import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as D,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",B,[i("div",y,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const P=g(f,[["render",x],["__scopeId","data-v-cf924cfa"]]),M=JSON.parse(`[{"page_url":"https://ro.wikipedia.org/wiki/Florentin,_Vidin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/%D0%A5%D1%80%D0%B0%D0%BC_%D0%92%D1%8A%D0%B7%D0%BD%D0%B5%D1%81%D0%B5%D0%BD%D0%B8%D0%B5_%D0%93%D0%BE%D1%81%D0%BF%D0%BE%D0%B4%D0%BD%D0%B5_%D0%B2_%D1%81%D0%B5%D0%BB%D0%BE_%D0%A4%D0%BB%D0%BE%D1%80%D0%B5%D0%BD%D1%82%D0%B8%D0%BD.JPG","page_title":"Florentin, Vidin","context_page_description":"Florentin este un sat în comuna Novo Selo, regiunea Vidin, Bulgaria. Localitatea a fost locuită compact de românii din Timocul bulgăresc."},{"page_url":"https://ceb.wikipedia.org/wiki/Achternock","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/AchternockSummitCross.jpg","page_title":"Achternock","context_page_description":"Bukid ang Achternock sa Italya. Nahimutang ni sa lalawigan sa Bolzano ug rehiyon sa Trentino-Alto Adige, sa amihanang bahin sa nasod, 600 km sa amihanan sa Rome ang ulohan sa nasod. 2,667 metros ibabaw sa dagat kahaboga ang nahimutangan sa Achternock, o 125 ka metros sa ibabaw sa naglibot nga tereyn. Mga 0.59 ka kilometro ang gilapdon sa tiilan niini.\\nAng yuta palibot sa Achternock kay kasagaran daghan kaayong kabukiran. Kinahabogang dapit sa palibot ang Grosser Fensterlekofel, 3,171 ka metros ni kahaboga ibabaw sa dagat, 2.1 km sa habagatan sa Achternock. Dunay mga 32 ka tawo kada kilometro kwadrado sa palibot sa Achternock medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Valle Aurina - Ahrntal, 10.4 km sa amihanan sa Achternock. Hapit nalukop sa kasagbotan ang palibot sa Achternock. Sa rehiyon palibot sa Achternock, kabukiran talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 0 °C. Ang kinainitan nga bulan Agosto, sa 10 °C, ug ang kinabugnawan Disyembre, sa -10 °C. Ang kasarangang pag-ulan 1,874 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 244 milimetro nga ulan, ug ang kinaugahan Disyembre, sa 104 milimetro."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B4%9D%E4%BC%8A%E5%A5%A5%E5%8D%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Map_of_Constantinople_%281422%29_by_Florentine_cartographer_Cristoforo_Buondelmonte.jpg","page_title":"贝伊奥卢","context_page_description":"贝伊奥卢是土耳其伊斯坦布尔的一个区，位于欧洲一侧，金角湾以北，与君士坦丁堡老城相望。它在中世纪称为佩拉，直到20世纪初土耳其共和国成立这个名称还很常用。\\n在中世纪，佩拉是热那亚和威尼斯商人的基地。1204年第四次十字军之后的拉丁帝国时期，威尼斯人占据优势。1273年，拜占庭皇帝将佩拉送给热那亚共和国，以回报热那亚的支持。佩拉成为繁荣的意大利殖民地，由一位执政官统治。1316年兴建了热那亚宫。1348年热那亚人修建了著名的加拉达石塔，为伊斯坦布尔的主要地标。热那亚人对佩拉的控制，直到1453年5月29日被奥斯曼帝国征服。\\n贝伊奥卢区通过跨越金角湾的加拉达桥和Unkapanı桥连接对岸的老城中心。\\n贝伊奥卢是伊斯坦布尔最活跃的艺术，娱乐和夜生活中心。\\n大部分领事馆位于贝伊奥卢：英国、德国、希腊、俄罗斯、荷兰、瑞典。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%82%AA%E3%83%87%E3%82%A3%E3%82%B15%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Demetrios_I_and_Laodike.jpg","page_title":"ラオディケ5世","context_page_description":"ラオディケ5世は、セレウコス朝の王女。"},{"page_url":"https://de.wikipedia.org/wiki/Michael_Kreuz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Hl_Rupert_Dez_1979.jpg","page_title":"Michael Kreuz","context_page_description":"Michael Kreuz entstammte einer Berchtesgadener Künstlerfamilie und war ein deutscher Holzbildhauer."},{"page_url":"https://es.wikipedia.org/wiki/Anna_Jean_Ayres","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Jean_Photos-1.jpg","page_title":"Anna Jean Ayres","context_page_description":"Anna Jean Ayres fue una terapeuta ocupacional americana, psicopedagoga y defensora de las personas con discapacidad. Se hizo conocida por su trabajo en la teoría de integración sensorial ​"},{"page_url":"https://ca.wikipedia.org/wiki/Sant_Gen%C3%ADs_de_Casavells","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Sant_Gen%C3%ADs_de_Casavells.JPG","page_title":"Sant Genís de Casavells","context_page_description":"L'església parroquial de Sant Genís de Casavells és un edifici romànic dins del nucli de Casavells, al municipi de Corçà, al Baix Empordà. És un monument protegit i inventariat dins el Patrimoni Arquitectònic Català."},{"page_url":"https://nl.wikipedia.org/wiki/Xubuntu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Xubuntu_18.04_live.png","page_title":"Xubuntu","context_page_description":"Xubuntu is een door Canonical erkende, op Ubuntu gebaseerde Linuxdistributie. Xubuntu gebruikt als desktopomgeving Xfce. Vandaar de X van Xubuntu. Xfce, en daarmee Xubuntu, zou minder capaciteit van een pc vergen dan andere Linuxdistributies, zoals GNOME, KDE, of Mate. Er zijn echter recensies die stellen dat dit niet altijd waar blijkt te zijn. Niettemin wordt Xubuntu vaak gezien als een desktopomgeving voor oudere hardware met minder werkgeheugen en minder rekenkracht.\\nNiettemin is Xubuntu een volwaardige desktopomgeving, en dus ook geschikt voor de nieuwste computers.\\nXubuntu wordt door de gemeenschap ondersteund en ontwikkeld. Xubuntu heeft als doel het uitbrengen van een Linuxdistributie die \\"gemakkelijk te gebruiken is, zich richt op integratie, gebruiksgemak en hoge prestaties, met verhoogde aandacht voor een laag geheugengebruik, gebaseerd op de waarden en idealen van Ubuntu.\\""},{"page_url":"https://sh.wikipedia.org/wiki/Mortiis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Mortiis-charlotte.jpg","page_title":"Mortiis","context_page_description":"Oslo, Norveška\\nMortiis, pravim imenom Håvard Ellefsen, je norveški glazbenik."},{"page_url":"https://en.wikipedia.org/wiki/Backpropagation","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/ArtificialNeuronModel_english.png","page_title":"Backpropagation","context_page_description":"In machine learning, backpropagation is a widely used algorithm in training feedforward neural networks for supervised learning. Generalizations of backpropagation exist for other artificial neural networks, and for functions generally – a class of algorithms referred to generically as \\"backpropagation\\". In fitting a neural network, backpropagation computes the gradient of the loss function with respect to the weights of the network for a single input–output example, and does so efficiently, unlike a naive direct computation of the gradient with respect to each weight individually. This efficiency makes it feasible to use gradient methods for training multilayer networks, updating weights to minimize loss; gradient descent, or variants such as stochastic gradient descent, are commonly used. The backpropagation algorithm works by computing the gradient of the loss function with respect to each weight by the chain rule, computing the gradient one layer at a time, iterating backward from the last layer to avoid redundant calculations of intermediate terms in the chain rule; this is an example of dynamic programming."},{"page_url":"https://cy.wikipedia.org/wiki/Troedwas_gyddfgoch","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Atolmis_rubricollis_02_%28HS%29.jpg","page_title":"Troedwas gyddfgoch","context_page_description":"Gwyfyn sy'n perthyn i urdd y Lepidoptera yw troedwas gyddfgoch, sy'n enw gwrywaidd; yr enw lluosog ydy troedweision gyddfgoch; yr enw Saesneg yw Red-necked Footman, a'r enw gwyddonol yw Atolmis rubricollis. Mae i'w ganfod yn Ewrop, Siberia a Tsieina.\\n25–35 mm ydy maint yr adenydd agored ac mae'n hedfan yn y nos rhwng Mai a Medi, yn ddibynol ar ei leoliad.\\nPrif fwyd y lindys ydy cen carreg ac algae."},{"page_url":"https://ru.wikipedia.org/wiki/121_%D0%B3%D0%BE%D0%B4_%D0%B4%D0%BE_%D0%BD._%D1%8D.","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/F%C3%A9lix_Auvray_Caio_Gracco.jpg","page_title":"121 год до н. э.","context_page_description":"Консулы: Луций Опимий и Квинт Фабий Максим Аллоброгик; преторы: Гай Атиний Лабеон Мацерион, Гай Скрибоний Курион, Квинт Марций Рекс и Марк Порций Катон; плебейские трибуны: Марк Минуций Руф и Мевий.\\nБеспорядки в Риме. Сторонники Гая Гракха укрепляются на Авентине. Консул Опимий использует войска, убито до 3000 человек. Гай Гракх и Марк Фульвий Флакк убиты.\\nГней Домиций Агенобарб проконсул Трансальпийской Галлии. Вместе с консулом Фабием Максимом по просьбе союзников Рима эдуев он выступает против кельтских племён аллоброгов и арвернов. Римская армия наносит им поражение. Римляне захватывают Южную Галлию, населённую аллоброгами, и превращают её в провинцию. Установление римского протектората над Массилией.\\nВ римской Галлии основан город Немауз."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%83%83%E3%82%AF%E3%82%B9%E3%83%BB%E3%83%9E%E3%83%83%E3%82%AB%E3%83%BC%E3%83%86%E3%82%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/DaxMcCarty.JPG","page_title":"ダックス・マッカーティ","context_page_description":"ダックス・マッカーティは、アメリカ合衆国・フロリダ州ウィンターパーク出身のプロサッカー選手。サッカーアメリカ合衆国代表。ナッシュビルSC所属。ポジションはMF。"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Chebu","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Cheb_-_Jate%C4%8Dn%C3%AD_%C4%8Dp._449.jpg","page_title":"Seznam kulturních památek v Chebu","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Cheb v okrese Cheb vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%8A%E3%82%BF%E3%83%8F%E3%83%B3%E3%81%AE%E5%A5%B3%E7%8E%8B%E4%BA%8B%E4%BB%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Anatahan_aerial.jpg","page_title":"アナタハンの女王事件","context_page_description":"アナタハンの女王事件とは1945年から1950年にかけて太平洋マリアナ諸島に位置する孤島アナタハン島で発生し、多くの謎を残した複数の男性の怪死事件。別名「アナタハン事件」「アナタハン島事件」。"},{"page_url":"https://de.wikipedia.org/wiki/Oberhessische_Zeitung_(Alsfeld)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Geb%C3%A4ude_OZ.jpg","page_title":"Oberhessische Zeitung (Alsfeld)","context_page_description":"Die Oberhessische Zeitung ist eine Lokalzeitung, die von Montag bis Samstag rund um Alsfeld erscheint. Berichtet wird aus den Gemeinden Alsfeld, Antrifttal, Feldatal, Gemünden, Grebenau, Homberg, Kirtorf, Romrod und Schwalmtal über politische, wirtschaftliche und gesellschaftliche Ereignisse.\\nGenau wie der Gießener Anzeiger, der Kreis-Anzeiger, der Lauterbacher Anzeiger, der Usinger Anzeiger und ehemals auch dem Gelnhäuser Tageblatt gehört die Oberhessische Zeitung zur Zeitungsgruppe Zentralhessen. Der Mantelteil all dieser Zeitungen wird vom Gießener Anzeiger gestaltet, während sich die Lokal- und Sportredaktion in Alsfeld befinden. Das bedeutet, das zweite Buch wird individuell gestaltet.\\nDie verkaufte Auflage beträgt 5459 Exemplare, ein Minus von 28,5 Prozent seit 1998."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%A7%E6%8B%89%E8%B5%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Neerach_Luftbild.jpg","page_title":"內拉赫","context_page_description":"内拉赫是瑞士联邦苏黎世州迪尔斯多夫区的市镇。该市镇面积为6.04平方千米，海拔高度449米，2018年12月31日人口数为3,176。"},{"page_url":"https://en.wikipedia.org/wiki/Brown-winged_kingfisher","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Brown-wingedKingfisher.jpg","page_title":"Brown-winged kingfisher","context_page_description":"The brown-winged kingfisher is a species of bird in the subfamily Halcyoninae.\\nIt is found along the north and eastern coasts of the Bay of Bengal, occurring in the countries of Bangladesh, India, Malaysia, Myanmar and Thailand. In India, it has been mainly reported from the Sundarbans region but records from further south near Chilka exist.\\nIts natural habitat is subtropical or tropical mangrove forests."},{"page_url":"https://en.wikipedia.org/wiki/Nurse_shark","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Ginglymostoma_cirratum_teeth_1.jpg","page_title":"Nurse shark","context_page_description":"The nurse shark is an elasmobranch fish within the family Ginglymostomatidae. The conservation status of the nurse shark is globally assessed as being data deficient in- the IUCN List of Threatened Species owing to the lack of information across its range in the eastern Pacific Ocean and eastern Atlantic Ocean. They are considered to be a species of least concern in the United States and in The Bahamas, but considered to be near threatened in the western Atlantic Ocean because of their vulnerable status in South America and reported threats throughout many areas of Central America and the Caribbean. They are directly targeted in some fisheries and considered as bycatch in others.\\nNurse sharks are an important species for shark research. They are robust and able to tolerate capture, handling, and tagging extremely well. As inoffensive as nurse sharks may appear, they are ranked fourth in documented shark bites on humans, likely due to incautious behavior by divers on account of the nurse shark's slow, sedentary nature."},{"page_url":"https://hu.wikipedia.org/wiki/II._Nab%C3%BA-kudurri-uszur","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Nebukadnessar_II.jpg","page_title":"II. Nabú-kudurri-uszur","context_page_description":"II. Nabú-kudurri-uszur az Újbabiloni Birodalom második, legismertebb királya volt; a Biblia ószövetségi könyveiben Nebukadneccár, Nabukodonozor néven szerepel, ismert még Nabukkó néven is. Kr. e. 607 óta segítette apját, Nabú-apal-uszurt a hadvezetésben, és nagy sikereket aratott az Egyiptom elleni harcokban. Először Kr. e. 614-ben hallunk róla, amikor feleségül vette a méd Uvakhsatra király lányát, Amütiszt, megpecsételve ezzel a megalakuló birodalom és a hódító nép szövetségét."},{"page_url":"https://id.wikipedia.org/wiki/Daftar_gereja_tituler_di_Roma","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Trastevere_-_sant%27Onofrio_-_chiostro_esterno_3108-10.JPG","page_title":"Sant'Onofrio (Roma)","context_page_description":"Sant'Onofrio al Gianicolo adalah sebuah gereja tituler di Trastevere, Roma. Gereja tersebut adalah gereja resmi ordo kesatria kepausan Ordo Makam Kudus. Sebuah kapel samping didedikasikan khusus untuk Ordo tersebut dan mantan grand master, Nicola Canali dimakamkan disana."},{"page_url":"https://sk.wikipedia.org/wiki/Velk%C3%BD_%C3%9Ajezd_(okres_Olomouc)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Velky_Ujezd_CoA_CZ.jpg","page_title":"Velký Újezd (okres Olomouc)","context_page_description":"Velký Újezd je obec v Česku v okrese Olomouc v Olomouckom kraji. 1. januára 2012 tu žilo 1 277 obyvateľov, z toho 630 mužov a 647 žien, pričom priemerný vek v obci bol 39,2 roka."},{"page_url":"https://fr.wikipedia.org/wiki/Hirson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Hirson_-_%C3%A9cole_primaire_sup%C3%A9rieure_de_jeunes_filles.jpg","page_title":"Hirson","context_page_description":"Hirson est une commune française, située dans le département de l'Aisne en région Hauts-de-France.\\nSes habitants s'appellent les Hirsonnais et les Hirsonnaises."},{"page_url":"https://de.wikipedia.org/wiki/Sainte-Luce_(Martinique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Sainte-Luce_view_over_town.JPG","page_title":"Sainte-Luce (Martinique)","context_page_description":"Sainte-Luce ist eine französische Gemeinde im Übersee-Département Martinique mit 9943 Einwohnern. Sie gehört administrativ zum Arrondissement Le Marin. Die Bewohner nennen sich Lucéens. Sainte-Luce war bis zu dessen Auflösung 2015 Hauptort des gleichnamigen Kantons."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%98%8E%E6%9C%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/British_Museum_Ming_banknote.jpg","page_title":"明朝","context_page_description":"明朝是中国历史上最后一个由汉人建立的大一统王朝，历经十二世、十六位皇帝，国祚二百七十六年。\\n元朝末年政治腐败，天灾不断，民不聊生，民变暴动屡禁不止，朱元璋加入红巾军并在其中乘势崛起，跟随占据濠州的郭子兴。郭子兴死后，朱元璋被当时反抗军拥立的小明王韩林儿封为左副元帅，并率部众先后攻占滁州、和州等地，并最终攻占集庆，采取朱升所建议的“高筑墙，广积粮，缓称王”的政策，以巩固根据地，让士兵屯田积粮减少百姓负担，以示自己为仁义之师而避免受敌。1364年，朱元璋称吴王，建立西吴政权。1368年，在扫灭陈友谅、张士诚和方国珍等群雄势力后，朱元璋于当年农历正月初四日登基称帝，立国号为大明，并定都应天府，其辖区称为京师，由因皇室姓朱，因此又称朱明。后以“驱逐胡虏，恢复中华”为号召北伐中原，少数民族政权统治四百年的燕云十六州也被汉族政权收回，结束蒙元在中国汉地的统治，统一天下。明初天下大定，经过朱元璋的休养生息，社会经济得以恢复和发展，国力迅速恢复，史称洪武之治。朱元璋去世后，其孙朱允炆即位，但其在靖难之役中败于驻守燕京的朱元璋第四子朱棣，也自此失踪。朱棣登基后迁都至顺天府，将北平布政司升为京师，原京师改称南京。成祖朱棣时期，开疆拓土，又派遣郑和七下西洋，此后许多汉人远赴海外，国势达到顶峰，史称永乐盛世。其后的仁宗和宣宗时期国家仍处于兴盛时期，史称仁宣之治。英宗和代宗时期，遭遇土木之变，国力中衰，经于谦等人抗敌，最终解除国家危机。宪宗和孝宗相继与民休息，孝宗则力行节俭，减免税赋，百姓安居乐业，史称弘治中兴。武宗时期爆发了南巡之争和宁王之乱。世宗即位初，引发大礼议之争，他清除宦官和权臣势力后总揽朝纲，实现嘉靖中兴，并于屯门海战与西草湾之战中击退葡萄牙殖民侵略，任用胡宗宪和俞大猷等将领平定东南沿海的倭患。世宗驾崩后经过隆庆新政国力得到恢复，神宗前期任用张居正，推行万历新政，国家收入大增，商品经济空前繁荣、科学巨匠迭出、社会风尚呈现出活泼开放的新鲜气息，史称万历中兴。后经过万历三大征平定内忧外患，粉碎丰臣秀吉攻占朝鲜进而入明的计划，然而因为国本之争，皇帝逐渐疏于朝政，史称万历怠政，同时东林党争也带来了明中期的政治混乱。\\n万历一朝成为明朝由盛转衰的转折期。光宗继位不久因红丸案暴毙，熹宗继承大统改元天启，天启年间魏忠贤阉党祸乱朝纲，至明思宗即位后铲除阉党，但阉党倒台后，党争又起，政治腐败以及连年天灾，导致国力衰退，最终爆发大规模民变。1644年4月25日，李自成所建立的大顺军攻破北京，思宗自缢于煤山，是为甲申之变。随后吴三桂倒戈相向，满清入主中原。"},{"page_url":"https://ca.wikipedia.org/wiki/Murchante","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Fiestas_murchante.jpg","page_title":"Murchante","context_page_description":"Murchante és un municipi de Navarra, a la comarca de Tudela, dins la merindad de Tudela. Limita al nord i oeste amb Tudela i al sud i est amb Cascante."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D1%80%D0%B5%D0%B2%D0%BD%D0%B5%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D1%85_%D0%B0%D1%80%D1%85%D0%B8%D1%82%D0%B5%D0%BA%D1%82%D1%83%D1%80%D0%BD%D1%8B%D1%85_%D1%81%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%BD%D0%B8%D0%B9_%D0%B4%D0%BE%D0%BC%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BF%D0%B5%D1%80%D0%B8%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Nikolsky_Cathedral.jpg","page_title":"Список древнерусских архитектурных сооружений домонгольского периода","context_page_description":"В списке древнерусских архитектурных сооружений домонгольского периода представлены древнерусские архитектурные памятники, возведённые до монгольского нашествия и сохранившиеся до конца XIX века.\\nДля каждой постройки указаны наименование, местонахождение, время возведения, степень сохранности, фотография. Для удобства список разбит по историко-географическому принципу. Несохранившиеся постройки выделены серым цветом."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdische_Gemeinde_Warendorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Paul_Spiegel.jpg","page_title":"Jüdische Gemeinde Warendorf","context_page_description":"Die Jüdische Gemeinde Warendorf bestand ungefähr vom 14. Jahrhundert bis 1941. Von 1945 bis 1947 entstand die Gemeinde in Ansätzen neu, als die Überlebenden des Holocausts aus dem Münsterland in Warendorf Gottesdienste feierten.\\nWährend ihrer Blütezeit von der Mitte des 17. bis zum ausgehenden 19. Jahrhundert war die Jüdische Gemeinde Warendorf eine der bedeutendsten im Münsterland mit einem herausragenden Stellenwert für ganz Westfalen. Bis heute gehört sie deutschlandweit zu den bekannteren ehemaligen jüdischen Landgemeinden, insbesondere deshalb, weil Paul Spiegel, bis zu seinem Tod 2006 Präsident des Zentralrats der Juden in Deutschland, aus Warendorf kam."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1991","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/20180610_FIFA_Friendly_Match_Austria_vs._Brazil_Danilo_Luiz_850_1591.jpg","page_title":"Lijst van personen geboren in 1991","context_page_description":"Dit is een lijst van personen die geboren zijn in 1991.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Tailfinger_Ried","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/NSG_Tailfinger_Ried_01.jpg","page_title":"Tailfinger Ried","context_page_description":"Tailfinger Ried ist ein mit Verordnung des Regierungspräsidiums Tübingen vom 10. Mai 1991 ausgewiesenes Naturschutzgebiet mit der Nummer 4.190."},{"page_url":"https://it.wikipedia.org/wiki/Conquista_islamica_della_Persia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Sassanid_army_helmet_by_Nickmard_Khoey.jpg","page_title":"Conquista islamica della Persia","context_page_description":"La conquista islamica della Persia segnò una svolta decisiva nella storia di questo Paese. Nel volgere di alcuni secoli la maggioranza dei Persiani abbandonò lo Zoroastrismo e divenne musulmana, mentre le caratteristiche della civiltà persiana venivano assorbite dalla nuova classe dirigente islamica. La rapida conquista della Persia in una serie di ben coordinati attacchi su più fronti, diretta dal Califfo ʿUmar da Medina, contribuì alla reputazione del califfo di grande stratega militare e politico."},{"page_url":"https://it.wikipedia.org/wiki/Something","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/The_White_Album.svg","page_title":"Something","context_page_description":"Something è un brano musicale dei Beatles, composto da George Harrison nel 1969. Fu inclusa nell'album Abbey Road e fu la prima canzone scritta da Harrison ad apparire sul lato A di un singolo dei Beatles. Fu anche uno dei primi singoli dei Beatles a contenere tracce già disponibili in un album long playing, con Something e Come Together entrambe già apparse su Abbey Road. Something fu l'unico brano dei Beatles scritto da George Harrison a raggiungere la vetta delle classifiche americane.\\nJohn Lennon e Paul McCartney, i principali compositori della band, elogiarono Something come una tra le migliori canzoni che Harrison avesse mai scritto, o che il gruppo avesse mai offerto; Lennon dichiarò persino che era la «canzone migliore presente su Abbey Road», mentre McCartney la considera tuttora «la miglior canzone di Harrison in assoluto». Oltre al buon successo di critica, il singolo ottenne anche un riscontro commerciale enorme, piazzandosi al primo posto della Billboard Hot 100 negli Stati Uniti, in Canada per quattro settimane, al secondo in Norvegia ed entrando nella Top 10 del Regno Unito."},{"page_url":"https://nl.wikipedia.org/wiki/Scheepsregister","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Rozenburgsesluis_juli_2007.jpg","page_title":"Scheepsregister","context_page_description":"Het scheepsregister is een onderdeel van het kadaster. Het systeem van teboekstellen in een kadastraal register met op verzoek weer verstrekken van uittreksels uit dit register is opgezet ten behoeve van de rechtszekerheid in het maatschappelijk verkeer. Over het algemeen wordt onderscheid gemaakt tussen zeeschepen, vissersschepen en binnenschepen. Volgens artikel 91 van het VN-zeerechtverdrag mag elke staat schepen registreren waarmee het schip de nationaliteit van dat land verkrijgt en het recht de vlag daarvan te voeren.\\nNa de privaatrechtelijke registratie van een zeeschip, veelal teboekstelling genoemd, waarbij eigendom, hypotheek en andere zakelijke rechten gekoppeld worden, volgt de publiekrechtelijke fase waarin een zeebrief wordt verstrekt."},{"page_url":"https://en.wikipedia.org/wiki/Kern_County_Raceway_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Brian_Richardson.JPG","page_title":"Kern County Raceway Park","context_page_description":"Kern County Raceway Park is a 0.5-mile oval speedway located on CA 43 just off Interstate 5 in Bakersfield, Kern County, California, United States. Opened in 2013, it was built as a replacement for Mesa Marin Raceway.\\nKern County Raceway Park hosts events with NASCAR's Whelen All-American Series along with a K&N Pro Series West race since 2013.\\nThe track has banks of 8° in the straightaways, with 14° paved corners. The track has 5,000 seats for fans, and room to expand to 17,000 seats for various events. It also contains 21 suites in the grandstand along with 18 concession stands.\\nThe property also contains a 0.33-mile asymmetrical clay oval track, just north of the paved oval. Turns 1-2 are tighter than turns 3-4. The first event for this track was September 4, 2015. Northwest of the track is also a motocross motorcycle track."},{"page_url":"https://en.wikipedia.org/wiki/Police_vehicles_in_New_York_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Police_and_TV_camers_outside_Trump_Tower_%2827252687294%29.jpg","page_title":"Police vehicles in New York City","context_page_description":"The New York City Police Department vehicle fleet consists of 9,624 police cars, 11 boats, eight helicopters, and numerous other vehicles. Responsibility of operation and maintenance lies with the NYPD's Support Services Bureau.\\nThe current colors of NYPD vehicles is an all-white body with two blue stripes along each side. The word \\"POLICE\\" is printed in small text above the front wheel wells, and as \\"NYPD Police\\" above the front grille. The NYPD patch is emblazoned on both sides, either on or just forward of the front doors. The letters \\"NYPD\\" are printed in blue Rockwell Extra Bold font on the front doors, and the NYPD motto \\"Courtesy, Professionalism, Respect\\" is printed on the rear ones. The unit's shop number is printed on the rear decklid. The shop number is also printed on the rear side panels above the gas intake, along with the number of the unit's assigned precinct.\\nA modified paint scheme, with dark blue body and white stripes on the sides was used for some divisions. The text was also white. This was phased out in favor of a modified version of the regular scheme, with the word \\"AUXILIARY\\", \\"SCHOOL SAFETY\\" or \\"TRAFFIC\\" on the rear quarter panels and trunk."},{"page_url":"https://fr.wikipedia.org/wiki/Auge_(r%C3%A9cipient)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Notre-Dame-de-la-Vie_fontaine_miraculeuse.jpg","page_title":"Auge (récipient)","context_page_description":"Une auge est un récipient de forme rectangulaire."},{"page_url":"https://de.wikipedia.org/wiki/Klappert%C3%B6pfe","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Yellow-rattle_close_700.jpg","page_title":"Klappertöpfe","context_page_description":"Die Klappertöpfe bilden eine Pflanzengattung innerhalb der Sommerwurzgewächse. Die 45 bis 50 Arten leben als Halbschmarotzer. Das weite Verbreitungsgebiet der Gattung ist Nordamerika und Eurasien, also die Holarktis."},{"page_url":"https://pt.wikipedia.org/wiki/Tapira%C3%AD_(S%C3%A3o_Paulo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Bandeira-tapira%C3%AD.png","page_title":"Tapiraí (São Paulo)","context_page_description":"Tapiraí é um município do estado de São Paulo, no Brasil. Localiza-se na Região Metropolitana de Sorocaba, na Mesorregião Macro Metropolitana Paulista e na Microrregião de Piedade, também possui território na região do Vale do Ribeira. Localiza-se a uma latitude 23º57'49\\" Sul e a uma longitude 47º30'26\\" Oeste, estando a uma altitude de 920 metros. Tinha 10 666 habitantes em 2006, e 7 991 em 2009. Em 2018, o Instituto Brasileiro de Geografia e Estatística estimou sua população em 7 850 habitantes. O município é formado pela sede e pelo distrito de Rio Turvo."},{"page_url":"https://it.wikipedia.org/wiki/Servizio_navale_della_Guardia_di_Finanza","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Gdf_nave_scuola_giorgio_cini.jpg","page_title":"Servizio navale della Guardia di Finanza","context_page_description":"Il Servizio navale della Guardia di Finanza è un servizio della Guardia di Finanza che ha lo scopo di contrastare il contrabbando marittimo e i traffici illeciti mediante l'esplorazione navale, in particolare il grande traffico internazionale di droga. Esercita inoltre le funzioni di polizia economica e finanziaria in mare.\\nÈ integrato nel Comando Operativo Aeronavale, con sinergia tra componente navale e componente aerea.\\nDipende dal Comando Generale della Guardia di Finanza - V Reparto, con sede a Roma.\\nConta di 4.502 unità di personale con 373 mezzi."},{"page_url":"https://fr.wikipedia.org/wiki/Arles_sous_le_gouvernement_des_podestats","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Blason_Baux_de_Provence.svg","page_title":"Arles sous le gouvernement des podestats","context_page_description":"Arles sous le gouvernement des podestats est une période très brève, au début du XIIIᵉ siècle, de l'histoire de la cité rhodanienne. Le gouvernement des podestats est une forme de gouvernement communal mis en place en 1220 et succédant au consulat, instauré un siècle plus tôt. Il correspond à un nouvel et précaire équilibre des forces communales en relation avec l'environnement politique complexe de l'époque, apportant principalement des limitations aux prérogatives de l’archevêque.\\nLa podestarie est créée à l'image de celles de l'Italie voisine avec qui la cité arlésienne entretient de nombreux contacts. Ce mode d'administration se traduit par le fait de confier la conduite de la ville à un personnage appelé podestat, véritable gouverneur de la cité. Il s'agit généralement d'un étranger — plus précisément d'un Italien — non lié aux factions arlésiennes, recruté et renouvelé chaque année pour assurer un gouvernement neutre ; il est muni de pouvoirs temporaires mais toutefois très étendus."},{"page_url":"https://nl.wikipedia.org/wiki/North_American_X-15","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Pilot_Neil_Armstrong_and_X-15_-1_-_GPN-2000-000121.jpg","page_title":"North American X-15","context_page_description":"Het X-15 raketvliegtuig was een van de belangrijkste experimentele vliegtuigen van USAF/NASA. De X-15 brak talrijke snelheids- en hoogterecords in de jaren 60 en leverde een grote hoeveelheid gegevens op, die nog decennialang gebruikt werden bij het ontwerp van nieuwere ruimtevaartuigen."},{"page_url":"https://en.wikipedia.org/wiki/Utopia_Tour_(Bj%C3%B6rk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Bjork_APEVicPark270518-99_%2842563937162%29.jpg","page_title":"Utopia Tour (Björk)","context_page_description":"The Utopia Tour was the ninth concert tour by Icelandic musician Björk, centering on her 2017 studio album, Utopia. The tour kicked off with 2 special stage rehearsals on 9 and 12 April 2018 at the Háskólabío Theater in Iceland before touring Europe. Utopia's live presentation later evolved into Cornucopia, a theatrical stage concert with enhanced visual and sound presentations which opened at The Shed in New York City on 6 May 2019."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%D0%91%D1%80%D0%B0%D1%83%D0%BD_%D0%98%D0%B2%D0%B0%D0%BD_%D0%9E%D1%81%D0%B8%D0%BF%D0%BE%D0%B2%D0%B8%D1%87.png","page_title":"Императорский Казанский университет","context_page_description":"Императорский Казанский университет — один из двенадцати Императорских университетов Российской империи."},{"page_url":"https://no.wikipedia.org/wiki/Stortorvet_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Christiania_bank_og_kreditkasse_ved_Stortorvet.jpg","page_title":"Stortorvet (Oslo)","context_page_description":"Stortorvet eller Stortorget er et torg i sentrum av Oslo. I 1736 overtok det som byens sentraltorg etter Christiania gamle torg og det har siden dengang vært en viktig del av det offentlige rom i Oslo. Det har fungert som møteplass og sosialisering for byens befolkning, som handelsplass og som trafikknutepunkt. Når veiavstander til Oslo vises på veiskilt, er avstanden målt til Stortorget. Torget er Oslos blomstertorg, og er representert i den norske utgaven av Monopol.\\nRundt torget ligger blant annet Oslo domkirke med adresse Stortorvet nr. 1, Christiania Glasmagasin i nr. 9 og Stortorvets Gjæstgiveri som ikke har adresse til torget, men Grensen 1."},{"page_url":"https://pt.wikipedia.org/wiki/Guia_de_onda_circular","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/E_TM23.jpg","page_title":"Guia de onda circular","context_page_description":"Guias de onda são estruturas que direcionam a propagação de ondas, sejam estas sonoras ou eletromagnéticas, sendo a discussão deste artigo sobre as do último tipo. Essas guias são, de forma geral, canaletas retangulares ou cilindros metálicos ocos usados na transmissão de ondas eletromagnéticas de alta frequência. No caso em que possuem seção transversal constante, são denominadas guias de onda uniformes, sendo a guia de onda circular aquela cuja seção é um círculo."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B0%91%E5%9C%8B%E5%90%8D%E4%BA%BA%E5%9C%96%E9%91%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/%E5%90%B3%E6%9B%BE%E6%84%88.jpg","page_title":"民國名人圖鑑","context_page_description":"《民國名人圖鑑》，楊家駱編，民國26年辭典館出版。此書按四角號碼檢字法排列人名，計劃出版四冊，第一冊是0-1號碼，第二冊是2-3號碼，第三冊是4號碼，第四冊是5-9號碼及總目、索引。但是只出版了第一、二冊，每冊前面是肖像、後面是小傳。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D8%B1%D9%88_%D8%A8%D8%A7%D8%B1%D9%8A%D9%85%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Drew_Barrymore_Berlin_2014.jpg","page_title":"درو باريمور","context_page_description":"درو باريمور ‏ ممثلة أمريكية، ولدت في لوس أنجليس في الولايات المتحدة الأمريكية."},{"page_url":"https://sv.wikipedia.org/wiki/Svartvit_sydhake","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Poecilodryas_hypoleuca.jpg","page_title":"Svartvit sydhake","context_page_description":"Svartvit sydhake är en fågel i familjen sydhakar inom ordningen tättingar. IUCN kategoriserar arten som livskraftig.\\nSvartvit sydhake delas in i tre underarter:\\nPoecilodryas hypoleuca steini – förekommer på Waigeo Island\\nPoecilodryas hypoleuca hypoleuca – förekommer från västra Nya Guinea till Port Moresby-området samt de västpapuanska öarna\\nPoecilodryas hypoleuca hermani – förekommer på norra Nya Guinea"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B0%D0%BD%D0%B8%D0%BB%D0%BE_%D0%93%D1%80%D0%B1%D0%B8%D1%9B","image_url":"http://upload.wikimedia.org/wikipedia/sr/8/83/Izvestaj_trnovo.jpg","page_title":"Данило Грбић","context_page_description":"Данило Грбић капетан II класе, пилот Југословенског краљевског ратног ваздухопловства погинуо је 6. априла 1941. године у одбрани Краљевине Југославије од немачких бомбардера."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/L327%2C_Moldova_-_panoramio.jpg","page_title":"Оргеевский район","context_page_description":"Орге́евский райо́н — административно-территориальная единица Республики Молдова."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%87%CE%BF%CE%B9%CE%BD%CE%AF_%CE%B1%CF%80%CE%BB%CF%8E%CE%BC%CE%B1%CF%84%CE%BF%CF%82_%CF%81%CE%BF%CF%8D%CF%87%CF%89%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Retractable_clothes_line_2.JPG","page_title":"Σχοινί απλώματος ρούχων","context_page_description":"Σχοινί απλώματος ρούχων ή απλούστερα σχοινί απλώματος, ονομάζεται ένα απλό οικιακό εργαλείο, το οποίο αποτελείται από ένα σχοινί που βρίσκεται τεντωμένο σε εξωτερικό είτε σε εσωτερικό χώρο, ψηλότερα από το έδαφος, ώστε πάνω του να απλωθούν ρούχα για στέγνωμα με μανταλάκια.\\nΤο σχοινί απλώματος ρούχων είναι επίσης όνομα γενικής χρήσης προϊόντων και αφορά είτε συσκευασμένα κομμάτια σχοινιού μικρού σχετικά μήκους τα οποία διατίθενται στη λιανική αγορά μέσα από καταστήματα που απευθύνονται στους καταναλωτές, όπως σούπερ-μάρκετ είτε πλήρη προϊόντα που περιλαμβάνουν μηχανισμό αυτόματης έλξης του σχοινιού και άγκιστρο, σχεδιασμένα για εσωτερικούς χώρους."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%AA%E3%82%A6%E3%82%B9%E7%B4%9A%E6%88%A6%E9%97%98%E7%B5%A6%E7%B3%A7%E8%89%A6","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Spica%28T-AFS-9%29-01.jpg","page_title":"シリウス級戦闘給糧艦","context_page_description":"シリウス級戦闘給糧艦は、アメリカ海軍が運用していた補給艦の艦級。イギリス海軍補助艦隊が運用していたネス型給糧艦を購入したものであった。"},{"page_url":"https://nl.wikipedia.org/wiki/Thoisy-le-D%C3%A9sert","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Map_commune_FR_insee_code_21630.png","page_title":"Thoisy-le-Désert","context_page_description":"Thoisy-le-Désert is een gemeente in het Franse departement Côte-d'Or en telt 187 inwoners. De plaats maakt deel uit van het arrondissement Beaune."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen,_Pl%C3%A4tze_und_Br%C3%BCcken_in_Hamburg-Borgfelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Beim_Gesundbrunnen.jpg","page_title":"Liste der Straßen, Plätze und Brücken in Hamburg-Borgfelde","context_page_description":"Die Liste der Straßen, Plätze und Brücken in Hamburg-Borgfelde ist eine Übersicht der gegenwärtig im Hamburger Stadtteil Borgfelde vorhandenen Straßen, Plätze und Brücken. Sie ist Teil der Liste der Verkehrsflächen in Hamburg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%83%D1%81%D1%82%D0%BE%D1%80%D1%84-%D0%B0%D0%BD-%D0%B4%D0%B5%D1%80-%D0%A0%D0%BE%D1%82%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Marienkirche_Ruhstorf.JPG","page_title":"Русторф-ан-дер-Ротт","context_page_description":"Русторф-ан-дер-Ротт — громада в Німеччині, знаходиться в землі Баварія. Підпорядковується адміністративному округу Нижня Баварія. Входить до складу району Пассау.\\nПлоща — 51,39 км². Населення становить 6938 ос."},{"page_url":"https://it.wikipedia.org/wiki/Sergej_L%27vovi%C4%8D_Pu%C5%A1kin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/S.L._Pushkin.jpg","page_title":"Sergej L'vovič Puškin","context_page_description":"Sergej L'vovič Puškin, in russo: Сергей Львович Пушкин, è stato un ufficiale russo."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_Khitans","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/KaraKhitaiAD1200.png","page_title":"History of the Khitans","context_page_description":"The history of the Khitans dates back to the 4th century. The Khitan people dominated much of Mongolia and modern Manchuria by the 10th century, under the Liao dynasty, and eventually collapsed by 1125.\\nOriginally from Xianbei origins they were part of the Kumo Xi tribe until 388 when the Kumo Xi-Khitan tribal grouping was defeated by the newly established Northern Wei. This allowed the Khitan to organize and consolidate their own tribe and entity which led to the beginning of Khitan written history.\\nFrom the 5th to the 8th centuries the Khitan were dominated by the steppe powers to their West the Turks and then the Uyghurs. The Chinese also came from the south. In some cases they were under Korean domination according to the balance of power at any given time. Under this triple domination the Khitan started to show growing power and independence. Their rise was slow compared to others because they were frequently crushed by neighbouring powers—each using the Khitan warriors when needed but ready to crush them when the Khitans became too powerful."},{"page_url":"https://nl.wikipedia.org/wiki/Amstel_(rivier)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Amstel_near_Nes.jpg","page_title":"Amstel (rivier)","context_page_description":"De Amstel is een gekanaliseerde rivier in het zuiden van Noord-Holland, voor een deel op de grens van Noord-Holland met Zuid-Holland en Utrecht. Het gebied langs de rivier wordt aangeduid als Amstelland. Amsterdam heeft zijn naam te danken aan de Amstel."},{"page_url":"https://es.wikipedia.org/wiki/La_Reina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Aerodromo_tobalaba_2.JPG","page_title":"La Reina","context_page_description":"La Reina es una comuna del sector nororiente de la ciudad de Santiago, capital de Chile. Limita al norte y al este con Las Condes, al sur con Peñalolén y al oeste con Providencia y Ñuñoa.\\nLa Reina es reconocida por su imagen de comuna parque: baja densidad poblacional y abundante arborización. Además, la comuna, producto de su plano regulador, tiene pocas construcciones en altura, lo que le permite mantener su carácter netamente residencial.\\nSu población es heterogénea, compuesta por grupos socioeconómicos medio-altos y altos en las zonas norte y oriente de la comuna, este último principalmente en La Reina Alta, mientras que de ingresos medios y bajos en la zona sur, especialmente en la población Villa La Reina."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D9%84%D9%86%D8%AF%DB%8C%D9%84_(%DA%A9%D8%A7%D9%84%DB%8C%D9%81%D8%B1%D9%86%DB%8C%D8%A7)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/The_Americana_at_Brand.jpg","page_title":"گلندیل (کالیفرنیا)","context_page_description":"گلندیل یک شهر در ایالات متحده آمریکا است که در شهرستان لس‌آنجلس، کالیفرنیا واقع شده‌است.\\nدر دهه ۱۹۷۰ میلادی با بلند شدن موج ملی‌گرایی عرب در مصر و سوریه و اسلام‌گرایی در ایران، و آغاز جنگ داخلی در لبنان، که مراکز مهم سکونت ارامنه بودند، هزاران تن از آن‌ها خاورمیانه را به مقصد غرب به خصوص آمریکا ترک کردند و خیلی از آن‌ها در بخش‌هایی از لس آنجلس بزرگ ساکن شدند. براساس برخی تخمین‌ها اکنون ۴۰ درصد جمعیت گلندل را ارامنه تشکیل می‌دهند. تعداد زیاد دیگری در شهرهای اطراف از جمله بربنک، هالیوود، پاسادینا، فرزنو، مونتبلو، هالیوود شمالی و حتی محله‌ای که «ارمنستان کوچک» نام گرفته زندگی می‌کنند. سه عضو از پنج عضو شورای شهر گلندیل از ارمنیان می‌باشند."},{"page_url":"https://fr.wikipedia.org/wiki/Luthrodes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Chilades_pandava_peripatria_ventral_view_20140921.jpg","page_title":"Luthrodes","context_page_description":"Luthrodes est un genre de lépidoptères de la famille des Lycaenidae et de la sous-famille des Polyommatinae."},{"page_url":"https://en.wikipedia.org/wiki/Multipolar_exchange_interaction","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Flipping_the_phases_of_multipoles.png","page_title":"Multipolar exchange interaction","context_page_description":"Magnetic materials with strong spin-orbit interaction, such as: LaFeAsO, PrFe₄P₁₂, YbRu₂Ge₂, UO₂, NpO₂, Ce1−xLaₓB₆, URu₂Si₂ and many other compounds, are found to have magnetic ordering constituted by high rank multipoles, e.g. quadruple, octople, etc. Due to the strong spin-orbit coupling, multipoles are automatically introduced to the systems when the total angular momentum quantum number J is larger than 1/2. If those multipoles are coupled by some exchange mechanisms, those multipoles could tend to have some ordering as conventional spin 1/2 Heisenberg problem. Except the multipolar ordering, many hidden order phenomena are believed closely related to the multipolar interactions"},{"page_url":"https://ca.wikipedia.org/wiki/Lepidocephalichthys","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/LepidocephalichthysGuntea.png","page_title":"Lepidocephalichthys","context_page_description":"Lepidocephalichthys és un gènere de peixos actinopterigis de la família dels cobítids."},{"page_url":"https://hu.wikipedia.org/wiki/Francisco_Serrano","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/El_capit%C3%A1n_general_Francisco_Serrano%2C_duque_de_la_Torre.jpg","page_title":"Francisco Serrano","context_page_description":"Francisco Serrano, de la Torre hercege, spanyol katonai vezető, politikus."},{"page_url":"https://da.wikipedia.org/wiki/Frederiksort","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Frederiksort.png","page_title":"Frederiksort","context_page_description":"Frederiksort eller Friedrichsort er en bydel i Kiel beliggende ved indløbet til Kiel Fjord i den sydøstlige del af halvøen Jernved.\\nI 1590 blev en lille landtunge på fjordens slesvigske bred første gang nævnt som Prisort. Stednavnets første led refererer til landsbyen Pris, den sidste led -ort betegner en mindre fremspring på en kyst og kendes også fra andre danske og tyske stednavne. For at beskytte den smalle indløb i fjorden byggede Christian 4. 1632 her en lille fæstning, som han efter sig kaldte Christianspris. Efter afståelsen af Skånelandene 1658 og Københavnerfreden 1660 fornyede Frederik 3. 1663 fæstningen og kaldte dem efter sig selv Frederiksort. I 1864 rådede fæstningsbyen allerede over 71 indbyggere, blandt dem også fæstningens besætning og deres familier. Efter den 2. Slesvigske krig 1864 kom fæstningsbyen i preussisk eje. Preusserne byggede på stedet en stor marinestation og rev mange af de hidtil danske fæstningsbygninger ned. Byen begyndte at vokse og i 1922 blev Frederiksort og den nærliggende landsby Pris endelig indlemmet i den ellers holstenske by Kiel. Efterhånden voksede Pris og Frederiksort helt sammen til en sammenhængende bydel."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%B5%D0%BB%D0%B7%D0%B5%D0%BD%D0%BA%D0%B8%D1%80%D1%85%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Gelsenkirchen_Altstadt_Panorama.jpg","page_title":"Гелзенкирхен","context_page_description":"Гелзенкирхен е 11-ият по големина град в най-населената федерална област в Германия Северен Рейн-Вестфалия и неговите 260 654 жители го правят 25-и по големина град в Германия. Разположен на река Емшер, градът се намира в центъра на Рур, най-голямата агломерация в Германия, в която е петият по големина град след Дортмунд, Есен, Дуисбург и Бохум. Рурската област се намира в урбанизирания район Рейн-Рур, един от най-големите в Европа. Гелзенкирхен е петият по големина град във Вестфалия след Дортмунд, Бохум, Билефелд и Мюнстер и е един от най-южните градове в зоната, където се говори долносаксонски език. Градът е дом на футболния клуб Шалке 04, който носи името на едноименния квартал. Стадионът на клуба, Фелтинс Арена, обаче се намира в квартал Ерле.\\nГелзенкирхен за първи път е документиран през 1150 г., но той остава мъничко село до 19 век, когато Индустриалната революция доведе до разрастване на цялата област. През 1840 г., когато е започнал добивът на въглища, 6000 жители живеят в Гелзенкирхен, а през 1900 г. населението се е увеличило до 138 000. В началото на 20 век Гелзенкирхен е бил най-важният град за добив на въглища в Европа."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%B1%D0%B0%D1%81%D1%8C%D0%B5%D0%B2,_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%92%D0%B8%D0%BA%D1%82%D0%BE%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/%D0%9A%D0%BE%D0%BB%D0%B1%D0%B0%D1%81%D1%8C%D0%B5%D0%B2_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%92%D0%B8%D0%BA_%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D0%BD%D0%B0_2-%D0%B3%D0%BE_%D1%80%D0%B0%D0%BD%D0%B3%D0%B0._~1910-1915%D0%B3%D0%B3._e1.jpg","page_title":"Колбасьев, Евгений Викторович","context_page_description":"Евгений Викторович Колба́сьев — русский изобретатель в области военно-морского дела, преподаватель Кронштадтской водолазной школы, капитан 1-го ранга."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%94%D0%BE%D0%BD%D0%B5%D1%86_%D0%B3%D0%BE%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%94%D0%BE%D0%BD%D0%B5%D1%86_%D0%B8_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%9B%D0%B0%D0%B2%D1%80%D0%B0._2006.jpg","page_title":"Донец гол","context_page_description":"Донец — Орос, Украйнаар 1053 км урсаж Дон мөрөнд цутгадаг гол."},{"page_url":"https://pt.wikipedia.org/wiki/Terrier_irland%C3%AAs","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Terier_irlandzki_g%C5%82owa_pl.jpg","page_title":"Terrier irlandês","context_page_description":"O terrier irlandês, apelidado ainda de pequeno demônio, é uma raça de cão do tipo terrier oriunda da Irlanda. Conhecidos como cães descuidados, são animados e brincalhões, criados para a caça de pragas em geral e como d'água. Donos de um corpo elegante, possuem passadas largas e são considerados companhias leais, embora não sejam muito sociáveis com outros cães logo de início. Exercícios e adestramento são fundamentais para guiá-los e controlar sua energia."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E7%94%A3%E3%83%BB%E3%83%9E%E3%83%BC%E3%83%81BOX","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Nissan_March_Box_005.JPG","page_title":"日産・マーチBOX","context_page_description":"マーチBOXは日産自動車が1999年から2001年まで製造・販売したステーションワゴン型乗用車である。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Blomberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Blomberg_Neue-Torstra%C3%9Fe-64_109.jpg","page_title":"Liste der Baudenkmäler in Blomberg","context_page_description":"Die Liste der Baudenkmäler in Blomberg enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Blomberg im Kreis Lippe in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Blomberg eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen.\\nAus der Denkmalliste ausgetragene/gelöschte Objekte:"},{"page_url":"https://en.wikipedia.org/wiki/Ixora","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Ixora_coccinea.jpg","page_title":"Ixora","context_page_description":"Ixora is a genus of flowering plants in the family Rubiaceae. It is the only genus in the tribe Ixoreae. It consists of tropical evergreen trees and shrubs and holds around 562 species. Though native to the tropical and subtropical areas throughout the world, its centre of diversity is in Tropical Asia. Ixora also grows commonly in subtropical climates in the United States, such as Florida where it is commonly known as West Indian Jasmine. Other common names include viruchi, rangan, kheme, ponna, chann tanea, techi, pan, siantan, jarum-jarum/jejarum, jungle flame, jungle geranium,\\ncruz de Malta among others. The plants possess leathery leaves, ranging from 3 to 6 inches in length, and produce large clusters of tiny flowers in the summer. Members of Ixora prefer acidic soil, and are suitable choices for bonsai. It is also a popular choice for hedges in parts of South East Asia. In tropical climates they flower year round and are commonly used in Hindu worship, as well as in ayurveda and Indian folk medicine."},{"page_url":"https://lt.wikipedia.org/wiki/Trak%C5%B3_Vok%C4%97s_dvaro_sodybos_ansamblis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Trak%C5%B3_vokes_dvaro_arklide2016.jpg","page_title":"Trakų Vokės dvaro sodybos ansamblis","context_page_description":"Trakų Vokės dvaro sodybos ansamblis – istorizmo architektūros paminklas Trakų Vokėje, turintis neogotikos, neoklasicizmo, eklektikos stiliaus elementų. Įsikūręs pusiaukelėje tarp Vilniaus ir Trakų.\\nNuo XIX a. vidurio priklausė grafams Tiškevičiams, kurie jį pirko iš Trakų maršalkos Liudviko Dombrovskio. 1876–1880 metais italų kilmės architektas Oleandras Markonis suprojektavo neoklasicizmo stiliaus rūmus, sekdamas Lenkijos karalių rezidencija Varšuvoje, Lazenkose. 1885 m. dvarui priklausė 4 735 dešimtinės žemės.\\nDvaras aptvertas plytų tvora su pseudogotikinio rytietiško stiliaus vartais bei urnomis. Prie vartų stovi sargo-šveicoriaus namelis. Dvaro rūmai dviejų aukštų, o flygeliai – vieno, puošti aštuoniomis skulptūromis, prieangis – gipso skydu su Tiškevičių giminės Lelyvų herbu. Prieškambaris buvo paremtas keturiomis kolonomis ir nuo jo tęsėsi galerija, kurioje, be baldų, kabėjo Suchodolskio paveikslai.\\nIš Trakų Vokės dvaro į Vilnių, kitus Tiškevičių rūmus, buvo nutiesta pirmoji Lietuvoje telefono linija.\\nAntrojo pasaulinio karo metais dvare gyveno kolonistai iš Olandijos. 1945 m. dvaras tapo LTSR Ministrų Tarybos vila, o vėliau Dotnuvos žemdirbystės instituto Vokės filialu."},{"page_url":"https://en.wikipedia.org/wiki/Physical_restraint","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Women%27s_prison_punishment_%28early_modern_era%29.jpg","page_title":"Physical restraint","context_page_description":"Physical restraint refers to means of purposely limiting or obstructing the freedom of a person's bodily movement."},{"page_url":"https://vi.wikipedia.org/wiki/Azolla_filiculoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Azolla_filiculoides0.jpg","page_title":"Azolla filiculoides","context_page_description":"Azolla filiculoides là một loài dương xỉ trong họ Salviniaceae. Loài này được Lam. mô tả khoa học đầu tiên năm 1783."},{"page_url":"https://sk.wikipedia.org/wiki/D%C3%A9ianeira_(dc%C3%A9ra_Oinea)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Hans_Rottenhammer_007.jpg","page_title":"Déianeira (dcéra Oinea)","context_page_description":"Déianeira je v gréckej mytológii dcéra kalydónskeho kráľa Oinea a jeho manželky Althaie. Bola druhou manželkou najväčšieho gréckeho hrdinu Hérakla.\\nDéianeira mala štyroch bratov, Meleagra, Toxea, Thyrea a Klymena a sestru Gorgu.\\nDéianeira sa stala druhou manželkou Hérakla po tom, ako svoju prvú manželku Megaru prenechal svojmu synovcovi Iolaovi, ktorý sa o ňu staral v čase, keď on plnil dvanásť ťažkých úloh, uložených kráľom Eurystheom. Po tejto službe, ktorá trvala niekoľko rokov, sa Hérakles rozhliadal po novej manželke. Páčila sa mu aj krásna rusovláska Iola, dcéra oichalského kráľa Euryta o ktorú súťažil v lukostreľbe. Keď však zvíťazil aj nad jej otcom Eurytom, ktorý ho lukostreľbe učil, Eurytos považoval za urážku, že ho prevýšil jeho vlastný žiak a potupne ho vyhnal.\\nPôvodne bola Déianeira zadaná riečnemu bohu Achelóovi, ktorý vedel meniť svoju podobu, ale Hérakles ho v ťažkom súboji premohol a právom víťaza si Déianeiru odviedol do Tirynthu. Cestou sa však odohrala udalosť, ktorá mala ďalekosiahle dôsledky. Keď prechádzali cez rieku, kde nebol most, Hérakles ju preplával a Déianeiru zveril Kentaurovi Nessovi, ktorý sa ponúkol, že ju prenesie cez rieku na chrbte."},{"page_url":"https://tr.wikipedia.org/wiki/Sono_Osato","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Sono_Osato_in_Francesca_da_Rimini_costume._%286174097084%29.jpg","page_title":"Sono Osato","context_page_description":"Sono Osato, Amerikalı dansçı ve aktris."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturdenkm%C3%A4ler_im_Bezirk_Eferding","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Erste_Eiche.JPG","page_title":"Liste der Naturdenkmäler im Bezirk Eferding","context_page_description":"Die Liste der Naturdenkmäler im Bezirk Eferding listet die als Naturdenkmal ausgewiesenen Objekte im Bezirk Eferding im Bundesland Oberösterreich auf. Unter den sechs Naturdenkmälern befinden sich fast ausschließlich Bäume, darunter ein Stieleichen-Paar, zwei freistehende Stieleichen und zwei Sommer-Linden. Zudem ist ein Seerosenbestand am Lauf der Aschach unter Schutz gestellt worden. Die älteste bestehende Unterschutzstellung im Bezirk Eferding erfolgte 1960, die letzte 2007."},{"page_url":"https://pt.wikipedia.org/wiki/Guerras_romano-persas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Bas_relief_nagsh-e-rostam_couronnement.jpg","page_title":"Guerras romano-persas","context_page_description":"As guerras romano-persas foram uma série de conflitos militares entre o Estado romano e os sucessivos impérios iranianos: a Pártia e a Sassânia. A Pérsia, como um grande desenvolvimento cultural e militar, tornou-se um inimigo de Roma e manteve-se como tal por vários séculos. Os romanos viram nos persas uma potência semelhante a si, e os grandes reis de Ctesifonte viam-os da mesma forma. Os persas já há muito tempo denominam seus soberanos como \\"grande rei\\", o que lhes atribui uma grandeza similar à de augusto no Império Romano.\\nAs hostilidades entre estas potências iniciaram-se em 92 a.C. e prolongaram-se por séculos até serem concluídas com as invasões árabes muçulmanas, que atingiram os impérios Sassânida e Bizantino com efeito devastador logo após o fim do último conflito entre eles. Embora a guerra entre os romanos e partas/sassânidas tenha durado sete séculos, a fronteira permaneceu aproximadamente estável. Um jogo de cabo de guerra se seguiu: cidades, fortificações e províncias foram continuamente saqueadas, capturadas, destruídas e trocadas."},{"page_url":"https://fr.wikipedia.org/wiki/Carthage","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/VueDuCielCarthageNov2013.jpg","page_title":"Carthage","context_page_description":"Carthage est une ville tunisienne située au nord-est de la capitale Tunis.\\nL'ancienne cité punique, détruite puis reconstruite par les Romains qui en font la capitale de la province d'Afrique proconsulaire, est aujourd'hui l'une des municipalités les plus huppées du Grand Tunis, résidence officielle du président de la République, regroupant de nombreuses résidences d'ambassadeurs ou de richissimes fortunes tunisiennes et expatriées. La ville possède encore de nombreux sites archéologiques, romains pour la plupart avec quelques éléments puniques, classés au patrimoine mondial de l'Unesco depuis le 27 juillet 1979.\\nLa municipalité de Carthage, qui compte 17 010 habitants en 2014, abrite le palais présidentiel, la mosquée Mâlik ibn Anas, le musée national de Carthage ou encore l'Académie tunisienne des sciences, des lettres et des arts. L'aéroport international de Tunis-Carthage est situé à quelques kilomètres à l'ouest de la ville."},{"page_url":"https://fr.wikipedia.org/wiki/G%C3%A9za_Alf%C3%B6ldy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/TarracoVALREB.jpg","page_title":"Géza Alföldy","context_page_description":"Géza Alföldy, né le 7 juin 1935 à Budapest et mort le 6 novembre 2011 à Athènes, est un historien et épigraphiste hongrois spécialiste de l'Antiquité romaine."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BB%D1%8F%D0%B4%D0%B7%D0%B5%D1%86_%D0%BF%D0%B0%D0%B4_%D1%84%D1%83%D1%82%D1%80%D0%B0%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Selidi_pod_shuboi.jpg","page_title":"Селядзец пад футрам","context_page_description":"Селядзе́ц пад фу́трам — рыбная салата з гароднінай.\\nУ 1-й палове XIX стагодзьдзя ў скандынаўскай кухні мела пашырэньне селядцовая салата. У 1845 годзе ангельская кухарская кніга згадвала швэдзкую салату, што зьмяшчала нарвэскі селядзец на дне, пакрыты рэзаным бураком, бульбай, марынаванымі гуркамі, цёртым яблыкам і рубленымі яйкамі. У нарвэскім рэцэпце 1851 году морква замяняла агурок, а складнікі ўкладвалі слаямі. У 2-й палове XIX стагодзьдзя рэцэпт селядца пад футрам зьявіўся ў расейскай кухні. У 1960-я гады салату сталі запраўляць маянэзам."},{"page_url":"https://af.wikipedia.org/wiki/Aruba","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Aruba-CIA_WFB_Map.png","page_title":"Aruba","context_page_description":"Aruba is 'n eilandnasie in die Karibiese See en behoort tot die ABC-eilande net noord van Venezuela. Tot 1986 het Aruba deel uitgemaak van die Nederlandse Antille, maar die eiland is sedert 1 Januarie 1986 'n outonome land binne die Koninkryk van die Nederlande.\\nDie amptelike tale is Nederlands en Papiaments; ander tale wat gepraat word is Spaans en Engels. Die hoofstad en grootste is Oranjestad. Die eiland het 'n oppervlakte van 180 km² en 'n bevolking van 102 911 in 2013 gehad."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%86%D8%AA%D9%88%D9%86%DB%8C%D9%88_%D9%85%D8%AA%D8%A6%D9%88_%D9%84%D8%A7%D8%A6%D9%88%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Antonio_Mateu_Lahoz_2012.jpg","page_title":"آنتونیو متئو لائوس","context_page_description":"آنتونیو متئو لائوس داور فوتبال اهل اسپانیا است.\\nوی از سال ۲۰۰۹ در لا لیگا و از سال ۲۰۱۱ در مسابقات بین‌المللی قضاوت میکند."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%96%E1%83%9D%E1%83%92%E1%83%90%E1%83%93%E1%83%9D%E1%83%94%E1%83%91%E1%83%A0%E1%83%98%E1%83%95%E1%83%98_%E1%83%A2%E1%83%A0%E1%83%90%E1%83%9C%E1%83%A1%E1%83%9E%E1%83%9D%E1%83%A0%E1%83%A2%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Tbilisi_MinibusMarshrutka.jpg","page_title":"საზოგადოებრივი ტრანსპორტი","context_page_description":"საზოგადოებრივი ტრანსპორტი — მგზავრების ჯგუფის გადასაყვანი საშუალება, რომელიც ჩვეულებრივ, საყოველთაოდაა ხელმისაწვდომი გადაადგილების ნებისმიერი მსურველისთვის, მოძრაობს წინასწარ განსაზღვრული დროის განრიგითა და დაგეგმილი მარშრუტით, თითოეულ მგზავრობას კი გარკვეული საფასური გააჩნია.\\nხშირ შემთხვევაში, საზოგადოებრივი სატრანსპორტო სისტემები იმართება ადგილობრივი მთავრობის მიერ, დანახარჯების სუბსიდიას კი სახელმწიფო უზრუნველყოფს, ვინაიდან ამგვარი სისტემები, გავრცელებული აზრით, მიიჩნევა საზოგადოებრივ სიკეთედ, რომელიც წინაპირობაა ეკონომიკის სხვადასხვა სექტორის განვითარების, შრომის ნაყოფიერების ამაღლების, წვდომის სამუშაო ადგილებთან, საგანმანათლებლო დაწესებულებებთან, სავაჭრო ობიექტებთან, სამედიცინო მომსახურებებსა და სხვა ეკონომიკურ-სოციალურ სტრუქტურებთან. ამასთან, იგი ხელს უწყობს ცხოვრების დონის ამაღლებას, ვინაიდან ამცირებს უარყოფით ზეგავლენას ეკოლოგიაზე, ასევე ზრდის გადაადგილების სიჩქარეს, რაც იძლევა დროისა და ძალის ეკონომიას, რომელიც შესაძლებელია მიმართული იყოს დასვენებაზე ან სხვა სახის სოციალურ აქტივობაზე. სწორედ ამიტომ, ზოგიერთ ქალაქში, გადაწყვიტეს სრულად მოეხსნათ მგზავრობის ღირებულება და მოსახლეობას საზოგადოებრივი ტრანსპორტი უფასოდ ემსახურება."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D0%B0%D0%BD%D1%81%D1%82%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Shanirak.svg","page_title":"Тенгрианство","context_page_description":"Тенгриа́нство, или тенгри́зм, — неологизм, обозначение средневековой этнической религии тюрко-монгольских кочевников евразийских степей и Центральной Азии, в которой, особенно на уровне государственного культа, высшим считался Тенгри — обожествлённое небо; а также одного из современных направлений в неоязычестве. В англоязычной литературе принят термин Tengrism. В тюркских языках используют два понятия: «Тенгир дин» и «Тенгиршилик», или Tengricilik. Автором термина «тенгризм/тенгрианство» является казахский этнограф XIX века Чокан Валиханов, а ввёл его в широкий научный оборот французский востоковед Жан-Поль Ру. В советские годы «тенгрианство» впервые появляется в книге АЗ и Я казахского поэта и тюрколога Олжаса Сулейменова."},{"page_url":"https://ms.wikipedia.org/wiki/Senarai_bandar_raya_terbesar_dan_kedua_terbesar_mengikut_negara","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Panorama_of_Hanoi.jpg","page_title":"Senarai bandar raya terbesar dan kedua terbesar mengikut negara","context_page_description":"Berikut merupakan senarai bandar raya terbesar dan kedua terbesar mengikut populasi bagi setiap negara. Bandar raya kedua bagi sesebuah negara merupakan bandar raya kedua terpenting, biasanya selepas ibu negara. Jika sesebuah wilayah atau kawasan bagi sesebuah negara disenaraikan, nama negara ditentukan di dalam kurungan selepas nama wilayah tersebut."},{"page_url":"https://es.wikipedia.org/wiki/Sam%C5%A1ina","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Sam%C5%A1ina_-_n%C3%A1ves.jpg","page_title":"Samšina","context_page_description":"Samšina es una localidad del distrito de Jičín en la región de Hradec Králové, República Checa, con una población estimada a principio del año 2018 de 257 habitantes.\\nSe encuentra ubicada al oeste de la región, a unos 85 km al noreste de Praga, en la zona conocida como \\"Paraíso Checo\\", cerca de la frontera con las regiones de Bohemia Central y Liberec.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D0%B4%D0%BE-%D0%B1%D0%B8%D1%87%D0%B8%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Todo_Bichig_Latin.png","page_title":"Тодо-бичиг","context_page_description":"Тодо-бичиг — письменность, созданная в 1648 году на основе старомонгольского письма ойратским просветителем, буддийским монахом Зая-Пандитой для приближения письменности к произношению, а также упрощения записи санскритских и тибетских заимствований, широко использовавшихся в религиозных текстах.\\nПисьменность получила широкое распространение среди ойрат-монголов, в том числе и калмыков. Определённую популярность оно получило у халха-монголов за лёгкость чтения, из-за чего часто использовалось для художественной литературы. В калмыцком языке письмо тодо-бичиг использовалось вплоть до 1924 года и было заменено кириллицей в ходе проводившейся тогда кампании кириллизации алфавитов народов СССР. Ойраты в КНР пользуются им до настоящего времени, хотя в образовании используется старомонгольский алфавит."},{"page_url":"https://vec.wikipedia.org/wiki/Castelculier","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Castelculier_-_Mairie_-1.JPG","page_title":"Castelculier","context_page_description":"Castelculier el xé on comun de 2 375 abitanti del departemento de Lot-et-Garonne che el fa parte del rejon Nova Acuitania in Fransa."},{"page_url":"https://pl.wikipedia.org/wiki/Saalfeld/Saale","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Stadtkirche_Saalfeld.JPG","page_title":"Saalfeld/Saale","context_page_description":"Saalfeld/Saale – miasto powiatowe w Niemczech w kraju związkowym Turyngia, siedziba administracyjna powiatu Saalfeld-Rudolstadt. Leży nad lewym brzegiem Soławy, u podnóża Lasu Turyńskiego, ok. 50 kilometrów na południe od Weimaru i ok. 130 km na południowy zachód od Lipska. 31 grudnia 2018 miasto liczyło 29,5 tys. mieszkańców.\\nDo 30 listopada 2011 miasto pełniło funkcję \\"gminy realizującej\\" dla gminy wiejskiej Arnsgereuth, która dzień później została przyłączona do miasta i stała się jego dzielnicą. 6 lipca 2018 do miasta przyłączono gminy Kamsdorf oraz Wittgendorf, które stały się jego dzielnicami. 1 stycznia 2019 natomiast do miasta przyłączono gminy Reichmannsdorf oraz Schmiedefeld."},{"page_url":"https://it.wikipedia.org/wiki/Distretti_della_Polonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Woj_opolskie_adm.png","page_title":"Distretti della Polonia","context_page_description":"I distretti della Polonia costituiscono suddivisione territoriale di secondo livello del Paese, dopo i voivodati, e ammontano a 379 distretti, di cui 66 sono classificati come distretti urbani, gli altri come distretti rurali. Ciascun distretto comprende a sua volta più comuni."},{"page_url":"https://fr.wikipedia.org/wiki/Fosse_n%C2%B0_9_des_mines_de_Lens","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Lens_-_Cit%C3%A9s_de_la_fosse_n%C2%B0_9_des_mines_de_Lens_%2849%29.JPG","page_title":"Fosse n° 9 des mines de Lens","context_page_description":"La fosse nᵒ 9 dite Saint-Théodore ou Théodore Barrois de la Compagnie des mines de Lens est un ancien charbonnage du Bassin minier du Nord-Pas-de-Calais, situé à Lens. Les travaux du puits commencent en juillet 1884, et la fosse commence à extraire le 1ᵉʳ octobre 1890. Les terrils nᵒˢ 68 et 68A sont édifiés à l'est de la fosse, le second est un cavalier minier permettant le raccordement avec la gare de Lens. Des cités sont construites au nord de la fosse, ainsi que des écoles primaires et maternelles, et une église, placée sous le vocable de saint Théodore. Une fosse d'aérage nᵒ 9 bis est entreprise à 640 mètres au sud-ouest en 1902 et est opérationnelle en 1904, elle est située sur un autre carreau. La fosse et ses cités sont détruites durant la Première Guerre mondiale. Elles sont reconstruites suivant le style architectural des mines de Lens d'après-guerre.\\nLa Compagnie des mines de Lens est nationalisée en 1946, et intègre le Groupe de Lens ; en 1952, ce dernier fusionne avec le Groupe de Liévin pour former le Groupe de Lens-Liévin. Des cités sont bâties au sud de la fosse. Cette dernière nᵒ 9 cesse d'extraire en 1960 à la suite de sa concentration sur la fosse nᵒ 11 - 19."},{"page_url":"https://ca.wikipedia.org/wiki/Apomorfina","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Apomorphine.png","page_title":"Apomorfina","context_page_description":"L'apomorfina és un derivat sintètic de la morfina, molt utilitzat en experimentació com a prototip d'agonista dopaminèrgic, no té acció analgèsica, però té intensa activitat com emètic, ja que estimula la zona quimioreceptora de l'àrea postrema."},{"page_url":"https://sv.wikipedia.org/wiki/Potsdams_stadsslott","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Stadtschloss_Potsdam_Gem%C3%A4lde.jpg","page_title":"Potsdams stadsslott","context_page_description":"Potsdams stadsslott är ett rekonstruerat barockslott i Potsdam, Tyskland, som ligger mellan Alter Markt och det nuvarande Hotel Mercure i centrala Potsdam. Det stod klart årsskiftet 2013/2014 som en utvändig rekonstruktion av det tidigare barockslott som förstördes i andra världskriget och därefter revs."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%83%93%E3%83%83%E3%83%89%E3%83%BB%E3%82%AA%E3%83%AB%E3%83%86%E3%82%A3%E3%83%BC%E3%82%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/David_Ortiz_on_July_27%2C_2013.jpg","page_title":"デビッド・オルティーズ","context_page_description":"デビッド・アメリコ・オルティーズ・アリアスは、ドミニカ共和国サントドミンゴ出身の元プロ野球選手。愛称は、ビッグ・パピ、クッキーモンスター。\\n引退後の2017年に背番号「34」がボストン・レッドソックスの永久欠番となった。"},{"page_url":"https://nl.wikipedia.org/wiki/Kasteel_van_Parc_Soubise","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Parc-Soubise.jpg","page_title":"Kasteel van Parc Soubise","context_page_description":"Het Kasteel van Parc Soubise is een kasteel in de Franse gemeente Mouchamps."},{"page_url":"https://en.wikipedia.org/wiki/Clachnacuddin_F.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Clachnacuddin_Football_Club_ground.JPG","page_title":"Clachnacuddin F.C.","context_page_description":"Clachnacuddin Football Club is a part-time senior professional football club from the city of Inverness who currently play in the Scottish Highland Football League.\\nClachnacuddin have won the most Highland Football League championships in the competition's history: a total of 18. Their home ground is Grant Street Park in the city's Merkinch area. They also have a youth system, with many teams ranging from the primary squads to the under 19s.\\nThe club operated a reserve team in the North Caledonian Football League but withdrew for the start of the 2014–15 season.\\nThey were founded in 1885 and are nicknamed \\"The Lilywhites\\" or \\"Clach\\". Their name is an English approximation of a Scots Gaelic name meaning \\"the stone of the tub\\", referring to a city landmark in Inverness.\\nAs a senior team with a compliant stadium, they are entitled to enter the Scottish Cup."},{"page_url":"https://fr.wikipedia.org/wiki/Punaise_de_Google_Maps","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Pin_11_ornduvald2013.jpg","page_title":"Punaise de Google Maps","context_page_description":"La punaise de Google Maps est une icône en forme de goutte à l’envers qui marque les emplacements dans Google Maps. L’icône est protégée par un brevet de dessin américain en tant qu’« icône ombrée en forme de larme ». Google a réutilisé cette punaise sur différentes images et jeux, ainsi que sur du matériel promotionnel.\\nLa punaise, parfois appelé « le marqueur », a été largement réutilisée par d'autres entreprises, organisations et particuliers, pour leurs actions artistiques, illustrer leur revendications ou faire leur propre promotion commerciale. Sa reproduction physique ou numérique est souvent utilisée comme symbole d’un logiciel cartographique ou des technologies de l’information et de la communication dans leur ensemble.\\nLa punaise Google Maps a été qualifiée de « produit purement fonctionnel devenu phénomène culturel » et de « réponse à un problème technique qui aurait acquis une vie propre, se révélant suffisamment identifiable pour pénétrer l’art et le stylisme d’autres projets ». « Semblable à une montgolfière en vol, cette icône a conquis notre culture visuelle »."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A6%E3%83%8F%E3%83%BB%E3%83%AC%E3%82%A4%E3%83%B4%E3%82%A3%E3%82%B9%E3%82%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Myyrm%C3%A4ki_compositional_analysis.jpg","page_title":"ユハ・レイヴィスカ","context_page_description":"ユハ・イルマリ・レイヴィスカはフィンランドの著名な建築家であり、デザイナーである。とりわけ教会や宗教建築で有名である。"},{"page_url":"https://de.wikipedia.org/wiki/Agnes_von_W%C3%BCrttemberg_(1835%E2%80%931886)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Agnes_von_W%C3%BCrttemberg.jpg","page_title":"Agnes von Württemberg (1835–1886)","context_page_description":"Prinzessin Agnes von Württemberg, verh. Pauline Louise Agnes Fürstin von Reuß jüngerer Linie war ein Mitglied des deutschen Hochadels. Unter dem Pseudonym Angelica Hohenstein war sie zudem als Schriftstellerin tätig."},{"page_url":"https://fr.wikipedia.org/wiki/Andrei_Istr%C4%83%C8%9Bescu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Andrei_Istratescu.jpg","page_title":"Andrei Istrățescu","context_page_description":"Andrei Istrățescu est un joueur d'échecs roumain né le 3 décembre 1975 en Roumanie. Champion d'Europe des moins de seize ans et champion de Roumanie en 1992 et 2017, il est grand maître international depuis 1993.\\nIstrățescu a représenté la Roumanie lors de six olympiades d'échecs. De 2011 à janvier 2017, il était affilié à la fédération française et a représenté la France lors du championnat d'Europe d'échecs des nations de 2011. Depuis février 2017, il est à nouveau affilié à la fédération roumaine.\\nAu 1ᵉʳ juin 2017, Istrățescu est le quatrième joueur roumain avec un classement Elo de 2 593 points."},{"page_url":"https://de.wikipedia.org/wiki/Villa_Louis_Link","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Hn-caecilien51detail-web.jpg","page_title":"Villa Louis Link","context_page_description":"Die Villa Link ist eine unter Denkmalschutz stehende Villa an der Cäcilienstraße 51 in Heilbronn."},{"page_url":"https://en.wikipedia.org/wiki/INS_Kalvari_(S23)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/INS_Kalvari_Submarine_Fin_at_RK_Beach_06.jpg","page_title":"INS Kalvari (S23)","context_page_description":"INS Kalvari (S23) was the lead vessel of the Kalvari class of diesel-electric submarines of the Indian Navy. The submarine was laid down on 27 December 1966 as Foxtrot-class submarine B-51 of the Soviet Navy by Novo-Admiralty at Galerniy Island, Leningrad. The submarine was launched on 15 April 1967 and competed on 26 September 1967. B-51 was transferred to the Indian Navy in July 1968. The submarine was removed from service in 1992.\\nKalvari is the Malayalam word for tiger shark, a deep-sea predator in the Indian Ocean. The name symbolizes agility, strength and predatory power. The tiger shark is a species of requiem shark which are found in tropical and temperate waters."},{"page_url":"https://ast.wikipedia.org/wiki/Asthenes_maculicauda","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Asthenes_maculicauda_-_Scribble-tailed_Canastero%3B_Pongo%2C_La_Paz%2C_Bolivia_%28cropped%29.jpg","page_title":"Asthenes maculicauda","context_page_description":"Asthenes maculicauda, tamién denomináu canastero estriáu, ye una especie d'ave paseriforme de la familia Furnariidae qu'habita en pacionales d'altitú del oeste d'América del Sur."},{"page_url":"https://no.wikipedia.org/wiki/Det_svenske_instituttet_i_Athen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Macra_Come_view.jpg","page_title":"Det svenske instituttet i Athen","context_page_description":"Det svenske instituttet i Athen er et svensk institutt som driver klassisk arkeologi i Hellas, og er et av 17 utenlandske arkeologiske institutt som betjenes i Athen. Det svenske instituttet ble opprettet den 10. mai 1948. Det finansieres av det svenske Utbildningsdepartementet. Det drives som en stiftelse og Sveriges regjering velger ordføreren i instituttets styre og regnskapene blir revidert av en revisor utpekt av regjeringen.\\nSammen med de tilsvarende dansk, finske og norske arkeologiske instituttene på stedet bidrar det svenske instituttet til Det nordiske biblioteket i Athen. Instituttets formål er formulert som følgende: «... å fremme utforskning av Hellas' antikke kultur, å formidle kunnskap om dette, og dermed berike vår egen kultur, samt å stimulere og støtte kulturutvekslingen mellom Sverige og Hellas.»\\nDirektør for instituttet siden 2010 har vært Arto Penttinen. Torsten Kälvemark har siden samme tid vært ordfører i stiftelsens styre. Til instituttet tilhører også Gästhuset i Kavala. Kavala ligger i østlige Makedonia i nordlige Hellas og har boliger tilgjengelige for svenske kunstnere, forfattere og forskere."},{"page_url":"https://cs.wikipedia.org/wiki/Allan_McGregor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Allan_McGregor_1.png","page_title":"Allan McGregor","context_page_description":"Allan James McGregor je skotský fotbalový brankář a reprezentant, v současnosti hráč klubu Hull City AFC.\\nMimo Skotsko působil na klubové úrovni v Turecku a Anglii."},{"page_url":"https://sv.wikipedia.org/wiki/Tors%C3%A5s_kyrka","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Tors%C3%A5s_kyrka_Orgeln_024.JPG","page_title":"Torsås kyrka","context_page_description":"Torsås kyrka är en kyrkobyggnad i Torsås i Växjö stift. Den är församlingskyrka i Torsås församling."},{"page_url":"https://sv.wikipedia.org/wiki/Campanula_spatulata","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Campanula_spatulata.jpg","page_title":"Campanula spatulata","context_page_description":"Campanula spatulata är en klockväxtart som beskrevs av James Edward Smith. Campanula spatulata ingår i släktet blåklockor, och familjen klockväxter."},{"page_url":"https://it.wikipedia.org/wiki/Asus_ZenWatch","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Asus_ZenWatch_%2816515994293%29.jpg","page_title":"Asus ZenWatch","context_page_description":"L'Asus ZenWatch è uno smartwatch basato su Android Wear annunciato il 3 settembre 2014 a IFA e rilasciato da ASUS il 9 novembre 2014. Utilizza Android Wear, una versione modificata di Android progettato specificamente per smartwatch e altri indossabili. È compatibile con tutti gli smartphone con sistema operativo Android 4.3 o superiore che supporta Bluetooth Low Energy."},{"page_url":"https://en.wikipedia.org/wiki/Chronological_summary_of_the_2008_Summer_Olympics","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/2008_Summer_Olympics_Opening_Ceremony_2.jpg","page_title":"Chronological summary of the 2008 Summer Olympics","context_page_description":"This page contains a chronological summary of major events from the 2008 Summer Olympics in Beijing, China."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%D8%B4%D9%87%D8%B1%DB%8C_%DA%A9%D9%88%D9%88%D9%84%D9%85%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Coleman_Municipal_Airport-TX-18Dec1994-USGS.jpg","page_title":"فرودگاه شهری کوولمن","context_page_description":"فرودگاه شهری کوولمن یک فرودگاه همگانی با کد یاتا COM است که یک باند فرود آسفالت دارد و طول باند آن ۱۳۷۳ متر است. این فرودگاه در شهر کولمن، تگزاس کشور ایالات متحده آمریکا قرار دارد و در ارتفاع ۵۱۷ متری از سطح دریا واقع شده‌است."},{"page_url":"https://eu.wikipedia.org/wiki/Mo%C8%99na_(Ia%C8%99i)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Mosna_jud_Iasi.png","page_title":"Moșna (Iași)","context_page_description":"Moșna Errumaniako udalerri bat da, Iași konderrian. 1.767 biztanle ditu, 28,31 kilometro koadroko azaleran banatuta."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8B%D5%B8%D6%80%D5%BB_%D5%96%D5%AC%D5%B8%D5%B5%D5%A4%D5%AB_%D5%A2%D5%B8%D5%B2%D5%B8%D6%84%D5%AB_%D6%81%D5%B8%D6%82%D5%B5%D6%81%D5%A5%D6%80%D5%AB_%D5%A8%D5%B6%D5%A9%D5%A1%D6%81%D6%84%D5%B8%D6%82%D5%B4_%D5%B0%D5%A1%D5%B6%D5%BE%D5%A1%D5%AE_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%80%D5%B1%D5%A1%D5%B6%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Appomattox_statue_in_Alexandria.jpg","page_title":"Ջորջ Ֆլոյդի բողոքի ցույցերի ընթացքում հանված հուշարձանների ցանկ","context_page_description":"2020 թվականի մայիսին Ջորջ Ֆլոյդի սպանությանը հաջորդած բողոքի ակցիաների ընթացքում Ամերիկայի Միացյալ Նահնագներում և մի շարք այլ երկրներում, մի շարք հուշարձաններ և հուշահամալիրներ հանվել են, կամ հայտարարվել է դրանք հանելու պլանները: Այս հուշարձաններից որոշները հանելու համար երկար տարիներ երբեմն օրենքի և դատարանի օգնությամբ պայքարել են: Որոշ դեպքերում հեռացումը պաշտոնական է եղել, մյուս դեպքերում՝ մասնավորապես Բիրմինգհեմում, Մոնտգոմերիում և Ալաբամա նահանգում գտնվող Մոբիլում, արձանների հանելը արգելող օրենքները դիտավորյալ խախտվել են: Ընդհանուր թեման սևամորթների հանդեպ պատմականորեն վատ վերաբերմունքն է եղել, նրանց նկատմամբ Համադաշնության տարիներին պատժամիջոցների կիրառումը:"},{"page_url":"https://bar.wikipedia.org/wiki/State_Parks_in_Nebraska","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Inside_powder_magazine_Fort_Atkinson.jpg","page_title":"State Parks in Nebraska","context_page_description":"Des is a Listn vo de State Parks im US-Bundesstoot Nebraska."},{"page_url":"https://en.wikipedia.org/wiki/History_of_Syria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Adib_al-Shishakli.jpg","page_title":"History of Syria","context_page_description":"The history of Syria covers events which occurred on the territory of the present Syrian Arab Republic and events which occurred in the region of Syria. The present Syrian Arab Republic spans territory which was first unified in the 10th century BCE under the Neo-Assyrian Empire, the capital of which was the city of Assur, from which the name \\"Syria\\" most likely derives. This territory was then conquered by various rulers, and settled in by different peoples. Syria is considered to have emerged as an independent country for the first time on 24 October 1945, upon the signing of the United Nations Charter by the Syrian government, effectively ending France’s mandate by the League of Nations to \\"render administrative advice and assistance to the population\\" of Syria, which came in effect on April 1946. On 21 February 1958, however, Syria merged with Egypt to create the United Arab Republic after plebiscitary ratification of the merger by both countries’ nations, but seceded from it in 1961, thereby recovering its full independence. Since 1963, the Syrian Arab Republic has been ruled by the Ba’ath Party, run by the Assad family exclusively since 1970."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A0%83%E6%9C%A8%E7%9C%8C%E9%81%93%E3%83%BB%E8%8C%A8%E5%9F%8E%E7%9C%8C%E9%81%931%E5%8F%B7%E5%AE%87%E9%83%BD%E5%AE%AE%E7%AC%A0%E9%96%93%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Map_of_Ibaraki_Prefecture_Ja.svg","page_title":"栃木県道・茨城県道1号宇都宮笠間線","context_page_description":"栃木県道・茨城県道1号宇都宮笠間線は、栃木県宇都宮市から同県芳賀郡益子町を経由し、茨城県笠間市に至る県道である。"},{"page_url":"https://de.wikipedia.org/wiki/Beskiden-Hauptwanderweg","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9d/Szczyt_Babiej_G%C3%B3ry.jpg","page_title":"Beskiden-Hauptwanderweg","context_page_description":"Der Kazimierz-Sosnowski-Beskidenhauptwanderweg ist ein rot markierter Fernwanderweg, der aus Ustroń in den Schlesischen Beskiden nach Wołosate in den Bieszczady führt.\\nDer mit 496 km längste Wanderweg in den polnischen Bergen, überquert die Schlesischen Beskiden, die Żywiec-Beskiden, die Gorce, den Beskid Sądecki, die Niederen Beskiden und die Bieszczady. Über die höchsten Teile der polnischen Beskiden führend, ermöglicht er den Zugang auf: Stożek Wielki, Barania Góra, Babia Góra, Polica, Turbacz, Lubań, Przehyba, Radziejowa, Jaworzyna Krynicka, Rotunda, Cergowa, Chryszczata, Smerek und Halicz. Folgende Ortschaften liegen am Weg: Ustroń, Węgierska Górka, Jordanów, Rabka-Zdrój, Krościenko nad Dunajcem, Rytro, Krynica-Zdrój, Iwonicz-Zdrój, Rymanów-Zdrój, Komańcza, Cisna, Ustrzyki Górne u. a.\\nDer Beskiden-Hauptwanderweg wurde während der Zwischenkriegszeit erstellt. Die Route des westlichen Teils wurde von Kazimierz Sosnowski entworfen und 1929 beendet. Der östliche Teil, nach dem Projekt von Mieczysław Orłowicz, wurde 1935 vollendet und führte bis zur Tschornohora in den ukrainischen Ostkarpaten, die sich damals innerhalb die Grenzen Polens befand."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Michigan_State_Historic_Sites_in_Ottawa_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Third_Reformed_Church_of_Holland.JPG","page_title":"List of Michigan State Historic Sites in Ottawa County","context_page_description":"The following is a list of Michigan State Historic Sites in Ottawa County, Michigan. Sites marked with a dagger are also listed on the National Register of Historic Places in Ottawa County, Michigan."},{"page_url":"https://vi.wikipedia.org/wiki/Conus_balteatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Conus_balteatus_002.jpg","page_title":"Conus balteatus","context_page_description":"Conus balteatus là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Conidae, họ ốc cối.\\nGiống như tất cả các loài thuộc chi Conus, chúng là loài săn mồi và có nọc độc. Chúng có khả năng \\"đốt\\" con người, do vậy khi cầm chúng phải hết sức cẩn thận."},{"page_url":"https://es.wikipedia.org/wiki/Carlo_Bergonzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Carlo_Bergonzi.jpg","page_title":"Carlo Bergonzi","context_page_description":"Carlo Bergonzi ​ fue un cantante de ópera italiano. Aunque interpretó y grabó varios roles de bel canto y del verismo, sobre todo se relaciona su nombre con óperas de Giuseppe Verdi, incluyendo un gran número de obras menos conocidas que ayudó a recuperar. Fue esencialmente un tenor lírico."},{"page_url":"https://sv.wikipedia.org/wiki/Ouville","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Map_commune_FR_insee_code_50389.png","page_title":"Ouville","context_page_description":"Ouville är en kommun i departementet Manche i regionen Normandie i norra Frankrike. Kommunen ligger i kantonen Cerisy-la-Salle som tillhör arrondissementet Coutances. År 2009 hade Ouville 453 invånare."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_kulturminner_i_Kr%C3%B8dsherad","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Olberg%2C_Buskerud_-_Riksantikvaren-T061_01_0023.jpg","page_title":"Liste over kulturminner i Krødsherad","context_page_description":"Liste over kulturminner i Krødsherad er en oversikt over fredede og/eller bevaringsverdige bygninger og elementer i Krødsherad. Data er hentet fra Riksantikvarens liste over kulturminner.\\nID-nummer består av et lenket tall som går direkte til det aktuelle kulturminnet i Kulturminnesøk."},{"page_url":"https://es.wikipedia.org/wiki/Leopardo_de_Panar","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/PanarManeater.jpg","page_title":"Leopardo de Panar","context_page_description":"El leopardo de Panar fue un leopardo macho antropófago que mató a 400 personas​ durante un periodo de varios años en el distrito de Kumaon en el norte de la India a principios del siglo XX, y que finalmente fue abatido en 1910 por el cazador y naturalista Jim Corbett.​"},{"page_url":"https://pt.wikipedia.org/wiki/Ouezzane","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Ouezzane-300tdorg-1.jpg","page_title":"Ouezzane","context_page_description":"Ouezzane ou Ouazzane, ou ainda Wazan e Uessen, também conhecida como Dar Dmana é uma cidade do noroeste de Marrocos, capital da província homónima, que faz parte da região de Tânger-Tetuão. Em 2004 tinha 57 367 habitantes e estimava-se que em 2010 tivesse 63 102. Situa-se no chamado pré-Rife, nos contrafortes daquela cadeia montanhosa, a sul do rio Lucos. Até à reforma administrativa de 2009 pertencia à província de Sidi Kacem e à região de Gharb-Chrarda-Beni Hssen.\\nA cidade é conhecida em Marrocos e no mundo islâmico como um importante centro espiritual, onde viveram grandes figuras sufistas e que foi a sede da importante irmandade sufista Tabiya, também conhecida como Ouezzani. Ao contrário de Xexuão, a cidade sagrada 60 km a norte, Ouezzane nunca foi interdita a cristãos, mas apesar disso o autor e jornalista inglês do final do século XIX Walter Harris descreveu-a como «a mais fanática que os europeus podem visitar». Durante muito tempo, Ouezzane foi uma espécie de cidade de fronteira entre os territórios mais obedientes ao governo central e os territórios tribais \\"sem lei\\"."},{"page_url":"https://de.wikipedia.org/wiki/Hechtia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Hechtia_podantha_-_Botanischer_Garten_M%C3%BCnchen-Nymphenburg_-_DSC07936.JPG","page_title":"Hechtia","context_page_description":"Hechtia ist die einzige Pflanzengattung der Unterfamilie Hechtioideae innerhalb der Familie der Bromeliengewächse. Früher wurden sie in die Unterfamilie Pitcairnioideae eingeordnet. Die etwa 60 Arten sind vom südlichen Texas bis nördlichen Nicaragua verbreitet. Die 60 bis 74 Arten sind hauptsächlich in Mexiko verbreitet, das auch als Entwicklungszentrum dieser Gattung gilt."},{"page_url":"https://he.wikipedia.org/wiki/55_%D7%91%D7%A1%D7%A8%D7%98%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Extrasolar_planet_NASA2.jpg","page_title":"55 בסרטן","context_page_description":"55 בסרטן הוא כוכב זוגי במרחק של כ-40 שנות אור ממערכת השמש בקבוצת הכוכבים סרטן. במערכת זו התגלו מאז שנת 2010 חמישה כוכבי לכת."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9D%E3%83%BC%E3%82%AD%E3%83%A5%E3%83%91%E3%82%A4%E3%83%B3%E3%83%BB%E3%83%84%E3%83%AA%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Porcupine_Tree_%40_Coachella_2010.jpg","page_title":"ポーキュパイン・ツリー","context_page_description":"ポーキュパイン・ツリー は、イングランド出身のプログレッシブ・ロックバンド。\\n1990年代の新しいサイケ/プログレ・スタイルとして注目され、その陰鬱なサウンドが第二の「ピンク・フロイド」と評価された。後年はプログレッシブ・メタルに接近し、音楽性を進化させている。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Metz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Metz_-_45%2C_rue_Vigne-Saint-Avold.jpg","page_title":"Liste des monuments historiques de Metz","context_page_description":"Ce tableau présente la liste de tous les monuments historiques classés ou inscrits dans la ville de Metz, Moselle, en France."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%BBuraw_zwyczajny","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Wappen_Wurzbach.png","page_title":"Żuraw zwyczajny","context_page_description":"Żuraw zwyczajny, żuraw, żuraw popielaty, żuraw szary – gatunek dużego ptaka z rodziny żurawi, zamieszkujący północną i środkową część Eurazji. Do niedawna można go było spotkać w całej Europie. W wyniku osuszania podmokłych lasów zniszczono jego lęgowiska i obecnie na południe od Bałtyku i na południu Europy występuje tylko wyspowo. Ciągły zasięg obejmuje Półwysep Skandynawski, północną Rosję i Azję aż po wschodnią Syberię. Wiosenne powroty w marcu i kwietniu, a jesienne przeloty we wrześniu i październiku. Zimuje na Półwyspie Iberyjskim, we Francji, w Afryce Północnej aż do Sudanu, na Bliskim Wschodzie, w Pakistanie, Indiach oraz południowych i wschodnich Chinach.\\nW Polsce nieliczny lub bardzo nieliczny ptak lęgowy niżu, lokalnie średnio liczny. Według szacunków Monitoringu Flagowych Gatunków Ptaków, w latach 2010–2012 populacja żurawia w Polsce liczyła 20–22 tysięcy par lęgowych, najliczniej występuje na północy i zachodzie kraju. Liczny na przelotach, zimuje wyjątkowo."},{"page_url":"https://de.wikipedia.org/wiki/Martin-Luther-Kirche_(Hamburg-Alsterdorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/M_luther_kirche_alsterdf_06.jpg","page_title":"Martin-Luther-Kirche (Hamburg-Alsterdorf)","context_page_description":"Die evangelisch-lutherische Martin-Luther-Kirche in Hamburg-Alsterdorf liegt dort direkt an der Achse der Hindenburgstraße und an deren Kreuzung mit der Bebelallee / Alsterdorfer Straße. Durch die offene Fläche der Straßen ist die Kirche zwar gut sichtbar, aber auch durch die Nähe zur großen Kreuzung vom Verkehrslärm beeinträchtigt."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_%C3%96hringen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Marktplatz_3_%C3%96hringen_20180913_001.jpg","page_title":"Liste der Kulturdenkmale in Öhringen","context_page_description":"In der Liste der Kulturdenkmale in Öhringen sind Bau- und Kunstdenkmale der Stadt Öhringen verzeichnet, die im „Verzeichnis der unbeweglichen Bau- und Kunstdenkmale und der zu prüfenden Objekte“ des Landesamts für Denkmalpflege Baden-Württemberg erfasst sind. Die folgende Liste basiert auf der von der Stadt Öhringen veröffentlichten Liste."},{"page_url":"https://ceb.wikipedia.org/wiki/Borodino_(lungsod_sa_Rusya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/BorodinoMonument.jpg","page_title":"Borodino (lungsod sa Rusya)","context_page_description":"Lungsod ang Borodino sa Rusya. Nahimutang ni sa lalawigan sa Krasnoyarskiy Kray, sa sentro nga bahin sa nasod, 3,500 km sa sidlakan sa Moscow ang ulohan sa nasod. 337 metros ibabaw sa dagat kahaboga ang nahimutangan sa Borodino, ug adunay 19,602 ka molupyo.\\nAng yuta palibot sa Borodino kay patag. Dunay mga 7 ka tawo kada kilometro kwadrado sa palibot sa Borodino may kaayo gamay nga populasyon. Borodino ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa Borodino.\\nAng klima boreal. Ang kasarangang giiniton -2 °C. Ang kinainitan nga bulan Hulyo, sa 19 °C, ug ang kinabugnawan Enero, sa -22 °C."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%87%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2_Bellator","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Kyoji_Horiguchi_2017.jpg","page_title":"Список чемпионов Bellator","context_page_description":"136 — 145 фунтов\\nВ 2016 году Bellator анонсировал введение женского полулёгкого дивизиона и розыгрыш чемпионского пояса между Марлос Кунен и Джулией Бадд на Bellator 155. Однако последняя получила травму, и была заменена на Алексис Дуфресне, которая не смогла уложиться в лимит, и, таким образом, её бой с Кунен потерял статус титульного. Поэтому чемпионский пояс был разыгран на Bellator 174 опять же между Кунен и Бадд."},{"page_url":"https://da.wikipedia.org/wiki/Gr%C3%B8n_vandagam","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Agama_blotna%2C_wodnogama_indochinska_%28Physignathus_cocincinus%29_-_Zoo_w_Warszawie_2.JPG","page_title":"Grøn vandagam","context_page_description":"Grøn vandagam lever i de meste af Sydøstasien og det sydlige Kina. Den er også udbredt som terrariedyr.\\nVandagamer er gode svømmere og tilbringer en stor del af dagen ved vandhuller og floder. Når der er fare på færde, flygter vandagamerne ud i vandet. Vandagamer er gode til at klatre og ses ofte i træerne.\\nDen grønne vandagam kan blive op til 70-80 centimeter lang. Den er lysegrøn med mørke ringe på halen og store, lyse skæl på underkæben og struben. Hannen er større end hunnen og mere farvestrålende. Begge køn har en kam på hovedet, der fortsætter ned ad kroppen til midt på halen. Kammen er størst hos hannen.\\nDen grønne vandagam har 3 øjne. Ligesom en del andre krybdyr har de et parietaløje oven på hovedet. Det sidder lige før den hjelmlignende forhøjning, de har på hovedet. Det er ikke et øje som de 2 andre, det kan kun sanse lys. Hvis der er et dyr, der sniger sig ind på en vandagam bagfra og skygger for solen, kan vandagamen se det, selvom de 2 andre øjne er fikseret på noget foran den. På den måde kan den nå at stikke af i tide.\\nNår hannen skal gøre kur til hunnen, \\"nikker\\" han med hovedet."},{"page_url":"https://eo.wikipedia.org/wiki/Rados%C5%82aw_Zawrotniak","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Rados%C5%82aw_Zawrotniak.jpg","page_title":"Radosław Zawrotniak","context_page_description":"Radosław Aleksander Zawrotniak estas pola spada skermisto. Li gajnis la arĝentan medalon en la vira teamo de spadaj skermistoj en la Somera Olimpiko 2008. Aldone li akiris bronzan medalon teame en la Monda Ĉampionado de 2009 en Antalya, arĝentan medalon teame en la Eŭropa Ĉampionado de 2007 kaj bronzan medalon individue en la Eŭropa Ĉampionado de 2010 en Lepsiko."},{"page_url":"https://lt.wikipedia.org/wiki/Kurkleliai_(Skiemonys)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Kurkleliai_29220%2C_Lithuania_-_panoramio.jpg","page_title":"Kurkleliai (Skiemonys)","context_page_description":"Kurkleliai – kaimas Anykščių rajono savivaldybėje, 7 km nuo Skiemonių."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%99%E1%80%AE%E1%80%86%E1%80%AD%E1%80%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Miso_paste_by_wilbanks_in_Nishiki_Ichiba%2C_Kyoto.jpg","page_title":"မီဆို","context_page_description":"မီဆို သည် ရိုးရာဂျပန် ဟင်းခတ်အမွှေးအကြိုင် တစ်မျိုးဖြစ်ပြီး ပဲပိစပ်ကို ဆားနှင့် ခိုးဂျီ ဟု ဂျပန်လိုခေါ်သော မှိုတစ်မျိုးကို အချဉ်ဖောက်ခြင်းဖြစ်သည်။ ရလဒ်မှာ အနှစ်ထူလပျစ်တစ်မျိုးဖြစ်လာ၍ စားမြိန်ရည်အဖြစ်လည်းကောင်း၊ အသားနှင့် အသီးအရွက်များကို သနပ်ပြုလုပ်ရာတွင်လည်းကောင်း၊ သုတ်လိမ်းစားသောက်ရန်လည်းကောင်း၊ ဒါရှီဟင်းရည်နှင့်ရော၍ ဂျပန်ဟင်းအတွဲအစပ်တစ်မျိုးအဖြစ် မီဆိုရှီရူ ဟုခေါ်သော မီဆို စွပ်ပြုတ်ပြုလုပ်ရာတွင်လည်းကောင်း အသုံးပြုသည်။ ပရိုတိန်းဓာတ်ကြွယ်ဝ၍ ဗီတာမင်၊ သတ္တုဓာတ်များနှင့် ပြည့်စုံသည်။ ဂျပန် ပဒေသရာဇ်ခေတ်တွင် မီဆိုသည် အရေးပါသော အာဟာရတစ်မျိုးဖြစ်သည်။ ဂျပန်နိုင်ငံတဝန်းတွင် မီဆိုကို ရိုးရာဟင်းချက်ရာတွင်၎င်း၊ ခေတ်ပေါ်ဟင်းချက်ရာတွင်၎င်း ယနေ့တိုင် ကျယ်ပြန့်စွာ အသုံးပြုနေကြဆဲဖြစ်၍ ကမ္ဘာအနှံ့မှ နှစ်ချိုက်မှုကိုလည်း ရရှိလာပြီဖြစ်သည်။\\nထုံးစံအရ မီဆိုသည် ငံသောအရသာရှိသော်လည်း ၎င်း၏ အနံ့အရသာသည် ပါဝင်ပေါင်းစပ်သော ပစ္စည်းများနှင့် အချဉ်ဖောက်ခြင်းဖြစ်စဉ်အပေါ်တွင် မူတည်သည်။ ငန်သော၊ချိုသော၊ ဖန်သော၊ အရသာရှိသော၊ ငံစပ်စပ်ရှိသော မီဆိုဟူ၍ အမျိုးအစားအမျိုးမျိုးရှိသည်။ မီဆိုနှင့် ဆင်သော တရုတ်ရိုးရာပစ္စည်းတစ်မျိုးမှာ ဒူကျန်းန် ဖြစ်သည်။"},{"page_url":"https://de.wikipedia.org/wiki/Kunst-_und_Wunderkammer_der_w%C3%BCrttembergischen_Herz%C3%B6ge","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Reliquary_Cologne_13th_century.jpg","page_title":"Kunst- und Wunderkammer der württembergischen Herzöge","context_page_description":"Die Kunst- und Wunderkammer der württembergischen Herzöge war eine vorwiegend der Repräsentation dienende Sammlung von Kunstwerken, Naturalien und Kuriositäten, die von Herzog Friedrich I. begründet wurde. Heute ist die Sammlung inszenierter Bestandteil des Museumskonzeptes Wahre Schätze im Landesmuseum Württemberg und wird im Stuttgarter Alten Schloss gezeigt. Sie ist auch die Vorgängersammlung des Staatlichen Museums für Naturkunde Stuttgart."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%83%D0%B1%D1%96%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Corundum.png","page_title":"Рубін","context_page_description":"Рубі́н — мінерал, різновид корунду, червоного кольору, який зумовлений домішками хрому. Належить до класу оксидів тригональної сингонії.\\nЗастаріла назва — сардіс, лал."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%88%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D0%B8_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_2006","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Stamp_of_Ukraine_s706-707.jpg","page_title":"Знаки поштової оплати України 2006","context_page_description":"Знаки поштової оплати України 2006 — перелік поштових марок, введених в обіг Укрпоштою у 2006 році.\\nЗ 5 січня по 15 грудня 2006 року було випущено 63 комеморативні поштові марки та сувенірний марковий аркуш стандартних поштових марок незалежної України п'ятого та шостого випуску: п'ятого — з літерним індексом «В», «Д», «Е», «C», «N», «Ж», «L», «Є», «Р» замість номіналу та шостого номіналом від 0,10 до 1,00 гривні. Тематика комеморативних марок охопила ювілеї визначних дат, подій, пам'яті видатних діячів культури та інши.\\nМарки було надруковано державним підприємством «Поліграфічний комбінат „Україна“».\\nВідсортовані за датою введення."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%BE%B7%E5%B7%9D%E5%BA%86%E5%96%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Shogun_Hitotsubashi_Yoshinobu_%285689020822%29.jpg","page_title":"德川庆喜","context_page_description":"德川庆喜，江户幕府第15代将军，也是末代将军。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D1%92%D0%BE%D1%88_(%D1%81%D0%BB%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%BE_%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D1%88%D1%82%D0%B5)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D0%A1%D0%BB%D0%B0%D1%82%D0%B8%D0%BD%D1%81%D0%BA%D0%BE_%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D1%88%D1%82%D0%B5.jpg","page_title":"Иђош (слатинско станиште)","context_page_description":"Слатине у околини села Иђош представљају слатинска станишта, природно богатство огромне вредности. Ова станишта се налазе на Директиви о стаништима Европске Уније као станиште које захтева неодложиву и приоритетну заштиту због велике угрожености и огромних ботаничких вредности."},{"page_url":"https://pl.wikipedia.org/wiki/Rubel_naddniestrza%C5%84ski","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/SUR_10_1961_reverse.jpg","page_title":"Rubel naddniestrzański","context_page_description":"Rubel naddniestrzański – oficjalna jednostka płatnicza w nieuznawanej Republice Naddniestrzańskiej. Wprowadzona jako oficjalna waluta republiki w sierpniu 1994 roku. W związku ze statusem Naddniestrza, waluta nie posiada kodu ISO 4217 dla waluty, choć niektóre instytucje naddniestrzańskie używają kodu PRB, a Bank Republiki Naddniestrzańskiej niekiedy określa go jako RUP.\\nNa wypuszczonych banknotach znajdowały się podobizny rosyjskiego dowódcy Aleksandra Suworowa, który był założycielem Tyraspola, będącego stolicą republiki, oraz hetmana Bohdana Chmielnickiego. Galopująca hiperinflacja doprowadziła do bardzo szybkiego spadku wartości waluty: w 2000 r. najmniejszy pozostający w obrocie banknot miał wartość 10 000 rubli.\\nNa początku 2001 przeprowadzono denominację rubla naddniestrzańskiego w stosunku 1 000 000:1.\\nNa nowych banknotach widnieją podobizny Aleksandra Suworowa, ukraińskiego poety Tarasa Szewczenki oraz mołdawskiego hospodara Dymitra Cantemira.\\nOkoło 8 milionów rubli naddniestrzańskich zostało wybitych w 2004 roku w polskiej Mennicy Państwowej."},{"page_url":"https://de.wikipedia.org/wiki/M%C3%A1nes_(Kunstverein)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Manes_Jan_Foltan_Maroko_Brana_Zapadu_10.JPG","page_title":"Mánes (Kunstverein)","context_page_description":"Der Verein bildender Künstler Mánes ist eine 1887 gegründete, nach dem Maler Josef Mánes benannte Künstlervereinigung in der tschechischen Hauptstadt Prag. Das Gebäude des Vereins befindet sich direkt am rechten Moldauufer.\\nZu Beginn des 20. Jahrhunderts war der Verein maßgeblich für die Entwicklung des tschechischen Kubismus und Rondokubismus."},{"page_url":"https://tl.wikipedia.org/wiki/Jean-Marie_Roland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Jean-Marie_Roland.jpg","page_title":"Jean-Marie Roland","context_page_description":"Si Jean-Marie Roland, de la Platière ay isang Pranses na tagapagmanupaktura sa Lyon at naging pinuno ng pangkat na Girondista noong panahon ng Himagsikang Pranses, na malakihang naimpluwensiyahan ng kaniyang asawang si Marie-Jeanne \\"Manon\\" Roland de la Platiere papunta sa direksiyong ito. Naglingkod siya bilang isang Ministrong Panloob ng Pransiya sa loob ng pamahalaan ni Haring Louis XVI noong 1792."},{"page_url":"https://id.wikipedia.org/wiki/50_Let_Pobedy","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/50letPob_pole.JPG","page_title":"50 Let Pobedy","context_page_description":"NS 50 Let Pobedy, diterjemahkan sebagai 50 Tahun Kemenangan atau Fiftieth Anniversary of Victory, adalah kapal pemecah es bertenaga nuklir Rusia kelas Arktika dan kapal pemecah es bertenaga nuklir terbesar di dunia.\\nKonstruksi proyek nomor. 10.521 mulai pada tanggal 4 Oktober 1989 di Baltic Works di Leningrad, Uni Soviet. Awalnya kapal itu bernama NS Ural. Pekerjaan dihentikan pada tahun 1994 karena kurangnya dana, sehingga pada ulang tahun kelimapuluh di Hari Kemenangan, pada tahun 1995, kapal dalam keadaan ditinggalkan. Konstruksi dimulai kembali pada tahun 2003.\\nPada tanggal 30 November 2004, kebakaran terjadi di kapal. Semua pekerja kapal kapal harus diungsikan sementara kru api berjuang memadamkan api selama 20 jam sebelum mendapatkan di bawah kendali; satu pekerja dikirim ke rumah sakit. Tidak ada ancaman kontaminasi radioaktif dari reaktor nuklir karena belum memiliki bahan bakar dalam.\\nDia akhirnya selesai pada awal tahun 2007, setelah Anniversary ke-60. Pemecah es yang berlayar ke Teluk Finlandia selama dua minggu pada percobaan laut pada tanggal 1 Februari 2007.\\nSetelah menyelesaikan uji coba laut, kapal pemecah es yang kembali ke galangan kapal St."},{"page_url":"https://id.wikipedia.org/wiki/Rompi_anti_peluru","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Modular_Tactical_Vest_components.jpg","page_title":"Rompi anti peluru","context_page_description":"Rompi anti peluru adalah pakaian Zirah yang melindungi bagian tubuh seperti dada, perut, dan punggung orang yang memakainya. Rompi ini melindungi pemakainya dari proyektil peluru dan serpihan dari ledakan granat. Biasanya dipakai oleh polisi, tentara, pasukan keamanan dan orang-orang yang memiliki risiko menjadi sasaran tembak yang tinggi seperti kepala negara, agen rahasia, polisi atau personil militer dan pasukan pengaman lainnya. Pakaian ini melindungi hampir 1/2 bagian tubuh manusia.Akan tetapi risiko tertembak adalah 1/3. Bagian besi yang melindungi tubuh kita berada di sekitar perut."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%90%E1%83%9C%E1%83%90%E1%83%93%E1%83%98%E1%83%A1_%E1%83%99%E1%83%9A%E1%83%93%E1%83%9D%E1%83%95%E1%83%90%E1%83%9C%E1%83%98_%E1%83%9B%E1%83%97%E1%83%94%E1%83%91%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Berengia_-_present_day.png","page_title":"კანადის კლდოვანი მთები","context_page_description":"კანადის კლდოვანი მთები — 80-ზე მეტ მთათა სისტემაში მდებარე სულ მცირე 200 მთისაგან შემდგარი მთათა სისტემა. მოიცავს ჩრდილოეთ ამერიკის კლდოვანი მთების კანადურ სეგმენტს. გვხვდება მის 2 პროვინციაში. მთლიანობაში შეადგენს კანადის ფართობის 2%-ს."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D1%96%D0%B2%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/%D0%A1%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B3%D0%BE%D1%80%D1%96%D0%B2%D0%BA%D0%B0%2C_%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB.jpg","page_title":"Красногорівка","context_page_description":"Красного́рівка — місто районного значення у Мар'їнському районі Донецької області."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_chr%C3%A1n%C4%9Bn%C3%BDch_%C3%BAzem%C3%AD_v_okrese_Bansk%C3%A1_%C5%A0tiavnica","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Bansk%C3%A1_%C5%A0tiavnica_-_Botanick%C3%A1_z%C3%A1hrada.jpg","page_title":"Seznam chráněných území v okrese Banská Štiavnica","context_page_description":"Toto je seznam chráněných území v okrese Banská Štiavnica aktuální k roku 2017, ve kterém jsou uvedena chráněná území v oblasti okresu Banská Štiavnica."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%AA%E3%82%AA%E3%83%AA%E3%81%AE%E5%8A%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/%E5%9B%9E%E8%BB%A2%E5%BA%A7%E6%A8%99.jpg","page_title":"コリオリの力","context_page_description":"コリオリの力とは、回転座標系上で移動した際に移動方向と垂直な方向に移動速度に比例した大きさで受ける慣性力の一種であり、コリオリ力、転向力ともいう。1835年にフランスの科学者ガスパール＝ギュスターヴ・コリオリが導いた。\\n回転座標系における慣性力には、他に、角速度変化に伴うオイラー力と回転の中心から外に向かって働く遠心力がある。"},{"page_url":"https://en.wikipedia.org/wiki/2011_Super_Outbreak","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Phil_Campbell_tornado_damage2.jpg","page_title":"2011 Super Outbreak","context_page_description":"The 2011 Super Outbreak was the largest, costliest, and one of the deadliest tornado outbreaks ever recorded, taking place along the Southern, Midwestern, and Northeastern United States and leaving catastrophic destruction in its wake. The event not only affected Alabama and Mississippi the most severely, but also produced destructive tornadoes in Arkansas, Georgia, Tennessee and Virginia, and affected many other areas throughout the Southern and Eastern United States. In total, 360 tornadoes were confirmed by NOAA's National Weather Service and Government of Canada's Environment Canada in 21 states from Texas to New York to southern Canada. Widespread and destructive tornadoes occurred on each day of the outbreak, with April 27 being the most active day with a record of 216 tornadoes touching down that day from midnight to midnight CDT. Four of the tornadoes were destructive enough to be rated EF5, which is the highest ranking possible on the Enhanced Fujita scale; typically these tornadoes are only recorded about once each year or less."},{"page_url":"https://pt.wikipedia.org/wiki/Bernay-Vilbert","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Town_hall_of_Vilbert_P1060898.JPG","page_title":"Bernay-Vilbert","context_page_description":"Bernay-Vilbert é uma comuna francesa localizada na região administrativa da Île-de-France, no departamento Sena e Marne. A comuna possui 629 habitantes segundo o censo de 1990."},{"page_url":"https://mg.wikipedia.org/wiki/Courtauly","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Blason_ville_fr_Courtauly.svg","page_title":"Courtauly","context_page_description":"I Courtauly dia kaominina ao amin'ny fivondronan'i Limoux, ao amin'ny departemantan'i Aude, ao amin'ny faritr'i Languedoc-Roussillon, ao Frantsa.\\nNy INSEE dia mampiasa ny kaodim-paositra 11107.\\nI Gérard Joulia no ben'ny tanàna mandritry ny taona 2008–2014. Ilay kaominina dia kaominina mpikambana amin'ny fivondronan-kaominin'i Chalabrais"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D1%8A%D0%BD%D0%B5%D0%BA%D1%82%D0%B8%D0%BA%D1%8A%D1%82_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/IMG_3758_view_north_from_French_King_Bridge.jpg","page_title":"Кънектикът (река)","context_page_description":"Кънектикът е най-голямата река в Нова Англия, САЩ.\\nДълга е 655 км. Извира на 811 м н.в. в северната част на Ню Хемпшир. Тече на югозапад и формира границата между Върмонт и Ню Хемпшир, след което пресича Масачузетс и Кънектикът, за да се влее в Лонг Айланд Саунд. Реката има над 50 притока. Водосборният басейн на реката е с площ от 28 710 км².\\nВидяна е за първи път от европеец през 1614 г."},{"page_url":"https://en.wikipedia.org/wiki/Nationalist_Party_of_Puerto_Rico","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Pedro_Albizu_Campos_raising_his_hat_to_a_crowd%2C_1936.jpg","page_title":"Nationalist Party of Puerto Rico","context_page_description":"The Puerto Rico Nationalist Party is a Puerto Rican political party which was founded on September 17, 1922, in San Juan, Puerto Rico. Its primary goal was to work for Puerto Rico's independence. The Party's selection in 1930 of Pedro Albizu Campos as its president brought a radical change to the organization and its tactics.\\nIn the 1930s, intimidation, repression and persecution of Party members by the government, then headed by a U.S. president-appointed governor, led to the assassination of two government officials, the attempted assassination of a federal judge in Puerto Rico, and the Rio Piedras and Ponce massacres. Under the leadership of Albizu Campos, the party abandoned the electoral process in favor of direct armed conflict as means to gain independence from the United States.\\nBy the late 1940s, a more US-friendly party, the Partido Popular Democrático, had gained an overwhelming number of seats in the legislature and, in 1948, it passed Ley de la Mordaza, which attempted to suppress the Nationalist Party and similar opposition. The Puerto Rican police arrested many Nationalist Party members under this law, some of whom were sentenced to lengthy prison terms."},{"page_url":"https://de.wikipedia.org/wiki/Ostarrichi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Ostarrichi.jpg","page_title":"Ostarrichi","context_page_description":"Ostarrichi, auch Ostarrîchi, zeitgenössisch anfangs auch Marcha orientalis, später Marcha Austriae oder Osterland, als Mark Österreich oder Markgrafschaft Österreich, ab dem 19. Jahrhundert vereinzelt auch als Ostmark bezeichnet, war nominell Teil des Herzogtums Bayern von 976 bis zur Unabhängigkeit 1156 als Herzogtum Österreich."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_Berkeley_Software_Distribution","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/VAX_11-780_intero.jpg","page_title":"History of the Berkeley Software Distribution","context_page_description":"The History of the Berkeley Software Distribution begins in the 1970s."},{"page_url":"https://nl.wikipedia.org/wiki/Spoorlijn_Eilsleben_-_Sch%C3%B6ningen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/DB_6874_railway_map.png","page_title":"Spoorlijn Eilsleben - Schöningen","context_page_description":"De spoorlijn Eilsleben - Schöningen was een Duitse spoorlijn in Saksen-Anhalt en Nedersaksen en was als spoorlijn 6874 onder beheer van DB Netze. Het gedeelte tussen Offleben en Schöningen was tijden de Duitse deling als spoorlijn 1941 onder beheer van DB Netze."},{"page_url":"https://de.wikipedia.org/wiki/St.-Paulus-Dom_(M%C3%BCnster)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Cross_M%C3%BCnster.JPG","page_title":"St.-Paulus-Dom (Münster)","context_page_description":"Der St.-Paulus-Dom ist eine römisch-katholische Kirche in Münster unter dem Patrozinium des Apostels Paulus. Die Kathedrale des Bistums Münster zählt zu den bedeutendsten Kirchenbauten in Münster und ist neben dem historischen Rathaus eines der Wahrzeichen der Stadt. Verwaltet wird der Dom vom Domkapitel Münster.\\nDer Dom steht im Herzen der Stadt auf einer kleinen Anhöhe, Horsteberg genannt, die halbkreisförmig durch den Straßenzug von Spiekerhof, Roggenmarkt, Prinzipalmarkt und Rothenburg umgrenzt wird. Dieses Gebiet, samt Domplatz und angrenzenden Gebäudeflächen, bildete die alte Domburg und Domimmunität. Für diesen Bezirk hat der Dom heute die Funktion einer Pfarrkirche. Westlich des Doms liegt die Kettelersche Doppelkurie: das heutige Bischofspalais sowie eines der ehemaligen Kuriengebäude mit der heutigen Domverwaltung. An der Stelle der weiteren, ehemals um den Domplatz befindlichen Kuriengebäude stehen unter anderem Gebäude der Universität Münster, der Bezirksregierung Münster und das LWL-Landesmuseum für Kunst und Kulturgeschichte.\\nDie Kathedrale hatte zwei Vorgängerbauten: Der erste Dom stand nördlich des heutigen Doms; der zweite Dom wurde im 10. oder 11."},{"page_url":"https://es.wikipedia.org/wiki/Pol%C3%ADtica_econ%C3%B3mica_del_gobierno_de_Hugo_Ch%C3%A1vez","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Venezuela_oil_revenues_1975_-.png","page_title":"Política económica del gobierno de Hugo Chávez","context_page_description":"Desde su elección en 1998 hasta su muerte en marzo de 2013, el gobierno del fallecido presidente venezolano Hugo Chávez propuso y promulgó políticas económicas populistas como parte de su Revolución Bolivariana.\\nA principios de la década de 2000, cuando los precios del petróleo se dispararon y le ofrecieron fondos a Chávez no vistos desde el comienzo del colapso económico de Venezuela en la década de 1980.​​ A nivel nacional, Chávez utilizó esos fondos petroleros para políticas populistas, creando las \\"Misiones Bolivarianas\\", destinadas a brindar servicios públicos para mejorar las condiciones económicas, culturales y sociales.​ Estas políticas incluían la redistribución de la riqueza, la reforma agraria y la democratización de la actividad económica mediante la autogestión del lugar de trabajo y la creación de cooperativas propiedad de los trabajadores A nivel internacional, la administración de Chávez utilizó la producción de petróleo para aumentar la autonomía de los gobiernos de Estados Unidos y Europa y utilizó los fondos petroleros para promover la integración económica y política con otras naciones latinoamericanas."},{"page_url":"https://de.wikipedia.org/wiki/Sarrazac_(Dordogne)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Sarrazac_%28Dordogne%29_%C3%A9glise_%282%29.JPG","page_title":"Sarrazac (Dordogne)","context_page_description":"Sarrazac ist eine Gemeinde mit 381 Einwohnern im französischen Département Dordogne in der Region Nouvelle-Aquitaine. Die Gemeinde gehört zum Arrondissement Nontron und zum Kanton Isle-Loue-Auvézère. Die Einwohner werden Sarrazacois genannt."},{"page_url":"https://lb.wikipedia.org/wiki/%C3%89istr%C3%A4icheschen_Ierffollegkrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Maurice_Quentin_de_La_Tour_-_Maurice%2C_Comte_de_Saxe%2C_Marshal_of_France_-_WGA12352.jpg","page_title":"Éisträicheschen Ierffollegkrich","context_page_description":"Den Éisträicheschen Ierffollegkrich ass 1740 nom Doud vum Karl VI. ausgebrach, a sollt bis 1748 daueren.\\nAm Joer 1740 ass et eriwwer mam Gläichgewiicht an Europa, an dat mam Doud vun zwee groussen Herrscher. Nom Doud vum Friedrich Wilhelm I. geet d'Kroun u säi Bouf, de Friedrich II., deemools 28 Joer jonk, deen de Ruff vun engem \\"Bel Esprit\\" huet, a sech haaptsächlech mat Museker, Philosophen a Poeten ofgëtt, also als \\"ongeféierlech\\" gëllt. Den Doud vum Keeser Karl VI. ass do scho méi problematesch. D'Pragmatesch Sanktioun, duerch déi seng Duechter Maria Theresia sollt d'Territoirë vun der Monarchie ierwen, gouf net vun allen europäeschen Herrscher unerkannt. De gréisste Problem war net, wat si ierwe sollt, mä wien alles dovu profitéiert. Bestuet war d'Maria Theresia nämlech mam François III. vu Loutrengen, an duerch d'Ierfschaft hat dësen eng Chance zum Keeser gewielt ze ginn. Fir Frankräich hätt dat d'Habsburger als direkt Nopere bedeit, wat si op kee Fall wollten. Doriwwereraus haten de Friedrich vu Preisen an de Karl Albrecht, Kurfürst vu Bayern hir eege Meenungen wéi den Territoire am beschte kéint opgedeelt ginn."},{"page_url":"https://pl.wikipedia.org/wiki/Wiktor_Krupski","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/%D0%90%D0%BB%D0%B5%D1%8F_%D0%93%D0%B5%D1%80%D0%BE%D1%97%D0%B2_-_%D0%9A%D1%80%D1%83%D0%BF%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%92%D1%96%D0%BA%D1%82%D0%BE%D1%80_%D0%99%D0%BE%D1%81%D0%B8%D0%BF%D0%BE%D0%B2%D0%B8%D1%87_%282011.09.20%29.JPG","page_title":"Wiktor Krupski","context_page_description":"Wiktor Iosifowicz Krupski – radziecki lotnik wojskowy, major, Bohater Związku Radzieckiego."},{"page_url":"https://pl.wikipedia.org/wiki/Wiener_Neustadt_Hauptbahnhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/WrNeustadt_Hbf_02.jpg","page_title":"Wiener Neustadt Hauptbahnhof","context_page_description":"Wiener Neustadt Hauptbahnhof – stacja kolejowa w Wiener Neustadt, w kraju związkowym Dolna Austria, w Austrii. Dziennie obsługuje około 700 pociągów i 25 000 pasażerów. Jest jednym z największych węzłów kolejowych w Austrii. Łączą się tu linie kolejowe m.in. z Wiednia, Bruck an der Mur i Mattersburga.\\nStacja w latach 1997 - 2003 została gruntownie przebudowana, jest również punktem wyjściowym większości autobusów miejskich. Bezpośrednio w budynku dworca jest oddział poczty."},{"page_url":"https://vi.wikipedia.org/wiki/Salix_integra","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Salix_integra_Hakuro_B.jpg","page_title":"Salix integra","context_page_description":"Salix integra là một loài thực vật có hoa trong họ Liễu. Loài này được Thunb. miêu tả khoa học đầu tiên năm 1784."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A4%D1%83%D0%B4%D0%B1%D0%B0%D0%BB%D1%81%D0%BA%D0%B8_%D0%BA%D1%83%D0%BF_%D0%BD%D0%B0_%D0%9C%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D0%B8%D1%98%D0%B0_1997-1998","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/600px_Azzurro5.png","page_title":"Фудбалски куп на Македонија 1997-1998","context_page_description":"Фудбалски куп на Македонија 1997–1998 - 6. издание на Македонскиот Куп.\\nВо оваа сезона шампион бил Вардар."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Leiden,_Binnenstad-Noord","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Leiden_-_Haven_6-8_GM-1073_20200418.jpg","page_title":"Lijst van gemeentelijke monumenten in Leiden, Binnenstad-Noord","context_page_description":"De wijk Binnenstad-Noord in Leiden heeft 554 gemeentelijke monumenten, hieronder een overzicht."},{"page_url":"https://de.wikipedia.org/wiki/Abraham_Speijer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Abraham_Speijer.JPG","page_title":"Abraham Speijer","context_page_description":"Abraham Speijer war ein niederländischer Schachmeister.\\nSpeijer zählte zu Beginn des 20. Jahrhunderts zu den besten Schachspielern in den Niederlanden. Er nahm in dieser Zeit an einer Reihe bedeutender internationaler Turniere teil, u. a. in Hilversum 1903, wo Speijer Vierter wurde, in Sankt Petersburg 1909, Hamburg 1910, Scheveningen 1913. 1908 verlor er in Amsterdam einen Kurzwettkampf gegen den damaligen Weltmeister Emanuel Lasker mit 0,5-2,5.\\nSpeijer gewann 1909 in Leiden gemeinsam mit Adolf Olland die erstmals ausgetragene niederländische Landesmeisterschaft mit 5 Punkten aus 8 Partien, doch wurde Olland zum Champion erklärt, da er in der direkten Begegnung Speijer besiegt hatte. Speijer trat seit Mitte der 1920er Jahre schachlich nicht mehr in Erscheinung."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%84%D0%BE%D1%80%D0%BC%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Hampeln.jpg","page_title":"Великая реформа","context_page_description":"«Вели́кая рефо́рма: Русское общество и крестьянский вопрос в прошлом и настоящем» — юбилейное энциклопедическое издание, посвящённое пятидесятилетию осуществления Крестьянской реформы в России. «Великая реформа» выпущена в Москве в 1910 — 1911 годах Исторической комиссией учебного отдела московского Общества распространения технических знаний и товариществом И. Д. Сытина в виде комплекта из шести томов большого энциклопедического формата.\\n«Великая реформа» — первое и наиболее известное из серии «роскошных» в книгоиздательской терминологии того времени юбилейных изданий, предпринятое издателем Иваном Сытиным в 1910-е годы. В 1911 году им была издан семитомник «Отечественная война и русское общество. 1812 — 1912», посвящённый столетнему юбилею Отечественной войны 1812 года, в 1912 — 1913 годах — шеститомное историческое исследование о трёхсотлетии Дома Романовых — «Три века. Россия от смуты до нашего времени», двухтомник «Государи из дома Романовых 1613 — 1913», 1913 год; «Полвека для книги », 1916 год. Помимо юбилейных изданий Сытиным тогда же были изданы «Народная энциклопедия», «Военная энциклопедия» и «Детская энциклопедия»."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D1%80%D0%B4%D0%B5%D0%BD%D1%84%D0%BB%D0%B8%D1%85%D1%82,_%D0%A5%D0%B5%D0%B4%D0%B2%D0%B8%D0%B3%D0%B0_%D0%A8%D0%B0%D1%80%D0%BB%D0%BE%D1%82%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Hedvig_Nordenflycht_by_Martin.jpg","page_title":"Норденфлихт, Хедвига Шарлотта","context_page_description":"Хедвига Шарлотта Норденфлихт — шведская писательница и поэтесса."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%82%B9%E3%83%84%E3%83%8E%E3%83%AA%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Final_Costunolide_Synthesis.png","page_title":"コスツノリド","context_page_description":"-コスツノリドは、天然に存在するセスキテルペンラクトンの一つ。1960年にモッコウの根から初めて単離された。また、レタスにも含まれている。"},{"page_url":"https://es.wikipedia.org/wiki/Catherine_Madox_Brown","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Stages_of_Cruelty_by_Ford_Madox_Brown.jpg","page_title":"Catherine Madox Brown","context_page_description":"Catherine Madox Brown Hueffer, también conocida como Cathy, fue una artista y modelo asociada con los prerrafaelitas."},{"page_url":"https://nl.wikipedia.org/wiki/Musculus_latissimus_dorsi","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Latissimus_dorsi.PNG","page_title":"Musculus latissimus dorsi","context_page_description":"De musculus latissimus dorsi of brede rugspier behoort tot de dorsale spiergroep. Dit is een brede, platte spier, de grootste spier van de mens.\\nHij ontspringt aan de doornuitsteeksels van de 7e - 12e borstwervel als de pars vertebralis, van de fascia thoracolumbaris en het achterste deel van de crista iliaca als de pars iliaca, van de 10e - 12e rib als de pars costalis en bovendien heel vaak van de angulus inferior van het schouderblad als de pars scapularis.\\nDe brede rugspier bestaat daarom uit vier delen die elk een verschillende functie hebben. Hij zit gezamenlijk vast met de musculus teres major, de grote ronde armspier, aan de crista tuberculi minoris op de humerus, het opperarmbeen.\\nDirect voor de verbinding van de beide spieren bevindt zich een bursa subtendinea musculi latissimi dorsi.\\nDe grote rugspier vormt de spierbasis van de achterste okselplooi. Hij trekt de opgeheven arm omlaag en adduceert deze. Bij een geadduceerde arm zal hij deze naar achter en mediaalwaarts trekken en daarbij zover naar binnen roteren dat de handrug op het zitvlak komt te liggen. De beide rugspieren kunnen samenwerken en de schouders naar achter en onder trekken."},{"page_url":"https://sv.wikipedia.org/wiki/H%C3%B6gan%C3%A4s_AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/H%C3%B6gan%C3%A4sgul.JPG","page_title":"Höganäs AB","context_page_description":"Höganäs AB är ett svenskt företag inom metallpulvertillverkning. Företaget har sitt ursprung i det gamla bruket Höganäs och har fortfarande sitt huvudkontor i staden Höganäs i Skåne."},{"page_url":"https://de.wikipedia.org/wiki/St._Martin_(Lobsing)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Kirche_St._Martin_in_Lobsing%2C_Landkreis_Eichst%C3%A4tt.jpg","page_title":"St. Martin (Lobsing)","context_page_description":"Die Pfarrkirche St. Martin ist die katholische Dorfkirche der Gemeinde Lobsing in Oberbayern."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D9%86%D9%88_%D8%AA%D9%88%D8%A6%DB%8C%D8%B2%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Twizy-IMG_6981.JPG","page_title":"رنو توئیزی","context_page_description":"توئیزی نام خودرو الکتریکی است که توسط شرکت رنو طراحی و ساخته شده‌است وکارخانه بین‌المللی آن در شهر والادولید کشور اسپانیا قرار دارد. توئیزی در تاریخ مارس ۲۰۱۲ برای فروش در فرانسه, انگلستان و دیگر نقاط اروپا ارائه شده‌است\\nاین خودرو در سه تیپ ارائه می‌شود که شروع قیمت ان از €۶۹۹۰ تا €۸۴۹۰ می‌باشد. قیمت فروش شامل باتری‌ها نمی‌باشد. و باید برای گارانتی تعویض و اجاره ماهانه یا عدم ظرفیت کافی باتری- و کمک‌های کنار جاده‌ای پرداخت شود.\\nدر سال ۲۰۱۲ توئیزی به عنوان پرفروش‌ترین خودرو برقی اروپا دست یافت\\nازتاریخ مارس ۱۰۱۲ تا دسامبر۲۰۱۲ تعداد ۹۰۲۰ تعداد از این خودرو به فروش رفته است, بیشترین فروش این خودرو در آلمان،فرانسه و ایتالیا بوده‌است."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8A%A4%ED%83%80%EC%9D%BC_%EC%98%A4%EB%B8%8C_%EC%95%84%EC%9D%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Style_of_Eye_Press_Photo_by_FREDRIK-SKOGKVIST_-_Small.jpg","page_title":"스타일 오브 아이","context_page_description":"스타일 오브 아이는 스웨덴의 DJ이다."},{"page_url":"https://pl.wikipedia.org/wiki/Wierzchucinek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Wiechrzucinek_z5.jpg","page_title":"Wierzchucinek","context_page_description":"Wierzchucinek – wieś w Polsce położona w województwie kujawsko-pomorskim, w powiecie bydgoskim, w gminie Sicienko."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%95%87%E6%B5%B7%E6%96%87%E5%BA%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Inkstone_Pool_of_Zhenhai_Confucius_Temple%2C_2017-11-19_02.jpg","page_title":"镇海文庙","context_page_description":"鎮海文廟又名鎮海學宮，位於中國浙江省寧波市鎮海區招寶山街道東北，大部與今鎮海中學範圍重合，是舊時鎮海縣的最高學府和祭祀孔子的場所。學宮始建於北宋雍熙二年，後屢次重建，現尚存硯池、泮池、大成門、大成殿等建築。鎮海文廟泮池為鴉片戰爭時欽差大臣裕謙殉國之處，因而被列入第四批全國重點文物保護單位中的鎮海口海防遺址項目，而大成殿則為鎮海區文物保護單位。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%BA%D0%BE%D0%BC%D0%BC%D0%B0%D0%BD%D0%B4%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Commando_Memorial_-_geograph.org.uk_-_876209.jpg","page_title":"Памятник коммандос","context_page_description":"Памятник коммандос — исторический бронзовый монумент, посвященный британским коммандос, участвовавшим во Второй мировой войне. Памятник находится в миле от села Спин-Бридж в районе Лохабер округа Хайленд на северо-шотландском нагорье в Шотландии в Великобритании."},{"page_url":"https://de.wikipedia.org/wiki/Pinne_(Schiffbau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Laser_Radial_160588_02.jpg","page_title":"Pinne (Schiffbau)","context_page_description":"Die Pinne ist auf Wasserfahrzeugen der Hebel, mit dem das Ruder bedient wird, um das Fahrzeug zu steuern. Pinne und Ruder sind zumeist in einem gemeinsamen Angelpunkt durch einen Ruderschaft verbunden.\\nAuf Segelbooten bis etwa 35 Fuß besitzt die Pinne meistens einen Pinnenausleger: Auf dem Ende der Pinne ist mit einem drehbaren Gelenk ein Stock befestigt, so dass die Pinne über diese Verlängerung bewegt werden kann. Sie kann dadurch auch dann noch bedient werden, wenn sich der Steuermann beispielsweise beim Ausreiten von ihr entfernen muss. Ausleger sind meist aus faserverstärktem Kunststoff oder Aluminiumrohr gefertigt und enden in einem Quergriff. Bis ins 18. Jahrhundert wurde der Kolderstock benutzt, um dem Rudergänger eine bessere Position zu geben.\\nHat ein Außenbordmotor im Betrieb die Funktion des Ruders und verfügt er über einen Hebel, der zum Schwenken des Motors dient und an dem sich in der Regel auch Gasdrehgriff und Schalthebel befinden, wird dieser Hebel ebenfalls als Pinne bezeichnet.\\nAuf größeren Booten und Schiffen wird zur Bedienung des Ruders zumeist ein Steuerrad verwendet."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%82%D0%BE%D0%BB%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Etauliers_mairie.JPG","page_title":"Етолије","context_page_description":"Етолије насеље је и општина у југозападној Француској у региону Аквитанија, у департману Жиронда која припада префектури Бле.\\nПо подацима из 2011. године у општини је живело 1579 становника, а густина насељености је износила 121,65 становника/km². Општина се простире на површини од 12,98 km². Налази се на средњој надморској висини од 7 метара."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%86%B0%E5%B3%B6%E6%95%99%E8%82%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Icelandic_Education_Levels.svg","page_title":"冰島教育","context_page_description":"冰岛的教育体制分为四个阶段：学前教育、义务教育、高级中等教育及高等教育，与北欧五国类似。其中，义务教育对象为六至十六岁的学童。冰岛大部分的教育机构系为国立，国内极少设有私立学校。冰岛并保有文科中学制度。"},{"page_url":"https://es.wikipedia.org/wiki/Juan_Mart%C3%ADn_Cabet","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Juan_Martin_Cabet.JPG","page_title":"Juan Martín Cabet","context_page_description":"Juan Martín Cabet, empresario andaluz de origen isleño y ascendencia catalana, introdujo en Andalucía y en España el arte de la tarrafa, aunque su introducción en Galicia debió esperar a 1902, y la propulsión a vapor en los barcos de pesca de su propia flota en Isla Cristina. De esta forma se ampliaban los caladeros al no estar circunscrita la zona de pesca al área cercana a la costa. Fue el primer armador de Isla Cristina. Fue asimismo el primer armador en usar hacia 1919 la iluminación eléctrica en Isla Cristina en uno de sus barcos de pesca a vapor.​También se le conoce con la castellanización de su segundo apellido, Juan Martín Cabot."},{"page_url":"https://fi.wikipedia.org/wiki/Heinolan_maalaiskunnan_vaakuna","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Heinolan.maalaiskunta.vaakuna.svg","page_title":"Heinolan maalaiskunnan vaakuna","context_page_description":"Heinolan maalaiskunnan vaakuna on saanut aiheensa vuonna 1934 Tuusjärven kylästä Viikinäisistä löydetystä reenjalaksesta. Jalas on ajoitettu 9000 vuoden ikäiseksi, ja se on tiettävästi maailman vanhin säilynyt reenjalas maailmassa. Jalas on näytteillä Kansallismuseossa Helsingissä.\\nVaakunan selitys on ”punaisessa kentässä paaluittain kaksi reenjalasta, joita yhdistää kaksi päällikkäistä poikkipuuta; kaikki hopeaa”. Vaakunan on suunnitellut Kaj Kajander, ja se vahvistettiin käyttöön 1. lokakuuta 1968. Vaakuna muuttui epäviralliseksi kotiseutuvaakunaksi 1997 Heinolan maalaiskunnan ja Heinolan kaupungin kuntaliitoksen yhteydessä."},{"page_url":"https://hu.wikipedia.org/wiki/A_Guarda","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/A_Guarda.jpg","page_title":"A Guarda","context_page_description":"A Guarda település Spanyolországban, Pontevedra tartományban. Lakosainak száma 10 438 fő."},{"page_url":"https://en.wikipedia.org/wiki/74th_Academy_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Jennifer_Connelly_2010_TIFF.jpg","page_title":"74th Academy Awards","context_page_description":"The 74th Academy Awards ceremony, presented by the Academy of Motion Picture Arts and Sciences, took place on March 24, 2002, at the Kodak Theatre in Hollywood, Los Angeles. During the ceremony, AMPAS presented Academy Awards in 24 categories honoring films released in 2001. The ceremony, televised in the United States by ABC, was produced by Laura Ziskin and directed by Louis J. Horvitz. Actress Whoopi Goldberg hosted the show for the fourth time. She first hosted the 66th ceremony held in 1994 and had last hosted the 71st ceremony in 1999. Three weeks earlier, in a ceremony held at the Regent Beverly Wilshire Hotel in Beverly Hills, California, on March 2, the Academy Awards for Technical Achievement were presented by host Charlize Theron.\\nA Beautiful Mind won four awards, including Best Picture and Best Director for Ron Howard. Other winners included The Lord of the Rings: The Fellowship of the Ring also with four awards, Black Hawk Down, and Moulin Rouge! with two, and The Accountant, For the Birds, Gosford Park, Iris, Monster's Ball, Monsters, Inc., Murder on a Sunday Morning, No Man's Land, Pearl Harbor, Shrek, Thoth, and Training Day, with one."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%81%D9%8A%D8%AF_%D8%BA%D8%A7%D8%B1%D9%8A%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Fanclub_-_David_Garrick_1.png","page_title":"ديفيد غاريك","context_page_description":"ديفيد غاريك ‏ هو مغني بريطاني، ولد في 12 سبتمبر 1945 في ليفربول في المملكة المتحدة، وتوفي في 23 أغسطس 2013 في Wirral Peninsula في المملكة المتحدة بسبب مرض."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BF%D1%81%D0%B0%D1%80%D0%B8_(%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/LepsariSchool.jpg","page_title":"Лепсари (деревня)","context_page_description":"Ле́псари — деревня в Романовском сельском поселении Всеволожского района Ленинградской области."},{"page_url":"https://en.wikipedia.org/wiki/Utopia,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/UtopiaOH2.JPG","page_title":"Utopia, Ohio","context_page_description":"Utopia is an unincorporated community in far southern Franklin Township, Clermont County, Ohio, United States, along the banks of the Ohio River. Utopia has been referred to as a \\"ghost town\\" although there are still people who live there."},{"page_url":"https://fr.wikipedia.org/wiki/Truffe_(champignon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Beaumont_-_truffi%C3%A8res.jpg","page_title":"Truffe (champignon)","context_page_description":"La truffe est le nom vernaculaire français donné à la fructification et à l'organe végétatif de plusieurs genres de champignons hypogés ascomycètes ectomycorhiziens qui se présente sous une forme plus ou moins globuleuse. Un même mycélium peut produire plusieurs truffes. Certaines espèces n'ont que peu de saveur alors que d'autres sont particulièrement appréciées et recherchées depuis l'Antiquité. Qu'elles aient poussé spontanément ou qu'elles soient issues de la trufficulture, les truffes sont très demandées par les gourmets.\\nLa truffe noire ou truffe du Périgord, en latin Tuber melanosporum, se trouve uniquement dans les sols calcaires à une profondeur de 1 à 15 cm au pied d'arbres dits truffiers. Elle se développe au printemps et grossit à partir de mi-août pour arriver à maturité plusieurs mois plus tard. Elle est alors ramassée à l'aide, en général, d'un chien truffier, d'un cochon ou de mouches.\\nIl existe plus d'une centaine d'espèces du genre Tuber, de la famille des Tuberaceae. Ces champignons et leurs fructifications sont tous appelés « truffe »."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%A9%E3%83%B3%E3%82%B9%E3%81%AE%E5%A4%A7%E7%B5%B1%E9%A0%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Napoleon-3.jpg","page_title":"フランスの大統領","context_page_description":"共和政時代のフランスの国家元首について、「大統領」と訳されない者を含めて年代順に一覧する。\\nなお、肩書きは時代により異なり、以下の通りである。\\nフランス第一共和政 － 国民公会議長、総裁政府総裁、第一統領\\nフランス第二共和政 － 臨時政府主席、行政権委員会議長、フランス国主席、共和国大統領\\nフランス第三共和政 － 国防政府主席、共和国行政長官、共和国大統領\\nヴィシー政権 － 国家主席\\nフランス共和国臨時政府 － フランス共和国臨時政府主席、臨時政府議長\\nフランス第四共和政以降 － 共和国大統領"},{"page_url":"https://vi.wikipedia.org/wiki/Elatine_brochonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Elatine_traiandra.JPG","page_title":"Elatine brochonii","context_page_description":"Elatine brochonii là một loài thực vật có hoa trong họ Elatinaceae. Loài này được Clavaud mô tả khoa học đầu tiên năm 1883."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%84%D9%8A%D8%A7%D9%85_%D8%A7%D9%84%D8%AB%D8%A7%D9%86%D9%8A_%D9%85%D9%86_%D9%81%D9%88%D8%B1%D8%AA%D9%85%D8%A8%D9%8A%D8%B1%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/K%C3%B6nig_Wilhelm_II.jpg","page_title":"وليام الثاني من فورتمبيرغ","context_page_description":"وليام الثاني من فورتمبيرغ هو سياسي من ألمانيا. ولد في شتوتغارت.\\nتوفي في توبنغن، عن عمر يناهز 73 عاماً."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%9C%D0%B8%D0%BD%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Coat_of_arms_of_Minsk.svg","page_title":"История Минска","context_page_description":"История Минска показывает развитие крупнейшего белорусского города и отражает исторические события региона в течение более 950 лет. Ранние поселения восточно-славянских племён кривичей и дреговичей в долине реки Свислочь на территории современного города относятся к IX веку. Эта территория входит в состав Полоцкого княжества в X веке. Первое летописное упоминание о Минске было в 1067 году в связи с битвой на Немиге. В XIV—XVIII веках Минск находился в составе Великого княжества Литовского и Речи Посполитой. В январе 1793 года город вошёл в состав Российской империи и быстро развивался в период промышленной революции XIX века. Минск был захвачен немецкой армией в 1918 году во время Первой мировой войны и передан Германии в соответствии с Брест-Литовским мирным договором. После поражения Германии и подписания Компьенского перемирия 11 ноября 1918 года, город был освобождён.\\n25 марта 1918 года в Минске была провозглашена независимость Белорусской Народной Республики.\\nМинск стал столицей 5 января 1919 года после провозглашения Советской Социалистической Республики Белоруссия в составе РСФСР. В период советско-польской войны город был занят армией Польской Республики."},{"page_url":"https://cs.wikipedia.org/wiki/Hyena_%C5%BE%C3%ADhan%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Striped-Hyena.JPG","page_title":"Hyena žíhaná","context_page_description":"Hyena žíhaná je jediným druhem hyeny, která se vyskytuje i mimo území Afriky, v Asii. Obývá rozsáhlé území stepí a polopouští od Senegalu po Indii a od Tanzanie až po Turkmenistán. Preferuje otevřenou krajinu stepí a savan, lesnatým územím a pouštím se vyhýbá."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AE%87%E9%83%A8%E6%97%A5%E5%A0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Ube_Nippo_head_office.JPG","page_title":"宇部日報","context_page_description":"宇部日報は、株式会社宇部日報社が発行する日本の新聞。全国郷土紙連合加盟。"},{"page_url":"https://en.wikipedia.org/wiki/Albrecht_von_Johansdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Codex_Manesse_Der_von_Johansdorf.jpg","page_title":"Albrecht von Johansdorf","context_page_description":"Albrecht von Johansdorf was a Minnesänger and a minor noble in the service of Wolfger of Erla. Documents indicate that his life included the years 1185 to 1209. He may have known Walther von der Vogelweide and is believed to have participated in a crusade. He is known to have written at least five \\"recruitment\\" songs in Middle High German, most likely for the Third Crusade. His \\"Song 2\\" owes a debt to the structure and melody from a song in Old French by trouvère poet Conon de Béthune. His \\"Song 5\\", which mentions the capture of Jerusalem, may suggest that he wrote around 1190. Von Johansdorf's Minnelieder conform outwardly to the standard pattern of man subordinating himself to the woman above him and is responsible for the classical formulation of \\"the educative value of Minnedienst\\". His integrity and warmth of heart are most evident in poems referring to the departure for the crusade."},{"page_url":"https://fr.wikipedia.org/wiki/Como%C3%A9_(fleuve)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Comoe_near_Folonzo_MS_1262.jpg","page_title":"Comoé (fleuve)","context_page_description":"La Comoé est un fleuve d'Afrique occidentale qui coule au Burkina Faso et en Côte d'Ivoire."},{"page_url":"https://id.wikipedia.org/wiki/Paku_tanduk_rusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Platycerium_andinum_1.jpg","page_title":"Paku tanduk rusa","context_page_description":"Paku tanduk rusa adalah sekelompok tumbuhan paku epifit yang semuanya tergabung dalam marga Platycerium'. Tumbuhan ini memiliki penampilan yang khas karena memiliki dua tipe ental dengan fungsi dan bentuk yang jelas berbeda, dengan salah satu tipe entalnya bercabang-cabang berbentuk seperti tanduk rusa. Paku yang juga dikenal sebagai simbar menjangan ini dapat dijumpai tumbuh liar di berbagai penjuru daerah tropika dan subtropika dunia."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%9C%D0%B0%D0%BD%D1%87%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Vladimir_Manchev.jpg","page_title":"Владимир Манчев","context_page_description":"Владимир Манчев — болгарський футболіст, що грав на позиції нападника. По завершенні ігрової кар'єри — тренер.\\nВиступав, зокрема, за клуби ЦСКА, «Лілль» та «Леванте», а також національну збірну Болгарії, з якою був учасником Євро-2004."},{"page_url":"https://en.wikipedia.org/wiki/Belfast_Harlequins","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Harlequins_Edit_edited.JPG","page_title":"Belfast Harlequins","context_page_description":"Belfast Harlequins is a multi-sports club located off the Malone Road in south Belfast, Northern Ireland. The club name provides the overall umbrella for rugby union, men's and ladies' hockey and squash. The club is associated on and off the field with Methodist College Belfast."},{"page_url":"https://de.wikipedia.org/wiki/Hootalinqua","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Norcom.jpg","page_title":"Hootalinqua","context_page_description":"Hootalinqua ist eine Ortschaft im kanadischen Territorium Yukon am Zusammenfluss von Teslin und Yukon River. Der Name Hootalinqua leitet sich aus der Sprache der Northern Tutchone ab. Diesen traditionellen Versammlungs- und Handelsort für Northern und Southern Tutchone als auch für Inland Tlingit nannten sie Hudinlin.\\nWie bei vielen anderen traditionellen Lagerplätzen oder Siedlungen der Indianer wurde diese auch während des Klondike-Goldrauschs von weißen Glücksuchern überrannt, die sofort hier eine Goldgräber-Siedlung errichteten. Die dort einst zum Fischen und zur Jagd ausgezogenen indianischen Familien, verdingten sich den Goldsuchern als billige Hilfskräfte, jagten für diese und schlugen nun Holz für die den Fluss entlang fahrenden Raddampfer. Heute sind dort restaurierte Cabins der früheren Siedlung und des Holzlagerplatzes zu sehen und außerdem befindet sich dort ein Camp mit Outhouse für Flusswanderer. Der Lagerplatz bietet sich aufgrund der Platzverhältnisse für größere Gruppen an. Wenn man einen kleinen Bach überquert, kann man außerdem zu einem kleinen Friedhof gelangen. Dort stehen Grabmale von Weißen und Indianern."},{"page_url":"https://it.wikipedia.org/wiki/Gabriel_Briard","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Gabriel_Briard_-_V%C3%AAnus_e_Cupido.jpg","page_title":"Gabriel Briard","context_page_description":"Gabriel Briard è stato un pittore francese."},{"page_url":"https://tr.wikipedia.org/wiki/Kemerk%C3%B6y,_Ka%C5%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/07580_Kemerk%C3%B6y-Ka%C5%9F-Antalya%2C_Turkey_-_panoramio.jpg","page_title":"Kemerköy, Kaş","context_page_description":"Kemerköy, Antalya ilinin Kaş ilçesine bağlı bir mahalledir."},{"page_url":"https://en.wikipedia.org/wiki/Offshore_wind_power","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Foundations_NREL.jpg","page_title":"Offshore wind power","context_page_description":"Offshore wind power or offshore wind energy is the use of wind farms constructed in bodies of water, usually in the ocean, to harvest wind energy to generate electricity. Higher wind speeds are available offshore compared to on land, so offshore wind power’s electricity generation is higher per amount of capacity installed, and NIMBY opposition to construction is usually much weaker.\\nUnlike the typical use of the term \\"offshore\\" in the marine industry, offshore wind power includes inshore water areas such as lakes, fjords and sheltered coastal areas as well as deeper-water areas. Most offshore wind farms employ fixed-foundation wind turbines in relatively shallow water. As of 2020, floating wind turbines for deeper waters are in the early phase of development and deployment.\\nAt the end of 2018, the total worldwide offshore wind power capacity was 23.1 gigawatt.\\nAll the largest offshore wind farms are currently in northern Europe, especially in the United Kingdom and Germany, which together account for over two-thirds of the total offshore wind power installed worldwide."},{"page_url":"https://ca.wikipedia.org/wiki/Saint-Maurice-de-Tavernole","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Map_commune_FR_insee_code_17371.png","page_title":"Saint-Maurice-de-Tavernole","context_page_description":"Saint-Maurice-de-Tavernole és un municipi francès, situat al departament del Charente Marítim i a la regió de la Nova Aquitània. L'any 2007 tenia 137 habitants."},{"page_url":"https://en.wikipedia.org/wiki/Adam_Krzesi%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Adam_Krzesinski.jpg","page_title":"Adam Krzesiński","context_page_description":"Adam Artur Krzesiński is a Polish fencer. He won a bronze medal in the team foil event at the 1992 Summer Olympics and a silver in the same event at the 1996 Summer Olympics."},{"page_url":"https://en.wikipedia.org/wiki/Nigel_Reo-Coker","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Carew_NR-C_Wrestling.JPG","page_title":"Nigel Reo-Coker","context_page_description":"Nigel Shola Andre Reo-Coker is an English professional footballer who plays as a midfielder. He is currently a free agent.\\nReo-Coker came through the youth team ranks at Wimbledon, and has previously played for West Ham United, Aston Villa, Bolton Wanderers, Ipswich Town, Vancouver Whitecaps FC, Chivas USA, Montreal Impact, Start and Milton Keynes Dons."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B8%9E%E7%91%AA%E7%91%99_(%E5%8A%A0%E5%88%A9%E7%A6%8F%E5%B0%BC%E4%BA%9E%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/OnyxCA.JPG","page_title":"縞瑪瑙 (加利福尼亞州)","context_page_description":"縞瑪瑙是位於美國加利福尼亞州克恩郡的一個人口普查指定地區。"},{"page_url":"https://ca.wikipedia.org/wiki/Saconin-et-Breuil","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Saconin-et-Breuil_%28Aisne%29_mairie-%C3%A9cole.JPG","page_title":"Saconin-et-Breuil","context_page_description":"Saconin-et-Breuil és un municipi francès, situat al departament de l'Aisne i a la regió dels Alts de França. L'any 2007 tenia 227 habitants."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%BE%D1%82%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%AE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Moskva_Hotel_in_MSK_%28img1%29.jpg","page_title":"Хотин, Алексей Юрьевич","context_page_description":"Алексе́й Ю́рьевич Хо́тин — российский предприниматель, владелец долей в финансовых организациях, объектах недвижимости и нефтегазодобывающих компаниях. В 2016 году занял 95 место в рейтинге 100 богатейших людей России согласно рейтингу журнала Forbes."},{"page_url":"https://en.wikipedia.org/wiki/Jewel_Cave_National_Monument","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Jewel_Cave_2.jpg","page_title":"Jewel Cave National Monument","context_page_description":"Jewel Cave National Monument contains Jewel Cave, currently the third longest cave in the world, with 200.3 miles of mapped passageways. It is located approximately 13 miles west of the town of Custer in Black Hills of South Dakota. It became a national monument in 1908."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%DB%8C%D9%84%D9%88%D9%85%DB%8C%D9%86%D8%A7%D8%AA%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Adam_weishaupt.jpg","page_title":"ایلومیناتی","context_page_description":"ایلومیناتی، به گروه‌های گوناگون واقعی و ساختگی گفته می‌شود. امروزه، ایلومیناتی فراگیرترین تئوری توطئه در جهان است.\\nایلومیناتی به گروه باوارین ایلومیناتی اشاره دارد. باوارین ایلومیناتی یک انجمن مخفی عصر روشنگری تأسیس شده در ۱ مه ۱۷۷۶ در باواریا بود. اهداف این انجمن مقابله با نفوذ خرافه، ظلمت‌پرستی و نفوذ مذهب بر زندگی عمومی و سوءاستفاده از قدرت بود. ایلومیناتی در کنار فراماسونری و دیگر انجمن‌های مخفی به تشویق کلیسای کاتولیک، در ۱۷۸۴، ۱۷۸۵، ۱۷۸۷، و ۱۷۹۰ با فرمان پادشاه بایرن ممنوع شدند. در سال‌های بعد این گروه از سوی منتقدین محافظه کار و مذهبی که ادعا می‌کردند فعالیت‌های آنها به‌طور زیرزمینی ادامه دارد و مسئول انقلاب فرانسه هستند با تهمت مواجه بود."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%82%A8%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Castillo_de_Ja%C3%A9n_III.JPG","page_title":"ハエン","context_page_description":"ハエンは、スペイン・アンダルシア州ハエン県のムニシピオ。ハエン県の県都である。\\n人口はハエン県の6分の1を占め、県の行政・産業の中心である。化学製品、なめし革、蒸留酒、クッキー、織物などの工場がある。スペイン有数のオリーブの産地であり、毎年オリーブエクスポを開催する。ハエン大学にはオリーブ研究機関があり、この分野で貢献している。"},{"page_url":"https://hu.wikipedia.org/wiki/%C3%9Ajvid%C3%A9k","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/A_h%C3%ADres_ford%C3%ADtott_%C3%B3ra_%28P%C3%A9terv%C3%A1rad%29.jpg","page_title":"Újvidék","context_page_description":"Újvidék, korábban Péterváradi Sánc város Szerbiában, a Vajdaság Autonóm Tartomány székvárosa és a Dél-bácskai körzet adminisztratív központja. A város Bácska és Szerémség határán, a Duna bal partján, a Tarcal-hegység északi lejtőin fekszik.\\nManapság Szerbia második legnagyobb városa Belgrád után. Vajdaság 1,9 milliós lakosságának közel egyötöde él itt, lakosainak száma a környező településekkel együtt, a 2011-es népszámlálás adatai szerint 341 625 fő. Soknemzetiségű város: szerbek, magyarok, horvátok, szlovákok, svábok és ruszinok is élnek itt.\\nÚjvidék ma a szerb ipar és pénzügy egyik legfontosabb központja, valamint Vajdaság egyetemi, tudományi, oktatási, egészségügyi, politikai és közigazgatási központja. Sok hazai és nemzetközi ipari, kulturális, tudományi és sportrendezvénynek a házigazdája, valamint a múzeumok, galériák, könyvtárak, színházak és mozik városa."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%88%D0%B5%D1%82%D0%B5%D0%BD%D0%B1%D0%B0%D1%85_(%D0%93%D0%BE%D1%80%D1%9A%D0%B8_%D0%91%D0%B0%D1%98%D0%B5%D1%80%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Waldkraiburg_238t.jpg","page_title":"Јетенбах (Горњи Бајерн)","context_page_description":"Јетенбах град је у њемачкој савезној држави Баварска. Једно је од 31 општинског средишта округа Милдорф ам Ин. Према процјени из 2010. у граду је живјело 702 становника. Посједује регионалну шифру 9183122."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_protestante_fran%C3%A7aise_de_Londres","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Eglise_Francaise_Soho_Square_1_%2824105299476%29.jpg","page_title":"Église protestante française de Londres","context_page_description":"L'Église protestante française de Londres est une église réformée qui sert la communauté francophone de Londres depuis 1550. Son temple, situé à Soho Square, est l'œuvre de l'architecte Aston Webb. L'Église est membre de la Communauté d’Églises protestantes francophones et en lien avec la Fédération protestante de France. Elle est l'une des deux Églises protestantes francophones en Angleterre, avec l'Église française de Canterbury."},{"page_url":"https://tr.wikipedia.org/wiki/Cide","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Gideros_Bay1.jpg","page_title":"Cide","context_page_description":"Cide, Türkiye Cumhuriyeti'nin Karadeniz Bölgesi'nde yer alan Kastamonu ilinin bir ilçesidir.\\nİlçe 939 km²'lik bir alanı kaplar ve toplam nüfusu 22.642'dir.\\n1868 yılında ilçe olan Cide’nin 85 köyü ve bu köylere bağlı 204 mahallesi bulunmaktadır. İlçede belediyeye bağlı altı mahalle vardır. İlçeye bağlı belde ve kasaba yoktur."},{"page_url":"https://ko.wikipedia.org/wiki/2018%EB%85%84_%EB%9F%AC%EC%8B%9C%EC%95%84_%EB%8C%80%ED%86%B5%EB%A0%B9_%EC%84%A0%EA%B1%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Sobchak.png","page_title":"2018년 러시아 대통령 선거","context_page_description":"2018년 러시아 대통령 선거는 2018년 5월 7일 취임하는 러시아의 대통령을 선출한 선거이다. 선거 결과 블라디미르 푸틴이 재선하며 4선이 확정되었다.\\n선거 운동은 2017년 12월부터 시작되었으며, 2018년 3월 18일 선거가 치러졌다.\\n2017년 12월 6일 블라디미르 푸틴 현직 대통령이 출마를 선언하였다. 이날 모스크바에서 열린 '2017 자원봉사자상' 시상식에서 곧 결정을 내릴 것이라고 밝혔으며, 이후 니즈니노브고로드의 GAZ 자동차 공장을 방문한 자리에서 대선 출마 선언을 하였다. 이어 12월 14일에 기자 회견을 통해 무소속으로 대선에 나서겠다고 밝혔다. 여당인 통합러시아당은 12월 23일 전당 대회를 통해 푸틴을 지지하기로 하였다.\\n푸틴에 앞서서 겐나디 주가노프, 블라디미르 지리놉스키, 그리고리 야블린스키, 보리스 티토프, 크세니야 솝차크 등이 출마를 선언하였다. 겐나디 주가노프는 러시아 연방 공산당 후보로 나설 예정이었으나, 고령을 이유로 파벨 그루디닌을 대신 추천하고 물러났다. 그루디닌은 후보 추대를 수락하고 공산당의 후보로 대선에 나선다.\\n한편, 야권 지도자 중 한 명인 알렉세이 나발니는 지방 정부 고문 재직 시절에 일어난 횡령 사건과 관련한 유죄 판결로, 출마가 금지되었다.\\n나발니가 12월 24일 후보 등록 서류를 선거관리위원회에 제출하였으나, 선거관리위원회 측이 나발니의 지지자 그룹의 등록을 거부하고 나발니의 범죄 사실을 적시하여 출마 불가를 재확인하였다."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Museen_in_Essen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Schloss-Borbeck-Komplettansicht-Sonnenuntergang-2012.jpg","page_title":"Liste der Museen in Essen","context_page_description":"Die Liste der Museen in Essen beschreibt die Museen in Essen, die unter anderem Kunst, Industriegeschichte und Heimatgeschichte zum Gegenstand haben."},{"page_url":"https://es.wikipedia.org/wiki/Kristjan_Jaak_Peterson","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Kristjan_Jaak_Peterson.jpg","page_title":"Kristjan Jaak Peterson","context_page_description":"Kristjan Jaak Peterson fue un poeta estonio, comúnmente considerado como el heraldo de la literatura nacional estonia y el fundador de la poesía estonia moderna.\\nSu carrera literaria se vio tempranamente truncada por la tuberculosis, que lo mató a la edad de 21 años. Su cumpleaños, el 14 de marzo, se celebra en Estonia como el Día de la Lengua Materna.​\\nKas siis selle maa keel\\nlaulutuules ei või\\ntaevani tõustes üles\\nigavikku omale otsida?\\n¿No puede la lengua de esta nación,\\nen el viento del cantar,\\nascender al cielo\\nbuscar la eternidad?\\nKristjan Jaak Peterson\\nEstas líneas del poema Kuu, las más conocidas del autor, han sido interpretadas como su reivindicación del derecho de emancipación del idioma estonio. Después de que fuera reabierta la Universidad de Tartu en 1802, pero con las clases impartidas solamente en alemán, Kristjan Jaak Peterson se convirtió en el primer estudiante universitario en reconocer su origen estonio, contribuyendo al \\"Despertar Nacional Estonio\\".​​\\nKristjan Jaak Peterson reunió sus poemas estonios en dos pequeños libros, pero nunca los vería publicados, pues ello ocurrió unos cien años más tarde de su fallecimiento."},{"page_url":"https://uk.wikipedia.org/wiki/Arthrocnemum_fruticosum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Sarcocornia_fruticosa.jpg","page_title":"Arthrocnemum fruticosum","context_page_description":"Arthrocnemum fruticosum — вид квіткових рослин родини амарантові. Етимологія: лат. fruticosa — «чагарник»."},{"page_url":"https://ca.wikipedia.org/wiki/Illa_Dougherty","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Nimrod.1909_voyage.jpg","page_title":"Illa Dougherty","context_page_description":"Dougherty és el nom d'una illa fantasma que es creia que estava situada entre l'oceà Pacífic i l'oceà Antàrtic, aproximadament a mig camí entre Cape Horn i Nova Zelanda. Rep el nom del Capità Dougherty del vaixell balener anglès James Stewart, qui l'any 1841 va informar del descobriment d'aquesta suposada illa a 59° 20′ S, 120° 20′ O. Ell la vadescriure com de 5-6 milles de llargada i coberta de neu. El descobriment de Dougherty va ser confirmat pel Capità Keates del Louise l'any 1860, i li va donar les coordenades de 59° 20′ S, 120° 18′ O, i pel Capità Stannard del Cingalese l'any 1886, amb les coordenades de 59° 21′ S, 119° 7′ O.\\nTanmateix, les exploracions de la resta del segle XIX i XX van establir que aquesta illa no existia. El Capità Davis del vaixell Nimrod va suggerir que probablement Dougherty, Keates, i Stannard van ser enganyats per bancs de boira o icebergs"},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%A1%D5%B6%D5%A3%D5%A5%D6%80%D5%AB%D5%B6%D5%A3%D5%A5%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Langerringen_-_Amtshaus_ehem_v_O.JPG","page_title":"Լանգերինգեն","context_page_description":"Լանգերինգեն, կոմունա Գերմանիայում, Բավարիա երկրամասում։\\nՄտնում է Աուգսբուրգի շրջանի կազմի մեջ։ Գտնվում է Շվաբիա վարչական շրջանի ենթակայության տակ։ Բնակչությունը 3772 մարդ է ։ Տարածքը 42,10 կմ² է։ Պաշտոնական կոդը՝ 09 7 72 170։"},{"page_url":"https://de.wikipedia.org/wiki/Chronologie_der_Luftfahrt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/At_North_Island%2C_Rowckwell_Field._Group_shot_around_Spirit_just_prior_to_flight_to_St._Louis._Lindbergh_is_in_front._%286107279064%29.jpg","page_title":"Chronologie der Luftfahrt","context_page_description":"Dieser Artikel gibt einen streng zeitlich geordneten Überblick über die Entwicklung der Luftfahrt. Die Chronologie der Erstflugtermine von Fluggeräten kann in der Liste der Erstflüge eingesehen werden. Eine an einzelnen Themen orientierte Darstellung findet sich im Artikel Geschichte der Luftfahrt."},{"page_url":"https://en.wikipedia.org/wiki/Gibraltar_City_Hall","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Connaught_House.jpg","page_title":"Gibraltar City Hall","context_page_description":"The Gibraltar City Hall is the former city hall for Gibraltar, centrally located within the city at the west end of John Mackintosh Square. It is the office of the Mayor of Gibraltar."},{"page_url":"https://de.wikipedia.org/wiki/Villa_Leutert","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Villa_Leutert_2.jpg","page_title":"Villa Leutert","context_page_description":"Die Villa Leutert ist eine Villa in Gießen."},{"page_url":"https://de.wikipedia.org/wiki/Milos-Mauereidechse","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Benny_Trapp_Podarcis_milensis.jpg","page_title":"Milos-Mauereidechse","context_page_description":"Die Milos-Mauereidechse zählt innerhalb der Familie der Echten Eidechsen zur Gattung der Mauereidechsen. Wissenschaftlich beschrieben wurde die Art im Jahre 1882 von dem russischen Herpetologen Jacques von Bedriaga."},{"page_url":"https://af.wikipedia.org/wiki/Sa%C3%B4ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/MapSa%C3%B4ne.jpg","page_title":"Saône","context_page_description":"Die Saône is 'n groot suidoos-vloeiende rivier in Frankryk. Die rivier, met 'n lengte van 473 km, is die langste sytak van die Rhône.\\nDie Saône ontspring naby Vioménil in die Vogese in die Franse gewes Grand Est van die historiese streek Lotaringe. Net wes ontspring die Maas en net oos die Moesel, 'n sytak van die Ryn. Aansluitend vloei die Saône in 'n suidwestelike rigting en mond by Lyon in die Rhône uit. Laasgenoemde sit die suidelike vloeirigting van die Saône vort. Die Saône vloei onder ander deur die Franse départements Vosges, Haute-Saône, Côte-d'Or, Saône-et-Loire, Rhône en Ain. Die gekanaliseerde Saône verbind die Rhônehawens met nywerheidstede soos Villefranche-sur-Saône, Mâcon en Chalons-sur-Saône."},{"page_url":"https://en.wikipedia.org/wiki/Luesma","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Luesma%2C_Zaragoza%2C_Espa%C3%B1a%2C_2017-01-04%2C_DD_58.jpg","page_title":"Luesma","context_page_description":"Luesma is a municipality located in the province of Zaragoza, Aragon, Spain. According to the 2004 census, the municipality has a population of 40 inhabitants."},{"page_url":"https://ms.wikipedia.org/wiki/Transjakarta","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Roundeltjk3.png","page_title":"Transjakarta","context_page_description":"Transjakarta —secara umumnya dipanggil Busway— ialah sistem pengangkutan Bas Transit Aliran pertama di Asia Tenggara dan Asia Selatan, yang beroperasi sejak tahun 2004 di Jakarta, Indonesia. Sistem ini direka berdasarkan sistem TransMilenio yang telah berjaya di Bogota, Colombia. Transjakarta dirancang sebagai mod pengangkutan penumpang yang tinggi sebagai pengangkutan sokongan kepada kepadatan bandaraya. Transjakarta merupakan sistem BRT dengan laluan bas khas terpanjang di dunia, serta mempunyai 228 stesen BRT yang terdapat di dalam 12 koridor. Sistem ini beroperasi dari 05.00 - 22.00 WIB, dan kini telah beroperasi 24 jam pada sebahagian koridornya.\\nTransjakarta dikendalikan oleh PT Pengangkutan Jakarta. Sejmlah tenaga buruh yang terlibat dalam kendalian Transjakarta dianggarkan sehingga 6,000 orang. Jumlah purata harian pengguna Transjakarta dijangka sekitar 350,000 orang. Manakala pada tahun 2012, Jumlah pengguna Transjakarta dapat mencapai sehingga 109,983,609 orang.\\nPada 10 November 2014, Transjakarta melancarkan logo barunya dan dirasmikan oleh Plt. Gabenor Provinsi DKI Jakarta, Basuki Tjahaja Purnama."},{"page_url":"https://en.wikipedia.org/wiki/List_of_carnivorous_plant_periodicals","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Capa_N_01.jpg","page_title":"List of carnivorous plant periodicals","context_page_description":"This list of carnivorous plant periodicals is a listing of periodicals devoted to the subject of carnivorous plants, most of which are published by carnivorous plant societies. The list includes magazines and journals as well as supplementary newsletters. Notable online periodicals are also listed.\\nUnless otherwise indicated, all information on individual publications is sourced from them directly or from their official websites. The terms bimonthly, biannual and triannual are used to mean \\"every two months\\", \\"twice a year\\" and \\"three times a year\\", respectively."},{"page_url":"https://fr.wikipedia.org/wiki/Dynastie_Zhou_de_l%27Ouest","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ri_ji_gong%2C_shaanxi_history_museum.jpg","page_title":"Dynastie Zhou de l'Ouest","context_page_description":"La dynastie Zhou de l'Ouest est une phase de l'histoire chinoise qui va d'environ 1046 à 771 av. J.-C. Elle doit son nom à la dynastie qui exerce alors la domination sur une vaste partie de la Chine, la dynastie Zhou, et au fait que celle-ci est alors établie dans des régions occidentales. Lui succède la période de la dynastie Zhou orientale, qui voit un déplacement de la capitale des Zhou à l'est, à Luoyi et un affaiblissement de la dynastie qui n'exerce plus de domination effective sur les pays chinois.\\nAprès la conquête de la partie nord de la plaine centrale sur la dynastie Shang au milieu du XIᵉ siècle av. J.-C., les rois Zhou y ont installé des lignages issus du clan royal ainsi que des clans alliés dans le but d'en assurer le contrôle, tandis qu'ils dirigeaient le pays depuis leur domaine occidental situé dans la vallée de la Wei. Ils dominèrent une vaste partie de la Chine du Nord, qui fut unifiée culturellement comme l'attestent les trouvailles archéologiques réparties sur les sites de la période."},{"page_url":"https://ca.wikipedia.org/wiki/Junkers","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Bundesarchiv_Bild_183-R14718%2C_Dessau%2C_Junkers-Werke.jpg","page_title":"Junkers","context_page_description":"Junkers Flugzeug-und Motorenwerke AG, més comunament Junkers, és un important fabricant d'avions alemany. Produí alguns dels avions més innovadors i més coneguts del món en el transcurs dels seus anys d'història. Es va fundar a Dessau, Alemanya, el 1895 per Hugo Junkers, fabricant inicialment calderes i radiadors. Durant la Primera Guerra Mundial, i després de la guerra, la companyia es va fer famosa pels seus pioners avions de metall. Durant la Segona Guerra Mundial, la companyia va produir alguns dels avions de la Luftwaffe més reeixits, així com motors d'avions de pistó i jet, encara que en absència del seu fundador, que per llavors havia estat eliminat pels nazis."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%A3%D1%8D%D0%BC%D0%B1%D0%BB%D0%B8_%D1%86%D1%8D%D0%BD%D0%B3%D1%8D%D0%BB%D0%B4%D1%8D%D1%85_%D1%85%D2%AF%D1%80%D1%8D%D1%8D%D0%BB%D1%8D%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Wembley_Stadium%2C_illuminated.jpg","page_title":"Уэмбли цэнгэлдэх хүрээлэн","context_page_description":"Уэмбли цэнгэлдэх хүрээлэн нь Английн Лондон хотын Уэмбли цэцэрлэгт хүрээлэнд байрлах хөлбөмбөгийн цэнгэлдэх хүрээлэн юм. 1923 онд анхлан баригдсан Уэмбли цэнгэлдэх хүрээлэнг засаж сайжруулан 2007 онд шинээр ашиглалтанд оруулсан нь өдгөөгийн Уэмбли цэнгэлдэх хүрээлэн билээ."},{"page_url":"https://fr.wikipedia.org/wiki/Biodiversit%C3%A9_marine_des_lagons_de_La_R%C3%A9union","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Protula_tubularia_%C3%A0_confirmer.jpg","page_title":"Biodiversité marine des lagons de La Réunion","context_page_description":"L'île de La Réunion est un département d'outre-mer français situé dans le sud-ouest de l'océan Indien.\\nC'est une île volcanique relativement jeune en forme caractéristique de cône, dont la base se situe directement sur le plancher océanique, ce qui explique son isolement. Sa jeunesse est la cause de la faible surface occupée par les formations coralliennes, âgées de 8 000 ans, se présentant pour la plupart sous la forme de récifs frangeants.\\nCes formations délimitent des « lagons » peu profonds dont le plus grand ne dépasse pas 500 m de large, pour 1 à 2 m de fond environ. Ces lagons, qui forment une ceinture récifale discontinue de 25 km de long pour une surface totale de 12 km², sont situés sur la côte ouest et sud-ouest de l’île.\\nLes plus importants sont ceux de L’Hermitage, St Leu, L'Étang-Salé et St Pierre.\\nMais il existe aussi des plates-formes récifales attenantes à ces lagons ou isolées, de taille plus modeste et dont la barrière est souvent rocailleuse.\\nLes platiers sont étroits et les tombants en arrière des barrières coralliennes plongent rapidement à des profondeurs importantes."},{"page_url":"https://vi.wikipedia.org/wiki/Ph%C6%B0%C6%A1ng_di%E1%BB%87n_qu%C3%A2n_Volkhov","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/%D0%9B%D0%B5%D0%B2_%D0%97%D0%B0%D1%85%D0%B0%D1%80%D0%BE%D0%B2%D0%B8%D1%87_%D0%9C%D0%B5%D1%85%D0%BB%D0%B8%D1%81.jpg","page_title":"Phương diện quân Volkhov","context_page_description":"Phương diện quân Volkhov là một tổ chức tác chiến chiến lược của Hồng quân Liên Xô trong Thế chiến thứ hai."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D1%81%D1%81%D0%BD%D0%B5%D1%80,_%D0%90%D0%B0%D1%80%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Aaron_Dessner_at_Way_Out_West_2014.jpg","page_title":"Десснер, Аарон","context_page_description":"Аарон Десснер — американский рок-музыкант, продюсер, автор, мультиинструменталист, член инди-рок-группы The National.\\nСотрудничал в записи альбомов и синглов Тейлор Свифт, The National, Big Red Machine и других."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9A%E1%83%90%E1%83%92%E1%83%A3%E1%83%9C%E1%83%90-%E1%83%A1%E1%83%90%E1%83%9C-%E1%83%A0%E1%83%90%E1%83%A4%E1%83%90%E1%83%94%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%94%E1%83%A0%E1%83%9D%E1%83%95%E1%83%9C%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%9E%E1%83%90%E1%83%A0%E1%83%99%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Campo_de_Hielo_Norte.jpg","page_title":"ლაგუნა-სან-რაფაელის ეროვნული პარკი","context_page_description":"ლაგუნა-სან-რაფაელის ეროვნული პარკი — ეროვნული პარკი ჩილეში. მდებარეობს პატაგონიის ანდებში, წყნარი ოკეანის სანაპირო ზოლში, ჩილეს აისენის რეგიონში. შეიქმნა 1959 წელს. ფართობი 17,420 კმ².\\n1979 წელს ეროვნული პარკი გაწევრიანდა იუნესკოს პროგრამაში ადამიანი და ბიოსფერო"},{"page_url":"https://vi.wikipedia.org/wiki/HMCS_Saguenay_(D79)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/HMCS_Saguenay_E-80027.jpg","page_title":"HMCS Saguenay (D79)","context_page_description":"HMCS Saguenay là một tàu khu trục thuộc lớp River của Hải quân Hoàng gia Canada đã phục vụ từ năm 1931 đến năm 1945. Nó tương tự như những chiếc tàu khu trục lớp A của Hải quân Hoàng gia Anh Quốc.\\nSaguenay được chế tạo bởi hãng John I. Thornycroft & Company tại Woolston, Hampshire, Anh; và đưa vào phục vụ cùng Hải quân Hoàng gia Canada ngày 21 tháng 5 năm 1931 tại Portsmouth, Anh. Nó cùng với con tàu chị em HMCS Skeena là những chiếc đầu tiên được chế tạo đặc biệt cho Hải quân Canada. Hai vị chỉ huy đầu tiên của Saguenay sau này là những Đô đốc Canada quan trọng tham gia trận Đại Tây Dương. Nó về đến Halifax vào ngày 3 tháng 7 năm 1931.\\nTrong tháng đầu tiên của Chiến tranh Thế giới thứ hai, Saguenay trợ giúp vào việc hộ tống các đoàn tàu vận tải tại khu vực Halifax. Đến cuối tháng 9 năm 1939, nó được điều về Hải đội Hoa Kỳ và Tây Ấn đặt căn cứ tại Kingston, Jamaica.\\nVào ngày 23 tháng 10, nó đụng độ với tàu chở dầu mang cờ Đức Emmy Friederich khiến tàu đối phương phải tự đánh đắm, trở thành tàu khu trục Canada đầu tiên tác chiến trong chiến tranh."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B1%B1%E5%8F%A3%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/C571_SL_Yamaguchi_20170909.jpg","page_title":"山口線","context_page_description":"山口線は、山口県山口市の新山口駅から島根県益田市の益田駅に至る西日本旅客鉄道の鉄道路線である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%A4%E3%83%91%E3%83%8F%E9%83%A1_(%E3%83%8D%E3%83%96%E3%83%A9%E3%82%B9%E3%82%AB%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/Map_of_Nebraska_highlighting_Keya_Paha_County.svg","page_title":"ケヤパハ郡 (ネブラスカ州)","context_page_description":"ケヤパハ郡は、アメリカ合衆国のネブラスカ州にある郡。2000年時点の人口は983人で、郡庁所在地はスプリングビュー 。郡内を流れるケヤパハ川にちなんで名付けられた。\\nネブラスカ州のナンバープレートで、ケヤパハ郡の車両は最初の数字が82になっている。これは1922年にナンバープレートの制度を確立した際、ケヤパハ郡の車両登録台数が州内の郡のなかで82番目に多かったからである。"},{"page_url":"https://en.wikipedia.org/wiki/Rafig_Hashimov","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/RafiqHeshimov2.jpg","page_title":"Rafig Hashimov","context_page_description":"Rafig Hashimov - \\"Honored Artist of Azerbaijan\\", announcer of AzTV, tele-journalist, essayist, director."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BA%D1%81%D1%83%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0_%D0%BE%D0%B1%27%D1%94%D0%BA%D1%82%D0%B8%D0%B2%D0%B0%D1%86%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Menu.jpg","page_title":"Сексуальна об'єктивація","context_page_description":"Сексуальна об'єктивація — акт поводження з людиною виключно як з об'єктом статевого потягу. Ширше об'єктивація означає відношення до людини як до товару чи об'єкта без поваги до її особистості чи гідності. Об'єктивація найчастіше розглядається на рівні суспільства, але може також стосуватись поведінки окремих осіб.\\nПоняття сексуальної об'єктивації та, зокрема, об'єктивації жінок, є важливою ідеєю в феміністській теорії та похідних від фемінізму психологічних теоріях, навіть якщо сексуальна об'єктивація надходить з обох сторін. Більшість феміністок вважають сексуальну об'єктивацію скорботним явищем, що, однак, відіграє вкрай важливу роль в підтриманні гендерної нерівності. При цьому, дехто з соціальних коментаторів стверджує, що деякі сучасні жінки об'єктивують себе в якості емпауерменту."},{"page_url":"https://en.wikipedia.org/wiki/Pallava_dynasty","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Elephant_mpuram.jpg","page_title":"Pallava dynasty","context_page_description":"The Pallava dynasty was an Indian dynasty that existed from 275 CE to 897 CE, ruling a portion of southern India. They gained prominence after the eclipse of the Satavahana dynasty, whom the Pallavas served as feudatories.\\nPallavas became a major power during the reign of Mahendravarman I and Narasimhavarman I and dominated the Telugu and northern parts of the Tamil region for about 600 years until the end of the 9th century. Throughout their reign they were in constant conflict with both Chalukyas of Badami in the north and the Tamil kingdoms of Chola and Pandyas in the south. Pallava was finally defeated by the Chola ruler Aditya I in the 9th century CE.\\nPallavas are most noted for their patronage of architecture, the finest example being the Shore Temple, a UNESCO World Heritage Site in Mamallapuram.Kancheepuram was capital of the pallava kingdom.The Pallavas, who left behind magnificent sculptures and temples, established the foundations of medieval South Indian architecture. They developed the Pallava script from which Grantha ultimately descended. The Pallava script gave rise to several other southeast Asian scripts."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%88%D9%85%D9%8A%D9%84%D8%A7%D8%AA%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Pomellato_Boutique.jpg","page_title":"بوميلاتو","context_page_description":"بوميلاتو هي شركة مجوهرات إيطالية."},{"page_url":"https://en.wikipedia.org/wiki/St._Anthony_Channel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/St._Anthony_cave.jpg","page_title":"St. Anthony Channel","context_page_description":"St. Anthony Channel also known as the Šibenik Channel is a strait connecting Šibenik Bay to the Adriatic Sea. It was protected as a significant landscape in 1974. It is more than 2000 metres long and between 140 and 220 metres wide. It has become popular since walking trail was built alongside channel. The place is perfect for a variety of activities such as biking, walking, swimming and sightseeing. The most beautiful attractions of the channel include St. Nicholas Fortress, located at the entrance of the channel, St. Anthony Cave, located in the middle of the channel and the nearby \\"Hitler's Eyes\\" bunker.\\nThere is a viewpoint with panoramic view of Šibenik near the cave."},{"page_url":"https://tr.wikipedia.org/wiki/Arabi_Pa%C5%9Fa","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Arabi_%281906%29_-_TIMEA.jpg","page_title":"Arabi Paşa","context_page_description":"Arabi Paşa ya da Urabi Paşa olarak da bilinir, tam adı Ahmed Arabi Paşa el-Mısri, Mısırlı milliyetçi önder. Aydınların, subayların ve Mısır köylü halkının yabancı denetiminden duyduğu hoşnutsuzluğu dile getiren toplumsal ve siyasi hareketin başında yer almıştır.\\nBir köylü ailesinden gelen Arabi, Kahire'de Orta Doğu'nun o dönemdeki öncü İslami bilim kurumu olan El-Ezher Üniversitesi'nde öğrenim gördü. Orduya girdikten sonra, 1875-1876 Mısır-Etiyopya Savaşı sırasında levazım subayı olarak görev yaptı ve albaylığa kadar yükseldi. 1879'da subayların Hıdiv İsmail Paşa'ya karşı düzenlediği ayaklanmaya katıldı. Daha ordudaki ilk yıllarında, üst kademeleri tekelinde tutan Osmanlı kökenli subayları tasfiye etmek amacıyla kurulan gizli bir derneğe katıldı; 1881'de bu amaçla bir ayaklanma başlattı. Ertesi yıl, Avrupalı devletlerin müdahalesi ve Mısır Meclisi'nin bütçe denetimiyle ilgili yetkileri konusunda çıkan anlaşmazlık üzerine Mahmud Sami el-Barudi başkanlığında kurulan milliyetçi hükümette savaş bakanı oldu. Mısır Mısırlılarındır sloganı, Arabi'yi ulusal bir kahraman haline getirdi."},{"page_url":"https://de.wikipedia.org/wiki/Malayer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/A_mosque_in_Malayer.jpg","page_title":"Malayer","context_page_description":"Malayer ist eine Stadt in der iranischen Provinz Hamadan.\\nMalāyer ist die zweitgrößte Stadt der Provinz Hamadan im Westiran und ist bekannt für Teppichweberei und einige öffentliche Parks. Malayer hat 2012 hochgerechnet 159.391 Einwohner. Die Stadt liegt zwischen Hamadan und Khorramabad und 380 km südwestlich von Teheran. Der aktuelle Bürgermeister ist Rahman Razi."},{"page_url":"https://pl.wikipedia.org/wiki/Przedrze%C5%BAniacz_p%C5%82owy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Mimus_graysoni_%28Museum_de_Gen%C3%A8ve%29.jpg","page_title":"Przedrzeźniacz płowy","context_page_description":"Przedrzeźniacz płowy – gatunek średniej wielkości ptaka z rodziny przedrzeźniaczy. Jest endemiczny dla wyspy Socorro w meksykańskim Archipelagu Revillagigedo. Według danych Międzynarodowej Unii Ochrony Przyrody gatunek krytycznie zagrożony.\\nBadania nad tym gatunkiem przeprowadzone w roku 1994 wykazały, że żyje tylko około 350 osobników. Obecna populacja szacowana jest na około 190–280 dorosłych osobników, a zasięg występowania na 50 km².\\nZagrożenie wyginięciem wynika ze zmniejszania się obszaru naturalnego habitatu przedrzeźniacza, spowodowanego aktywnością zdziczałych owiec oraz locusty jak również z powodu zdziczałych kotów, zawleczonych na wyspę między 1953 a 1970 r. Jego środowisko to wilgotne, karłowate lasy i wąwozy porośnięte krzewami i drzewami. Nie mieszka niżej niż 600 m n.p.m. Prowadzi naziemny tryb życia.\\nSam ptak mierzy 25 cm i waży 65 g. Średniej długości, nieco zagięty szary dziób. Przez oko biegnie brązowa przepaska, cały wierzch ciała łącznie z ogonem także brązowy. Reszta głowy jaśniejsza, a spód ciała biały. Szare nogi. Z tyłu lekko kreskowany.\\nGniazduje pomiędzy listopadem a lipcem. Swoje 3 białe jaja wysiaduje nie więcej niż przez 15 dni."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%89%E3%82%AC%E3%83%BC%E3%83%BB%E3%83%80%E3%83%BC%E3%83%B4%E3%82%A3%E3%83%83%E3%83%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Edgar_Davids.jpg","page_title":"エドガー・ダーヴィッツ","context_page_description":"エドガー・スティーヴン・ダーヴィッツは元サッカー選手、サッカー指導者。ポジションはMF。元オランダ代表。"},{"page_url":"https://ro.wikipedia.org/wiki/Rocar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/ROCAR_40_C.jpg","page_title":"Rocar","context_page_description":"Rocar București, denumire adoptată din 1993, ca succesoare a întreprinderii Uzina Autobuzul București, a fost o companie producătoare de autobuze, troleibuze și autovehicule comerciale ușoare deținută de Statul Român."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AE%BE%E0%AE%A9%E0%AF%8D_%E0%AE%8E%E0%AE%B2%E0%AF%8D-%E0%AE%95%E0%AE%BE%E0%AE%B2%E0%AE%BF%E0%AE%B2%E0%AF%8D%E0%AE%B2%E0%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Khan_elkhaleely_haddara.jpg","page_title":"கான் எல்-காலில்லி","context_page_description":"கான் எல்-காலில்லி கெய்ரோவில் உள்ள ஓர் முதன்மை கடைத்தெரு ஆகும். இது இசுலாமியர்கள் பெரும்பான்மையாக உள்ள இசுலாமிய கெய்ரோப் பகுதியில் அமைந்துள்ளது. இது கெய்ரோவில் சுற்றுலாப் பயணிகளையும் எகிப்தியர்களையும் ஈர்க்கும் முதன்மை கடைத்தெரு ஆகும். இது 1382ஆம் ஆண்டில் எமிர் சகார்க்சு எல்-காலில்லியால் வணிகர் விடுதியாகக் கட்டப்பட்டது. இந்த விடுதி இன்றளவிலும் உள்ளது."},{"page_url":"https://ro.wikipedia.org/wiki/Cartu%C8%99_(design)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/15%2C_Strada_Sm%C3%A2rdan%2C_Bucharest_%28Romania%29.jpg","page_title":"Cartuș (design)","context_page_description":"Un cartuș este un design oval sau alungit cu o suprafață convexă, cu ornamente care derivă de la frunza de acantă. Una dintre utilitățile cartușelor e scrierea unui text scurt sau a unei inițiale în ele.\\nÎncă de la începutul secolului al XVI-lea, cartușul este un ornament, termenul derivând inițial de la italienescul „cartoccia”. Cartușele au apărut în timpul Renașterii la începutul secolelor XV-XVI. În epoca barocă și în cea rococo, cartușele dobândesc forme mai complexe, cele rococo fiind asimetrice. Cartușele pot fi găsite ulterior în arhitectura eclectică, neoclasică și uneori Art Nouveau, fiind larg răspândite în arhitectura secolului al XIX-lea și în cea din Belle Époque.\\nCuvântul francez „cartouche” se referă la ancadramentul ornamental al unei tăblițe pentru inscripții, la unui scut, blazon, etc., mai ales în cazul în care ancadramentul e format din bezni rulate, volute sau alte ornamente întotocheate. În limba franceză, denumirea de „cartouche” vine de la italienescul „cartocci”, care înseamnă sul de carton. La alte părți de ornamente rulate se adaugă, frunze de acantă, palemte, festoane, panglici care flutură, mascaroane de putti, și alte elemente de tipul emblemelor."},{"page_url":"https://et.wikipedia.org/wiki/Alo_Ritsing","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Alo_Ritsing_laulupeol_2.JPG","page_title":"Alo Ritsing","context_page_description":"Alo Ritsing on eesti koorijuht ja helilooja."},{"page_url":"https://fr.wikipedia.org/wiki/Ludv%C3%ADkovice","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Ludvikovice_DC_CZ.png","page_title":"Ludvíkovice","context_page_description":"Ludvíkovice est une commune du district de Děčín, dans la région d'Ústí nad Labem, en Tchéquie. Sa population s'élevait à 931 habitants en 2018."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B2%D1%91%D0%B7%D0%B4%D0%BD%D1%8B%D0%B9_%D0%BF%D1%83%D1%82%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Star_Trek_Picard_logo.svg","page_title":"Звёздный путь","context_page_description":"«Звёздный путь» — американская научно-фантастическая медиафраншиза, включающая в себя несколько телевизионных сериалов, полнометражных фильмов. Проект внёс существенный вклад в массовую культуру и породил оригинальную субкультуру. Автором идеи и основателем Вселенной «Звёздного пути», ведущей своё начало с выхода на экраны 8 сентября 1966 года сериала «Звёздный путь: Оригинальный сериал», является Джин Родденберри.\\n«Звёздный путь» является культовым явлением на протяжении десятилетий. Поклонники франшизы называются Треккерами. Шоу обросло широким спектром сопутствующих продуктов, включая компьютерные игры, статуэтки, романы, игрушки и комиксы. «Звёздный путь» был темой аттракциона в Лас-Вегасе, открытого с 1998 по сентябрь 2008 года. Не менее двух музейных экспозиций, составленных из реквизита франшизы, путешествуют по миру в рамках проекта Star Trek: The Exhibition. Для сериала создан свой полноценный искусственный язык — клингонский. Появились пародии на тему «Звёздного пути». Кроме того, зрители подготовили несколько фан-постановок. По мотивам киноэпопеи создано множество фан-артов."},{"page_url":"https://en.wikipedia.org/wiki/Molly_Gloss","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Molly_Gloss_reading_for_Ars_Poetica.jpg","page_title":"Molly Gloss","context_page_description":"Molly Gloss is an American writer currently best known for historical fiction and science fiction."},{"page_url":"https://no.wikipedia.org/wiki/TACV","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/TACV_B757_D4-CBG_MUC.jpg","page_title":"TACV","context_page_description":"TACV Cabo Verde Airlines er et kappverdisk flyselskap. Flyselskapet ble stiftet i 1958, er 100% eid av myndighetene og har 788 ansatte."},{"page_url":"https://eu.wikipedia.org/wiki/Vittuone","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Vittuone_Chiesa_Annunciazione.jpg","page_title":"Vittuone","context_page_description":"Vittuone Italiako udalerri bat da. Milango probintzian kokatuta dago, Lombardia eskualdean. 9.063 biztanle ditu, 6,13 kilometro koadroko azaleran banatuta."},{"page_url":"https://de.wikipedia.org/wiki/H._R._S._Records","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Pee_Wee_Russell_%28Gottlieb_07571%29.jpg","page_title":"H. R. S. Records","context_page_description":"H. R. S. Records war ein 1938 gegründetes unabhängiges US-amerikanisches Jazz-Label, das sich auf Hot Jazz spezialisierte.\\nH. R. S. Records entstand als Label der von Steve Smith gegründeten Hot Record Society. Während sich die zwei Jahre zuvor von Milt Gabler und Stephen W. Smith gegründete Vereinigung United Hot Clubs of America auf die Wiederveröffentlichung lang vergriffender Jazzklassiker verlegt hatte, konzentrierte sich H.R.S. Records ab 1938 auf den Vertrieb von Originalaufnahmen per Mailorder. 1939 eröffnete Smith den H.R.S. Record Shop in Midtown Manhattan, wo man sowohl gebrauchte als auch neue Jazzplatten sowie Jazzmagazine und -Bücher erwerben konnte.\\nBei H.R.S. Records wurden zwischen August 1938 und September 1947 insgesamt 124 Titel in 25 Sessions aufgenommen, von Pee Wee Russell, Sidney Bechet/Muggsy Spanier, Rex Stewart, Jack Teagarden, Sandy Williams, J. C. Higginbotham, Jimmy Jones, Babe Matthew/Joe Thomas, Harry Carney, Dicky Wells, Buck Clayton, Trummy Young, Billy Kyle, Russell Procope, Billy Taylor, Rex Stewart und Brick Fleagle."},{"page_url":"https://sl.wikipedia.org/wiki/Scania-Vabis","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Scania-Vabis_2122_1929.jpg","page_title":"Scania-Vabis","context_page_description":"Scania-Vabis je bil švedski proizvajalec tovornjakov, avtomobilov in avtobusov. Podjetje je bilo ustanovljeno leta 1911, ko sta se združila Scania in Vabis. Proizvodnja avtomobilov se je končala leta 1929, leta 1968 so opustili ime Vabis.\\nPodjetje je proizvajalo tovornjake v Argentini, Botsvani, Braziliji, Južni Koreji, Tanzaniji, Južni Koreji, Nizozemski, Zimbabveju in ZDA."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%81%D1%82%D0%B5%D1%80_%D0%92%D0%B8%D0%BB%D0%B8%D1%98%D0%B0%D0%BC%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Esther_Williams_-_portrait.jpg","page_title":"Естер Вилијамс","context_page_description":"Естер Вилијамс била је америчка филмска глумица и пливачица, рођена 8. августа 1921. године у Инглвуду, а преминула 6. јуна 2013. године у Лос Анђелесу. Најпознатија је по улози у филму Бал на води.\\nВилијамсова је пре своје двадесете године поставила неколико националних рекорда у пливању такмичећи се за клуб из Лос Анђелеса. Почетак Другог светског рата ју је спречио да учествује на Летњим олимпијским играма 1940. После тога потписује уговор са филмским студијом МГМ, за који током четрдесетих и педесетих година снима тзв. \\"мјузикле на води“. Након раскида уговора снима неколико неуспешних филмова, па одлучује да се повуче са филма. Затим је отпочела нову каријеру пословне жене тако што је позајмила своје име линији купаћих костима и базена и снимала кратке филмове учећи децу да пливају."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AA%D8%A7%D8%B1%D9%85_(%D8%A8%D9%87%D8%B4%D9%87%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/%D9%86%D9%85%D8%A7%DB%8C%DB%8C_%D8%A7%D8%B2_%D8%AA%D9%BE%D9%87_%D9%87%D8%A7%D9%85%D9%90%D9%86_%D8%B1%D9%88%D8%B3%D8%AA%D8%A7%DB%8C_%D8%A7%D8%B3%D8%AA%D8%A7%D8%B1%D9%85.jpg","page_title":"استارم (بهشهر)","context_page_description":"استارم روستایی از توابع بخش یانه‌سر شهرستان بهشهر در استان مازندران ایران است."},{"page_url":"https://vi.wikipedia.org/wiki/Pin_nhi%C3%AAn_li%E1%BB%87u","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/U_Boot_212_HDW_1.jpg","page_title":"Pin nhiên liệu","context_page_description":"Các tế bào nhiên liệu, hay còn gọi là \\"pin nhiên liệu\\", biến đổi năng lượng hóa học của nhiên liệu, thí dụ như là hiđrô, trực tiếp thành năng lượng điện. Không giống như pin hoặc ắc quy, tế bào nhiên liệu không bị mất điện và cũng không có khả năng tích điện. Tế bào nhiên liệu hoạt động liên tục khi nhiên liệu và chất ôxi hóa được đưa từ ngoài vào.\\nPin nhiên liệu là loại thiết bị năng lượng có mức thải ô nhiễm gần như \\"bằng 0\\", thân thiện với môi trường tuy nhiên giá thành của nó không hề nhỏ."},{"page_url":"https://es.wikipedia.org/wiki/Guerras_de_independencia_hispanoamericanas","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Retrato_del_excelent%C3%ADsimo_se%C3%B1or_don_Jos%C3%A9_Mar%C3%ADa_Morelos.png","page_title":"Guerras de independencia hispanoamericanas","context_page_description":"Las guerras de independencia hispanoamericanas fueron una serie de conflictos armados que se desarrollaron en las posesiones americanas del Imperio español a principios del siglo XIX, entre 1810 y 1829, en los cuales se enfrentaron el bando a favor de las independencias en una operación conjunta, también denominado patriota o revolucionario, contra el bando a favor de mantener la integridad de la Monarquía española, ​ que se conocería más tarde como realista o virreinal. Según la postura historiográfica, estos conflictos además de guerras de independencia, son considerados también guerras civiles​​ o bien, una combinación de diversas formas de guerras.​​\\nLos movimientos independentistas de Hispanoamérica adquirieron en principio formas políticas variadas de acuerdo con las condiciones que imperaban en cada región, y todos convergen finalmente en el Estado liberal.​ Así, una postura historiográfica dice que la emancipación hispanoamericana tiene sus raíces en la independencia de las colonias británicas de América del Norte en 1776, la Revolución francesa o la Revolución Haitiana."},{"page_url":"https://en.wikipedia.org/wiki/Graduate_Institute_of_International_and_Development_Studies","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/The_Kathryn_and_Shelby_Cullom_Davis_Library.JPG","page_title":"Graduate Institute of International and Development Studies","context_page_description":"The Graduate Institute of International and Development Studies, or the Graduate Institute, abbreviated IHEID, is a government-accredited postgraduate institution of higher education located in Geneva, Switzerland.\\nThe institution counts one UN secretary-general, seven Nobel Prize recipients, one Pulitzer Prize winner, and numerous ambassadors, foreign ministers, and heads of state among its alumni and faculty. Founded by two senior League of Nations officials, the Graduate Institute maintains strong links with that international organisation's successor, the United Nations, and many alumni have gone on to work at UN agencies.\\nFounded in 1927, the Graduate Institute of International Studies is continental Europe's oldest school of international relations and was the world's first graduate institute dedicated solely to the study of international affairs. It offered one of the first doctoral programmes in international relations in the world. In 2008, the Graduate Institute absorbed the Graduate Institute of Development Studies, a smaller postgraduate institution also based in Geneva founded in 1961."},{"page_url":"https://de.wikipedia.org/wiki/Wilhelm_Kaisen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Bundesarchiv_B_145_Bild-F011021-0002%2C_K%C3%B6ln%2C_Staatsbesuch_de_Gaulle%2C_Begr%C3%BC%C3%9Fung_Adenauer.jpg","page_title":"Wilhelm Kaisen","context_page_description":"Carl Wilhelm Kaisen war ein deutscher Politiker der Sozialdemokratischen Partei Deutschlands. Von 1920 bis 1928 sowie 1933 war er Mitglied der Bremischen Bürgerschaft. Zwischen 1928 und 1933 bekleidete er das Amt des Senators für Wohlfahrtswesen in Bremen. Die Zeit des Nationalsozialismus in Bremen verbrachte er mit seiner Familie als Landwirt im heutigen Bremer Stadtteil Borgfeld, damals noch eine ländliche Gemeinde. Nach dem Ende des Zweiten Weltkriegs beriefen ihn die Vertreter der amerikanischen Besatzungsmacht erneut in den Senat. Sie beförderten ihn kurz darauf zu dessen Präsidenten und damit zum Bremer Bürgermeister. Kaisen prägte den politischen und wirtschaftlichen Wiederaufbau der Hansestadt bis zu seinem Ausscheiden aus dem Senat im Jahr 1965 entscheidend. Er plädierte für die Westintegration der Bundesrepublik Deutschland und die europäische Einigung. Innerhalb der SPD vertrat er damit öffentlich Positionen, die bis Ende der 1950er Jahre deutlich von der ablehnenden Haltung des SPD-Parteivorstands abwichen. Kaisen gilt in Bremen als Symbolfigur des Wiederaufbaus nach 1945."},{"page_url":"https://pt.wikipedia.org/wiki/Moeda_privada","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Avers_et_Revers_Vera_Valor.jpg","page_title":"Moeda privada","context_page_description":"Moeda privada é uma moeda emitida por uma entidade privada, seja ela uma pessoa física, jurídica ou entidades sem fins lucrativos. Muitas vezes, é contrastada com moeda fiduciária emitida por governos ou bancos centrais. Em muitos países, a emissão de moedas privadas é severamente restringida por lei.\\nHoje, existem mais de quatro mil moedas privadas em mais de 35 países. Estes incluem transações comerciais na forma de escambo que usam créditos e unidades de troca, trocas privadas de ouro, prata, papel-moeda local; sistemas informatizados de crédito e débito e criptomoedas em circulação, como a DGC."},{"page_url":"https://pt.wikipedia.org/wiki/Miratejo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Miratejo.jpg","page_title":"Miratejo","context_page_description":"Miratejo é uma localidade da freguesia de Corroios, concelho do Seixal, pertencente à Área Metropolitana de Lisboa.\\nMiratejo está situado no extremo poente do concelho do Seixal na parte norte da vila de Corroios, junto ao Laranjeiro, a um braço do Estuário do Tejo e ao extremo leste do Alfeite.O Miratejo encontra-se dividido em três zonas: uma área urbana constituída por empreendimentos, outra situada junto do parque José Afonso com moradias isoladas, e uma área de reserva ecológica nacional denominada de Ponta dos Corvos."},{"page_url":"https://en.wikipedia.org/wiki/Indrayani_Express","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/22106_Indrayani_Express.jpg","page_title":"Indrayani Express","context_page_description":"The 22105/22106 Indrayani Superfast Express is a superfast express train belonging to Indian Railways that runs between Mumbai CSMT and Pune Junction in India.\\nIt is a daily service & is named after the river Indrayani flowing near Pune.\\nIn India, Indhrayaani is the combination of two unique words: Indhira and Yaani, meaning, the Vehicle of Indhira.\\nThe train earlier numbered as 1021 while running from Mumbai to Pune and 1022 from Pune to Mumbai, has now been upgraded to superfast & renumbered as 22105 & 22106.\\nThis train had superb livery of white+royal blue colours and red bands.from 2 February 2020 it is upgraded to LHB coaches"},{"page_url":"https://en.wikipedia.org/wiki/Santa_Maria_della_Consolazione,_Todi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Tempio_di_Santa_Maria_della_Consolazione_Interno.jpg","page_title":"Santa Maria della Consolazione, Todi","context_page_description":"Santa Maria della Consolazione is a Renaissance-style pilgrimage church in Todi, Italy. The centralized, symmetric plan, surmounted by a tall dome, distinguishes this Renaissance church, from the more common elongated basilica or Latin-cross designs.\\nCola da Caprarola, supposedly aided by Baldassarre Peruzzi, began construction in 1508 on the flank of the city hill, just outside the walls. The design is often erroneously attributed to Bramante. It has a Greek cross plan: three apses are polygonal and the one on the north side is semicircular. Other architects who helped bring the work to completion were Antonio da Sangallo the Younger, Galeazzo Alessi, Michele Sanmicheli, Vignola and Ippolito Scalza. The church was completed only by 1607. The apse is surmounted by a square terrace with four eagles at the corners, from which the dome rises.\\nLegend holds that a worker, who was blind in one eye, had the sight of that eye restored when he wiped it with a cloth that had cleaned an icon of the Madonna. The church was built at the site where the icon had been housed, and now contains the icon at the altar. Twelve niches in the first three apses house giant statues of the apostles."},{"page_url":"https://io.wikipedia.org/wiki/Listo_pri_chefministri_di_Hispania","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Escudo_de_Espa%C3%B1a_%28mazonado%29.svg","page_title":"Listo pri chefministri di Hispania","context_page_description":"La chefministro esas la chefo di guvernerio di Hispania. Yen la listo pri chefministri di Hispania, de 1833 til nun."},{"page_url":"https://en.wikipedia.org/wiki/Marin_County,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Northern_California_Muir_Woods_-_National_Monument.jpg","page_title":"Marin County, California","context_page_description":"Marin County is located in the northwestern part of the San Francisco Bay Area of the U.S. state of California. As of the 2010 census, the population was 252,409. Its county seat is San Rafael. Marin County is across the Golden Gate Bridge from San Francisco, and is included in the San Francisco–Oakland–Berkeley, CA Metropolitan Statistical Area.\\nAs of 2010, Marin County had the fifth highest income per capita in the United States at $91,483. The county is governed by the Marin County Board of Supervisors. The county is also well known for its natural environment.\\nSan Quentin State Prison is in the county, as is George Lucas' Skywalker Ranch. Autodesk, the publisher of AutoCAD, is also there, as well as numerous other high-tech companies. The Marin County Civic Center was designed by Frank Lloyd Wright and draws thousands of visitors a year to guided tours of its arch and atrium design. In 1994, a new county jail facility was embedded into the hillside nearby. Marin County's natural sites include the Muir Woods redwood forest, the Marin Headlands, Stinson Beach, the Point Reyes National Seashore, and Mount Tamalpais."},{"page_url":"https://fr.wikipedia.org/wiki/Globule_Lyman-%CE%B1_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Lyman_Alpha_Blob.jpg","page_title":"Globule Lyman-α 1","context_page_description":"Le globule Lyman-α 1, en abrégé LAB-1 pour l'anglais Lyman-alpha blob 1, est un nuage de gaz cosmique géant qui se trouve dans la constellation australe du Verseau, à quelque 11,5 milliards d'années-lumière de la Terre, avec un décalage vers le rouge de 3,09. Il a été découvert de façon inattendue en 2000 par Charles Steidel et ses collègues, qui observaient des galaxies à grand décalage vers le rouge avec le télescope Hale de 200 pouces de l'Observatoire du Mont Palomar. Les chercheurs étudiaient l'abondance des galaxies dans le jeune Univers quand ils sont tombés sur deux objets qui allait devenir connus comme étant des globules Lyman-α : d'énormes concentrations de gaz émettant la raie d'émission Lyman-alpha de l'hydrogène.\\nLAB-1 est le premier globule de Lyman-alpha découvert, d'où le numéro 1. C'est le prototype de ce type d'objets. C'est aussi le plus grand en son genre, mesurant 300 000 années-lumière de large, trois fois plus que la Voie lactée. Le globule apparaît vert sur l'image en raison de la combinaison du grand décalage vers le rouge et de la nature ultraviolette du globule."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_L%C3%BCbbenau/Spreewald","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Hauptstra%C3%9Fe_15_Zerkwitz_L%C3%BCbbenau.jpg","page_title":"Liste der Baudenkmale in Lübbenau/Spreewald","context_page_description":"In der Liste der Baudenkmale in Lübbenau/Spreewald sind alle Baudenkmale der brandenburgischen Stadt Lübbenau/Spreewald und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019. Die Bodendenkmale sind in der Liste der Bodendenkmale in Lübbenau/Spreewald aufgeführt."},{"page_url":"https://da.wikipedia.org/wiki/L%C3%A9on_Degrelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/L%C3%A9on_Degrelle.jpg","page_title":"Léon Degrelle","context_page_description":"Léon Joseph Marie Ignace Degrelle var en belgisk højreekstrem journalist og forfatter. Han grundlade og ledte den fascistiske Rex-bevægelse og blev senere officer i Waffen-SS på Østfronten. Han blev dømt til døden in absentia 1944, flygtede via Danmark og Norge til Spanien, hvor han fik varigt ophold."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D1%80%D0%BC%D0%B5%D0%BD%D0%B4%D0%B8%D0%B0,_%D0%A5%D0%BE%D1%81%D0%B5_%D0%98%D0%B3%D0%BD%D0%B0%D1%81%D0%B8%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Jos%C3%A9_Ignacio_Garmendia_-_Imagen.jpg","page_title":"Гармендиа, Хосе Игнасио","context_page_description":"Хосе Игнасио Гармендиа Суарес — аргентинский военачальник, дивизионный генерал, художник, писатель и дипломат. Член Национальной академии истории Аргентины."},{"page_url":"https://hu.wikipedia.org/wiki/Rute","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Rute_desde_el_cerro_de_la_higuera._-_panoramio.jpg","page_title":"Rute","context_page_description":"Rute település Spanyolországban, Córdoba tartományban. Lakosainak száma 10 560 fő."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_de_Rozewie","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Latarnia_morska_Rozewie_1.JPG","page_title":"Phare de Rozewie","context_page_description":"Le phare de Rozewie est un phare situé à Rozewie dans la gmina de Władysławowo. Le phare se trouve entre le phare de Stilo et le phare de Jastarnia.\\nCe phare est sous l'autorité du Bureau maritime régional de Gdynia.\\nCe phare est classé au titre des monuments historiques de Pologne."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%B1%D8%A4%D8%B3%D8%A7%D8%A1_%D9%88%D8%B2%D8%B1%D8%A7%D8%A1_%D8%A8%D8%B1%D9%8A%D8%B7%D8%A7%D9%86%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/James_Callaghan.JPG","page_title":"قائمة رؤساء وزراء بريطانيا","context_page_description":"رئيس وزراء المملكة المتحدة هو رئيس حكومة المملكة المتحدة ويرأس اجتماعات مجلس الوزراء. ليس هناك تاريخ محدد عندما ظهر مكتب رئيس الوزراء لأول مرة، حيث لم يتم إنشاء الدور ولكن تطور على مدى فترة من الزمن. وقد استخدم هذا المصطلح في مجلس العموم في عام 1805، وكان بالتأكيد في الاستخدام البرلماني بحلول عام 1880، وفي عام 1905 اُعترف رسمياً بمنصب رئيس الوزراء في ترتيب الأسبقية. يعدّ المؤرخون الحديثون عموما السير روبرت والبول، الذي قاد حكومة بريطانيا العظمى لمدة 21 عاما في 1721-42, كأول رئيس وزراء يخدم، والبول هو أيضا أطول رئيس وزراء بريطاني. ومع ذلك، كان السير هنري كامبل - بانرمان أول رئيس وزراء موقر ومارغريت تاتشر رئيس الوزراء الذي يخدم على المدى الطويل ليشار إليها رسميا على هذا النحو.\\nوبشكل صارم، كان أول رئيس وزراء للمملكة المتحدة وليام بيت الأصغر. وكان ديفيد لويد جورج أول رئيس وزراء للدولة البريطانية الحالية، المملكة المتحدة لبريطانيا العظمى وأيرلندا الشمالية، على الرغم من أن البلد لم يعاد تسميته رسمياً حتى عام 1925 عندما كان ستانلي بالدوين رئيساً للوزراء.\\nونظرا للتطور التدريجي لمنصب رئيس الوزراء، يطبق العنوان على رؤساء الوزراء في وقت مبكر فقط بأثر رجعي؛ وقد أدى ذلك أحيانا إلى نشوء نزاع أكاديمي."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BB%D0%B8%D0%B1%D0%B5%D1%80%D1%82%D0%B5,_%D0%93%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Guy_Laliberte_WPT.jpg","page_title":"Лалиберте, Ги","context_page_description":"Ги Лалиберте́ — основатель и руководитель компании Cirque du Soleil."},{"page_url":"https://en.wikipedia.org/wiki/Merrill,_Wisconsin","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Merrill_Wisconsin_Downtown_East_Eastside_WIS64.jpg","page_title":"Merrill, Wisconsin","context_page_description":"Merrill is a city in and the county seat of Lincoln County, Wisconsin, United States. It is located to the south of and adjacent to the Town of Merrill. The population was 9,661, according to the 2010 census. Merrill is part of the United States Census Bureau's Merrill MSA, which includes all of Lincoln County. Together with the Wausau MSA, which includes all of Marathon County, it forms the Wausau-Merrill CSA."},{"page_url":"https://en.wikipedia.org/wiki/John_Haimes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/John_Haimes.jpg","page_title":"John Haimes","context_page_description":"John Haimes was pioneer mail coach operator, hotelier and brewer in South Australia, and pastoralist and racehorse breeder and owner in Victoria, Australia, where he was universally known as \\"Captain Haimes\\"."},{"page_url":"https://de.wikipedia.org/wiki/Konservatismus_in_Deutschland","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Friedrich_Julius_Stahl-1-.JPG","page_title":"Konservatismus in Deutschland","context_page_description":"Der Konservatismus in Deutschland entwickelte sich seit der Deutschen Revolution von 1848/1849 zunächst in Preußen durch konservative Vereine, Gruppierungen und Abgeordnete. Dazu gehörte der „Verein zur Wahrung der Interessen des Grundbesitzes“. Die spezifisch deutsche Ausprägung des Konservatismus ist untrennbar mit Bismarck verbunden."},{"page_url":"https://en.wikipedia.org/wiki/The_Wiggle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/The_Wiggle.jpg","page_title":"The Wiggle","context_page_description":"The Wiggle is a one-mile, zig-zagging bicycle route from Market Street to Golden Gate Park in San Francisco, California, that minimizes hilly inclines for bicycle riders. Rising 120 feet, The Wiggle inclines average 3% and never exceed 6%. The path generally follows the historical route of the long since paved-over Sans Souci Valley watercourse, winding through the Lower Haight neighborhood toward the Panhandle section of Golden Gate Park.\\nThe lower end of the route begins at either end of the Duboce Bikeway in the block of Duboce Avenue just west of Market Street. The elevation is approximately 100 feet above sea level. It then moves in a zig-zag toward the northwest along Duboce Avenue, Steiner, Waller, Pierce, Haight, Scott, and Fell Streets to the Panhandle Bikeway, 215 feet above sea level. After climbing 50 more feet, the peak of The Wiggle is reached near Stanyan Street at the peninsular drainage divide, i.e., the dividing point between surface water flowing to the San Francisco Bay on the east side and flowing to the Pacific Ocean on the west.\\nBicyclists can travel The Wiggle between major eastern and central neighborhoods and major western neighborhoods."},{"page_url":"https://nl.wikipedia.org/wiki/Overwinningsmedaille_(Verenigd_Koninkrijk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Henry_Allingham_in_June_2006.jpg","page_title":"Overwinningsmedaille (Verenigd Koninkrijk)","context_page_description":"De Overwinningsmedaille, ook wel \\"Inter-Allied Victory Medal\\" genoemd, is de Britse versie van de Intergeallieerde Medaille die na de overwinning in de Eerste Wereldoorlog aan meer dan 6.334.522 veteranen werd uitgereikt.\\nDe medaille werd op 1 september 1919 ingesteld door George V van het Verenigd Koninkrijk. De medaille werd ook in de Britse koloniën en in de dominions Canada, Australië, Nieuw-Zeeland en het Keizerrijk India uitgereikt.\\nVan de dominions verkoos alleen Zuid-Afrika een eigen medaille met tweetalige keerzijde in het Engels en het Nederlands te slaan. De Britse medaille wordt tot de campagnemedailles gerekend.\\nDe dominions en de koloniën maakten in 1918 en nog lang daarna gebruik van de in het Verenigd Koninkrijk door hun gezamenlijke koning ingestelde en verleende onderscheidingen en ridderorden."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9C%D1%96%D1%85%D0%B0%D0%B9%D0%BB%D0%B0%D1%9E%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D1%83%D0%BB%D1%96%D1%86%D0%B0_(%D0%9A%D1%96%D0%B5%D1%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/DSC_5536_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_18-%D0%92_%D0%9A%D0%B8%D0%B5%D0%B2_2012_01.JPG","page_title":"Міхайлаўская вуліца (Кіеў)","context_page_description":"Міхайлаўская вуліца — вуліца ў Шаўчэнкаўскім раёне горада Кіева. Пралягае ад плошчы Незалежнасці да Міхайлаўскай плошчы. Да Міхайлаўскай вуліцы прымыкае Міхайлаўскі завулак."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Lichterfelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Kommandantenstra%C3%9Fe_83-84_%28Berlin-Lichterfelde%29.JPG","page_title":"Liste der Kulturdenkmale in Berlin-Lichterfelde","context_page_description":"In der Liste der Kulturdenkmale von Lichterfelde sind die Kulturdenkmale des Berliner Ortsteils Lichterfelde im Bezirk Steglitz-Zehlendorf aufgeführt."},{"page_url":"https://pt.wikipedia.org/wiki/Ur%C3%A2nia_(S%C3%A3o_Paulo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Bras%C3%A3o_de_Ur%C3%A2nia%2C_SP.jpg","page_title":"Urânia (São Paulo)","context_page_description":"Urânia é um município brasileiro do estado de São Paulo. Localiza-se a uma latitude 20º14'46\\" sul e a uma longitude 50º38'35\\" oeste, estando a uma altitude de 458 metros. A cidade tem uma população de 8.836 habitantes e área de 208,9 km²."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CE%B1%CF%84%CE%AC%CE%BB%CE%BF%CE%B3%CE%BF%CF%82_%CE%AD%CF%81%CE%B3%CF%89%CE%BD_%CF%84%CE%BF%CF%85_%CE%92%CE%AF%CE%BD%CF%83%CE%B5%CE%BD%CF%84_%CE%B2%CE%B1%CE%BD_%CE%93%CE%BA%CE%BF%CE%B3%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/WLANL_-_artanonymous_-_Plaster_Statuette_of_a_Horse.jpg","page_title":"Κατάλογος έργων του Βίνσεντ βαν Γκογκ","context_page_description":"Η σελίδα αυτή είναι ένας εικονογραφημένος κατάλογος έργων του Βίνσεντ βαν Γκογκ. Παρά το μέγεθός του, ο κατάλογος αυτός δεν είναι πλήρης, δεδομένου ότι ο βαν Γκογκ δημιούργησε στα 37 χρόνια της ζωής του περίπου 900 πίνακες ζωγραφικής και 1.100 σχέδια, σκίτσα κτλ. Το Μουσείο Βαν Γκογκ στο Άμστερνταμ και το Kröller-Müller Museum στο Otterlo της Ολλανδίας διαθέτουν τις σημαντικότερες συλλογές έργων του καλλιτέχνη.\\nTα έργα παρουσιάζονται με χρονολογική σειρά και κατ' αύξοντα αριθμό καταλόγου του Jacob Baart de la Faille. Υπάρχουν πάντως σήμερα επιφυλάξεις ως προς την αυθεντικότητα ορισμένων έργων. Όλα τα έργα είναι με λάδι σε καμβά, εκτός αν αναφέρεται διαφορετικά."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%97%A4%EC%88%98%EC%8A%A4_%EB%82%98%EB%B0%94%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Navas_of_Manchester_City_October_2014.jpg","page_title":"헤수스 나바스","context_page_description":"헤수스 나바스 곤살레스는 스페인 출신의 축구 선수로, 세비야 소속으로 뛰고 있다. 포지션은 윙어이다. 그는 빠른 스피드와 준수한 키핑능력, 강력한 중거리 슛 등이 장점이다. 허나 그는 공황장애라는 것을 앓고 있어 어려움을 받고 있었다. 그러나 지금은 많이 좋아졌다.\\n그는 세비야에서 400경기를 뛰었고, UEFA컵과 코파 델 레이를 포함한 6개의 주요 타이틀로 그의 경력은 대부분 세비야에 있다.\\n2013년에 그는 맨체스터 시티로 이적하였다."},{"page_url":"https://da.wikipedia.org/wiki/Jordan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/King_abdullah_ii_of_jordan.jpg","page_title":"Jordan","context_page_description":"Jordan er et land i Mellemøsten øst for Jordanfloden. Landet ligger mellem Syrien, Irak, Saudi-Arabien, Israel og Vestbredden.\\nJordan er et monarki med en stærk kongemagt. Kong Abdullah II tilhører den hashemitiske kongeslægt, der betragter sig som efterkommere af profeten Muhammed."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D8%B1%D8%A7%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Parn%C3%ADk_Vy%C5%A1ehrad_pod_Vy%C5%A1ehradem.jpg","page_title":"پراگ","context_page_description":"پراگ پایتخت و بزرگ‌ترین شهر کشور جمهوری چک است، همچنین ۱۴امین شهر بزرگ اتحادیه اروپا نیز به‌شمار می‌آید. این شهر در شمال غربی کشور چک بر روی رودخانه ولتاوا بنا شده‌است و جمعیتی نزدیک به ۱٫۳ میلیون نفر دارد که منطقه بزرگ شهری آن جمعیتی نزدیک به ۲ میلیون نفر را شامل می‌شود. پراگ دارای آب و هوای معتدل اقیانوسی بوده و از این رو دارای تابستان‌های گرم و زمستان‌های سرد است. متروی پراگ از اواسط قرن بیستم فعال شده اما بیشتر حمل و نقل عمومی مردم با استفاه از خطوط تراموا است.\\nاین شهر زمانی پایتخت بوهم بوده، به‌خاطر موقعیت راهبردی‌اش، بسیار مهم تلقی می‌شده و در جریان جنگ جهانی هم بسیار نقش‌آفرین بوده‌است. خصوصیت‌های جغرافیایی و ویژگی‌های تاریخی منطقهٔ پراگ قدیم موجب شده که همواره جزو ده شهر گردشگرپذیر اتحادیهٔ اروپا محسوب شده، سالیانه حدود ۶ میلیون نفر گردشگر را از سراسر دنیا پذیرا باشد.\\nقلعهٔ پراگ، پل تاریخی چارلز، ساعت نجومی و موزهٔ ملی چک، از دیدنی‌های پراگ به‌شمار می‌روند. تالار شهرداری، گالری پراگ، موزهٔ کافکا، موزهٔ کمونیسم، موزهٔ هنرهای تزئینی، باغ وحش پراگ، گورستان اولشانی و تپه و پارک پترین، از دیگر جاذبه‌های گردشگری پراگ هستند. مرکز این شهر ساختمان‌هایی با نماهایی هنری با شیروانی‌های آجری‌رنگ و کوچه پسکوچه‌های سنگفرش با تعداد کثیری مغازهٔ سوغاتی‌فروشی و کافه دارد."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D1%83%D1%80%D0%B0%D0%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Dir_Hagla_P1020157.JPG","page_title":"Мурал","context_page_description":"Мурал или зидно сликарство означава монументалну композицију урађену на зиду, таваници или некој другој великој перманентној зиданој површини, као њен интегрални део. Ова уметничка композиција у себи обједињава опште елементе слике, и елементе архитектуре.\\nСама израда зидне слике, односно мурала, зависи од састава подлоге уз коју је везана одговарајућом техником, док на композицију и распоред елемената утиче простор чије димензије намјећу и димензије саме зидне слике. Зидне слике, односно мурали могу бити изузетно велике велике, па у својој декоративној, наративној или меморијалној функцији најчешће попримају монументални карактер.\\nНајчешће се на овај начин осликавају фасаде зграда или велике зидне површине унутар просторија. У ширем смислу појам „мурал” се односи на сликарску категорију која је постала популарна захваљујући уметничком покрету – мурализму. Некада су зидне слике имале велику важност, не само као украс верских и стамбених објеката, него и као исказ богатства и покровитељства. Карактеристика која мурал издваја од других сликарских форми је то да су архитектонски елементи датог простора хармонично уграђени у слику."},{"page_url":"https://pl.wikipedia.org/wiki/Marcus_Banks","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Marcus_banks.jpg","page_title":"Marcus Banks","context_page_description":"Marcus Banks, właśc. Arthur Lemarcus Banks III – amerykański koszykarz, grający na pozycji rozgrywającego, obecnie zawodnik New Orleans Hornets."},{"page_url":"https://es.wikipedia.org/wiki/Villafranca_de_los_Barros","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Concejales_.jpg","page_title":"Villafranca de los Barros","context_page_description":"Villafranca de los Barros es un municipio y localidad de España, en la provincia de Badajoz, comunidad autónoma de Extremadura. Junto con Almendralejo, es el centro comarcal de Tierra de Barros. Asimismo, Villafranca es la capital administrativa de la Mancomunidad Tierra de Barros-Río Matachel."},{"page_url":"https://nl.wikipedia.org/wiki/Cypriotische_oudheid","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Chypriotische_koninkrijken.PNG","page_title":"Cypriotische oudheid","context_page_description":"De Cypriotische oudheid is de periode van de 8e eeuw v.Chr. tot de Cypriotische middeleeuwen. De vroegste geschreven bronnen die verwijzen naar Cyprus dateren van de midden-bronstijd, zie Alashia."},{"page_url":"https://es.wikipedia.org/wiki/Mujeres_en_WWE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Becky_Lynch_WM_2019.jpg","page_title":"Mujeres en WWE","context_page_description":"Las mujeres en WWE son el talento femenino al servicio de la World Wrestling Entertainment, una promoción de lucha libre profesional estadounidense. Este término se refiere a mujeres que aparecen como luchadoras, mánagers o valets, entrevistadoras, comentaristas o anunciadoras.\\nDurante años, se utilizó el término Diva para referirse al talento femenino en cuestión.​ El lema de la división era atractiva, inteligente y poderosa.\\nLas mujeres comenzaron a llamarse Superstars en Wrestlemania 32. El término fue eliminado a causa de la 'Diva Revolution' en 2015, donde el talento así como fanáticos exigieron más oportunidades para las mujeres. Después de dichos cambios, la división femenina ya no participa en concursos de bikini, luchas de disfraces o derivadas, también dando como resultado el retiro del Campeonato de Divas, dando entrada a los Campeonatos femeninos de Raw y SmackDown."},{"page_url":"https://ceb.wikipedia.org/wiki/Kingston_Seymour_(kapital_sa_distrito)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/The_Triangle_Kingston_Seymour.jpg","page_title":"Kingston Seymour (kapital sa distrito)","context_page_description":"Kapital sa distrito ang Kingston Seymour sa Hiniusang Gingharian. Nahimutang ni sa kondado sa North Somerset ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 190 km sa kasadpan sa London ang ulohan sa nasod. 6 metros ibabaw sa dagat kahaboga ang nahimutangan sa Kingston Seymour, ug adunay 388 ka molupyo.\\nAng yuta palibot sa Kingston Seymour kay kasagaran patag, apan sa sidlakan nga kini mao ang kabungtoran. Sa amihang-kasadpan, dagat ang pinakaduol sa Kingston Seymour. Kinahabogang dapit sa palibot ang Blackdown, 322 ka metros ni kahaboga ibabaw sa dagat, 12.7 km sa habagatan-sidlakan sa Kingston Seymour. Dunay mga 493 ka tawo kada kilometro kwadrado sa palibot sa Kingston Seymour nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Bristol, 19.4 km sa sidlakan sa Kingston Seymour. Hapit nalukop sa kasagbotan ang palibot sa Kingston Seymour. Sa rehiyon palibot sa Kingston Seymour, mga luuk talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Agosto, sa 16 °C, ug ang kinabugnawan Disyembre, sa 0 °C."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%9B%E0%B8%B2%E0%B9%80%E0%B8%95%E0%B8%B5%E0%B8%A2%E0%B8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Fu_Rong_2016_Han_Zhao_Lie_Miao.jpg","page_title":"เปาเตียว","context_page_description":"เปาเตียว ขุนศึกแห่ง จ๊กก๊ก ในช่วง ยุคสามก๊ก\\nใน ศึกอิเหลง เมื่อ ค.ศ. 221 เปาเตียวได้ติดตามพระเจ้าเล่าปี่ไปรบกับ ง่อก๊ก ของ ซุนกวน เพื่อล้างแค้นให้กับ กวนอู และ เตียวหุย แต่เปาเตียวกลับถูกฆ่าตายในที่รบเมื่อ ค.ศ. 222\\nเปาเตียวเป็นบิดาของ ปอเฉียม ขุนศึกแห่งจ๊กก๊กซึ่งได้ออกรบต่อสู้กับ วุยก๊ก และ ง่อก๊ก หลายครั้งอย่างกล้าหาญ"},{"page_url":"https://it.wikipedia.org/wiki/Nissan_NV400","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Nissan_NV400_Kastenwagen_dCi_100_%E2%80%93_Heckansicht%2C_26._April_2014%2C_D%C3%BCsseldorf.jpg","page_title":"Nissan NV400","context_page_description":"Il Nissan NV400 è un furgone prodotto dalla casa automobilistica giapponese Nissan a partire dal 2011. Sostituisce il Nissan Interstar ed è uguale al Renault Master III serie e all'Opel Movano II serie."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B8%D1%87%D0%BC%D1%8A%D0%BD%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Falls_of_the_James%2C_Downtown_Richmond%2C_Virginia%2C_2008.JPG","page_title":"Ричмънд","context_page_description":"Ричмънд е град в Съединените американски щати, столица на щата Вирджиния. Разположен е на река Джеймс, на 100 km над вливането ѝ в Атлантическия океан. Градът е място на няколко сражения в хода на Американската война за независимост и на Американската гражданска война, по време на която е столица на Конфедералните американски щати. Населението му е около 204 214 души."},{"page_url":"https://nl.wikipedia.org/wiki/Vanessa_braziliensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Vanessa_braziliensis.jpg","page_title":"Vanessa braziliensis","context_page_description":"Vanessa braziliensis is een vlinder uit de familie Nymphalidae, de vossen, parelmoervlinders en weerschijnvlinders. De wetenschappelijke naam van de soort werd, als Pyrameis braziliensis, in 1883 door Frederic Moore gepubliceerd."},{"page_url":"https://de.wikipedia.org/wiki/Gedenkm%C3%BCnzen_der_Deutschen_Demokratischen_Republik","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/5_Mark_DDR_1983_-_500._Geburtstag_von_Martin_Luther_-_Geburtshaus_in_Eisleben_-_Wertseite.JPG","page_title":"Gedenkmünzen der Deutschen Demokratischen Republik","context_page_description":"Die Gedenkmünzen der Deutschen Demokratischen Republik wurden von der Münzprägeanstalt der DDR von 1966 bis 1990 mit 122 unterschiedlichen Motiven produziert. Vier davon hatten als Währungsbezeichnung MDN, alle anderen Mark. Sie bestanden aus unterschiedlichen Legierungen mit Münzwerten von 5, 10 oder 20 Mark.\\nDie seltenste Gedenkmünze der DDR ist eine Goldprägung des 20-Mark-Stücks 150. Geburtstag von Karl Marx. Sie wurde als Einzelanfertigung zum 75. Geburtstag des Staatsratsvorsitzenden Walter Ulbricht geprägt und diesem von der Staatsbank überreicht. Das Exemplar befindet sich heute im Deutschen Historischen Museum in Berlin.\\nDie auflagenstärkste Münze hatte einen Wert von 5 Mark und wurde aus einer bronzefarbenen Legierung aus Kupfer und Nickel hergestellt. Ihre Anzahl war mit über 50 Millionen Exemplaren mehr als dreimal so hoch wie die Einwohnerzahl der DDR von ca. 16 Millionen.\\n11 Gedenkmünzen aus Neusilber hatten ebenfalls hohe Prägezahlen von weit über einer Million Exemplaren und damit keinen Sammlerwert. Die höchste Auflage hatte die 5-Mark-Münze aus dem Jahr 1971 – Berlin, Hauptstadt der DDR – mit über 18 Millionen Stück."},{"page_url":"https://de.wikipedia.org/wiki/Filmjahr_1967","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Maria_Bello_at_the_2010_Independent_Spirit_Awards.jpg","page_title":"Filmjahr 1967","context_page_description":"18. Oktober: Premiere von Das Dschungelbuch. Das Dschungelbuch wird das erfolgreichste Film des Jahres 1967. Diese Disney-Produktion erweist sich in den Folgejahrzehnten als der Film mit den meisten Zuschauern in Deutschland.\\nUraufführungen von Bonnie und Clyde und Die Reifeprüfung. Beide Filme werden als Keimzellen des Begriffs New Hollywood angesehen, der sich später etablierte.\\nDer Film The Trip trifft den Zeitgeist der 1960er und wird ein großer Erfolg in den Kinos.\\n1. Dezember: Kinostart des Films Tanz der Vampire in der Bundesrepublik Deutschland.\\nDer Prototyp des IMAX Kino-Systems wird auf der EXPO 1967 in Montreal, Kanada ausgestellt.\\nUnited Artists wird von den dessen Manager Arthur Krim und Robert Benjamin an das Unternehmen Transamerica Corporation verkauft.\\nDie Hochschule für Fernsehen und Film München nimmt im Wintersemester ihren Lehrbetrieb auf.\\nDie Sieger der BRAVO Otto Leserwahl 1967:\\nKategorie – männlicher Filmstar: Gold Pierre Brice, Silber Horst Buchholz, Bronze Sean Connery\\nKategorie – weiblicher Filmstar: Gold Marie Versini, Silber Liselotte Pulver, Bronze Uschi Glas\\nDie erfolgreichsten westdeutschen Filmproduktionen und Koproduktionen 1967:"},{"page_url":"https://pt.wikipedia.org/wiki/Hist%C3%B3ria_de_Silves","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Algarve_-_Silves_-_view_of_the_town_%2825198729934%29_%28cropped%29.jpg","page_title":"História de Silves","context_page_description":"Silves é uma cidade e um concelho na região do Algarve, no Sul de Portugal. O local onde se encontra a cidade pode já ter sido ocupado pelos lusitanos, que teriam um castro no local do Castelo, tendo sido depois dominada pelos romanos. Atingiu uma grande importância política, cultural e económica durante o período muçulmano, entre os séculos VIII e XIII, sendo nessa altura conhecida como Xelb. Após a reconquista, a cidade entrou num profundo processo de declínio, acabando por perder a sua posição como sede do Bispado do Algarve para Faro em 1577."},{"page_url":"https://vi.wikipedia.org/wiki/Th%C3%A1i_S%C6%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Town_at_the_top.jpg","page_title":"Thái Sơn","context_page_description":"Thái Sơn là một ngọn núi có ý nghĩa lịch sử và văn hóa nằm ở phía Bắc của thành phố Thái An, Sơn Đông, Trung Quốc. Điểm cao nhất của nó được gọi là Đỉnh Ngọc Hoàng cao 1.545 mét nhưng theo các báo cáo của cơ quan thuộc Chính phủ Trung Quốc là 1.532,7 mét.\\nThái Sơn được mệnh danh là Đông Nhạc, một trong số Ngũ Nhạc danh sơn Trung Quốc và được coi là ngọn núi quan trọng nhất trong số đó. Ngoài ra, Thái Sơn cũng là nơi có lịch sử thờ cúng ít nhất 3.000 năm, là một trong những trung tâm nghi lễ tôn giáo quan trọng nhất của Trung Quốc trong suốt lịch sử."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D0%BC%D0%BD%D1%8F_(%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D1%97%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Demnia_myk_prapor.png","page_title":"Демня (Миколаївський район)","context_page_description":"Де́мня — село в Україні, у Миколаївському районі Львівської області. Населення становить 1602 особи. Орган місцевого самоврядування — Демнянська сільська рада."},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0lhanl%C4%B1_h%C3%BCk%C3%BCmdarlar%C4%B1_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Teg%C3%BCder_recevant_une_ambassade.jpeg","page_title":"İlhanlı hükümdarları listesi","context_page_description":"İlhanlı hükümdarlarının listesi, Cengiz Han'ın torunu Hülagû Han tarafından, merkezi Tebriz olmak üzere Azerbaycan'da kurulan Moğol devleti İlhanlılar'ın hükümdarları."},{"page_url":"https://pl.wikipedia.org/wiki/Linia_kolejowa_nr_283","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/DSCF2926.JPG","page_title":"Linia kolejowa nr 283","context_page_description":"Linia kolejowa nr 283 – linia kolejowa w południowo-zachodniej Polsce, w województwie dolnośląskim o długości 77,551 km, łącząca Jelenią Górę z Ławszową przez Lwówek Śląski i Zebrzydową. Jest to linia drugorzędna, w całości jednotorowa i niezelektryfikowana. W przeszłości linia liczyła łącznie 104,730 km i kończyła swój bieg na stacji Żagań w województwie lubuskim.\\nLinia jest położona w województwie dolnośląskim, na obszarze miasta Jelenia Góra oraz powiatów: jeleniogórskiego, lwóweckiego i bolesławieckiego. W obecnym przebiegu powstała ona w wyniku zakwalifikowania przez Polskie Koleje Państwowe po 1945 roku, trzech przedwojennych linii niemieckich: Zebrzydowa – Żagań, Zebrzydowa – Lwówek Śląski oraz Jelenia Góra – Lwówek Śląski. Obecny numer linia nosi od roku 1980.\\nPoczątki linii nr 283 sięgają lat 80. XIX wieku, kiedy to projektowano połączenie biegnące wzdłuż Doliny Bobru, mające połączyć Jelenią Górę z Bolesławcem. Linię rozpoczęto realizować na początku XX w. od Zebrzydowej do Żagania etapami, do 1 sierpnia 1905."},{"page_url":"https://en.wikipedia.org/wiki/Betania,_Antioquia","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Parque_de_Betania_2.JPG","page_title":"Betania, Antioquia","context_page_description":"Betania is a town and municipality in the Colombian department of Antioquia. Part of the subregion of Southwestern Antioquia. It exists 33 mi/53 km SW of Medellín. Main industries include coffee, sugarcane, cacao, and livestock."},{"page_url":"https://vi.wikipedia.org/wiki/B%E1%BA%AFc_Ireland","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Mournes_wiki.jpg","page_title":"Bắc Ireland","context_page_description":"Bắc Ireland là một bộ phận của Vương quốc Liên hiệp Anh và Bắc Ireland nằm ở đông bắc của đảo Ireland. Trong các điều khoản khác nhau, Bắc Ireland được mô tả như một quốc gia, tỉnh hay vùng của nước Anh. Bắc Ireland có biên giới với Cộng hòa Ireland ở phía nam và phía tây. Theo số liệu điều tra năm 2011, có 1.810.900 cư dân sinh sống tại Bắc Ireland, chiếm khoảng 30% tổng dân số toàn đảo Ireland và khoảng 3% dân số nước Anh. Kể từ khi ký kết Thỏa thuận Thứ sáu Tuần Thánh năm 1998, Bắc Ireland được tự trị ở mức độ lớn. Theo thỏa thuận, Bắc Ireland hợp tác với phần còn lại của đảo Ireland trên một số phạm vi chính sách, trong khi chính phủ nước Anh duy trì quyền lực với các lĩnh vực khác, mặc dù Cộng hòa Ireland \\"có thể trình bày quan điểm và đề nghị\\".\\nTrong nhiều năm, Bắc Ireland là nơi diễn ra một cuộc xung đột bạo lực và quyết liệt, được gọi với cái tên the Troubles. Nguyên nhân của cuộc xung đột này là sự chia rẽ giữa hai lực lượng, thứ nhất là những người dân tộc chủ nghĩa tự nhìn nhận mình là người Ireland và chủ yếu là tín đồ Giáo hội Công giáo Rôma, lực lượng còn lại là những người hợp nhất chủ nghĩa vốn tự nhìn nhận mình là người Anh và chủ yếu là tín đồ Tin Lành."},{"page_url":"https://de.wikipedia.org/wiki/Estnische_Inseln","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Kasselaid.jpg","page_title":"Estnische Inseln","context_page_description":"Die Estnischen Inseln umfassen 2222 Inseln in der Ostsee und 133 größere Inseln in Seen und Flüssen. Nur 29 Inseln des Landes sind größer als 1 km², 318 sind größer als 1 Hektar und nur 19 Inseln sind bewohnt."},{"page_url":"https://tr.wikipedia.org/wiki/Supermarine_Seafire","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Seafire_1.jpg","page_title":"Supermarine Seafire","context_page_description":"Supermarine Seafire, Supermarine tarafından üretilen Birleşik Krallık yapımı bir uçak gemisi tabanlı avcı uçağıdır. Uçak, Supermarine Spitfire'ın donanma için üretilmiş varyantı olup II. Dünya Savaşı'nda kullanılmıştır."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%A0%D7%98%D7%A7%D7%A8%D7%99%D7%A1%D7%98%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Montecristo_island.corr.jpg","page_title":"מונטקריסטו","context_page_description":"מוֹנטֶקריסטוֹ הוא אי איטלקי זעיר בים הטירני. שטחו הוא כ-10 קילומטרים מרובעים. הוא נמצא בערך בחצי הדרך בין קורסיקה לבין איטליה. אי זה הוא חלק מהארכיפלג הטוסקני. האי איננו מיושב.\\nעלילת הספר הרוזן ממונטה כריסטו מאת אלכסנדר דיומא האב מתרחשת באי ועל כך עיקר פרסומו."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC_%D0%9A%D0%BE%D1%80%D0%B4%D0%B5%D1%81_%D0%B8_%D1%81%D1%8B%D0%BD%D0%BE%D0%B2%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Rose_Esmeralda.jpg","page_title":"Вильгельм Кордес и сыновья","context_page_description":"W. Kordes’ Söhne Rosenschulen GmbH & Co KG — компания, занимающаяся селекцией и производством роз.\\nВ компании работает около 150 сотрудников, ежегодно реализуется более двух миллионов роз по всему миру."},{"page_url":"https://sh.wikipedia.org/wiki/Cl%C3%A9mence_Po%C3%A9sy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Clemence_Poesy_2014.jpg","page_title":"Clémence Poésy","context_page_description":"Klemans Poezi je francuska glumica i manekenka, internacionalnoj publici poznata po ulogama Fler Delaker u Hari Poter serijalu, Kloi u kriminalističkoj komediji U Brižu i Rane u drami 127 sati. Takođe je nastupila u nekoliko epizoda serije Tračara."},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%AD%E0%B3%80%E0%B2%AE%E0%B2%BE%E0%B2%B6%E0%B2%82%E0%B2%95%E0%B2%B0_%E0%B2%A6%E0%B3%87%E0%B2%B5%E0%B2%BE%E0%B2%B2%E0%B2%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Bell_BM.jpg","page_title":"ಭೀಮಾಶಂಕರ ದೇವಾಲಯ","context_page_description":"ಭೀಮಾಶಂಕರ ದೇವಾಲಯ ವು, ಭಾರತದ ಪೂನಾ ಸಮೀಪದ ಖೇಡ್ ನ ವಾಯವ್ಯ ದಿಕ್ಕಿನಲ್ಲಿ ೫೦ ಕಿಲೋಮೀಟರ್ ದೂರದಲ್ಲಿರುವ ಭೋರ್ ಗಿರಿ ಎಂಬ ಹಳ್ಳಿಯಲ್ಲಿ ಸ್ಥಾಪಿತವಾಗಿದೆ. ಈ ದೇವಾಲಯವು ಸಹ್ಯಾದ್ರಿ ಪರ್ವತಗಳ ಘಟ್ಟ ಪ್ರದೇಶದಲ್ಲಿ ಪೂನಾದಿಂದ ೧೧೦ಕಿಲೋಮೀಟರ್ ಗಳ ದೂರಕ್ಕೆ ನೆಲೆಗೊಂಡಿದೆ. ಭೀಮಾಶಂಕರ ದೇವಾಲಯದ ತಟದಲ್ಲಿ ಭೀಮಾನದಿಯ ಉಗಮವಾಗುತ್ತದೆ. ಇದು ಆಗ್ನೇಯ ದಿಕ್ಕಿನಲ್ಲಿ ಹರಿಯುವುದರ ಜೊತೆಗೆ ರಾಯಚೂರು ಸಮೀಪದ ಕೃಷ್ಣಾ ನದಿಯಲ್ಲಿ ಸಂಗಮವಾಗುತ್ತದೆ. ಮಹಾರಾಷ್ಟ್ರದಲ್ಲಿರುವ ಇತರ ಜ್ಯೋತಿರ್ಲಿಂಗ ದೇವಾಲಯಗಳೆಂದರೆ ಪಾರ್ಲಿ ತ್ರೈಯಂಬಕೇಶ್ವರ್ ಹಾಗು ಗ್ರಿಶ್ಣೆಶ್ವರ್. ಮುಂಬಯಿ ಸಮೀಪದ ಯಾತ್ರಿಗಳು ಭೀಮಾಶಂಕರ ದೇವಾಲಯಕ್ಕೆ ಖಂಡಸ್ ಮೂಲಕ ಕರ್ಜತ್ ನಿಂದ ಪ್ರಯಾಣ ಬೆಳೆಸುತ್ತಾರೆ. ಇಲ್ಲಿ ನೆಲೆಯಾಗಿರುವ ಭೀಮಾಶಂಕರ ವನ್ಯಜೀವಿ ಅಭಯರಣ್ಯವು ಮುಂಬಯಿ ಹಾಗು ಪೂನಾದ ನಿವಾಸಿಗಳಿಗೆ ಒಂದು ಜನಪ್ರಿಯ ವಾರಾಂತ್ಯದ ತಾಣವಾಗಿದೆ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BB%D0%B5%D1%81%D0%BE_%D0%90%D1%80%D0%B8%D1%81%D1%82%D0%BE%D1%82%D0%B5%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Aristotles_wheel.svg","page_title":"Колесо Аристотеля","context_page_description":"«Колесо Аристотеля» — физический парадокс, описанный в книге «Механика», которая считается трудом Аристотеля. Рассмотрим два соединённых колеса, одно внутри другого, с общим центром. Когда внешнее колесо движется без скольжения по плоскости и описывает полный оборот, его путь равен длине его окружности. При этом путь внутреннего колеса точно такой же, из чего можно сделать ошибочный вывод, что их окружности равны.\\nЭтот парадокс обсуждали многие выдающиеся физики и математики, в том числе Галилей, Декарт и Ферма. Первым правильный анализ дал Жан-Жак Дорту де Меран в 1715 году. Ошибка заключается в предположении, что внутреннее колесо, подобно внешнему, движется без скольжения."},{"page_url":"https://ceb.wikipedia.org/wiki/Mylopharyngodon_piceus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Mylopharyngodon_piceus.jpg","page_title":"Mylopharyngodon piceus","context_page_description":"Espesye sa isda nga una nga gihulagway ni Richardson ni adtong 1846 ang Mylopharyngodon piceus. Ang Mylopharyngodon piceus sakop sa kahenera nga Mylopharyngodon sa kabanay nga karpa. Giklaseklase sa IUCN ang espesye sa kapos sa datos. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82%D1%96%D0%B2_%D0%91%D1%83%D0%BD%D0%B4%D0%B5%D1%81%D1%82%D0%B0%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Joana_Cotar.jpg","page_title":"Список депутатів Бундестагу","context_page_description":"Нижче наведено список чинних депутатів Бундестагу, законодавчого органу Німеччини. Поточна сесія почалась 24 жовтня 2017 року, за результатами виборів до Бундестагу 2017 року. Законодавчий термін триває чотири роки. Наступні вибори до Бундестагу очікуються між серпнем та жовтнем 2021 року."},{"page_url":"https://fr.wikipedia.org/wiki/Claire_Philouze","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/2014_Acrobatic_Gymnastics_World_Championships_-_Women%27s_pair_-_Awarding_ceremony_01_%28cropped%29.jpg","page_title":"Claire Philouze","context_page_description":"Claire Philouze, née le 15 juillet 1998, est une gymnaste acrobatique française.\\nElle remporte aux Championnats du monde de gymnastique acrobatique 2014 à Levallois-Perret la médaille de bronze en duo féminin avec Léa Roussel."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%8D%CF%83%CF%84%CE%B7%CE%BC%CE%B1_%CE%BA%CF%81%CE%AC%CF%84%CE%B7%CF%83%CE%B7%CF%82_%CE%B1%CE%B5%CF%81%CE%BF%CF%80%CE%BF%CF%81%CE%B9%CE%BA%CF%8E%CE%BD_%CE%B8%CE%AD%CF%83%CE%B5%CF%89%CE%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Magnetronic_Reservisor.jpg","page_title":"Σύστημα κράτησης αεροπορικών θέσεων","context_page_description":"Ένα «Σύστημα κράτησης αεροπορικών θέσεων», είναι μέρος των λεγόμενων «Συστημάτων Εξυπηρέτησης Επιβατών», τα οποία είναι εφαρμογές που υποστηρίζουν την άμεση επαφή μεταξύ της αεροπορικής εταιρίας και του επιβάτη.\\nΤο ARS, τελικά εξελίχθηκε στο λεγόμενο «Ηλεκτρονικό σύστημα κράτησης θέσεων», «Σύστημα κράτησης θέσεων» ή απλά «Κεντρικό σύστημα κρατήσεων», το οποίο είναι ένα μηχανογραφικό σύστημα που χρησιμοποιείται για την αποθήκευση και ανάκτηση των πληροφοριών και τη διεξαγωγή των συναλλαγών που σχετίζονται με τα αεροπορικά ταξίδια, ξενοδοχεία, ενοικιάσεις αυτοκινήτων ή δραστηριότητες. Αρχικά, σχεδιασμένο για να λειτουργεί από τις αεροπορικές εταιρίες, τα CRS αργότερα επεκτάθηκαν για χρήση και από τα γραφεία ταξιδίων. Οι μεγάλοι σημαντικοί λειτουργοί των CRS, οι οποίοι πραγματοποιούν κρατήσεις θέσεων και πωλούν εισιτήρια σε πολλαπλές αεροπορικές εταιρίες, είναι γνωστοί ως «Παγκόσμια Συστήματα Διανομής», τα οποία υποστηρίζουν τα γραφεία ταξιδίων και τα άλλα κανάλια διανομής, πραγματοποιώντας κρατήσεις θέσεων για τις περισσότερες μεγάλες αεροπορικές εταιρίες, σε ένα ενιαίο σύστημα."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1992","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Tomac.jpg","page_title":"Lijst van personen geboren in 1992","context_page_description":"Dit is een lijst van personen die geboren zijn in 1992.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://bs.wikipedia.org/wiki/Dijakritici_u_arapskom_pismu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Kufic_Quran%2C_sura_7%2C_verses_86-87.jpg","page_title":"Dijakritici u arapskom pismu","context_page_description":"Arapsko pismo ima brojne dijakritike, uključujući i'džam, suglasničke tačke i teškil, dodatne dijakritike. Potonji uključuju hereketa non.mn., ḥereke nom.jd., znakove za samoglasnike.\\nArapsko pismo je mješoviti ebdžed, gdje su kratki suglasnici i dugi samoglasnici predstavljeni slovima, ali kratki samoglasnici i suglasnička dužina uglavnom nisu naznačeni prilikom pisanja. Trškīl se uoptrebljava po slobodnom izboru za predstavljanje nedostajućih samoglasnika i suglasničke dužine. Moderni arapski jezik uvijek se piše korištenjem i'džāma - suglasničkih tačaka tj. suglasničkog usmjeravanja, ali samo su vjerski tekstovi, dječje knjige i djela za učenike napisani s cijelim teškilima - pokazivačima samoglasnika i suglasničkih dužina. Autori često dodaju dijakritike pojedinim riječima ili slovima kada padež ili značenje migli biti dvosmisleni ili nejasni. Pored toga, klasična dela i istorijski dokumenti koji su dostupni široj javnosti često su publikovana sa potpunim teškilom, kako bi se prebrodio jaz u razumevanju zbog stilskih promijena kroz vijekove."},{"page_url":"https://de.wikipedia.org/wiki/Salesche","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Salesche.JPG","page_title":"Salesche","context_page_description":"Salesche ist ein Ort in der zweisprachigen polnischen Gemeinde Leschnitz im Landkreis Strzelce der Woiwodschaft Oppeln."},{"page_url":"https://sr.wikipedia.org/wiki/Fikocijanin","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/Phycocyanobilin2.svg","page_title":"Fikocijanin","context_page_description":"Fikocijanin je pigmentni proteinski kompleks za prijem svetlosti, koji pripada porodici fikobiliproteina, zajedno sa alofikocijaninom i fikoerithrinom.To je dodatni pigment hlorofila.\\nSvi fikobiliproteini su rastvorljivi u vodi, tako da ne mogu postojati unutar membrane kao karotenoidi. Umesto toga, fikobiliproteini formiraju klastere koji se pridržavaju membrana zvanih fikobilisomi. Fikocijanin je karakteristično svjetlo plave boje, upijajući narandžasto i crveno svetlo, posebno oko 620 nm, i emituje fluorescentno, oko 650 nm. Alofikocijanin upija i emitira više talasnih dužina od fikocijanina C ili fikocijanina R.\\nFikocijanini se nalaze kod cijanobakterija. Imaju fluorescentne osobine koje se koriste u kompletima imunoanaliza. Naziv fikocijanin potiče od grčkoengleske rečenice grč. phyco = \\"alga\\" + eng. cyanin = boja cijan, što uobičajeno znači nijansu plavo-zelene, a potiče iz grčkog \\"kyanos\\" = nešto drugačije boje: \\"tamno plava\\". Fikocijaninski proizvodi, u produkciji Aphanizomenon flos-Aquae i spirulina, se, na primer, koriste u industriji hrane i pića, kao prirodne boje agensa 'Lina Blue' i nalaze se u slatkišima i sladoledu."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BD%D0%B4%D0%B5%D0%BB%D0%BE%D0%B2%D0%B8_%D0%B7%D0%B0%D0%BA%D0%BE%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/%D0%9D%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%BD%D0%BE_%D0%BF%D0%BE%D0%B4%D1%80%D0%B5%D0%B4%D1%83%D0%B2%D0%B0%D1%9A%D0%B5_%D0%B8_%D1%86%D0%B5%D0%BF%D0%B5%D1%9A%D0%B5.svg","page_title":"Менделови закони","context_page_description":"Менделовите закони научно опишуваат како наследните белези се предаваат од родителските организми на нивното потомство. Овие закони лежат во основата на генетиката. Теоретската рамка е изведена од работата на Грегор Мендел, објавена во 1865 и 1866, која била повторно актуелизирана во 1900; прво овие тврдења биле предмет на контроверзи. Кога Менделовите теории биле интегрирани во хромозомската теорија на наследувањето од страна на Томас Хант Морган во 1915, тие станале централен дел на класичната генетика."},{"page_url":"https://sr.wikipedia.org/wiki/Trovanje_gljivama","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Amanita_phalloides_1.JPG","page_title":"Trovanje gljivama","context_page_description":"Micetizam, odnosno trovanje gljivama, su štetni efekti unošenja otrovnih supstanci koje postoje u gljivama. Ovi simptomi mogu varirati od neznatnog bola u trbuhu do smrti. Trovanje gljivama je obično rezultat konzumiranja divljih gljiva zbog zamene sa nekom jestivom vrstom. Najčešći razlog ovoj zameni je velika sličnost po boji i generalnoj morfologiji otrovnih i jestivih gljiva.\\nKada govore o otrovima iz gljiva ljudi najčešće misle na one najopasnije - smrtno otrovne. Nisu svi toksini iz gljiva podjednako štetni, za ljudski organizam, a pogotovo nisu gljive, u kojima je toksin izolovan, obavezno smrtno otrovne. Treba imati na umu da je reakcija ljudskog organizma na otrovnost gljiva, često, sasvim individualna reakcija na ono što smo pojeli. Puževi i crvi, a često i krupna stoka, slobodno jedu i veoma otrovne gljive, bez ikakvih posledica. Na primer otrovi koji napadju krv, jetru i bubrege kod čoveka, na puževe uopšte ne deluju, zato što oni nemaju navedene organe i tkiva. Znači možemo da kažemo da šta je i za koga i koliko otrovno, to zavisi od niza okolnosti."},{"page_url":"https://fr.wikipedia.org/wiki/Ren%C3%A9-Michel_Legris-Duval","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Abb%C3%A9_Ren%C3%A9-Michel_Legris-Duval_%281765-1819%29.jpg","page_title":"René-Michel Legris-Duval","context_page_description":"L'abbé René-Michel Le Gris-Duval est un prêtre et prédicateur français."},{"page_url":"https://vi.wikipedia.org/wiki/Abutilon_hirtum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Abutilon_hirtum%28Lam.%29Sweet..jpg","page_title":"Abutilon hirtum","context_page_description":"Abutilon hirtum là một loài thực vật có hoa trong họ Cẩm quỳ. Loài này được Sweet mô tả khoa học đầu tiên năm 1826."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Aachen-Mitte_(A%E2%80%93H)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Gartenstra%C3%9Fe_40-44.JPG","page_title":"Liste der Baudenkmäler in Aachen-Mitte (A–H)","context_page_description":"Die Liste der Baudenkmäler in Aachen-Mitte (A–H) enthält die denkmalgeschützten Bauwerke auf dem Gebiet des Stadtbezirks Aachen-Mitte in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Aachen eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%81%93%E3%81%AE%E9%A7%85%E3%82%B9%E3%82%BF%E3%83%BC%E3%83%97%E3%83%A9%E3%82%B6%E8%8A%A6%E5%88%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Hoshi_no_furu_Hyakunen_Museum.jpg","page_title":"道の駅スタープラザ芦別","context_page_description":"道の駅スタープラザ芦別は、北海道芦別市にある国道38号の道の駅である。"},{"page_url":"https://fr.wikipedia.org/wiki/Daryl_Boyle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/GSHC_-_Redbull_Munich_-_Hockeyades_2016_-_36.jpg","page_title":"Daryl Boyle","context_page_description":"Daryl Boyle est un joueur professionnel canadien et allemand de hockey sur glace. Il évolue au poste de défenseur."},{"page_url":"https://en.wikipedia.org/wiki/Calcium_chloride","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Flame_Test_Ca.jpg","page_title":"Calcium chloride","context_page_description":"Calcium chloride is an inorganic compound, a salt with the chemical formula CaCl₂. It is a white coloured crystalline solid at room temperature, and it is highly soluble in water. It can be created by neutralising hydrochloric acid with calcium hydroxide.\\nCalcium chloride is commonly encountered as a hydrated solid with generic formula CaCl₂ₓ, where x = 0, 1, 2, 4, and 6. These compounds are mainly used for de-icing and dust control. Because the anhydrous salt is hygroscopic, it is used as a desiccant."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B9%CF%83%CF%83%CF%8E%CE%B4%CE%B7%CF%82_%CE%AC%CE%BC%CE%BC%CE%BF%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Athabasca_Oil_Sands_map.png","page_title":"Πισσώδης άμμος","context_page_description":"Η πισσώδης άμμος είναι μια μορφή μη συμβατικού κοιτάσματος πετρελαίου. Τα αποθέματα πισσώδους άμμου αποτελούνται από φυσικά μείγματα άμμου, αργίλου, νερού και ιδιαίτερα μεγάλου ιξώδους μειγμάτων βαρέων υδρογονανθράκων, είτε σε μορφή πισσώδους κινούμενης άμμου, είτε εγκλωβισμένων μέσα σε πισσώδη ψαμμίτη.\\nΦυσικά υπάρχοντα κοιτάσματα πισσώδους άμμου έχουν αναφερθεί σε πολλές χώρες, αλλά έχουν βρεθεί σε εξαιρετικά μεγάλες ποσότητες στον Καναδά.\\nΆλλα μεγάλα κοιτάσματα βρίσκονται στο Καζακστάν, στη Ρωσία και στη Βενεζουέλα. Εκτιμάται ότι τα παγκόσμια κοιτάσματα πετρελαίου ανέρχονται σε περισσότερο από 320 km³. Αυτή η εκτίμηση συμπεριλαμβάνει κοιτάσματα που δεν έχουν ακόμη ανακαλυφθεί. Τα αποδεδειγμένα κοιτάσματα πισσώδους άμμου ανέρχονται περίπου στα 16 km³. Τα συνολικά αποθέματα πισσώδους άμμου εκτιμάται ότι ανέρχονται σε 39,694 km³, από τα οποία 28,11 km³, δηλαδή περί το 70,8%, βρίσκονται στην Αλμπέρτα του Καναδά."},{"page_url":"https://cs.wikipedia.org/wiki/Atzenbrugg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Tautendorf_-_Kapelle.JPG","page_title":"Atzenbrugg","context_page_description":"Atzenbrugg je městys v Rakousku ve spolkové zemi Dolní Rakousy v okrese Tulln."},{"page_url":"https://fr.wikipedia.org/wiki/Jean_Ballestra","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Casque_de_J.Ballestra.jpg","page_title":"Jean Ballestra","context_page_description":"Jean Marc Ballestra, né le 20 juin 1924 à Nice et mort le 28 août 1944 à Nice, est un cheminot et un résistant français, membre des Forces françaises de l'intérieur."},{"page_url":"https://id.wikipedia.org/wiki/Antifon_O","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Evora88.jpg","page_title":"Antifon O","context_page_description":"Antifon O, yang juga dikenal sebagai O Agung adalah antifon Magnificat yang digunakan pada ibadat sore dalam tujuh hari terakhir dalam masa Adven dalam tradisi Kristen Barat. Antifon ini juga digunakan sebagai bait pengantar injil pada hari yang sama dalam Misa Gereja Katolik Roma yang dipergunakan sejak tahun 1970.\\nAntifon ini disebut sebagai \\"Antifon O\\" karena masing-masing judulnya dimulai dengan partikel vokatif \\"O\\". Masing-masing antifon adalah nama Kristus, salah satu sifat-Nya yang disebutkan dalam Kitab Suci. Antifon-antifon tersebut adalah:\\n17 Desember: O Sapientia\\n18 Desember: O Adonai\\n19 Desember: O Radix Jesse\\n20 Desember: O Clavis David\\n21 Desember: O Oriens\\n22 Desember: O Rex Gentium\\n23 Desember: O Emmanuel\\nDalam ritus Katolik bahasa Latin, Antifon O dinyanyikan atau dibacakan dalam ibadat sore dari tanggal 17 sampai dengan 23 Desember secara inklusif. Beberapa Gereja Anglikan juga menggunakannya, baik dalam cara yang sama seperti Katolik Roma modern, atau dengan cara penggunaan dalam bahasa Inggris menurut tradisi pada abad pertengahan.\\nPengunaan Antifon O juga berlangsng dalam banyak Gereja Lutheran."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_de_Languidou","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Languidou_fontaine.jpg","page_title":"Chapelle de Languidou","context_page_description":"La chapelle de Languidou est située dans la commune de Plovan, en Bretagne. D'un point de vue administratif, elle est dans le département du Finistère, arrondissement de Quimper. D'un point de vue ethnographique, elle est dans le Pays Bigouden, en Basse-Cornouaille.\\nAujourd'hui en ruine, cette chapelle du milieu du XIIIᵉ siècle conserve charme et beauté. Elle a en outre sa place dans l'histoire de l'art, car elle est peut-être l'édifice fondateur du style architectural dit de l'École de Pont-Croix. Elle se trouve en rivalité pour ce titre avec la collégiale Notre-Dame de Roscudon, à Pont-Croix : du fait de l'impossibilité de les dater avec une précision suffisante, on ne peut savoir lequel des deux édifices est le prototype du style."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%91%9E%E5%85%B8%E8%87%AA%E6%B2%BB%E5%B8%82%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Flen_Municipality_in_S%C3%B6dermanland_County.png","page_title":"瑞典自治市列表","context_page_description":"自治市是瑞典的一级地方政府。瑞典现有290个自治市，组成21个省。1971年，随着形式上的城乡地区划分正式被取消，所有自治市从而成为同一行政级别的唯一单位，享有同等的地位和权利。\\n瑞典的各个自治市在人口和面积上的差异很大。大斯德哥尔摩地区中，斯德哥尔摩附近坐落着许多面积小而人口密度高的自治市。而位于北方的自治市往往只有数千人口，但面积却比一些南方的整个省份还要大。"},{"page_url":"https://ro.wikipedia.org/wiki/Dumbr%C4%83veni","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Dumbraveni_church_inside.jpg","page_title":"Dumbrăveni","context_page_description":"Dumbrăveni, mai demult Ibașfalău, oficial Elisabetopol, este un oraș în județul Sibiu, Transilvania, România, format din localitățile componente Dumbrăveni, Ernea și Șaroș pe Târnave."},{"page_url":"https://en.wikipedia.org/wiki/Uptown,_Chicago","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Aragon_Ballroom%2C_Chicago.jpg","page_title":"Uptown, Chicago","context_page_description":"Uptown is one of Chicago, Illinois’ 77 community areas. Uptown's boundaries are Foster Avenue on the north; Lake Michigan on the east; Montrose, and Irving Park on the south; Ravenswood, and Clark on the west. To the north is Edgewater, to the west is Lincoln Square, and to the south is Lake View."},{"page_url":"https://eu.wikipedia.org/wiki/Alagoas","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Deodoro_da_Fonseca_sak.jpg","page_title":"Alagoas","context_page_description":"Alagoas Brasilgo ekialdean dagoen estatua da.\\n27.767 km2-ko azalera dauka eta 3.018.632 biztanle zituen 2005ean.\\nMaceió hiriburua eta hiri nagusia da."},{"page_url":"https://azb.wikipedia.org/wiki/%DB%8C%D8%A7%D9%85%D8%A7%D8%B3%DA%A9%D8%A7%D8%8C_%DA%A9%D9%88%D8%A8%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Calvaire_Albert-Mondoux.JPG","page_title":"یاماسکا، کوبک","context_page_description":"یاماسکا آمریکانین کبئک اوستانی ایالتینده یئرلشن بیر کند. ۲۰۱۱-جی وئریلن معلوماتا اهالیسینین سایی ۱۶۴۴ نفر ایدی."},{"page_url":"https://ro.wikipedia.org/wiki/Podurile_din_Budapesta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Kvassay3.jpg","page_title":"Podurile din Budapesta","context_page_description":"Podurile din Budapesta care traversează fluviul Dunărea de la nord la sud sunt următoarele:"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_pam%C3%A1tn%C3%BDch_strom%C5%AF_v_okrese_Brno-venkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Un%C3%ADnsk%C3%A9_l%C3%ADpy_1.jpg","page_title":"Seznam památných stromů v okrese Brno-venkov","context_page_description":"Toto je seznam památných stromů v okrese Brno-venkov aktuální k roku 2020, ve kterém jsou uvedeny památné stromy v okrese Brno-venkov. Symbolem † jsou označeny památné stromy, jejichž ochrana byla zrušena. Symbolem †† jsou označeny zaniklé památné stromy."},{"page_url":"https://pt.wikipedia.org/wiki/Vacquerie-le-Boucq","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Vacquerie-le-Boucq_%C3%A9glise2.jpg","page_title":"Vacquerie-le-Boucq","context_page_description":"Vacquerie-le-Boucq é uma comuna francesa na região administrativa de Altos da França, no departamento de Pas-de-Calais. Estende-se por uma área de 3,3 km². Em 2010 a comuna tinha 78 habitantes."},{"page_url":"https://nl.wikipedia.org/wiki/Cugir","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/ROU_AB_Cugir_CoA.png","page_title":"Cugir","context_page_description":"Cugir is een stad in het Roemeense district Alba. De stad telt 26.561 inwoners."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%A1%D5%BE%D5%A1%D5%A6%D5%A1%D5%B6_(%D5%A5%D5%AF%D5%A5%D5%B2%D5%A5%D6%81%D5%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/%D4%B3%D5%A1%D5%BE%D5%A1%D5%A6%D5%A1%D5%B61.JPG","page_title":"Գավազան (եկեղեցի)","context_page_description":"Գավազանը եկեղեցական ըմբռնմամբ՝ հոգևոր աստիճանի կամ պաշտոնի հայտարարական իշխանության նշանակություն ունի։ Արքայական Գավազան կոչվում է նաև մական, հովվականը՝ ասա, սովորականը՝ ցուպ։ Գավազանի վարդապետին կամ ծայրագույն վարդապետին շնորհում է եպիսկոպոսը՝ ձեռնադրությամբ, Ձեռնադրության Մաշտոցի համաձայն։ Գավազանի մասին, որպես խորհրդավոր ուժակրի, ակնարկվում է դեռևս Ծննդոց գրքում, նահապետներից Հակոբը ջրի գռների մեջ խնկենու, ընկուզենու և սոսու կեղևահան Գավազաններ է դրել, որպեսզի բեղմնավորվող մաքիները, այդ ջրից խմելով, խայտաճամուկ գառներ ծնեն։ Ելք գրքում Մովսեսի Գավազանը օժտվել է աստվածային իշխանությամբ և հրաշագործությամբ։ Այն վիշապ դառնալով՝ կուլ է տալիս քրմերի վիշապներին, բացում Կարմիր ծովը և կատարում այլ հրաշքներ։\\nԹվոցում Ահարոնի Գավազանը, դրվելով Վկայության խորանում, ծաղկել է, հետագայում այն, ի թիվս այլ սրբությունների, դրվել է Ուխտի տապանակի մեջ։ Ավելի ուշ, եկեղեցու պաշտոնյաներին տրված Գավազաներն ունեցել են օձի գլուխև զարդարվել ՝ ի հիշատակ և ի նմանություն անապատում Մովսեսի բարձրացրած բուժիչ պղնձե օձի և Ահարոնի ծաղկած Գավազանի՝ խորհրդանշելով պատժիչ կամ փրկարար ուժ, զորություն, իմաստություն, հավիտենություն են։ Գավազանով հրեաները զատել են Տիրոջը նվիրաբերված տասանորդի անասունները։"},{"page_url":"https://sh.wikipedia.org/wiki/Mayen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Mayen-altes-rathaus.jpg","page_title":"Mayen","context_page_description":"Majen je grad u njemačkoj saveznoj državi Rajna-Palatinat. Jedno je od 86 opštinskih središta okruga Majen-Koblenc. Prema procjeni iz 2010. u gradu je živjelo 18.961 stanovnika. Posjeduje regionalnu šifru 7137068."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%88%D0%B0%D0%BB%D1%81%D0%BA%D0%B0_%D1%81%D0%BB%D1%83%D0%B6%D0%B1%D0%B0_%D0%BD%D0%B0_%D0%A1%D1%8A%D0%B5%D0%B4%D0%B8%D0%BD%D0%B5%D0%BD%D0%B8%D1%82%D0%B5_%D1%89%D0%B0%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/SethBullock.jpg","page_title":"Маршалска служба на Съединените щати","context_page_description":"Маршалската служба на Съединените щати е правоохранителна служба в САЩ с федерална юрисдикция, подчинена на Департамента на правосъдието на САЩ.\\nТя е организацията от този вид с най-дългата история в страната. Създадена е с приемането на Наказателно-процесуалния кодекс от 1789 г. Службата е подчинена на системата от 94 федерални съдилища, като към всяко едно от тях има по един офис на щатските маршали. В света няма друга подобна организация, която да съчетава в себе си полицейски и следователски функции, както и охрана на съдебната власт. Службата има пряка юрисдикция върху лицата лишени от свобода чрез влезли в съда присъди от федерални съдилища. Най-зрелищната част от работата на маршалите е издирването, залавянето и въдворяването във федерални затвори на укриващи се престъпници, връчването на призовки. Освен това службата отговаря за тяхното транспортиране, програмата за защита на свидетели и ред други функции, като личната охрана на федерални съдии. Но освен това маршалите разполагат с пълни полицейски правомощия на територията на цялата страна. В Съединените американски щати службата е добила култов статус и е обект на множество игрални филми, сериали и романи."},{"page_url":"https://fr.wikipedia.org/wiki/Sites_m%C3%A9galithiques_de_Maine-et-Loire","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Les-ulmes_pierre-couverte-mousseau_17.jpg","page_title":"Sites mégalithiques de Maine-et-Loire","context_page_description":"Le département de Maine-et-Loire possède un certain nombre de sites mégalithiques, témoins des premières occupations humaines du territoire."},{"page_url":"https://fi.wikipedia.org/wiki/Kauppakatu_(Joensuu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Joensuu_market_place2009.jpg","page_title":"Kauppakatu (Joensuu)","context_page_description":"Kauppakatu on Joensuun keskustan etelä-pohjoissuuntainen katu. Kolmen korttelin matkalla katu on myös Joensuun kävelykatu ja samoin kolmen korttelin välillä Suomen ensimmäinen pyöräkatu. Pääosa rakennuksista on asuinkerrostaloja. Torin lähikorttelien talot ovat liiketaloja."},{"page_url":"https://en.wikipedia.org/wiki/Al-Manshiyya,_Tiberias","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Historical_map_series_for_the_area_of_al-Manshiyya%2C_Tiberias_%28modern%29.jpg","page_title":"Al-Manshiyya, Tiberias","context_page_description":"Al-Manshiyya was a Palestinian Arab village in the Tiberias Subdistrict, located 11 kilometres south of Tiberias. It was probably depopulated at the same time as neighbouring Al-'Ubaydiyya, in the 1947–1948 Civil War in Mandatory Palestine. Manshiyya was located 0.5 km south of Umm Junieh or Khirbat Umm Juni, and the two villages were usually described together in administrative documents."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%81%A5%E7%A5%9E%E6%98%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/AnimatedOrbitOf10Hygiea.gif","page_title":"健神星","context_page_description":"健神星位于主带，是一颗主要的小行星。它的直径为434千米，质量占主带小行星总质量的2.9%。按体积和质量，它是太阳系中第四大的小行星。在一些光谱分类中，它是表面是碳的黯淡C型小行星中最大的，另一方面，它排名第二，仅次于谷神星。\\n使用甚大望远镜的SPHERE在2017和2018观测的影像，于2019年10月宣布健神星有一个几乎是球体的形状，这至少符合流体静力平衡，因此够资格成为一颗矮行星。"},{"page_url":"https://pt.wikipedia.org/wiki/Ben_Wallace","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Ben_Wallace_4104263221_%28cropped%29.jpg","page_title":"Ben Wallace","context_page_description":"Benjamin \\"Ben\\" Cameron Wallace é um ex-jogador de basquete profissional que atuou em diversas franquias da NBA. Ele estudou nas universidades de Cuyahoga Community College e Virginia Union University.\\nApós não ser selecionado no Draft de 1996, ele assinou com o Washington Bullets. Ele também jogou por Orlando Magic, Detroit Pistons, Chicago Bulls e Cleveland Cavaliers.\\nEle ganhou 4 vezes o prêmio Jogador Defensivo do Ano da NBA, alcançando o recorde de Dikembe Mutombo. Wallace foi considerado como uma das peças-chave para o sucesso do Detroit Pistons no início dos anos 2000, eles chegaram a duas Finais da NBA, sendo campeão na temporada de 2003-04.\\nOs Pistons aposentaram a sua camisa de número 3 em 2016. Ele foi nomeado finalista do Hall da Fama do Basquetebol em 2019, mas perdeu por pouco a indução."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%88%D8%B3-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Tactical_exercises_of_Radiological%2C_Chemical_and_Biological_Protection_Troops_units_at_Shikhani_training_ground_%28410-24%29.jpg","page_title":"توس-1","context_page_description":"توس-1 ‏ هي راجمة صواريخ لها القدرة على إطلاق صواريخ محملة بوقود شديدة الاحتراق تم استعمال هذه الراجمة وتصميمها في حرب الشيشان كما أن هيكل الراجمة هو هيكل دبابة تي-72, مكونة من ثلاثين أنبوب أي تحمل ثلاثين صاروخ. من ضمن مهام هذه الراجمة تدمير القوات العاملة والمدرعات الخفيفة واليات العدو السيارة بصواريخ حرارية وحارقة. وقعت الشركة السعودية للصناعات العسكرية مذكرة تفاهم مع شركة روسوبورون اكسبورت لإنتاجه الطراز محليا في السعودية."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D0%B5_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D1%8B_%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD%D0%B0_%D0%B8%D0%B7_%D1%81%D0%B5%D1%80%D0%B5%D0%B1%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/KZ-2015-500tenge-Assembly-b.png","page_title":"Памятные монеты Казахстана из серебра","context_page_description":"Памятные монеты из серебра выпускаются Национальным банком Республики Казахстан с 1995 года, когда была выпущена серия из 5 монет, посвящённых 150-летию со дня рождения Абая Кунанбаева. Для изготовления монет используется серебро 925 пробы, все они чеканятся в качестве proof на Казахстанском монетном дворе.\\nБыли выпущены серии монет «150-летие Абая Кунанбаева», «Выдающиеся события и люди», «Петроглифы Казахстана», «Прикладное искусство», «Архитектурные и исторические памятники», «Красная книга Казахстана», «Монеты старых чеканов», «Художники Казахстана », «Космос», «Спорт», «Растительный мир Казахстана», «Фауна и флора Казахстана», «Мечети и соборы Казахстана», «Знаменитые мечети мира», «Золото номадов», «Великие полководцы», «Обряды, национальные игры Казахстана», «Сказки Народа Казахстана», «Достояние Республики», «Портреты на банкнотах», «От сердца к сердцу», «Сокровища степи», «Монета — подарок», «Магические символы», «Изобразительное искусство Казахстана», «Культовые животные - тотемы кочевников», «Восточный календарь» и «Знаки зодиака».\\nЧасть памятных монет выпускается вне каких-либо серий."},{"page_url":"https://de.wikipedia.org/wiki/Evangelisch-Lutherische_Kirche_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Berlin%2C_Mitte%2C_Annenstrasse%2C_Annenkirche.jpg","page_title":"Evangelisch-Lutherische Kirche Berlin","context_page_description":"Die Evangelisch-Lutherische Kirche Berlin, Annenstraße 52/53, ist ein Gotteshaus der Selbständigen Evangelisch-Lutherischen Kirche und befindet sich in der Luisenstadt im Berliner Ortsteil Mitte des gleichnamigen Bezirks. Es ist die erste Kirche der Evangelisch-Lutherischen Kirche der Stadt. Die Kirchengemeinde gehört zum Kirchenbezirk Berlin-Brandenburg. Eine Besonderheit ist, dass sie seit Gründung keinen Namen besitzt. Im Volksmund wird sie – wegen ihrer Lage an der Annenstraße – auch Annenkirche genannt. Die Kirche ist ein gelistetes Baudenkmal."},{"page_url":"https://vi.wikipedia.org/wiki/Poa_pratensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Veldbeemdgras_Poa_pratensis_ligula.jpg","page_title":"Poa pratensis","context_page_description":"Poa pratensis là một loài cỏ trong họ hòa thảo, thuộc chi poa."},{"page_url":"https://de.wikipedia.org/wiki/Martinlamitzer_Forst-Nord","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Martinlamitzer_Forst-Nord_in_HO.svg","page_title":"Martinlamitzer Forst-Nord","context_page_description":"Das gemeindefreie Gebiet Martinlamitzer Forst-Nord liegt im oberfränkischen Landkreis Hof.\\nDer 6,78 km² große Staatsforst liegt zwischen Schwarzenbach an der Saale, Rehau, Martinlamitzer Forst-Süd und Kirchenlamitz. Der Große Kornberg ist mit 826 m ü. NN die höchste Erhebung in dem Gebiet."},{"page_url":"https://it.wikipedia.org/wiki/Palazzo_Bardi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Palazzo_de%27_Bardi%2C_stemma_cancellata.JPG","page_title":"Palazzo Bardi","context_page_description":"Il palazzo Bardi o Busini-Bardi-Serzelli si trova in via de' Benci 5 a Firenze."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Fulton_County,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Southern_Spring_Bed_-_Block_Candy_Company.JPG","page_title":"National Register of Historic Places listings in Fulton County, Georgia","context_page_description":"This is a list of properties and districts in Fulton County, Georgia that are listed on the National Register of Historic Places. It covers most of the NRHP properties in Atlanta; other Atlanta listings are covered in National Register of Historic Places listings in DeKalb County, Georgia.\\nThis National Park Service list is complete through NPS recent listings posted August 21, 2020."},{"page_url":"https://id.wikipedia.org/wiki/Rumbadi_Dalle","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Rumbadi_Dalle.jpg","page_title":"Rumbadi Dalle","context_page_description":"Rumbadi Dalle, adalah seorang penulis dan wartawan yang pernah eksis di dunia jurnalistik medio 1990 hingga 2017. Bagi kalangan jurnalistik, politisi, pengusaha dan akademisi di Provinsi Kepulauan Riau, Rumbadi Dalle dikenal mudah bergaul dan idealis dalam menjalankan profesinya sebagai wartawan.\\nRumbadi Dalle memiliki pandangan terbuka terhadap dinamika kehidupan. Hal itu didasari perjalanan masa kecilnya yang penuh suka dan duka semasa di kampung halamannya, Kota Prabumulih.\\"Menjadi anak laki-laki itu harus memiliki Mental Fight,\\" kata Rumbadi Dalle. Hal itu setidaknya yang senantiasa terngiang dalam kenangan kedua anak laki-lakinya, yakni Andri Arianto, S.H selaku putra sulung dan Jerry Fernandez, S.H., CLA putra bungsu.\\nPria yang akrab disapa Bang Rum oleh rekan-rekanya sesama jurnalis di Kota Batam ini memiliki lima orang anak, dua orang putri dan tiga orang putri. Ketiga putrinya masing-masing bernama, Yuliyanti R Dalle, Verina Indrianti dan Roza Permata Sari. Kelima anak-anaknya itu berasal dari istrinya tercinta, Suryati Berantap."},{"page_url":"https://az.wikipedia.org/wiki/Penstemon_papillatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Penstemon_papillatus_dupl._of_RSA407652_%285468968995%29.jpg","page_title":"Penstemon papillatus","context_page_description":"Penstemon papillatus — bağayarpağıkimilər fəsiləsinin penstemon cinsinə aid bitki növü."},{"page_url":"https://la.wikipedia.org/wiki/Bisbona","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Castellopietradamico.jpg","page_title":"Bisbona","context_page_description":"Bisbona est Urbs Italiae et municipium, circiter 3 983 incolarum, in regione Sicilia et in Consortio Libero Municipali Agrigentino. Cuius incolae Bisbonenses appellantur.\\nBisbona, urbs Montibus Sicanis circumdata, ab Agrigento circiter 60 chiliometra et 90 fere chiliometra a Panormo, capite Siciliae, abest. Praesertim saeculis 15 et 16 una ex maioribus Siciliae civitatibus feudalibus fuit, prima cui Carolus V ducatus dignitatem tribuit. Constat Sanctae Rosaliae antiquissimus cultus Bisbonae fuisse. Hodie praeclara est in cultura malorum Persicorum et, in locis vicinis, in multarum scholarum frequentia, ad quas proximorum communium iuvenes affluunt."},{"page_url":"https://eu.wikipedia.org/wiki/Gelli_(Rhondda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Mount_Zion%2C_Gelli.JPG","page_title":"Gelli (Rhondda)","context_page_description":"Gelli, galesez: Y Gelli, Galesko udalerri bat da, Rhondda Cynon Taf konderrian."},{"page_url":"https://fr.wikipedia.org/wiki/Baekje","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Jar%2C_Baekje_kingdom.Buyeo_National_Museum.jpg","page_title":"Baekje","context_page_description":"Baekje, est un royaume qui se développa au début de notre ère dans le sud-ouest de la Corée durant la période des Trois Royaumes, un ensemble de petits États qui sont nommés collectivement Gaya tenant le centre du sud de la péninsule.\\nBaekje, en tant que royaume, apparait sur le territoire de la confédération de Mahan, de la période précédente, dite des Samhan, [les trois confédérations]. Ces confédérations ayant été Mahan, Byeonhan et Jinhan.\\nBaekje traversa d'abord une phase d'expansion jusqu'à 538. Puis la partie Nord lui fut retirée par Koguryo et le royaume se recentra sur sa moitié Sud. Le bouddhisme, encore nouveau en Corée, est soutenu par le pouvoir. Finalement le royaume est détruit par une coalition qui voit l'alliance entre l'empire chinois des Tang et le royaume de Silla. C'est, en fait, Silla qui en profite ; il opère l'annexion en 660, et chasse les chinois peu après."},{"page_url":"https://es.wikipedia.org/wiki/Villedieu_(Cantal)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Map_commune_FR_insee_code_15262.png","page_title":"Villedieu (Cantal)","context_page_description":"Villedieu es una comuna francesa, situada en la región de Auvernia, departamento de Cantal, distrito de Saint-Flour y cantón de Saint-Flour-Sud.\\nEstá integrada en la Communauté de communes du Pays de Saint-Flour."},{"page_url":"https://pt.wikipedia.org/wiki/GMC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/2020_GMC_Acadia_AT4_front_NYIAS_2019.jpg","page_title":"GMC","context_page_description":"A GMC é a divisão de caminhonetes e caminhões da General Motors."},{"page_url":"https://sh.wikipedia.org/wiki/Nemacolin,_Pennsylvania","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Map_of_Nemacolin%2C_Greene_County%2C_Pennsylvania_Highlighted.png","page_title":"Nemacolin, Pennsylvania","context_page_description":"Nemacolin, Pennsylvania je naseljeno mesto bez administrativnog statusa u američkoj saveznoj državi Pensilvanija."},{"page_url":"https://es.wikipedia.org/wiki/Aeropuerto_Internacional_Netaji_Subhas_Chandra_Bose","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Bird_eye_view_of_the_new_terminal.jpg","page_title":"Aeropuerto Internacional Netaji Subhas Chandra Bose","context_page_description":"El Aeropuerto Internacional Netaji Subash Chandra Bose es un aeropuerto de la India en las cercanías de la ciudad de Calcuta. Es el cuarto aeropuerto más importante de la India después del aeropuerto internacional Indira Gandhi en Nueva Delhi, el aeropuerto internacional Chhatrapati Shivaji, en Bombay, y el Aeropuerto Internacional de Chennai, así como un centro de conexiones muy importante entre Europa y Asia."},{"page_url":"https://it.wikipedia.org/wiki/Deinosuchus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Deinosuchus_hatcheri_skull.jpg","page_title":"Deinosuchus","context_page_description":"Deinosuchus è un genere estinto di alligatore gigante vissuto nel Cretaceo superiore, circa 82-73 milioni di anni fa, in quello che oggi è il Texas, Nord America. Il nome del genere, Deinosuchus, significa letteralmente \\"coccodrillo terribile\\" e deriva dal greco antico deinos/δεινός ossia \\"terribile\\" e soukhos/σοῦχος ossia \\"coccodrillo\\". I primi resti fossili di questo rettile vennero scoperti nel Carolina del Nord nel 1850; il genere fu nominato e descritto nel 1909, mentre alcuni frammenti supplementari furono scoperti nel 1940 e sono stati successivamente incorporati in un'influente ricostruzione del cranio, che anche se imprecisa fu esposta all'American Museum of Natural History. Tuttora la conoscenza di Deinosuchus rimane incompleta, sebbene negli anni siano stati ritrovati materiali cranici meglio conservati, che hanno ampliato notevolmente la comprensione scientifica di questo massiccio predatore.\\nAnche se il Deinosuchus era di gran lunga più grande di qualsiasi altro coccodrillo o alligatore moderno, con i più grandi esemplari adulti che arrivavano anche ai 10,6 metri di lunghezza totale, il suo aspetto complessivo era abbastanza simile ai suoi parenti più piccoli."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B0%D0%B4%D0%BE%D0%B2_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D1%96%D0%B9_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Chadov_Aleksey.jpg","page_title":"Чадов Олексій Олександрович","context_page_description":"Олексій Олександрович Чадов — російський актор театру і кіно, молодший брат актора Андрія Чадова."},{"page_url":"https://eo.wikipedia.org/wiki/Amap%C3%A1_(municipo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Amapa_Municip_Amapa.jpg","page_title":"Amapá (municipo)","context_page_description":"Amapá estas municipo de la brazila subŝtato Amapao, kiu taksis 8.005 enloĝantojn en 2010."},{"page_url":"https://sv.wikipedia.org/wiki/Morton_S._Wilkinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Morton_S._Wilkinson_-_Brady-Handy.jpg","page_title":"Morton S. Wilkinson","context_page_description":"Morton Smith Wilkinson, född 22 januari 1819 i Onondaga County, New York, död 4 februari 1894 i Wells, Minnesota, var en amerikansk politiker. Han representerade delstaten Minnesota i USA:s senat 1859-1865.\\nHan inledde 1843 sin karriär som advokat i Michigan och flyttade 1847 till Stillwater, Minnesota och elva år senare till Mankato. Han var först medlem av whigpartiet och blev sedan republikan. Han valdes till senaten som republikanernas kandidat. Efter sex år i senaten lyckades Wilkinson inte bli omvald. Han var ledamot av USA:s representanthus 1869-1871. Han flyttade sedan till Wells, Minnesota och var ledamot av delstatens senat 1874-1877. Då hade han bytt parti till demokraterna.\\nWilkinsons grav finns på Glenwood Cemetery i Mankato, Minnesota."},{"page_url":"https://nl.wikipedia.org/wiki/Longcao_Road","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Shanghai_Light_Rail_Transit.jpg","page_title":"Longcao Road","context_page_description":"Longcao Road is een station van de metro van Shanghai, gelegen in het district Xuhui. Het station werd geopend op 26 december 2000 en is onderdeel van lijn 3 en lijn 12."},{"page_url":"https://en.wikipedia.org/wiki/Wizdish_ROVR","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/ROVR_Main.png","page_title":"Wizdish ROVR","context_page_description":"The Wizdish ROVR is an omnidirectional treadmill that simulates walking and running in virtual reality when used alongside a head-mounted display.\\nIt is developed by Wizdish Ltd, who market it as \\"The mouse of the VR world\\". This is due to the ROVR providing omnidirectional movement in virtual reality in a manner akin to walking in the real world. This is as opposed to the current teleportation solution. The difference can be described as navigating a website with a mouse instead of cycling through links sequentially using the tab key."},{"page_url":"https://en.wikipedia.org/wiki/Vasyl_Herasymenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Vasily_Gerasimenko.jpg","page_title":"Vasyl Herasymenko","context_page_description":"Vasyl Herasymenko was a Soviet military leader from Ukraine who was nominally and temporarily appointed the People's Commissar of Defense of the Ukrainian SSR in 1944-45."},{"page_url":"https://en.wikipedia.org/wiki/Alpha_course","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Alpha_course_logo.png","page_title":"Alpha course","context_page_description":"The Alpha course is an evangelistic course which seeks to introduce the basics of the Christian faith through a series of talks and discussions. It is described by its organisers as \\"an opportunity to explore the meaning of life\\". Alpha courses are being run in churches, homes, workplaces, prisons, universities and a wide variety of other locations. The course began in Britain and is being run around the world by various Christian denominations."},{"page_url":"https://nl.wikipedia.org/wiki/Bisdom_Opole","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/CatholicDiocesesPoland2004Numbered.svg","page_title":"Bisdom Opole","context_page_description":"Het bisdom Opole is een in Polen gelegen rooms-katholiek bisdom met zetel in de stad Opole. Het bisdom behoort tot de kerkprovincie Katowice, en is, samen met het bisdom Gliwice, suffragaan aan het aartsbisdom Katowice."},{"page_url":"https://en.wikipedia.org/wiki/Coins_of_the_Ukrainian_hryvnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/2_hryvnia_coin_of_Ukraine%2C_2018_%28reverse%29.jpg","page_title":"Coins of the Ukrainian hryvnia","context_page_description":"Coins of the Ukrainian hryvnia were first minted in 1992. Coins were first struck in 1992 for the new currency but were not introduced until September 1996. Initially, coins valued between 1 and 50 kopecks were issued. In March 1997, 1 hryvnia coins were added; they are however rarely seen in circulation. The note of the same value is far more commonly used. Since 2004 several commemorative 1 hryvnia coins have been struck. New coins have been produced annually since then and they make up a valuable aspect of the Ukrainian currency system. Today, circulating coins exist in denominations of 1 kopiyka, 2, 5, 10, 25 and 50 kopiyok, ₴1.00 and ₴2.00. Also minted are bullion and commemorative coins. All of these are produced by the National Bank of Ukraine.\\nIn October 2012 the National Bank of Ukraine announced that it is examining the possibility of withdrawing the 1 and 2 kopeck-coins from circulation; the withdrawal started on 1 October 2019. The coins had become too expensive to produce compared to their nominal value.\\nIn the same month, the Bank proposed the introduction of the 2 hryvnia coin; this was finally issued as a circulation coin in April 2018."},{"page_url":"https://simple.wikipedia.org/wiki/Clement_Attlee","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Person_attlee2.jpg","page_title":"Clement Attlee","context_page_description":"Clement Richard Attlee, 1st Earl Attlee KG OM CH PC FRS was a British politician. Prime Minister from 1945 to 1951, he was the first Labour prime minister with a majority in government, and was very important in the setting up of the welfare state. He was made a member of the House of Lords after he retired, and became the first Earl Attlee.\\nAttlee died of pneumonia in 1967. He is buried in Westminster Abbey."},{"page_url":"https://lb.wikipedia.org/wiki/H%C3%A4erzniwwel","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Melotte15HunterWilson.jpg","page_title":"Häerzniwwel","context_page_description":"Den Häerzniwwel ass en Emissiounsniwwel mat engem oppene Stärekoup am Zentrum a steet am Stärebild Cassiopeia."},{"page_url":"https://en.wikipedia.org/wiki/List_of_United_States_Navy_aircraft_squadrons","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Hsc5.png","page_title":"List of United States Navy aircraft squadrons","context_page_description":"This is a list of active United States Navy aircraft squadrons. Deactivated or disestablished squadrons are listed in the List of Inactive United States Navy aircraft squadrons.\\nNavy aircraft squadrons are composed of several aircraft, the officers who fly them, the officers and sailors who maintain them and administrative support officers and sailors. Some of the units listed in this article are not technically \\"squadrons\\", but they all operate U.S. Navy aircraft in some capacity.\\nSquadrons and their history are listed in the Dictionary of American Naval Aviation Squadrons."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Tolkewitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Lewickistra%C3%9Fe_11-21_10-2012.jpg","page_title":"Liste der Kulturdenkmale in Tolkewitz","context_page_description":"Die Liste der Kulturdenkmale in Tolkewitz umfasst die Kulturdenkmale der Dresdner Gemarkung Tolkewitz. Grundlage bildet das vom Landesamt für Denkmalpflege Sachsen verfasste und beständig aktualisierte Denkmalverzeichnis. Der äußerste Norden der Gemarkung gehört zum Denkmalschutzgebiet Blasewitz/Striesen-Nordost.\\nDie Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Dresden.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%BE%8E%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Bald_Eagle_Portrait.jpg","page_title":"美国","context_page_description":"美利坚合众国，中文通称“美国”，是由其下辖50个州、华盛顿哥伦比亚特区、五个自治领土及外岛共同组成的联邦共和国。美国本土48州和联邦特区位于北美洲中部，东临大西洋，北面是加拿大，南部和墨西哥及墨西哥湾接壤，本土位于温带、副热带地区。阿拉斯加州位于北美大陆西北方，东部为加拿大，西隔白令海峡和俄罗斯相望；夏威夷州则位于大洋洲太平洋中部的群岛。美国在加勒比海和太平洋还拥有多处境外领土和岛屿地区。此外，美国还在全球很多个国家和地区拥有着众多海外军事基地。美国的面积超过983万平方公里, 正式为9,834,000万平方公里，位居世界第三或第四；同时拥有接近超过3.3亿人口，为世界第三人口大国。是世界上人口最多的发达国家。美国有着来自世界各地的大量移民，是世界上民族和文化最多元的国家之一。美国地形与气候复杂多样，是多种野生动物的家园。\\n一万五千多年前，古印第安人自亚洲迁徙至北美大陆。16世纪欧洲开始殖民北美。现今的合众国起始于东海岸的13个英属美洲殖民地。欧洲七年战争后，大不列颠王国与其殖民地之间的争议愈发剧烈，最终导致在1775年爆发美国革命。1776年7月4日，正与大不列颠进行独立战争的各殖民地派出代表，协同一致发表《独立宣言》。战争终止于1783年，大不列颠王国承认这13个北美殖民地脱离管辖而独立，与其签订《巴黎条约》。这场战争也是第一场成功脱离欧洲殖民帝国的独立战争。1781年，《邦联条例》在邦联13个构成州获得通过，共同组成了邦联议会。1787年《美利坚合众国宪法》完稿，将“美利坚合众国”改制为联邦体制，联邦政府随之成立。1791年，合称为权利法案的十条宪法修正案获得批准，担保了基本民权。\\n自19世纪起，美国政府通过强行移置原住民，征服及购买等方法大力扩张领土，随着逐渐不断地承认扩张领地为新州份，至1848年时美国疆域已横跨整个北美大陆。19世纪下半叶爆发的内战，使曾经合法的奴隶制度得以终结。在19世纪末，美国已将其领土延伸到太平洋的夏威夷。美国经济在工业革命的推动下，自那时起也开始蓬勃发展。随后美西战争的胜利，使美国势力进入加勒比海地区及太平洋西部；而参与第一次世界大战则奠定其作为一个全球性军事力量的基础。尽管在1930年代经历经济大萧条，美国在第二次世界大战获得胜利之后崛起成为超级大国。作为联合国安全理事会常任理事国，美国是世界上第一个研发出核武器，也是唯一一个曾将其投入实战的国家。战后美国与苏联进行了数十年冷战，顶峰时期的太空竞赛促使了人类第一次登月计划的成功。在1991年苏联解体后，至今三十年来，美国成为世上唯一的超级强国及经济强国。\\n美国作为一个高度发达国家，是世界上最大的进口国及第二大的商品出口国，国内生产总值按国际汇率排名世界第一、而依购买力平均则位列第二。"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%A7%91%E6%9E%97%E5%BE%B7%E7%9B%AE%E9%8C%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Eso1422a.jpg","page_title":"科林德目錄","context_page_description":"科林德目录是瑞典天文学家佩尔·科林德收录471个疏散星团的目录。这本目录于1931年出版，是科林德论文《疏散星团的结构特性及其在空间的分布》中的附录。目录中的物件用\\"Collinder\\"标示，例如\\"Collinder 399\\"。数值序号的前置码包括Col + 目录序号，或Cr +目录序号，例如\\"Cr 399\\"。"},{"page_url":"https://cs.wikipedia.org/wiki/Bo%C5%A1tjan_Burger","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/PlaninskaJama.jpg","page_title":"Boštjan Burger","context_page_description":"Boštjan Burger je slovinský informatik, geograf, panoramatický fotograf a speleolog."},{"page_url":"https://pl.wikipedia.org/wiki/Triple_Crown_Championship","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/KurtAngleSs05.jpg","page_title":"Triple Crown Championship","context_page_description":"Triple Crown Championship – osiągnięcie w profesjonalnym wrestlingu. Jest to wyróżnienie dla profesjonalnego wrestlera, który zdobył trzy tytuły mistrzowskie federacji z trzech szczebli wartości - pierwszorzędnego, drugorzędny oraz mistrzostwo dywizji tag team.\\nDo międzynarodowych federacji uznających Triple Crown Championship zalicza się WWE, Impact Wrestling oraz Ring of Honor, jak i również nieistniejące już World Championship Wrestling i Extreme Championship Wrestling. Pomniejsze niezależne federacje takie jak Ohio Valley Wrestling również mają swoją wersję Triple Crown."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Bannewitz_(Bannewitz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/N%C3%B6thnitz-Orangerie-1.jpg","page_title":"Liste der Kulturdenkmale in Bannewitz (Bannewitz)","context_page_description":"Die Liste der Kulturdenkmale in Bannewitz enthält die in der amtlichen Denkmalliste des Landesamtes für Denkmalpflege Sachsen ausgewiesenen Kulturdenkmale im Bannewitzer Ortsteil Bannewitz.\\nDie Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Sächsische Schweiz-Osterzgebirge.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://en.wikipedia.org/wiki/COVID-19_pandemic_in_New_Mexico","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Santa_fe_county_covid_sign.jpg","page_title":"COVID-19 pandemic in New Mexico","context_page_description":"The COVID-19 pandemic was confirmed to have reached the U.S. state of New Mexico on March 11, 2020.\\nThe most populous counties in the state saw the largest number of infections, but by mid-April the northwest counties of McKinley and San Juan became the most infected areas in the state. Sandoval county also saw a high infection rate. All of these counties have large Native American populations. According to the state's Data dashboard American Indians had nearly 58 percent of the statewide infection rates as of May 15. On April 25 McKinley county had the highest total number of cases while San Juan county had the highest number of deaths by April 26. However, by the end of July, Hispanics/Latinos had a plurality of cases."},{"page_url":"https://en.wikipedia.org/wiki/HMCS_Vancouver_(FFH_331)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/US_Navy_020520-N-9312L-025_USS_Stennis_-_joint_operations_with_Canada.jpg","page_title":"HMCS Vancouver (FFH 331)","context_page_description":"HMCS Vancouver is a Halifax-class frigate, of the Royal Canadian Navy launched on 8 July 1989, as the second vessel of her class. She is currently based at CFB Esquimalt on the west coast of Canada. She is the third vessel to be named after Vancouver, British Columbia."},{"page_url":"https://ast.wikipedia.org/wiki/Apolu","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Roman_Statue_of_Apollo.jpg","page_title":"Apolu","context_page_description":"Apolo foi una de les divinidáes principales de la mitoloxía greco-romana, unu de los dioses olímpicos. Yera fíu de Zeus y Leto, y hermanu mellizu d'Artumisa, tenía munchos atributos y funciones, y posiblemente dempués de Zeus foi'l dios más influyente y veneráu de tolos de l'Antigüedá clásica.\\nYera descritu como'l dios de la divina distancia, qu'amenaciaba o protexía dende lo alto de los cielos, siendo identificáu cola lluz de la verdá, tal ye como lo representaba col sol. Yera tarrecíu polos otros dioses y solamente el so padre y la so madre podíen contenelo. Yera'l dios de la muerte súbita, de les plagues y enfermedaes, pero tamién el dios del sanamientu y de la proteición contra les fuercies malines. Amás, yera'l dios de la guapura, de la perfeición, de la harmonía, del equilibriu y de la razón, el iniciador de los mozos nel mundu de los adultos, taba conectáu a la naturaleza, a les yerbes y a los fataos, y yera proteutor de los pastores, marineros y arquerus.\\nLos oríxenes del so mitu son escuros, pero nel tiempu de Homero yá yera de gran importancia, siendo unu de los más citaos na Ilíada."},{"page_url":"https://en.wikipedia.org/wiki/Cheonggyecheon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Cheonggyecheon_shortly_after_reopening_-_oct_9_-_2005.jpg","page_title":"Cheonggyecheon","context_page_description":"Cheonggyecheon is a 10.9-kilometre-long, modern public recreation space in downtown Seoul, South Korea. The massive urban renewal project is on the site of a stream that flowed before the rapid post-war economic development caused it to be covered by transportation infrastructure. The $900 million project initially attracted much public criticism but, since opening in 2005, has become popular among residents and tourists."},{"page_url":"https://en.wikipedia.org/wiki/Maryland_Terrapins_football,_1892%E2%80%931946","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/1931_USNA_UMD_pass.JPG","page_title":"Maryland Terrapins football, 1892–1946","context_page_description":"The modern Maryland Terrapins football program representing the University of Maryland traces its lineage to the team first formed at what was then the Maryland Agricultural College in 1892. In the initial years, due to the rudimentary state of intercollegiate athletics and interstate travel, all games were played against local colleges, high schools, and athletic clubs.\\nIn 1902, Maryland hired its first professional coach, John Markey, and soon after drafted a \\"football philosophy\\", an early attempt at a codification of college football. During his tenure as head coach from 1911 to 1934, Harry C. \\"Curley\\" Byrd significantly increased Maryland's strength of schedule, and recorded victories over then-powerhouses Penn and Yale. Byrd also greatly increased school support and interest in the sport, and was responsible for the building of the school's first stadium in 1923.\\nByrd became the university president in 1935, and continued his support for Maryland football from that office. As a coach, he was succeeded by several prominent individuals, namely Clark Shaughnessy, who had perfected the T-formation, and Paul \\"Bear\\" Bryant, who later went on to great success at Alabama."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%81%D1%81%D0%BD%D0%B5%D1%80,_%D0%98%D0%BE%D0%B3%D0%B0%D0%BD%D0%BD_%D0%95%D0%B2%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D0%B8%D1%81%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Johannes_Go%C3%9Fner.JPG","page_title":"Госснер, Иоганн Евангелиста","context_page_description":"Иоганн Евангелиста Госснер — немецкий религиозный писатель и поэт, проповедник и миссионер."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A5%D5%BD%D5%A1_%D5%8E%D5%A5%D6%80%D5%A4%D5%A5_%D5%A1%D5%A6%D5%A3%D5%A1%D5%B5%D5%AB%D5%B6_%D5%BA%D5%A1%D6%80%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/MesaVerdeNationalParkCliffPalace.jpg","page_title":"Մեսա Վերդե ազգային պարկ","context_page_description":"Մեսա-Վերդե, ազգային պարկ, որը գտնվում է Կոլորադո նահանգի հարավարևմտյան մասում։ Մակերեսը՝ 211 կմ²:"},{"page_url":"https://en.wikipedia.org/wiki/National_symbols_of_the_Czech_Republic","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Rip-mountain.jpeg","page_title":"National symbols of the Czech Republic","context_page_description":"The national symbols of the Czech Republic are flags, heraldry, cultural expressions and other symbols that represent the Czech Republic, Czech people and their history, culture and nationhood. There are six official symbols which are declared in the Constitution of the Czech Republic. However many other historical, cultural and geographical symbols of the Czech republic and Czech people do exist."},{"page_url":"https://de.wikipedia.org/wiki/Stegosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Thagomizer_01.jpg","page_title":"Stegosaurus","context_page_description":"Stegosaurus ist ein thyreophorer Dinosaurier aus der Familie der Stegosauridae und damit ein Vertreter der Ornithischia, der im Oberjura lebte. Mit bis zu 9 Metern Länge war er der größte bekannte Vertreter der Stegosauria. Der Name Stegosaurus bedeutet so viel wie „Dachechse“.\\nMindestens drei verschiedene Arten wurden aus der unteren Morrison-Formation im westlichen Nordamerika geborgen, die Überreste stammen insgesamt von etwa 80 Individuen. Ein Fund aus Portugal im Jahr 2006 hat gezeigt, dass die Gattung auch in Europa vorkam. Mit seinen imposanten Knochenplatten und Schwanzstacheln ist Stegosaurus – zusammen mit Tyrannosaurus, Triceratops, Apatosaurus und Velociraptor – einer der populärsten Dinosaurier überhaupt.\\nStegosaurus war ein großer, schwergebauter und quadrupeder Herbivore mit einer ungewöhnlichen Körperhaltung: Der Rücken war stark gewölbt, die Vorderbeine waren kurz. Den Schwanz hielt das Tier hoch in der Luft, während der Kopf nahe über dem Boden gehalten wurde. Seine verschiedenen Knochenplatten und Schwanzstacheln boten Stoff für viele Spekulationen."},{"page_url":"https://pt.wikipedia.org/wiki/Regions_Financial_Corporation","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Downtown_Jacksonville_-_panoramio_%282%29.jpg","page_title":"Regions Financial Corporation","context_page_description":"Regions Financial Corporation é uma holding bancária sediada no Regions Center em Birmingham, Alabama. A empresa fornece serviços bancários de varejo e comerciais, de confiança, de corretagem de ações e de hipotecas. Sua subsidiária bancária, Regions Bank, opera 1.952 caixas automáticos e 1.454 agências em 15 estados do sul dos Estados Unidos e do Centro-Oeste dos Estados Unidos.\\nO Regions está classificado em 460º na Fortune 500 e é um componente sediado no Alabama. O Regions também está na lista dos maiores bancos dos Estados Unidos.\\nRegions é o maior detentor de depósito no Alabama e Tennessee. É também um dos maiores detentores de depósito em Arkansas, Louisiana, Mississippi e Flórida.\\nA empresa patrocina o Regions Field, um estádio da Minor League Baseball em Birmingham, Alabama, e o torneio de golfe The Tradition. Ele patrocinou o Regions Charity Classic, um torneio de golfe realizado em 2009 e 2010.\\nA empresa tem uma parceria com a Operation HOPE, Inc. para fornecer educação financeira gratuita a comunidades carentes."},{"page_url":"https://ru.wikipedia.org/wiki/Cygnus_CRS_OA-4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/OA-4_Cygnus_AtlasV_roll-out_%2822854108994%29.jpg","page_title":"Cygnus CRS OA-4","context_page_description":"Cygnus CRS OA-4 — четвёртая миссия грузового корабля Cygnus к Международной космической станции по контракту снабжения Commercial Resupply Services с NASA.\\nПятый полёт космического корабля Cygnus, первый полёт с удлинённой версией герметичного отсека. Корабль повторно назван в честь астронавта NASA Дональда Слейтона.\\nВ связи с аварией ракеты-носителя Antares в ходе предыдущей миссии, запуск был осуществлён ракетой-носителем Atlas V 401."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BF%9D%E5%AE%88%E5%BA%8F%E5%88%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Cpg_island_evolution.svg","page_title":"保守序列","context_page_description":"保守序列在生物學中是指在核酸序列、蛋白質序列、蛋白質結構或多聚糖序列內相似或相同的序列，這種情況可以發生在各物種間或由相同生物產生的不同分子間。對於物種間保守的情況，這意味著儘管物種形成一些特定的序列仍在進化過程中被保留了下來。也就是說系統樹越向上推，特定序列越保守。因為序列信息在通常情況下通過基因自雙親傳向子代，那麼一條保守序列即意味著存在著一條保守基因。\\n人們普遍認為「高度保守」區域的突變會引發不能生存或無法延續的生命形式，或是在自然選擇中消亡的生命形式。環境決定著基因的保守或非保守。例如，在有抗生素存在的環境下，微生物中的抗生素抗藥性基因將高度保守。如果環境中沒有抗生素的存在，這種基因將變成非保守基因。"},{"page_url":"https://hu.wikipedia.org/wiki/Friedland_(Mecklenburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Wappen_Friedland.PNG","page_title":"Friedland (Mecklenburg)","context_page_description":"Friedland település Németországban, Mecklenburg-Elő-Pomeránia tartományban. Lakosainak száma 6472 fő. +/-"},{"page_url":"https://da.wikipedia.org/wiki/Fran%C3%A7ois_G%C3%A9rard","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Emprjose.jpg","page_title":"François Gérard","context_page_description":"Francois Pascal Gérard var en fransk maler og baron.\\nGérard studerede først skulptur under Pajou og dyrkede derefter malerkunst under David. Med sit affabelt slebne væsen passede han ikke ind i Revolutionens aktive politik, og den stilling som medlem i Revoltitionstribunalet, som hans lærer skaffede ham, forstod han snarest at unddrage sig. Efter at have vundet en vis anseelse med »Josef genkendt af Brødrene« og Tegningerne til pragtudgaven af Vergil m. m. slog han igennem 1795 med sit udmærket komponerede »Belisar«; det sødlige »Amor kysser Psyke« skaffede ham et beundrende Publikum, der også nød hans senere lidt niarvløse akademiske arbejder, som »De fire Livsaldere«, »Homer«, »Dafnis og Chloe«, »Corinna« etc. flere stukne af tidens største mestre. Ogsaa i Historiebilledet holdt han sig saa temmelig inden for den davidske overlevering; han malede »Slaget ved Austerlitz«, »Henrik IV’s Indtog i Paris«, der skaffede ham barontitel og værdighed som kgl. Hofmaler,\\nHet store, delvis ødelagte »Karl X’s Salving«, begge i Versailles o. fl. I portrættet ydede han sit bedste."},{"page_url":"https://de.wikipedia.org/wiki/SC_Schlesien_Breslau","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/SC_Schlesien_1901_Breslau.png","page_title":"SC Schlesien Breslau","context_page_description":"Der SC Schlesien Breslau war ein deutscher Fußballverein aus dem mittelschlesischen Breslau."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB_%D0%A5%D0%BE%D1%83%D0%B3%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Paul_Hogan-2.jpg","page_title":"Пол Хоуган","context_page_description":"Пол Хоган е австралийски актьор и сценарист, комик, добил световна популярност с ролята на Дънди Крокодила от едноименния филм, за която си роля печели „Златен глобус“, през 1987 година."},{"page_url":"https://sl.wikipedia.org/wiki/Son%C4%8Dev_mrk_21._avgusta_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Solar_eclipse_of_August_21%2C_2017_Nebraska_TLR1.jpg","page_title":"Sončev mrk 21. avgusta 2017","context_page_description":"Sončev mrk 21. avgusta 2017, medijsko napihnjen tudi \\"Veliki ameriški mrk\\", je bil popolni sončev mrk, ki je obsegal pas čez cele celinske Združene države, od Tihega oceana do Atlantskih obal. Kot delni sončev mrk je bil na kopnem viden od Nunavuta v severni Kanadi, do severne Južne Amerike. V severozahodni Evropi in Afriki je bil viden le delno v poznem večeru. V severovzhodni Aziji je bil delno viden ob sončnem vzhodu.\\nRazen tega dogodka, ni bilo čez cele Združene države vidnega niti enega mrka vse od 8. junija 1918, od februarja 1979 pa ni bilo mrka, ki bi bil viden iz celinskih Združenih držav. Pot popolnosti se je dotaknila 14 zveznih držav, preostale ZDA pa so uživale v delnem mrku. Površina popolnosti je obsegala okoli 16 odstotkov površine ZDA, z največjo površino čez ocean, ne zemljo. Senca se je dotaknila tal na oregonski obali kot delni mrk ob 16:05 UTC, popolni mrk pa se je tu pričel ob 17:16 UTC; pokritost popolnega mrka se je končala v Južni Karolini ob okoli 18:44 UTC. Vidnost kot delni mrk se je v mestu Honolulu, Havaji začela s sončevih vzhodom ob 16:20 UTC in se je končala ob 17:25 UTC."},{"page_url":"https://fr.wikipedia.org/wiki/Dampremy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Charleroi_-_Chauss%C3%A9e_de_Mons_-_Carsid.jpg","page_title":"Dampremy","context_page_description":"Dampremy est une section de la ville belge de Charleroi située en Région wallonne dans la province de Hainaut.\\nC'était une commune à part entière avant la fusion des communes de 1977. Elle comprenait à cette date 8 500 habitants.\\nElle a eu un grand passé industriel au temps des mines de charbon. Accueillant nombre de grandes industries qui participèrent à la prospérité du bassin industriel de Charleroi : les verreries de Dampremy, les concessions des Charbonnages de Sacré-Madame..."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Imperial_Japanese_Navy_admirals","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Yoshikazu_End%C5%8D.jpg","page_title":"List of Imperial Japanese Navy admirals","context_page_description":"The following is a list of the Admirals of the Imperial Japanese Navy during its existence from 1868 until 1945."},{"page_url":"https://fr.wikipedia.org/wiki/Chemin_de_fer_de_V%C3%A9lu-Bertincourt_%C3%A0_Saint-Quentin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Ytres_Gare_1910.jpg","page_title":"Chemin de fer de Vélu-Bertincourt à Saint-Quentin","context_page_description":"Le Chemin de fer de Vélu-Bertincourt à Saint-Quentin a fonctionné entre 1880 et 1955, dans les départements de la Somme, l'Aisne et du Pas-de-Calais.\\nElle faisait partie des lignes secondaires de chemin de fer à voie normale du Nord - Pas de calais - Picardie :\\nCompagnie du chemin de fer de Pont-de-la-Deûle à Pont-à-Marcq\\nla ligne de Boisleux à Marquion\\nChemin de fer d'Achiet à Bapaume et Marcoing\\nchemin de fer de Roisel à Hargicourt\\nLa ligne est initialement exploitée par :\\nla Compagnie du Chemin de fer de Vélu-Bertincourt à Saint-Quentin puis par\\nla Compagnie générale de voies ferrées d'intérêt local entre 1930 et 1956 et enfin par\\nla Régie des transports de l'Aisne."},{"page_url":"https://de.wikipedia.org/wiki/Liste_ausgew%C3%A4hlter_Stra%C3%9Fenbrunnen_im_alten_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Reymann_Neuester_Grundriss_von_Berlin_1835.jpg","page_title":"Liste ausgewählter Straßenbrunnen im alten Berlin","context_page_description":"Die Liste ausgewählter Straßenbrunnen im alten Berlin belegt Standorte, die öffentliche Zapfstellen von Trink- und Löschwasser boten. Die Straßenbrunnen Berlins dienten vormals der Wasserversorgung der Bevölkerung bis durch den vollen Ausbau des Wassernetzes in den 1910er Jahren eine Versorgung mit fließendem Wasser für Berlin möglich wurde. Seither dienen die Straßenbrunnen der Notfallversorgung im Verteidigungs- und Katastrophenfall. In sonstigen Zeiten dienen sie Hunden und Vögeln als Tränke und Kindern sind sie Spielplatz, von Anwohnern für die Bewässerung der Straßenbäume genutzt.\\nFalls notwendig sind in den Listenelementen Fakten zum Standort oder dessen Veränderung angegeben. Es existieren weitere Bilder auf denen Berliner Straßenbrunnen der verschiedenen Ständertypen zu erkennen sind, jedoch ist bei jenen Fotos kein Hinweis zum Ort des Bildes vorhanden und aus der Bildsituation auch nicht nachvollziehbar. Weiterführende Aussagen zum Typ der Ständerkörper und zum Bau der Straßenbrunnen finden sich im Artikel Formen Berliner Straßenbrunnen."},{"page_url":"https://en.wikipedia.org/wiki/Birth_process","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Birth_process.svg","page_title":"Birth process","context_page_description":"In probability theory, a birth process or a pure birth process is a special case of a continuous-time Markov process and a generalisation of a Poisson process. It defines a continuous process which takes values in the natural numbers and can only increase by one or remain unchanged. This is a type of birth–death process with no deaths. The rate at which births occur is given by an exponential random variable whose parameter depends only on the current value of the process"},{"page_url":"https://gl.wikipedia.org/wiki/Lardeira,_Carballeda_de_Valdeorras","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Lardeira%2C_Carballeda_de_Valdeorras.jpg","page_title":"Lardeira, Carballeda de Valdeorras","context_page_description":"San Tirso de Lardeira é unha parroquia que se localiza no leste do concello de Carballeda de Valdeorras. Segundo o IGE en 2014 tiña 26 habitantes, 24 menos ca en 2004 e 25 menos ca en 1999. Ten unha única entidade de poboación, a aldea que dá nome á parroquia."},{"page_url":"https://fr.wikipedia.org/wiki/Robert_Gardelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Jean-Louis_Calandrini.jpg","page_title":"Robert Gardelle","context_page_description":"Robert Gardelle, né le 6 avril 1692 à Genève et mort le 7 mars 1766, est un peintre, portraitiste et graveur genevois du XVIIIᵉ siècle."},{"page_url":"https://sv.wikipedia.org/wiki/Stenogobius_gymnopomus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Stenogobius_gymnopomus.jpg","page_title":"Stenogobius gymnopomus","context_page_description":"Stenogobius gymnopomus är en fiskart som först beskrevs av Bleeker, 1853. Stenogobius gymnopomus ingår i släktet Stenogobius och familjen smörbultsfiskar. IUCN kategoriserar arten globalt som livskraftig. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fi.wikipedia.org/wiki/John_Boyd_Orr","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/John_Boyd_Orr_nobel.jpg","page_title":"John Boyd Orr","context_page_description":"Sir John Boyd Orr, 1. paroni Boyd-Orr oli skotlantilainen lääkäri, biologi ja poliitikko, joka palkittiin Nobelin rauhanpalkinnolla vuonna 1949 ravinnon tieteellisestä tutkimuksesta ja työstään Yhdistyneiden kansakuntien elintarvike- ja maatalousjärjestön hyväksi."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%85%D8%AA%D8%AD%D9%81_%D8%A7%D9%84%D9%85%D8%B5%D8%B1%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Mask_of_Amenemope1.jpg","page_title":"المتحف المصري","context_page_description":"المتحف المصري هو أحد أكبر وأشهر المتاحف العالمية، يقع في قلب العاصمة المصرية \\"القاهرة\\" بالجهة الشمالية لميدان التحرير. يعود تاريخ إنشائه إلى عام 1835 وكان موقعه حينها بحديقة الأزبكية، حيث ضم وقتها عدداً كبيراً من الآثار المتنوعة، ثم نقل بمحتوياته إلى قاعة العرض الثانية بقلعة صلاح الدين، حتى فكر عالم المصريات الفرنسي أوجوست مارييت الذي كان يعمل بمتحف اللوفر في افتتاح متحفٍ يعرض فيه مجموعة من الآثار على شاطئ النيل عند بولاق، وعندما تعرضت هذه الآثار لخطر الفيضان تم نقلها إلى ملحق خاص بقصر الخديوي إسماعيل بالجيزة، ثم جاء عالم المصريات جاستون ماسبيرو وافتتح عام 1902 في عهد الخديوي عباس حلمي الثاني مبنى المتحف الجديد في موقعه الحالي في قلب القاهرة.\\nيعتبر المتحف المصري من أوائل المتاحف في العالم التي أسست لتكون متحف عام على عكس المتاحف التي سبقته، يضم المتحف أكثر من 180 ألف قطعة أثرية أهمها المجموعات الأثرية التي عثر عليها في مقابر الملوك والحاشية الملكية للأسرة الوسطى في دهشور عام 1894، ويضم المتحف الآن أعظم مجموعة أثرية في العالم تعبر عن جميع مراحل التاريخ المصري القديم."},{"page_url":"https://cs.wikipedia.org/wiki/Ho%C5%99ec_bezlody%C5%BEn%C3%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Gentiana_acaulis4.jpg","page_title":"Hořec bezlodyžný","context_page_description":"Hořec bezlodyžný je jedním z nejkrásnějších a nejoblíbenějších druhů rodu hořec, který však již z volné přírody České republiky vymizel. Lze jej však občas spatřit v okrasných skalkách kde patří mezi často pěstované hořce."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_la_Rep%C3%BAblica_Dominicana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/President_Baez_with_American_Commissioners%2C_1871.jpg","page_title":"Historia de la República Dominicana","context_page_description":"La historia de la República Dominicana se remonta al año 600 d.C., cuando los ocupantes de la isla eran los taínos. La isla de La Española fue reclamada por España en 1492, y el pueblo de Santo Domingo decidió rebelarse contra España en noviembre de 1821 para unirse al país sudamericano de Gran Colombia. Sin embargo, Haití ocupó la república en 1822, y la república luchó por su independencia hasta que finalmente se logró en 1844. España aprovechó el caos para recolonizar la república, y no fue hasta 1865 que la República Dominicana recuperó su independencia para la última vez. Desde la década de 1860 hasta la década de 1910, el país experimentó conflictos internos, lo que condujo a una invasión y ocupación del país por parte de los Estados Unidos de 1916 a 1924.\\nAlrededor de 1930, la República Dominicana se encontró bajo el control del despiadado dictador Rafael Leónidas Trujillo, quien gobernó el país hasta 1961. Miles de dominicanos perdieron la vida, fueron encarcelados y torturados por los secuaces de Trujillo. Muchos sobrevivientes permanecieron mutilados por el resto de sus vidas; algunos tenían cicatrices permanentes en sus cuerpos y otros sufrían enfermedades mentales."},{"page_url":"https://en.wikipedia.org/wiki/Lightweight_Helmet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/US_Navy_110831-N-KQ416-166_Members_of_the_in-port_security_team_aboard_the_aircraft_carrier_USS_Abraham_Lincoln_%28CVN_72%29_participate_in_a_training.jpg","page_title":"Lightweight Helmet","context_page_description":"The Lightweight Helmet, also known as the Lightweight Marine Corps Helmet or Lightweight Marine Helmet, is an armored helmet that is used by the United States Marine Corps and U.S. Navy. It is the U.S. Marine Corps' successor to the PASGT combat helmet, which it replaced."},{"page_url":"https://en.wikipedia.org/wiki/Austroboletus_lacunosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Austroboletus_lacunosus_13936.jpg","page_title":"Austroboletus lacunosus","context_page_description":"Austroboletus lacunosus is a bolete fungus native to Australia."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%A9l%C3%A8ne_Breschand","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/H%C3%A9l%C3%A8ne_Breschand.jpg","page_title":"Hélène Breschand","context_page_description":"Hélène Breschand, née à Paris, est une harpiste française."},{"page_url":"https://cs.wikipedia.org/wiki/Tadarida_evropsk%C3%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Tadarida_teniotis_distribution_Map.png","page_title":"Tadarida evropská","context_page_description":"Tadarida evropská je netopýr z čeledi tadaridovitých."},{"page_url":"https://es.wikipedia.org/wiki/Sampu%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Parque_principal_de_municipio_de_Sampu%C3%A9s_Sucre_Sabanas.jpg","page_title":"Sampués","context_page_description":"Sampués es un municipio colombiano del occidente del departamento de Sucre, ubicado en la subregión de La Sabana. Su población es de 37.925 habitantes, de los cuales 18.822 pertenecen al pueblo zenú.​\\nEl municipio es reconocido por ser uno de los principales centros de elaboración del sombrero vueltiao, símbolo cultural de Colombia, y por la celebración del Reinado Nacional del Sombrero Vueltiao."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%99%BE%E5%90%88%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lilium_washingtonianum_3.jpg","page_title":"百合属","context_page_description":"百合属通称百合花，是百合目百合科的一属，为多年生草本球根植物，属内物种繁多，经常作为观赏植物，被赋予各种雅称，如：强瞿、番韭、山丹、倒仙、重迈、中庭、摩罗、重箱、中逢花、百合蒜、大师傅蒜、蒜脑薯、夜合花、密灸百合、白花百合等等。主要分布在亚洲东部、欧洲、北美洲等北半球温带地区，全球已发现有至少96个品种，其中5种产于台湾。近年更有不少经过人工杂交而产生的新品种，如OT百合、东方型百合、玫瑰百合等。百合属对猫来说有剧毒。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D0%BA%D0%B8_%D0%9F%D0%BB%D1%83%D1%82%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Nix_cropped_from_family_portrait.png","page_title":"Спутники Плутона","context_page_description":"У Плутона известно пять спутников. Это крупный спутник Харон и четыре значительно меньших — Стикс, Никта, Кербер и Гидра.\\nВсе известные спутники Плутона обращаются по почти круговым орбитам, лежащим примерно в плоскости экватора Плутона, в ту же сторону, что и он вокруг своей оси. Все они близки к орбитальному резонансу: периоды их обращения соотносятся примерно как 1:3:4:5:6. Три из них — Стикс, Никта и Гидра — действительно пребывают в резонансе с соотношением периодов 18:22:33.\\nВращение Плутона и Харона синхронно, а малых спутников — нет: период их осевого вращения намного меньше, чем орбитального, а оси вращения сильно наклонены к осям Плутона и Харона."},{"page_url":"https://fi.wikipedia.org/wiki/Naantalin_viljasiilot","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Naantali_harbor_grain_silos.jpg","page_title":"Naantalin viljasiilot","context_page_description":"Naantalin viljasiilot ovat suomalaisen valtionyhtiön, Suomen Viljavan omistamat viljasiilot Naantalissa, Naantalin satamassa. Ne ovat Suomen suurimmat viljasiilot 230 000 tonnin kapasiteetillaan. Viljasiilojen korkeus on 85 metriä. Naantalissa varastoidaan viljaa ja viljantyyppisiä tuotteita siiloissa. Naantalin toimipisteessä työskentelee 15 henkilöä.\\nSiilot rakennettiin kolmessa eri vaiheessa vuosina 1959, 1970 ja 1982. Siiloja on yhteensä 180 kappaletta, joista pienimpien kapasiteetti on noin 200 tonnia ja suurimpien 3 500 tonnia. Purkaus ja lastaus laivoista tapahtuu kahdella erillisellä linjalla, joista kummankin kapasiteetti on noin 250 tonnia tunnissa. Rekka-autoja varten on neljä eri linjaa, joista kahden suurimman kapasiteetti on 250 tonnia tunnissa linjaa kohden ja kummankin pienemmän kapasiteetti on 120 tonnia tunnissa linjaa kohden.\\nNaantalin toimipisteessä tehdään leipä- ja rehuvilja-analyyseja sekä nurmikasvien siemenanalyyseja. Naantalissa sijaitsee myös nurmikasvien ja pellavan siementenkunnostuslaitos.\\nNaantalin viljasiilojen sijainti on hyvä, sillä lähellä on rehu- ja elintarviketeollisuutta ja satama sekä hyvät tie- ja rautatieyhteydet."},{"page_url":"https://pt.wikipedia.org/wiki/NGC_7081","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/NGC7081_-_SDSS_DR14.jpg","page_title":"NGC 7081","context_page_description":"NGC 7081 é uma galáxia espiral localizada na direcção da constelação de Aquarius. Possui uma declinação de +02° 29' 28\\" e uma ascensão recta de 21 horas, 31 minutos e 24,3 segundos.\\nA galáxia NGC 7081 foi descoberta em 10 de Outubro de 1790 por William Herschel."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Mateusza_w_%C5%81odzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Kosciol_sw_Mateusza_2.jpg","page_title":"Kościół św. Mateusza w Łodzi","context_page_description":"Kościół ewangelicko-augsburski św. Mateusza – kościół w Łodzi, przy Piotrkowskiej 283."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B4%A3%E0%B4%BF%E0%B4%AF%E0%B4%BF%E0%B4%9F_%E0%B4%AA%E0%B4%B0%E0%B4%BF%E0%B4%B8%E0%B5%8D%E0%B4%A5%E0%B4%BF%E0%B4%A4%E0%B4%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/AmbientDesktop.png","page_title":"പണിയിട പരിസ്ഥിതി","context_page_description":"ഒരു ഓപറേറ്റിംഗ് സിസ്റ്റവും ഉപയോക്താവും തമ്മിലുള്ള ആശയവിനിമയം അനായാസകരമാക്കുവാൻ വേണ്ടി നിർമ്മിക്കപ്പെട്ടിട്ടുള്ള ഒരു ഗ്രാഫിക്കൽ ഉപഭോക്തൃ സമ്പർക്കമുഖത്തെ പണിയിട പരിസ്ഥിതി എന്നു പറയുന്നു. പണിയിട വ്യവസ്ഥ അല്ലെങ്കിൽ പണിയിട സംവിധാനം എന്നും പറയാറുണ്ട്. ഇത് ഡെസ്ക്ടോപ് അടിസ്ഥാനമാക്കിയാണ് പ്രവർത്തിക്കുന്നത്. എന്നാൽ ഇതൊരു ഓപറേറ്റിംഗ് സിസ്റ്റത്തിൽ കാണുന്ന എല്ലാ സംവിധാനങ്ങളേയും സൂചിപ്പിക്കുന്നില്ല. ചിലതെല്ലാം ഓപറേറ്റിംഗ് സിസ്റ്റത്തിന്റെ ഭാഗവുമാകാം. ചില സമയങ്ങളിൽ ഓപറേറ്റിംഗ് സിസ്റ്റത്തിന്റെ മുഴുവൻ നിയന്ത്രണമേറ്റെടുക്കാൻ കമാന്റ്ലൈൻ ഇന്റർഫേസ് തന്നെ ആവശ്യമായിവരും.\\nഒരു മനുഷ്യൻ എങ്ങനെയാണോ ഭൗതികലോകത്ത് ഓരോ ജോലികൾ കൈകാര്യം ചെയ്യുന്നത് അതുപോലെത്തന്നെ കമ്പ്യൂട്ടറിലും ചെയ്യാൻ പ്രാപ്തനാക്കുന്ന രീതിയിൽ ഒരു നല്ല സമ്പർമുഖം പ്രദാനം ചെയ്യുക എന്നതാണ് എല്ലാ പണിയിട പരിസ്ഥിതികളുടെയും അടിസ്ഥാന ലക്ഷ്യം. പണിയിട പരിസ്ഥിതിയുടെ പ്രധാന ഘടകങ്ങളെ 'വിമ്പ്' എന്നു സൂചിപ്പിക്കുന്നു. ജാലകങ്ങൾ, ചെറുചിത്രങ്ങൾ മെനു, പോയിന്റർ എന്നിവയാണവ. ഒരു പണിയിടത്തിന്റെ സമ്പർക്കമുഖത്തെ നിർണ്ണയിക്കുന്നതിനൊപ്പം ആ പണിയിടത്തിനെ പൂർത്തിയാക്കുന്ന പ്രോഗ്രാമുകളെയും പണിയിട പരിസ്ഥിതി ഉൾകൊള്ളുന്നു. കെഡിഇയും കോമൺ ഡെസ്ക്ടോപ്പ് എൻവയോൺമെന്റുമാണ് ഈ ഉപയോഗത്തെ ജനപ്രിയമാക്കിയത്."},{"page_url":"https://simple.wikipedia.org/wiki/Freddy_Buache","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Freddy_Buache_by_Erling_Mandelmann.jpg","page_title":"Freddy Buache","context_page_description":"Freddy Buache was a Swiss journalist, movie critic and historian. He was the director of the Swiss Film Archive from 1951 to 1996. He was a privatdozent at the University of Lausanne. Buache was born in Lausanne.\\nBuache died on 28 May 2019 at the age of 94."},{"page_url":"https://tr.wikipedia.org/wiki/Rutenyum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Ru%2C44.jpg","page_title":"Rutenyum","context_page_description":"Rutenyum bir kimyasal element olup, element sembolü Ru ve atom numarası 44’dür. Perdiyodiksistemin geçiş metalleri bölgesinde bulunmaktadır ve 5.Periyodun 8’inci grubunda yer almaktadır. Gümüş renginde, sert ve pürüzlü bir metaldir. Rutenyum 1844 Alman kimyacı Karl Ernst Claus tarafından Sibirya Platinmadenlerinde keşfedilmiştir. Rutenyum çok nadirdir ve az miktarlarda kullanılıyor. Elektro sanayisinde ve katalizör olarak kullanılmaktadır."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AF%D9%8A%D9%88%D8%A7%D9%86_%D8%A7%D9%84%D9%88%D8%B7%D9%86%D9%8A_%D9%84%D9%84%D8%AD%D8%AC_%D9%88%D8%A7%D9%84%D8%B9%D9%85%D8%B1%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Sa%27yee_To_return.jpg","page_title":"الديوان الوطني للحج والعمرة","context_page_description":"الديوان الوطني للحج والعمرة هو مؤسسة رسمية مختصة في شؤون الحج والعمرة بالنسبة للجزائريين، ويقع مقره في ولاية الجزائر.\\nهذا الديوان تشرف عليه وزارة الشؤون الدينية والأوقاف."},{"page_url":"https://it.wikipedia.org/wiki/Cascate_dell%27Oxena","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Cascate_dell%27Ossena_04.jpg","page_title":"Cascate dell'Oxena","context_page_description":"Le cascate dell'Oxena sono una cascata naturale in territorio di Militello in Val di Catania, comune italiano della provincia di Catania in Sicilia.\\nSi tratta di belle cascate naturali situate a Sud del territorio di Militello al confine con il territorio di Francofonte, raggiungibili tramite la sp28 ii Militello-Vizzini Scalo bivio per Francofonte. Incastonate in un bellissimo contesto ambientale, caratterizzato da specie ripariali che accompagnano il corso d'acqua e dalla presenza di olivastri, carrubi, querce, ficodindia, tamerici e oleandri, esse sono alimentate in regime permanente dal fiume Ossena. L'Ossena è un affluente del Trigona il quale a sua volta si versa in parte nel lago di Lentini e in parte nel San Leonardo. Rocce basaltiche ne caratterizzano l'alveo e la loro visita è affascinante, specie nelle stagioni calde per il refrigerio che offrono. La visita di queste cascate permette di godere di un ambiente inusuale, formato da cave verdeggianti e pianori assolati: si percorre il fondo di una di queste cave, sotto una galleria vegetale che funge da volta, e si perlustra controcorrente il fiume che non è mai profondo."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_passeports","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/KZepassport.jpg","page_title":"Liste de passeports","context_page_description":"Les passeports dont le nom est indiqué en italique sont émis par des États non reconnus internationalement.\\nMême si Taïwan maintient des relations officielles avec seulement 22 États, ses passeports de République de Chine sont acceptés comme document d'identité dans la plupart des pays du monde. Si ces passeport permettent à leurs porteurs de circuler sans visa dans 137 États du monde, selon le Visa Restrictions Index ; quelques États, comme l'Argentine, le Brésil ou le République populaire de Chine, refusent de reconnaitre le passeport et émettent donc des visas sur une feuille libre séparée, et ce afin d'appuyer leur refus de reconnaissance d'une Chine distincte de la République populaire de Chine."},{"page_url":"https://it.wikipedia.org/wiki/Quetzalcoatlus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Quetzalcoatlus.JPG","page_title":"Quetzalcoatlus","context_page_description":"Quetzalcoatlus è un genere estinto di pterosauro azhdarcho di enormi dimensioni vissuto nel Cretaceo superiore, circa 70-65 milioni di anni fa, in Nord America. La specie tipo del genere è Q. northropi, inoltre vi è una seconda specie ancora non descritta e classificata come Q. sp.. Questo animale è membro della famiglia degli Azhdarchidae, una famiglia di pterosauri dal becco lungo e sdentato, un collo molto lungo e rigido e aperture alari incredibilmente sviluppate."},{"page_url":"https://pt.wikipedia.org/wiki/Organiza%C3%A7%C3%A3o_Cidades_sem_Fome","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Cidades_sem_Fome_4.jpg","page_title":"Organização Cidades sem Fome","context_page_description":"A Organização não governamental Cidades Sem Fome foi criada no ano de 2004, pelo empresário alemão Hans Dieter Temp. Hans Dieter Temp é graduado em Administração de Empresas, além de possuir o título de Técnico em Agropecuária e Políticas Ambientais. Ao se mudar para Suzano, município próximo a região metropolitana da cidade de São Paulo, constatou que vários terrenos próximos a sua casa estavam desocupados, cheio de entulho e lixo. Para resolver a questão do despejo de detritos nos terrenos, Hans Dieter Temp criou hortas comunitárias, onde são cultivados os mais diversos tipos de verduras e hortaliças orgânicas. Baseado nesta iniciativa, desenvolveu-se a criação da ONG Cidades sem Fome."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_130","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/NGC_0130_SDSS.jpg","page_title":"NGC 130","context_page_description":"NGC 130 galaxia bat da, Pisces konstelazioan. William Parsonsek aurkitu zuen 1850eko azaroaren 4an."},{"page_url":"https://fr.wikipedia.org/wiki/Base_a%C3%A9rienne_200_Apt-Saint-Christol","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Plateau_albion_silos_carte_topographique.png","page_title":"Base aérienne 200 Apt-Saint-Christol","context_page_description":"La base aérienne 200 Apt-Saint-Christol est une ancienne base aérienne de l'Armée de l'air française située sur le territoire de la commune de Saint-Christol, près de la ville d'Apt, dans le Vaucluse.\\nElle avait la responsabilité des dix-huit silos à missiles de la force de dissuasion nucléaire française situés sur le plateau d'Albion. Son unité principale était le 1ᵉʳ groupement de missiles stratégiques dépendant des forces aériennes stratégiques.\\nAprès le départ de l'Armée de l'air, en 1999, la base a été renommée quartier Maréchal Koenig et accueille désormais le 2ᵉ régiment étranger de génie de la Légion étrangère ainsi qu'une station d'écoute de la direction générale de la Sécurité extérieure."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D1%83%D1%85%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/New_Wan_Chai_Market_Interior_201408.jpg","page_title":"Гонконгская кухня","context_page_description":"Гонконгская кухня — совокупность кулинарных традиций населения Гонконга. В городе преобладает общественное питание, чему во многом способствуют как занятость населения, так и особенности жилищ. Большинство горожан предпочитает питаться в ресторанах и уличных закусочных, которых в Гонконге насчитывается более 14 тысяч. Представлены практически все кулинарные стили и течения, но преобладает кантонская кухня, кулинарные традиции которой являются родными для большинства местного населения.\\nВ период британского правления кантонская кухня синтезировала как европейские элементы, так и элементы других китайских и азиатских кухонь. В итоге в гонконгской кухне, при явном доминировании кантонских традиций, присутствуют элементы британской, американской, японской, индийской, пекинской, сычуаньской и других кухонь мира, а также локальных кухонь крупнейших этнических групп Гонконга.\\nБлагодаря статусу международного финансового, транспортного и туристического центра Гонконг превратился в своеобразный гастрономический «инкубатор» и средоточие новых кулинарных веяний."},{"page_url":"https://it.wikipedia.org/wiki/Avro_730","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Avro_730.jpg","page_title":"Avro 730","context_page_description":"L'Avro 730 era il prototipo di un aereo britannico da Mach 3, ricognitore e bombardiere per la Royal Air Force. Venne cancellato nel 1957 insieme ad altri sviluppi di aerei pilotati come parte del 1957 Defence White Paper."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Sabak_Bernam_Ko%C4%81n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Daerah_Sabak_Bernam_Highlighted_in_the_State_of_Selangor%2C_Malaysia.png","page_title":"Sabak Bernam Koān","context_page_description":"Sabak Bernam sī Má-lâi-se-a Selangor Chiu ê chi̍t ê koān.\\nPang-bô͘:Má-lâi-se-a ê koān"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%A9%E3%82%AD%E3%82%A2%E3%83%83%E3%83%88%E3%83%BB%E3%82%B5%E3%83%86%E3%82%A3%E3%82%A2%E3%83%B3%E3%82%BF%E3%82%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/%E0%B8%A5%E0%B8%B2%E0%B8%A2%E0%B9%80%E0%B8%8B%E0%B9%87%E0%B8%99_%E0%B8%AA%E0%B8%B8%E0%B8%A3%E0%B9%80%E0%B8%81%E0%B8%B5%E0%B8%A2%E0%B8%A3%E0%B8%95%E0%B8%B4_%E0%B9%80%E0%B8%AA%E0%B8%96%E0%B8%B5%E0%B8%A2%E0%B8%A3%E0%B9%84%E0%B8%97%E0%B8%A2.png","page_title":"スラキアット・サティアンタイ","context_page_description":"スラキアット・サティアンタイはタイの政治家。2006年7月現在副首相を務め、外交、教育、文化などを担当している。\\n日本のメディアではスラキアットと呼称されることもあるが、在日タイ大使館の公式ホームページにおいては「スラキアット・サティアンタイ」または「スラキエット・サティアンタイ」と表記されている。"},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_peixos_d%27Alb%C3%A0nia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Great_white_shark_is_going_for_a_bait.jpg","page_title":"Llista de peixos d'Albània","context_page_description":"Aquesta llista de peixos d'Albània inclou 426 espècies de peixos que es poden trobar actualment a Albània ordenades per l'ordre alfabètic de llur nom científic."},{"page_url":"https://fr.wikipedia.org/wiki/Scutellastra_longicosta","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Scutellastra_longicosta_01.JPG","page_title":"Scutellastra longicosta","context_page_description":"Scutellastra longicosta est un mollusque de la famille des patelles. Elle est très répandue en Afrique du Sud."},{"page_url":"https://pl.wikipedia.org/wiki/Changchun_(stacja_kolejowa)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Changchun_Railway_Station_01.jpg","page_title":"Changchun (stacja kolejowa)","context_page_description":"Changchun – stacja kolejowa w Changchun, w prowincji Jilin, w Chinach. Na stacji są 4 perony.\\nStacja została wybudowana przez potomków polskich zesłańców na Syberię. Pod koniec XIX wieku stała się ważnym punktem kolei mandżurskiej."},{"page_url":"https://fr.wikipedia.org/wiki/Lemnos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Salt_lake_3.jpg","page_title":"Lemnos","context_page_description":"Lemnos ou Límnos est une île grecque du nord-est de la mer Égée, située entre la péninsule du mont Athos à l'ouest, les îles de Thasos et Samothrace au nord, la Turquie à l'est, Lesbos au sud-est, Ágios Efstrátios et les Sporades au sud-ouest. Elle forme un dème et un district régional de la périphérie d'Égée-Septentrionale. Avant la réforme Kallikratis, elle était rattachée au nome de Lesbos.\\nSa superficie est de 478 km², et sa population d'environ 17 000 habitants. Elle culmine à 470 m d’altitude.\\nOn trouve à Límnos plusieurs sites archéologiques, dont le sanctuaire des Cabires, un culte à mystères où étaient vénérés les Grands Dieux avant que Samothrace ne prenne le relais.\\nLímnos abrite une base militaire aérienne."},{"page_url":"https://es.wikipedia.org/wiki/Ernesto_Munro_L%C3%B3pez","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Kiko_munro.jpg","page_title":"Ernesto Munro López","context_page_description":"Ernesto Roger Munro López también conocido como Kiko Munro es un político mexicano, miembro del Partido Acción Nacional desde 2012. Ha sido en tres ocasiones candidato a la alcaldía del municipio de Puerto Peñasco, la primera en el año 2012 donde no resultó con la mayoría de votos, ​ la segunda ocasión en 2015 quedando electo, ​, y estando en tal cargo se postuló a una reelección en 2018, siendo electo por segunda vez. Es hijo del político Ernesto Munro Palacio, aspirante a la presidencia del PAN estatal.\\nEn 2009 Kiko crea la fundación Todos Somos Peñasco organización sin ánimos de lucro.​"},{"page_url":"https://de.wikipedia.org/wiki/Schalenstein_von_Castleton","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Standing_stone_at_Castleton_-_geograph.org.uk_-_352906.jpg","page_title":"Schalenstein von Castleton","context_page_description":"Der Schalenstein von Castleton steht am Castleton Hill, westlich von Pool of Muckhart, bei Dollar in Clackmannanshire in Schottland.\\nDer 2,2 m hohe, 1,0 m breite und 0,9 m dicke Menhir steht in der Nähe der Westseite der namengebenden Farm. Er wird als Erinnerungsstein eines unbekannten Ereignisses betrachtet.\\nDer Stein trägt insbesondere auf dem unteren Teil seiner Nordseite eine Reihe kleiner Schälchen von denen einige auf Verwitterung zurückzuführen sein können. Während der Untersuchung wurden keine Informationen bezüglich einer Verlegung des Steins in den 1920er Jahren gefunden. Der Stein wurde erstmals im Namensbuch von 1859 beschrieben."},{"page_url":"https://sk.wikipedia.org/wiki/Slavkov_(okres_Opava)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Slavkov_%28okres_Opava%29_flag.jpg","page_title":"Slavkov (okres Opava)","context_page_description":"Slavkov je obec v Česku v okrese Opava v Moravskosliezskom kraji. 1. januára 2012 tu žilo 1 864 obyvateľov, z toho 910 mužov a 954 žien, pričom priemerný vek v obci bol 39,2 roka."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D0%B8%D0%BB%D0%B5%D0%BF_(%D0%9F%D1%96%D0%B2%D0%BD%D1%96%D1%87%D0%BD%D0%B0_%D0%9C%D0%B0%D0%BA%D0%B5%D0%B4%D0%BE%D0%BD%D1%96%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/%D0%9F%D1%80%D0%B8%D0%BB%D0%B5%D0%BF%D1%81%D0%BA%D0%B8_%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D1%82%D0%B5%D0%BB%D0%B8.JPG","page_title":"Прилеп (Північна Македонія)","context_page_description":"Прилеп — місто у північній Македонії з населенням 64 тисячі жителів. Місто розташовано у північній частині Пелагонійської рівнини, за 128 км від столиці Скоп'є.\\nМісто розташовано біля підніжжя фортеці легендарного сербського королевича Марка, відомого як борця проти турків і мудрого правителя."},{"page_url":"https://en.wikipedia.org/wiki/Graham_Vowell","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Graham_Vowell.png","page_title":"Graham Vowell","context_page_description":"John Graham Vowell was an American football player for the Tennessee Volunteers, of the University of Tennessee. He was the school's first All-American. Vowell was inducted into the Tennessee Sports Hall of Fame for 2017."},{"page_url":"https://de.wikipedia.org/wiki/Makaroa_(Franz%C3%B6sisch-Polynesien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Makaroa.jpg","page_title":"Makaroa (Französisch-Polynesien)","context_page_description":"Makaroa ist eine Insel der Gambierinseln in Französisch-Polynesien. Die unbewohnte Insel ist 0,2 km² groß, ihr höchster Punkt liegt 138 m über dem Meeresspiegel."},{"page_url":"https://eu.wikipedia.org/wiki/Magallaes_itsasartea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Commerson%27s_dolphins_%28Cephalorhynchus_commersonii%29_in_the_Strait_of_Magellan.jpg","page_title":"Magallaes itsasartea","context_page_description":"Magallaes itsasartea Hego Amerikako hego muturrean, Txileko Patagoniaren, Tierra del Fuegoren eta Ozeano Barean dauden uharte ugarien artean, dagoen itsasartea da. Ozeano Barea eta Ozeano Atlantikoa lotzen dituen pasabide natural nagusia da.\\nItsasartea osorik Txile barruan dago, Magallaes eta Txileko Antartika XII. eskualdean hain zuzen, baina bere ekialdeko muturra Argentinako urez inguratuta dago. 1881 eta 1984ko Txile eta Argentinaren arteko Itunen arabera, bere uretan edozein herrialdetako itsasontzi pasa daiteke gertatzen dena gertatzen dela.\\n1520an Fernando Magallaes portugaldar esploratzailea izan zen itsasartea igaro zuen lehen europarra. Lehen, bertan bizi ziren tribu nomadak baino ez zeuden"},{"page_url":"https://eo.wikipedia.org/wiki/Satelita_televido","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Antenne-toroidale.jpg","page_title":"Satelita televido","context_page_description":"Satelita televido baziĝas sur la perado de televidaj signaloj helpe de satelitoj troviĝantaj en orbito ĉirkaŭ la Tero. Krom televidaj programoj, oni ofte dissendas ankaŭ radiofoniajn programojn kaj ebligas aldone kelkajn aliajn servojn. Komence la satelitoj havis tre feblan dissendan povumon kaj ne estis tersinkrone lokitaj, do oni bezonis grandegajn turneblajn spegul-antenojn por ricevi la de la alŝutstacio plusenditajn signalojn. Praktike nur specialaj deŝutaj stacioj povis ricevi kaj plukonduki la satelite peritajn programojn. Sed la dissenda povumo de la satelitoj rapide kreskis kaj oni metis ilin sur tersinkronan orbiton, tiel permesante rektan ricevadon per fiksa anteno. Tiel ĉiu spektanto povas per malgranda malmultekosta \\"pelvo\\" kapti la programojn - kondiĉe nur, ke tiu povas vidi la sateliton. Do nenio baru la videblon. Ĉi ĉio bonege funkcias ĝis ĉirkaŭ ±70º norde aŭ sude de la ekvatoro."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D9%85%D8%B7%D8%A9_%D8%B1%D9%83%D8%A7%D8%A8%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Measure_a_u-bolt.jpg","page_title":"قامطة ركابية","context_page_description":"القَامِطَة الرِّكَابِيَّة هي نوع من القوامط تكون على شكل ركاب."},{"page_url":"https://de.wikipedia.org/wiki/Ulmensplintk%C3%A4fer","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Scolytus_scolytus_1_meyers_1888_v16_p352.jpg","page_title":"Ulmensplintkäfer","context_page_description":"Mit dem Begriff Ulmensplintkäfer bezeichnet man verschiedene Arten der zur Unterfamilie der Borkenkäfer gehörenden Gattung der Splintkäfer, die an Ulmen leben. Sie sind als Überträger des Schlauchpilzes Ophiostoma novo-ulmi, der das Ulmensterben in Europa verursacht, bekannt.\\nOft ist mit „Ulmensplintkäfer“ der Große Ulmensplintkäfer gemeint, der im mitteleuropäischen Raum häufigste unter diesen Arten. Gebietsweise kann jedoch auch der Mittlere Ulmensplintkäfer stark vertreten sein.\\nAn der Ulme leben folgende Splintkäferarten:\\nScolytus ensifer\\nScolytus kirschii\\nScolytus laevis\\nScolytus multistriatus\\nScolytus pygmaeus\\nScolytus scolytus\\nScolytus zaitzevi"},{"page_url":"https://en.wikipedia.org/wiki/Pineapple_tart","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/5_pineapple_tarts.jpg","page_title":"Pineapple tart","context_page_description":"Pineapple tarts or nanas tart are small, bite-size pastries filled or topped with pineapple jam, commonly found throughout different parts of Southeast Asia such as Indonesia, Malaysia, Brunei and Singapore in various forms. The origins of the pineapple tart possibly derives from a Portuguese influence back in the 16th century when the pineapple, a fruit native to South America, was introduced by the Portuguese Empire to Asia, specifically the Malay Peninsula. A similar influenced pastry, known as pineapple cake or pineapple pastry, is also found in Taiwan, South Korea and Japan."},{"page_url":"https://es.wikipedia.org/wiki/Ciclog%C3%A9nesis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Waterspout_noaa00307.jpg","page_title":"Ciclogénesis","context_page_description":"Ciclogénesis es el desarrollo o la consolidación de la circulación ciclónica en la atmósfera.​ Se trata de un término paraguas para varios procesos diversos, todos los cuales dan lugar al desarrollo de una cierta clase de ciclón. Puede ocurrir en varias escalas, desde la microescala a la escala sinóptica. Los ciclones extratropicales forman ondas a lo largo de los frentes antes de ocluir más adelante en su ciclo vital como ciclones de núcleo frío. Los ciclones tropicales se forman debido al calor latente conducido por actividad de tormenta significativa y son de núcleo cálido. Los mesociclones se forman sobre tierra como ciclones de núcleo cálido y pueden conllevar a la formación de tornados. También formadas a partir de mesociclones son las trombas marinas, aunque a menudo se forman a partir de ambientes de fuerte inestabilidad y cizalladura vertical baja.\\nCiclogénesis es lo opuesto a ciclólisis —la disipación de un ciclón— y tiene un equivalente anticiclónico que se relaciona con la formación de áreas de alta presión: anticiclogénesis.​"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BD%D1%82%D0%B8%D1%87%D0%B5%D0%BD_%D1%81%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD_(%D0%9F%D0%BB%D0%BE%D0%B2%D0%B4%D0%B8%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Razkrivane_stadion_4.jpg","page_title":"Античен стадион (Пловдив)","context_page_description":"Античният стадион на Филипопол, днешен Пловдив, е изграден в началото на ІІ в., по времето на император Адриан. Филипопол и Тримонциум са имената на Пловдив по времето на Древния Рим. Античният стадион е едно от най-забележителните съоръжения на древния Филипопол. Обявен е за национална културна ценност през 1995 година. Стадионът е една от многото запазени сгради от времето на Древния Рим в днешен Пловдив, сред които са най-добре съхраненият античен театър на Балканския полуостров, фрагменти от Форума / Агората, Одеона / Булевтериона, фрагменти от два акведукта, крепостни стени, терми, малка и голяма базилика, синагога, резиденции, улици и др."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D1%80%D0%B1%D0%B8_%D0%B2%D0%BE_%D0%A3%D0%BD%D0%B3%D0%B0%D1%80%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Szentendre4.jpg","page_title":"Срби во Унгарија","context_page_description":"Србите во Унгарија се едно од официјалните национални малцинства."},{"page_url":"https://de.wikipedia.org/wiki/Frederick_E._Morgan","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Frederick_E._Morgan.jpg","page_title":"Frederick E. Morgan","context_page_description":"Sir Frederick Edgeworth Morgan war ein britischer Lieutenant-General im Zweiten Weltkrieg, der die Hauptarbeit an der Planung der Operation Overlord leistete."},{"page_url":"https://es.wikipedia.org/wiki/Louis_Michel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Louis_Michel.jpg","page_title":"Louis Michel","context_page_description":"Louis Michel es un político belga, antiguo Comisario Europeo de Desarrollo y ayuda humanitaria entre 2004 y 2009. Es un miembro prominente del partido francófono y liberal Movimiento Reformador. Ocupó el puesto de Ministro de Exteriores en su país hasta julio de 2004.\\nComenzó su carrera política en 1967 como líder de los Jóvenes Liberales en el distrito de Nivelles. En 1977 deja de liderar a los jóvenes y se convierte en concejal de Jodoigne hasta 1983, siendo desde entonces alcalde de la localidad. Por otro lado, en 1980 se convertía en secretario general del Partido Reformista Liberal, llegando en 1982 a ser su presidente cargo que ocuparía hasta 1990 y de nuevo de 1995 a 1999.\\nHa sido miembro del Parlamento Federal Belga desde 1978 a 2004, primero como diputado y los años restantes como senador. Participó en el gobierno de Guy Verhofstadt como Ministro de Exteriores y Viceprimer Ministro, hasta que en 2004 fue propuesto como comisario belga en la Comisión Barroso. Ocupó la comisaría de Desarrollo y Ayuda humanitaria hasta julio de 2009.​. Actualmente es Diputado del Parlamento Europeo. Es el padre del actual primer ministro de Bélgica, Charles Michel.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E9%BA%BB%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Cannabis_sativa_leaf_diagnostic_venation_2012_01_23_0829_c.jpg","page_title":"大麻属","context_page_description":"大麻属，是蔷薇目大麻科的一属，其该属内的物种，常见说法只列出寻常大麻一种，也有将印度大麻、莠草大麻也并列为大麻物种的说法。大麻属植物可能起源于中亚或南亚地区，现今广泛在全球种植，主要生长地区主要包括在亚洲的吉尔吉斯、阿富汗、中国部分地区、印度和尼泊尔以及欧洲的匈牙利、波兰、保加利亚等地。在中国，主要生长于安徽、河南、河北、山西、山东、黑龙江、内蒙古、陕西、甘肃、四川等地。\\n大麻属植物中存在多种化学物质，被称为大麻素，最明显体现的是四氢大麻酚和大麻二酚两大主要成分，主要存在于大麻的花、叶内，而大麻花穗之中主要成分最多。欧盟根据植株花叶干物质中四氢大麻酚百分含量高低，将大麻分为药用型、中间型和纤维型。"},{"page_url":"https://no.wikipedia.org/wiki/Metaanalyse","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Forestplot01.jpg","page_title":"Metaanalyse","context_page_description":"Metaanalyse er innen statistikk å sammenstille eller sammenligne resultater fra flere tidligere empiriske undersøkelser. Metaanalyser summerer tidligere forskning om et fenomen. Formålet er å kombinere enkeltstudier for å få en bedre og sikrere helhetsbilde over forskningen. En annen grunn er for å finne årsaker til at konklusjonene i enkeltstudier kan avvike. Grunnprinsippet i metaanalyser er å finne en felles måleenhet på tvers av undersøkelsene for deretter å vekte gjennomsnitt av forskningsundersøkelsene som inngår. Vanligvis vektes det etter utvalgsstørrelse. Felles måleenhet er gjerne effektstørrelse.\\nNår det gjennomføres en metaanalyse må en først velge hvilke kvalitetskriterier en skal bruke for å søke etter og velge hvilke undersøkelser som skal inngå, hvordan håndtere manglende data og hvilke statistiske metoder som skal brukes i analysen. En vanlig feilkilde i metananlyser er publikasjonsbias, som tendensen til undersøkelser med positivt resultat har større sannynlighet for å bli publisert og dermed inngå i senere metaanalyser."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%9F%E0%A4%BE%E0%A4%87%E0%A4%9F%E0%A5%88%E0%A4%A8%E0%A5%8B%E0%A4%B8%E0%A5%89%E0%A4%B0%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Titanosaurus.jpg","page_title":"टाइटैनोसॉरस","context_page_description":"टाइटैनोसॉरस भारत में उत्तर चाकमय युग में पाया जाने वाला एक डायनोसोर था। यह पहला डायनोसोर था जिसके जीवाश्म भारत में मिले। इसकी रीढ़ की एक हड्डी सन् 1828 में पाई गई थी। यह सभी डयनोसोर जातियों में सबसे भीमकाय में से एक माना जाता है। इसके बावजूद इसका अधिक वर्णन नहीं किया जाता और कुछ जीववैज्ञानिकों का मानना है कि भारत ने अपने डायनासोरों को पार्याप्त रूप से उजागर नहीं करा है।"},{"page_url":"https://pl.wikipedia.org/wiki/Stadion_Start_w_Lidzie","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/%D0%A1%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD_%22%D0%A1%D1%82%D0%B0%D1%80%D1%82%22.jpg","page_title":"Stadion Start w Lidzie","context_page_description":"Stadion Start – wielofunkcyjny stadion w Lidzie, na Białorusi. Został otwarty w 2013 roku. Może pomieścić 2960 widzów. Jest jednym z dwóch obiektów domowych klubu FK Lida.\\nBudowa stadionu rozpoczęła się w 1979 roku, kiedy kierownictwo miejscowej fabryki butów, wspierającej również lokalny klub piłkarski, postanowiło skorzystać z przedolimpijskiego programu rozwoju infrastruktury sportowej. Po igrzyskach w Moskwie fundusze jednak odcięto i stadion nie został ukończony, a niedoszły obiekt sportowy zamieniono w targowisko, choć boisko było wykorzystywane przez piłkarzy do treningów. Dokończenia budowy stadionu podjęto się przed dożynkami w 2010 roku. Prac nie udało się ukończyć na czas, ale wiosną 2013 roku obiekt był w pełni gotowy. Odtąd, razem ze stadionem Junactwa, obiekt pełni rolę domowej areny dla klubu FK Lida. Stadion posiada trybuny wzdłuż boiska, po obu jego stronach, mogące łącznie pomieścić 2960 widzów. Obiekt wyposażony jest w boisko z syntetyczną nawierzchnią, sztuczne oświetlenie oraz tartanową, 6-torową bieżnię lekkoatletyczną. Za północnym łukiem bieżni mieści się budynek administracyjny, południowy łuk okala wał ziemny pozbawiony trybun."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BD%D0%B0%D0%BF%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Anapa._Anapka_river.JPG","page_title":"Анапа","context_page_description":"Анапа — місто, центр Анапського міського округу Краснодарського краю Росії. Один з осередків кубанських козаків, що походять від переселенців з України. Населення 53,6 тис. осіб."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B2%D1%96%D1%82%D0%BB%D0%BE%D0%B2%D0%B8%D0%B9_%D1%84%D0%BE%D0%BD%D1%82%D0%B0%D0%BD_(%D0%9B%D1%96%D1%81%D0%B0%D0%B1%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Fonte_Monumental_Alameda_D_Afonso_Henriques_IMG_4492.jpg","page_title":"Світловий фонтан (Лісабон)","context_page_description":"Світловий фонтан, Монументальний фонтан, Фонте Луміноза — фонтан, що знаходиться в парку Alameda Dom Afonso Henriques, в Лісабоні."},{"page_url":"https://de.wikipedia.org/wiki/San_Juan_Islands","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/San_Juans_Names.png","page_title":"San Juan Islands","context_page_description":"Die San Juan Islands sind eine Inselgruppe im Nordwesten des US-Bundesstaats Washington. Je nach Definition von „Insel“ spricht man von 172 oder sogar mehreren hundert Inseln und Inselchen, die den San Juans zugerechnet werden. 172 ist dabei die Anzahl der Inseln, die groß genug sind, um mit eigenem Namen bezeichnet zu werden. Gelegentlich findet man auch die Angabe von 176 Inseln mit eigenem Namen. Auf den San Juan Islands leben etwa 16.000 Menschen.\\nDie Inseln liegen östlich der kanadischen Insel Vancouver Island beziehungsweise der Haro-Straße und des Boundary Pass und trennen die Juan-de-Fuca-Straße im Süden von der Straße von Georgia im Norden. Die Ostgrenze ist die Rosario-Straße. Die drei größten Inseln sind San Juan Island, Orcas Island und Lopez Island.\\nDie San Juan Islands bilden das San Juan County. Auf den Inseln liegt das San Juan Islands National Monument mit 75 Teilflächen."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%86%AB%E4%BA%8B%E6%AA%A2%E9%A9%97%E5%B8%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Needle_EMG_of_paravertebral_muscles%282J009%29.jpg","page_title":"醫事檢驗師","context_page_description":"醫事檢驗師，是指專門負責檢驗醫學的專業醫事人員。\\n60%～70%的醫療重要決策來取決於檢驗醫學的結果，檢驗醫學在現代醫學的地位可見一斑。\\n醫檢師工作範圍十分廣泛，檢驗包含血液、尿液、精液、羊水、糞便、傷口膿液、痰液、腦脊髓液、胸水、腹水等各種體液或分泌物，以進行臨床生化學、臨床血液學、臨床血庫學、臨床血清免疫學、臨床病毒學、臨床鏡檢學、臨床微生物學、臨床生理學、醫學分子檢驗以及專門檢驗染色體異常的細胞遺傳學檢驗等各式醫學檢驗分析或檢查。同時醫檢師也從事臨牀實驗室的質量保證和合規管理。\\n在人類基因組計畫後的時代，個人化醫療將逐漸成為趨勢，而醫學分子檢驗即為個人化醫療的關鍵，醫檢師可針對個人進行DNA分析，幫助醫師評估藥物的適用性，便於調整治療方式，癌症基因檢測可以評估癌症的發生可能性和治療預後預測，遺傳疾病的發生機率等。\\n親子鑑定亦為醫檢師的工作內容之一。利用血液中萃取DNA，可以利用聚合酶鏈式反應方式針對各個簡單重複序列分析，經過計算後可以做為判斷親緣關係的依據，並提供醫師或法院參考。\\n在DNA測序技術成熟後，醫檢師利用PCR方式針對不易培養或不易觀察的微生物，或是針對抗藥性基因設計引子，更可以加快醫師診斷和治療。\\n在世界各國中，醫檢師通常需要通過特定團體或國家所舉行的考試才可擔任醫檢師，並使用醫檢師此一職業稱呼。若未通過考試而使用醫檢師名稱或執行醫檢師業務通常被視為違法行為。在台灣，醫檢師為國家所定之「專門職業及技術人員」，必須依法經國家考試通過取得醫事檢驗師證書才可執業。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AE%D9%88%D8%A7%D9%86_%D8%A8%D9%8A%D9%84%D9%8A%D9%86%D9%83%D9%88%D8%B3%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Juan_Belencoso.JPG","page_title":"خوان بيلينكوسو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nخوان بيلينكوسو لاعب كورة قدم من اسبانيا."},{"page_url":"https://fr.wikipedia.org/wiki/S%C3%A8te","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Saint_Louis2005_1.jpg","page_title":"Sète","context_page_description":"Sète — écrit Cette jusqu'en 1927 — est une commune française située dans le département de l'Hérault en région Occitanie. Elle appartient à la communauté d'agglomération Sète Agglopôle Méditerranée.\\nPar sa population, Sète est la 146ᵉ commune de France, établie sur les données de la population légale millésimées 2013 entrant en vigueur le 1ᵉʳ janvier 2016 et la troisième de l'Hérault. Son agglomération, ou unité urbaine est, avec 91 508 habitants, la deuxième du département.\\nAppelée l'île singulière, Sète a vu naître des artistes comme Paul Valéry, Georges Brassens, Manitas de Plata ou Jean Vilar.\\nElle est parfois surnommée la « Venise du Languedoc » pour son canal et sa situation particulièrement privilégiée sur un promontoire, agrémentée d'un littoral de sable fin, qui contribuent à faire de Sète une villégiature prisée. Enfin, son port de pêche et ses diverses activités maritimes ont permis à cette ville de prospérer malgré la dure concurrence des autres ports méditerranéens."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%85%E0%A8%A7%E0%A8%BE%E0%A8%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Periodic_table_%28polyatomic%29.svg","page_title":"ਅਧਾਤ","context_page_description":"ਰਸਾਇਣ ਵਿਗਿਆਨ ਵਿੱਚ ਅਧਾਤ ਇੱਕ ਅਜਿਹਾ ਰਸਾਇਣਕ ਤੱਤ ਹੁੰਦਾ ਹੈ ਜੋ ਧਾਤਾਂ ਦੇ ਗੁਣਾਂ ਤੋਂ ਵਾਂਝਾ ਹੋਵੇ। ਭੌਤਿਕ ਤੌਰ ਉੱਤੇ ਇਹ ਬਹੁਤ ਹੀ ਬੁਖ਼ਾਰਾਤੀ, ਘੱਟ ਲਚਕੀਲੇ ਅਤੇ ਤਾਪ ਤੇ ਬਿਜਲੀ ਦੇ ਚੰਗੇ ਰੋਧਕ ਹੁੰਦੇ ਹਨ; ਰਸਾਇਣਕ ਤੌਰ ਉੱਤੇ ਇਹਨਾਂ ਦੀ ਆਇਨੀਕਰਨ ਊਰਜਾ ਅਤੇ ਬਿਜਲਾਣੂਰਿਣਤਾ ਦੇ ਮੁੱਲ ਬਹੁਤ ਉੱਚੇ ਹੁੰਦੇ ਹਨ ਅਤੇ ਹੋਰ ਤੱਤਾਂ ਜਾਂ ਯੋਗਾਂ ਨਾਲ਼ ਕਿਰਿਆ ਕਰਦੇ ਹੋਏ ਇਹ ਬਿਜਲਾਣੂਆਂ ਨੂੰ ਲੈਂਦੇ ਜਾਂ ਸਾਂਝਾ ਕਰਦੇ ਹਨ, ਦਿੰਦੇ ਨਹੀਂ ਹਨ। ਆਮ ਤੌਰ ਉੱਤੇ 17 ਤੱਤਾਂ ਨੂੰ ਅਧਾਤਾਂ ਆਖਿਆ ਜਾਂਦਾ ਹੈ; ਬਹੁਤੀਆਂ ਤਾਂ ਗੈਸਾਂ ਹਨ; ਇੱਕ ਤਰਲ ਹੈ; ਅਤੇ ਕੁਝ ਠੋਸ ਹਨ ।"},{"page_url":"https://pt.wikipedia.org/wiki/S%C3%BAmate","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Maria_Corina_Machado_%28Sumate%29_meets_George_W._Bush_%282002%29.jpg","page_title":"Súmate","context_page_description":"Súmate é uma controvertida ONG venezuelana que se auto-descreve como sendo uma associação civil. Seu diretor, legislador da oposição María Corina Machado, disse que a única maneira de acabar com o governo Chávez é um \\"golpe\\" É patrocinada e financiada pelo governo dos Estados Unidos, que tem como seu único objetivo desestabilizar o governo venezuelano, e provocar a queda de Hugo Chávez\\nO grupo organizou o \\"referendo revogatório\\" de Hugo Chávez O grupo é financiado em grande parte por interesses privados venezuelanos, mas também teria recursos recebidos os EUA. Durante 2014 publicou-se um áudio onde líderes de ONGs, incluindo Corina Machado, pediu liderar um golpe de Estado ou um processo de desestabilização. No dia da votação do referendo, Sumate distribuiu panfletos falsos anunciando uma vitória falsa da oposição, o ex-presidente dos EUA Jimmy Carter disse\\" Súmate distribui deliberadamente esses resultados errados, a fim de construir não só a esperança de vitória, mas também para influenciar as pessoas que ainda estavam na fila para votar\\"."},{"page_url":"https://ht.wikipedia.org/wiki/Empire_(seri,_2015)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Xzibit_2012.jpg","page_title":"Empire (seri, 2015)","context_page_description":"Empire se yon seri televizyon amerikèn kreye pa Lee Daniels ak Danny Strong e difize depi 7 janvye 2015 sou rezo Fox ak nan Kanada an menm tan sou Omni Television pou premyè sezon an."},{"page_url":"https://es.wikipedia.org/wiki/Eduardo_Mella","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Eduardo_Mella_Mella.jpg","page_title":"Eduardo Mella","context_page_description":"Eduardo Mella Mella fue un abogado y político chileno, que ejerció como diputado por la antigua provincia de Colchagua entre 1945 y 1949. Fue también director del periódico El Cóndor de Santa Cruz."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D0%BA%D0%BE%D0%B1%D0%B8,_%D0%92%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Valery_Jacobi_Ninth_Thermidor.jpg","page_title":"Якоби, Валерий Иванович","context_page_description":"Вале́рий Ива́нович Яко́би — русский живописец, профессор, академик, член академического Совета Императорской Академии художеств, один из учредителей Товарищества передвижных художественных выставок.\\nБрат революционера, впоследствии психиатра и этнографа П. И. Якоби."},{"page_url":"https://sco.wikipedia.org/wiki/Bilady,_Bilady,_Bilady","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Flag_of_Egypt.svg","page_title":"Bilady, Bilady, Bilady","context_page_description":"Bilady, laki hubbi wa fu'adi is the naitional anthem o Egyp. The melody wis componed bi Sayed Darwish an wis adopted in 1979. Altho the modren version haes three stanzas, anly the first is commonly sung the day. This anthem replaced Walla Zaman Ya Selahy."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_St._Clair_(condado_de_Columbiana,_Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Grimms_Bridge_from_west%2C_slightly_upstream.JPG","page_title":"Municipio de St. Clair (condado de Columbiana, Ohio)","context_page_description":"El municipio de St. Clair es un municipio ubicado en el condado de Columbiana en el estado estadounidense de Ohio. En el año 2010 tenía una población de 7957 habitantes y una densidad poblacional de 103,78 personas por km².​"},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Stadt_Kronach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/De_Gaulle-OWI.jpg","page_title":"Geschichte der Stadt Kronach","context_page_description":"Die Geschichte der Stadt Kronach beginnt vermutlich im achten oder neunten nachchristlichen Jahrhundert; dokumentiert ist sie seit der ersten urkundlichen Erwähnung des Ortes im Jahr 1003. Die Stadtgeschichte ist deutlich von der jahrhundertelangen Zugehörigkeit zum katholischen Hochstift Bamberg und der damit verbundenen Grenzlage zum protestantischen Kurfürstentum Sachsen geprägt. Als nördliches Bollwerk im Herrschaftsgebiet der Bamberger Fürstbischöfe wurde die oberhalb der Stadt gelegene Burg Rosenberg, die Mitte des 13. Jahrhunderts erstmals urkundlich erwähnt wurde, zu einer frühneuzeitlichen Schlossfestung ausgebaut."},{"page_url":"https://hu.wikipedia.org/wiki/A_Dal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/A_Dal_2016_TOP_30_2015-12-15.JPG","page_title":"A Dal","context_page_description":"A Dal című műsorsorozat az Európai Műsorszolgáltatók Szövetsége felügyelete alatt az Eurovízió néven ismert műsorcsere keretében, az EBU tagok nemzetközi koprodukciójaként megrendezésre kerülő, évente több mint százmillió nézőt vonzó Eurovízós Dalfesztivál magyarországi válogatóversenye volt, 2020 óta a nemzetközi dalfesztiváltól függetlenül képernyőre kerülő tehetségkutató műsor. Első alkalommal 2012-ben rendezték meg a hazai válogató műsort, három élő adással. A következő években már hat élő műsorral jelentkezett a nemzeti döntő.\\n2018-ig, amíg Magyarország A Dal című műsor keretiben választotta ki a versenyzőjét, addig minden egyes előadó, illetve zenekar bejutott a dalfesztivál döntőjébe, és 2014-ig sikerült az előző évi eredményen javítani. Az elődöntők 2004-es bevezetése óta mindössze csak háromszor nem sikerült Magyarországnak kvalifikálnia magát, 2008-ban, 2009-ben és 2019-ben, habár a 2004-es, a 2006-os és a 2010-es versenyen nem vett részt a Magyar Televízió. 2016 óta a magyarországi közszolgálati médiumok közös jogutódja, a Duna Médiaszolgáltató látja el ezt a feladatot."},{"page_url":"https://pt.wikipedia.org/wiki/Minhoca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Sistema_circulat%C3%B3rio.jpg","page_title":"Minhoca","context_page_description":"As minhocas são animais anelídeos, da subclasse Oligochaeta, de simetria bilateral, recobertos por uma fina cutícula pigmentada. Seu corpo cilíndrico é segmentado interna e externamente, mas os dois primeiros segmentos não são identificados externamente. Estão distribuídas pelos solos úmidos de todo o mundo, algumas com apenas alguns centímetros, outras com um a dois metros de comprimento, ou mais, casos nos quais são conhecidas como minhocuçus. O seu corpo é formado por anéis, o que faz com que sejam cilíndricos e alongados, com a boca e o ânus em extremidades opostas, e um anel mais claro, o clitelo, mais próximo à extremidade anterior. São, ainda, conhecidas por serem animais com vários corações, podendo ter entre dois e quinze pares.\\nElas vivem enterradas, escavam galerias e canais no solo, buscando abrigo e restos vegetais, os quais são seu principal alimento, ingerido com grandes quantidades de terra. Elas são, portanto, animais detritívoros, pois se alimentam de detritos de várias origens. As fezes das minhocas contém terra ingerida misturada com matéria orgânica, compondo o húmus de minhoca, um ótimo fertilizante."},{"page_url":"https://ar.wikipedia.org/wiki/NGC_3493","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/NGC3493_-_SDSS_DR14.jpg","page_title":"NGC 3493","context_page_description":"NGC 3493 في الفهرس العام الجديد، هي مجرة، تقع في كوكبة الأسد الأصغر. اكتشفت في 24 ديسمبر 1827 بواسطة جون هيرشل."},{"page_url":"https://en.wikipedia.org/wiki/Felimare","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/BEP_1457-1.jpg","page_title":"Felimare","context_page_description":"Felimare is a genus of sea slugs, dorid nudibranchs, shell-less marine gastropod molluscs in the family Chromodorididae."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/A-phi-sng","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Arsenous-acid-2D.svg","page_title":"A-phi-sng","context_page_description":"A-phi-sng, mā ū kiò sìn-chio̍h, hoà-ha̍k-sek H₃AsO₃.\\nA-phi-sng ē tī sam-sng-hoà phi-sò͘ iûⁿ tī chúi lāi ê sî sán-seng:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D1%96%D1%8F_%D0%BA%D0%BE%D0%BB%D0%BE%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/SAO_1990.png","page_title":"Революція колод","context_page_description":"Революція колод — повстання, яке почалося 17 серпня 1990 року в районах Республіки Хорватія зі значною часткою сербського населення. Цим подіям, які переростуть у стан війни, передував цілий рік напруженості, включаючи дрібні сутички і перестрілки."},{"page_url":"https://de.wikipedia.org/wiki/Meletius_von_Antiochien","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/StMeletiy.jpg","page_title":"Meletius von Antiochien","context_page_description":"Meletius von Antiochien war von 360 bis 381 Patriarch von Antiochien und verursachte dort das nach ihm benannte Meletianische Schisma, bevor er zum Führer der sogenannten Jungnizäner wurde."},{"page_url":"https://sv.wikipedia.org/wiki/Planococcus_citri","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Planococcus_citri_1455198.jpg","page_title":"Planococcus citri","context_page_description":"Planococcus citri är en insektsart som först beskrevs av Antoine Risso 1813. Planococcus citri ingår i släktet Planococcus och familjen ullsköldlöss. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_K%C3%A4sesorten_aus_Frankreich","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Camembert_de_Normandie_%28AOP%29_11.jpg","page_title":"Liste von Käsesorten aus Frankreich","context_page_description":"Die Liste enthält Käsesorten aus Frankreich."},{"page_url":"https://es.wikipedia.org/wiki/Mezquita_de_Solim%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/S%C3%BCleymaniye_Camii.jpg","page_title":"Mezquita de Solimán","context_page_description":"La mezquita de Solimán o mezquita de Süleymaniye es una mezquita imperial otomana situada en la tercera colina de Estambul, Turquía. Hasta el año 2019 era la más grande de la ciudad, siendo sucedida por la La Mezquita Çamlıca, aun así es una de las panorámicas más conocidas de la misma."},{"page_url":"https://pt.wikipedia.org/wiki/Sitters","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Wappen_Sitters.png","page_title":"Sitters","context_page_description":"Sitters é um município da Alemanha localizado no distrito de Donnersbergkreis, na associação municipal de Verbandsgemeinde Alsenz-Obermoschel, no estado da Renânia-Palatinado."},{"page_url":"https://af.wikipedia.org/wiki/Sossusvlei","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Thorn_Tree_Sossusvlei_Namib_Desert_Namibia_Luca_Galuzzi_2004.JPG","page_title":"Sossusvlei","context_page_description":"Sossusvlei is 'n kleivallei in die middel van die Namibwoestyn. Die vallei is deel van die Namib-Naukluft Nasionale Park in Namibië. Dit word deur die Tsauchab-rivier gevoed en is bekend vir die hoë, rooi sandduine wat dit omring en dit tot 'n groot see van sand omvorm. Plantegroei, soos die kameeldoring, word deur seldsame vloede van die Tsauchab van water voorsien. Die rooi kleur van die sand is aan die hoë konsentrasie yster te danke.\\nNaby Sossusvlei lê die Dooievlei en die Hidden-vlei. Duin 45 is 'n bekend uitkykpunt oor die gebied. Hierdie spesiale plekke is oor die pad deur die plekkie Sesriem bereikbaar."},{"page_url":"https://it.wikipedia.org/wiki/Sin_c%C3%B3digo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Antonio_Grimau_junto_a_una_estatua_de_Fontanarrosa_en_el_bar_%22El_Cairo%22%2C_en_Rosario..JPG","page_title":"Sin código","context_page_description":"Sin código è una police procedural/telenovela argentina trasmessa da Canal 13 dal 2004 al 2006.\\nCreata da Adrián Suar, la serie è interpretata dallo stesso Suar e da Nicolás Cabré e narra le vicende di Gabriel Nielson, dirigente di una azienda di massima sicurezza.\\nDivisa in due stagioni, la prima si caratterizza per essere di genere police procedural, mentre la seconda come una telenovela."},{"page_url":"https://de.wikipedia.org/wiki/Pilar_(Paraguay)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Escudo_de_Pilar.png","page_title":"Pilar (Paraguay)","context_page_description":"Pilar ist eine Distriktsstadt und Hauptstadt des Departamentos Ñeembucú am Río Paraguay in Paraguay mit 32.800 Einwohnern, an der Grenze zu Argentinien.\\nSie besitzt unter anderem ein historisches Museum – das 1784 errichtete Museo Cabildo de Pilar, einen Hafen, einen Flugplatz und eine Universität.\\nNach dem Tripel-Allianz-Krieg siedelten sich italienische Einwanderer in Pilar an und gründeten eine Textilfabrik."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_beelden_in_Waterland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Maria_boodschap_Weezenland20_Monnickendam.jpg","page_title":"Lijst van beelden in Waterland","context_page_description":"Dit is een chronologische lijst van beelden in Waterland. Onder een beeld wordt hier verstaan elk driedimensionaal kunstwerk in de openbare ruimte van de Nederlandse gemeente Waterland, waarbij beeld wordt gebruikt als verzamelbegrip voor sculpturen, standbeelden, installaties, gedenktekens en overige beeldhouwwerken."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%8A%D9%86_%D9%88%D8%A8%D9%8A%D9%84_(%D9%81%D9%8A%D9%84%D9%85)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Min_and_Bill_lobby_card.jpg","page_title":"مين وبيل (فيلم)","context_page_description":"مين وبيل ‏ هو فيلم كوميدي تم إنتاجه في الولايات المتحدة وصدر في سنة 1930. الفيلم من كتابة فرانسيز ماريون."},{"page_url":"https://de.wikipedia.org/wiki/McLaren_Racing","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Stefan_Johansson_2007_%28crop%29.JPG","page_title":"McLaren Racing","context_page_description":"McLaren Racing ist ein britisches Motorsport-Rennteam, das 2020 in der Formel-1-Weltmeisterschaft antritt. Das gegenwärtig in Woking ansässige Team ist ein Teil der McLaren Group. Der Rennstall wurde 1965 von dem neuseeländischen Automobilrennfahrer Bruce McLaren gegründet und ist nach der Scuderia Ferrari am längsten in der Formel 1 vertreten. Weitere Betätigungsfelder des Teams, das anfänglich Bruce McLaren Motor Racing hieß, waren in den ersten Jahren die nordamerikanischen CanAm- und Champ-Car-Serien. Hier gewannen Autos von McLaren dreimal die Indianapolis 500. Seit den 1970er-Jahren beschränkt sich das Team auf die Formel 1.\\nMcLaren ist nach Ferrari das erfolgreichste Team der Formel-1-Geschichte. Bis heute ist McLaren der einzige Konstrukteur von Renn- und Straßenfahrzeugen, der sowohl beim Großen Preis von Monaco, dem 500-Meilen-Rennen von Indianapolis als auch beim 24-Stunden-Rennen von Le Mans als Sieger geführt wird. Dazu kommen Gesamtsiege in der Formel-1- und ChampCar-Meisterschaft. In diesem Zusammenhang wird in der Fachliteratur auch der fiktive Titel Grand Slam des Motorsports angewandt."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%9F%B3%E9%BC%93%E6%B4%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Shekkwuchau.png","page_title":"石鼓洲","context_page_description":"石鼓洲是一个香港岛屿，地区行政上属于离岛区。位于大屿山芝麻湾半岛以南，茶果洲以东，长洲以西。"},{"page_url":"https://fr.wikipedia.org/wiki/Susan_Ebrahimi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Susan_Ebrahimi.jpg","page_title":"Susan Ebrahimi","context_page_description":"Susan Ebrahimi est une chanteuse allemande."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A6%99%E8%9C%9C%E6%B9%96%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Xiangmihu_station_20130917.JPG","page_title":"香蜜湖站","context_page_description":"香蜜湖站是深圳地鐵1號綫的一個車站，位於中國廣東省深圳市福田區香梅路西側與香蜜湖度假村出口之間的深南大道北側綠地地下，大致沿深南大道布置。西北面是香蜜湖度假村，南面隔著深南大道是高爾夫球場。本站臨近「香蜜湖度假村」而得名。車站設計以白色為主。\\n香蜜湖車站採用明挖順作法施工，於2004年12月28日隨1號線第一期工程的落成而啟用。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_windmolens_in_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Oud-Vossemeer_molen_De_Jager.jpg","page_title":"Lijst van windmolens in Nederland","context_page_description":"In Nederland staan circa 1170 windmolens, waarvan er vele maalvaardig zijn. De beroemdste molenlocatie is Kinderdijk, waar de meeste windmolens in een klein gebied te vinden zijn; dit zijn poldermolens. Ook de Zaanse Schans heeft diverse molens, evenals de gemeente Alblasserwaard en het gebied tussen Alphen aan den Rijn en Leiden. In Leiden zelf zijn negen molens. De Schiedamse molens behoren tot de hoogste ter wereld.\\nWindmolens waarop de blauwe wimpel wappert, zijn op dat moment in ieder geval te bezoeken. Vaak kunnen ook draaiende molens zonder blauwe wimpel bezocht worden."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E5%8C%97%E8%88%AA%E7%A9%BA85%E5%8F%B7%E7%8F%AD%E6%9C%BA%E4%BA%8B%E6%95%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Northwest_Airlines_Boeing_747-451_%28N661US_23719_696%29_%286853201992%29.jpg","page_title":"西北航空85号班机事故","context_page_description":"西北航空85号班机是美国西北航空公司的一班由底特律国际机场起飞，前往东京成田国际机场的定期班机，于2002年10月9日在飞越白令海峡时发生机件故障，飞机返航并在2小时后紧急降落在阿拉斯加安克雷奇国际机场，机上人员无人受伤。"},{"page_url":"https://cs.wikipedia.org/wiki/Opakovac%C3%AD_pu%C5%A1ka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Mannlicher_Gewehr.jpg","page_title":"Opakovací puška","context_page_description":"Opakovací puška je ruční dlouhá opakovací zbraň umožňující střelbu pouze jednotlivými ranami, vybavená zásobníkem nebo nábojovou schránkou na několik nábojů a s ručně ovládaným závěrem.\\nVětšina opakovacích pušek jsou palné zbraně. Existují i opakovací větrovky a vzduchovky. Příkladem větrovky, která byla omezeně nasazena i v armádním použití, je rakouská vojenská opakovací větrovka Girandoni vzor 1779. Vynálezce nejběžnějšího typu opakovací pušky byl Walter Hunt, který tuto zbraň sestrojil v roce 1848.\\nOpakovací pušky používající jednotný kovový náboj se střelným prachem se objevují ve výzbroji armád evropských států v osmdesátých letech 19. století a s minimálními úpravami tvořily hlavní pěchotní výzbroj i v průběhu první a druhé světové války. Po druhé světové válce dochází k jejich nahrazování samonabíjecími puškami a útočnými puškami."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%A6%99%E6%B8%AF%E8%B6%B3%E7%90%83%E5%8F%B2%E5%AD%B8%E6%9C%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Hong_Kong_Football_History_Society%2C_2015.jpg","page_title":"香港足球史學會","context_page_description":"香港足球史学会是香港一个学术研究组织，成立于2015年，由一群热心研究香港足球人士组成现任会长是伍国峰。"},{"page_url":"https://en.wikipedia.org/wiki/1932_Democratic_National_Convention","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Franklin_D._Roosevelt_-_NARA_-_197120_%28cropped%29.jpg","page_title":"1932 Democratic National Convention","context_page_description":"The 1932 Democratic National Convention was held in Chicago, Illinois June 27 – July 2, 1932. The convention resulted in the nomination of Governor Franklin D. Roosevelt of New York for president and Speaker of the House John N. Garner from Texas for vice president. Beulah Rebecca Hooks Hannah Tingley was a member of the Democratic National Committee and Chair of the Democratic Party of Florida. She seconded the nomination of Franklin Delano Roosevelt, becoming the second woman to address a Democratic National Convention."},{"page_url":"https://sv.wikipedia.org/wiki/P%C3%A5_havet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Albert_Gustav_Aristides_Edelfelt_001.jpg","page_title":"På havet","context_page_description":"På havet är en oljemålning av den finländske konstnären Albert Edelfelt från 1883. Den är utställd på Göteborgs konstmuseum.\\nEdelfelt började sin målarbana som historiemålare men gick i slutet av 1870-talet över till att måla realistiska samhällsskildringar och friluftsmåleri. När han sommaren 1879 för första gången kom till Haiko gård utanför Borgå blev han genast fångad av den nyländska skärgårdens natur och människor. Ett barns likfärd från 1879 var ett tidigt verk från denna miljö. Edelfelt återkom till Haiko hela sitt liv och 1883 byggde han en ateljé där som nu är ett museum, Albert Edelfelts ateljémuseum\\nPå havet är realistisk i sitt utförande och alla föremålen i båten är noggrant återgivna. Eftersom bilden är skuren så att endast aktern på båten syns kan betraktaren få känslan att själv vara ombord i båtens för. Man kan förstå utifrån den grå färgskalan och molnen som tornar upp sig i bakgrunden att det kommer att bli en hård seglats.\\nMålningen föregicks av flera studier och skisser, en mindre skiss i olja från samma år ägs av Göteborgs konstmuseum."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D1%80%D0%BA%D0%B0%D0%BB%D0%BE%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/%D0%94%D0%B5%D1%80._%D0%92%D0%B0%D1%80%D0%BA%D0%B0%D0%BB%D0%BE%D0%B2%D0%BE.jpg","page_title":"Варкалово","context_page_description":"Ва́ркалово — деревня в составе Кузьмоловского городского поселения Всеволожского района Ленинградской области."},{"page_url":"https://it.wikipedia.org/wiki/Mescolanza_razziale","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/FranzBoas.jpg","page_title":"Mescolanza razziale","context_page_description":"Il termine miscegenazione, ovvero mescolanza etnica, si diffuse nel corso del XIX secolo per riferirsi agli incroci di diverse cosiddette \\"etnie umane\\", soprattutto in considerazione del colore della pelle umana e del presupposto che voleva l'esistenza di etnie ben distinte riferibili alla specie umana.\\n\\"Miscegenazione\\" o mescolanza genetica deriva da miscuglio è stato considerato come il mescolamento di diversi gruppi etnici attraverso il matrimonio, la convivenza, le relazioni sessuali o la procreazione. A causa dell'utilizzazione storica del termine in contesti generalmente implicanti una forte disapprovazione, parole più neutrali come interrazziale, interetnico o transculturale si rivelano essere più comuni nell'uso contemporaneo.\\nIl termine, soprattutto nei paesi anglosassoni, dove viene indicato come miscegenation, venne utilizzato fin dal XIX secolo per riferirsi al matrimonio interetnico e alle relazioni sessuali interetnici e, più in generale, al processo di \\"commistione genetica\\". Storicamente fu utilizzato nel contesto delle leggi contro la mescolanza razziale che vietarono il matrimonio e il rapporto sessuale interrazziale."},{"page_url":"https://tr.wikipedia.org/wiki/Be%C5%9Fikta%C5%9F_(futbol_tak%C4%B1m%C4%B1)_2016-17_sezonu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Eagle_sculpture.jpg","page_title":"Beşiktaş (futbol takımı) 2016-17 sezonu","context_page_description":"Beşiktaş (futbol takımı) 2016-17 sezonu, Beşiktaş'ın kuruluşundan itibaren 113. sezonu, ulusal ligdeki 59. sezonudur. 2015-16 sezonunu lig şampiyonu olarak bitiren takım Süper Lig'de mücadele etmektedir. Şampiyonlar Ligi'ne gruplardan katılmıştır."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9D%D0%B5%D1%87%D0%B0%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Nechako_River.jpg","page_title":"Нечако","context_page_description":"Нечако, Канада өзені, Британ Колумбиясы орталығы. Ірі саласы Фрейзер өзеніне құяды, шығысқа қарай ұзындығы 240 км. Стюарт саласы Форт-Фрайзер және Принс-Джордж арасында құлап ағады. Канада ұлттық темір жолын бойлап ағады. 1952ж. Кенней бөгетінен асып өтті, пайда болған су қоймасы электроэнергия береді."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%8A%D9%84%D8%AF%D8%A7_%D8%B1%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Ram_Hilda_%28Mathilda_Ramboux%29.jpg","page_title":"هيلدا رام","context_page_description":"هيلدا رام هي كاتِبة وشاعرة بلجيكية، ولدت في 31 أكتوبر 1858 في أنتويرب في بلجيكا، وتوفي بنفس المكان في 12 يوليو 1901."},{"page_url":"https://fr.wikipedia.org/wiki/Henri_Rendu_(m%C3%A9decin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Henri_Rendu.jpg","page_title":"Henri Rendu (médecin)","context_page_description":"Henri Jules Louis Marie Rendu est un médecin français né le 24 juillet 1844 à Paris 10e, mort le 16 avril 1902 à Paris 7e. Il a laissé son nom à la maladie de Rendu-Osler."},{"page_url":"https://pl.wikipedia.org/wiki/Vermelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Vermelles%2C_France.-_Eglise_saint_Pierre_%281%29.jpg","page_title":"Vermelles","context_page_description":"Vermelles – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Pas-de-Calais.\\nWedług danych na rok 1990 gminę zamieszkiwały 4584 osoby, a gęstość zaludnienia wynosiła 441 osób/km²."},{"page_url":"https://de.wikipedia.org/wiki/Lajos_Kossuth","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Kossuth_Husaren.jpg","page_title":"Lajos Kossuth","context_page_description":"Lajos Kossuth de Kossuth et Udvard war Rechtsanwalt, Politiker und in den Jahren 1848/49 einer der Anführer der Ungarischen Unabhängigkeitserhebung gegen Österreich. Auch nach der Niederschlagung der Revolution setzte er sich im Exil bis zu seinem Tod für die Unabhängigkeit Ungarns vom Kaisertum Österreich ein. Bis in die Gegenwart gilt Kossuth als ungarischer Nationalheld."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%84%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Surfing_in_Hawaii%2B50_saturation.jpg","page_title":"تلون","context_page_description":"إن مفاهيم التلون ‏ والصفاء اللوني والإشباع اللوني في قياس الألوان ونظرية اللون متعلقة ببعضها البعض، ولكن هذه المفاهيم تشير إلى الشدة المدركة للون محدد. التلون هو الفرق بين اللون مقارنة باللون الرمادي. والصفاء اللوني هي الفرق بين اللون مقارنة بسطوع لون آخر يظهر لونه أبيضا تحت ظروف المشاهدة المشابهة. الإشباع هو الفرق بين اللون مقارنة بسطوعه. ومع أن هذا المفهوم العام هو مفهوم بديهي، إلا أن المصطلحات مثل \\"الصفاء: chroma\\"، و\\"الإشباع: saturation\\"، و\\"النقاء: purity\\"، و\\"الشدة: intensity\\" تستخدم غالبا بدون دقة كبيرة حتى عندما تعرّف جيدا بالاعتماد على النموذج اللوني المستخدم.\\nفالمحفزات المتلونة جدا تكون زاهية وحادة في حين تظهر المحفزات الأقل تلونا خافتة وأقرب إلى الرمادي. وبدون تلون يكون اللون حياديا ورماديا. ويمكن وصف أي لون باستخدام ثلاثة صفات مثل التلون، والإضاءة، والصبغة."},{"page_url":"https://en.wikipedia.org/wiki/Turbo_cailletii","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Turbo_cailletii_002.jpg","page_title":"Turbo cailletii","context_page_description":"Turbo cailletii, common name the filose turban, is a species of sea snail, a marine gastropod mollusk in the family Turbinidae, the turban snails."},{"page_url":"https://ms.wikipedia.org/wiki/Pertempuran_Gaugamela","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Battle_of_Gaugamela%2C_331_BC_-_Opening_movements.png","page_title":"Pertempuran Gaugamela","context_page_description":"Dalam Pertempuran Gaugamela in 331 BC Iskandar Agung dari Macedon mengalahkan Darius III dari Achaemenid Parsi. Pertempuran ini turut dikenalis sebagai Pertempuran Arbela. Pertempuran ini turut menggunakan gajah perang."},{"page_url":"https://lv.wikipedia.org/wiki/Ko%C5%A1ie_mu%C5%A1%C4%B7%C4%93r%C4%81ji","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Ultramarine_Flycatcher_Pangot_Uttarakhand_India_04.10.2014.jpg","page_title":"Košie mušķērāji","context_page_description":"Košie mušķērāji, košo mušķērāju ģints ir mušķērāju dzimtas ģints, kas apvieno 33 mūsdienās dzīvojošas dziedātājputnu sugas. Tie ir Vecās Pasaules putni, kas sastopami Eirāzijā, Āfrikā un vairākās okeānu salās. Daļa sugu ir izteikti gājputni, daļa nometnieki.\\nĢints zinātniskais nosaukums Ficedula atvasināts no latīņu valodas un latviski nozīmē \\"neliels, vīģes ēdošs putniņš\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A6%D0%B8%D0%B2%D1%96%D0%BB%D1%96%D0%B7%D0%B0%D1%86%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Arthur_de_Gobineau.jpg","page_title":"Цивілізація","context_page_description":"Цивіліза́ція — людська спільнота, яка впродовж певного періоду часу має стійкі особливі риси в соціально-політичній організації, економіці та культурі, спільні духовні цінності та ідеали, ментальність.\\nНаприклад, Єгипетській цивілізації властиві спорудження пірамід, муміфікація померлих, своєрідне ієрогліфічне письмо тощо. Інколи в одну цивілізацію об'єднують людей однакової віри.\\nЦивілізація — такий щабель розвитку людства, коли власні соціальні зв'язки починають домінувати над природними, і коли суспільство починає розвиватися і функціонувати на своєму власному ґрунті.\\nПоняття цивілізація введене у науковий словник французьким просвітником Оноре Габріелем Мірабо 1756 року. Під цим визначенням французькі просвітники мали на увазі суспільство, засноване на засадах розуму та справедливості."},{"page_url":"https://de.wikipedia.org/wiki/Luftangriffe_auf_Chemnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Chemnitz_Jakobikirche_Kirchenmodelle.jpg","page_title":"Luftangriffe auf Chemnitz","context_page_description":"Die Luftangriffe auf Chemnitz während des Zweiten Weltkrieges fügten der sächsischen Industriestadt Chemnitz schwere Schäden zu. Vom 6. Februar bis zum 11. April 1945 flogen Einheiten von Royal Air Force und United States Army Air Forces insgesamt zehn Luftangriffe auf die Großstadt am Nordrand des Erzgebirges. Daran beteiligt waren 2.880 schwere viermotorige Bombenflugzeuge, welche über 7.700 Tonnen Sprengmittel und Brandsätze abwarfen. Davon entstammten etwa 55 % dem Bomber Command der britischen RAF und der Kanadischen RCAF, sowie 45 % der 8th Air Force. Im Chemnitzer Stadtgebiet kamen dabei wohl 4.000 Menschen ums Leben, davon 2.100 allein in der Nacht vom 5. auf den 6. März 1945.\\nDie Innenstadt wurde zu 80 % vernichtet. 27.000 Wohnungen, 167 Fabriken, 84 öffentliche Gebäude und zahlreiche Kulturbauten im Stadtgebiet waren völlig zerstört. Von den Alliierten wurde Chemnitz als „weitere tote Stadt“ abgeschrieben."},{"page_url":"https://nl.wikipedia.org/wiki/Vandalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Heinrich_Leutemann%2C_Pl%C3%BCnderung_Roms_durch_die_Vandalen_%28c._1860%E2%80%931880%29.jpg","page_title":"Vandalen","context_page_description":"De Vandalen waren een Oost-Germaanse stam die in 429 n.Chr. onder leiding van koning Geiserik Afrika binnentrok. Tegen 439 n.Chr. hadden ze in Noord-Afrika een koninkrijk gesticht met als kern de voormalige Romeinse provincie Africa met de hoofdstad Carthago. Later kwamen daar als aanvullende veroveringen nog Sicilië, Corsica, Sardinië, Malta en de Balearen bij. In 455 plunderden ze de stad Rome. Hun koninkrijk stortte ineen in de Vandaalse oorlog, toen keizer Justinianus I de provincie Africa wist terug te veroveren op de Vandalen voor het Oost-Romeinse rijk."},{"page_url":"https://ca.wikipedia.org/wiki/Zine_El_Abidine_Ben_Ali","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Zine_El_Abidine_Ben_Ali.jpg","page_title":"Zine El Abidine Ben Ali","context_page_description":"Zine El Abidine Ben Ali va ser un polític tunisià, president de Tunísia entre el 7 de novembre de 1987 i el 14 de gener de 2011, quan va ser deposat per la Primavera Àrab.\\nDesprés d'estudiar enginyeria electrònica, va dedicar els seus esforços a la carrera militar, rebent formació a l'acadèmia militar francesa de Saint-Cyr i més tard, la Senior Intelligence School de Fort Holabird dels Estats Units, i acabà sent nomenat Director General de Seguretat el 1958. Durant els conflictes dels anys 70 amb els sindicats, va ser qui va dirigir les actuacions militars del govern en la repressió. Va ser ambaixador a Polònia, ministre i primer ministre amb Habib Burguiba, el qual va deposar en un cop d'estat el 1987, assumint la presidència del país el 7 de novembre i governant de forma dictatorial durant 24 anys.\\nVa ser reelegit per última vegada el 25 d'octubre del 2009 obtenint el 89,62% dels sufragis, en unes eleccions amb tots els partits d'esquerra i islàmics prohibits."},{"page_url":"https://sv.wikipedia.org/wiki/Thaddeus_H._Caraway","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bb/Thaddeus_H._Caraway.jpg","page_title":"Thaddeus H. Caraway","context_page_description":"Thaddeus \\"Thad\\" Horatius Caraway, född 17 oktober 1871 i Stoddard County, Missouri, död 6 november 1931 i Little Rock, Arkansas, var en amerikansk demokratisk politiker. Han representerade Arkansas i båda kamrarna av USA:s kongress mellan 1913 och 1931, först som kongressledamot, sedan som senator.\\nCaraway flyttade 1883 till Arkansas med sina föräldrar. Han utexaminerades 1896 från Dickson College i Tennessee. Han studerade därefter juridik och inledde 1900 sin karriär som advokat i Arkansas. Han gifte sig 1902 med Hattie Ophelia Wyatt.\\nCaraway arbetade 1908-1912 som åklagare. Han representerade Arkansas 1:a distrikt i USA:s representanthus 1913-1921. Han var därefter ledamot av USA:s senat fram till sin död. Guvernör Harvey Parnell utnämnde änkan Hattie till senaten efter Thaddeus H. Caraways död. Hattie Caraway var senator 1931-1945. Före henne hade bara en kvinna, Rebecca Latimer Felton, blivit utnämnd till USA:s senat och bara för en dag som en symbolisk gest.\\nCaraways grav finns på West Lawn Cemetery i Jonesboro, Arkansas."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%E1%BA%A1o_%C4%91%E1%BB%A9c_v%E1%BB%9Bi_vi%E1%BB%87c_%C4%83n_th%E1%BB%8Bt","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Spatchcocking.jpg","page_title":"Đạo đức với việc ăn thịt","context_page_description":"Đạo đức với việc ăn thịt động vật là chủ đề tranh cãi chưa có hồi kết về vấn đề đạo đức và việc ăn thịt động vật, và vấn đề có đạo đức hay không khi con người ta ăn thịt các loài động vật trên cơ sở giết mổ chúng, có nghĩa là tước đi mạng sống của các loài vật để có thức ăn cho con người. Ở hầu hết các xã hội, đa số người dân sẽ ăn thịt khi họ có thể ăn được, nhưng ngày càng có nhiều tranh luận và đàm luận về đạo đức ăn thịt. Phe phản đối nhất đối với việc ăn thịt là đối với hầu hết mọi người sống ở các nước phát triển cho rằng không cần thiết phải như vậy vì sự sống còn hoặc sức khoẻ, việc giết mổ động vật chỉ vì người ta thưởng thức hương vị thịt được một số người cho là sai lầm và không hợp lý về mặt đạo đức.\\nNgười ăn chay có đạo đức và những người ăn chay theo chủ nghĩa thuần chay cũng có thể phản đối những thực trạng từ các cơ sở sản xuất thịt hoặc trích dẫn những quan ngại của họ về phúc lợi động vật, quyền của động vật, đạo đức môi trường, và lý do tôn giáo. Để đáp lại, một số người ủng hộ việc ăn thịt đã đưa ra nhiều lập luận khoa học, dinh dưỡng, văn hoá và tôn giáo khác nhau để hỗ trợ cho lý thuyết ăn thịt là cần thiết."},{"page_url":"https://de.wikipedia.org/wiki/Bismarckturm_(Bad_Godesberg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/20170316_Godesberg_01.jpg","page_title":"Bismarckturm (Bad Godesberg)","context_page_description":"Der Bismarckturm in Bad Godesberg wurde als dritter Bismarckturm auf dem heutigen Gebiet der Stadt Bonn errichtet. Die noch existierende Bismarcksäule in der Rheinaue in Bonn-Gronau war bereits im Jahr 1901 fertiggestellt, und der hölzerne Bismarckturm auf dem Venusberg in Bonn-Kessenich schon 1894 eingeweiht worden; der Holzturm musste 1912 abgerissen werden und wurde später nicht wieder aufgebaut. Der Godesberger Bismarckturm befindet sich auf der Wacholderhöhe an der Elisabethstraße im Ortsteil Alt-Godesberg. Der Turm steht unter Denkmalschutz, die Eintragung erfolgte 1988 mit der Anmerkung, dass das Bauwerk deutlich von der Jugendstil-Architektur von Henry van de Velde beeinflusst worden sei."},{"page_url":"https://en.wikipedia.org/wiki/Rock_City,_Kansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Rockcityks.JPG","page_title":"Rock City, Kansas","context_page_description":"Rock City is a park located on hillsides overlooking the Solomon River in Ottawa County, Kansas. It is 3.6 miles south of Minneapolis, Kansas and just over 0.5 mile west of Kansas highway K-106 and the Minneapolis City County Airport on Ivy Road. In a patch of prairie about 500 meters long and 40 meters wide, Rock City contains three clusters of large spherical boulders. These three clusters contain a total of 200 spherical boulders. It has been designated as a National Natural Landmark.\\nThe park, owned by a non-profit corporation, has a visitor center and picnic tables. A small admission fee, which is used to maintain this park, is charged.\\nThe remarkable size and spherical shape of these rock formation was first noted by Bell. Later, these boulders were either noted or described by Gould, Landes, Shaffer, Ward, and Swineford. Shaffer was the first person to map the distribution of these boulders at Rock City and investigate their petrography in detail."},{"page_url":"https://no.wikipedia.org/wiki/Smith_%26_Wesson_Model_500","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Model5006.JPG","page_title":"Smith & Wesson Model 500","context_page_description":"Smith & Wesson Model 500 er en femskudds revolver produsert av Smith & Wesson, kamret i kaliber .500 S&W Magnum.\\nVåpenet er bygget på S&W største ramme, X-rammen. Revolveren er påstått å være verdens mest kraftige serieproduserte revolver da den ble introdusert. I 2008 kom Politidirektoratet i Norge med forbud mot revolvere i kaliber over .455, noe som da gjelder denne revolveren. Forbudet kom med bakgrunn at det er uønsket med slike kraftige håndvåpen blant kriminelle, og at det påstås at det er en viss lekkasje av våpen til det illegale markedet fra private våpeneiere. Ca. 100 slike revolvere er solgt i Norge før forbudet kom."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%A8%D9%88_%D8%A7%D9%84%D8%AD%D8%B3%D9%86_%D8%A8%D9%86%D9%8A_%D8%B5%D8%AF%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Abol-Hassan_Banisadr%2C_Venise%2C_septembre_2009_2.jpg","page_title":"أبو الحسن بني صدر","context_page_description":"أبو الحسن بني صدر من مواليد 22 مارس 1933، كان أول رئيس لإيران بعد الثورة الإيرانية سنة 1979، التي انتصرت وأنهت الحكم الملكي.\\nكان أبو الحسن بني صدر شيعيا اثني عشريا ولد في همدان الإيرانية، تولّى مؤقتاً منصب وزير الشئون الخارجية في إيران من 12 نوفمبر 1979 بعد إبراهيم يزدي وتلاه في هذا المنصب صادق قطب زاده.\\nتولّى رئاسة الجمهورية الإيرانية في 4 فبراير 1980 حتى 21 يونيو 1981 ليليه في هذا المنصب محمد علي رجائي."},{"page_url":"https://vi.wikipedia.org/wiki/Catherine_de_M%C3%A9dicis","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Catherine-de-medici.jpg","page_title":"Catherine de Médicis","context_page_description":"Catherine de' Medici, là một nữ quý tộc người Ý và trở thành Vương hậu nước Pháp từ năm 1547 đến năm 1559, với tư cách là vợ của Quốc vương Henri II của Pháp. Bà là mẹ của 3 vị Quốc vương liên tiếp kế vị nước Pháp: François II của Pháp; Charles IX của Pháp và Henri III của Pháp. Ngoài ra, bà còn là mẹ của Élisabeth de Valois, Vương hậu Tây Ban Nha, vợ của Felipe II cùng vị Vương hậu nổi tiếng của Pháp, Marguerite de Valois.\\nNăm 1533, ở tuổi 14 Caterina kết hôn với Henri II, con trai thứ hai của Quốc vương nước Pháp François I và Vương hậu Claude, nhằm giúp phát triển quyền lợi của người bác của bà, Giáo hoàng Clêmentê VII. Năm 1547, Henri II đăng quang, với tên tiếng Pháp \\"Catherine de Médicis\\", Caterina trở thành Vương hậu nước Pháp. Tuy vậy, suốt thời gian trị vì, Henri II loại bỏ ảnh hưởng của Catherine và dành sự ưu ái cho Diane de Poitiers, tình nhân của nhà vua. Sau khi Henri II tử nạn năm 1559, Catherine đột ngột bị cuốn vào chính trường, trở thành nhiếp chính của tân vương mới 15 tuổi, François II. François II chết sau 1 năm trị vì, Catherine trở nên nhiếp chính đầy quyền lực cho con trai 10 tuổi của bà, Charles IX."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%91%AA%E9%9B%85%E6%96%87%E6%98%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Zacuelu2.jpg","page_title":"瑪雅文明","context_page_description":"馬雅文明是中部美洲古文明，主要分布於墨西哥東南部、瓜地馬拉、貝里斯、宏都拉斯和薩爾瓦多西部地區，以馬雅人而得名。其分布區域大致分為三部分：北部的低地，包括猶加敦半島在內；中部的高地，分布有恰帕斯馬德雷山脈；南部的太平洋海岸平原。馬雅文明的技術基本處於新石器時代和銅石並用時代的水平，但卻在天文學、曆法、數學、藝術、建築及文字等方面有極高成就。\\n馬雅文明最早形成於約公元前2000年之前，在那時，農業得到最初發展，出現了早期聚落。根據中部美洲斷代史的劃分，馬雅文明在前古典期發展出最早的複雜社會，出現定居的農業生活，玉米、豆類、南瓜和辣椒是其主要作物。前750年前後，出現早期的城市，至前500年已經建成祭祀建築，建起外牆經精心粉刷的大型神廟；前3世紀出現象形文字系統。到前古典期晚期，佩滕盆地和瓜地馬拉高地上已建立起多個大型城市。馬雅文明在古典期步入繁盛，各地較大規模的居民點數以百計，部分城市形成城邦，其間以複雜的貿易網相聯繫，北部低地的提卡爾和卡拉克穆爾城邦逐漸崛起。不過，分布於今墨西哥中部的特奧蒂瓦坎文明也在此時期對馬雅城邦展開侵略。9世紀，馬雅文明的中部地區突然出現集體性的政治崩潰，是為古典期衰落，引發連年內亂，大量城市陷入廢棄，人口開始北移。到後古典期，來自墨西哥腹地的托爾特克人征服了馬雅地區北部的猶加敦半島，建立起強大的奇琴伊察城邦，後又有好戰的馬雅潘和基切王國建立霸權統治，好戰之風導致戰亂頻仍，馬雅文化趨於衰敗。16世紀，西班牙殖民帝國征服中部美洲，逐步征服馬雅各邦，1697年，最後一個馬雅城邦諾赫佩滕陷落，馬雅文明就此滅亡。\\n在馬雅文明興盛的古典期，各城邦的領袖稱為「聖主」，聯繫人神兩界，地位世襲，長子是首要繼承人；王位的有力候選人通常善於作戰。馬雅城邦政治架構主要為互相制約的緊密體系，不過具體情況依不同城邦而有所分別。到古典時代晚期，貴族影響力加大，聖主不再大權獨攬。馬雅城市大多沒有規則的發展方式，城市中心既是祭祀中心，亦為行政中心，周圍被不規則的居民區包圍。城市的不同區域由路網連接。城市的主要建築包括宮殿、金字塔寺廟、蹴球場和天文觀測台等。馬雅文明發展出了高度複雜的藝術形式，廣泛運用各種工藝原料，如木材、玉石、黑曜石、陶器和石碑等。馬雅精英富於涵養，其創製的象形文字體系馬雅文字是前哥倫布時代美洲唯一成熟的書寫系統，常見於石碑和陶器。馬雅人主要使用折頁書本記錄其歷史和文化，稱為馬雅手抄本，但大部分書籍都被西班牙人摧毀，現存且不具有爭議的馬雅書面史料僅餘三冊。馬雅人發展出了高度精密的曆法系統，且在數學領域也有較高造詣，先於歐洲人引入「零」的概念。\\n18世紀末，馬雅文明開始得到傳統學術界注意，19世紀末，一批重要遺址得到發掘，馬雅文明的現代考古學研究拉開序幕。到20世紀30年代以後，馬雅文明的研究進展較快，形成專門的馬雅學學科。"},{"page_url":"https://es.wikipedia.org/wiki/Sierra_Fr%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Ca%C3%B1ada_lluviosa_en_Sierra_Fr%C3%ADa_-_panoramio.jpg","page_title":"Sierra Fría","context_page_description":"Sierra fría está ubicada al norponiente del estado mexicano de Aguascalientes, dentro de los municipios de San José de Gracia, Calvillo, Rincón de Romos, Jesús María y Pabellón de Arteaga. Parte de la Sierra Madre Occidental; comprende una extensión de 112,090 hectáreas de sierra y bosques atravesados por la carretera escénica La Congoja - El Temazcal, donde destacan las especies de pino, encino, cedro, madroño, fresno, entre otras. Aquí se localiza el cerro de la Ardilla, el de mayor elevación sobre el nivel del mar con una altura de 3,050 metros. La fauna predominante es venado de cola blanca, puma, jabalí de collar, gato montés, cacomite, zorra gris, águila real, halcón peregrino, codorniz de Moctezuma, camaleón y cascabel.\\nLas actividades que se pueden realizar son: campismo, excursionismo, caminatas guiadas por senderos interpretativos, observación de flora y fauna, paseos a burro, ciclismo de montaña y pesca deportiva-recreativa y cinegética."},{"page_url":"https://cs.wikipedia.org/wiki/Jo%C5%BEe_Ple%C4%8Dnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Praha%2C_m%C3%ADsa_v_Rajsk%C3%A9_zahrad%C4%9B_Hradu_%288%29.jpg","page_title":"Jože Plečnik","context_page_description":"Jože Plečnik, v Česku známý spíše jako Josip Plečnik, byl slovinský architekt a urbanista, který svou prací ve 20. a 30. letech 20. století pro československou prezidentskou kancelář významně přispěl k současnému vzhledu Pražského hradu."},{"page_url":"https://lt.wikipedia.org/wiki/Bir%C5%A1tonas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/J._Mar%C4%8Diukaitis._Bir%C5%A1tonas%2C_1930-.jpg","page_title":"Birštonas","context_page_description":"Birštonas – kurortinis miestas Lietuvos pietuose, Kauno apskrityje. Birštono savivaldybės, dekanato ir parapijos centras.\\nTai balneologinis ir purvo terapijos kurortas, išgaunami mineraliniai vandenys. Mieste stovi Birštono Šv. Antano Paduviečio bažnyčia, stūkso Vytauto kalnas, Dainų kalnelis, trys sanatorijos, žirgynas, olimpinis irklavimo centras. Didžiausia įmonė – „Birštono mineraliniai vandenys“. Mieste veikia Birštono gimnazija, viešoji biblioteka. Kairiajame Nemuno krante, Alksniakiemio šilo pakraštyje, įrengtas takas stalinizmo aukoms atminti."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%84%B8%EB%A8%B8%EC%9C%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/%ED%84%B8%EB%A8%B8%EC%9C%84.JPG","page_title":"털머위","context_page_description":"털머위는 국화과의 늘푸른 여러해살이풀이다."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%B0%8F%E5%B4%8E%E6%86%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Ken-Kozaki20101010.jpg","page_title":"小崎憲","context_page_description":"小崎 憲は日本中央競馬会 ・栗東トレーニングセンターに所属している調教師。愛知県豊明市出身。星城高等学校卒。"},{"page_url":"https://cs.wikipedia.org/wiki/Michle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Michle_a_Vr%C5%A1ovice_z_Tyr%C5%A1ova_vrchu_na_sever.jpg","page_title":"Michle","context_page_description":"Michle je čtvrť a katastrální území v Praze, jihovýchodně od centra, s jádrem v údolí Botiče a zahrnující i Kačerovský vrch s okolím. Převažující část patří do městské části Praha 4, pouze východní část vrchu Bohdalce a michelská část Slatin patří do Prahy 10. Vymezení Michle jako katastrálního území se nepatrně liší od vymezení Michle jako části obce."},{"page_url":"https://ms.wikipedia.org/wiki/Toei_Animation","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/TOEI_ANIMATION_Oizumi_Studio.JPG","page_title":"Toei Animation","context_page_description":"Toei Animation Co., Ltd., dirujuk sebagai Toei Animation, ialah studio animasi Jepun dimiliki oleh Toei Company. Ia telah menerbitkan beberapa siri animasi, termasuk Sally the Witch, Gegege no Kitaro, Mazinger Z, Galaxy Express 999. Dr. Slump, Dragon Ball, Saint Seiya, Sailor Moon, Slam Dunk, Digimon, One Piece and the Precure series."},{"page_url":"https://id.wikipedia.org/wiki/Sejarah_Ordo_Bait_Allah","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/50/JacquesdeMolay.jpg","page_title":"Sejarah Ordo Bait Allah","context_page_description":"Sejarah Ordo Bait Allah meliputi waktu sepanjang dua abad selama Abad Pertengahan, semenjak berdirinya Ordo Bait Allah di awal abad ke-12 hingga dibubarkannya ordo ini di awal abad ke-14."},{"page_url":"https://it.wikipedia.org/wiki/TI-Nspire","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/TI-Nspire.jpg","page_title":"TI-Nspire","context_page_description":"TI-Nspire è una famiglia di prodotti creati da Texas Instruments e in commercio a partire dalla primavera del 2007.\\nÈ composta da:\\nTI-Nspire CAS Palmare: Calcolatrice grafica simbolica con sistema CAS, chiamata anche palmare viste le caratteristiche hardware.\\nTI-Nspire Palmare: Calcolatrice grafica senza sistema CAS e possibilità di sostituire il tastierino con un layout semplificato derivato dai modelli TI-83 e TI-84 per renderla utilizzabile in determinate tipologie di esami secondo i regolamenti scolastici Stati Uniti d'America.\\nTI-Nspire CAS Software: Software per Windows"},{"page_url":"https://sv.wikipedia.org/wiki/Noiseau","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Map_commune_FR_insee_code_94053.png","page_title":"Noiseau","context_page_description":"Noiseau är en kommun i departementet Val-de-Marne i regionen Île-de-France i norra Frankrike. Kommunen ligger i kantonen Ormesson-sur-Marne som tillhör arrondissementet Nogent-sur-Marne. År 2009 hade Noiseau 4 662 invånare."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D0%BE%D0%BB%D1%8C%D1%8F%D0%BD%D0%B8%D0%BD%D0%BE%D0%B2,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/%D0%A1%D0%BB%D0%BE%D0%B2%D0%B0%D1%80%D1%8C_1916.jpg","page_title":"Обольянинов, Николай Александрович","context_page_description":"Николай Александрович Обольянинов — русский библиограф и библиофил, коллекционер, военный врач. Титулярный советник."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%BB%D0%B2%D0%B0_(%D0%9E%D0%BA%D0%BB%D0%B0%D1%85%D0%BE%D0%BC%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Alva_Intersection.jpg","page_title":"Алва (Оклахома)","context_page_description":"Алва град је у америчкој савезној држави Оклахома."},{"page_url":"https://en.wikipedia.org/wiki/The_National_Memorial_for_Peace_and_Justice","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Memorial_Corridor_at_The_National_Memorial_for_Peace_and_Justice.jpg","page_title":"The National Memorial for Peace and Justice","context_page_description":"The National Memorial for Peace and Justice, informally known as the National Lynching Memorial, is a national memorial to commemorate the victims of lynching in the United States. The memorial is intended to acknowledge past racial terrorism and advocate for social justice in America. Founded by the non-profit Equal Justice Initiative, it opened in downtown Montgomery, Alabama on April 26, 2018."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%86%D9%88%D8%B1%D9%88%DA%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/1730_Homann_Map_of_Scandinavia%2C_Norway%2C_Sweden%2C_Denmark%2C_Finland_and_the_Baltics_-_Geographicus_-_Scandinavia-homann-1730.jpg","page_title":"نوروژ","context_page_description":"نوروژ، یادا رسمی آدیلا نوروژ شاهلیغی، اوروپانین قوزئی‌ینده یئرلشن بیر اؤلکه دیر. نوروژ ۳۸۵٬۲۵۲ کیلومتیر مساحت ایله، ۵٬۳۶۷٬۵۸۰ نفر جمعیتی واردیر. بۇ اؤلکه دوغودان سوئدله قوزئی‌دوغودان ایسه روسیه و فنلاند ایله قونشودور."},{"page_url":"https://ms.wikipedia.org/wiki/Air_qamari","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Moon_South_Pole.jpg","page_title":"Air qamari","context_page_description":"Air qamari atau air bulan merujuk kepada jumlah kecil air yang mungkin hadir pada permukaan Bulan. Air qamari mungkin hadir di zon sejuk di kutub Bulan yang sentiasa dalam bayang dalam bentuk ais. Air tidak boleh wujud dalam bentuk cecair di Bulan, dan sebarang wap air akan segera hilang ke angkasa lepas.\\nPada November 2009, NASA akhirnya mengesahkan yang kuar angkasa lepasnya LCROSS telah mengesan jumlah nyata air dalam bahan yang terpancut akibat hentaman kapal angkasa itu di sebuah kawah kutub selatan.\\nAir ini mungkin terhasil daripada perlanggaran komet, asteroid dan meteor yang membawa air dengan Bulan atau melalui proses hentaman ion hidorogen dari angin suria dengan mineral beroksigen. Pencarian kehadiran air di kawasan-kawasan sejuk dan gelap telah menjadi perhatian beberapa misi qamari baru-baru ini."},{"page_url":"https://hu.wikipedia.org/wiki/Gare_de_Nogent-sur-Marne","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Gare_nogent_sur_marne_2009_01.JPG","page_title":"Gare de Nogent-sur-Marne","context_page_description":"Gare de Nogent-sur-Marne vasútállomás és RER állomás Franciaországban, Nogent-sur-Marne településen."},{"page_url":"https://fr.wikipedia.org/wiki/Tour_de_Suisse","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Ruzovy.jpg","page_title":"Tour de Suisse","context_page_description":"Le Tour de Suisse est une course à étapes inscrite au calendrier UCI World Tour ayant lieu annuellement en juin. Depuis sa création en 1933, la course a constamment évolué au niveau des parcours et des sponsors notamment. Elle est considérée au même titre que le Critérium du Dauphiné comme une préparation pour le Tour de France ayant lieu quelques semaines plus tard. En effet, comme ces derniers, le Tour de Suisse offre des étapes de haute montagne ainsi qu'un contre-la-montre individuel. De grands noms du Tour de France ont également remporté le Tour de Suisse comme Gino Bartali, Eddy Merckx, ou encore Jan Ullrich.\\nLe Tour de Suisse est organisé depuis son édition 2015 par l'entreprise InfrontRingier Sports & Entertainment, pour le compte de Swiss Cycling, propriétaire de la marque « Tour de Suisse ». InfrontRingier Sports & Entertainment a été fondée conjointement par le groupe de presse Ringier et la société de marketing sportif Infront Sports & Media en 2011.\\nL'édition 2020 est annulée en raison de la pandémie de maladie à coronavirus."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%A5%D5%B4%D5%AC%D5%AB%D5%B6%D5%A3%D5%A5%D5%B6_(%D5%86%D5%A5%D6%80%D6%84%D5%AB%D5%B6_%D5%96%D6%80%D5%A1%D5%B6%D5%AF%D5%B8%D5%B6%D5%AB%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Remlingen%2C_Am_Kies_7-001.jpg","page_title":"Ռեմլինգեն (Ներքին Ֆրանկոնիա)","context_page_description":"Ռեմլինգեն (Ներքին Ֆրանկոնիա), շուկայային համայնք Գերմանիայի Բավարիա երկրամասում։\\nԵնթարկվում է Ստորին Ֆրանկոնիա վարչական շրջանին։ Գտնվում է Վյուրցբուրգ շրջանի կազմում։ Բնակչությունը կազմում է 1498 մարդ ։ Տարածքը կազմում է 20,44 կմ²։ Պաշտոնական կոդ՝ 09 6 79 177։"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B1%D0%B5%D1%80%D0%BD%D0%B5_%D1%84%D1%80%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Cab_franc_leaf.JPG","page_title":"Каберне фран","context_page_description":"Каберне фран винова лоза је пореклом из Француске где се највише гаји, посебно у виноградарском региону Бордоа. Распрострањена је још у Шпанији, Португалији, Румунији и Украјини. У Србији се среће као пратилац сорте Каберне Совињон. Франциска је земља са убедљиво највећом површином под засадом Каберне франа око 15000 хектара. Позната је и под именима Carment, Cabonet, Gros cabernet, Petit fer и Veron."},{"page_url":"https://en.wikipedia.org/wiki/Diastolic_heart_murmur","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Phonocardiograms_from_normal_and_abnormal_heart_sounds.png","page_title":"Diastolic heart murmur","context_page_description":"Diastolic heart murmurs are heart murmurs heard during diastole, i.e. they start at or after S2 and end before or at S1. Many involve stenosis of the atrioventricular valves or regurgitation of the semilunar valves."},{"page_url":"https://de.wikipedia.org/wiki/Haukadalur","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/BlesiStrokkur.jpg","page_title":"Haukadalur","context_page_description":"Das Haukadalur ist ein Tal mit einem Hochtemperaturgebiet nördlich des Laugarvatn am Fuße des Berges Laugarfjall rund um das aktive Vulkansystem des Großen Geysirs. Es liegt auf dem Gemeindegebiet von Bláskógabyggð."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%B0%E7%81%A3%E4%BD%9B%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Lung-shan_temple-Taipei-Taiwan-P1010110.JPG","page_title":"台灣佛教","context_page_description":"台灣佛教的信仰人口約801.5萬人，佔2300萬人口的35%，其信仰人數可能與道教、儒教或其他台灣民間信仰，甚至與其他新興宗教有重疊的情況。據美國國務院民主、人權和勞工事務局發布的資料顯示，台灣有多達80%的人口信奉某種形式，摻雜有佛教信仰因素的傳統台灣民間信仰或台灣宗教。因此就廣義而言，在台灣佛教是最大宗教。其本質是中國佛教的分支與組成部分。\\n台灣佛教系統承襲自閩南地區，世俗化的信仰體系為其一大特色，與以出家僧侶為主的叢林體系並立。然而因戰後大陸傳入的佛教體系一枝獨秀，蓋過原有本土佛教勢力，使得原有的本土佛教體系常遭誤解，例如世俗體系部份就經常被誤認為「佛道混合」或「非正信」，但實際上世俗體系的發展未必違反佛教原教旨。\\n不過，從佛教以不同形式傳入台灣後，臺灣的佛教信徒，並沒有精確的統計。因此，統計改以觀察寺院增加數目、並透過台灣社會變遷歷次調查問卷中有關宗教項目的實際統計數字，來論斷其變革的趨勢。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%87%BA%E5%8D%97%E5%B8%82%E6%96%87%E5%8C%96%E8%B3%87%E7%94%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/%E5%9F%BA%E7%9D%A3%E6%95%99%E8%87%BA%E5%8D%97%E6%B5%B8%E4%BF%A1%E6%9C%83%E6%95%99%E5%A0%82.jpg","page_title":"臺南市文化資產","context_page_description":"台南市文化资产是位于台南市的各级古迹与历史建筑。原台南市可以说是台湾的历史名城，从1624年荷治时期建城至今已有将近四百年的历史，自17世纪作为台湾全岛首府长达200余年。在历经了荷治、明郑、清领与日治等时期的交织之后，每个时代都或多或少留下了一些建筑与文化物件。使台南成为文化资产最多的县市。\\n原台南市周围的地区，在清代台南成为台湾府城之后，先后成为台湾县、安平县等行政区，最后成为台南县，而在2010年12月25日，台南县市合并升格为直辖市，使这两个区域从此合而为一。"},{"page_url":"https://de.wikipedia.org/wiki/Cadenabbia","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/2011-01-02_Italien_Cadenabbia_Adenauer_Denkmal.JPG","page_title":"Cadenabbia","context_page_description":"Cadenabbia ist ein Ortsteil der Gemeinde Griante in Italien, liegt direkt am Westufer des Comer Sees und ist ein international bekannter Tourismusort. Griante liegt in der Region Lombardei und gehört zur Provinz Como.\\nVon Cadenabbia setzen Autofähren nach Bellagio über.\\nKonrad Adenauer verbrachte zwischen 1957 und 1966 regelmäßig seinen Urlaub in Cadenabbia. Sein ehemaliges Urlaubsdomizil, die 1899 erbaute Villa la Collina mit ihrem Park von 5,7 Hektar, wird seit 1977 als internationale Tagungsstätte von der Konrad-Adenauer-Stiftung genutzt. Sie wurde 1990 um die Accademia Konrad Adenauer erweitert. Seit 1992 besteht eine Partnerschaft mit der Stadt Bad Honnef, dem letzten Wohnort von Konrad Adenauer.\\nDaneben verbrachten Stendhal, Giuseppe Verdi – der hier einige Arien der Traviata verfasste –, Königin Victoria, Zar Nikolaus II. sowie Kaiser Wilhelm II. hier schon ihren Urlaub.\\nArthur Schnitzler erwähnt den Friedhof von Cadenabbia in seinem Roman Der Weg ins Freie: „Und während er so […] hindämmerte, […] sah er lauter schimmernde Kreuze ragen auf winzigen Hügeln, […] und eine rötlich-gelbe Puppensonne glänzte darüber hin."},{"page_url":"https://en.wikipedia.org/wiki/South_Main_Street_Historic_District_(Kernersville,_North_Carolina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Kernersville_Moravian_Church_South_Main_Street_Historic_District_Kernersville_NC_Jan_2015.jpg","page_title":"South Main Street Historic District (Kernersville, North Carolina)","context_page_description":"South Main Street Historic District is a national historic district located at Kernersville, Forsyth County, North Carolina. The district encompasses 53 contributing buildings, 2 contributing sites, and 2 contributing objects in Kernersville. They include residential and commercial buildings built between about 1834 and 1930 in a variety of popular architectural styles including Colonial Revival, Queen Anne, and Bungalow / American Craftsman style. Located in the district is the separately listed Korner's Folly. Other notable buildings include Spears House, Dr. Elias Kerner House, Elias Kerner Huff House, Greenfield and Kerner Tobacco Factory, Bank of Kernersville, DeWitt Harmon's Office, Kernersville Moravian Church, and Main Street United Methodist Church.\\nIt was listed on the National Register of Historic Places in 1988."},{"page_url":"https://es.wikipedia.org/wiki/Circo_Ruso","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Moscowcircus.JPG","page_title":"Circo Ruso","context_page_description":"El Circo Ruso fue oficialmente fundado el 26 de agosto del 1919 por el decreto de Lenin, según el cual todos los circos de toda Rusia pasaron a ser propiedad del gobierno​. Más tarde se creó una instancia administrativa SoyuzGosTzirk que regula todos los asuntos relacionados al Circo Ruso. Después de la caída de la Unión Soviética esta instancia se convirtió en RosGosTzirk la cual tiene completa autoridad sobre todas las compañías de circo en el territorio de la Federación Rusa excepto:\\nEl Gran Circo de Moscú\\nEl Circo de Nikulin\\nEl Circo de San Petersburgo en Fontanka\\nEl Circo Estatal de Kazán\\nLos cuales mantienen su autonomía.\\nEl 28 de febrero del 1995 por el decreto del gobierno de La Federación Rusa Nº 196 la instancia administrativa RosGosTzirk se convirtió oficialmente en La Compañía Estatál de Circo Ruso. Quedándose con la misma abreviación RosGosTzirk."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BA%9E%E6%AD%B7%E5%B1%B1%E5%A4%A7%E4%B8%B9%E5%B0%BC%E5%A3%ABEnviro_500_MMC","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/SN4860-8045-A22.JPG","page_title":"亞歷山大丹尼士Enviro 500 MMC","context_page_description":"亚历山大丹尼士Enviro 500MMC是一款由英国亚历山大丹尼士生产的3轴双层巴士，它也是亚历山大丹尼士制造的其中一款Enviro系列巴士。它是全球最畅销的3轴双层巴士，由2012年至今已售出超过4,500辆，也是香港多间专营巴士公司车队中为数最多的巴士型号。"},{"page_url":"https://it.wikipedia.org/wiki/Disastro_ambientale_della_piattaforma_petrolifera_Deepwater_Horizon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Gulf_of_Mexico_oil_spill_May_17_cropped.jpg","page_title":"Disastro ambientale della piattaforma petrolifera Deepwater Horizon","context_page_description":"Il disastro ambientale della piattaforma petrolifera Deepwater Horizon, affiliata alla British Petroleum, è stato un massiccio sversamento di petrolio nelle acque del Golfo del Messico in seguito a un incidente riguardante il Pozzo Macondo che si trova a oltre 1.500 m di profondità.\\nLo sversamento è iniziato il 20 aprile 2010 ed è terminato 106 giorni più tardi, il 4 agosto 2010, con milioni di barili di petrolio sulle acque di fronte alla Louisiana, Mississippi, Alabama e Florida, oltre alla frazione più pesante del petrolio che ha formato grossi ammassi sul fondale marino.\\nÈ il disastro ambientale più grave della storia americana, avendo superato di oltre dieci volte per entità quello della petroliera Exxon Valdez nel 1989, pertanto spesso ci si riferisce a questo disastro con l'espressione \\"Marea nera\\"."},{"page_url":"https://vi.wikipedia.org/wiki/Angus_Deaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Angus_Deaton_5289-2015.jpg","page_title":"Angus Deaton","context_page_description":"Angus Stewart Deaton là một nhà kinh tế học vi mô người Anh và Mỹ.\\nÔng là giáo sư kinh tế và các vấn đề quốc tế tại Trường Woodrow Wilson ở Princeton từ năm 1983. Hiện ông đang nghiên cứu về y tế, phúc lợi xã hội và sự phát triển kinh tế.\\nNăm 2015, ông được trao giải Nobel kinh tế cho tích của ông về tiêu dùng, nghèo đói và phúc lợi xã hội.\\nỦy ban trao giải Nobel cho rằng bằng việc chỉ ra các mối liên hệ giữa những quyết định tiêu dùng cá nhân và những tác động đến toàn nền kinh tế, công trình của Deaton đã giúp làm biến đổi nền kinh tế vi mô, vĩ mô và những nền kinh tế phát triển."},{"page_url":"https://ja.wikipedia.org/wiki/M14_DMR","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Designated_Marksman_Rifle_2.jpg","page_title":"M14 DMR","context_page_description":"M14 DMRは、7.62x51mm NATO弾を使用するガス圧作動式のセミオートスナイパーライフルである。アメリカ海兵隊が、M14をベースに改良して製作した。"},{"page_url":"https://ceb.wikipedia.org/wiki/Skellytown","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Restored_filling_station_in_Skellytown%2C_Texas.JPG","page_title":"Skellytown","context_page_description":"Lungsod ang Skellytown sa Tinipong Bansa. Ang Skellytown nahimutang sa kondado sa Carson County ug estado sa Texas, sa sentro nga bahin sa nasod, 2,200 km sa kasadpan sa ulohang dakbayan Washington, D.C. 986 metros ibabaw sa dagat kahaboga ang nahimutangan sa Skellytown, ug adunay 473 ka molupyo.\\nAng yuta palibot sa Skellytown kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,002 ka metro ug 1.7 km sa habagatan-sidlakan sa Skellytown. Dunay mga 2 ka tawo kada kilometro kwadrado sa palibot sa Skellytown may kaayo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang White Deer, 15.6 km sa habagatan sa Skellytown. Hapit nalukop sa kasagbotan ang palibot sa Skellytown.\\nAng kasarangang giiniton 18 °C. Ang kinainitan nga bulan Hulyo, sa 32 °C, ug ang kinabugnawan Enero, sa 4 °C. Ang kasarangang pag-ulan 540 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 109 milimetro nga ulan, ug ang kinaugahan Enero, sa 9 milimetro."},{"page_url":"https://nl.wikipedia.org/wiki/Arctostaphylos_pungens","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Arctostaphylospungens.jpg","page_title":"Arctostaphylos pungens","context_page_description":"Arctostaphylos pungens is een plant uit de heidefamilie. Zoals de andere manzanitasoorten komt deze soort in de chaparralgebieden in het westen van Noord-Amerika voor, maar ook in bossen en woestijnen. De soort is inheems in het zuidwesten van de Verenigde Staten en in noorden en centrum van Mexico. A. pungens is een van de meest wijdverspreide soorten in het westen van de VS.\\nIn het Engels wordt de plant doorgaans Pointleaf manzanita of Mexican manzanita genoemd."},{"page_url":"https://es.wikipedia.org/wiki/Pseudecheneis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Pseudecheneis_sulcatus_Griesbach_116.jpg","page_title":"Pseudecheneis","context_page_description":"Pseudecheneis es un género de peces de la familia Sisoridae. En 1930 Blyth describió el género.\\nLas especies de Pseudecheneis son peces que prefieren vivir en aguas que se mueven rápidamente, principalmente en la desembocadura de los grandes ríos en el sur y el sureste de Asia.​ Se encuentran en la parte alta de los ríos de toda la región subhimalaya e Indochina. Se distribuyen en los drenajes del norte de la India y Nepal, en los ríos Ganges y Brahmaputra y hacia el este de las montañas Ailao a lo largo de la cuenca alta del río Rojo de Vietnam y la cordillera Annamita.​​ P. maurus representa el primer registro del género en los ríos de la cara este de esta cordillera."},{"page_url":"https://da.wikipedia.org/wiki/Virgin_Records","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Rolling_Stones_-_Virgin.JPG","page_title":"Virgin Records","context_page_description":"Virgin Records er et engelsk pladeselskab. Det blev stiftet af Richard Branson og Nik Powell i 1972. Virgin Records blev solgt til EMI i 1992 og indgik herefter i Virgin EMI og ejes i dag af Universal Music Group.\\nI 2013 blev Virgin EMI Records etableret ved en sammenlægning af Mercury Records UK, Universal Island og Virgin Records. Virgin EMI’s artister inkluderer bl.a. Paul McCartney, U2, Massive Attack, Elton John m.fl."},{"page_url":"https://sv.wikipedia.org/wiki/Bassaxofon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Otto_Lington_with_We_Three.jpg","page_title":"Bassaxofon","context_page_description":"Bassaxofonen stämd i BBb är den tredje största saxofonen av alla. Större modeller är kontrabassaxofonen stämd i EEb och den nyligen tillverkade subkontrabassaxofonen stämd i BBBb. Bassaxofonen var den första saxofonmodellen som Adolphe Sax tillverkade på 1840-talet, syftet var att ta fram ett ljudstarkt blåsinstrument som kunde överbrygga klangen mellan brass och träblås.\\nBassaxofonen är i dag ett ganska sällan använt instrument. På 1920-talet hade den dock en relativt viktig roll inom dans- och jazzmusik. Till tidens mest kända virtuoser på instrumentet hör Adrian Rollini och Spencer Clark, vilka båda primärt verkade inom orkestern California Ramblers. Också Coleman Hawkins framträdde under början av sin karriär som solist på bassaxofon.\\nI modern tid har den svenske jazzmusikern Frans Sjöström skaffat sig världsomfattande berömmelse som traktör av detta instrument."},{"page_url":"https://en.wikipedia.org/wiki/British_railway_rolling_stock","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Hugh_llewelyn_%2845%295910_%286437923229%29.jpg","page_title":"British railway rolling stock","context_page_description":"British railway rolling stock refers to the trains used in Britain."},{"page_url":"https://en.wikipedia.org/wiki/United_States_coinage_type_set","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/1976D_Type2_Eisenhower_Reverse.jpg","page_title":"United States coinage type set","context_page_description":"United States coinage type set is a visual collection of each of the types of coins produced by the US Mints. A \\"Type set\\" collection is enjoyed by some collectors of coins who try to collect one example of as many types of coins as they can.\\nDue to various reasons, collectors will sometimes group several different coins together as one \\"type.\\" For example, one could collect a Liberty Seated dime, quarter, and half dollar, and call that their example of a Liberty Seated coin for each denomination. Or, they could choose to collect an example of sub-types within the Liberty Seated design, including the with and without arrows at date, and with and without mottos.\\nAdditionally, delineating sub-types within a particular design is not always consistent. For example, almost all type collectors consider the 1909 \\"V.D.B.\\" Lincoln cent to be different from the 1909 no-\\"V.D.B.\\" Lincoln cent. However, the \\"V.D.B.\\" initials were returned to the Lincoln cent in 1918 on the bottom of the bust on the obverse, and almost no type collector considers this a separate type."},{"page_url":"https://fr.wikipedia.org/wiki/Vikings_(s%C3%A9rie_t%C3%A9l%C3%A9vis%C3%A9e)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Jasper_P%C3%A4%C3%A4kk%C3%B6nen.jpg","page_title":"Vikings (série télévisée)","context_page_description":"Vikings est une série télévisée canado-irlandaise créée par Michael Hirst, diffusée simultanément depuis le 3 mars 2013 sur les chaînes History au Canada et History aux États-Unis.\\nEn France, la série est diffusée depuis le 10 juin 2013 sur Canal+ puis dès le 23 novembre 2014 sur W9, au Québec, depuis le 1ᵉʳ novembre 2013 sur Super Écran puis rediffusée à partir du 4 novembre 2014 sur Ztélé, en Suisse, depuis le 28 avril 2014 sur RTS Un et en Belgique depuis le 22 février 2015 sur La Deux.\\nDepuis le 1ᵉʳ février 2020, les cinq premières saisons sont disponibles en VOD sur Netflix."},{"page_url":"https://ru.wikipedia.org/wiki/Galeus_mincaronei","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Galeus_mincaronei_distmap.png","page_title":"Galeus mincaronei","context_page_description":"Galeus mincaronei — вид рода пилохвостов, семейства кошачьих акул. Эндемик южного побережья Бразилии. Размножается, откладывая яйца. Максимальный размер 43 см."},{"page_url":"https://pt.wikipedia.org/wiki/Victor_Willis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Victor_Willis_in_concert_2008.jpg","page_title":"Victor Willis","context_page_description":"Victor Edward Willis é um cantor, compositor e ator americano, mais conhecido como o vocalista original do grupo Village People entre 1977 e 1980."},{"page_url":"https://sw.wikipedia.org/wiki/Mto_Aire","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/River_Aire_south_of_Malham.jpg","page_title":"Mto Aire","context_page_description":".\\nMto Aire ni mto mkubwa katika Yorkshire, Uingereza 71 miles Sehemu ya mto huu una mtaro unaojulikana kama njia ya maji ya Aire na Calder.\\nAire ni moja ya mito kuu Uingereza na hupitia katika maeneo yenye idadi kubwa ya wakazi nchini Uingereza, ambayo ni Yorkshire Magharibi.\\nHuanzia katika Malham Tarn na kupitia hadiMalham Cove, karibu na Malham, katika Kaskazini Yorkshire na hupitia pia Gargrave na Skipton. Baada ya Cononley, mto huu huingia Yorkshire Magharibi ambapo hupitia katika maeneo ya viwanda Keighley, Bingley, Saltaire, Shipley, kisha hupitia Leeds, katika vijiji vya Swillington na Woodlesford. Katika Castleford ni mkutanbo wa Aire na Calder; upande wa chini wa mkutano huu kulikuwa na ford ambapo barabara ya kale ya Uingereza, ilitumika na kurekebishwa na Warumi, kuvukia kuelekea kaskazini York. Mto huingia tena kaskazini Yorkshire karibu na Knottingley na sehemu uyake ya chini inaunda mpaka kati ya Kaskazini Yorkshire na Mashariki ya Riding Yorkshire.\\nMto Aire huingia ndani ya mto Ouse katika Airmyn, 'myn' kuwa neno la zamani la Kiingereza la ' kinywa cha mto'. Jina hili linauwezekano wa kutoka katikaBrythonia * Isara, na maana kuwa \\"nguvu mto\\"."},{"page_url":"https://en.wikipedia.org/wiki/Silvio_Rodr%C3%ADguez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Silvio_Rodr%C3%ADguez_-_Plaza_de_Mayo_-_Festival_Todos_Somos_Argentinos-25-may-04-presidencia-govar.jpg","page_title":"Silvio Rodríguez","context_page_description":"Silvio Rodríguez Domínguez is a Cuban musician, and leader of the nueva trova movement.\\nHe is widely considered Cuba's best folk singer and arguably one of Latin America's greatest singer-songwriters. Known for his intellectual, highly eloquent and symbolic lyrics, his songs are iconic elements of Latin American left-leaning intellectual culture. Many of his songs have become classics in Latin American music, such as \\"Ojalá\\", \\"Playa Girón\\", \\"Unicornio\\", \\"Sueño con Serpientes\\", \\"Vamos a andar,\\" and \\"La maza\\". Among his other well-known songs are political anthems like \\"Fusil contra fusil\\" and \\"Canción del Elegido\\", and poetic melodies like \\"A donde van\\" and \\"Noche sin fin y mar\\". He has released over 20 albums.\\nRodríguez, musically and politically, is a symbol of the Latin American left. His lyrics are notably introspective, while his songs combine romanticism, eroticism, existentialism, revolutionary politics and idealism. As a humanist, his songs often bespeak a secular worldview, where humanity must make the best of this world. He has been referred to as \\"Cuba's John Lennon.\\""},{"page_url":"https://tr.wikipedia.org/wiki/Magic_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/WDW-Tomorrowland_sign.jpg","page_title":"Magic Kingdom","context_page_description":"Magic Kingdom, Walt Disney World Resort'ta bulunan bir eğlence parkıdır. 1 Ekim 1971 tarihinde açılmış olup parktaki dört tema parkından ilkidir. Park, Walt Disney tarafından başlatılmış olup WED Enterprises tarafından tasarlanan düzeni ve turistik mekanları, Anaheim'deki Disneyland'a dayanmaktadır ve peri masalları ile Disney karakterleri temasına sahiptir.\\nPark, 1950 filminde görülen peri masalı kalesinden esinlenen Sindirella Kalesi ile temsil edilmektedir. 2016'da park, 20.395 milyon ziyaretçiye ev sahipliği yaparak son 17 yıl boyunca Kuzey Amerika'da en çok ziyaret edilen tema parkı haline geldi."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D0%B3%D1%80%D0%B0%D0%B4%D0%BE%D0%B2%D0%B0_%D0%BF%D0%BE_%D0%B3%D1%83%D1%81%D1%82%D0%B8%D0%BD%D0%B8_%D0%BD%D0%B0%D1%81%D0%B5%D1%99%D0%B5%D0%BD%D0%BE%D1%81%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Pic_geo_photos_-_ph%3Dmm%3Dpasay%3Dbay_city_skyline_-_aerial_shot_from_cityland_vito_cruz_-philippines--2015-0624--ls-.JPG","page_title":"Списак градова по густини насељености","context_page_description":"Ово је провизорни списак 40 најгушће насељених градова на свету.\\nСтановништво, густина насељености и копнена површина за градове наведене на списку параметри су који се односе на целу јединствену политичку јурисдикцију којој припада историјски центар града, односно у обзир су узете недвосмислено границе града. Списак не укључује становништво, густину становништва или копнену површину већих метрополитенских или урбаних подручја, а такође не обухвата ни поједине градске дистрикте у било ком од наведених градова.\\nНајгушће насељен град на свету је тренутно филипинска престоница Манила."},{"page_url":"https://sh.wikipedia.org/wiki/Rudolph,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/OHMap-doton-Rudolph.png","page_title":"Rudolph, Ohio","context_page_description":"Rudolf je naseljeno mesto bez administrativnog statusa u američkoj saveznoj državi Ohajo."},{"page_url":"https://tr.wikipedia.org/wiki/Bwindi_Ge%C3%A7ilmez_Mill%C3%AE_Park%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Bwindi.JPG","page_title":"Bwindi Geçilmez Millî Parkı","context_page_description":"Bwindi Geçilmez Milli Parkı, güneybatı batı Uganda'da yer almaktadır. Park, Bwindi Geçilmez Ormanının bir parçasıdır ve Kongo Demokratik Cumhuriyeti sınırında Virunga Milli Parkı'nın yanında ve Albertine Rift'in kenarında bulunmaktadır. Hem dağlık hem de ova ormanlarından oluşan 331 kilometrekare ormandan oluşmaktadır ve yalnızca yürüyerek erişilebilir. BINP, Birleşmiş Milletler Eğitim, Bilim ve Kültür Örgütü tarafından belirlenen bir Dünya Mirası sitesidir.\\nTürlerin çeşitliliği parkın bir öne çıkan bir özelliğidir. 120 tür memeli hayvan, 348 kuş türü, 220 tür kelebek, 27 kurbağa türünün yanı sıra bukalemun, gecko ve birçok nesli tükenmekte olan tür için yaşam alanı sağlar. Floristik olarak, Doğu Afrika'daki en çeşitli ormanları arasında yer alır ve park içerisinde 163 ağaç ve 104 çeşit yabani çiçek olmak üzere 1.000'den fazla çiçekli bitki türü bulunur. Kuzey bölümü, nesli tükenmekte olan iki tür olan Lovoa swynnertonii ve Brazzeia longipedicellata da dahil olmak üzere birçok Gine-Kongo flora türüne sahiptir.\\nPark, kara beyaz kolobus, şempanzeler ve boynuzgaga ve turako gibi birçok kuş için bir yaşam alanıdır."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D0%BE%D0%B2%D0%BE%D0%B5_%D1%81%D0%BE%D0%B7%D1%80%D0%B5%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Tanner_scale-female.svg","page_title":"Половое созревание","context_page_description":"Полово́е созрева́ние, также пуберта́тный период или пуберта́т — процесс изменений в организме подростка, вследствие которых он становится взрослым и способным к продолжению рода. Несмотря на индивидуальные различия, в среднем начинается в 10-12 лет, а заканчивается в 19.5 лет. Половое созревание запускается с помощью сигналов из головного мозга к половым железам: семенникам у мальчиков и яичникам у девочек. В ответ на эти сигналы половые железы вырабатывают различные гормоны, стимулирующие рост и развитие мозга, костей, мышц, кожи и репродуктивных органов. Рост тела ускоряется в первой половине пубертатного периода, а полностью заканчивается с завершением полового созревания. До начала полового созревания различия в строении тела девочки и мальчика сводятся практически только к половым органам. В течение периода полового созревания формируются значительные различия в размерах, форме, составе и функции многих структур и систем организма, наиболее очевидные из которых относят ко вторичным половым признакам."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BD%A9%E7%88%BE%E9%A0%93%E5%BC%8F%E6%B0%B4%E8%BC%AA%E6%A9%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Peltonturbine-1.jpg","page_title":"佩爾頓式水輪機","context_page_description":"佩爾頓式水輪機為衝擊式水輪機的一種，它是在1870年代由美國發明家萊斯特·艾倫·佩爾頓所開發。佩爾頓式水輪機是利用水流動並衝擊水車時來取得能量，不同於利用水自身重量來帶動的傳統上射式水車。早在佩爾頓的設計發表前，便已有多種不同的衝擊式水輪機版本已經存在，然而它們的工作效率上，比起佩爾頓的設計來的更低。在水離開水車後，水通常仍具有速度，將水車的許多動能一併給浪費掉。佩爾頓的划槳幾何設計，使得動輪跑在水射流速度的一半後，僅用極低的速度離開動輪；因此佩爾頓的設計幾乎完全擷取了水的衝擊能量，如此一來便可擁有一部具有高效能的水輪機。"},{"page_url":"https://ms.wikipedia.org/wiki/Etos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Australian_Capital_Territory_Legislative_Assembly_and_the_statue_Ethos.jpg","page_title":"Etos","context_page_description":"Etos ialah perkataan bahasa Yunani bermaksud \\"watak\\" yang digunakan untuk menggambarkan kepercayaan atau cita-cita yang menjadi pedoman yang menggambarkan ciri suatu masyarakat, bangsa, atau ideologi. Orang Yunani juga menggunakan perkataan ini untuk merujuk kepada kuasa muzik mempengaruhi emosi, tingkah laku, dan juga moral. Cerita awal Yunani Orpheus menunjukkan idea ini dalam cara yang mendorong. Penggunaan perkataan ini dalam retorik berasaskan rapat pada peristilahan Yunani yang digunakan oleh Aristotle dalam konsepnya tiga bukti seni atau cara pujukan."},{"page_url":"https://en.wikipedia.org/wiki/Operation_Enduring_Freedom","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Seal_of_the_International_Security_Assistance_Force.svg","page_title":"Operation Enduring Freedom","context_page_description":"Operation Enduring Freedom was the official name used by the U.S. government for the Global War on Terrorism. On October 7, 2001, in response to the September 11 attacks, President George W. Bush announced that airstrikes targeting Al Qaeda and the Taliban had begun in Afghanistan. Operation Enduring Freedom primarily refers to the War in Afghanistan, but it is also affiliated with counterterrorism operations in other countries, such as OEF-Philippines and OEF-Trans Sahara.\\nAfter 13 years, on December 28, 2014, President Barack Obama announced the end of Operation Enduring Freedom in Afghanistan. Continued operations in Afghanistan by the United States' military forces, both non-combat and combat, now occur under the name Operation Freedom's Sentinel."},{"page_url":"https://en.wikipedia.org/wiki/Italian_lira","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/5000lire.jpg","page_title":"Italian lira","context_page_description":"The lira was the currency of Italy between 1861 and 2002 and of the Albanian Kingdom between 1941 and 1943. Between 1999 and 2002, the Italian lira was officially a national subunit of the euro. However, cash payments could be made in lira only, as euro coins or notes were not yet available. The lira was also the currency of the Napoleonic Kingdom of Italy between 1807 and 1814.\\nThe term originates from the value of a pound weight of high purity silver and is thus directly related to the British pound sterling from the Germanic silabar; in some countries, such as Cyprus and Malta, the words lira and pound were used as equivalents, before the euro was adopted in 2008 in the two countries. \\"L\\", sometimes in a double-crossed script form, was the symbol most often used. Until the Second World War, it was subdivided into 100 centesimi, which translates to \\"hundredths\\" or \\"cents\\".\\nThe lira was established at 4.5 grams of silver or 290.322 milligrams of gold. This was a direct continuation of the Sardinian lira and the French franc."},{"page_url":"https://ms.wikipedia.org/wiki/Llauro","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Llauro_-_vue_g%C3%A9n%C3%A9rale.jpg","page_title":"Llauro","context_page_description":"Llauro merupakan sebuah komun di jabatan Pyrénées-Orientales di selatan Perancis."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B1%D9%85%D9%84%D8%A9_%D8%B3%D9%88%D8%AF%D8%A7%D8%A1_%D8%AC%D9%86%D9%88%D8%A8%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Black_widow_spider.jpg","page_title":"أرملة سوداء جنوبية","context_page_description":"الأرملة السوداء الجنوبية أو الأرملة الجنوبية، وببساطة يسمونها الأرملة السوداء، هي نوع من العناكب السامة للغاية من جنس الزوع. وتتميز إناثها بأن لها لون مميز من الأسود والأحمر، وتأكل أحيانا شريكها بعد الإنجاب. وتستوطن هذه الأنواع في أمريكا الشمالية. وسمها نادرا ما يكون قاتل للبشر. وتبدو ذكور وإناث هذا النوع من العناكب مختلفة وفي جميع الحالات الإناث هي الأكثر تميزا في الشكل بسبب هيئتها السوداء والحمراء اللامعة حيث توجد علامات على الجانب السفلي من البطن تشبه شكل الساعة الرملية التي تٌستخدم لإرسال أشارات تحذير لبعض الحيوانات. ويبلغ طول الذكور حوالي نصف حجم الإناث وهم أفتح لوناً من الإناث مع وجود بقع حمراء أو وردية على ظهورهم. تعيش الإناث تقريبا ثلاث سنوات بينما يبلغ عمر الذكور شهر أو شهرين لهذا سميت الإناث بالأرامل."},{"page_url":"https://sv.wikipedia.org/wiki/Anathallis_rubens","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Pleurothallis_montana-Pleurothallis_gracilis-Anathallis_rubens_%28as_Pleurothallis_rubens_var._latifolia%29_-_Fl.Br._3-4-87.jpg","page_title":"Anathallis rubens","context_page_description":"Anathallis rubens är en orkidéart som först beskrevs av John Lindley, och fick sitt nu gällande namn av Alec M. Pridgeon och Mark W. Chase. Anathallis rubens ingår i släktet Anathallis och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Temple_ma%C3%A7onnique_de_Philadelphie","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Grand_Lodge_of_Pennsylvania.jpg","page_title":"Temple maçonnique de Philadelphie","context_page_description":"Le temple maçonnique de Philadelphie est un monument historique qui se situe en face de l'hôtel de ville de Philadelphie, le Philadelphia City Hall, sur la North Broad Street n°1. Le temple maçonnique est le siège de la Grande Loge de Pennsylvanie, l'une des plus anciennes obédiences maçonniques des États-Unis."},{"page_url":"https://de.wikipedia.org/wiki/Innungskrankenkasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/SG_IKK_Kronprinzenstra%C3%9Fe_KSG_5030_pK.jpg","page_title":"Innungskrankenkasse","context_page_description":"Eine Innungskrankenkasse ist ein Träger der gesetzlichen Krankenversicherung in der Bundesrepublik Deutschland. Meist sind deren Versicherte historisch bedingt Handwerker, auch wenn inzwischen jede IKK für alle Versicherten geöffnet ist."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B6%D0%B5%D0%BA%D1%81%D0%BE%D0%BD_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3,_%D0%90%D1%80%D0%BA%D0%B0%D0%BD%D0%B7%D0%B0%D1%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/77/USA_Jackson_County%2C_Arkansas_age_pyramid.svg","page_title":"Джексон (округ, Арканзас)","context_page_description":"Округ Джексон — округ, расположенный в штате Арканзас, США, с населением в 18 418 человек по статистическим данным переписи 2000 года. Столица округа находится в городе Ньюпорт.\\nОкруг Джексон был образован 5 ноября 1829 года, став 23-м по счёту округом Арканзаса и получил своё название в честь седьмого президента США Эндрю Джексона, во время нахождения на посту которого Арканзас вошёл в состав Соединённых Штатов"},{"page_url":"https://es.wikipedia.org/wiki/Ippolito_Caffi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Ippolito_Caffi%2C_Acquedotti_nella_campagna_romana%2C_1843.jpg","page_title":"Ippolito Caffi","context_page_description":"Ippolito Caffi fue un pintor italiano."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Collorgues","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Collorgues.jpg","page_title":"Collorgues","context_page_description":"Collorgues sī ūi-tī Hoat-kok Languedoc-Roussillon tōa-khu Gard séng ê chi̍t ê commune."},{"page_url":"https://fr.wikipedia.org/wiki/T%C3%A9mia_%C3%A0_ventre_blanc","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Dendrocitta_leucogastra_map.png","page_title":"Témia à ventre blanc","context_page_description":"La Témia à ventre blanc est une espèce de passereau appartenant à la famille des Corvidae."},{"page_url":"https://pl.wikipedia.org/wiki/Ruch_Autonomii_%C5%9Al%C4%85ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Wyniki_RA%C5%9A_wed%C5%82ug_gmin_w_wyborach_do_sejmiku_wojew%C3%B3dztwa_%C5%9Bl%C4%85skiego_%282010%29.png","page_title":"Ruch Autonomii Śląska","context_page_description":"Ruch Autonomii Śląska – stowarzyszenie utworzone w styczniu 1990 na Górnym Śląsku. Od 27 czerwca 2001 z siedzibą w Katowicach. Głównym celem organizacji jest utworzenie autonomicznego regionu w historycznych granicach Górnego Śląska. Ruch Autonomii Śląska powołuje się na posiadanie autonomii w okresie II Rzeczypospolitej przez województwo śląskie, które działało w ramach Statutu Organicznego, nadanego przez Sejm Ustawodawczy."},{"page_url":"https://nl.wikipedia.org/wiki/Mule_(auto)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/100220_Erlkoenig_BMW_7.jpg","page_title":"Mule (auto)","context_page_description":"Een mule is een auto met een neutraal koetswerk van hetzelfde merk.\\nEen mule is bedoeld voor prototypes van nieuwe auto's. Onder de mule wordt de techniek van een nieuwe auto getest. Het neutrale koetswerk dient als camouflage. Dit wordt gedaan omdat de nieuwe auto nog op de markt moet komen en de fabrikant het uiteindelijke verkoopmodel vaak zo laat mogelijk wil onthullen als het bijna te koop is. Door het een neutraal koetswerk te geven, liefst door het op een veelvoorkomend model te laten lijken, hopen de fabrikanten dat autojournalisten de mule niet voortijdig ontdekken.\\nEen mule is te herkennen aan de veelal slecht passende koetswerkdelen. Ook past de carrosserie vaak niet helemaal op het nieuwe onderstel waardoor de wielkasten deels weggehaald of juist bijgepast moeten worden met losse stukken plaatwerk."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89nergie_en_Pologne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/KWB_Be%C5%82chat%C3%B3w3a.JPG","page_title":"Énergie en Pologne","context_page_description":"Le secteur de l'énergie en Pologne se caractérise avant tout par la prépondérance massive du charbon, qui en 2018 assurait 77,8 % de la production d'énergie primaire, 47,1 % de la consommation intérieure totale d'énergie primaire et 78,3 % de la production d'électricité, avec en conséquence de fortes émissions de dioxyde de carbone : 7,96 tonnes de CO₂ par habitant en 2017, supérieures de 82 % à la moyenne mondiale et de 27 % à celle de l'Union européenne, à comparer à l'Allemagne : 8,70 t/hab et à la France : 4,56 t/hab. Ces émissions ont reculé de 12 % entre 1990 et 2017.\\nLa Pologne est au 1ᵉʳ rang européen et au 10ᵉ rang mondial pour la production de charbon et lignite en 2019 avec 1,1 % de la production mondiale, devant l'Allemagne : 0,8 %. Ses réserves de charbon se classent au 9ᵉ rang mondial avec 2,5 % des réserves mondiales.\\nLa consommation intérieure totale d'énergie primaire de la Pologne par habitant était de 2,70 tep en 2017, supérieure de 45 % à la moyenne mondiale, mais inférieure de 28 % à celle de l'Allemagne et de 27 % à celle de la France."},{"page_url":"https://sv.wikipedia.org/wiki/Follingbo_sjukhus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Tallbacken.jpg","page_title":"Follingbo sjukhus","context_page_description":"Follingbo sjukhus, även kallat Tallbacken, är ett tidigare sjukhem och sanatorium beläget i socknen Follingsbo strax utanför Visby på Gotland, uppfört 1910 och tillbyggt i etapper under 1950- och 1960-talet. Huvudbyggnaden är en 3 500 m² trevånings betongbyggnad, de båda sidobyggnaderna är på 1 400 m² respektive 1 200 m² och övriga byggnader är en före detta överläkarvilla, ett tvåfamiljshus, ett garage och en värmecentral. Området har eget vatten och avloppssystem och marken är på cirka 82 000 m², belägen på en plats som är en av Gotlands högsta punkter, nästan 100 meter över havet. Follingbo sjukhus spelar en av huvudrollerna i författaren Anna Janssons bok Främmande fågel och som sändes som TV-serie i TV4 under hösten 2008."},{"page_url":"https://it.wikipedia.org/wiki/Darryl_Jackson","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Basketball_Malta.png","page_title":"Darryl Jackson","context_page_description":"Darryl Joshua Jackson è un cestista maltese."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%94%8C%E6%8C%87%E6%A0%B8%E9%85%B8%E9%85%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Repair_outcomes_of_a_genomic_double-strand_break_for_ZFN_cleavage.jpg","page_title":"锌指核酸酶","context_page_description":"鋅指核酸酶，是人工改造的限制酶，通過融合鋅指結構的結合DNA結構域和分解DNA結構域而成。可通過基因工程改造鋅指結構域使鋅指核酸酶針對複雜基因組裡的特定DNA順序。藉助內源DNA的修復機制，鋅指核酸酶可以精確改變高等動物的基因組。類似的技術還有類轉錄活化因子核酸酶。"},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Summersberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Hexenturm_%28Gufidaun%29_1.jpg","page_title":"Schloss Summersberg","context_page_description":"Das kastellartige Schloss Summersberg liegt in Gufidaun in Südtirol. Es wurde von Georg von Villanders 1329 errichtet und war bis 1828 Sitz des Gerichtes in Gufidaun."},{"page_url":"https://it.wikipedia.org/wiki/Area_8_di_Brodmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Brodmann_area_8_lateral.jpg","page_title":"Area 8 di Brodmann","context_page_description":"L'area 8 di Brodmann è una delle aree di Brodmann citologicamente definite del cervello. È coinvolta nella pianificazione dei movimenti complessi."},{"page_url":"https://en.wikipedia.org/wiki/Brian_Collins_(designer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/NBC_Education_Nation.jpeg","page_title":"Brian Collins (designer)","context_page_description":"Brian Collins is an American designer, creative director, and educator. He is the Chief Creative Officer of COLLINS, an independent strategy and brand experience design company with offices in New York City and San Francisco.\\nPrior to founding COLLINS, he served as Chairman and Chief Creative Officer of the brand and innovation division of Ogilvy & Mather for ten years. He has been a professor in the Graduate Program of the School of Visual Arts since 2001, and is an officer on the Board of Directors for The One Club, a non-profit organization recognizing creative excellence in design and advertising.\\nCollins was named a “Design Master” by Graphis Inc. and named one of five American “Masters of Design” by Fast Company. He was also named one of 50 Most Influential Graphic Designers Working Today by Graphic Design USA. He was the first graphic designer invited to participate in the World Economic Forum in Davos, Switzerland, becoming a charter member of the Forum's Global Agenda Council on Design"},{"page_url":"https://en.wikipedia.org/wiki/Vaca_Falls_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Aboard_the_%27Up_we-go%27_train._Starting_the_return_journey.jpg","page_title":"Vaca Falls Railway","context_page_description":"The Vaca Falls Railway was a 15 miles long 3 ft gauge logging railway between the Vaca Falls and the Chiquibui Forest on the Mountain Pine Ridge in Belize."},{"page_url":"https://en.wikipedia.org/wiki/Technological_changes_at_the_Paralympic_Games","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/53_ACPS_Atlanta_1996_Rugby_Steve_Porter_Garry_Croker.jpg","page_title":"Technological changes at the Paralympic Games","context_page_description":"Technological changes at the Paralympic Games have had major impacts on the types of sports that are played and how those sports are played. Assistive technology in sports can be “low-tech” or can be highly advanced. Over the past decades technology at the Paralympic Games has become more specialised; with the development of tailored technologies and equipment to individual athletes and uses.."},{"page_url":"https://pt.wikipedia.org/wiki/Capit%C3%A3o_En%C3%A9as","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Capit%C3%A3o_En%C3%A9asmgbrasao.jpg","page_title":"Capitão Enéas","context_page_description":"Capitão Enéas é um município brasileiro do estado de Minas Gerais. Sua população estimada em 2010 era de 14.206 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Piombino","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Porto_Antico_di_Piombino_01.JPG","page_title":"Piombino","context_page_description":"Piombino is an Italian town and comune of about 35,000 inhabitants in the province of Livorno. It lies on the border between the Ligurian Sea and the Tyrrhenian Sea, in front of Elba Island and at the northern side of Maremma."},{"page_url":"https://en.wikipedia.org/wiki/Bartholomeus_van_der_Helst","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Pieter_Lucaszn_van_de_Venne_with_Anna_de_Carpentier_1652_van_der_Helst.jpg","page_title":"Bartholomeus van der Helst","context_page_description":"Bartholomeus van der Helst was a Dutch painter. Considered to be one of the leading portrait painters of the Dutch Golden Age, his elegant portraits gained him the patronage of Amsterdam's elite as well as the Stadtholder's circle. Besides portraits, van der Helst painted a few genre pictures as well as some biblical scenes and mythological subjects."},{"page_url":"https://sl.wikipedia.org/wiki/Kal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Kal_Beka_05.JPG","page_title":"Kal","context_page_description":"Kal je plitva kotanja na kraških tleh, kjer se zbira deževnica. Voda ne pronica v kraško podzemlje, ker ima kal dno prekrito z neprepustno plastjo gline ali ilovice.\\nNaravni kal nastane, ko se na dnu vrtače zbere plast gline, to je usedlin, ki so nastale s kraškim preperevanjem. Ker je ta plast neprepustna, se deževnica na njej ustavi in ustvarja naravni zbiralnik pitne vode. Pri nekaterih kalih povečajo količino vode drobna podzemska pretakanja, ki med kamninami prodirajo do te neprepustne plasti, katera ne dovoli, da bi se razpršili v podtalnico. Razumljivo je torej, da nekateri kali niso celo leto napolnjeni z vodo, saj je količina vode odvisna predvsem od padavin, pa tudi od prisotnosti kake podzemnega vodnega vira.\\nV preteklih časih so bili kali zelo pomembni tudi za človeško prehrano. Pozneje so si ljudje raje kopali vodnjake, ki niso bili toliko izpostavljeni izhlapevanju in ki so nudili čistejšo vodo. Kale so pustili večinoma za napajanje živine, kar pa seveda ni zmanjšalo važnosti teh naravnih zbiralnikov. Kmetje so skrbeli za čistočo in vzdrževanje kalov ter prodov, kot so imenovali dostope do vode. Ob suši so jih celo stražili, posebno ponoči."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CF%80%CE%B1%CF%81%CF%84%CF%83%CE%B5%CE%BB%CF%8C%CE%BD%CE%B1_%CE%A0%CF%8C%CF%84%CF%83%CE%BF_%CE%BD%CF%84%CE%B9_%CE%93%CE%BA%CF%8C%CF%84%CE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Barcellona_Pozzo_di_Gotto_Il_Municipio.jpg","page_title":"Μπαρτσελόνα Πότσο ντι Γκότο","context_page_description":"Η Μπαρτσελόνα Πότσο ντι Γκότο είναι η τέταρτη πόλη της Μητροπολιτικής πόλης της Μεσσίνας στην Ιταλική Περιφέρεια Σικελία που αντικατέστησε την Ιταλική επαρχία της Μεσσίνας με διοικητική μεταρρύθμιση.\\nΗ πόλη έχει έκταση 59.14 τετραγωνικά χιλιόμετρα και πληθυσμό 41.389 κατοίκους σύμφωνα με την Απογραφή του 2018, η πυκνότητα του πληθυσμού είναι 700 κάτοικοι ανά τετραγωνικό χιλιόμετρο. Η Μπαρτσελόνα Πότσο ντι Γκότο βρίσκεται σε απόσταση περίπου 40 χιλιόμετρα από την πρωτεύουσα της επαρχίας Μεσσήνη με κατεύθυνση προς το Παλέρμο."},{"page_url":"https://ca.wikipedia.org/wiki/Protectorat_de_Rhod%C3%A8sia","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Pioneer-corps-officers.jpg","page_title":"Protectorat de Rhodèsia","context_page_description":"La història de la Rhodèsia sota protectorat correspon al període durant el qual el Zimbàbue actual era un protectorat britànic de 1895 fins a la independència del país l'any 1980.\\nLes primeres incursions portugueses al segle XVIe a l'Àfrica austral no van aconseguir l'establiment de zones de població europeu. Fins als descobriments de l'explorador britànic David Livingstone de les cascades Victòria l'any 1855 i a continuació amb les exploracions de Frederick Courtney Selous els anys 1870 que els Britànics començaren a interessar-se a aquesta part amagada de l'Àfrica. La Rhodèsia deu el seu nom i la seva existència política i geogràfica a l'ambiciós home de negocis britànic Cecil Rhodes."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D9%81_%D9%85%D8%B3%D8%AA%D8%B1%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Internationale_Tenniskampioenschappen_Melkhuisje%2C_de_Australier_G_Masters_in_ak%2C_Bestanddeelnr_926-5593.jpg","page_title":"جف مسترز","context_page_description":"جف مسترز یک تنیس‌باز اهل استرالیا است."},{"page_url":"https://nl.m.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1988","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Antonio_Veic_010311.jpg","page_title":"Lijst van personen geboren in 1988","context_page_description":"Dit is een lijst van personen die geboren zijn in 1988.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A1%E0%A7%87%E0%A6%A8%E0%A6%BF%E0%A6%B6_%E0%A6%87%E0%A6%B8%E0%A7%8D%E0%A6%9F_%E0%A6%87%E0%A6%A8%E0%A7%8D%E0%A6%A1%E0%A6%BF%E0%A6%AF%E0%A6%BC%E0%A6%BE_%E0%A6%95%E0%A7%8B%E0%A6%AE%E0%A7%8D%E0%A6%AA%E0%A6%BE%E0%A6%A8%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/European_settlements_in_India_1501-1739.png","page_title":"ডেনিশ ইস্ট ইন্ডিয়া কোম্পানি","context_page_description":"ডেনিশ ইস্ট ইন্ডিয়া কোম্পানি বলতে দুটি ভিন্ন ভিন্ন ডেনিশ কোম্পানি বোঝায়। প্রথমটি ১৬১৬ থেকে ১৬৫০ সাল পর্যন্ত ও দ্বিতীয়টি ১৬৭০ থেকে ১৭২৯ সাল পর্যন্ত স্থায়ী ছিল। ১৭৩০ সালে এটি এশিয়াটিক কোম্পানি নামে পুনরায় গঠিত হয়।"},{"page_url":"https://hu.wikipedia.org/wiki/India_vil%C3%A1g%C3%B6r%C3%B6ks%C3%A9gi_helysz%C3%ADnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Kazi_rhino_edit.jpg","page_title":"India világörökségi helyszínei","context_page_description":"India területéről a 2019. évvel bezárólag 38 helyszín került fel a világörökségi listára. Továbbá 42 helyszín várakozik a felvételre."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%81%D0%BD%D0%B0%D1%89%D0%B5%D0%BD%D0%BD%D1%8F_%D0%A1%D1%83%D1%85%D0%BE%D0%BF%D1%83%D1%82%D0%BD%D0%B8%D1%85_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA_%D0%9F%D0%BE%D0%BB%D1%8C%D1%89%D1%96","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Transporter_TRI.jpg","page_title":"Оснащення Сухопутних військ Польщі","context_page_description":"Згідно з даними IISS The Military Balance на 2010 рік Сухопутні війська Польщі мали в своєму розпорядженні наступну техніку:"},{"page_url":"https://en.wikipedia.org/wiki/Trick_riding","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/The_Cossacks_albert_Seaton_1972.JPG","page_title":"Trick riding","context_page_description":"Trick riding refers to the act of performing stunts while riding a horse, such as the rider standing upright on the back of a galloping horse, using a specially designed saddle with a reinforced steel horn, and specialized kossak loops for hands and feet. The horse is likewise galloping free.\\nTrick riding is NOT the same as equestrian vaulting which is an internationally recognized competitive sport, governed by the Federation Equestre Internationale.\\nHorse riding stunts have been performed in many films, as well as in equestrian events such as Equitana and the official opening of the Australian Equine and Livestock Events Centre, rodeos, and much more.\\nHorse riding stunts were also performed on the musical theatre production of \\"The Man from Snowy River: Arena Spectacular\\". The trick riders for the show included Deborah Brennan and Zelie Bullen."},{"page_url":"https://cs.wikipedia.org/wiki/Franz_von_Krauss","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Wien_-_Volksoper.JPG","page_title":"Franz von Krauss","context_page_description":"Franz von Krauss byl rakouský architekt."},{"page_url":"https://en.wikipedia.org/wiki/Endymion_(mythology)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Girodet_-_Sommeil_Endymion.jpg","page_title":"Endymion (mythology)","context_page_description":"In Greek mythology, Endymion was variously a handsome Aeolian shepherd, hunter, or king who was said to rule and live at Olympia in Elis. He was also venerated and said to reside on Mount Latmus in Caria, on the west coast of Asia Minor.\\nThere is confusion over Endymion's correct identity, as some sources suppose that he was, or was related to, the prince of Elis, and others suggest he was a shepherd from Caria. There is a later suggestion that he was an astronomer: Pliny the Elder mentions Endymion as the first human to observe the movements of the moon, which accounts for Endymion's love. Consequently, there have been two attributed sites of Endymion's burial: the citizens of Heracleia ad Latmo claimed that Endymion's tomb was on Mount Latmus, while the Eleans declared that it was at Olympia.\\nHowever, the role of lover of Selene, the moon, is attributed primarily to Endymion who was either a shepherd or an astronomer, either profession providing justification for him to spend time beneath the moon."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B1%CF%8C%CF%82_%CE%91%CE%B3%CE%AF%CE%BF%CF%85_%CE%9B%CE%B1%CE%B6%CE%AC%CF%81%CE%BF%CF%85_(%CE%9B%CE%AC%CF%81%CE%BD%CE%B1%CE%BA%CE%B1)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Cyprus-lazarus-church_hg.jpg","page_title":"Ναός Αγίου Λαζάρου (Λάρνακα)","context_page_description":"Ο ναός του Αγίου Λαζάρου είναι χριστιανικός ναός ο οποίος βρίσκεται στη Λάρνακα, Κύπρος. Ο ναός χρονολογείται από το τέλος του 9ου αιώνα και υπάγεται στην αυτοκέφαλη ελληνορθόδοξη εκκλησία της Κύπρου. Ο ναός είναι αφιερωμένος στον Άγιο Λάζαρο της Βηθανίας, τον οποίο σύμφωνα με τον κατά Ιωάννη Ευαγγέλιο ανέστησε ο Ιησούς τέσσερις ημέρες μετά τον θάνατό του. Σύμφωνα με την εκκλησιαστική παράδοση, ο Λάζαρος μετά την ανάσταση έφυγε από την Ιουδαία ώστε να μην δολοφονηθεί και κατέφυγε στην Κύπρο. Εκεί οι απόστολοι Παύλος και Βαρνάβας τον όρισαν πρώτο επίσκοπο Κιτίου. Έζησε στην Λάρνακα μέχρι τον θάνατό του και η εκκλησία κτίστηκε πάνω από τον θεωρούμενο ως τάφο του."},{"page_url":"https://en.wikipedia.org/wiki/Williston,_North_Dakota","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Williston_North_Dakota_US2_and_US85.jpg","page_title":"Williston, North Dakota","context_page_description":"Williston is a city in and the county seat of Williams County, North Dakota, United States. The 2010 census gave its population as 14,716, and the Census Bureau gave the 2019 estimated population as 29,033, making Williston the sixth-largest city in North Dakota. The North Dakota oil boom is largely responsible for the sharp increase in population.\\nWilliston's newspapers, both in print and online, are the daily Williston Herald and the weekly The Williston Trader. Williston is the home of Williston State College and the Miss North Dakota Scholarship Pageant."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A7%D9%84%D8%A2%D8%AB%D8%A7%D8%B1_%D9%88%D8%A7%D9%84%D9%85%D9%88%D8%A7%D9%82%D8%B9_%D8%A7%D9%84%D8%A3%D8%AB%D8%B1%D9%8A%D8%A9_%D9%81%D9%8A_%D8%A7%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/%D8%A8%D8%B1%D8%AC-%D8%A7%D9%84%D8%B4%D9%86%D8%A7%D9%86%D8%A9.jpg","page_title":"قائمة الآثار والمواقع الأثرية في السعودية","context_page_description":"هذه قائمة بالمواقع الأثرية والتاريخية في السعودية جنوب غربي قارة آسيا وإحدى دول الشرق الأوسط."},{"page_url":"https://cs.wikipedia.org/wiki/Falkirk_Wheel","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Falkirk_wheel.jpg","page_title":"Falkirk Wheel","context_page_description":"Falkirk Wheel je originální rotační lodní výtah, nacházející se nedaleko města Falkirk ve Skotsku. Propojuje průplavy Forth and Clyde Canal a Union Canal a překonává výškový rozdíl 24 m. Umožňuje vnitrozemské vodní spojení mezi městy Edinburgh a Glasgow.\\nVýtah se skládá ze dvou van, které jsou umístěny na koncích mohutného rotoru. Obě vany mají kapacitu 600 tun vody. Díky Archimedově zákonu nezáleží na hmotnosti plujících lodí a obě vany jsou vždy vyváženy. K pohonu celého zařízení proto stačí relativně slabý motor, který otočí rotorem o 180° za 5 minut.\\nFalkirk Wheel je jediný rotační lodní výtah tohoto typu na světě a je považován za technickou pamětihodnost Skotska. Ve Spojeném království je provozován ještě jeden lodní výtah – Andertonský lodní výtah. Ten pracuje na podobném principu dvou vyvážených nádrží, z nichž jedna stoupá vzhůru, zatímco druhá klesá.\\nVýtah nahradil systém 11 zdymadel, který umožňoval přepravu mezi kanály až do 30. let 20. století.\\nStavba výtahu stála 17,5 miliónu liber, celý projekt oživení kanálů 84,5 miliónu liber.\\nVýtah byl slavnostně otevřen královnou Alžbětou II. 24. května 2002."},{"page_url":"https://vi.wikipedia.org/wiki/Bruno_Mars","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Bruno_Mars_Doowops.jpg","page_title":"Bruno Mars","context_page_description":"Peter Gene Hernandez, được biết đến với nghệ danh Bruno Mars, là một ca sĩ-nhạc sĩ và nhà sản xuất thu âm người Mỹ. Mars lớn lên trong một gia đình nghệ sĩ ở Honolulu, Hawaii và anh đã bắt đầu ca hát từ khi còn nhỏ. Sau khi biểu diễn nhiều nơi ở quê nhà quê anh thời niên thiếu, anh quyết định theo đuổi sự nghiệp ca hát. Anh đã bắt đầu sản xuất bài hát cho các nghệ sĩ khác, tham gia nhóm sản xuất The Smeezingtons.\\nBruno Mars được ghi nhận là một nghệ sĩ hát đơn thực sự sau khi anh góp giọng và đồng sáng tác các bài hát \\"Nothin' on You\\" của B.o.B và \\"Billionaire\\" của Travie McCoy. Anh cũng đồng sáng tác các hit \\"Right Round\\" của Flo Rida và Kesha, \\"Wavin' Flag\\" của K'naan, \\"Fuck You!\\" của Cee Lo Green. Tháng 10 năm 2010, anh phát hành album đầu tiên của mình, Doo-Wops & Hooligans, đã đạt đến vị trí số 3 trên Billboard 200. Hai đĩa đơn từ album này, \\"Just the Way You Are\\" và \\"Grenade\\" đều đã đạt vị trí quán quân trên Billboard Hot 100. Album phòng thu thứ hai của anh với tựa đề Unorthodox Jukebox được phát hành vào ngày 11 tháng 12 năm 2012."},{"page_url":"https://en.wikipedia.org/wiki/Jew%27s_harp","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Jew%27s_harp.jpg","page_title":"Jew's harp","context_page_description":"The Jew's harp, also known as the jaw harp, mouth harp, gewgaw, guimbard, khomus, trump, Ozark harp, Galician harp, or murchunga is a lamellophone instrument, consisting of a flexible metal or bamboo tongue or reed attached to a frame.\\nJew's harps may be categorized as idioglot or heteroglot, by the shape of the frame, by the number of tines, and whether the tines are plucked, joint-tapped, or string-pulled."},{"page_url":"https://pl.wikipedia.org/wiki/WWE_Intercontinental_Championship","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Jericho_9th_Intercontinental_Championship.jpg","page_title":"WWE Intercontinental Championship","context_page_description":"WWE Intercontinental Championship – tytuł mistrzowski profesjonalnego wrestlingu stworzony i promowany przez federację WWE w brandzie Smackdown. Wraz z WWE United States Championship jest jednym z dwóch drugorzędnych solowych tytułów w federacji. Aktualnie pas posiada Sami Zayn, którego jest to pierwsze panowanie.\\nMistrzostwo zostało wprowadzone przez World Wrestling Federation 1 września 1979, zaś inauguracyjnym mistrzem był Pat Patterson, który zunifikował WWF North American Heavyweight i South American Heavyweight Championship. Jest to obecnie trzecie najstarsze mistrzostwo WWE, tuż za WWE Championship i United States Championship. Pomimo że jest generalnie broniony w początku lub środku karty walk, tytuł był broniony w walkach wieczoru WrestleManii VI, SummerSlam 1992, trzeciej i ósmej gali z cyklu In Your House oraz Backlash 2001. Mistrzostwo jest określane jako odskocznia od WWE Championship."},{"page_url":"https://pt.wikipedia.org/wiki/Two_Tickets_to_Broadway","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Gloria_DeHaven.jpg","page_title":"Two Tickets to Broadway","context_page_description":"Two Tickets to Broadway é um filme estadunidense de 1951, do gênero comédia musical, dirigido por James V. Kern e estrelado por Tony Martin e Janet Leigh."},{"page_url":"https://pl.wikipedia.org/wiki/Jan_Skala","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Pomnik.Jana.Skali-Namyslow.JPG","page_title":"Jan Skala","context_page_description":"Jan Skala – serbołużycki polityk, dziennikarz, poeta, prozaik, publicysta i teoretyk zagadnień mniejszościowych."},{"page_url":"https://cy.wikipedia.org/wiki/Colin_McRae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Colin_McRae_Subaru_Impreza_WRC.jpg","page_title":"Colin McRae","context_page_description":"Gyrrwr Albanaidd ym Mhencampwriaeth Rali'r Byd oedd Colin Steele McCrae MBE, mab Jimmy McRae, enillydd Pencampwriaeth Rali Prydain pum gwaith, a brawd hyn y gyrrwr proffesiynol Alister McRae. Enillodd Bencampwriaeth Rali'r Byd yn 1995, a bu'n ail yn 1996, 1997 a 2001, a thrydydd yn 1998.\\nHelpodd Colin i Subaru ennill Pencampwriaeth y Gwneuthurwyr yn 1995, 1996 a 1997, a Citroën yn 2003. Cafodd MBE gan y frenhines, Elisabeth II, yn 1996.\\nBu farw McRae mewn damwain pan ddisgynnodd ei hofrennydd i'r ddaear wrth lanio ar dir ei gartref yn Lanark."},{"page_url":"https://eu.wikipedia.org/wiki/Platypelis_grandis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Platypelis_grandis_01.jpg","page_title":"Platypelis grandis","context_page_description":"Platypelis grandis Platypelis generoko animalia da. Anfibioen barruko Microhylidae familian sailkatuta dago, Anura ordenan."},{"page_url":"https://lv.wikipedia.org/wiki/Kembrid%C5%BEas_Universit%C4%81te","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/TrinityCollegeCamGreatCourt.jpg","page_title":"Kembridžas Universitāte","context_page_description":"Kembridžas Universitāte ir sabiedriski finansēta universitāte Kembridžā, Apvienotajā Karalistē. Tiek uzskatīta par vienu no izcilākajām un prestižākajām universitātēm pasaulē. Pasaules universitāšu akadēmiskajā reitingā ieņem 4. vietu."},{"page_url":"https://es.wikipedia.org/wiki/Bajo_el%C3%A9ctrico","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Clarke_Wooten.jpg","page_title":"Bajo eléctrico","context_page_description":"El bajo eléctrico, llamado sencillamente bajo, ​ es un instrumento musical melódico de la familia de los cordófonos, similar en apariencia y construcción a la guitarra eléctrica pero con un cuerpo de mayores dimensiones, un mástil de mayor longitud y escala y, normalmente, cuatro cuerdas afinadas según la afinación estándar del contrabajo, su antecesor.​​\\nSalió de la necesidad de producir los sonidos rítmicos graves con un instrumento más compacto, barato, fácil de producir y transportar que el contrabajo, que era el instrumento encargado de esta tarea en los años 40 y 50. Para esto, el bajo adoptó una forma bastante similar a la de la guitarra, aunque luego esto provocó que algunas personas confundieran estos dos instrumentos.\\nCon el objetivo de evitar un uso excesivo de líneas adicionales en el pentagrama, el bajo eléctrico ―al igual que el contrabajo― suena una octava más grave que las notas representadas en notación musical. Como la guitarra eléctrica, el bajo eléctrico necesita ser conectado a un amplificador para emitir sonidos."},{"page_url":"https://pt.wikipedia.org/wiki/Furac%C3%A3o_Agnes","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Agnes_1972_track.png","page_title":"Furacão Agnes","context_page_description":"O furacão Agnes foi o furacão na época mais caro a atingir os Estados Unidos, causando uma estimativa de US $ 2,1 bilhões em prejuízos. O número de mortos do furacão foi de 128. Os efeitos de Agnes foram generalizados, do Caribe ao Canadá, com grande parte da costa Leste dos Estados Unidos afetada. Os danos foram maiores na Pensilvânia, onde Agnes foi o ciclone tropical mais húmido do estado. Devido aos efeitos significativos, o nome Agnes foi retirado na primavera de 1973.\\nAgnes foi o segundo ciclone tropical e a primeira tempestade da temporada de furacões no oceano Atlântico de 1972. Desenvolveu-se como uma depressão tropical em 14 de junho da interação de uma frente polar e um cavado superior sobre a península de Iucatã. A tempestade surgiu no mar do Caribe ocidental em 15 de junho, no dia seguinte foi nomeada a tempestade tropical Agnes. Depois disso, Agnes lentamente curvou para o norte e passou a oeste de Cuba em 17 de junho. No início de 18 de junho, a tempestade intensificou-se o suficiente para ser atualizada para o furacão Agnes. Seguindo para o norte, no final de 19 de junho o furacão finalmente chegou a terra firme perto de Panama City, Flórida."},{"page_url":"https://fy.wikipedia.org/wiki/Edward_Sheriff_Curtis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/ApsarokaHorse.jpg","page_title":"Edward Sheriff Curtis","context_page_description":"Edward Sheriff Curtis wie in Amerikaansk fotograaf, dy't benammentlik ferneamd waard fan syn fotostúdzjes fan it libben fan de Noard-Amerikaanske Yndianen, dêr't er him goed tritich jier fan syn libben mei dwaande hold."},{"page_url":"https://en.wikipedia.org/wiki/Dale_Hoganson","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Dale_Hoganson_1969.JPG","page_title":"Dale Hoganson","context_page_description":"Dale Gordon Hoganson is a Canadian retired professional ice hockey player who played 344 games in the National Hockey League and 378 games in the World Hockey Association. He played for the Los Angeles Kings, Montreal Canadiens, Quebec Nordiques, and Birmingham Bulls. In 1973 Dale was included with Montreal Canadiens official Stanley Cup winning picture, and was awarded a Stanley Cup ring. His name was left off the Stanley Cup, because did not officially qualify. He is cousin with Paul Hoganson."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_prot%C3%A9g%C3%A9s_en_1912","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Etang_Saclay.JPG","page_title":"Liste des monuments historiques protégés en 1912","context_page_description":"Cet article recense les monuments historiques français classés en 1912."},{"page_url":"https://no.wikipedia.org/wiki/Tennessee_Titans","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Eddie_George.jpg","page_title":"Tennessee Titans","context_page_description":"Tennessee Titans er et profesjonelt amerikansk fotballag basert i Nashville, Tennessee. Laget konkurrer i National Football League i ligaens American Football Conference i AFC South-divisjonen. Laget ble stiftet under navnet Houston Oilers av Bud Adams som var lagets eier frem til hans død i 2013, og begynte laget å spille i 1960 i Houston, Texas, som et oppstartslag i American Football League. Oilers vant de første to AFL-titlene samt fire divisjonstitler, og ble med i NFL etter de to ligaene slo seg sammen i 1970. Oilers nådde sluttspillet flere sesonger på rad i periodene 1978–1980 og 1987–1993, med Hall of Famerne Earl Campbell og Warren Moon, respectively.\\nLaget flyttet fra Houston til Tennessee i 1997, hvor de spilte i Liberty Bowl Memorial Stadium i Memphis i en sesong. De flyttet så til Nashville i 1998, hvor de spilte i Vanderbilt Stadium. I de to årene var de kjent som \\"Tennessee Oilers\\", men skiftet navn til \\"Tennessee Titans\\" før 1999-sesongen. Laget spiller nå i Nissan Stadium, som åpnet i 1999 under navnet Adelphia Coliseum. Titans treningsfasiliteter er i Saint Thomas Sports Park i MetroCenter i Nashville."},{"page_url":"https://sv.wikipedia.org/wiki/Komposit","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Composite_3d.png","page_title":"Komposit","context_page_description":"Kompositer är sammansatta material, där två eller fler av de ingående materialen var för sig har helt olika egenskaper och tillsammans bildar ett konstruktionsmaterial med nya egenskaper.\\nKompositmaterial har använts länge, exempelvis hyddor av lera och växtmaterial.\\nTrä kan betraktas som en naturlig komposit med cellulosafibrer som ger styrka och lignin som fungerar som bindemedel."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%A4%D7%A0%D7%94_%D7%9C%D7%99%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Daphna1_liel.jpg","page_title":"דפנה ליאל","context_page_description":"דפנה ליאל היא עיתונאית ישראלית המשמשת ככתבת הכנסת של חברת החדשות של ערוץ 12."},{"page_url":"https://en.wikipedia.org/wiki/National_symbols_of_North_Korea","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Nkorea08-5000a.jpg","page_title":"National symbols of North Korea","context_page_description":"Upon its liberation in 1945 and subsequent foundation in 1948, North Korea adopted national symbols distinct from the national symbols of South Korea. The traditional flag of Korea, the Taegukgi, and the symbol Taeguk, were swapped for communist symbols.\\nSome of the symbols of North Korea – the national emblem, flag, anthem and capital – are defined in the constitution of North Korea, while others such, as the national sport Ssirum or the national dish kimchi, are traditional. Some traditional symbols are shared with the South but with different connotations. Mount Paektu, for instance, is recognized as the symbol of Korea across the peninsula, but North Koreans revere it as the birthplace of Kim Jong-il. Some North Korean symbols are complemented with symbols for the ruling Kim family. For example, the Magnolia sieboldii is the national flower but the hybrid orchids Kimilsungia and Kimjongilia are also respected."},{"page_url":"https://da.wikipedia.org/wiki/Nationals_Park","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Nationals_Park_181.jpg","page_title":"Nationals Park","context_page_description":"Nationals Park er et baseballstadion i Washington D.C. USA, der er hjemmebane for MLB-klubben Washington Nationals. Stadionet har plads til 41.888 tilskuere, og blev indviet 30. marts 2008. Stadionet erstattede her Nationals gamle hjemmebane RFK Stadium."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD-%D0%9B%D0%BE%D1%80%D0%B0%D0%BD-%D0%B4%D0%B5-%D0%9B%D0%B5%D0%B2%D0%B5%D0%B7%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Saint-Laurent-de-L%C3%A9v%C3%A9zou_mairie.jpg","page_title":"Сен-Лоран-де-Левезу","context_page_description":"Сен-Лора́н-де-Левезу́ — коммуна во Франции, находится в регионе Юг — Пиренеи. Департамент — Аверон. Входит в состав кантона Везен-де-Левезу. Округ коммуны — Мийо.\\nКод INSEE коммуны — 12236.\\nКоммуна расположена приблизительно в 520 км к югу от Парижа, в 140 км северо-восточнее Тулузы, в 35 км к юго-востоку от Родеза."},{"page_url":"https://pt.wikipedia.org/wiki/Pr%C3%A9mio_Kan_Kikuchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Kido_okamoto.jpg","page_title":"Prémio Kan Kikuchi","context_page_description":"O Prémio Kan Kikuchi, batizado em homenagem ao escritor Kan Kikuchi, é entregue anualmente pela revista literária Bungeishunjū e pela Sociedade para a Promoção da Literatura Japonesa, em honra às realizações da cultura literária japonesa em todos os aspetos."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%DB%8C_%DB%B1%DB%B7_%D9%85%D9%88%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Bundesarchiv_Bild_102-06183%2C_Berlin-Tempelhof%2C_Sturmsch%C3%A4den_an_Flugzeug.jpg","page_title":"ای ۱۷ موه","context_page_description":"ای ۱۷ موه یک هواگرد ملخ‌پیشین تک‌موتوره از نوع هواپیمای مسافربری ساخت شرکت Focke-Wulf است. هواگرد ای ۱۷ موه نخستین پروازش را در ۱۹۲۷ میلادی انجام داد. در مجموع، تعداد ۲۰ فروند از این هواگرد ساخته شده‌است."},{"page_url":"https://it.wikipedia.org/wiki/Tombe_dei_faraoni_d%27Egitto","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/King_Narmer.jpg","page_title":"Tombe dei faraoni d'Egitto","context_page_description":"Questo è l'elenco dei luoghi di sepoltura dei faraoni d'Egitto."},{"page_url":"https://ca.wikipedia.org/wiki/Conjunt_monumental_de_la_Roca","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Catalunya_en_Miniatura-Sant_Mart%C3%AD_Sarroca.JPG","page_title":"Conjunt monumental de la Roca","context_page_description":"El Conjunt monumental de la Roca està format per dues construccions del segle x i del segle xii, el Castell de Sant Martí Sarroca i l'església de Santa Maria, que estan situats a la població de Sant Martí Sarroca, a l'Alt Penedès, al cim del turó de la Roca. És un dels conjunts més ben conservats del romànic català i ambdós edificis estan catalogats com monument històric artístic d'interès nacional i formen part del museu municipal.\\nEl turó de la Roca i el seu conjunt monumental són el centre de referència del municipi de Sant Martí Sarroca. En el segle X el turó servia de punt de guaita i de protecció per als seus habitants. Anteriorment havia estat un assentament ibèric i també romà, segons diversos indicis.\\nDes de la baixa edat mitjana i fins al segle XIX, al voltant del castell s'hi consolidà un nucli de població que donà origen de l'actual poble. El nucli va ser destruït durant la Primera Guerra Carlina. En aquesta època va començar el creixement del nucli de població de les cases noves, a baix al pla, com a cap del municipi i principal nucli de població. Els carrers de Casetes i de Cases Noves mostren l'expansió de la població fora del nucli murallat."},{"page_url":"https://en.wikipedia.org/wiki/2008_Langerado_Music_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Langerado_2008.jpg","page_title":"2008 Langerado Music Festival","context_page_description":"The sixth Langerado Festival was held March 6, 2008 through March 9, 2008, making it one day longer than the previous year. The festival took place on the Big Cypress Indian Reservation, thirty miles west of Ft. Lauderdale and featured on-site camping."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E4%B8%AD%E6%96%87%E5%A4%A7%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/CUHK_UniversitySportsCentre.jpg","page_title":"香港中文大學","context_page_description":"香港中文大學，簡稱中文大學、中大、港中文，是一所香港公立大學，也是香港第一所研究型大學，於1963年合併新亞書院、崇基學院及聯合書院而成立，其中的組成書院最早源於1845年在清朝中葉成立的基督教教會大學，為香港歷史源流最久遠的高等學院。香港中文大學現已發展成為轄九大書院的書院制大學。\\n該校既是香港的天災監測中心，亦是該地社會科學、國學、工商管理、理學及醫學的主要研究機構。截止2018年10月，香港中文大學的校友、教授及研究人員中，共有5位獲得諾貝爾獎、1位獲得菲爾茲獎、1位獲得圖靈獎，其他獎項包括沃爾夫數學獎、勒諾多文學獎和克魯格人文與社會科學終身成就獎得主以及包括嶺南大學、香港大學等在內的等高校的校長，是唯一具有獲得國際頂級獎項的校友以及諾貝爾獎、菲爾茲獎、圖靈獎及奧斯瓦爾德·維布倫幾何學獎得主專任任教的香港高校。香港教育歷來產生的諾貝爾獎等級的學者中，三分之二是中大的校友、教授。 香港中文大學本科畢業生獲得羅德獎學金的數目為香港最高，也是歷代神童出現最多的本地大學。"},{"page_url":"https://ro.wikipedia.org/wiki/Arhitectur%C4%83_von_Neumann","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Schema_arhitecturii_von_Neumann.png","page_title":"Arhitectură von Neumann","context_page_description":"Arhitectura von Neumann este una din arhitecturile posibile ale calculatoarelor numerice, arhitectură care are în centrul ei o unitate centrală de procesare și o unitate separată de memorare. Datează din anii 1940.\\nNumele provine de la John von Neumann, un renumit matematician și pionier al informaticii american de origine austro-ungar evreu, primul care a stabilit cerințele pentru un calculator electronic de uz general. Arhitectura s-a înrădăcinat, iar majoritatea calculatoarelor construite până acum au avut și au această arhitectură.\\nPrincipalul obiectiv al lui von Neumann a fost să construiască un sistem de calcul de uz general în care datele de prelucrat și rezultatele calculelor intermediare să fie stocate alături de instrucțiuni într-o memorie comună suficient de mare. Conform acestei arhitecturi, într-un sistem de calcul general chiar și instrucțiunile însele trebuie să poată fi modificate la fel de ușor ca și numerele cu care lucrează și pe care le modifică ele. Astfel, instrucțiunile sunt codificate numeric și stocate în aceeași memorie ca și datele."},{"page_url":"https://en.wikipedia.org/wiki/List_of_passports","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Indian_Passport_cover_2015.jpg","page_title":"List of passports","context_page_description":"A passport is a booklet issued by countries to their citizens, permitting the person to travel to other countries. In some cases countries issue travel documents similar to passports to their residents. International organizations also issue travel documents, usually called laissez-passer, to their staff."},{"page_url":"https://de.wikipedia.org/wiki/Anker_(Heraldik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Wappen_Braunschweig-Neustadt.png","page_title":"Anker (Heraldik)","context_page_description":"Der Anker ist als gemeine Figur in der Heraldik eine häufig gewählte Wappenfigur."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%AD%D8%B1%D8%A8_%D8%A7%D9%84%D8%B4%D9%8A%D8%B4%D8%A7%D9%86%D9%8A%D8%A9_%D8%A7%D9%84%D8%A3%D9%88%D9%84%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Evstafiev-chechnya-women-pray.jpg","page_title":"الحرب الشيشانية الأولى","context_page_description":"الحرب الشيشانية الأولى، والمعروفة أيضا باسم الحرب في الشيشان، هي حرب دارت رحاها بين روسيا والشيشان بين ديسمبر 1994 وأغسطس 1996. أدت إلى استقلال فعلي وليس رسمي للشيشان عن روسيا وإنشاء جمهورية الشيشان إشكيريا.\\nبعد الهجمات الأولية من 1994-1995 وحدوث معركة غروزني المدمرة، أجبر الاتحاد الروسي محاولاً أن يتحكم في منطقة الجبال الشيشانية ولكن تم إحباطه عن طريق حرب العصابات الشيشانية والهجمات على الأرض، برغم قوة روسيا الهائلة في عدد الجنود والأسلحة والمساندة الجوية. أدى هذا إلى إضعاف معنويات الجيش الروسي بالإضافة إلى المعارضة شبه العالمية ضد الروس من أجل الصراع الوحشي, مما حدى بحكومة بوريس يلتسين إلى إعلان وقف إطلاق النار في 1996 وتوقيع معاهدة سلام بعدها بسنة.\\nبلغت الخسائر الرسمية العسكرية الروسية 5.500، بينما معظم التقديرات تشير إلى 3,500 و7،500. على الرغم من عدم وجود أرقام دقيقة لعدد قتلى العسكريين الشيشان, فإن التقرير الرسمي الروسي يضع الرقم حوالي 15000. الانفصاليون الشيشان يدعوا أكثر من 3000. الارقام المختلفة تشير إلى أن عدد القتلى المدنيين بين 50000 - 100000, وأكثر من 200000 مصاب. هاجر أكثر من 500000 شخصا بسبب الصراع حيث أصبحت القرى والمدن على الحدود في دمار هائل."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%B5%D1%81%D1%82%D0%B8_%D1%83_%D0%A1%D1%80%D0%B1%D0%B8%D1%98%D0%B8_2017.","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/2017_serbia_protest_symbol.png","page_title":"Протести у Србији 2017.","context_page_description":"Протести у Србији 2017. године, познатији под називом Протест против диктатуре, били су масовни протести огранизовани широм Београда, Новог Сада, Ниша и других градова у Србији и представљале су до тада најмасовније свакодневне антирежимске демонстрације у историјском периоду после свргавања Слободана Милошевића.\\nНастали су као реакција на резултате председничких избора одржаних 2. априла 2017. године, а били су усмерени директно против новоизабраног председника Александра Вучића. Непосредни повод је била медијска слика и свеукупна атмосфера у којима су избори одржани. Наиме, целокупни период изборне кампање, тишине и дан самих избора су били обележени оптужбама о застрашивању бирача и готово тоталном доминацијом Вучића и његове Српске напредне странке у српским медијима. Према извештају ОЕБС-а, неизбалансирано извештавање медија, притисци на бираче и запослене у државним институцијама и злоупотреба јавних ресурса за спровођење кампање су пољуљали једнакост могућности у такмичењу кандидата. Делегација Савета Европе је идентификовала бројне неправилности и недостатке током изборног процеса и том приликом дала препоруке Србији да побољша своју изборну законску регулативу."},{"page_url":"https://sk.wikipedia.org/wiki/Lesn%C3%A1_(okres_Znojmo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Kostel_v_Lesn%C3%A9.JPG","page_title":"Lesná (okres Znojmo)","context_page_description":"Lesná je obec v Česku v okrese Znojmo v Juhomoravskom kraji. 1. januára 2012 tu žilo 270 obyvateľov, z toho 137 mužov a 133 žien, pričom priemerný vek v obci bol 41,3 roka."},{"page_url":"https://it.wikipedia.org/wiki/Abbazia_di_Nostra_Signora_di_Paulis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Ittiri_-_Abbazia_di_Nostra_Signora_di_Paulis_%2835%29.JPG","page_title":"Abbazia di Nostra Signora di Paulis","context_page_description":"L'abbazia di Nostra Signora di Paulis è un edificio religioso, ridotto allo stato di rudere, situato in territorio di Ittiri, centro abitato della Sardegna nord-occidentale. La sua costruzione risale al primo XIII secolo ad opera dei monaci cistercensi. Crollata parzialmente alla fine del XIX secolo, ne sopravvivono parte della navata e del transetto, la navatella destra, i resti di uno dei chiostri e molti ambienti semidistrutti tra cui alcune sale sotterranee. Il complesso è stato riconsolidato da un recente restauro.\\nUna chiesa recente con lo stesso titolo si trova nel vicino paese di Uri e testimonia la devozione molto diffusa verso la Madonna sotto questo antico titolo anche in questo centro e in quelli vicini.\\nTuttavia la chiesa urese non ha relazione con la chiesa abbaziale, trovandosi in un altro territorio comunale e nella diocesi di Alghero. Il territorio di Ittiri e l'abbazia appartengono invece all'arcidiocesi di Sassari e l'arcivescovo di Sassari detiene il titolo onorifico di abate di Paulis sin dalla prima metà del XV secolo. Nella chiesa si onora, da parte della città di Ittiri, la Madonna di Chiaravalle o d'Itria, ricordata la terza domenica di maggio."},{"page_url":"https://hu.wikipedia.org/wiki/Anna_Karol%C3%ADna_Schmiedlov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Schmiedlova_RG15_%2810%29_%2819310570111%29.jpg","page_title":"Anna Karolína Schmiedlová","context_page_description":"Anna Karolína Schmiedlová szlovák profi teniszezőnő.\\nHárom egyéni WTA-tornagyőzelemmel rendelkezik. Emellett még egyéniben 12 ITF-tornát nyert. A Grand Slam-tornákon a legjobb eredményt a 2014. évi Roland Garroson, valamint a 2015. évi US Openen érte el, amelyeken a 3. fordulóig jutott. Juniorként 2012-ben a Roland Garros döntőjébe jutott. Legjobb egyéni világranglista-helyezése a 26., amely helyet 2015. október 12-én foglalta el, párosban a 213. helyen állt 2015. június 15-én. 2012-ben, valamint 2014–2016 között szerepelt Szlovákia Fed-kupa-válogatottjában.\\nTestvére Kristína Schmiedlová szintén profi teniszező."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%8E%D0%B1%D0%B0%D0%BD%D1%8C_(%D0%91%D1%96%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/%D0%9B%D1%8E%D0%B1%D0%B0%D0%BD%D1%8C._%D0%A6%D0%B0%D1%80%D0%BA%D0%B2%D0%B0_%2801%29.jpg","page_title":"Любань (Білорусь)","context_page_description":"Любань — місто в Мінській області Білорусі, центр Любанського района."},{"page_url":"https://en.wikipedia.org/wiki/Tainhas_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Cachoeira_do_Passo_do_S.jpg","page_title":"Tainhas State Park","context_page_description":"The Tainhas State Park is a state park in the state of Rio Grande do Sul, Brazil.\\nIt protects forests in the valley of the Tainhas River surrounded by open fields. The main attraction is the Cachoeira do Passo do S, a waterfall."},{"page_url":"https://ceb.wikipedia.org/wiki/Evol%C3%A8ne_(kapital_sa_distrito)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Karte_Gemeinde_Evol%C3%A8ne_2011.png","page_title":"Evolène (kapital sa distrito)","context_page_description":"Kapital sa distrito ang Evolène sa Nasod nga Swiss. Nahimutang ni sa distrito sa Hérens District ug kanton sa Canton du Valais, sa habagatang bahin sa nasod, 90 km sa habagatan sa Bern ang ulohan sa nasod. 1,340 metros ibabaw sa dagat kahaboga ang nahimutangan sa Evolène, ug adunay 1,557 ka molupyo.\\nAng yuta palibot sa Evolène kay kasagaran daghan kaayong kabukiran. Evolène nahimutang sa usa ka walog. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,955 ka metro ug 1.0 km sa amihanan-sidlakan sa Evolène. Dunay mga 10 ka tawo kada kilometro kwadrado sa palibot sa Evolène may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Sitten, 16.5 km sa amihanan-kasadpan sa Evolène. Hapit nalukop sa kasagbotan ang palibot sa Evolène. Sa rehiyon palibot sa Evolène, kabukiran talagsaon komon.\\nAng klima tundra. Ang kasarangang giiniton -3 °C. Ang kinainitan nga bulan Hulyo, sa 8 °C, ug ang kinabugnawan Enero, sa -15 °C. Ang kasarangang pag-ulan 1,585 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 179 milimetro nga ulan, ug ang kinaugahan Marso, sa 64 milimetro."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AA%E0%B5%86%E0%B5%BB%E2%80%8C%E0%B4%B8%E0%B4%BF%E0%B5%BD%E2%80%8C%E0%B4%B5%E0%B4%BE%E0%B4%A8%E0%B4%BF%E0%B4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Pennsylvania-counties-map.gif","page_title":"പെൻ‌സിൽ‌വാനിയ","context_page_description":"പെൻ‌സിൽ‌വാനിയ, അമേരിക്കൻ ഐക്യനാടുകളിലെ ഒരു സംസ്ഥാനമാണ്. ഔദ്യോഗികമായി കോമൺവെൽത്ത് ഓഫ് പെൻസിൽവാനിയ എന്നറിയപ്പെടുന്ന ഈ സംസ്ഥാനം അമേരിക്കൻ ഐക്യനാടുകളുടെ വടക്കുകിഴക്കൻ, മദ്ധ്യ അറ്റ്‍ലാന്റിക് പ്രദേശങ്ങളിൽ സ്ഥിതിചെയ്യുന്നു. അപ്പലേച്യൻ പർവതം സംസ്ഥാനത്തിൻറെ മധ്യഭാഗത്തുകൂടി കടന്നുപോകുന്നു. ഐക്യനാടുകളി‍ൽ രൂപീകൃതമായ 13 ആദിമ സ്ഥാപിത സംസ്ഥാനങ്ങളിലൊന്നാണിത്. 13 ആദ്യകോളനികളുടെ മധ്യഭാഗത്തായിരുന്നു പെൻസിൽ‌വാനിയയുടെ സ്ഥാനം. ഇതിനാൽ കീസ്റ്റോൺ സ്റ്റേറ്റ് എന്നറിയപ്പെടുന്നു. അമേരിക്കൻ സർക്കാർ, ഭരണഘടനാ രൂപവത്കരണ വേളകളിലെ സുപ്രധാന മുഹൂർത്തങ്ങൾക്കു വേദിയായ സംസ്ഥാനമാണിത്.\\nസംസ്ഥാനത്തിൻറെ പേരിനു കാരണക്കാരനായ സർ വില്ല്യം പെന്നിൻറെ പുത്രനു് 1681 ൽ ലഭിച്ച രാജകീയ ഭൂമിയിൽനിന്നാണ് ഈ നഗരത്തിൻറെ തുടക്കം. ഡിലാവെയർ നദിയ്ക്കു സമാന്തരമായുള്ള പെൻസിൽവാനിയയുടെ ഭാഗവും ഇന്നത്തെ ഡിലാവെയർ സംസ്ഥാനത്തിന്റെ ഭാഗവും ഒന്നുചേർന്ന് ആദ്യകാലത്ത് ന്യൂ സ്വീഡൻ കോളനി സംഘടിപ്പിക്കപ്പെട്ടിരുന്നു. 1787 ഡിസംബർ 12-ന് അമേരിക്കൻ ഭരണഘടനയാൽ അംഗീകരിക്കപ്പെട്ട രണ്ടാമത്തെ സംസ്ഥാനമായിരുന്നു ഇത്. അമേരിക്കൻ സ്വാതന്ത്ര്യത്തിൻറെ പ്രഖ്യാപനവും ഐക്യനാടുകളുടെ ഭരണഘടനയുടെ രൂപരേഖയും തയ്യാറാക്കിയ ഇൻഡിപ്പെൻഡൻസ് ഹാൾ സംസ്ഥാനത്തെ ഏറ്റവും വലിയ നഗരമായ ഫിലാഡൽഫിയയിൽ സ്ഥിതിചെയ്യുന്നു."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%A4%E5%B7%B4%E9%9D%A9%E5%91%BD%E6%AD%A6%E8%A3%85%E5%8A%9B%E9%87%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Cuban_military_truck_in_Havanna.jpg","page_title":"古巴革命武装力量","context_page_description":"古巴革命武装力量是古巴的正规军。2006年，军费占古巴国内生产总值的3.8%。，装备得到中华人民共和国和朝鲜民主主义人民共和国的供应。古巴是一个长期实行义务兵役制的国家，年满17岁的男青年均有服兵役的义务。服役期1年或2年，长度取决于是否被高等教育机构录取。年满17岁的女性公民如果自愿，并符合军队需要，也可参军服现役。\\n菲德尔·卡斯特罗曾建立起仅次于巴西军队的拉美第二大武装力量。从1975年到1980年代末，苏联的军事援助使古巴提升了军事能力，使古巴军队有能力参与支援亚非拉国家左翼反对派或政权的行动。但随着苏联解体，古巴失去军援，被迫裁军，军人人数由1994年的23.5万人缩减到2011年的约8.5万人。从此，军队除支援国家经济建设外，还直接开办企业，其目的在于减轻政府的军费负担，并给予老一辈无产阶级革命家和高级军官提供适度的经济好处以维系军内团结。古巴革命武装力量使用的苏制武器和本国开发的轻武器与美军装备的差距正在扩大。\\n古巴陆军2007年的兵力为3.8万人。部队可得到一个空防高炮团和一个地对空导弹旅的支援。地面部队的主要武器装备包括900辆苏制T系列坦克、700辆装甲运兵车、500门机动火炮等。古巴军队还拥有多种导弹，其中包括防空军装备的300枚苏制地对空导弹。古巴空军的员额约八千人，编为6个飞行中队，装备110架米格系列战斗机和45架攻击直升机。古巴海军约有三千军人，只有一些小型舰只，包括一支550多人组成的海军陆战队。此外还有准军事部队共110余万人，其中地方民兵100余万人、劳动青年军6.5万人、民防部队5万人、国家保安队2万人、边防警卫队6500人。"},{"page_url":"https://la.wikipedia.org/wiki/Renatus_Andegavensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Renedesanjou.jpg","page_title":"Renatus Andegavensis","context_page_description":"Renatus Andegavensis cognomento bonus, Francogallice René d'Anjou atque saepe le bon roi René, fuit nobilis Franciae qui etiam regna transmarina sibi vindicavit, videlicet Hierosolymitanum, Neapolitanum, Siculum. Filius fuit Ludovici II ducis Andegavensis et Yolandae Aragonensis. Pater fuit Margaritae Andegavensis reginae Angliae. Neque Hierosolymam neque Siciliam unquam visitavit. Neapoli haud regnavit, nisi quod inter annos 1437 et 1442 in terris huius regni vano militabat. Francogallice de amore et de nobilitate scripsit. Ordinem crescentis lunae anno 1448 condidit."},{"page_url":"https://en.wikipedia.org/wiki/Wimereux","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Wimereux_France_High_Tide.jpg","page_title":"Wimereux","context_page_description":"Wimereux is a commune in the Pas-de-Calais department in the Hauts-de-France region of France."},{"page_url":"https://nl.wikipedia.org/wiki/Naaktoogpunaduif","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Bare-faced_Ground-Dove.jpg","page_title":"Naaktoogpunaduif","context_page_description":"De naaktoogpunaduif is een vogel uit de familie Columbidae."},{"page_url":"https://en.wikipedia.org/wiki/Hull_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Hull_House_Women%27s_Club_building.jpg","page_title":"Hull House","context_page_description":"Hull House was a settlement house in the United States that was co-founded in 1889 by Jane Addams and Ellen Gates Starr. Located on the Near West Side of Chicago, Illinois, Hull House opened to recently arrived European immigrants. By 1911, Hull House had grown to 13 buildings. In 1912 the Hull House complex was completed with the addition of a summer camp, the Bowen Country Club. With its innovative social, educational, and artistic programs, Hull House became the standard bearer for the movement that had grown, by 1920, to almost 500 settlement houses nationally.\\nThe Hull mansion and several subsequent acquisitions were continuously renovated to accommodate the changing demands of the association. In the mid-1960s, most of the Hull House buildings were demolished for the construction of the University of Illinois-Chicago. The original building and one additional building survive today. On June 12, 1974, the surviving Hull mansion was designated a Chicago Landmark. On June 23, 1965, it was designated as a U.S. National Historic Landmark."},{"page_url":"https://it.wikipedia.org/wiki/Ossario_del_Pasubio","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Veduta_della_vallata_dalla_sommitt%C3%A0_della_torre_dell%27ossario_del_Pasubio.jpg","page_title":"Ossario del Pasubio","context_page_description":"Il sacello-ossario del Pasubio, più noto come ossario del Pasubio, è un monumento dedicato ai caduti della prima guerra mondiale. Si trova sul colle Bellavista che domina la Val Leogra, proprio sotto il monte Cornetto a circa 2 km da Pian delle Fugazze, collegato al passo stesso dalla diramazione della ex strada statale 46.\\nLa posizione che è stata scelta permette di vedere la sagoma dell'ossario da tutta la pianura vicentina.\\nL'ossario del Pasubio, insieme a quelli di Tonezza del Cimone, del monte Grappa e di Asiago compare in uno dei quattro quarti dello stemma della provincia di Vicenza."},{"page_url":"https://no.wikipedia.org/wiki/Norsk_Kvinnesaksforening","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Anna_Bugge.jpg","page_title":"Norsk Kvinnesaksforening","context_page_description":"Norsk Kvinnesaksforening er en norsk tverrpolitisk organisasjon som jobber for jenters og kvinners menneskerettigheter. Den ble etablert i 1884 og er Norges eldste kvinneorganisasjon. NKF har som grunnleggende prinsipp at kvinner skal ha samme rettigheter og muligheter i samfunnet som menn. Professor Anne Hege Grung ble i 2020 valgt som leder av NKF; hun etterfulgte høyesterettsdommer Karin M. Bruzelius. Statsviter og Ap-politiker Beret Bråten er nestleder fra 2020. NKF har kontorer på Majorstuen i Oslo.\\nNKF ble grunnlagt etter initiativ fra Gina Krog og Hagbart Berner av 171 kjente kvinner og menn, herunder et halvt dusin statsministre. I tråd med røttene i den første bølgen av feminisme, 1800-tallets liberale feminisme, har NKF alltid fokusert på politisk og rettslig reform der målet er likestilling innenfor rammen av det liberale demokratiet."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BD%D1%83%D0%B4_(%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/LHS3rdfloorview.jpg","page_title":"Линуд (Калифорния)","context_page_description":"Линуд е град в окръг Лос Анджелис в щата Калифорния, САЩ. Линуд е с население от 72 984 жители и обща площ от 12,70 км²."},{"page_url":"https://gl.wikipedia.org/wiki/Galer%C3%ADa_de_imaxes_de_h%C3%B3rreos_de_Galicia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/H%C3%B3rreo_A_Lama.jpg","page_title":"Galería de imaxes de hórreos de Galicia","context_page_description":"O hórreo é unha construción destinada na súa orixe a secar, gardar e en xeral conservar o millo antes de o debullar."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%80%EC%A7%91_%EC%9E%A5%EC%B0%BD_%EB%B3%B4%EB%B3%91%EB%8C%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Phalanx.png","page_title":"밀집 장창 보병대","context_page_description":"밀집 장창보병대 혹은 팔랑크스는 고대 그리스 시민군의 전형적인 부대 형태 또는 그러한 부대를 운용하는 전술을 말한다. 이후 마케도니아 왕국의 알렉산드로스 대왕이 동방 원정 때에도 이 전술이 효과적으로 사용되었다.\\n고대 그리스 폴리스의 시민들은 직접 무장을 준비하여 유사시 호플리테스로 참전했다. 즉, 그리스의 보병은 훈련받은 우수한 병사라기보다는 무장을 갖춘 시민들의 집단이다. 따라서 개개인의 무용이나 현재와 같은 전술적 움직임 대신, 시민단 전체의 유기적인 연결에 집중하게 된다. 그리스식 투구, 흉갑, 정강이받이를 장비하고 왼팔에 묶은 대형의 원형 방패로 내 몸 일부와 왼쪽 병사의 몸 일부를 가려주는 형태로 바짝 다가서붙은 밀집진을 형성하며, 드러난 양쪽 날개부분은 소수의 귀족 기병들이 보호해주게 된다. 진과 진이 서로 부딪혀서 먼저 대열이 깨지는 쪽이 전쟁에서 패배하게 되는 것이 일반적인 그리스 폴리스간의 전투였다.\\n그리스 밀집진의 위력은 비슷한 훈련도를 가지고 제대로 된 대열을 갖추지 못한 보병대와 싸울 때 발휘되었다. 그리스와 페르시아 제국 간의 전쟁에서 지상군의 수효가 충분했을 때 그리스 보병 밀집진을 페르시아군이 돌파한 경우는 없었다.\\n마케도니아 왕국의 필리포스 2세와 알렉산드로스 대왕은 이를 발전시켜, 종래 그리 길이가 길지 않았던 창의 길이를 몇배로 늘여 기병돌격에서도 버틸 수 있는 사리사를 개발하였다. 한편 과거 양쪽 날개의 보호에만 주력하던 기병대를 증강하여 보병 밀집진이 전열을 유지하는 동안 기병을 이용한 우회공격을 하는 망치와 모루 전술로 동방원정에서 승승장구하게된다.\\n그러나 이러한 밀집진형은 기동성이 떨어지며 탁 트인 평지에서만 운용가능하다는 전술적인 경직성을 가지고 있어, 이후 로마의 보다 유연한 군단병이나 우수한 기동성을 가진 궁기병대와의 싸움에서는 한계를 보였다."},{"page_url":"https://it.wikipedia.org/wiki/Plotosus_lineatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Plotosus_lineatus_1.jpg","page_title":"Plotosus lineatus","context_page_description":"Plotosus lineatus Thunberg, 1787, noto in italiano come pesce gatto dei coralli, è uno dei pochissimi membri dell'ordine Siluriformes completamente adattato alla vita nelle acque marine."},{"page_url":"https://it.wikipedia.org/wiki/Eucheuma","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Aquakulturen_Rotalgen_Sansibar_1.jpg","page_title":"Eucheuma","context_page_description":"Eucheuma J.Agardh è un genere di alghe rosse della famiglia Solieriaceae."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_R%C3%BCdigsdorf_(Frohburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/R%C3%BCdigsdorfKirche.JPG","page_title":"Liste der Kulturdenkmale in Rüdigsdorf (Frohburg)","context_page_description":"Die Liste der Kulturdenkmale in Rüdigsdorf (Frohburg) enthält die Kulturdenkmale im Frohburger Ortsteil Rüdigsdorf.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%D8%AA%D9%8A%D8%B1_%D9%81%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Walter_Feit.jpg","page_title":"والتير فيت","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nوالتير فيت كان عالم رياضيات من امريكا."},{"page_url":"https://id.wikipedia.org/wiki/Tumbuhan_menahun","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/%D7%A4%D7%90%D7%A8%D7%A7_%D7%94%D7%9B%D7%A8%D7%9E%D7%9C_1_-_%D7%92%D7%A0%D7%99%D7%9D_%D7%9C%D7%90%D7%95%D7%9E%D7%99%D7%99%D7%9D_%D7%91%D7%A6%D7%A4%D7%95%D7%9F_%D7%94%D7%90%D7%A8%D7%A5_-_%D7%90%D7%AA%D7%A8%D7%99_%D7%9E%D7%95%D7%A8%D7%A9%D7%AA_2016_%28170%29.jpg","page_title":"Tumbuhan menahun","context_page_description":"Tumbuhan menahun atau tanaman menahun atau tumbuhan bertahunan atau tanaman bertahunan, adalah tumbuhan yang dapat meneruskan kehidupannya setelah bereproduksi atau menyelesaikan siklus hidupnya dalam jangka waktu lebih daripada dua tahun di dalam siklus hidupnya. Banyak di antaranya berupa pohon, meskipun terdapat pula terna ataupun semak.\\nUntuk mengatasi tantangan lingkungan, tumbuhan tahunan mengembangkan berbagai strategi untuk bertahan hidup, seperti menggugurkan daun, mengubah morfologi, atau menghasilkan senyawa tertentu yang membuat sel-selnya mampu bertahan pada perubahan lingkungan yang ekstrem."},{"page_url":"https://en.wikipedia.org/wiki/Second_inauguration_of_Lyndon_B._Johnson","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/1965_Inauguration_of_President_Lyndon_Johnson.jpg","page_title":"Second inauguration of Lyndon B. Johnson","context_page_description":"The second inauguration of Lyndon B. Johnson as President of the United States was held on Wednesday, January 20, 1965, at the East Portico of the United States Capitol in Washington, D.C. This was the 45th inauguration and marked the commencement of the second and only full term of Lyndon B. Johnson as President and the only term of Hubert Humphrey as Vice President. Chief Justice Earl Warren administered the Oath of office. Lady Bird Johnson founded the tradition of incoming First Ladies participating in the ceremony by holding the sworn-in president's Bible. Vice President Humphrey was sworn-in by John W. McCormack, the Speaker of the House of Representatives. This was the first inauguration when the president rode in a bulletproof limousine.\\nAn estimated 1.2 million attended the inauguration, at the time the record holder for any event held at the National Mall until the Obama inauguration in 2009. This was the last time an inauguration was covered by newsreels."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%9E%88%EC%BD%94%EB%84%A4%EB%B2%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Ii_Naooki.jpg","page_title":"히코네번","context_page_description":"히코네 번은 일본 에도 시대 오미국 북부를 지배했던 번으로, 지금의 시가현 히코네시에 위치했다. 번주 가문은 후다이 다이묘의 필두격인 이이 가문으로, 번청은 히코네 성이다."},{"page_url":"https://es.wikipedia.org/wiki/Tapirus_terrestris_spegazzinii","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Anta_pantanal.jpg","page_title":"Tapirus terrestris spegazzinii","context_page_description":"Tapirus terrestris spegazzinii, es la denominación científica de una de las subespecies en que se divide la especie Tapirus terrestris, un mamífero perisodáctilo del género Tapirus de la familia de los tapíridos, denominada popularmente como «tapir sudamericano», «tapir de las tierras bajas», o «tapir amazónico». Esta subespecie se distribuye en el centro de Sudamérica."},{"page_url":"https://pl.wikipedia.org/wiki/Herb_Koszyc","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Kosice_Coat_of_Arms.svg","page_title":"Herb Koszyc","context_page_description":"Herb Koszyc przedstawia na tarczy trójdzielnej w pas, w głowicy w polu błękitnym trzy złote lilie.\\nPole środkowe dzielone jest na poziome pasy srebrno-czerwone, z połową koronowanego białego orła w części lewej.\\nU podstawy w polu błękitnym trzy lilie rozdzielone skosem szachowanym złoto-czerwono.\\nW wersji wielkiej tarczę herbu ozdobioną dwoma hełmami i labrami czerwono-srebrnymi trzyma anioł o błękitnych skrzydłach.\\nHerb w obecnej wersji pochodzi z 1502 roku.\\nKról węgierski Ludwik I 7 maja 1369 roku udzielił Koszycom prawa posługiwania się herbem.Był to pierwszy taki dokument w Europie. Pierwotny herb przedstawiał lwa pośród lilii. W 1423 roku król Zygmunt Luksemburczyk nadał miastu nowy herb – trzy złote lilie w polu błękitnym i pasy srebrno-czerwone i anioła jako trzymacza herbu.\\nObecnie używany przez miasto herb nadał król Władysław II Jagiellończyk 8 grudnia 1502 roku dodając na pasy srebrno-czerwone połowę polskiego białego orła\\ni w podstawie herb żony Anny de Foix. Dodał również dwa hełmy ze złotymi koronami na tarczę."},{"page_url":"https://cs.wikipedia.org/wiki/ATP_Tour_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Shapovalov_WM19_%2826%29_%2848521748796%29.jpg","page_title":"ATP Tour 2019","context_page_description":"ATP Tour 2019 představoval jubilejní 50. ročník nejvyšší úrovně mužského profesionálního tenisu, hraný v roce 2019. Sezóna okruhu trvajícího od 31. prosince 2018 do 24. listopadu 2019 zahrnovala 67 turnajů ve 31 státech, až na výjimky organizovaných Asociací profesionálních tenistů. Odměny hráčům z turnajů, mimo grandslamy, dosáhly v roce 2019 celkové částky 137,5 milionů dolarů, což od strukturálních změn v sezóně 2008 znamenalo nárůst 110 %.\\nTenisový okruh obsahoval čtyři turnaje Grand Slamu – pořádané Mezinárodní tenisovou federací, devět události kategorie ATP Tour Masters 1000, třináct ATP Tour 500, třicet devět ATP Tour 250 a dvě závěrečné akce: Turnaj mistrů a Next Generation ATP Finals pro nejlépe postavené tenisty do 21 let.\\nSoučástí kalendáře byly také týmové soutěže organizované ITF – Davisův pohár s novým formátem a Hopmanův pohár, z nichž hráči nezískali do žebříčku žádné body.\\nJako světová jednička ve dvouhře do sezóny vstoupil Srb Novak Djoković a klasifikaci čtyřhry v úvodu roku vévodil americký deblista Mike Bryan."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Maksymiliana_w_Siedlcach","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Maksymiliana_w_Siedlcach_wn%C4%99trze.JPG","page_title":"Kościół św. Maksymiliana w Siedlcach","context_page_description":"Kościół pw. św. Maksymiliana – kościół murowany w stylu współczesnym, w Siedlcach przy ulicy Kazimierzowskiej 128. Kościołem opiekują się ojcowie franciszkanie.\\nWybudowany w latach 1991-1995, staraniem oo. franciszkanów. Konsekrowany w 1995 roku przez ks. bp. Jana Mazura."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D1%83%D0%B7%D0%B2%D0%B5%D0%BB%D1%82%D0%BE%D0%B2%D0%BE_%D1%98%D0%B5%D0%B7%D0%B5%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Gifford_Ferry.JPG","page_title":"Рузвелтово језеро","context_page_description":"Рузвелтово језеро је вештачко језеро у Сједињеним Америчким Државама. Налази се на територији америчке савезне државе Вашингтон. Површина језера износи 332 km²."},{"page_url":"https://hu.wikipedia.org/wiki/Erkel_Ferenc","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Erkel_Ferenc_portr%C3%A9.jpg","page_title":"Erkel Ferenc","context_page_description":"Erkel Ferenc magyar zeneszerző, karmester, zongoraművész és sakkmester, a Pesti Sakk-kör első elnöke. Pályáját zongoraművészként és zenepedagógusként kezdte Kolozsvárott, de alkalmilag vezényelt is, és a zeneszerzéssel is megpróbálkozott. Pesten 1834-ben mutatkozott be, majd a következő esztendőben véglegesen ott telepedett le. Két éven át a Pesti Városi Német Színháznál, valamint a Budai Magyar Színjátszó Körnél dolgozott karnagyként. 1837-ben a Pesti Magyar Színházhoz, a későbbi Nemzeti Színházhoz került előbb ügyelői, majd első karmesteri minőségben. Itt mintegy három évtizeden át munkálkodott. 1840-ben írta meg első operáját, a Bátori Máriát. A szövegkönyv szerzője Egressy Béni, aki ezután egészen haláláig segítőtársa volt operaszerzői munkájában. 1844-ben megnyerte a Kölcsey Himnuszának megzenésítésére hirdetett pályázatot. Az 1848–49-es forradalom és szabadságharc után a főváros hangversenyéletének fellendítésén fáradozott. Vezetésével alakult meg 1853-ban a Filharmóniai Társaság, amelyet számtalan esetben vezényelt. Bánk bán című operáját, amely egyben pályájának csúcsát is jelentette, 1861-ben mutatták be."},{"page_url":"https://cs.wikipedia.org/wiki/Monday_James","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Monday_James%2C_2013-04-14d.JPG","page_title":"Monday James","context_page_description":"Monday James je nigerijský fotbalový obránce momentálně působící ve švédském klubu Hammarby IF."},{"page_url":"https://fr.wikipedia.org/wiki/Chartreuse_de_Grenade","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/%D0%9A%D0%B0%D1%80%D1%82%D1%83%D1%85%D0%B0_1.JPG","page_title":"Chartreuse de Grenade","context_page_description":"La chartreuse de Grenade, placée sous le vocable de Notre Dame de l'Assomption, est un ancien monastère de chartreux sis à Grenade, en Espagne. La chartreuse a été fondée au XVIe siècle et construite en style baroque. Elle constitue l'un des monuments parmi les plus importants d'Andalousie. Elle a été supprimée en 1835."},{"page_url":"https://sv.wikipedia.org/wiki/Amblyopone_leae","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Amblyopone_leae_casent0172391_dorsal_1.jpg","page_title":"Amblyopone leae","context_page_description":"Amblyopone leae är en myrart som beskrevs av Wheeler 1927. Amblyopone leae ingår i släktet Amblyopone och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BA%D1%80%D1%83%D0%B3_%D0%9A%D0%B5%D1%98%D0%BD_(%D0%88%D1%83%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Map_of_Utah_highlighting_Kane_County.svg","page_title":"Округ Кејн (Јута)","context_page_description":"Округ Кејн је округ у америчкој савезној држави Јута. По попису из 2010. године број становника је 7.125."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CE%BB%CE%B5%CF%8D%CE%B8%CE%B5%CF%81%CE%BF%CF%82_%CE%A3%CF%85%CF%81%CE%B9%CE%B1%CE%BA%CF%8C%CF%82_%CE%A3%CF%84%CF%81%CE%B1%CF%84%CF%8C%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Saadoun_al-Faisal_%28Abu_Laya%29.png","page_title":"Ελεύθερος Συριακός Στρατός","context_page_description":"O Ελεύθερος Συριακός Στρατός είναι παράταξη χαλαρής δομής στον εμφύλιο πόλεμο της Συρίας, που ιδρύθηκε στις 29 Ιουλίου 2011 από αξιωματικούς των Συριακών Ενόπλων Δυνάμεων, των οποίων ο δεδηλωμένος στόχος ήταν η ανατροπή της κυβέρνησης του Μπασάρ αλ-Άσαντ. Επίσημη οργάνωση κατά την ίδρυσή της, η δομή της σταδιακά εξαφανίστηκε μέχρι τα τέλη του 2012 και η ταυτότητα του ΕΣΣ έχει έκτοτε χρησιμοποιηθεί από διάφορες μη αλληλένδετες ομάδες αντιπολίτευσης.\\nΣτα τέλη του 2011, θεωρήθηκε η κύρια ομάδα Σύριων στρατιωτικών αποστατών. Είχε επιτυχία ενάντια στις πολύ καλύτερα ένοπλες κυβερνητικές δυνάμεις. Από τον Ιούλιο του 2012 και μετά, η απειθαρχία, οι εσωτερικές έριδες και η έλλειψη χρηματοδότησης εξασθένισαν τον ΕΣΣ, ενώ οι ισλαμιστικές ομάδες κυριαρχούσαν στην ένοπλη αντιπολίτευση\\nΟ Ελεύθερος Συριακός Στρατός αυτοχαρακτηρίστηκε \\"η στρατιωτική πτέρυγα της αντιπολίτευσης του συριακού λαού στο καθεστώς\\" και στοχεύει να καταρρίψει την κυβέρνηση με ένοπλες επιχειρήσεις, ενθαρρύνοντας τη στρατιωτική αυτομόληση και πραγματοποιώντας ένοπλη δράση."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_Sambias","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Flag_of_Northern_Rhodesia_%281939%E2%80%931964%29.svg","page_title":"Geschichte Sambias","context_page_description":"Die Geschichte Sambias umfasst die Entwicklungen auf dem Gebiet der Republik Sambia von der Urgeschichte bis zur Gegenwart."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%8B%B1%E6%A0%BC%E8%98%AD%E9%81%BA%E7%94%A2%E5%A7%94%E5%93%A1%E6%9C%83%E7%AE%A1%E7%90%86%E7%94%A2%E6%A5%AD%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Arthur%27s_stone_-_geograph.org.uk_-_941844.jpg","page_title":"英格蘭遺產委員會管理產業列表","context_page_description":"英格兰遗产委员会是一个英国慈善组织，负责管理英格兰的历史名胜，当中包括超过400处英格的的历史建筑、古迹、地点等。委员会亦直接拥有其中一部分古迹的业权，亦会与其他业主商议如何管理该古迹。\\n下表为英格兰遗产委员会管理产业列表，当中包括英格兰乡村别墅、古屋、城堡、修道院、博物馆等。此表仅表示英格兰遗产委员会负责管理，部分建筑之业权可属政府、或属私人拥有。"},{"page_url":"https://cs.wikipedia.org/wiki/Kalv%C3%A1rie_(Bratislava)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Bratislavska_Kalvaria_7.JPG","page_title":"Kalvárie (Bratislava)","context_page_description":"Bratislavská Kalvárie je místo v Bratislavě, která představuje pozůstatky z původní křížové cesty z roku 1694. Nachází se v městské části Staré Město nad Pražskou ulicí."},{"page_url":"https://de.wikipedia.org/wiki/Diners_of_Massachusetts_MPS","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/The_owl_diner_in_lowell%2C_mass.jpg","page_title":"Diners of Massachusetts MPS","context_page_description":"Als Diners of Massachusetts sind im Rahmen einer Multiple Property Submission alle Diners zusammengefasst, die im Bundesstaat Massachusetts der Vereinigten Staaten im National Register of Historic Places eingetragen sind."},{"page_url":"https://fr.wikipedia.org/wiki/Pel-et-Der","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/82/Pel-et-Der_Eglise_Notre-Dame_de_l%27Assomption.jpg","page_title":"Pel-et-Der","context_page_description":"Pel-et-Der est une commune française, située dans le département de l'Aube en région Grand Est."},{"page_url":"https://sk.wikipedia.org/wiki/Adolf_Hoffmeister","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Bundesarchiv_Bild_183-81825-0001%2C_Berlin%2C_Er%C3%B6ffnung_Adolf_Hoffmeister_Ausstellung.jpg","page_title":"Adolf Hoffmeister","context_page_description":"Adolf Hoffmeister bol český spisovateľ, publicista, dramatik, výtvarník, karikaturista, prekladateľ, diplomat, právnik a cestovateľ."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%86%D8%B1%D9%8A_%D9%87%D9%8A%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Methuen_City_Hall_-_2006.jpg","page_title":"هنري هيو","context_page_description":"هنري هيو ‏ هو مهندس معماري أمريكي، ولد في 1845 في تشيشير في المملكة المتحدة، وتوفي في 30 يونيو 1917 في بوسطن في الولايات المتحدة."},{"page_url":"https://nl.wikipedia.org/wiki/Montacher-Villegardin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Montacher-Villegardin-89-A10.JPG","page_title":"Montacher-Villegardin","context_page_description":"Montacher-Villegardin is een gemeente in het Franse departement Yonne en telt 679 inwoners. De plaats maakt deel uit van het arrondissement Sens."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%DB%8C%D9%86%DA%A9%D8%A7%D9%86%D8%AA%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/WeaverStadium.jpg","page_title":"وینکانتون","context_page_description":"وینکانتون بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 5272 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B0%D0%BA%D0%BE%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Mairie_de_G%C3%A2cogne.jpg","page_title":"Гаконь","context_page_description":"Гако́нь, Ґаконь — муніципалітет у Франції, у регіоні Бургундія-Франш-Конте, департамент Ньєвр. Населення — 274 осіб.\\nМуніципалітет розташований на відстані близько 220 км на південний схід від Парижа, 90 км на захід від Діжона, 60 км на північний схід від Невера."},{"page_url":"https://fi.wikipedia.org/wiki/Kanger_Ghatin_kansallispuisto","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Kanger_valley12.JPG","page_title":"Kanger Ghatin kansallispuisto","context_page_description":"Kanger Ghatin kansallispuisto on luonnonsuojelualue Intiassa Chhattisgarhin osavaltiossa. Se sijaitsee 27 km kaakkoon Jagdalpurista. Puisto on kuutisen kilmetriä leveä, 33 km pitkä ja seurailee Kangerin jokilaaksoa. Laaksossa kasvaa Intian niemimaan viimeisiä koskemattomia ikimetsiä. Tyypillisiä lajeja ovat sal- eli intianmerantipuut, tiikki ja bambut. Niiden joukossa kulkee tiikereitä, leopardeja, kääpiökauriita, sambar- ja aksishirviä."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B8%85%E4%BB%A3%E8%92%99%E5%8F%A4%E7%9B%9F%E9%83%A8%E6%97%97%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Outer_Mongolia_under_Qing_rule.png","page_title":"清代蒙古盟部旗列表","context_page_description":"本表收入清代蒙古各盟、部落、旗。本表的简表参见此处。"},{"page_url":"https://simple.wikipedia.org/wiki/Condor_(roller_coaster)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/El_condor_Walibi_Wolrd.JPG","page_title":"Condor (roller coaster)","context_page_description":"Condor is a steel roller coaster at Walibi Holland in The Netherlands. The ride was built by Vekoma as the first suspended looping coaster in the world."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A9%86%E4%BA%9A%E5%85%8B_(%E5%A1%94%E6%81%A9-%E5%8A%A0%E9%BE%99%E7%9C%81)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Map_commune_FR_insee_code_82133.png","page_title":"穆亚克 (塔恩-加龙省)","context_page_description":"穆亞克是法國南部-庇里牛斯大區塔恩-加龍省的一個市鎮，屬於蒙托邦區和凱爾西-魯埃格縣。該市鎮2009年時的人口 為98人。"},{"page_url":"https://en.wikipedia.org/wiki/Baghdad","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Baghpahlavi.png","page_title":"Baghdad","context_page_description":"Baghdad is the capital of Iraq and the third-largest city in the Arab world after Cairo and Riyadh. Located along the Tigris River, the city was founded in the 8th century, and became the capital of the Abbasid Caliphate. Within a short time of its inception, Baghdad evolved into a significant cultural, commercial, and intellectual center of the Muslim world. This, in addition to housing several key academic institutions, including the House of Wisdom, as well as hosting a multiethnic and multireligious environment, garnered the city a worldwide reputation as the \\"Centre of Learning\\".\\nBaghdad was the largest city in the world for much of the Abbasid era during the Islamic Golden Age, peaking at a population of more than a million. The city was largely destroyed at the hands of the Mongol Empire in 1258, resulting in a decline that would linger through many centuries due to frequent plagues and multiple successive empires. With the recognition of Iraq as an independent state in 1932, Baghdad gradually regained some of its former prominence as a significant center of Arabic culture, with a population variously estimated at 6 or over 7 million."},{"page_url":"https://en.wikipedia.org/wiki/Fairbanks,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Fairbanks%2C_Indiana.jpg","page_title":"Fairbanks, Indiana","context_page_description":"Fairbanks is an unincorporated community in Fairbanks Township, Sullivan County, in the U.S. state of Indiana.\\nThe community is part of the Terre Haute Metropolitan Statistical Area."},{"page_url":"https://eu.wikipedia.org/wiki/Garo_etnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Garo_tribes_House.JPG","page_title":"Garo etnia","context_page_description":"Garo etnia Indiako Meghalaya estatuan eta Bangladeshko ondoko zenbait eskualdetan bizi den herri indigena da. Beren buruari a·chic mande deritzote, edo besterik gabe a·chic edota mande. Guztira milioi bat inguru direla kalkulatu da. Meghalayaren barruan, biztanleen herena dira; khasi etniaren ondoren, estatu hartako tribu jendetsuenetan bigarrena dira, beraz. Garoen kultura matrilineala da."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D1%97_%D0%9F%D0%B0%D1%81%D1%82%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Vulitsya_Pastera.JPG","page_title":"Луї Пастер","context_page_description":"Луї́ Пасте́р — видатний французький мікробіолог і хімік. Пастер відкрив мікробіологічну суть бродіння і багатьох хвороб людини, став разом з Фердінандом Коном та Робертом Кохом одним з основоположників мікробіології та імунології. Його роботи в галузі вивчення будови кристалів і явища поляризації світла лягли в основу стереохімії. Також Пастер поставив крапку в багатовіковій суперечці про наявність вітальної сили, що призводить до постійної появи живого з неживого, дослідним шляхом довівши неможливість цього. Його ім'я широко відоме в колах фахівців у галузі харчових технологій завдяки створеній ним і названій згодом на його честь технології пастеризації.\\nУдостоєний безлічі наукових і державних нагород різних країн світу. До дня смерті Луї Пастера приурочений Всесвітній день боротьби проти сказу — пам'ятна дата, що відзначається щорічно."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%A0%D0%B8%D0%B2%D1%8C%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/La_Riviere_%28Is%C3%A8re%29._Clocher_de_l%27%C3%A9glise.jpg","page_title":"Ла-Ривьер","context_page_description":"Ла-Ривьер — Францин гӀала-коммуна, лаьтта Рона — Альпаш регионехь. Коммунан департамент — Изер. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BC%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Heming_eglise.JPG","page_title":"Емен","context_page_description":"Еме́н — муніципалітет у Франції, у регіоні Лотарингія, департамент Мозель. Населення — 505 осіб.\\nМуніципалітет розташований на відстані близько 340 км на схід від Парижа, 75 км на південний схід від Меца."},{"page_url":"https://nl.wikipedia.org/wiki/Kidung_Sunda","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Rigging4.png","page_title":"Kidung Sunda","context_page_description":"Kidung Sunda of Kidoeng Soenda is een gedicht in het Middeljavaans, in Javaanse metra en is waarschijnlijk uit Bali afkomstig. In dit gedicht wordt verhaald over koning Hayam Wuruk uit Majapahit die bezig was een vrouw te vinden om hem als koningin te vergezellen. Hij had zijn oog laten vallen op de prinses van Sunda*, wier naam in dit verhaal niet genoemd wordt. Maar zijn grootvizier Gajah Mada was het niet met hem eens. Er is een meningsverschil omtrent de staatkundige verhouding tussen Sunda en Majapahit. Gajah Mada is van mening dat Sunda een onderhorige is van Majapahit. Daardoor ontstond er een oorlog te Bubat, de havenplaats waar de Sundanezen landden, want zij weigerden het om als onderhorigen beschouwd te worden. Daar werden de Sundanese manschappen geheel afgeslacht. De prinses van Sunda pleegde daarna zelfmoord door verdriet. Dit verhaal moet gesitueerd worden in het midden van de 14e eeuw.\\n*In dit artikel wordt “Sunda” als zodanig gespeld en niet als “Soenda”."},{"page_url":"https://gl.wikipedia.org/wiki/Celestino_L%C3%B3pez_de_Castro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Celestino_L%C3%B3pez_de_Castro_1914.jpg","page_title":"Celestino López de Castro","context_page_description":"Celestino López de Castro, nado en Pontevedra en 1860 e finado na mesma cidade o 30 de novembro de 1934, foi un médico galego."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D5%B6%D5%B8%D5%AC%D5%AB%D5%BD_%D4%B3%D5%AC%D5%A5%D5%A6%D5%B8%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Manolis_Glezos_2007-2.jpg","page_title":"Մանոլիս Գլեզոս","context_page_description":"Մանոլիս Գլեզոս, հույն ձախ քաղաքական գործիչ, գրող, հակաֆաշիստական շարժման խորհրդանիշ։ Լենինյան միջազգային մրցանակի դափնեկիր «Ժողովուրդների միջև խաղաղության ամրապնդման համար»։ Ընդհանուր առմամբ, իր համոզմունքների համար դատապարտվել է 16 տարի, չորս անգամ մահապատժի է դատապարտվել։"},{"page_url":"https://de.wikipedia.org/wiki/Zeitungsviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Berlin%2C_Mitte%2C_Zimmerstra%C3%9Fe%2C_Alfandary-Haus_01.jpg","page_title":"Zeitungsviertel","context_page_description":"Als Zeitungsviertel bezeichnet man einen Teil der südlichen Friedrichstadt in Berlin, in dem über 500 Betriebe des grafischen Gewerbes, Druckereien und Verlagshäuser ihren Sitz hatten. Das Kerngebiet lag zwischen der Leipziger Straße im Norden, der Wilhelmstraße im Westen, der Axel-Springer- und Lindenstraße im Osten sowie dem Mehringplatz im Süden."},{"page_url":"https://sv.wikipedia.org/wiki/Bibasis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/BuraraHarisa_749_1.jpg","page_title":"Bibasis","context_page_description":"Bibasis är ett släkte av fjärilar. Bibasis ingår i familjen tjockhuvuden."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Brive-la-Gaillarde","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Coll%C3%A9giale_Saint_Martin%2C_Brive_la_Gaillarde%2C_Corr%C3%A8ze%2C_France.JPG","page_title":"Liste des monuments historiques de Brive-la-Gaillarde","context_page_description":"Ce tableau présente la liste de tous les monuments historiques classés ou inscrits dans la ville de Brive-la-Gaillarde, Corrèze, en France."},{"page_url":"https://en.wikipedia.org/wiki/Barton-upon-Humber","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Church_of_St._Peter_-_geograph.org.uk_-_261529.jpg","page_title":"Barton-upon-Humber","context_page_description":"Barton-upon-Humber or Barton is a town and civil parish in the North Lincolnshire, England. The population at the 2011 census was 11,066. It is situated on the south bank of the Humber Estuary at the southern end of the Humber Bridge. It is 46 miles east of Leeds, 6 miles south-west of Kingston upon Hull and 31 miles north north-east of the county town of Lincoln. Other nearby towns include Scunthorpe to the south-west and Grimsby to the south-east."},{"page_url":"https://de.wikipedia.org/wiki/Jean-Charles_Cazin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Art_and_criticism_-_monographs_and_studies_%281892%29_%2814781489061%29.jpg","page_title":"Jean-Charles Cazin","context_page_description":"Jean-Charles Cazin war ein französischer Keramiker, Maler, Stecher und Zeichner."},{"page_url":"https://es.wikipedia.org/wiki/Espada_Imperial","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Erste_detaillierte_Darstellung_des_reichsschwertes.jpg","page_title":"Espada Imperial","context_page_description":"El nombre de Espada Imperial se usa normalmente en el mundo germanófono para referirse a una espada perteneciente a las llamadas \\"joyas imperiales\\", tesoro de los reyes y emperadores del Sacro Imperio Romano Germánico.\\nEn un sentido más amplio, con el término \\"espada imperial\\" se denomina una espada particular que constituye un símbolo estatal de una monarquía y representa el poder, la fuerza y la capacidad de autodefensa de un país. Con esta acepción existen o han existido numerosos ejemplos en Inglaterra, Escocia, Prusia, Dinamarca, Noruega, Hungría, Francia, los Países Bajos o Japón. Este artículo se centra en la descripción de la Espada Imperial del Sacro Imperio Romano Germánico, lo que incluye su historia, sus características y su significado.\\nLa Espada Imperial del Sacro Imperio se conoce también con el nombre de Espada de San Mauricio, pues se dice que perteneció originalmente a Mauricio el Tebano, santo cristiano de existencia cuestionable a quien se le atribuye haber comandado en el siglo III una legión formada por cristianos procedentes de Egipto, que posteriormente, siempre según la leyenda, sufrieron martirio cerca del cantón suizo de Valais."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%84%E3%82%AF%E3%83%90%E3%83%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Buckleya_lanceolata_9.JPG","page_title":"ツクバネ","context_page_description":"ツクバネは、ビャクダン科ツクバネ属の落葉低木。雌雄異株 。"},{"page_url":"https://fr.wikipedia.org/wiki/Steven_Lewerenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Lewerenz%2C_Steven_W%C3%BCrzburg_14-15_WP.jpg","page_title":"Steven Lewerenz","context_page_description":"Steven Lewerenz, né le 18 mai 1991 à Hambourg, est un footballeur professionnel allemand."},{"page_url":"https://pt.wikipedia.org/wiki/Fijaci%C3%B3n_oral,_Vol._1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Strasbourg_Goltzius_Eve_1613.jpg","page_title":"Fijación oral, Vol. 1","context_page_description":"Fijación Oral, Vol. 1 é o sexto álbum de estúdio estúdio e o quarto lançado mundialmente pela artista musical colombiana Shakira, em 3 de junho de 2005, pelo selo da gravadora Epic Records. Após alcançar sucesso internacional com seu primeiro álbum de estúdio gravado em inglês, Laundry Service, Shakira queria lançar um projeto em língua espanhola como seu acompanhamento. Musicalmente, o disco é derivado do Pop latino, assim como o trabalho anterior da cantora. As gravações do projeto ocorreram entre 2004 e 2005, nos Estados Unidos e no Canadá, sob a produção de profissionais como Rick Rubin, Gustavo Cerati, Lester Mendez, Luis Fernando Ochoa e Jose \\"Gocho\\" Torres.\\nFijación Oral, Vol. 1 ​​recebeu análises positivas da mídia especializada, a qual prezou a evolução de Shakira de seu projeto anterior. Durante os Grammy Awards de 2006, o projeto venceu a categoria de Best Latin Rock/Alternative Album, além de ter recebido as condecorações de Melhor Álbum Vocal Pop Feminino e Álbum do Ano durante o Grammy Latino do mesmo ano."},{"page_url":"https://ro.wikipedia.org/wiki/Comitatul_T%C3%A2rnava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Jude%C8%9Be_Transilvania_sec17.PNG","page_title":"Comitatul Târnava","context_page_description":"Comitatul Târnava a fost o unitate administrativă a Regatului Ungariei, care a funcționat din secolul al XII-lea și până la reforma administrativă din 1784, apoi din nou în perioada 1867-1918. Capitala comitatului a fost Cetatea de Baltă."},{"page_url":"https://fr.wikipedia.org/wiki/Licario","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/ByzantineEmpire1265.svg","page_title":"Licario","context_page_description":"Licario, appelé Ikarios par les chroniqueurs grecs, est un amiral byzantin d'origine italienne au XIIIᵉ siècle. En désaccord avec les barons de l'Eubée, sa terre d'origine, il entre au service de l'empereur Michel VIII Paléologue et reconquiert pour le compte des Byzantins la plupart des îles de la mer Égée. En récompense, il reçoit l'Eubée comme fief et obtient le rang de mégaduc, ce qui fait de lui le premier étranger à obtenir une telle distinction."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B3%A2%E6%89%80%E4%B9%97%E5%BE%A1%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Kashikodokoro_Jogyosha_and_Ohaguruma_01.png","page_title":"賢所乗御車","context_page_description":"賢所乗御車は、日本国有鉄道の前身である鉄道院が、神鏡を輸送するため、1915年に製造した鉄道車両である。\\n大正天皇の即位式の際に、東京の皇居と京都御所の間を、宮中三殿の賢所に祀られている神鏡を輸送するために製造された特殊用途の客車で、賢所奉安車とも呼ばれる。略して賢車と称されることもあった。「神」を輸送の対象とする鉄道車両は世界的にも類例がないと思われ、その意味でも極めて珍しい車両である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%B4%E3%83%BB%E3%83%91%E3%83%AC%E3%83%BC%E3%83%89_(1929%E5%B9%B4%E3%81%AE%E6%98%A0%E7%94%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Love_Parade_poster.jpg","page_title":"ラヴ・パレード (1929年の映画)","context_page_description":"『ラヴ・パレード』は、1929年に製作・公開されたアメリカ合衆国の映画である。"},{"page_url":"https://sk.wikipedia.org/wiki/Mojm%C3%ADr_II.","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Mojhmir2.jpg","page_title":"Mojmír II.","context_page_description":"Mojmír II. bol najstarším synom kniežaťa Svätopluka a posledný historicky známy panovník Veľkomoravskej ríše. Pochádzal z rodu Mojmírovcov. Dátum a miesto jeho narodenia nepoznáme. Vieme len logicky povedať, že sa narodil na Veľkej Morave niekedy po roku 871 a jeho matkou zrejme bola Svätoplukova manželka Svätožizňa z českého rodu Přemyslovcov."},{"page_url":"https://en.wikipedia.org/wiki/William_Frederick_Nkomo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/WF_Nkomo.png","page_title":"William Frederick Nkomo","context_page_description":"William Frederick Nkomo was a South African medical doctor, community leader, political activist and teacher from Pretoria. He was the founding chairman of the African National Congress Youth League. While at the University of the Witwatersrand, Nkomo was one of the first black students to serve on the Students Representative Committee.\\nAfter graduation, he practiced as a teacher and medical doctor in various parts of Pretoria. He was later also involved in the Moral Re-Armament Movement. He was also elected president of the South African Institute of Race Relations, and was a steward of the Methodist Church and Trustee of the Bantu Welfare Trust."},{"page_url":"https://es.wikipedia.org/wiki/Cugny","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Map_commune_FR_insee_code_02246.png","page_title":"Cugny","context_page_description":"Cugny es una comuna francesa, situada en el departamento de Aisne, de la región de Alta Francia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%81%93%E5%A5%87%E6%8C%91%E6%88%B0%E8%80%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/1973_Dodge_Challenger_red.jpg","page_title":"道奇挑戰者","context_page_description":"道奇•挑戰者為道奇所生產的三代各異的美國汽車。銀色挑戰者生產於1958至1959年。第一代挑戰者小馬車使用克萊斯勒E汽車平台，與普利茅斯梭魚共用主要部件。第二代生產於1978至1983年，為經過換牌工程的三菱戈藍拉姆達。第三代，也是目前所屬的車代，介紹於2008年早期，成為了新第五代福特野馬和第五代雪佛蘭科邁羅的競爭對手。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Schiltigheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Schiltigheim19.jpg","page_title":"Liste der Monuments historiques in Schiltigheim","context_page_description":"Die Liste der Monuments historiques in Schiltigheim führt die Monuments historiques in der französischen Gemeinde Schiltigheim auf."},{"page_url":"https://en.wikipedia.org/wiki/Villu_Paatu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Villupattu_at_kollam.jpg","page_title":"Villu Paatu","context_page_description":"Villu Paatu, also known as Villadichampaatu, is an ancient form of musical story-telling in India where narration is interspersed with music, an art of southern states of Tamil Nadu and Kerala. This art form is popular among Nadar and Chettiar castes of erstwhile Travancore kingdom. Simple tunes and verses make the story easy to follow. The villu, the age-old weapon of warriors - paradoxically lends itself to be used as a primary musical instrument for the Villu Paatu artists."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D1%94%D0%B2%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B0_%D1%82%D0%B5%D0%BE%D0%BB%D0%BE%D0%B3%D1%96%D1%87%D0%BD%D0%B0_%D1%81%D0%B5%D0%BC%D1%96%D0%BD%D0%B0%D1%80%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/UETS_Academic_building_%28%D0%90%D0%BA%D0%B0%D0%B4%D0%B5%D0%BC%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D0%A3%D0%84%D0%A2%D0%A1%29.jpg","page_title":"Українська євангельська теологічна семінарія","context_page_description":"Українська євангельська теологічна семінарія, скор. УЄТС, — вищий міжденомінаційний богословський навчальний заклад з підготовки священнослужителів у сфері пасторології, лідерства, християнської психології та музичної творчості.\\nУЄТС заснована 1992 р. Союзом вільних церков християн євангельської віри України для навчання священнослужителів."},{"page_url":"https://hu.wikipedia.org/wiki/Am_Hart_(metr%C3%B3%C3%A1llom%C3%A1s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Munich_subway_station_Am_Hart.JPG","page_title":"Am Hart (metróállomás)","context_page_description":"A Am Hart metróállomás Németországban, a bajor fővárosban, Münchenben a müncheni metró U2 metróvonalán található."},{"page_url":"https://it.wikipedia.org/wiki/John_Fawcett","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/John_Fawcett_by_Gage_Skidmore.jpg","page_title":"John Fawcett","context_page_description":"John Fawcett è un regista, sceneggiatore e produttore cinematografico canadese.\\nAttivo sia nel campo cinematografico che televisivo, è noto soprattutto per aver realizzato il film horror del 2000 Licantropia Evolution e per aver co-creato e girato la pluripremiata Serie televisiva fantascientifica Orphan Black."},{"page_url":"https://en.wikipedia.org/wiki/CIDEA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/PBB_GE_CIDEA_221295_at_fs.png","page_title":"CIDEA","context_page_description":"Cell death activator CIDE-A is a protein that in humans is encoded by the CIDEA gene. Cidea is an essential transcriptional coactivator regulating mammary gland secretion of milk lipids.\\nThis gene encodes the homolog of the mouse protein Cidea that has been shown to activate apoptosis. This activation of apoptosis is inhibited by the DNA fragmentation factor DFF45 but not by caspase inhibitors. Mice that lack functional Cidea have higher metabolic rates, higher lipolysis in brown adipose tissue and higher core body temperatures when subjected to cold. These mice are also resistant to diet-induced obesity and diabetes. This suggests that in mice this gene product plays a role in thermogenesis and lipolysis. Two alternative transcripts encoding different isoforms have been identified."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E6%8B%89%E5%85%8B%E5%9F%8E%E5%B8%82%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Iraq-CIA_WFB_Map.png","page_title":"伊拉克城市列表","context_page_description":"以下列出伊拉克城市。"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%96%D0%BE%D2%93%D0%B0%D1%80%D2%93%D1%8B_%D0%B6%D1%8B%D0%BB%D0%B4%D0%B0%D0%BC%D0%B4%D1%8B%D2%9B%D1%82%D1%8B_%D0%BF%D0%BE%D0%B9%D1%8B%D0%B7%D0%B4%D0%B0%D1%80%D1%8B%D0%BD%D1%8B%D2%A3_%D1%82%D1%96%D0%B7%D1%96%D0%BC%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/E6%E7%B3%BB%E6%96%B0%E5%B9%B9%E7%B7%9A%E9%9B%BB%E8%BB%8A%282011.11.9%29-2.jpg","page_title":"Жоғарғы жылдамдықты пойыздарының тізімі","context_page_description":"Бұл әлем елдеріндегі жоғарғы жылдамдық пойыздарының тізімі."},{"page_url":"https://en.wikipedia.org/wiki/Milo_(CDP),_Maine","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Milo_from_River%2C_Milo%2C_ME.jpg","page_title":"Milo (CDP), Maine","context_page_description":"Milo is a census-designated place (CDP) in the town of Milo in Piscataquis County, Maine, United States. The population was 1,898 at the 2000 census."},{"page_url":"https://en.wikipedia.org/wiki/Yvonne_Reynders","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/WK_Wielrennen_op_de_baan_Amsterdam._fotonr._9_Yvonne_Reynders_%28Belgie%29_in_ak%E2%80%A6%2C_Bestanddeelnr_920-6974.jpg","page_title":"Yvonne Reynders","context_page_description":"Yvonne Reynders is a former track and road cyclist from Belgium. With Beryl Burton of Great Britain, Reynders was one of the top female riders of the 1960s, winning 13 medals at world championships, including seven gold medals.\\nReynders' first sport was athletics: her heroine was Dutch athlete Fanny Blankers-Koen, who won four sprint golds at the 1948 Summer Olympics. However, after her coaches told her that she did not have the speed on the track to follow in Blankers-Koen's footsteps, she initially switched to the discus, winning two consecutive Belgian junior discus titles in 1955 and 1956. Reynders then switched to cycle racing, having ridden a carrier tricycle when delivering coal in Antwerp after leaving school at the age of 16. In order to lose the muscle mass she had built up as a discus thrower, she developed a weekday routine of riding her race bike 40 km from her home in the Campine to Antwerp, where she did her 8–16 km coal round on her carrier trike in the morning, and then riding another 100–140 km on her racing bicycle along the Scheldt valley before returning home. After six months her weight had reduced from 74 kg to 59.5 kg."},{"page_url":"https://pl.wikipedia.org/wiki/Offenbach_am_Main","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Wetters%C3%A4ule_Kaiserstra%C3%9Fe.jpg","page_title":"Offenbach am Main","context_page_description":"Offenbach am Main – miasto na prawach powiatu w Niemczech, w kraju związkowym Hesja, w rejencji Darmstadt.\\nMiasto liczy 121 747 mieszkańców i jest 5. pod względem wielkości miastem w regionie Ren-Men. Jest ważnym ośrodkiem przemysłowym, usługowym i handlowym. Najbliższe duże miasto – Frankfurt nad Menem – znajduje się bezpośrednio przy zachodniej i północno-zachodniej granicy miasta. Offenbach am Main należy do dziewięciu miast Hesji o największym znaczeniu regionalnym."},{"page_url":"https://cs.wikipedia.org/wiki/N%C3%A1rodn%C3%AD_technick%C3%A9_muzeum_v_Praze","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/1935_Java_750.jpg","page_title":"Národní technické muzeum v Praze","context_page_description":"Národní technické muzeum v Praze je největší českou institucí specializovanou na muzejní sbírky technického charakteru. Muzeum bylo založeno 5. července 1908 jako Technické muzeum Království českého. V současnosti představuje své sbírky ve 21 expozicích a v množství krátkodobých výstav v budově na Letné, v pobočce Centrum stavitelského dědictví v Plasích a v Železničním depozitáři v Chomutově."},{"page_url":"https://en.wikipedia.org/wiki/Montagney","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Montagney_10.jpg","page_title":"Montagney","context_page_description":"Montagney is a commune in the Haute-Saône department in the region of Bourgogne-Franche-Comté in eastern France."},{"page_url":"https://eo.wikipedia.org/wiki/Sankta_Petro","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Pope-peter_pprubens.jpg","page_title":"Sankta Petro","context_page_description":"La apostolo Petro, devena nomo Simono estis unu el dek du devenaj apostoloj - disĉiploj de Jesuo Kristo. Li estas konsiderata kiel unua el la papoj.\\nJen laŭ la bibliaj tekstoj la vivo de Sankta Petro: Sankta Petro antaŭ ol fariĝi disĉiplo de Jesuo nomiĝis Simon kaj li estis filo de Jona. Li naskiĝis en distrikto Galileo, en la loko Betsaida, ĉe norda bordo de la lago Genezareta – kiu estis nomita ankaŭ Galilea Maro aŭ Tiberiada lago. La naskiĝdaton de Sankta Petro oni ne konas, sed oni scias, ke li estis pli aĝa ol Jesuo. Simon kune kun sia frato Andreo loĝis en la loĝloko Kapernaum, kie ili estis fiŝkaptistoj. Ili antaŭ ol fariĝi disĉiploj al Jesuo estis disĉiploj de Sankta Johano la Baptisto\\nLia nomo Petro, kiu aperas en la kvar Evangelioj 114 fojojn kun aparta atento kaj unualoke kompare kun la aliaj apostoloj, estis donita de Jesuo, kiu diris:\\n\\"Vi estas Petro, kaj sur tiu ĉi \\"petro\\" mi konstruos mian eklezion\\"\\nTiuj vortoj estas laŭ katolikismo la pravigo de la povo de papo. Kaj tiel Sankta Petro estas la unua papo.\\nSankta Petro estis la unua inter la apostoloj, kiu faris miraklon, kuracante invalidon de Jerusalemo"},{"page_url":"https://ca.wikipedia.org/wiki/Activitat_%C3%B2ptica","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Quartz_right_handed.jpg","page_title":"Activitat òptica","context_page_description":"L'activitat òptica és la capacitat que presenten certes substàncies de fer girar el pla de vibració de la llum polaritzada plana que les travessa.\\nL'angle de rotació, α, és directament proporcional a la distància travessada per la llum, l; a la densitat, ρ, si és una substància pura; o a la concentració, c, d'aquesta substància quan es troba en dissolució. La constant de proporcionalitat, [α]ᵗλ, depèn de la natura de la substància òpticament activa; de la temperatura, t; de la longitud d'ona de la llum, λ; i del dissolvent si la substància està en dissolució. Aquesta constant s'anomena rotació òptica específica o poder rotatori específic. La fórmula que ho relaciona tot per a substàncies en dissolució és deguda al físic francès Jean-Baptiste Biot i s'anomena llei de Biot:\\nEn el cas dels cristalls la constant és [α₀]ᵗλ i s'anomena rotació òptica o poder rotatori i l'angle de rotació només depèn de la longitud del camí recorregut l:\\n[α]ᵗλ i [α₀]ᵗλ es consideren positius quan el pla de polarització de la llum gira en el mateix sentit que les busques d'un rellotge, negatiu en el cas contrari."},{"page_url":"https://en.wikipedia.org/wiki/Heart_of_Darkness","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/VingtAnnees_289.jpg","page_title":"Heart of Darkness","context_page_description":"Heart of Darkness is a novella by Polish-English novelist Joseph Conrad about a narrated voyage up the Congo River into the Congo Free State in the Heart of Africa. Charles Marlow, the narrator, tells his story to friends aboard a boat anchored on the River Thames. This setting provides the frame for Marlow's story of his obsession with the successful ivory trader Kurtz. Conrad offers parallels between London and Africa as places of darkness.\\nCentral to Conrad's work is the idea that there is little difference between \\"civilised people\\" and those described as \\"savages.\\" Heart of Darkness implicitly comments on imperialism and racism.\\nOriginally issued as a three-part serial story in Blackwood's Magazine to celebrate the thousandth edition of the magazine, Heart of Darkness has been widely re-published and translated into many languages. It provided the inspiration for Francis Ford Coppola's 1979 film Apocalypse Now. In 1998, the Modern Library ranked Heart of Darkness 67th on their list of the 100 best novels in English of the twentieth century."},{"page_url":"https://nl.wikipedia.org/wiki/Newtonia_(dier)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Newtonia_brunneicauda_1868.jpg","page_title":"Newtonia (dier)","context_page_description":"Newtonia is een geslacht van zangvogels uit de familie vanga's."},{"page_url":"https://de.wikipedia.org/wiki/Luftangriffe_auf_Solingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Solingen_Innenstadt_002.JPG","page_title":"Luftangriffe auf Solingen","context_page_description":"Die Luftangriffe auf Solingen während des Zweiten Weltkriegs sorgten in der bergischen Großstadt Solingen für beträchtliche Schäden, die Zahl der Todesopfer schwankt zwischen 1.880 und 2.250. Zwischen 1940 und 1945 war die Stadt das Ziel von insgesamt 84 Luftangriffen der Alliierten. Am 4. und 5. November 1944 wurde durch je einen Großangriff die Solinger Altstadt komplett zerstört. Weitere Ziele des Luftkriegs waren beispielsweise der Rüstungsbetrieb Rudolf Rautenbach am Mangenberg sowie in zwei Großangriffen Teile der Stadtteile Wald und Gräfrath."},{"page_url":"https://de.wikipedia.org/wiki/Jerusalem","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Jerusalem_Zitadelle_BW_1.JPG","page_title":"Jerusalem","context_page_description":"Jerusalem ist eine Stadt in den judäischen Bergen zwischen Mittelmeer und Totem Meer mit rund 920.000 Einwohnern.\\nIn Jerusalem begegnen sich viele Kulturen der Antike und Moderne. Die Altstadt ist in das jüdische, christliche, armenische und muslimische Viertel gegliedert und von einer aus osmanischer Zeit stammenden Befestigungsmauer umgeben.\\nDer politische Status der Stadt ist international umstritten und Teil des Nahostkonflikts. Jerusalem wurde 1980 von Israel, das das gesamte Stadtgebiet kontrolliert, durch das Jerusalemgesetz zu seiner vereinigten und unteilbaren Hauptstadt erklärt, aber als solche nur von den USA, Guatemala, Honduras und Nauru anerkannt. In Jerusalem befinden sich der Sitz des Staatspräsidenten, die Knesset und das Oberste Gericht als Teil des politischen Systems Israels, die 1918 gegründete Hebräische Universität sowie die Holocaustgedenkstätte Yad Vashem und der Israel National Cemetery am Herzlberg."},{"page_url":"https://es.wikipedia.org/wiki/Uroscopia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Konstantinderafrikaner.jpg","page_title":"Uroscopia","context_page_description":"La uroscopia es una técnica médica histórica que consiste en inspeccionar visualmente la orina de un paciente en busca de signos de enfermedad, como sangre, pus, litiasis, etc.​ Su origen se remonta al antiguo Egipto, Babilonia y la India. Tuvo especial importancia en la medicina bizantina.​\\nLa medicina moderna considera a la uroscopia una prueba muy limitada para aportar información diagnóstica. Se han abandonado muchas de las suposiciones antiguas por su falta de base científica.\\nEn la actualidad, el examen visual de la orina de un paciente puede proporcionar indicios de un diagnóstico, pero se limita en general a las afecciones del sistema urinario, como infecciones o hemorragias, visualizando orina turbia o sangre."},{"page_url":"https://ceb.wikipedia.org/wiki/Grad_Petrinja","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Petrinja_ulica.jpg","page_title":"Grad Petrinja","context_page_description":"Dakbayan ang Grad Petrinja sa Krowatiya. Nahimutang ni sa lalawigan sa Sisačko-Moslavačka Županija, sa sentro nga bahin sa nasod, 50 km sa habagatan-sidlakan sa Zagreb ang ulohan sa nasod. Adunay 24,671 ka molupyo. Naglangkob kin og 42 ka kilometro kwadrado.\\nAng yuta sa Grad Petrinja kay kasagaran patag, apan sa habagatan nga kini mao ang kabungtoran.\\nAng klima hemiboreal. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Disyembre, sa -2 °C. Ang kasarangang pag-ulan 1,591 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 203 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 91 milimetro."},{"page_url":"https://pl.wikipedia.org/wiki/Careoradula_perelegans","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Careoradula_perelegans_shell.png","page_title":"Careoradula perelegans","context_page_description":"Careoradula perelegans jest to gatunek oddychającego powietrzem ślimaka lądowego z rodziny Streptaxidae.\\nCareoradula perelegans to jedyny gatunek z rodzaju Careoradula.\\nNazwa rodzajowa Careoradula składa się z łacińskiego słowa \\"careo\\", które oznacza „brakujący”, oraz słowa \\"radula\\" - \\"tarka\\"."},{"page_url":"https://en.wikipedia.org/wiki/Jawahar_Navodaya_Vidyalaya,_Puducherry","image_url":"https://upload.wikimedia.org/wikipedia/en/f/f5/Jawahar_Navodaya_Vidyalaya_logo%2C_jnvlogo.jpg","page_title":"Jawahar Navodaya Vidyalaya, Puducherry","context_page_description":"Jawahar Navodaya Vidyalaya, Puducherry or locally known as JNV Mettakur is a boarding, co-educational school in Puducherry district of Puducherry U.T. in India. Navodaya Vidyalayas are funded by the Indian Ministry of Human Resources Development and administered by Navodaya Vidyalaya Smiti, an autonomous body under the ministry. Navodaya Vidyalayas provide free education to talented children from Class VI to XII. Puducherry district is a coastal enclave within Tamil Nadu state."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A0%D7%93%D7%A8%D7%98%D7%90%D7%95%D7%AA_%D7%9E%D7%9C%D7%97%D7%9E%D7%AA_%D7%94%D7%A2%D7%A6%D7%9E%D7%90%D7%95%D7%AA_%D7%91%D7%99%D7%A9%D7%A8%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/PikiWiki_Israel_19106_Monument_to_the_Conquers_of_Jaffa_in_The_Independe.JPG","page_title":"אנדרטאות מלחמת העצמאות בישראל","context_page_description":"ברחבי מדינת ישראל פזורות כמאתיים וחמישים אנדרטאות למלחמת העצמאות ולנופליה. כאנדרטאות לראשונה שבמלחמות ישראל היוו רבות מהן תקדימים, אשר הניחו את היסודות לעיצוב האנדרטאות למערכות ישראל ולחלליהן.\\nהגם שרבות מהאנדרטאות הוקמו בעשור הראשון שלאחר המלחמה, הוסיפו אנדרטאות להיבנות בעשורים שלאחר מכן, ומאז ראשית שנות התשעים הוקמו בישראל למעלה מעשרים אנדרטאות חדשות למלחמה ולנופליה."},{"page_url":"https://vi.wikipedia.org/wiki/PTRD-41","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Ptrd-1941.jpg","page_title":"PTRD-41","context_page_description":"PTRD-41 là súng trường chống tăng được Hồng quân Liên Xô chế tạo và trang bị từ đầu năm 1941, trong Chiến tranh thế giới thứ hai."},{"page_url":"https://la.wikipedia.org/wiki/Epulum_a_Thoma_Wolseio_celebratum_(1526)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Fr_Pecht_T_L_Raab_Goupil_Henry_VIII_and_Anne_Boleyn.jpg","page_title":"Epulum a Thoma Wolseio celebratum (1526)","context_page_description":"Epulum a Thoma Wolseio celebratum est die 30 Decembris 1526 Londinii in domo suo ad York Place. Ibi rex Henricus VIII et amici, faciebus dissimulatis, in cena irruperunt et cum mulieribus saltaverunt. Epulum in editione altera operis Raphaelis Holinshed Chronicles of England, Scotland and Ireland, anno 1587 divulgata, ita describitur:\\nThat same night, the king and manie yoong gentlemen with him, came to Bridewell, and there put him and fifteene other, all in masking apparell, and then tooke his barge, and rowed to the cardinals place, where were at supper a great companie of lords and ladies, and then the maskers dansed, and made goodlie pastime: and when they had well dansed, the ladies plucked awaie their visors, and so they were all knowen, and to the king was made a great banket.\\nAn sit idem epulum non liquet quo Thomas Wolseius regem ac Annam Bolenam, reginam futuram, convocavit, sicut in vita Wolseii Georgius Cavendish narravit:"},{"page_url":"https://de.wikipedia.org/wiki/Lembata","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Lembata_island%2C_Indonesia.jpg","page_title":"Lembata","context_page_description":"Lembata ist die größte Insel des Solor-Archipels, der wiederum zu den Kleinen Sundainseln gehört. Der Archipel ist ein Teil der Provinz Ost-Nusa Tenggara."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D9%85_%D8%A7%D8%B3%D8%AA%D9%88%DA%A9%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Bram_Stoker_house_Dracula.JPG","page_title":"برام استوکر","context_page_description":"برام استوکر رومانچی و یازیچی - ۸ نوْوامبر ۱۸۴۷ تاریخیندا دۆنیایا گؤز آچیب. ۶۴ ایل عومر ائله‌ییب و ۲۰ آوریل ۱۹۱۲ میلادی تاریخیندا وفات ائدیب."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Cobitidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Sabanejewia_aurata_t%C3%B6rpecs%C3%ADk.jpg","page_title":"Specie di Cobitidae","context_page_description":"Di seguito sono elencate tutte le 252 specie di pesci ossei della famiglia Cobitidae note a novembre 2014"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%A1%D5%B6%D5%B7_(%D5%A4%D5%A5%D5%BA%D5%A1%D6%80%D5%BF%D5%A1%D5%B4%D5%A5%D5%B6%D5%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Manche_department_relief_location_map.jpg","page_title":"Մանշ (դեպարտամենտ)","context_page_description":"Մանշ, դեպարտամենտ Ֆրանսիայի հյուսիս-արևմուտքում։\\nՄանշ դեպարտամենտի կարգային թիվն է՝ 50։"},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_estatales_del_Estado_de_M%C3%A9xico_de_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Delfina_G%C3%B3mez.jpg","page_title":"Elecciones estatales del Estado de México de 2017","context_page_description":"Las elecciones estatales del Estado de México de 2017, denominadas oficialmente por la autoridad electoral como Proceso Electoral 2016-2017 se llevaron a cabo el domingo 4 de junio de 2017, y en ellas se renovaron los siguientes cargos de elección popular:​\\nGobernador del Estado de México. Titular del Poder Ejecutivo del estado, electo para un periodo de seis años no reelegibles en ningún caso. El candidato electo fue Alfredo del Mazo Maza.\\nLa jornada electoral fue regulada por el Instituto Electoral del Estado de México.​"},{"page_url":"https://sco.wikipedia.org/wiki/Hamelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Hameln_Panorama_3-2006_small.jpg","page_title":"Hamelin","context_page_description":"Hamelin is a toun on the river Weser in Lawer Saxony, Germany."},{"page_url":"https://nn.wikipedia.org/wiki/Crossmaglen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Cardinal_O%27Fiach_Square%2C_Crossmaglen_-_geograph.org.uk_-_1447342.jpg","page_title":"Crossmaglen","context_page_description":"Crossmaglen er ein by i grevskapet Armagh i Nord-Irland. Han ligg nær grensa til Irland. Byen har vore dominert av nasjonalistar, og har katolsk majoritet. Dette har ført til mange samanstøytar med tryggingsstyrkane, og både den britiske hæren og Royal Ulster Constabulary har store forskansa bygningar i Crossmaglen. Innan tryggingsstyrkane er byen kjent som XMG, og er rekna som eit av dei verste stadane for britiske soldatar å bli utplassert.\\nSidan byrjinga av The Troubles i 1969 har minst 58 polititenestemenn og 124 soldatar vorte drepne av republikanske paramilitære i det sørlege Armagh, med Crossmaglen som ein av dei hardast ramma stadane. Tidleg i 1990-åra drap snikskyttarar frå Den provisoriske irske republikanske armeen tolv medlemmar av tryggingsstyrkane i byen. Bombar som vart brukt ved London Docklands, Bishopsgate og i Manchester i same tidsrom vart konstruert i Crossmaglen.\\nI seinare år har ein som ein del av normaliseringa av arbeidet til tryggingsstyrkane ikkje tillate at soldatane ber hjelmar, skotsikre vestar og andletskamuflasje under rutinepatruljar inne i byen. Dei har heller ikkje lov til å sikta på personar så lenge dei ikkje sjølv har våpen retta mot seg."},{"page_url":"https://br.wikipedia.org/wiki/Mirdi_Broadel_Hendraouriezh_Naplez","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/BattleofIssus333BC-mosaic-detail2.png","page_title":"Mirdi Broadel Hendraouriezh Naplez","context_page_description":"Mirdi Hendraouriezh Broadel Naplez zo bet krouet e 1822; a-raok e oa ur rann eus ur skol-veur.\\nUn dastumadeg vras a draoù tennet eus Pompei ha Herculanum zo ennañ hag eus Egipt.\\nUr rann arz erotek zo ennañ ivez abaoe 2000."},{"page_url":"https://tr.wikipedia.org/wiki/Beaumont,_Bel%C3%A7ika","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Beaumont_JPG02.jpg","page_title":"Beaumont, Belçika","context_page_description":"Beaumont, Belçika'nın Hainaut eyaletinde bulunan bir belediyedir. 1 Ocak 2012'de Beaumont'un toplam nüfusu 7.060 idi. Toplam alan 92.97 km²'dir"},{"page_url":"https://vi.wikipedia.org/wiki/Limnonectes_fujianensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Big-headed_Frog_%28Limnonectes_fujianensis%29_%E5%A4%A7%E9%A0%AD%E8%9B%995.jpg","page_title":"Limnonectes fujianensis","context_page_description":"Limnonectes fujianensis là một loài ếch trong họ Ranidae.\\nNó được tìm thấy ở Trung Quốc, Hồng Kông, và Đài Loan.\\nCác môi trường sống tự nhiên của chúng là các khu rừng ẩm ướt đất thấp nhiệt đới hoặc cận nhiệt đới, rừng mây ẩm nhiệt đới và cận nhiệt đới, sông, sông có nước theo mùa, đầm nước, đầm nước ngọt, đầm nước ngọt có nước theo mùa, hố lộ thiên, và kênh đào và mương rãnh."},{"page_url":"https://sv.wikipedia.org/wiki/Hogstads_distrikt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Mj%C3%B6lby_Municipality_in_%C3%96sterg%C3%B6tland_County.png","page_title":"Hogstads distrikt","context_page_description":"Hogstads distrikt är ett distrikt i Mjölby kommun och Östergötlands län.\\nDistriktet ligger väster om Mjölby."},{"page_url":"https://af.wikipedia.org/wiki/Steven_Yeun","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Steven_Yeun_2016.jpg","page_title":"Steven Yeun","context_page_description":"Steven Yeun is 'n Amerikaanse akteur en vervaardiger. Hy is bekend vir sy rolle in die rolprente I Origins, Okja, en Mayhem, en in die televisiereeks The Walking Dead."},{"page_url":"https://cs.wikipedia.org/wiki/919_Third_Avenue","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/919thirdave.jpg","page_title":"919 Third Avenue","context_page_description":"919 Third Avenue je kancelářský mrakodrap v New Yorku. Má 47 podlaží a výšku 188 metrů. Byl dokončen v roce 1971 podle projektu společnosti Skidmore, Owings & Merrill."},{"page_url":"https://lv.wikipedia.org/wiki/Dzelzce%C4%BCa_l%C4%ABnija_R%C4%ABga%E2%80%94Ventspils","image_url":"https://upload.wikimedia.org/wikipedia/lv/f/fa/DR1A_Tukuma_I_stacij%C4%81_2.JPG","page_title":"Dzelzceļa līnija Rīga—Ventspils","context_page_description":"Dzelzceļa līnija Rīga—Ventspils ir dzelzceļa līnija, kas savieno Rīgas un Ventspils pilsētas. Tehniski līnija dalās divās: Torņakalns — Tukums II un Ventspils—Tukums II."},{"page_url":"https://de.wikipedia.org/wiki/Stawek_(Miko%C5%82ajki)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Stawek.jpg","page_title":"Stawek (Mikołajki)","context_page_description":"Stawek ist ein Dorf in der polnischen Woiwodschaft Ermland-Masuren. Es gehört zur Stadt- und Landgemeinde Mikołajki im Powiat Mrągowski."},{"page_url":"https://it.wikipedia.org/wiki/Udma","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/SIMET_College_of_Nursing_Udma.jpeg","page_title":"Udma","context_page_description":"Udma è una suddivisione dell'India, classificata come census town, di 8.144 abitanti, situata nel distretto di Kasaragod, nello stato federato del Kerala. In base al numero di abitanti la città rientra nella classe V."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Br%C3%BCcken_%C3%BCber_die_Thur","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Thurbo_Eisenbahnbr%C3%BCcke_%C3%BCber_die_Thur%2C_Weinfelden_TG_%E2%80%93_Bussnang_TG_20190801-jag9889.jpg","page_title":"Liste der Brücken über die Thur","context_page_description":"Die Liste der Brücken über die Thur enthält die Übergänge der Säntisthur und der Wildhauser Thur sowie die Brücken vom Zusammenfluss der zwei Quellbäche bei Unterwasser bis zur Mündung bei Flaach in den Rhein."},{"page_url":"https://fr.wikipedia.org/wiki/Compagnie_g%C3%A9n%C3%A9rale_des_omnibus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/GI_632_-_PARIS_-_L%27avenue_des_Gobelins_-d%C3%A9tail-.jpg","page_title":"Compagnie générale des omnibus","context_page_description":"La Compagnie générale des omnibus est constituée en 1855 par fusion de plusieurs compagnies de transports urbains parisiens, sur la pression des autorités de l'époque soucieuses d'organiser le transport public de voyageurs à Paris.\\nÀ cette époque de rapides évolutions techniques, la CGO expérimenta de nombreuses techniques : l'omnibus, le tramway, l'autobus, le trolleybus, que ce soit en traction hippomobile, à vapeur, à air comprimé, électrique par accumulateurs ou par captage du courant.\\nCette société privée, titulaire d'une concession délivrée par la Ville de Paris, est intégrée le 1ᵉʳ janvier 1921 à la Société des transports en commun de la région parisienne, et se trouve être ainsi un lointain ancêtre de l'actuelle Régie autonome des transports parisiens."},{"page_url":"https://en.wikipedia.org/wiki/U.S._Army_Engineer_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/BG_Anthony_C_Funkhouser.jpg","page_title":"U.S. Army Engineer School","context_page_description":"The United States Army Engineer School is located at Fort Leonard Wood, Missouri. It was founded as a School of Engineering by General Headquarters Orders, Valley Forge on 9 June 1778. The U.S. Army Engineer School provides training that develops a wide variety of engineering skills including: combat engineer, bridging, construction, geospatial, topography, diving, and firefighting.\\nUSAES defines its mission as:\\nSynchronize and integrate the Doctrine, Organization, Training, Material, Leader Development, Personnel, and Facilities domains to ensure the Engineer Regiment is prepared to provide engineer support now and into the future."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%8B%E7%AB%8B%E4%BA%BA%E9%A1%9E%E5%AD%B8%E5%8D%9A%E7%89%A9%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/20041229-Luchador_Olmeca_%28Museo_Nacional_de_Antropolog%C3%ADa%29_MQ.jpg","page_title":"國立人類學博物館","context_page_description":"國立人類學博物館是一座位於墨西哥城的國家博物館。它是墨西哥參觀人數最多的博物館。博物館包含從哥倫布發現美洲大陸前重要的考古和人類學的文物遺產。\\n設計者是墨西哥建築師佩德羅·拉米雷斯·巴斯克斯。"},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9_Anny_(Lan%C5%A1kroun)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Lan%C5%A1kroun%2C_kostel_sv._Anny_%283%29.jpg","page_title":"Kostel svaté Anny (Lanškroun)","context_page_description":"Bývalý hřbitovní kostel sv. Anny je dnes již nevyužívaný římskokatolický chrám v Lanškrouně. Byl postaven počátkem 18. století podle projektu architekta G. P. Tencally s finanční podporou knížecího rodu Lichtenštejnů. V rámci královéhradecké diecéze patří k významným památkám barokní sakrální architektury. Svému původnímu účelu dnes kostel již neslouží a veřejnosti bývá zpřístupněn jen výjimečně."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%88%87%E5%B0%94%E8%A5%BF%E8%B6%B3%E7%90%83%E4%BF%B1%E4%B9%90%E9%83%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/F-Lampard.jpg","page_title":"切尔西足球俱乐部","context_page_description":"切尔西足球俱乐部，是一间位于英格兰首都伦敦的足球俱乐部，目前比赛于英格兰超级联赛。球队主场为斯坦福桥球场。\\n切尔西足球俱乐部成立至今超过一百年，在1955年首次赢得英格兰最顶级足球联赛冠军。到目前为止，切尔西一共赢得6 次英格兰顶级足球联赛冠军，8 次英格兰足总杯冠军，5 次英格兰联赛杯冠军和4 次英格兰社区盾。在欧洲赛事方面则赢得1 次欧洲冠军联赛冠军，2 次欧洲联赛冠军，2 次欧洲优胜者杯冠军和1 次欧洲超级杯。"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%9F%E5%B1%B1%E7%94%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Tsuchiyama_Chiiki_Shimin_Center_02.jpg","page_title":"土山町","context_page_description":"土山町は、かつて滋賀県の南東に存在した町。\\n2004年10月1日、水口町、土山町、甲賀町、甲南町、信楽町が合併して甲賀市となったため廃止した。現在は「甲賀市土山町」として、地名に残る。"},{"page_url":"https://sv.wikipedia.org/wiki/Sigara","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Sigara.nigrolineata.-.lindsey.jpg","page_title":"Sigara","context_page_description":"Sigara är ett släkte av insekter. Sigara ingår i familjen buksimmare."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B8%D1%82%D0%B0%D0%B9%D1%81%D1%8C%D0%BA%D0%B5_%D1%80%D0%B0%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Chopsueywithrice.jpg","page_title":"Китайське рагу","context_page_description":"Китайське рагу це страва з американсько-китайської кухні та інших форм зарубіжної китайської кухні, що складається з м'яса та яйця, що швидко приготовані з овочами, такими як паростки квасолі, капусти, селери та покрита крохмалевим соусом. Страва, як правило, подається з рисом, але може бути китайсько-американською формою «чау мейн» з додаванням смаженої локшини.\\nКитайське рагу стало помітною частиною американсько-китайської, філіппінської, канадсько-китайської, німецько-китайської, індійсько-китайської і полінезійської кухні. У китайській кухні Індонезії рагу стало відоме як кришка CAI і переважно складається з тих же овочів."},{"page_url":"https://et.wikipedia.org/wiki/Orsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/St.Orsk.jpg","page_title":"Orsk","context_page_description":"Orsk on tööstuslinn Venemaal Orenburgi oblastis. Linn asub Lõuna-Uuralite jalamil Uurali jõe kaldal ja Ori jõe suudmes vahetult Kasahstani loodepiiri ääres.\\nOrsk on asutatud 1735. aastal. Linnaõigused sai 1865. aastal.\\nTähtsamad tööstusharud on värviline metallurgia, masinatööstus ja keemiatööstus.\\nOrskis on sündinud vene nõukogude kirjanik ja dramaturg Juri Bondarev."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B3%BC%ED%95%99%ED%98%81%EB%AA%85%EC%9D%98_%EA%B5%AC%EC%A1%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/CopernicSystem.png","page_title":"과학혁명의 구조","context_page_description":"⟪과학혁명의 구조⟫는 철학자 토머스 S. 쿤이 저술한 과학사에 대한 책이다. 이 책의 출판은 과학사, 과학 철학, 과학 지식 사회학에서의 기념비적 사건이며, 현재에도 진행되고 있는 광범위한 평가와 반응을 촉발하였다. 쿤은 정상 과학에서의 진보에 대한 일반적인 인식에 도전하였다. 일반적인 과학적 진보는 이미 수용된 사실과 이론의 \\"축적에 의한 발전\\"으로 인식되었다. 쿤은 정상 과학에서의 이러한 개념적인 연속성의 시기가 혁명적인 과학의 시기에 의해 방해되는 불연속적인 모델을 주장하였다. 혁명의 시기 동안에 발견된 \\"이상 현상\\"은 새로운 패러다임을 야기한다. 새로운 패러다임은 오래된 데이터에 대하여 새로운 질문을 던지며, 이전 패러다임의 \\"수수께끼 풀기\\"을 넘어, 게임의 법칙과 새로운 연구의 방향을 지시하는 \\"지도\\"를 변경한다.\\n예를 들어 쿤의 코페르니쿠스 혁명에 대한 분석은 처음에는 태양중심설이 천체 현상에 대한 지구중심설보다 더욱 정확한 예측을 제공하지 못하였으나, 미래의 어느 시점에서 발전할 더 나은, 더 간결한 해결책의 전망을 가진 실행자에게는 매력적인 이론이었다는 것을 강조하였다. 쿤은 우세한 혁명의 대한 핵심적 개념을 패러다임이라고 불렀으며, 이 단어를 20세기 후반에 광범위한 분석 활동에 활용하게 하였다. 패러다임의 전환은 사회학, 맹신, 과학적 전제의 혼합이며, 논리적으로 명확한 과정이 아니라는 쿤의 주장은 대단한 논쟁을 일으켰다. 쿤은 제2판의 1969년 후기에서 우려를 표한 바가 있다. 일부 평론가는 쿤의 책은 과학의 핵심에 실제적인 인문주의를 도입한 것으로 평가하는 반면, 다른 평론가는 가장 위대한 성취의 중심에 비이성적인 요소를 도입하여 과학의 고귀함을 파괴했다고 평가한다."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AC%E0%B4%82%E0%B4%97%E0%B5%8D%E0%B4%B8%E0%B4%BF%E0%B4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Bangsia_arcaei_-Costa_Rica-8.jpg","page_title":"ബംഗ്സിയ","context_page_description":"ആറു സ്പീഷീസുകളടങ്ങിയ ടനേജേഴ്സിൻറെ ഒരു ജീനസാണ് ബംഗ്സിയ. കൊളംബിയ, ഇക്വഡോർ, പനാമ, കോസ്റ്റാ റീക്ക എന്നിവിടങ്ങളിൽ ഈർപ്പമുള്ള വനങ്ങളുള്ള പ്രദേശങ്ങളിലാണ് ഇവ കാണപ്പെടുന്നത്. Wetmorethraupis അടുത്ത ബന്ധുവാണ്."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%B0%E4%B8%8B%E9%89%84Em%E5%BD%A2%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/%D0%95-%D0%9A%D0%9C_%D0%BD%D0%B0_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D0%B8_%D0%94%D0%BD%D0%B5%D0%BF%D1%80_2.jpg","page_title":"地下鉄Em形電車","context_page_description":"Em形は、ムィティシ機械製造工場およびI.E.エゴロフ工場で製造された地下鉄用電車。ホームドアが採用されたレニングラード地下鉄向けに開発された車両である。\\nこの項目では、I.E.エゴロフ工場で製造が実施された増備車のEm501形およびモスクワ地下鉄に導入されたEm508形についても解説する。"},{"page_url":"https://pl.wikipedia.org/wiki/Przegl%C4%85darka_internetowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Firefox_57.0.png","page_title":"Przeglądarka internetowa","context_page_description":"Przeglądarka internetowa – program komputerowy służący do pobierania i wyświetlania stron internetowych udostępnianych przez serwery WWW, a także odtwarzania plików multimedialnych, często przy użyciu dodatków, zwanych wtyczkami."},{"page_url":"https://it.wikipedia.org/wiki/Shiloh_(Georgia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Shiloh_Georgia.JPG","page_title":"Shiloh (Georgia)","context_page_description":"Shiloh è una città degli Stati Uniti d'America, situata in Georgia, nella Contea di Harris."},{"page_url":"https://es.wikipedia.org/wiki/Espa%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Castillo_de_Sancti_Petri.JPG","page_title":"España","context_page_description":"España, también denominado Reino de España, ​ es un país transcontinental, miembro de la Unión Europea, constituido en Estado social y democrático de derecho y cuya forma de gobierno es la monarquía parlamentaria. Su territorio, con capital en Madrid, ​ está organizado en diecisiete comunidades autónomas, formadas a su vez por cincuenta provincias; y dos ciudades autónomas.\\nEspaña se sitúa tanto al sur de Europa Occidental como en el norte de África. En Europa, ocupa la mayor parte de la península ibérica, conocida como España peninsular, y las islas Baleares; en África se hallan las ciudades de Ceuta y Melilla, las islas Canarias, las islas Chafarinas, el peñón de Vélez de la Gomera, las islas Alhucemas y la isla de Alborán. El municipio de Llivia, en los Pirineos, constituye un exclave rodeado totalmente por territorio francés. Completa el conjunto de territorios una serie de islas e islotes frente a las propias costas peninsulares.\\nTiene una extensión de 505 370 km², ​ por lo que es el cuarto país más extenso del continente, tras Rusia, Ucrania y Francia.​ Con una altitud media de 650 metros sobre el nivel del mar es uno de los países más montañosos de Europa."},{"page_url":"https://nl.wikipedia.org/wiki/%C4%90%E1%BB%93ng_H%E1%BB%9Bi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Donghoi2.jpg","page_title":"Đồng Hới","context_page_description":"Dong Hoi is de hoofdstad van provincie Quảng Bình, centraal Vietnam. Het stadsgebied omvat 154 vierkante kilometer, bevolking in 2005: 130.000. Dong Hoi ligt op ongeveer 50 km ten zuiden van nationaal park Phong Nha-Ke Bang, en 486 km ten zuiden van Hanoi en 172 km van Hué. Dong Hoi is bereikbaar over de weg, per spoor en via de lucht."},{"page_url":"https://pl.wikipedia.org/wiki/Aaron_Leya_Iseka","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Aaron_Leya_Iseka_-_2018-09-24_-_2_cropped.jpg","page_title":"Aaron Leya Iseka","context_page_description":"Aaron Leya Iseka – belgijski piłkarz kongijskiego pochodzenia występujący na pozycji napastnika we klubie SV Zulte Waregem, do którego jest wypożyczony z Anderlechtu. Brat Michyego Batshuayiego."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D8%A7%D9%86%D8%B2_%DA%AF%D8%B1%DB%8C%D9%84%D9%BE%D8%A7%D8%B1%D8%B2%D8%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/100_Schilling_Franz_Grillparzer_obverse.JPG","page_title":"فرانز گریلپارزر","context_page_description":"فرانز سروفیکوس گریلپارزر درام نویس برجسته قرن ۱۹ اهل اتریش بود. نمایشنامه‌های او اغلب در تالار معروف بورگ‌تئاتر وین اجرا می‌شد. او همچنین برای مراسم تشییع جنازه لودویگ فان بتهوون خطابه نوشت.\\nدر حالی که گریلپارزر در دوره رمانتیسم می‌نوشت، زبان شاعرانه او مدیون دوره کلاسیکالیسم است که در سال‌های خلاقیت وی حکمفرما بود. تعهد به آرمانهای کلاسیک زیبایی و اخلاق زیبایی شناختی در قطعه‌های او از واقع‌گرایی ـ که در زمان او شکل گرفت ـ دور است. او ترجیح می‌داد در عوض از تئاتر برای پرداختن به ارزشهای معنوی استفاده کند. به ویژه پس از جنگ جهانی دوم، به دلیل استفاده هویت سازنده در آثار او، از او به عنوان شاعر ملی اتریش نام برده شد."},{"page_url":"https://pl.wikipedia.org/wiki/Messner_Mountain_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Burg_sigmundskron_70249_2014-08-19.JPG","page_title":"Messner Mountain Museum","context_page_description":"Messner Mountain Museum – muzeum założone przez włoskiego alpinistę, Reinholda Messnera, w Południowym Tyrolu, w północnych Włoszech. Instytucja została stworzona w celu przybliżenia odwiedzającym historii i charakteru alpinizmu, nauki na temat gór i lodowców, a także historii osadnictwa w górach. Muzeum posiada sześć oddziałów."},{"page_url":"https://es.wikipedia.org/wiki/%C3%85snes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/NO_0425_%C3%85snes.svg","page_title":"Åsnes","context_page_description":"Åsnes es un municipio en el condado de Hedmark, Noruega. Forma parte del distrito de Solør y su centro administrativo es la localidad de Flisa."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%BE%E4%BB%A3%E8%97%A9","image_url":"https://upload.wikimedia.org/wikipedia/ja/1/13/Sanada_Park_Onda_Tamichika_statue.jpg","page_title":"松代藩","context_page_description":"松代藩は、江戸時代、信濃国埴科郡松代町にあった藩。信濃国内の藩では最高の石高を有した。長野県長野市の松代城を居城とし川中島四郡を領した。藩主は、酒井家、越前松平家、真田家が就封した。なお本項では、城地は異なるが同じ領地を支配した川中島藩についても記載する。"},{"page_url":"https://cs.wikipedia.org/wiki/William_Daniel_Phillips","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/William_Phillips-physicist_photo.jpg","page_title":"William Daniel Phillips","context_page_description":"William Daniel Phillips je americký fyzik, který spolu se Stevenem Chu a Claudem Cohen-Tannoudjim získal Nobelovu cenu za fyziku za rok 1997. Má italské a velšské předky."},{"page_url":"https://de.wikipedia.org/wiki/Tschumysch","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Chumysh_Yazovo_winter_2005.jpg","page_title":"Tschumysch","context_page_description":"Der Tschumysch ist ein 644 km langer rechter Nebenfluss des Ob in Westsibirien."},{"page_url":"https://en.wikipedia.org/wiki/Rubbenbruchsee","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Osnabr%C3%BCck_Rubbenbruch_Naturwiese.jpg","page_title":"Rubbenbruchsee","context_page_description":"The Rubbenbruchsee is an artificial lake on the western side of Osnabrück, Germany, which comprises part of a larger local recreation area. It covers an area of roughly 24 hectares and has a length of about one kilometre. Its width varies from around 100 to 300 metres, its depth from 2 to 24 metres."},{"page_url":"https://nl.wikipedia.org/wiki/Strangolagalli","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Strangolagalli.jpg","page_title":"Strangolagalli","context_page_description":"Strangolagalli is een gemeente in de Italiaanse provincie Frosinone en telt 2552 inwoners. De oppervlakte bedraagt 10,5 km², de bevolkingsdichtheid is 250 inwoners per km²."},{"page_url":"https://az.wikipedia.org/wiki/Manipur","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Manipur_district_map.png","page_title":"Manipur","context_page_description":"Manipur - Hindistanın şimal-şərqində yerləşən ştat. İnzibati mərkəzi İmfal şəhəridir. Şimalda Naqalend, cənubda Mizoram, qərbdə Assam, şərqdə isə Myanma ilə həmsərhəddir. Ştatın digər adları Kangleipak və ya Sanaleibak-dır.\\nManipur 2500 ildən artıq müddətdə Asiyanın iqtisadi və mədəni kəsişmə nöqtəsi olmuşdu."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A5%D0%B8%D0%B4%D1%80%D0%BE%D0%B5%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B0%D0%BD%D0%B0_%D0%83%D0%B5%D1%80%D0%B4%D0%B0%D0%BF_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Izgled_gradili%C5%A1ta_HE_%C4%90erdap_I_posle_pregra%C4%91ivanja_Dunava.jpg","page_title":"Хидроелектрана Ѓердап I","context_page_description":"Хидроелектрана Ѓердап – систем од една бранска и една речна-проточна хидроелектрана, „Ѓердап I“ и „Ѓердап II“, кои се изградени на реката Дунав на излезот од Ѓердапската Клисура, на српско-романската граница, така што им припаѓа на Србија и Романија.\\nВо вкупното производство на електрична енергија во Србија електраните Ѓердап учествуваат со околу 20%."},{"page_url":"https://de.wikipedia.org/wiki/St._Michael_(Waalhaupten)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Waalhaupten_St._Michael_Felderdecke_833.jpg","page_title":"St. Michael (Waalhaupten)","context_page_description":"Die katholische Filialkirche St. Michael in Waalhaupten, einem Ortsteil von Waal im bayerischen Landkreis Ostallgäu, ist ein gotischer Bau aus der ersten Hälfte des 15. Jahrhunderts, der um 1700 erneuert wurde. Die ehemalige Pfarrkirche und heutige Friedhofskirche ist dem Erzengel Michael geweiht. In der Kirche sind Wandmalereien aus dem frühen 16. Jahrhundert erhalten. Das Gebäude ist ein geschütztes Baudenkmal."},{"page_url":"https://eo.wikipedia.org/wiki/Carbodies","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/1962_Austin_FX4_London_taxi.jpg","page_title":"Carbodies","context_page_description":"Carbodies estis brita fabrikanto de karoserioj kaj taksioj, establita de 1919 ĝis 1988 sur Holyhead Road en Coventry."},{"page_url":"https://sv.wikipedia.org/wiki/Pomorer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Rus-pomors.jpg","page_title":"Pomorer","context_page_description":"Pomorer var ett namn under tidigare århundraden för de ryssar som var bosatta vid Barents hav och Vita havet i Nordvästra Ryssland.\\nPomorerna drev en omfattande handel med den norska kustbefolkningen i Finnmark och övriga Nordnorge ungefär fram till Bodø under perioden från 1740-talet och fram till första världskriget."},{"page_url":"https://cs.wikipedia.org/wiki/Obdob%C3%AD_Tai%C5%A1%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Emperor_Taish%C5%8D.jpg","page_title":"Období Taišó","context_page_description":"Období Taišó bylo historické období v dějinách Japonska mezi 30. červencem 1912 a 25. prosincem 1926. Během tohoto období stál v čele Japonského císařství císař éry Taišó. Rok 1912 byl původně 45. rokem éry Meidži, ale po smrti císaře éry Meidži byl prohlášen 1. rokem éry Taišó. Obdobně rok 1926 byl původně 15. rokem éry Taišó, ale po smrti císaře byl prohlášen 1. rokem následující éry Šówa.\\nBěhem předchozího období Meidži došlo k mnoha reformám ve státní správě, ale i ke změnám ve společnosti. Tyto změny pokračovaly i nadále. Charakteristický byl prudký technický pokrok a modernizace institucí.\\nKe konci tohoto období se začala Japonského císařství dotýkat poválečná hospodářská krize."},{"page_url":"https://nl.wikipedia.org/wiki/Huis_met_de_Vazen_(Assen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/HuisMetDeVazen.Assen.jpg","page_title":"Huis met de Vazen (Assen)","context_page_description":"Het Huis met de Vazen is een 19e-eeuws woonhuis in de Nederlandse stad Assen. Het pand valt sinds 1997 binnen het beschermd stadsgezicht."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%82%A4%E3%82%AF%E3%83%BB%E3%83%9B%E3%83%B3%E3%83%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Honda_family.jpg","page_title":"マイク・ホンダ","context_page_description":"“マイク”マイケル・マコト・ホンダは、アメリカ合衆国の政治家。カリフォルニア州に生まれ、民主党のカリフォルニア州第15下院議員選挙区選出の下院議員を8期務めた。学歴はサンノゼ州立大学修了。学位はBachelor in biological sciences and Spanish及びMaster in Education。韓国外国語大学校名誉政治学博士。日本名は本田実。\\n2007年に米国下院議会で行われた「従軍慰安婦問題の対日謝罪要求決議」を代表提案者として主導した。コリア・コーカスのメンバーで、米国政界を代表する親韓派・知韓派議員と韓国で報道されていた。"},{"page_url":"https://nl.wikipedia.org/wiki/Roodmaskertimalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Liocichla_phoenicea_-_Chiang_Mai.jpg","page_title":"Roodmaskertimalia","context_page_description":"De roodmaskertimalia is een zangvogel uit de familie Leiothrichidae."},{"page_url":"https://it.wikipedia.org/wiki/Saona_(isola)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Acque_isola_di_Saona%2C_Repubblica_Dominicana.jpg","page_title":"Saona (isola)","context_page_description":"Saona, situata nel mar dei Caraibi, in posizione parallela all'estremità sud orientale delle Repubblica Dominicana, è un'isola delle Antille di 110 km² di superficie, lunga circa 22 km e larga 5 km nella sua parte più estesa.\\nAppartiene alla provincia con capoluogo La Romana della Repubblica Dominicana. Perlopiù pianeggiante, è una zona protetta e santuario naturale parte del Parco Nazionale dell'Est, istituito nel 1975. È facilmente raggiungibile da Bayahibe, piccola comunità rurale di pescatori.\\nLa popolazione si aggira intorno ai 450 abitanti, localizzati soprattutto a Mano Juan e in misura minore a Punta Catuano; vivono principalmente di pesca e vendita di souvenir ai turisti. Saona rappresenta infatti una delle escursioni più richieste per chi soggiorna a Santo Domingo.\\nL'isola viene spesso descritta come un tipico \\"paradiso caraibico\\", con grandi spiagge di sabbia bianca e acqua cristallina, ed è stata usata come set per numerose riprese con ambientazione tropicale, incluse diversi spot pubblicitari della barretta al cioccolato Bounty."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_properties_in_Kingman,_Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Kingman-House_on_202_E._Park_St-1910.jpg","page_title":"List of historic properties in Kingman, Arizona","context_page_description":"This is a list that includes a photographic gallery of some remaining historical buildings, houses, structures and monuments in Kingman, Arizona. Some of which are listed in the National Register of Historic Places. Also, included are images of the historic Steam Engine #3759 which was built in 1927 for the Santa Fe Railroad."},{"page_url":"https://cs.wikipedia.org/wiki/G%C3%BCnzburg","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Innenstadt_Guenzburg_02.JPG","page_title":"Günzburg","context_page_description":"Günzburg je velké okresní město stejnojmenného okresu v německé spolkové zemi Bavorsko. Leží ve Švábsku, asi 20 km severovýchodně od Ulmu, na soutoku Dunaje s řekou Günz, která mu dala jméno. Má přibližně dvacet tisíc obyvatel."},{"page_url":"https://eo.wikipedia.org/wiki/Mar%C5%9Dado","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Tour_to_the_Quebrada_de_las_Conchas.jpg","page_title":"Marŝado","context_page_description":"Marŝado aŭ piedirado aŭ paŝado estas sporto aŭ libertempa okupado, kiu konsistas je piedirada promeno en la naturo.\\nMarŝadon oni praktikas aŭ nur kiel celo por fortigi la korpon aŭ trankviligi la menson, sed ankaŭ, ĉefe iam, por specifaj celoj kiel esplorado, laborserĉado, fuĝado aŭ komercado. Oni nomas tiun formon de marŝo ankaŭ migrado.\\nEn la eŭropaj Alpoj marŝado estas centra ero de la somera turismo, sed ne nur ligita al montoj. Ĉiuj pejzaĝe belaj regionoj en Eŭropoj proponas prilaboritajn kaj markitajn marŝadpadojn."},{"page_url":"https://ms.wikipedia.org/wiki/Limans","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Limans.jpg","page_title":"Limans","context_page_description":"Limans ialah komun di jabatan Alpes-de-Haute-Provence di Provence-Alpes-Côte d'Azur di tenggara Perancis."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%82%AE%E3%83%AA%E3%82%B9%E3%81%AE%E8%BB%BD%E6%88%A6%E8%BB%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Vickers_Light_Tank_Mark_VI.jpg","page_title":"イギリスの軽戦車","context_page_description":"イギリスの軽戦車において、Mk IからMk Vの一連の軽戦車は設計上の関連が深い。これらは戦間期にヴィッカースによりイギリス陸軍向けに生産された。\\n第一次世界大戦および第二次世界大戦の間、イギリスでは類似した一連の軽戦車を生産していた。これらは訓練に使用され、また、限定的ながら1941年の東アフリカ戦線における南アフリカ陸軍のように、イギリス帝国の部隊が戦闘に投入している。全てが車重およそ5.1t、路上で48km/hを発揮し、路外の縦走では約32km/hを出した。\\nイギリスではこうした軽戦車について、他の軽戦車以外に想定される何かに対しての投入を考えていなかった。そうした事から兵装は機関銃のみであった――7.7mmか12.7mm弾を用いるヴィッカース重機関銃を射撃する。緩衝装置にはボギーにホルストマン・コイルスプリングを装着した。機関にはメドウス6気筒ガソリンエンジンを用いた。Mk Vになるまでこれらは操縦手兼車長、銃手が搭乗した。Mk Vには操縦手、銃手、銃手を補助する車長が乗った。\\n比較的少数の、多様な軽戦車が生産されている。Mk Vでは設計が多かれ少なかれ最適化されており、これはMk.VI軽戦車の形状をとって最後の派生型になった。戦争が予期される中、Mk VIはイギリス陸軍の増強計画のために選ばれた。\\nMk.VIIテトラーク軽戦車およびMk VIII軽戦車「ハリー・ホプキンス」がヴィッカースによって生産されているが、これらはMk IからMk VIまでの一連の軽戦車と関連はない。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Dallet","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Dallet_0803.jpg","page_title":"Dallet","context_page_description":"Dallet sī ūi-tī Hoat-kok Auvergne toā-khu Puy-de-Dôme koān ê chi̍t ê commune."},{"page_url":"https://be.wikipedia.org/wiki/%D0%86%D0%BB%D0%BE%D0%B2%D0%B0-%D0%90%D1%81%D0%B0%D0%B4%D0%B0_(%D0%B3%D0%BC%D1%96%D0%BD%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Dzialdowski.png","page_title":"Ілова-Асада (гміна)","context_page_description":"Іло́ва-Аса́да — вясковая гміна ў Польшчы, уваходзіць у склад Дзялдоўскага павета Вармінска-Мазурскага ваяводства. Сядзіба размешчана ў Ілова-Асадзе. Плошча гміны складае 103,77 км². Станам на 2010 год у гміне Ілова-Асада пражывалі 7248 чалавек, шчыльнасць — 69,8 чал./км². Адміністрацыйна падзелена на 15 салецтваў."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B2%D0%B8%D0%BB%D1%8C_(%D0%AD%D1%80_%D0%B0,_%D0%9B%D1%83%D0%B0%D1%80_%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Serville_mairie_Eure-et-Loir_France.jpg","page_title":"Сервиль (Эр а, Луар а)","context_page_description":"Сервиль — Францин гӀала-коммуна, лаьтта Центр — Луаран атагӀа регионехь. Коммунан департамент — Эр а, Луар а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://de.wikipedia.org/wiki/Wikiwand","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Screenshot_wikiwand.jpg","page_title":"Wikiwand","context_page_description":"Wikiwand ist eine Software zur alternativen Darstellung von Artikeln aus der Wikipedia. Die grafische Benutzeroberfläche ist englisch, die Wikipedia-Inhalte können in allen vorliegenden Sprachen angezeigt werden."},{"page_url":"https://en.wikipedia.org/wiki/GMT400","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Gmcsuburban.jpg","page_title":"GMT400","context_page_description":"The GMT 400 and similar GMT 480 was the platform for the 1988-1998 model year full-size pickup truck. The GMT 410, GMT 420, GMT 425, and GMT 430 were used for full-size SUVs from late 1991 to 2000. This was the first GMT designation for the C and K full-size trucks and SUVs.\\nThe engineering for the GMT400 was done by the GM Truck & Bus group, working primarily out of a rented facility at Pioneer Engineering on 9 mile Road in Warren, MI.\\nGMT 400 frames were built by A.O. Smith Automotive Products, Dana Holding Corporation, and Tower Automotive.\\nEngines included the gasoline 4.3L-V6, 5.0L-V8, 5.7L-V8, 7.4L-V8, and diesel 6.2L V8 and 6.5L V8. Throttle body fuel injection was used on '88-'95 gas engines. CPI was used on the '96-'00 4.3L-V6, 5.0L-V8, 5.7L-V8, while the '96-'00 7.4L-V8 used SFI.\\nThe GMT400 series was replaced by the GMT800 vehicles beginning in 1998. The GMT400 models were built at Ft. Wayne, IN, Pontiac, MI, Flint, MI, Oshawa, ON Canada, and Janesville, WI & Arlington, TX."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%82%D1%80%D0%B0%D1%82%D0%B8_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D1%96%D0%B9%D1%89%D0%B8%D0%BD%D0%B8_%D0%B2%D0%BD%D0%B0%D1%81%D0%BB%D1%96%D0%B4%D0%BE%D0%BA_%D0%B2%D1%82%D0%BE%D1%80%D0%B3%D0%BD%D0%B5%D0%BD%D0%BD%D1%8F_%D0%B2_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D1%83_%D1%80%D0%BE%D1%81%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D1%85_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B2%D0%B8%D1%85_%D1%84%D0%BE%D1%80%D0%BC%D1%83%D0%B2%D0%B0%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/3-%D0%B9_%D0%BE%D0%BA%D1%80%D0%B5%D0%BC%D0%B8%D0%B9_%D0%BF%D0%BE%D0%BB%D0%BA_%D1%81%D0%BF%D0%B5%D1%86%D1%96%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BF%D1%80%D0%B8%D0%B7%D0%BD%D0%B0%D1%87%D0%B5%D0%BD%D0%BD%D1%8F.png","page_title":"Втрати Олександрійщини внаслідок вторгнення в Україну російських військових формувань","context_page_description":"Список осіб, чиє життя було пов'язане з Олександрією та/або Олександрійським районом, що служили чи працювали у силових структурах України і загинули внаслідок російської військової агресії проти України."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Yp%C3%A4j%C3%A4n_julkisista_taideteoksista_ja_muistomerkeist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/fi/7/70/Perttulan_vanhan_kirkon_muistokivi.JPG","page_title":"Luettelo Ypäjän julkisista taideteoksista ja muistomerkeistä","context_page_description":"Luettelo Ypäjän julkisista taideteoksista ja muistomerkeistä sisältää Ypäjän kunnassa olevat pysyvät patsaat, muistomerkit ja muistolaatat.\\nLuettelossa on pysyvästi julkisilla paikoilla olevia taideteoksia, muistomerkkejä ja muistolaattoja sekä hautausmailla olevia yleisiä muistomerkkejä ja patsaita. Luettelossa ei mainita rakennusten sisällä ja suljetuilla sisäpihoilla olevia julkisia teoksia eikä yksittäisten hautojen veistoksia. Teokset ovat luettelossa nimensä mukaisessa aakkosjärjestyksessä. Sijaintipaikka on puiston, aukion, rakennuksen tai muun vastaavan nimi ja/tai katuosoite. Alue tarkoittaa kaupunginosaa/kunnanosaa, taajamaa, kylää, osa-aluetta tai asuinaluetta. Karttalinkki osoittaa teoksen sijaintipaikan kymmenien metrien tarkkuudella. Paljastusvuosi on teoksen julkistuksen tai paljastuksen vuosi sijaintipaikalla."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Bousval","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Ch%C3%A2teau_de_Bousval_02.JPG","page_title":"Château de Bousval","context_page_description":"Le château de Bousval est un château situé à Bousval, section de la ville belge de Genappe, en Brabant wallon."},{"page_url":"https://vi.wikipedia.org/wiki/Rau_c%E1%BB%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Og%C3%B3rki...jpg","page_title":"Rau củ","context_page_description":"Rau, có thời kỳ còn gọi là la ghim, là tên gọi chung cho những bộ phận của thực vật được con người hay động vật dùng làm thực phẩm. Ý nghĩa này hiện vẫn được sử dụng phổ biến và áp dụng cho những thực vật có bộ phận ăn được, bao gồm hoa, quả, thân, lá, rễ và hạt. Định nghĩa thứ cấp của từ này không được thống nhất giữa các nền văn hóa và ẩm thực khác nhau. Nhìn chung, rau có thể không gồm quả, hoa, quả kiên và ngũ cốc, nhưng lại bao gồm các loại quả ngon miệng như cà chua và bí ngòi, hoa như bông cải xanh và hạt như đậu.\\nThuở sơ khai, rau được người cổ đại thu hái trong tự nhiên và bắt đầu trồng trọt ở một số nơi trên thế giới, có lẽ trong giai đoạn từ 10.000 đến 7.000 năm trước Công nguyên, khi lối sống nông nghiệp mới đầu phát triển. Ban đầu, người ta trồng những giống địa phương, nhưng theo thời gian, thương mại phát triển đã mang những cây trồng ngoại lai từ nơi khác đến để canh tác trong nước. Hiện nay, hầu hết các loại rau đều có thể sản xuất trên khắp thế giới, miễn là khí hậu thuận lợi, và tại những nơi có ít điều kiện thích hợp thì vẫn có thể trồng cây trong môi trường được bảo vệ."},{"page_url":"https://de.wikipedia.org/wiki/Vincenzo_Vela","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Last_Days_of_Napoleon_by_Vela.jpg","page_title":"Vincenzo Vela","context_page_description":"Vincenzo Vela war ein Schweizer Bildhauer des 19. Jahrhunderts und ein Hauptvertreter des Verismus."},{"page_url":"https://en.wikipedia.org/wiki/Metzgeriales","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Pellia_epiphylla7_ies.jpg","page_title":"Metzgeriales","context_page_description":"Metzgeriales is an order of liverworts. The group is sometimes called the simple thalloid liverworts: \\"thalloid\\" because the members lack structures resembling stems or leaves, and \\"simple\\" because their tissues are thin and relatively undifferentiated. All species in the order have a small gametophyte stage and a smaller, relatively short-lived, spore-bearing stage. Although these plants are almost entirely restricted to regions with high humidity or readily available moisture, the group as a whole is widely distributed, and occurs on every continent except Antarctica."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%86%D8%A7%D8%B1%D8%AA%DA%BE_%D8%B3%DB%8C%D9%86%D9%B9%D8%B1%D9%84_%D9%85%D8%BA%D8%B1%D8%A8%DB%8C_%D9%88%D8%B1%D8%AC%DB%8C%D9%86%DB%8C%D8%A7_%DB%81%D9%88%D8%A7%D8%A6%DB%8C_%D8%A7%DA%88%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/North_Central_West_Virginia_Airport_-_USGS_1_April_1997.jpg","page_title":"نارتھ سینٹرل مغربی ورجینیا ہوائی اڈا","context_page_description":"نارتھ سینٹرل مغربی ورجینیا ہوائی اڈا ریاستہائے متحدہ امریکا کا ایک ہوائی اڈا جو مغربی ورجینیا میں واقع ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/Spring_Grove,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Green_County_Wisconsin_incorporated_and_unincorporated_areas_Spring_Grove_highlighted.svg","page_title":"Spring Grove, Wisconsin","context_page_description":"Spring Grove is a town in Green County, Wisconsin, United States. The population was 861 at the 2000 census. The unincorporated communities of Oakley and Tyrone are located in the town. The ghost town of Clarence was also located in the town."},{"page_url":"https://fi.wikipedia.org/wiki/Cecil_Beaton","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Cecil_Beaton_Photographs-_General%3B_Beaton%2C_Cecil_IB4287C.jpg","page_title":"Cecil Beaton","context_page_description":"Cecil Walter Hardy Beaton oli brittiläinen valokuvaaja, elokuvalavastaja ja puvustaja. Hänen tunnetuimpia valokuviaan ovat kuuluisuuksien muotokuvat, joita on kymmenistä henkilöistä, kuten Marlene Dietrichistä, Salvador Dalísta, Mick Jaggerista, Joan Crawfordista, Katharine Hepburnista, Jacqueline Kennedystä ja Marlon Brandosta.\\nBeaton sai vuoden 1958 lavastuksen ja puvustuksen Oscar-palkinnon elokuvasta Gigi ja vuoden 1964 Oscar-palkinnon puvustuksesta elokuvaan My Fair Lady. Beaton toimi valokuvaajana myös toisessa maailmansodassa. Hänet aateloitiin vuonna 1972."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%9C%A3%E7%A6%8F%E6%96%AF%E7%89%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Map_commune_FR_insee_code_36190.png","page_title":"圣福斯特","context_page_description":"聖福斯特是法國安德爾省的一個市鎮，位於該省中部偏東，屬於伊蘇丹區。該市鎮總面積23.07平方公里，2009年時的人口為293人。"},{"page_url":"https://it.wikipedia.org/wiki/Ana_Ivanovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ana_Ivanovic_Eastbourne_2011_Toss_%281%29.jpg","page_title":"Ana Ivanović","context_page_description":"Ana Ivanović è un'ex tennista serba.\\nTra le giocatrici più talentuose della storia del tennis, in carriera ha conquistato 15 tornei WTA in singolare, compreso il Roland Garros nel 2008; nei tornei del Grande Slam ha raggiunto la finale anche al Roland Garros nel 2007 e agli Australian Open nel 2008. È stata inoltre numero 1 del mondo dal 9 giugno al 10 agosto 2008 e poi dal 18 agosto al 7 settembre dello stesso anno, per un totale di 12 settimane.\\nDopo un periodo di scarsi risultati, torna al successo nel 2014 vincendo in tutto 56 partite e tornando in Top10 a distanza di sei anni dall'ultima volta.\\nSi è ritirata dal tennis professionistico alla fine del 2016.\\nÈ considerata, assieme a Maria Sharapova e ad Anna Kurnikova, come una delle atlete più belle della storia dello sport."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%A1%9C%E3%81%AE%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Tamamura_Utaji.jpg","page_title":"桜の園","context_page_description":"『桜の園』は、ロシアの劇作家アントン・チェーホフによる最晩年の戯曲。チェーホフ42歳の1902年夏に着想され、1903年秋に書き上げられた。初演は1904年1月17日、モスクワ芸術座によって上演された。チェーホフはこれを喜劇と主張したが、スタニスラフスキーは真面目な劇と主張した。\\n最後の劇作品で、『かもめ』、『ワーニャ伯父さん』、『三人姉妹』とともに「チェーホフ四大戯曲」と呼ばれる。"},{"page_url":"https://sv.wikipedia.org/wiki/Hemtj%C3%A4nst","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Altenpflege_05.jpg","page_title":"Hemtjänst","context_page_description":"Hemtjänst organiseras i Sverige främst av kommunerna och består i att bistå individen med hjälp i det egna hemmet så att individen skall kunna fortsätta bo kvar hemma. Oftast bedrivs den av personal anställda av kommunen, men tjänsterna kan också köpas in av privata företag. Hemtjänsten arbetar ofta parallellt med hemsjukvården, i vissa svenska kommuner är det primärvården som har ansvar för hemsjukvård och i andra så har kommunen tagit över det ansvaret efter ädelreformen. Ett samlingsnamn för dessa två grupper är hemvården.\\nFörutom personalen som utför de direkta stödinsatserna så finns inom kommunerna också anställda legitimerade sjuksköterskor med ett medicinskt ansvar för den kommunala hälso- och sjukvården, så kallade MAS, medicinskt ansvarig sjuksköterska. Vissa arbetsgivare bistår personalen med särskilda arbetskläder, så som enhetliga jackor, västar, förkläden samt ibland andra likvärdiga överdelar och byxor."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%A5rse_Sogn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Nordenskirker_Baarse01.jpg","page_title":"Bårse Sogn","context_page_description":"Bårse Sogn\\nist eine Kirchspielsgemeinde\\nim Süden der Insel Sjælland im südlichen Dänemark.\\nBis 1970 gehörte sie zur Harde Bårse Herred im damaligen Præstø Amt, danach zur Præstø Kommune im Storstrøms Amt, die im Zuge der Kommunalreform zum 1. Januar 2007 in der Vordingborg Kommune in der Region Sjælland aufgegangen ist.\\nIm Kirchspiel leben 802 Einwohner, davon 517 im Kirchdorf.\\nIm Kirchspiel liegt die Kirche „Bårse Kirke“.\\nNachbargemeinden sind im Süden und Osten Beldringe Sogn, im Süden Udby Sogn und im Westen Lundby Sogn, ferner in der benachbarten Næstved Kommune im Nordwesten Hammer Sogn und im Norden Snesere Sogn."},{"page_url":"https://de.wikipedia.org/wiki/Gehrendorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Gehrendorf.JPG","page_title":"Gehrendorf","context_page_description":"Gehrendorf ist ein Ortsteil der Stadt Oebisfelde-Weferlingen im Landkreis Börde in Sachsen-Anhalt."},{"page_url":"https://pl.wikipedia.org/wiki/Kr%C3%B3lik_Oswald","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Trolley_Troubles_poster.jpg","page_title":"Królik Oswald","context_page_description":"Królik Oswald – fikcyjna postać stworzona przez Uba Iwerksa i Walta Disneya dla serii filmów animowanych dystrybuowanych przez Universal Studios w latach 20. i 30. XX wieku.\\nBył pierwowzorem Myszki Miki, stworzonej po odebraniu wytwórni Disneya praw do Królika Oswalda."},{"page_url":"https://en.wikipedia.org/wiki/Ifeanyi_Kalu","image_url":"https://upload.wikimedia.org/wikipedia/en/2/20/Ifeanyi_Kalu.jpg","page_title":"Ifeanyi Kalu","context_page_description":"Ifeanyi Kalu is a Nigerian television and film actor, model and fashion designer. He is best known for his role in the movie Lagos Cougars where he starred alongside Uche Jombo, Monalisa Chinda, Alexx Ekubo and the Africa Independent Television series Allison's Stand alongside Joselyn Dumas, Bimbo Manuel, and Victor Olaotun."},{"page_url":"https://pl.wikipedia.org/wiki/USS_Illinois_(BB-7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/USS_Prairie_State_%28IX-15%29_-_NH_67629.jpg","page_title":"USS Illinois (BB-7)","context_page_description":"USS Illinois (BB-7) – amerykański pancernik, okręt główny typu Illinois. Był drugim okrętem United States Navy noszącym nazwę pochodzącą od 21. stanu USA.\\nJednostkę zamówiono 26 września 1896. Stępkę położono 10 lutego 1897 w stoczni Newport News Shipbuilding & Dry Dock Company. Okręt został zwodowany 4 października 1898. Matką chrzestną była pani Nancy Leiter, córka chicagowskiego multimilionera Leviego Z. Leitera. Jednostka weszła do służby 16 września 1901. Pierwszym dowódcą został komandor George A. Converse."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bad_Staffelstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Wolfsdorf_Schafanger_Kruzifix_D-4-78-165-391.jpg","page_title":"Liste der Baudenkmäler in Bad Staffelstein","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen Stadt Bad Staffelstein zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%88%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Lophopsittacus.mauritianus.jpg","page_title":"دودو","context_page_description":"الدودو، طائر عاجز عن الطيران منقرض وقد كان مستوطنا في جزيرة موريشيوس، شرق مدغشقر في المحيط الهندي. وأقرب نوع للدودو ومن نفس الفصيلة طائر ناسك رودريغيس، اللذان يشكلان أسرة الرافينيات من فصيلة الحمام. وأقرب طائر له علاقة بطائر الدودو موجود حاليا هو حمام نيكوبار. كان يعتقد فيما مضى أن طائر الدودو الأبيض موجودا على جزيرة قريبة من ريونيون، ولكن تبين أنه طائر أبو منجل ريونيون واللوحات المرسومة هي لطيور الدودو البيضاء.\\nتبين لنا بقايا طائر الدودو أن طوله يقارب المتر الواحد ووزنه ما بين 10.6 - 21.1 كغم. والدليل الوحيد لوجوده هي اللوحات المرسومة في القرن 17. بسبب الاختلافات الكبيرة، وبعض الرسوم التوضيحية المعروف التي أخذت من العينات الحية، فإن حياة طائر الدودو الدقيقة لا تزال مجهولة، ولا يعرف عن سلوكه الكثير. وقد بينت القصص أن طائر الدودو سمين وغبي، لكن تبين أنه قد تكيف بشكل جيد لنظامه البيئي. وقد تم وصفه أن له ريش بني مع الرمادي، وأقدام صفراء، وذيل كخصلة الشعر، ورأس رمادي عاري، ومنقار أسود، أصفر وأخضر. ويستخدم حصاة المعدة للمساعدة في هضم الطعام، ويعتقد أن الموطن الرئيسية له هي غابات المناطق الساحلية الجافة في موريشيوس. ويضع بيضة واحدة فوق الأرض. ويعتقد أن سبب عجز طائر الدودو عن الطيران هو سهولة حصوله على المصادر الغذائية الوفيرة والغياب النسبي للحيوانات المفترسة في موريشيوس."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B3%D0%B5%D0%BB%D1%8C,_%D0%9C%D0%B0%D1%83%D1%80%D0%B8%D1%81%D0%B8%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Mauricio_Kagel_%281985%29.jpg","page_title":"Кагель, Маурисио","context_page_description":"Маурисио Кагель — аргентинский и германский композитор, известный произведениями с внедрёнными элементами перформанса, подразумевающего включение исполнителей в театральную актёрскую игру.\\nРодился в еврейской семье, по материнской линии происходил из белорусских евреев. Изучал в Буэнос-Айресском университете литературу и философию; не был принят в консерваторию, но частным образом занимался под руководством Альберто Хинастеры. Начиная с 1950 года выступал как кинокритик, в 1955—1957 годы работал репетитором с хором Камерной оперы Театра Колон.\\nС 1957 года жил и работал в Кёльне. В период 1960—1976 годов преподавал на Летних курсах новой музыки в Дармштадте, в 1974—1997 годы — профессор музыкального театра в Кёльнской консерватории. В разное время преподавал также в Буффало, Гётеборге, Берлине.\\nЛауреат ряда международных премий, в том числе Премии Эрнста фон Сименса и Премии Рольфа Шока."},{"page_url":"https://hu.wikipedia.org/wiki/Samuel_de_Champlain","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Samuel_de_Champlain_arrive_%C3%A0_Qu%C3%A9bec_-_George_Agnew_Reid_-_1909.jpg","page_title":"Samuel de Champlain","context_page_description":"Samuel de Champlain francia hajós, térképész, felfedező. Ő alapította Québec városát 1608. július 3-án; „Új-Franciaország atyjának” is nevezik."},{"page_url":"https://ast.wikipedia.org/wiki/Historia_de_Guatemala","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Guatemala_franja_transversal_del_norte.png","page_title":"Historia de Guatemala","context_page_description":"La hestoria de Guatemala ye la cronoloxía de sucesos acaecíos dende l'empiezu del primixeniu poblamientu humanu nel actual territoriu de la República de Guatemala hasta los nuesos díes. Esta empieza colos primeros grupos de persones n'habitar la rexón, de les que se destacar la civilización maya.\\nLos conquistadores españoles lleguen a Guatemala en 1523. Hernán Cortés noma a la ciudá de Guatemala, na so carta de rellación empobinada a Carlos V, fechada en Méxicu el 15 d'ochobre del añu siguiente 1524. Cortés referir a «unes ciudaes de que munchos díes había que yo tengo noticies que se llamen Ucatlán y Guatemala». La rexón pasó a formar la Capitanía Xeneral de Guatemala, adscrita al Virreinatu de la Nueva España.\\nNel sieglu xix, los criollos de la Capitanía Xeneral de Guatemala llograron la so independencia del Imperiu español y la rexón pasó a llamase Federación Centroamericana, que amestóse efímeramente al imperiu d'Agustín de Iturbide en Méxicu."},{"page_url":"https://la.wikipedia.org/wiki/Bo%C3%ABn-sur-Lignon","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Boengenerale.jpg","page_title":"Boën-sur-Lignon","context_page_description":"Boën-sur-Lignon est commune Francicum 3'204 incolarum praefecturae Ligeris in regione orientali Rhodano et Alpibus."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8C%80%EC%A0%84%EA%B4%91%EC%97%AD%EC%8B%9C%EC%9D%98_%EC%8B%9C%EB%82%B4%EB%B2%84%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Daejeon_Bus_Route_311_NSAC_Revised.jpg","page_title":"대전광역시의 시내버스","context_page_description":"대전광역시의 시내버스는 대전광역시의 핵심적인 대중교통 수단으로, 현재 급행버스는 3개 노선, 간선버스는 49개 노선, 지선버스는 12개 노선, 외곽버스는 30개 노선, 맞춤버스는 8개 노선, 간선급행버스는 1개 노선, 마을버스는 유성구에서 3개 노선이 운영중이다.\\n2005년 7월 4일부터 준공영제 및 무료환승제도를 실시하고 있으며, 특히 준공영제는 버스운행은 민간사업자가 전담하되 버스노선과 배차간격 등 운행계획과 실적 관리, 운송수입금과 운송원가관리 등은 대전시에서 관리하는 방식으로 운영하고 있다."},{"page_url":"https://de.wikipedia.org/wiki/Studentenverbindungen_in_Russland","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Bundeszeichen_Ruthenia_St._Petersburg.JPG","page_title":"Studentenverbindungen in Russland","context_page_description":"Deutsche, russische, estnische, lettische und polnische Studentenverbindungen in Russland gab es in St. Petersburg und Moskau."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D9%86%D8%B8%D8%B1%D9%8A%D8%A9_%D8%A7%D9%84%D9%83%D9%87%D8%B1%D9%88%D9%85%D8%BA%D9%86%D8%A7%D8%B7%D9%8A%D8%B3%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Franklin-Benjamin-LOC.jpg","page_title":"تاريخ نظرية الكهرومغناطيسية","context_page_description":"تاريخ نظرية الكهرومغناطيسية، يعود إلى أكثر من 2000 سنة، وانظر التسلسل الزمني لنظرية الكهرومغناطيسية. كان القدماء ملمين بتأثير كهرباء الغلاف الجوي، ولا سيما البرق التي هي بشكل عام كالعواصف الرعدية في مناطق خطوط العرض الجنوبية، وكان لديهم أيضا إلمام بنار سانت إلمو. ومع ذلك فلديهم القليل المعلومات حول الكهرباء، ولم يتمكنوا من تفسير تلك الظواهر علميا. لا يمكن التعامل مع الكهربائية إلا سويا مع المغناطيسية لأن كليهما يظهران معا. أينما توجد الكهرباء فإن المغناطيسية تكون معها. فقد لوحظت كلا من ظاهرتي المغناطيسية والكهرباء في زمن مبكر من \\"تاريخ وجودهما\\"، ولكن لم يفسرا حسب الفهم المعاصر إلى أن طورت فكرة الحث المغناطيسي والشحنة الكهربائية."},{"page_url":"https://sh.wikipedia.org/wiki/Novi_Zeland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Territorial_waters_-_New_Zealand.svg","page_title":"Novi Zeland","context_page_description":"Novi Zeland je ostrvska država u jugozapadnom delu Tihog okeana. Sastoji se od dva velika ostrva ‒ Severnog i Južnog ‒ kao i većeg broja manjih ostrva. Zvanično ime države na maorskom je Aotearoa, što se često prevodi kao „Zemlja dugog belog oblaka“. Novi Zeland je geografski najizolovanija država na svetu. Najbliži sused, Australija, udaljena je 1.500 kilometara severozapadno od glavnih ostrva, preko Tasmanovog mora. Jedina značajnija kopnena masa ka jugu je Antarktik, ka severu su Nova Kaledonija, Fidži i Tonga.\\nZbog svoje izolovanosti Novi Zeland je jedno od poslednje naseljenih mesta na planeti. Tokom ove izolacije razvijen je karakterističan diverzitet flore i faune. Najznačajniji je veliki broj jedinstvenih ptica, od kojih su mnoge izumrle dolaskom ljudi i sisara. Sa umerenom morskom klimom, zemljište je uglavnom pokriveno šumom. Raznovrsnu topografiju zemlje čine i oštri planinski vrhovi koji su rezultat tektonskog pomeranja tihookeanske i indo-australijske ploče.\\nPolinežani su naselili teritoriju današnjeg Novog Zelanda između 1250. i 1300. godine, pritom razvivši karakterističnu Maori kulturu. Prvi kontakt Evropljana je bio 1642. kada je do obala doplovio Abel Tasman."},{"page_url":"https://de.wikipedia.org/wiki/Sabine_Baring-Gould","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/S._Baring-Gould_portrait.PNG","page_title":"Sabine Baring-Gould","context_page_description":"William Sabine Baring-Gould war ein viktorianischer englischer Priester, Hagiograf, Okkultist, Dichter und Schriftsteller sowie Sammler von Volksliedern."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%BD%94%EB%8F%84%EB%A6%AC_%EA%B3%84%EA%B3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Abkhazia_Kodori_Valley.PNG","page_title":"코도리 계곡","context_page_description":"코도리 협곡지대은 조지아에서 분리 독립을 선언한 압하지야에 있는 강 지대이다. 상류 지대는 스반족이 대다수이며 1993년 이후에는 거의 조지아 중앙 정부가 관리했다. 공식적으로는 이 지역을 상압하지야로 통칭한다. 2008년 8월 12일, 압하지야군이 코도리 계곡에서 조지아와 충돌했다.\\n코도리 계곡 상류는 압하지야 상부 부분의 중추를 이루며 조지아와 40마일 정도 국경을 접하고 있다. 평균 해발 고도는 1300~3984m에 이르며 한대림과 눈이 쌓여있는 지대로 연결된다.\\n고원 지대이므로 겨울에는 강설량이 상당히 많다. 연간 강수량은 1600~2000mm에 이르며 1월, 4월, 7월, 10월에 많은 양이 내린다. 180일 정도 눈이 고산 지대에 존재하며 30일 이상 강우가 있다."},{"page_url":"https://en.wikipedia.org/wiki/CHRNB4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/PBB_GE_CHRNB4_207516_at_fs.png","page_title":"CHRNB4","context_page_description":"Neuronal acetylcholine receptor subunit beta-4 is a protein that in humans is encoded by the CHRNB4 gene."},{"page_url":"https://en.wikipedia.org/wiki/Civita_d%27Antino","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Civita_dantino_valleroveto.jpg","page_title":"Civita d'Antino","context_page_description":"Civita d'Antino is a comune and town in the province of L'Aquila, in the Abruzzo region of central Italy."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%9F%93%E5%9C%8B%E8%9C%9C%E7%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Korean_melons_1.jpg","page_title":"韓國蜜瓜","context_page_description":"韓國蜜瓜係葫蘆科蜜瓜屬下嘅一種植物，果實可以食。係東亞種植嘅一種蜜瓜。"},{"page_url":"https://de.wikipedia.org/wiki/Burg_Deva","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Fortificatie_Deva.JPG","page_title":"Burg Deva","context_page_description":"Die Burg Deva befindet sich in der Stadt Deva im Kreis Hunedoara in Rumänien."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B8%D0%B0%D0%BD%D0%B0_(%D1%84%D1%80%D0%B5%D0%B3%D0%B0%D1%82,_1852)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Diana_Wreckage_Illustrated_London_News_1856.jpg","page_title":"Диана (фрегат, 1852)","context_page_description":"«Диана» — фрегат военного флота Российской империи. Стал последним парусным 52-пушечным фрегатом военно-морского флота Российской империи, построенным под руководством подполковника корпуса корабельных инженеров Ф. Т. Загуляева по чертежам фрегата «Паллада», разработанным кораблестроителем В. Ф. Стоке."},{"page_url":"https://no.wikipedia.org/wiki/VM_i_landeveissykling_2017_%E2%80%93_Mennenes_temporitt_(U23)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Brandon_McNulty.jpg","page_title":"VM i landeveissykling 2017 – Mennenes temporitt (U23)","context_page_description":"Menn U23 sin individuelle tempo under VM i landeveissykling 2017 går av stabelen mandag 18 september. Først sykler man den lange runden på 21,1 km. Det er start utenfor Grieghallen før man sykler over Puddefjordsbroen og mot Solheimsviken. Og videre Løbergsveien mot Mindemyren. Og fortsetter til Paradis. Før man sykler opp Birkelundsbakken og ned Nattlandsveien mot Haukeland sykehus og inn mot Bergen sentrum og Sandviken før man sykler inn over Bryggen og mot Festplassen.\\nSå går man ut på runde 2 og da sykler man den korte runden på 16,1 km og løypen går mot Puddefjordsbroen og mot Solheimsviken. Og videre Løbergsveien mot Mindemyren. Og videre opp til Tveitvannet og mot Landås og Haukeland sykehus før man fortsetter forbi Årstad og Bergen sentrum opp mot Sandviken. Før man sykler tilbake forbi Håkonshallen og langs Bryggen og inn til mål ved Festplassen. Til sammen sykler de 37,2 km."},{"page_url":"https://no.wikipedia.org/wiki/Idris_I_av_Libya","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/King_Idris_I_of_Libya_August_15%2C_1965.jpg","page_title":"Idris I av Libya","context_page_description":"Idris I av Libya, født Muḥammad Īdrīs ibn Sayyid Muḥammad al-Mahdī as-Sanūsī, var Kongedømmet Libyas først og eneste konge fra 1951 til 1969. Han var overhode for den islamske sanussiya-ordenen.\\nFør Libyas uavhengighet hadde han vært emir for Kyrenaika fra 1920 og for Tripolitania fra 1922. Under andre verdenskrig støttet han de allierte, og etter å ha forhandlet fram landets uavhengighet med Storbritannia og De forente nasjoner støttet han som konge Amerikas forente stater og Storbritannia heller enn å støtte panarabismen i nabolandene.\\nI 1969 ledet den 27-årige kapteinen, senere selvutnevnt oberst, Muammar al-Gaddafi et statskupp mot Idris og avskaffet monarkiet. Hans nevø Hasan as-Sanussi ble deretter sanussienes leder og Libyas tronpretendent. Idris døde senere i 1983 i Egypt."},{"page_url":"https://fr.wikipedia.org/wiki/V%C3%ADctor_Manuel_Toledo_Manzur","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Andrew_Wheeler_and_Victor_Toledo_Manzur_at_2019_CEC.jpg","page_title":"Víctor Manuel Toledo Manzur","context_page_description":"Víctor Manuel Toledo Manzur, né le 18 octobre 1945 à Mexico, est un biologiste et homme politique mexicain.\\nIl est nommé secrétaire à l'Environnement et aux Ressources naturelles en mai 2019, au sein du gouvernement López Obrador, en remplacement de Josefa González-Blanco Ortiz-Mena."},{"page_url":"https://en.wikipedia.org/wiki/%C3%98stre_Anl%C3%A6g","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Kunstmuseet%2C_c._1896.png","page_title":"Østre Anlæg","context_page_description":"Østre Anlæg is a public park in Copenhagen. Once it was a part of the old city fortifications. The park was designed by landscape architect H.A. Flindt who also designed Ørstedsparken and Copenhagen Botanical Garden on the old fortification. The park lies between The National Art Museum at the southern end, and Oslo Plads and Østerport Station at the northern end. There are three lakes in this park, they used to be part of the moat system."},{"page_url":"https://it.wikipedia.org/wiki/Uccelli_del_Madagascar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Bernier%27s_Teal_RWD.jpg","page_title":"Uccelli del Madagascar","context_page_description":"Uccelli del Madagascar\\nIn Madagascar sono state descritte quasi 300 differenti specie di uccelli, la maggior parte delle quali nidificanti; 110 specie sono endemiche, cioè presenti esclusivamente sul territorio malgascio; altre specie sono condivise con le vicine isole Comore, Mascarene, Mayotte e Seychelles.\\nQuattro famiglie di uccelli sono endemiche del Madagascar: Bernieridae, Brachypteraciidae, Leptosomidae e Mesitornithidae.\\nQuesta lista si basa sulla checklist redatta da Morris e Hawkins ed è aggiornata in base alla classificazione tassonomica e alla nomenclatura attualmente accettate dal Congresso ornitologico internazionale.\\nPer ogni specie sono fornite informazioni sulla presenza seguendo la seguente terminologia:\\nAccidentale - specie riscontrata solo occasionalmente in un determinato territorio; in genere si tratta di individui singoli o in numero limitato, spesso sospinti fuori dalle abituali rotte migratorie da particolari situazioni meteorologiche.\\nEstiva - specie o popolazione migratrice e nidificante in un determinato territorio, nel quale non viene abitualmente effettuato lo svernamento."},{"page_url":"https://fi.wikipedia.org/wiki/Chaumont","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/France_Haute_Marne_Chaumont_01.jpg","page_title":"Chaumont","context_page_description":"Chaumont on kaupunki Ranskassa. Se on Haute-Marnen departementin prefektuuri, eli pääkaupunki, Grand Estin alueella. Kaupungissa on 24 357 asukasta."},{"page_url":"https://ro.wikipedia.org/wiki/Amanita_ceciliae","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Miles_Joseph_Berkeley.jpg","page_title":"Amanita ceciliae","context_page_description":"Amanita ceciliae, sin. Amanita inaurata, din încrengătura Basidiomycota în familia Amanitaceae și de genul Amanita, denumită în popor ciupercă cu teacă, sau ciupercă fără inel uriașă, este o specie de ciuperci comestibile care coabitează, formând micorize pe rădăcinile arborilor. Acest burete, între timp devenit foarte rar, se poate găsi în România, Basarabia și Bucovina de Nord, crescând solitar sau în grupuri mici preferat pe sol neutru până calcaros, dar se întâlnește și pe cel argilos, în păduri de foioase împreună cu carpen, fagi, mesteceni și stejari, dar poate apărea uneori de asemenea în cele de conifere sub"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_in_der_Steiermark","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/NSG_83c_Hubertusseezufluss_0002.jpg","page_title":"Liste der Naturschutzgebiete in der Steiermark","context_page_description":"In der Steiermark sind folgende Gebiete als Naturschutzgebiet ausgewiesen:"},{"page_url":"https://pl.wikipedia.org/wiki/(1805)_Dirikis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/1805Dirikis_%28Lightcurve_Inversion%29.png","page_title":"(1805) Dirikis","context_page_description":"(1805) Dirikis – planetoida z grupy pasa głównego planetoid okrążająca Słońce w ciągu 5 lat i 208 dni w średniej odległości 3,14 au Została odkryta 1 kwietnia 1970 roku w Krymskim Obserwatorium Astrofizycznym w Naucznym na Półwyspie Krymskim przez Ludmiłę Czernych. Nazwa planetoidy pochodzi od Matissa A. Dīriķisa, łotewskiego astronoma. Przed nadaniem nazwy planetoida nosiła oznaczenie tymczasowe (1805) 1970 GD."},{"page_url":"https://uk.wikipedia.org/wiki/STS-129","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/STS-129_Rendezvous_Pitch_Maneuver_Station_Photographers.jpg","page_title":"STS-129","context_page_description":"STS-129 — космічний політ «Атлантіс» за програмою «Спейс Шаттл».\\nДоставка наукового обладнання, матеріалів і запасних частин для продовження життєдіяльності Міжнародної космічної станції. 31-й політ шатла до МКС."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B1%8C%E8%B1%86%E5%B1%9E","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/Snow_pea_flowers.jpg","page_title":"豌豆属","context_page_description":"豌豆屬是豆科蝶形花亞科的一個屬，為一年生或多年生草本植物，分布於地中海和西亞。"},{"page_url":"https://es.wikipedia.org/wiki/Centro_Cultural_de_Espa%C3%B1a_en_Buenos_Aires","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Biblioteca_CCEBA.jpg","page_title":"Centro Cultural de España en Buenos Aires","context_page_description":"El Centro Cultural de España en Buenos Aires de la Agencia Española de Cooperación Internacional para el Desarrollo, conocido por sus siglas CCEBA, creado en 1988 inicialmente como Instituto de Cooperación Iberoamericana conocido como ICI de Buenos Aires Centro Cultural, fue el primer centro de la Red de Centros Culturales AECID, en América y África, dedicados a promover la cultura, la creatividad y la diversidad."},{"page_url":"https://pt.wikipedia.org/wiki/Isabel_Carlota_de_Orle%C3%A3es","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%C3%89lisabeth_Charlotte_d%27Orl%C3%A9ans_as_Duchess_of_Lorraine_after_Rigaud.png","page_title":"Isabel Carlota de Orleães","context_page_description":"Isabel Carlota de Orleães foi uma princesa francesa que se tornou duquesa e, mais tarde, regente de Lorena e Bar graças ao seu casamento com o duque Leopoldo. Era também princesa de Commercy suo jure. Entre os seus filhos, destaca-se o sacro-imperador Francisco I, co-fundador da Casa de Habsburgo-Lorena."},{"page_url":"https://de.wikipedia.org/wiki/Palais_Mamming_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Peter_Mitterhofer_Modell_Meran.jpg","page_title":"Palais Mamming Museum","context_page_description":"Das im April 2015 eröffnete Palais Mamming Museum ist das Stadtmuseum von Meran in Südtirol.\\nDie Dauerausstellung präsentiert in 27 Abteilungen Aspekte der Meraner und Tiroler Geschichte, von der Urgeschichte bis zur modernen Kunst mit Werken von Friedrich Wasmann und Leo Putz. Durch Schenkungen von Bürgern und Kurgästen gelangte das Museum auch in Besitz von Kuriositäten, so werden unter anderem eine ägyptische Mumie, eine sudanesische Waffensammlung aus dem Vorlass von Slatin Pascha und eine Totenmaske Napoleons gezeigt.\\nDas Museum besitzt etwa 100.000 Objekte, dazu kommt eine Tirolensien-Sammlung mit 30.000 Bänden."},{"page_url":"https://de.wikipedia.org/wiki/Hundshai","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/94/Caz%C3%B3n_Adobo_%28Valencia%29.jpg","page_title":"Hundshai","context_page_description":"Der Hundshai ist ein Hai aus der Familie der Glatthaie."},{"page_url":"https://ro.wikipedia.org/wiki/Lactarius_aurantiacus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Milchling-_Birken_%282%29.JPG","page_title":"Lactarius aurantiacus","context_page_description":"Lactarius aurantiacus, din încrengătura Basidiomycota, în familia Russulaceae și de genul Lactarius, este o ciupercă limitat comestibilă, denumită în popor caisa pădurii sau burete gălbișor (bureți gălbișori). Acest burete coabitează, fiind un simbiont micoriza (formează micorize pe rădăcinile arborilor). În România, Basarabia și Bucovina de Nord crește solitar, dar și în grupuri mai mici, în păduri de conifere și mixte umbroase, preferat sub molizi printre perinițe de mușchi, foarte rar, de asemenea, sub brazi precum în cele de foioase pe lângă fagi. Specia se dezvoltă pe sol bazic proaspăt, nu prea gras și umed precum cu un nivel scăzut de azot, de la deal la munte, din august până la sfârșitul lui octombrie sau până la mijlocul lui noiembrie."},{"page_url":"https://en.wikipedia.org/wiki/Buff-tip","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Phalera_bucephala_MHNT.jpg","page_title":"Buff-tip","context_page_description":"The buff-tip is a moth of the family Notodontidae. It is found throughout Europe and in Asia to eastern Siberia. The species was first described by Carl Linnaeus in his 1758 10th edition of Systema Naturae."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%A9%D8%B4%D9%85%DB%8C%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Shawl_makers_in_Kashmir_%281867%29.jpg","page_title":"کشمیر","context_page_description":"کشمیر برصغیر پاک ھند دے شمال مغرب وچ اک پہاڑی دیس اے ۔ تریخی طور تے کشمیر اوہ وادی اے جہڑی ہمالیہ تے پیر پنجال دے پہاڑی سلسلیاں دے وچکار واقع اے ۔ اج کل کشمیر کافی وڈے علاقے نوں سمجھیا جاندا اے، جس چ وادی کشمیر، جموں، لداخ، آزاد کشمیر تے پاکستان دے شمالی علاقے گلگت تے بلتستان شامل نیں ۔ گلگت تے 1848ء چ کشمیر دے ڈوگرہ راجہ نے قبضہ کر لئیا سی، استوں پہلے ایہہ اک آزاد ریست سی، پاکستان بنن دے ویلے ایہہ علاقہ کشمیر چ شامل سی ۔ ایدا کچھ حصھ ھندستان کول کچھ پاکستان کول تے کچھ چین کول اے۔ لوک مسلمان ھندو سکھ بدھ نیں\\nوادی کشمیر پہاڑاں دے دامن چ کئی دریاواں نال زرخیز ہون والی سرزمین اے ۔ ایہہ اپنے حسن دی وجہ توں زمین تے جنت تصور کیتی جاندی اے ۔\\nکشمیر برصغیر پاک ھنددا شمال-مغربی کھیتر اے۔ 19ویں صدی دے ادھ تک کشمیر دا مطلب صرف اپرلے ہمالیا اتے پیر پنجال پربت لڑی دے وچکار کشمیر وادی ہندا سی۔ اج ایہہ اک بہت وڈے کھیتر نوں درساؤندا اے جس وچ بھارت ولوں قبضہ کیتا جموں اتے کشمیر وی شامل اے اتے اس پردیش وچ کشمیر گھاٹی توں علاوہ جموں، اتے لداخ کھیتر وی شامل ہن۔ پاکستان دے انتظام ہیٹھلے آزاد کشمیر اتے گلگت بلتستان، اتے چین دے انتظام ہیٹھلے اکسائی چن اتے قراقرم پرے علاقہ وی کشمیر دے کھیتر دا حصہ ہن۔"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AA%E3%83%B3%E3%83%89%E3%82%A6%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Gentiana_zollingeri.JPG","page_title":"リンドウ属","context_page_description":"リンドウ属はリンドウ科の属の一つ。\\n多年草、一年草、越年草で、茎は直立し、葉は対生または輪生する。花は主に紫色で、茎の先や葉のわきにつく。花冠はふつう5裂し、裂片の間に副片がある。\\n世界に広く分布し、約500種ある。日本には13種知られている。"},{"page_url":"https://it.wikipedia.org/wiki/United_States_Navy","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/United_States_Third_Fleet_insignia_2014.png","page_title":"United States Navy","context_page_description":"La United States Navy è la marina militare degli Stati Uniti d'America, una delle forze armate della repubblica federale.\\nResponsabile della condotta delle operazioni militari navali, la sua missione principale è quella «di mantenere, addestrare ed equipaggiare forze navali pronte al combattimento e capaci di vincere le guerre, essere un deterrente per le aggressioni e mantenere la pace sui mari».\\nNell'anno fiscale 2008, contava 331.682 uomini e donne in servizio attivo e 124.000 nella Riserva Navale, operando con 283 navi e più di 3.700 aeroplani.\\nTrae le sue origini dalla Marina Continentale, fondata durante la guerra di indipendenza e smantellata nel 1790. La costituzione degli Stati Uniti d'America pose le basi per l'istituzione di una marina militare dando al Congresso il potere di «fornire e mantenere una Marina».\\nSecondo la riorganizzazione della U.S. Navy condotta dall'ammiraglio Chester Nimitz, le flotte attive nel Pacifico sono designate da un numero dispari, quelle attive nell'Atlantico e nel Mediterraneo da un numero pari."},{"page_url":"https://hu.wikipedia.org/wiki/Rudolf_Scheurer","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Rudolf_Scheurer_%281973%29.jpg","page_title":"Rudolf Scheurer","context_page_description":"Rudolf Scheurer svájci nemzetközi labdarúgó-játékvezető. Egyetemi tanulmányait Bernben és Genfben végezte. Polgári foglalkozása testnevelő tanár és a soluthurmi tanács tagja."},{"page_url":"https://fi.wikipedia.org/wiki/Saamelaiset","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Aili_Keskitalo_nyvalgt_2013.jpg","page_title":"Saamelaiset","context_page_description":"Saamelaiset ovat pääosin Fennoskandian pohjoisosissa elävä kielellisesti suomalais-ugrilainen alkuperäiskansa. Saamelaisten asuttamaa aluetta kutsutaan Saamenmaaksi. Se koostuu Norjan, Ruotsin ja Suomen pohjoisosista sekä Venäjään kuuluvasta Kuolan niemimaasta.\\nArviot saamelaisten määrästä vaihtelevat 50 000:n ja 100 000:n välillä. Arvioiden suuri vaihtelu johtuu saamelaisuuden tunnusmerkkien eroista. Saamelaisuuden määritelmä perustuu tunnusmerkkeihin, kuten esimerkiksi kieleen, kansalliseen tai kulttuurilliseen samaistumiseen sekä perinteisten saamelaiselinkeinojen harjoittamiseen. Saamelaisten puhumat kielet kuuluvat uralilaisiin kieliin, ja niiden läheisimmät sukukielet ovat yleisimmän käsityksen mukaan itämerensuomalaiset kielet. Saamen kieli on peräisin varhaiskantasuomen eriytymiskehityksestä. Suomen ja saamen kielieron on arveltu alkaneen muodustua noin vuonna 2800 eaa. Suomessa puhutaan kolmea saamen kieltä: pohjois-, inarin ja koltansaamea, jotka ovat kaikki uhanalaisia.\\nSuomen saamelaisalue kattaa Enontekiön, Inarin ja Utsjoen kunnat sekä Lapin paliskunnan alueen Sodankylän kunnassa. Suomen noin 10 000 saamelaisesta noin 3 000 puhuu saamelaiskieliä äidinkielenään."},{"page_url":"https://es.wikipedia.org/wiki/Kelly_Johnson_(ingeniero)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/KellyJohnsonandGaryPowers.jpg","page_title":"Kelly Johnson (ingeniero)","context_page_description":"Clarence Leonard \\"Kelly\\" Johnson fue un innovador ingeniero aeronáutico estadounidense. Obtuvo un gran reconocimiento por sus contribuciones a muchos diseños de aeronaves notables, especialmente por los aviones espía Lockheed U-2 y SR-71 Blackbird, incluyendo también al P-38 Lightning, P-80 Shooting Star y F-104 Starfighter, entre muchos otros. Como miembro y primer líder de la división Skunk Works de Lockheed, Johnson trabajó más de cuatro décadas y fue respetado como una figura con \\"genio organizacional\\".​ Jugó un papel fundamental en el diseño de más de cuarenta aeronaves, incluyendo varias galardonadas con el prestigioso Collier Trophy, adquiriendo la reputación de ser uno de los diseñadores aeronáuticos más prolíficos y talentosos en la historia de la aviación. En 2003, como parte de la conmemoración del centenario del primer vuelo de los Hermanos Wright, la publicación Aviation Week & Space Technology presentó un listado de las 100 personalidades \\"más importantes, interesantes e influyentes\\" en el primer siglo aeroespacial, ubicándolo como 8.º.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%B7%8F%E9%AB%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Souhatsu.jpg","page_title":"総髪","context_page_description":"総髪は、男性の髪型である。月代を剃らずに、前髪を後ろに撫で付けて、髪を後ろで引き結ぶか髷を作った形を言う。髪を結ぶ位置が高いものは形が慈姑に似ることから「慈姑頭」とも呼ばれた。\\n室町時代までは男性の一般的な髪型であった。江戸時代前期からは男性の神官や学者、医師の髪型として結われ始め、江戸時代後期には武士の間でも流行した。経済的に余裕がなく、頻繁に髪の手入れができない浪人も総髪であった。現在でも見られる髪型であり、日本人男性の最も伝統的な髪型の一つである。なお女性の場合は同じ「総髪」でも読みが「そうがみ」と異なる。\\nそもそも月代を剃る習慣とは、戦国時代末期のころに、兜を被った際、頭が蒸れないようにするために定着したものであり、月代が武士の一般風俗として定着したのは江戸時代になってからである。神官や学者は戦闘にはかかわらないという思想上の観点から、この月代は剃らずに総ての髪を残していた。これが「総髪」の語源である。時代が下るにつれて、儒者に限らず「思想家」が一般的にこれを結うようにもなり、幕末の頃になると勤王派の志士の間で大流行したほか、佐幕派の面々の間でもこれを結う者が少なくなかった。江戸時代初期の軍学者・由井正雪、幕末の勤王派の志士・坂本龍馬、佐幕派の新撰組局長・近藤勇、徳川家茂、徳川慶喜などの画像や写真では、月代を剃らず、全ての髪が残っている。\\nなお時代劇に出てくる医師は大抵この総髪を結っているが、御殿医などの官職に就いてる医師の場合髪を剃り上げていた。これに対し町医者などは総髪が一般であった。これは戦国時代の医師が戦場に動員される際には非戦闘員であることを敵方に示すために髪を剃り上げていたことに由来するという説もある。\\n明治時代になると、西洋化政策の一環として明治4年に断髪令が出され、総髪を含む髷は衰退した。当時、「総髪頭をたたいて見れば王政復古の音がする。」という歌が流行した。\\n現在では、散髪の必要がなく、視界を遮らない合理的な髪型として好む男性も多い。"},{"page_url":"https://de.wikipedia.org/wiki/Dehesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Dehesa_Boyal._Bollullos_Par_del_Condado_%28Huelva%29.jpg","page_title":"Dehesa","context_page_description":"Dehesa ist die spanische Bezeichnung für beweidete Eichenhaine, die vor allem im Südwesten Spaniens und in Portugal ausgedehnte Flächen einnehmen. Die Dehesa wurde traditionell als Gemeineigentum gemeinsam bewirtschaftet und gehört zu den Silvopastoralen Systemen; noch heute befinden sich die Ländereien oft im Eigentum der Gemeinde.\\nDie Dehesas in der Extremadura umfassen heute 1,03 Millionen Hektar und bedecken ein Viertel der Gesamtfläche der Region. In der Provinz Cáceres stehen Stein- und Korkeichen auf einer Fläche von 0,53 Millionen Hektar, in der Provinz Badajoz auf 0,50 Millionen Hektar. Damit haben die Dehesas in der Extremadura die mit Abstand größte Verbreitung in Spanien, wo sich im ganzen Land Flächen von 2,1 Millionen Hektar finden. Auch die Hälfte aller spanischen Kork- und Steineichen wächst in der Extremadura. Außerhalb der Iberischen Halbinsel existieren wenige vergleichbare Landschaften. Wegen ihrer großen Ähnlichkeit mit afrikanischen Baumsavannen wird die Dehesa auch die „iberische Serengeti“ genannt."},{"page_url":"https://it.wikipedia.org/wiki/Abbiategrasso","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Abbiategrasso_-_Chiesa_ex_convento_Annunciata_-_Via_Pontida_-_panoramio.jpg","page_title":"Abbiategrasso","context_page_description":"Abbiategrasso è un comune italiano di 32 855 abitanti della città metropolitana di Milano in Lombardia, situato a circa 29 chilometri a sud-ovest dal Duomo di Milano, centro cittadino del capoluogo."},{"page_url":"https://en.wikipedia.org/wiki/Identity_document","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Italian_electronic_ID_card.png","page_title":"Identity document","context_page_description":"An identity document is any document that may be used to prove a person's identity. If issued in a small, standard credit card size form, it is usually called an identity card, or passport card. Some countries issue formal identity documents, as national identification cards which may be compulsory or non-compulsory, while others may require identity verification using regional identification or informal documents. When the identity document incorporates a person's photograph, it may be called photo ID.\\nIn the absence of a formal identity document, a driver's license may be accepted in many countries for identity verification. Some countries do not accept driver's licenses for identification, often because in those countries they do not expire as documents and can be old or easily forged. Most countries accept passports as a form of identification.\\nSome countries require all people to have an identity document available at any time. Many countries require all foreigners to have a passport or occasionally a national identity card from their home country available at any time if they do not have a residence permit in the country."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Deux_Alpes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/2alpes_230206.jpg","page_title":"Les Deux Alpes","context_page_description":"Les Deux Alpes est une station de sports d'hiver française située en Oisans, dans le massif des Écrins. Localisée dans le département de l’Isère et la région d’Auvergne-Rhône-Alpes, elle se trouve à 64 km au sud-est de Grenoble et est desservie par l'aéroport de Grenoble-Isère ou la gare TGV de Grenoble.\\nSituée à 1 650 m d’altitude avec des remontées mécaniques desservant le domaine skiable jusqu’à 3 568 m via un funiculaire souterrain et plusieurs téléphériques. La station, qui possède l’un des plus grands glaciers skiables d’Europe, est très réputée en France pour son ski d’été et son domaine d'altitude particulièrement accessible, même aux débutants.\\nElle fut l’une des premières stations de ski créée en France, dans les années 1930, juste après Chamonix-Mont-Blanc. Elle s’est ensuite développée très fortement dans les années 1950.\\nAnciennement créatrice de la communauté de communes des Deux Alpes, elle est intégrée depuis 2009 à la communauté de communes de l'Oisans."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%82%A4%E3%83%AB%E3%83%AA%E3%83%B3%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Rail_Link_001.jpg","page_title":"レイルリンク","context_page_description":"レイルリンク は、イギリスで生産、フランスで調教を受けたサラブレッドの競走馬、種牡馬。2006年の凱旋門賞、パリ大賞典などに優勝した。"},{"page_url":"https://en.wikipedia.org/wiki/Dale_Abbey_(ruin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Dale_Abbey_2019_east_window_-_east02.jpg","page_title":"Dale Abbey (ruin)","context_page_description":"Dale Abbey, also known as the Abbey of Stanley Park, was a religious house, close to Ilkeston in Derbyshire. Its ruins are located at the village of Dale Abbey, which is named after it. Its foundation legend portrays it as developing from a hermitage, probably in the early 12th century. After several false starts, it was finally constituted as an abbey in 1204. It was affiliated to the Premonstratensians, an order of canons regular in which it played, at times, a leading part among English Houses. It acquired a large number of small properties, concentrated in areas of the East Midlands, developed a network of granges and appropriated a number of lucrative parish churches. Its discipline and reputation varied considerably, particularly in the 15th century, and it seems to have fallen away from the originally austerity. By 1536 its income was well below the threshold set for the Dissolution of Lesser Monasteries. Although there were accusations of grave immorality, the abbey was allowed to pay a fine to continue its existence until 1538."},{"page_url":"https://it.wikipedia.org/wiki/12._Division","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1b/Slesiani_in_fondovalle_Isonzo.jpg","page_title":"12. Division","context_page_description":"La 12. Division fu una divisione regolare dell'Esercito prussiano costituita nel 1818 e integrata dopo il 1871 nel nuovo Esercito tedesco, inserita all'interno del VI corpo d'armata prussiano. I soldati della divisione erano reclutati in Slesia e l'unità aveva la sua base in tempo di pace nella città di Neisse.\\nDopo aver partecipato con distinzione alla guerra contro l'Austria del 1866 e alla guerra franco-prussiana del 1870-1871, la divisione prese parte alla prima guerra mondiale combattendo prevalentemente sul fronte occidentale.\\nNell'autunno 1917 la 12. Division venne trasferita insieme ad altre unità tedesche, sul fronte italiano dove svolse un ruolo decisivo nella battaglia di Caporetto; furono i soldati slesiani di questa divisione che il 24 ottobre avanzarono in profondità nella nebbia lungo il fondovalle dell'Isonzo e raggiunsero, dopo una sorprendente marcia di oltre 20 chilometri in poche ore, la cittadina di Caporetto, sfondando completamente il fronte italiano e seminando il panico e la confusione tra i reparti nemici di retrovia.\\nDopo la brillante condotta sul fronte italiano, la 12."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Roman_theatres","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Roman_theatre_of_Palmyra_02.jpg","page_title":"List of Roman theatres","context_page_description":"Roman theatres built during the Roman period may be found all over the Roman Empire. Some were older theatres that were re-worked."},{"page_url":"https://es.wikipedia.org/wiki/Sh%C5%8Dgun","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Kanji_shogun.png","page_title":"Shōgun","context_page_description":"En la historia de Japón, el término shōgun escuchar, castellanizado como sogún, ​ era un título histórico en Japón concedido directamente por el emperador. Como título, es la abreviación de Seii Taishōgun, ​ nombramiento que hasta 1192 había sido temporal​ y era utilizado para referirse al general que comandaba al ejército enviado a combatir a los emishi, quienes habitaban en el norte del país.\\nDurante el siglo XII​ el shōgun se constituyó como el gobernante de facto de todo el país, aunque teóricamente el emperador era el legítimo gobernante y este depositaba la autoridad en el shōgun para gobernar en su nombre.​ Durante este tiempo, el emperador se vio obligado a delegar completamente cualquier atribución o autoridad civil, militar, diplomática y judicial a quien tuviera dicho título.​\\nDurante los primeros contactos con occidente e incluso en algunos países asiáticos como China, el shōgun era considerado como «rey de Japón», ignorando que existían dos estructuras de autoridad.​"},{"page_url":"https://en.wikipedia.org/wiki/Amund_Maarud","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Amund_Maarud_Piknik_i_Parken_2017_%28150833%29.jpg","page_title":"Amund Maarud","context_page_description":"Amund Maarud is a Norwegian blues/rock musician and composer, known as a solo artist and as frontman of rock bands The Grand and the duo «Morudes» with his brother, the drummer Henrik Maarud."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Gro%C3%9Fkorbetha%E2%80%93Deuben","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/DehlitzSaalebr.JPG","page_title":"Bahnstrecke Großkorbetha–Deuben","context_page_description":"Die Bahnstrecke Großkorbetha–Deuben ist eine nur noch teilweise in Betrieb befindliche Nebenbahn im Burgenlandkreis im südlichen Sachsen-Anhalt. Bedeutendste Stadt an der Strecke ist Hohenmölsen."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%84%D8%A8%D8%B1%D8%AA_%D9%81%D9%88%D9%83%D8%B3_(%D9%84%D8%A7%D8%B9%D8%A8_%D8%B4%D8%B7%D8%B1%D9%86%D8%AC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Albert_Whiting_Fox.jpg","page_title":"ألبرت فوكس (لاعب شطرنج)","context_page_description":"ألبرت فوكس ‏ هو لاعب شطرنج أمريكي، ولد في 29 أبريل 1881 في بوسطن في الولايات المتحدة، وتوفي في 29 أبريل 1964 في واشنطن العاصمة في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Norfolk_County,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Daniel_Kingsbury_House%2C_Needham_MA.jpg","page_title":"National Register of Historic Places listings in Norfolk County, Massachusetts","context_page_description":"This is a list of properties and historic districts listed on the National Register of Historic Places in Norfolk County, Massachusetts, other than those within the city of Quincy and the towns of Brookline and Milton. Norfolk County contains more than 300 listings, of which the more than 100 are not in the above three communities are listed below. Some listings extend across municipal boundaries, and appear on more than one list.\\nThe locations of National Register properties and districts may be seen in a map by clicking on \\"Map of all coordinates\\".\\nThis National Park Service list is complete through NPS recent listings posted April 10, 2020."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D0%B0%D1%8F%D1%9E%D0%BD%D1%8B%D1%8F_%D0%B3%D1%80%D0%BE%D1%88%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Coins_before_Euro.jpg","page_title":"Наяўныя грошы","context_page_description":"Ная́ўныя гро́шы, гато́ўка — сума выпушчаных у абарот папяровых і манетных грошаў, якія з'яўляюцца сапраўднымі аплатнымі сродкамі.\\nНаяўныя грошы нязручныя тым, што імі нельга аплаціць дыстанцыйна, для гэтага трэба выкарыстоўваць электронныя грошы або безнаяўную аплату, але вельмі зручныя, калі трэба аплаціць што-небудзь канфідэнцыйна."},{"page_url":"https://ceb.wikipedia.org/wiki/G%C3%B6ta_%C3%84lv","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Trollhattefallen.jpg","page_title":"Göta Älv","context_page_description":"Suba ang Göta Älv sa Sweden. Nahimutang ni sa habagatang bahin sa nasod, 400 km sa habagatan-kasadpan sa Estokolmo ang ulohan sa nasod. Ang Göta Älv mao ang bahin sa tubig-saluran sa Göta Älv."},{"page_url":"https://ceb.wikipedia.org/wiki/Gazella_subgutturosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Kuhertajagaselli_Korkeasaari.jpg","page_title":"Gazella subgutturosa","context_page_description":"Espesye sa mamipero nga una nga gihulagway ni Güldenstaedt ni adtong 1780 ang Gazella subgutturosa. Ang Gazella subgutturosa sakop sa kahenera nga Gazella sa kabanay nga Bovidae. Giklaseklase sa IUCN ang espesye sa madutlan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D0%B1%D0%BE%D1%80_%D0%A1%D0%B2%D1%8F%D1%82%D0%B5%D0%B9%D1%88%D0%B5%D0%B3%D0%BE_%D0%A1%D0%B5%D1%80%D0%B4%D1%86%D0%B0_%D0%98%D0%B8%D1%81%D1%83%D1%81%D0%B0_(%D0%9B%D0%B0%D1%85%D0%BE%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Sacred_Heart_Cathedral1.jpg","page_title":"Собор Святейшего Сердца Иисуса (Лахор)","context_page_description":"Собор Святейшего Сердца Иисуса — католический храм, находящийся в городе Лахор, Пакистан. Церковь является кафедральным собором архиепархии Лахора."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9C%9D%E4%BE%86%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Flag_of_Asago_Hyogo.JPG","page_title":"朝來市","context_page_description":"朝來市是位於日本兵庫縣北部但馬地域的城市，轄區位於中國山地內，因此多為山區地形，主要市區集中在圓山川及市川沿岸山谷中。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A6%B2%E0%A6%95%E0%A6%BE%E0%A6%A4%E0%A6%BE_%E0%A6%AA%E0%A7%81%E0%A6%B2%E0%A6%BF%E0%A6%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/India_-_Kolkata_traffic_cop_-_3661.jpg","page_title":"কলকাতা পুলিশ","context_page_description":"কলকাতা পুলিশ ফোর্স হলো পশ্চিম বঙ্গ রাজ্যের দুটি পুলিশ ফোর্সের মধ্যে একটি । কোলকাতা পুলিশের কাজ হল কোলকাতা মহানগর এলাকায় পুলিশি কাজ, ভারতের মধ্যে যেটা ১৮৬৬ সালের 'কলকাতা পুলিশ' আইন' এবং ১৮৬৬ সালের 'কোলকাতা উপ-পৌর পুলিশি আইন'-এর অধীনে সংজ্ঞায়িত।"},{"page_url":"https://de.wikipedia.org/wiki/Chaumi%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Chaumi%C3%A8re_normande.jpg","page_title":"Chaumière","context_page_description":"Eine Chaumière ist ein einfaches, strohgedecktes Wohngebäude in Frankreich. Chaume bedeutet im Französischen „Stroh“. Die Gebäude sind manchmal zweistöckig, stets aber relativ schmal und nur selten vollständig unterkellert. Der Unterschied zum Cottage besteht außer in der geografischen Lage noch darin, dass eine Chaumière unbedingt ein Stroh- oder Reetdach hat."},{"page_url":"https://sv.wikipedia.org/wiki/Hymenoxys","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Hymenoxyshoopesii.JPG","page_title":"Hymenoxys","context_page_description":"Hymenoxys är ett släkte av korgblommiga växter. Hymenoxys ingår i familjen korgblommiga växter.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://es.wikipedia.org/wiki/Primer_ministro_de_Rumania","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Barbu_Stirbey.jpg","page_title":"Primer ministro de Rumania","context_page_description":"El primer ministro de Rumania es el jefe de Gobierno de dicho país. Es designado por el presidente de Rumania y ratificado por la Cámara de Diputados tras las elecciones legislativas en el país. El actual primer ministro del país es Ludovic Orban elegido el 4 de noviembre de 2019."},{"page_url":"https://en.wikipedia.org/wiki/Singapore_Armed_Forces_Military_Police_Command","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/SAFMPCGOH.jpg","page_title":"Singapore Armed Forces Military Police Command","context_page_description":"The Singapore Armed Forces Military Police Command is the military police unit of the Singapore Armed Forces, performing policing duties to uphold standards of discipline amongst members of the SAF. Its responsibilities include security of key SAF military installations, the guarding of the Ministry of Defence, ceremonial sentries at the Istana, forming the ceremonial guards for visits by VVIPs to the country and other national events, the maintenance of discipline through enforcement and the operation of the SAF Detention Barracks, and search and rescue operations, amongst others. In wartime contingencies, it would also be tasked with safeguarding prisoners-of-war, protecting rear-echelon areas/HQs and securing important supply routes and relevant bases."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%90%D7%95%D7%93%D7%95%D7%A8%D7%94,_%D7%A7%D7%99%D7%A1%D7%A8%D7%99%D7%AA_%D7%94%D7%90%D7%99%D7%9E%D7%A4%D7%A8%D7%99%D7%94_%D7%94%D7%91%D7%99%D7%96%D7%A0%D7%98%D7%99%D7%AA_(%D7%94%D7%9E%D7%90%D7%94_%D7%94-6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Benjamin-Constant-L%27Imperatrice_Theodora_au_Colis%C3%A9e.jpg","page_title":"תאודורה, קיסרית האימפריה הביזנטית (המאה ה-6)","context_page_description":"תאודורה הייתה אשתו של קיסר האימפריה הביזנטית יוסטיניאנוס הראשון וקיסרית במשותף עם בעלה. דמותה של תאודורה עוררה מאז ומעולם עניין רב, בין בשל אישיותה הכריזמטית וכוחה הרב באימפריה ובין בשל הקריירה המושמצת שלה לפני שהפכה לקיסרית."},{"page_url":"https://en.wikipedia.org/wiki/Sisters_of_Charity_of_Saint_Elizabeth","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Convent_Elizabeth_Morristown_sign_jeh.jpg","page_title":"Sisters of Charity of Saint Elizabeth","context_page_description":"The Sisters of Charity of Saint Elizabeth are a Roman Catholic apostolic congregation of pontifical right, based in the Convent Station area of Morris Township, New Jersey, USA. The religious order was established in 1859 in Newark, New Jersey, following the example of Elizabeth Ann Seton's community that was founded in 1809 in Emmitsburg, Maryland."},{"page_url":"https://hu.wikipedia.org/wiki/Gare_du_Grand-Lemps","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/17/Gare_Le_Grand_Lemps.JPG","page_title":"Gare du Grand-Lemps","context_page_description":"Gare du Grand-Lemps vasútállomás Franciaországban, Le Grand-Lemps településen."},{"page_url":"https://gl.wikipedia.org/wiki/Pagai_do_Norte","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Mentawai_Islands_Topography.png","page_title":"Pagai do Norte","context_page_description":"Pagai do Norte é unha das illas Mentawai na costa occidental de Sumatra en Indonesia. Está ao sur da illa de Sipura e ao norte de Pagai do Sur."},{"page_url":"https://pt.wikipedia.org/wiki/Robbie_Keane","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/FIFA_WC-qualification_2014_-_Austria_vs_Ireland_2013-09-10_-_Robbie_Keane_01.jpg","page_title":"Robbie Keane","context_page_description":"Robert David Keane, mais conhecido como Robbie Keane, é um ex-futebolista irlandês. Atualmente é auxiliar na Seleção Irlandesa de Futebol."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%80%D0%BE%D0%B4%D1%83_%D0%BB%D1%8E%D0%B1%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Piperia_elongata_-_Flickr_003.jpg","page_title":"Список видів роду любка","context_page_description":"Список видів роду Любка:\\nСписок, який містить 152 визнаних види роду Любка, складений на основі даних сайту «The Plant List».\\nУкраїнські назви видів, які містять посилання на авторитетні джерела, є прийнятими українськими назвами."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D8%B1%DB%8C_%D9%84%D8%A7%D9%BE%D8%AA%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ari_Laptev.jpg","page_title":"آری لاپتف","context_page_description":"آری لاپتف دانشمند در زمینه ریاضیات اهل سوئد است."},{"page_url":"https://ca.wikipedia.org/wiki/Bas%C3%ADlica_de_Santa_Cec%C3%ADlia_in_Trastevere","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Santa_Cecilia_in_Trastevere_dettaglio_scultoreo.jpg","page_title":"Basílica de Santa Cecília in Trastevere","context_page_description":"Santa Cecilia in Trastevere és una lloc de culte catòlic del segle v situat al rioni del Trastevere, al centre històric de Roma, dedicat a Santa Cecília. Té la dignitat de basílica menor."},{"page_url":"https://pl.wikipedia.org/wiki/Ischnura_rubilio","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Ischnura_rubilio-Kadavoor-2016-07-09-001.jpg","page_title":"Ischnura rubilio","context_page_description":"Ischnura rubilio – gatunek ważki z rodzaju Ischnura należącego do rodziny łątkowatych."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%8A%D9%85%D9%86_%D8%B9%D9%88%D8%AF%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/%D7%90%D7%99%D7%99%D7%9E%D7%9F_%D7%A2%D7%95%D7%93%D7%94.jpg","page_title":"أيمن عودة","context_page_description":"أيمن عادل عودة محام وسياسي من عرب 48 يشغل حاليا منصب نائب في الكنيست الإسرائيلي عن الجبهة-العربية للتغيير. كان في الماضي عضوًا في مجلس بلدية حيفا منذ عام 1998 وحتى 2003 خلال الفترة التي كان فيها عمرام متسناع رئيسًا للبلدية كما وأشغَلَ منصِبَ الأمين العام \\"للجبهة الديمقراطية للسلام والمساواة\\" بين عام 2006 وحتى 2015, ورئيساً ل القائمة المشتركة بين عام 2015 وحتى 2019."},{"page_url":"https://en.wikipedia.org/wiki/Chase_Jeter","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/20150329_MCDAAG_closed_practice_Chase_Jeter_%281%29.JPG","page_title":"Chase Jeter","context_page_description":"Chase Michael Jeter is an American basketball player. He played college basketball for the Duke Blue Devils and the Arizona Wildcats."},{"page_url":"https://de.wikipedia.org/wiki/Drehscheibe_Longwood","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Former_trolleybus_turntable%2C_Longwood%2C_near_Huddersfield_-_geograph.org.uk_-_645432.jpg","page_title":"Drehscheibe Longwood","context_page_description":"Die Drehscheibe Longwood ist eine ehemalige Oberleitungsbus-Drehscheibe in Longwood bei Huddersfield, Großbritannien. Sie wurde am 1. September 1939 eröffnet und musste bereits 1940 kriegsbedingt wieder eingestellt werden. In der zweiten Hälfte der 1980er Jahre wurde sie abgebaut. Darüber hinaus existieren beziehungsweise existierten weltweit noch vier weitere Anlagen dieser Art."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D8%A8%D9%8A%D9%86_%D9%81%D9%88%D9%86%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Sabine_Funke_Gebeugtes_Feld-2019-120_x_120_cm.jpg","page_title":"سابين فونك","context_page_description":"سابين فونك ‏ هي رسامة ألمانية، ولدت في 1955 في بوخوم في ألمانيا."},{"page_url":"https://it.wikipedia.org/wiki/Castello_di_Koznik","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Koznik2.jpg","page_title":"Castello di Koznik","context_page_description":"Il castello di Koznik è un castello medievale nella Serbia centrale, 10 km a nordovest dalla attuale città di Brus, sul fianco della collina Kopaonik e sulla riva destra del tratto superiore del fiume Rasina. Il castello fu costruito ad un’altitudine di 920 metri, sulla cima di una ripida collina che dominava il terreno circostante."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Mayhem_band_members","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Attila_Csihar.jpg","page_title":"List of Mayhem band members","context_page_description":"Mayhem is a Norwegian black metal band from Oslo. Formed in 1984, the group originally included guitarist Øystein \\"Euronymous\\" Aarseth, bassist Jørn \\"Necrobutcher\\" Stubberud and drummer Kjetil Manheim. In 1985 the group added Eirik \\"Messiah\\" Norheim as its first vocalist, before he was replaced by Sven Erik \\"Maniac\\" Kristiansen the next year. After releasing their first EP Deathcrush in 1987, both Maniac and Manheim left Mayhem. The departed members were briefly replaced by Kittil Kittilsen and Torben Grue, before Per \\"Dead\\" Ohlin and Jan Axel \\"Hellhammer\\" Blomberg took over in late 1988. This lineup of the group recorded several live albums – Live in Leipzig, Dawn of the Black Hearts, Live in Leitz and Live in Jessheim – as well as their second full demo Out from the Dark, which was released in 1996.\\nOn 8 April 1991, Dead committed suicide at a house shared with Euronymous and Hellhammer. Due to the singer's death, and the guitarist's subsequent actions, Necrobutcher left Mayhem. Stian \\"Occultus\\" Johansen briefly joined after Dead's suicide on vocals and bass."},{"page_url":"https://pt.wikipedia.org/wiki/Abdominea","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Abdominea_minimiflora.jpg","page_title":"Abdominea","context_page_description":"Abdominea é um género botânico pertencente à família das orquídeas."},{"page_url":"https://it.wikipedia.org/wiki/Diocesi_di_Casale_Monferrato","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Mappa_diocesi_Casale_Monferrato.png","page_title":"Diocesi di Casale Monferrato","context_page_description":"La diocesi di Casale Monferrato è una sede della Chiesa cattolica in Italia suffraganea dell'arcidiocesi di Vercelli appartenente alla regione ecclesiastica Piemonte. Nel 2016 contava 98.700 battezzati su 103.300 abitanti. È retta dal vescovo Gianni Sacchi."},{"page_url":"https://cs.wikipedia.org/wiki/Varnsdorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Velveta_Varnsdorf.JPG","page_title":"Varnsdorf","context_page_description":"Varnsdorf je město v nejsevernější části Česka, ve východní části Ústeckého kraje, v okrese Děčín, na jihovýchodě Šluknovského výběžku. Protéká jím říčka Mandava a je ze tří stran obklopen územím Německa. Leží 32 kilometrů východně od Děčína a 34 kilometrů severozápadně od Liberce.\\nObec s rozšířenou působností Varnsdorf je počtem obyvatel druhým největším městem okresu Děčín, žije zde přibližně 15 tisíc obyvatel, výměra katastru města je 26,21 km². Skládá se z částí Varnsdorf, Studánka a Světliny 1. díl. Ve Varnsdorfu jsou hraniční přechody do Německa: silniční Varnsdorf-Seifhennersdorf a Varnsdorf-Großschönau, dále přes město vede peážní železniční trať Liberec–Rybniště/Seifhennersdorf.\\nDějiny města začínají ve 2. polovině 14. století založením zemědělských dvorů. V roce 1830 se zde konalo první úplné liturgické provedení Beethovenovy slavnostní mše Missa solemnis. Varnsdorf byl povýšen na město v roce 1868, do té doby byl největší vesnicí Rakouska-Uherska. Ve stejném roce přijel do Varnsdorfu první vlak z Děčína a díky železnici nastal rozvoj průmyslu, především strojírenského a textilního."},{"page_url":"https://sv.wikipedia.org/wiki/Iresine_diffusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Iresine_diffusa_1.jpg","page_title":"Iresine diffusa","context_page_description":"Iresine diffusa är en amarantväxtart som beskrevs av Alexander von Humboldt, Aimé Bonpland och Carl Ludwig von Willdenow. Iresine diffusa ingår i släktet Iresine och familjen amarantväxter."},{"page_url":"https://en.wikipedia.org/wiki/List_of_protected_heritage_sites_in_Wanze","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Potale_rue_Georges_Smal.jpg","page_title":"List of protected heritage sites in Wanze","context_page_description":"This table shows an overview of the protected heritage sites in the Walloon town Wanze. This list is part of Belgium's national heritage."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A3%E0%B8%96%E0%B9%84%E0%B8%9F%E0%B8%8A%E0%B8%B2%E0%B8%99%E0%B9%80%E0%B8%A1%E0%B8%B7%E0%B8%AD%E0%B8%87%E0%B9%83%E0%B8%99%E0%B8%81%E0%B8%A3%E0%B8%B8%E0%B8%87%E0%B9%80%E0%B8%97%E0%B8%9E%E0%B8%A1%E0%B8%AB%E0%B8%B2%E0%B8%99%E0%B8%84%E0%B8%A3%E0%B9%81%E0%B8%A5%E0%B8%B0%E0%B8%9B%E0%B8%A3%E0%B8%B4%E0%B8%A1%E0%B8%93%E0%B8%91%E0%B8%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/SRT_1237_%286120459792%29.jpg","page_title":"รถไฟชานเมืองในกรุงเทพมหานครและปริมณฑล","context_page_description":"รถไฟชานเมืองในกรุงเทพมหานครและปริมณฑล เป็นระบบรถไฟชานเมืองขนาดใหญ่ในประเทศไทย ให้บริการในเขตพื้นที่กรุงเทพมหานครและปริมณฑล, จังหวัดพระนครศรีอยุธยา, จังหวัดสระบุรี, จังหวัดลพบุรี, จังหวัดสุพรรณบุรี, จังหวัดราชบุรี, จังหวัดฉะเชิงเทรา, จังหวัดปราจีนบุรี และจังหวัดสมุทรสงคราม ดำเนินการโดยการรถไฟแห่งประเทศไทย รหัสเลขขบวนรถส่วนใหญ่จะเป็นเลขสามหลัก ขึ้นต้นด้วยเลข 3 และ4 และใช้ทางวิ่งร่วมกับรถไฟทางไกลและรถไฟสินค้า ทางส่วนใหญ่เป็นทางคู่"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kunstwerke_im_%C3%B6ffentlichen_Raum_in_Graz/Geidorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Ehrenring_Denkmal_f%C3%BCr_Oktavia_Aigner-Rollett_Vorklinik_Graz.jpg","page_title":"Liste der Kunstwerke im öffentlichen Raum in Graz/Geidorf","context_page_description":"Diese Liste der Kunstwerke im öffentlichen Raum in Graz/Geidorf enthält die auf „OFFSITE_GRAZ“ gelisteten permanenten Kunstwerke im öffentlichen Raum im Grazer Stadtbezirk Geidorf. OFFSITE_GRAZ wurde im Auftrag der Stadt Graz, in Koordination mit dem Kulturamt, entwickelt und umfasst einen Zeitraum bis 2011."},{"page_url":"https://sv.wikipedia.org/wiki/Sm%C3%A5blommig_nunne%C3%B6rt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Corydalis_aurea_4.jpg","page_title":"Småblommig nunneört","context_page_description":"Småblommig nunneört är en vallmoväxtart som beskrevs av Carl Ludwig von Willdenow. Enligt Catalogue of Life ingår Småblommig nunneört i släktet nunneörter och familjen vallmoväxter, men enligt Dyntaxa är tillhörigheten istället släktet nunneörter och familjen vallmoväxter. Arten har ej påträffats i Sverige. Utöver nominatformen finns också underarten C. a. aurea."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BB%D0%B0%D1%82%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Kostel_Nanebevzet%C3%AD_P._Marie_%28Slatiny%29_01.JPG","page_title":"Слатини","context_page_description":"Слатини је насељено мјесто са административним статусом сеоске општине у округу Јичин, у Краловехрадечком крају, Чешка Република."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%B0%D0%BA_%D0%BA%D0%BE%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B8%D1%85_%D0%BA%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%86%D0%B0_%D0%A1%D0%BE%D0%B2%D1%98%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3_%D0%A1%D0%B0%D0%B2%D0%B5%D0%B7%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/USSR-1991-1ruble-CuNi-Olympics92_Cycling-b.jpg","page_title":"Списак комеморативних кованица Совјетског Савеза","context_page_description":"У Совјетском Савезу су од 1965. до 1991. године објављени комеморативни новчићи. Већина њих је направљена од легуре бакра и никла, али постоје и сребрени новчићи, златни новчићи, од паладијума и платине. Сви новчићи су ковани или у Московској ковници новца или у Санкт Петербуршкој ковници новца."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9F%E3%83%A5%E3%83%BC%E3%83%AB%E3%82%BF%E3%83%BC%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/InnerCastle.jpg","page_title":"ミュールタール","context_page_description":"ミュールタール はドイツ連邦共和国ヘッセン州ダルムシュタット＝ディーブルク郡に属す町村。この地域は、紀元前から入植が行われていた地域で、20世紀の初めまでは多彩な水車小屋 があることで知られていた。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9D%B4%ED%83%88%EB%A6%AC%EC%95%84%EC%9D%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/The_Pantheon.jpg","page_title":"이탈리아인","context_page_description":"이탈리아인은 일반적인 이탈리아 문화와 혈통을 공유하고 이탈리아어를 모국어로 말하는, 이탈리아 출신의 국민과 민족이다. 법적으로, 이탈리아인은 혈통이나 거주 국가의 상관없이 이탈리아 공화국의 시민권자만을 의미하지만, 이탈리아인의 후손과 이탈리아 반도에 인접한 지역에 거주했던 이탈리아계 민족들로 구별한다.\\n2010년 기준으로, 이탈리아에는 5600만 명의 이탈리아인들이 거주하며, 이탈리아어를 자유롭게 말하는 화자들은 인접 국가인 스위스에서 50만 명, 프랑스가 대다수를 차지하며, 슬로베니아와 크로아티아에서 소규모의 화자가 존재하며, 주로 이스트리아와 달마티아 지역이다. 광범위한 디아스포라로 인해, 5백만 명의 이탈리아 시민권자들이 국외에 있고, 약 8000만 명에 가까운 순수 또는 혼혈 이탈리아 혈통들이 이탈리아 밖에서 거주하며, 대표적인 곳이 남아메리카, 북아메리카, 오스트레일리아, 유럽 지역들이다.\\n이탈리아인들은 과학, 예술, 기술, 음식, 스포츠, 은행업의 확산과 세계화에 엄청난 영향과 기여를 하였다."},{"page_url":"https://pl.wikipedia.org/wiki/W_czas_zmartwychwstania","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Michelangelo_Buonarroti_005.jpg","page_title":"W czas zmartwychwstania","context_page_description":"W czas zmartwychwstania – wiersz Bolesława Leśmiana. Utwór pochodzi z tomiku Napój cienisty, wydanego w 1936, i i zalicza się do cyklu Spojrzystość. Utwór opowiada o tym, że podczas sądu ostatecznego znajdą się takie ciała, które nie będą chciały zmartwychwstać. Utwór jest ironiczny, ale i patetyczny. Utwór jest napisany jambicznym czterostopowcem, na przemian ośmiozgłoskowym i dziewięciozgłoskowym, ułożonym w zwrotki czterowersowe, rymowane abab.\\nJest takie próchno, co już dość\\nZaznało zgrozy w swem konaniu!\\nJest taka dumna w ziemi kość,\\nCo się sprzeciwi — zmartwychwstaniu!"},{"page_url":"https://cs.wikipedia.org/wiki/Laguna","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Atafutrim.jpg","page_title":"Laguna","context_page_description":"Laguna je přírodní nádrž stojaté vody na okraji moře.\\nJe to mělký mořský vodní útvar naplněný slanou nebo brakickou vodou, který je oddělen od hlubšího moře korálovým útesem nebo písečným valem. Laguny jsou jak laguny atolů, vytvořené růstem korálových útesů, tak pobřežní laguny vytvořené vznikem písčitých valů."},{"page_url":"https://id.wikipedia.org/wiki/Hindia_Belanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Javaanse_KNIL-militairen.jpg","page_title":"Hindia Belanda","context_page_description":"Hindia Belanda atau Hindia Timur Belanda adalah sebuah daerah pendudukan Belanda yang wilayahnya saat ini dikenal dengan nama Republik Indonesia. Hindia Belanda dibentuk sebagai hasil dari nasionalisasi koloni-koloni Vereenigde Oostindische Compagnie, yang berada di bawah pemerintahan Belanda pada tahun 1800.\\nSelama abad ke-19, daerah jajahan dan hegemoni Belanda diperluas, mencapai batas wilayah teritorial terbesar mereka pada awal abad ke-20. Hindia Belanda adalah salah satu koloni Eropa yang paling berharga di bawah kekuasaan Imperium Belanda, dan berkontribusi pada keunggulan global Belanda dalam perdagangan rempah-rempah dan hasil bumi pada abad ke-19 sampai awal abad ke-20. Tatanan sosial kolonial didasarkan pada struktur rasial dan sosial yang kaku dengan para elit Belanda yang tinggal terpisah tetapi tetap berhubungan dengan penduduk pribumi yang dijajah mereka. Istilah \\"Indonesia\\" mulai digunakan untuk lokasi geografis setelah tahun 1880. Pada awal abad 20, para intelektual lokal mulai mengembangkan konsep Indonesia sebagai negara dan bangsa, dan menetapkan panggung untuk gerakan kemerdekaan."},{"page_url":"https://simple.wikipedia.org/wiki/Mountain_big-eyed_tree_frog","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Nyctimystes_montanus_holotype.jpg","page_title":"Mountain big-eyed tree frog","context_page_description":"The mountain big-eyed tree frog is a tree frog from New Guinea. Scientists have only seen it in the Arfak Mountains in Indonesia.\\nThe adult male frog is about 5.2 cm long and the female about 6.3 cm long. The dead, preserved frog is gray or brown with darker markings."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_ngh%E1%BB%87_s%C4%A9_%C3%A2m_nh%E1%BA%A1c_b%C3%A1n_%C4%91%C4%A9a_nh%E1%BA%A1c_ch%E1%BA%A1y_nh%E1%BA%A5t","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Aerosmith_4.jpg","page_title":"Danh sách nghệ sĩ âm nhạc bán đĩa nhạc chạy nhất","context_page_description":"Đây là danh sách các nghệ sĩ âm nhạc bán đĩa nhạc chạy nhất."},{"page_url":"https://en.wikipedia.org/wiki/Whistling_duck","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Dendrocygna_viduata_upright.jpg","page_title":"Whistling duck","context_page_description":"The whistling ducks or tree ducks are a subfamily, Dendrocygninae, of the duck, goose and swan family of birds, Anatidae. They are not true ducks. In other taxonomic schemes, they are considered a separate family, Dendrocygnidae. Some taxonomists list only one genus, Dendrocygna, which contains eight living species, and one undescribed extinct species from Aitutaki of the Cook Islands, but other taxonomists also list the white-backed duck under the subfamily."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AE%E0%A4%B8%E0%A5%8D%E0%A4%9C%E0%A4%BF%E0%A4%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Kabaa_%28January_2003%29.jpg","page_title":"मस्जिद","context_page_description":"मस्जिद मुसलमानों का उपासना या प्रार्थना स्थल है। इसे नमाज़ के लिए प्रयोग किया जाता है मुसलमानों के प्रारंभिक काल में मस्जिदे नबवी को विदेश से आने वाले ओफ़ोद से मुलाकात और चर्चा के लिए भी इस्तेमाल किया गया था। मस्जिद से मुसलमानों की पहली विश्वविद्यालयों ने भी जन्म लिया है। इसके अलावा इस्लामी वास्तुकला भी मुख्य रूप से मस्जिदों से विकास हुई है।"},{"page_url":"https://pl.wikipedia.org/wiki/Europejska_Organizacja_Rozwoju_Rakiet_No%C5%9Bnych","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Coralie_rocket_stage_top_view.jpg","page_title":"Europejska Organizacja Rozwoju Rakiet Nośnych","context_page_description":"Europejska Organizacja Rozwoju Rakiet Nośnych – międzynarodowa organizacja zawiązana w 1962, a formalnie utworzona w 1964, w celu opracowania i budowy rakiety nośnej Europa. W 1975 połączona z ESRO w Europejską Agencję Kosmiczną.\\nPropozycja utworzenia ELDO została wysunięta przez Wielką Brytanię, która w kwietniu 1960 anulowała niemal ukończony program budowy rakiety Blue Streak. Wielka Brytania zaproponowała krajom ówczesnej Unii Europejskiej budowę wspólnej trójstopniowej rakiety nośnej zdolnej do wyniesienia na niską orbitę okołoziemską ładunek 1 000 kg.\\nDo programu przystąpiły:\\nAustralia - członek stowarzyszony, który udostępnił poligon rakietowy Woomera\\nBelgia\\nFrancja\\nHolandia\\nNiemcy\\nWielka Brytania\\nWłochy\\nBrytyjski Blue Streak miał stanowić 1. człon rakiety Europa I. Francuska rakieta Coralie, 2. człon. Niemcy miały zbudować człon trzeci o nazwie Astris. Włochy miały zaprojektować satelitę, a Holandia z Belgią skoncentrować się na systemie śledzenia i telemetrii.\\nPierwsze 10 startów odbyło się z poligonu rakietowego Woomera, w Australii. Program startów podzielono na trzy fazy:\\nFaza 1 - starty F1 do F3 - starty pierwszego członu Blue Streak w kierunku północno-zachodnim."},{"page_url":"https://ca.wikipedia.org/wiki/Molibdofornacita","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Molybdofornacite-283006.jpg","page_title":"Molibdofornacita","context_page_description":"La molibdofornacita és un mineral de la classe dels sulfats."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%94%90%E9%92%9B%E7%9F%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Anatase_Oisans.jpg","page_title":"锐钛矿","context_page_description":"銳鈦礦是二氧化鈦的五種礦物形式之一， 它的名稱來源於希臘語ανάτασις。"},{"page_url":"https://fr.wikipedia.org/wiki/Cylindrocline_lorencei","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Cylindrocline_lorencei_CNB_Brest_11.jpg","page_title":"Cylindrocline lorencei","context_page_description":"Cylindrocline lorencei est une espèce d'arbre endémique de l'île Maurice appartenant à la famille des Astéracées qui a été décrite en 1987 par A.J. Scott. Un seul spécimen a été observé dans la nature en 1973. En 1990, l'espèce a été considérée comme éteinte à l'état sauvage, la semence disponible ne réussissant pas à germer. Le Conservatoire botanique national de Brest s'est lancé avec succès dans la culture in vitro d'une partie viable de l'embryon de la graine et a pu sauver cette plante de l'extinction. Grâce à la multiplication végétative au Conservatoire botanique national de Brest et aux Jardins botaniques royaux de Kew, une petite population de Cylindrocline lorencei est cultivée et des efforts sont en cours pour les rétablir dans leur habitat naturel."},{"page_url":"https://es.wikipedia.org/wiki/Torre_Nueva_de_Guadiaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Torre_Nueva_de_Guadiaro.jpg","page_title":"Torre Nueva de Guadiaro","context_page_description":"La Torre Nueva de Guadiaro es una atalaya situada en la localidad andaluza de San Roque junto a la desembocadura del río Guadiaro construida para la vigilancia del tramo de costa adyacente ante la presencia de piratas berberiscos. Comparte características con otras torres artilladas de la región edificadas en las mismas fechas y como éstas entró a formar parte del sistema de fortificaciones del Campo de Gibraltar con posterioridad a la pérdida de Gibraltar.​\\nLa torre fue construida con posterioridad a 1516 cuando mediante Real Cédula se pone de manifiesto la necesidad de vigilancia de esas costas debido a que la única torre situada en las cercanías, la actualmente conocida como Torre Quebrada de Guadiaro, había sido destruida por un rayo. Tiene planta circular con 14 metros de diámetro y alzado troncocónico de 16 metros de los cuales 4 se corresponden con la escarpa. Sus muros están compuestos por sillarejos en hiladas horizontales unidos con mortero que delimitan dos estancias con bóveda y comunicadas entre sí mediante una escalera adosada a los muros. En el interior de las estancias se situaba una chimenea destinada al cuerpo de guardia presente en la construcción."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AE%E3%83%86%E3%82%A3%E3%83%AA%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Espa%C3%B1aLoc.svg","page_title":"ギティリス","context_page_description":"ギティリスは、スペイン・ガリシア州ルーゴ県のムニシピオ。コマルカ・ダ・テーラ・チャに属す。ガリシア統計局によれば、2009年の人口は5,896人。住民呼称は、男女同形のguitiricense。\\nガリシア語話者の自治体住民に占める割合は98.45％。"},{"page_url":"https://en.wikipedia.org/wiki/Girton_College,_Cambridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Cambridge_-_Girton_College_Main_Gate_-_June_2018.jpg","page_title":"Girton College, Cambridge","context_page_description":"Girton College is one of the 31 constituent colleges of the University of Cambridge. The college was established in 1869 by Emily Davies and Barbara Bodichon as the first women's college in Cambridge. In 1948, it was granted full college status by the university, marking the official admittance of women to the university. In 1976, it was the first Cambridge women's college to become coeducational.\\nThe main College site, situated on the outskirts of the village of Girton, about 2.5 miles northwest of the university town, comprises 33 acres of land. In a typical Victorian red brick design, most was built by architect Alfred Waterhouse between 1872 and 1887. It provides extensive sports facilities, an indoor swimming pool, an award-winning library and a chapel with two organs. There is an accommodation annexe, known as Swirles Court, situated in the Eddington neighborhood of the North West Cambridge development. Swirles opened in 2017 and provides up to 325 en-suite single rooms for graduates, and for second-year undergraduates and above.\\nThe college has a reputation for admitting a high number of UK state-school students, its community feel and for musical talent."},{"page_url":"https://ca.wikipedia.org/wiki/Limfopoesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/New_Mixed_Myeloid-Lymphoid_Progenitor_Tree%28RCCH%29_Grayscale.jpg","page_title":"Limfopoesi","context_page_description":"La limfopoesi, en anglès: Lymphopoiesis o lymphocytopoiesis, és la generació de limfòcits els quals són un dels cinc tipus de cèl·lules blanques sanguínies. De manera més formal es coneix com a hematopoesi limfoide.\\nLa patologia en la limfopoesi condueix a diversos trastorns limfoprolferatius com el limfoma i la leucèmia limfoide.\\nLa mielopoesi es refereix a la 'generació de cèl·lules del llinatge mieloide' i l'eritropoesi es refereix a la 'generació de cèl·lules del llinatge eritroide', etc., per tant, l'ús paral·lel ha evolucionat a dir que la limfopoesi es refereixi a la 'generació de cèl·lules del llinatge limfoide'.\\nLa limfopoesi és absolutament necessària per a la vida. Els limfòcits madurs són una part crítica del sistema immunològic que tenen una vida curta mesurada en dies o setmanes i s'han de generar de manera contínua per divisió cel·lular i diferenciació a partir de cèl·lules com les cèl·lules progenitores en ratolí. Quan falla aquest sistema, el cos queda en gran part indefens davant les infeccions."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BD%D0%B6%D1%83%D0%BB-%D0%AE%D0%BD%D0%B4%D1%83%D0%BC_(%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Banjul-aeroport.jpg","page_title":"Банжул-Юндум (аэропорт)","context_page_description":"Аэропорт Юндум — международный аэропорт столицы Гамбии. Аэропорт расположен примерно в 24 километрах к югу от столицы Банжул в районе западного побережья вблизи города Комбо. Аэропорт занимает площадь в 1327 га. Длина его взлётно-посадочной полосы, отвечающей самым высоким требованиям, — 3600 метров, так что Юндум способен принимать самолёты любого веса.\\nЗдание аэропорта построено по проекту известного сенегальского архитектора Пьера Гоудиаби Атепа.\\nАэропорт был построен в 1977 году.\\nВ 1987 году, как кандидат для создания запасного аэродрома для многоразовых кораблей типа шаттл, был отобран НАСА, и в сентябре 1987 американцы достигли договоренности с гамбийской стороной об использовании в этих целях аэродрома Юндум. ВПП была усовершенствована.\\nВ 1996 году было введено в эксплуатацию здание аэропорта, построенное по совместному англо-гамбийскому проекту.\\nАэропорт обслуживает следующие авиалинии: Air Europa, Arik Air, Air Nigeria, Brussels Airlines, Fly 6ix, Monarch Airlines, Royal Air Maroc, Royal Flight, Senegal Airlines.\\nВ 2004 году аэропорт обслужил 967'719 пассажиров."},{"page_url":"https://en.wikipedia.org/wiki/Phaonia_rufiventris","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Phaonia_rufiventris%2C_Trevor_Quarry%2C_North_Wales%2C_June_2010_%2816595237517%29.jpg","page_title":"Phaonia rufiventris","context_page_description":"Phaonia rufiventris is a fly from the family Muscidae. It is found in the Palearctic."},{"page_url":"https://cs.wikipedia.org/wiki/Zelen%C3%A9_jez%C3%ADrko","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Zelene_jezirko.jpg","page_title":"Zelené jezírko","context_page_description":"Zelené jezírko je jezírko v okrese Plzeň-sever u silnice do Manětína nad osadou Berk."},{"page_url":"https://en.wikipedia.org/wiki/Chitra_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Chitra_River.JPG","page_title":"Chitra River","context_page_description":"The Chitra River is located in southwestern Bangladesh. It is one of the large coastal rivers of the Ganges-Padma system. It joins with the Nabaganga, and then flows into the Bhairab River."},{"page_url":"https://tr.wikipedia.org/wiki/DJI_(%C5%9Firket)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/DJI_Phantom_3_Professional_photographed_at_Lake_Albert_%282%29.jpg","page_title":"DJI (şirket)","context_page_description":"Dà-Jiāng Innovations Science and Technology Co. Ltd., Çin merkezli bir teknoloji şirketidir. Şirket, 2006 yılında Frank Wong tarafından kurulmuş olup sivil insansız hava araçları ile kamera yalpa çemberi, uçuş platformları, kameralar, tahrik sistemleri, kamera sabitleyicileri ve uçuş kontrol sistemleri üretmektedir. Şirketin merkezi Shenzhen'de yer almaktadır.\\nDJI, İHA pazarının %70'inden fazlasını oluşturmakta olup ticari ve sivil İHA endüstrisinde dünya lideridir."},{"page_url":"https://pt.wikipedia.org/wiki/Claude_Louis_Hector_de_Villars","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/0_%27Le_mar%C3%A9chal_de_Villlars%27_-_Rigaud_-_Vaux-le-Vicomte.JPG","page_title":"Claude Louis Hector de Villars","context_page_description":"Claude Louis Hector, Duque de Villars foi o principal comandante militar francês no final do reinado de Luís XIV. Com uma carreira militar irregular, criticado por ser demasiadamente cauteloso, teve uma ascensão profissional lenta. Após a Guerra da Grande Aliança foi apontado embaixador em Viena. Foi apenas durante a Guerra de Sucessão Espanhola que conseguiu se destacar dos demais comandantes. Cruzando o rio Reno, obteve vitórias nas batalhas de Friedlingen e Höchstadt, apesar de sua antipatia por seus aliados bávaros. Retirado do front, foi enviado para suprimir uma revolta huguenote no interior do país, enquanto, muito longe dali, as forças francesas eram destroçadas na batalha de Blenheim. Chamado de volta à guerra, teve um desempenho que não agradou o rei. Contudo, em 1709, foi considerado a única opção na desesperada tentativa de deter as forças inimigas comandadas por John Churchill, 1.° Duque de Marlborough e pelo príncipe Eugênio de Savoia. A formidável linha de fortificações levantada por Vauban nas décadas anteriores vinha sendo perdida pouco a pouco, no curso do longo conflito.\\nA França, derrotada nos campos da Alemanha, estava na defensiva."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Freistadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Schmiede_und_Scheiblingturm.jpg","page_title":"Liste der denkmalgeschützten Objekte in Freistadt","context_page_description":"Die Liste der denkmalgeschützten Objekte in Freistadt enthält die 164 denkmalgeschützten, unbeweglichen Objekte der oberösterreichischen Gemeinde Freistadt."},{"page_url":"https://sk.wikipedia.org/wiki/TERRIERS","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/TERRIERS_1.jpg","page_title":"TERRIERS","context_page_description":"Tomographic Experiment using Radiative Recombinative Ionospheric EUV and Radio Sources, skrátene TERRIERS bola americká študentská družica prevádzkovaná Bostonskou univerzitou. Hlavným cieľom misie bolo demonštrovať možnosti sledovania termosféry a ionosféry pomocou tomografie a emisií fotónov v oblasti extrémneho ultrafialového žiarenia. Družica bola vynesená 18. mája 1999 raketou Pegasus XL. Po dosiahnutí obežnej dráhy však zlyhal systém orientácie a družica nebola schopná nasmerovať svoj jediný slnečný panel na Slnko. Po niekoľkých neúspešných pokusoch o zorientovanie boli palubné batérie vybité a spojenie bolo prerušené."},{"page_url":"https://tr.wikipedia.org/wiki/Waddy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Arrernte_Keulen_EthnM.jpg","page_title":"Waddy","context_page_description":"Waddy ya da nulla nulla Avustralya Aborjinleri tarafından silah olarak kullanılan sopalara verilen addır. İsim Sidney Port Jackson'da bulunan Dharuk Aborijinleri tarafından kullanılan isimden gelir.\\nWaddy, oyulmuş tahtadan yapılmış ağır bir sopadır. Yakın döğüşte kullanılan bu silah bir kalkanı parçalayabilmekte, karşısındakini bayıltmakta ve hatta öldürebilmektedir. Uzaktan atılarak kullanılabilmesinin yanı sıra ateş yakmakta ve toprak boyası yapmakta da kullanılabilirler. Ayrıca Aborijin yasalarını çiğneyenleri cezalandırmakta da kullanılır.\\nHem erkek hem de kadınlar tarafından yapılan bu silah boyandığı gibi boyasız olarak da bırakılabilmektedir. Yapımları kabileden kabileye değişiklik gösterse de genel olarak bir metre uzunluğundadır ve bazen balmumu ve ip yardımı ile uçlarına taş da eklenebilmektedir. Ağacın dalının gövdeye bağlandığı kısımdan ya da köküyle birlikte sökülen genç ağaççıkklardan yapılır."},{"page_url":"https://es.wikipedia.org/wiki/Monarquismo_en_Per%C3%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Leopold_I_of_Belgium_%282%29.jpg","page_title":"Monarquismo en Perú","context_page_description":"El monarquismo en Perú se encuadra dentro de una serie de proyectos monárquicos durante las postrimerías del Virreinato del Perú debido al movimiento independentista peruano, el cual contaba con dos corrientes; una que buscaba establecer un sistema de gobierno republicano independiente, y otra corriente la cual buscaba consolidar una monarquía peruana como sistema de gobierno, independiente de la monarquía española; proyecto llevado a cabo en 1821 principalmente por José de San Martín durante su gobierno provisional; proyecto que no llego a ser concretado a causa de la disolución del Protectorado de San Martín, y la instauración del congreso constituyente que proclamó la República Peruana en 1822, y la oposición de Simón Bolívar en la reunión que mantuvo con San Martín en Guayaquil.\\nEste proyecto de sistema de gobierno fue propuesto por José de San Martín al Virrey del Perú en las conferencias de Punchauca, el 4 de mayo de 1821 y el 2 de junio de 1821."},{"page_url":"https://en.wikipedia.org/wiki/Baden-W%C3%BCrttemberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Der_Friedrichsplatz_und_der_Wasserturm.jpg","page_title":"Baden-Württemberg","context_page_description":"Baden-Württemberg is a state in southwest Germany, east of the Rhine, which forms the border with France. It is Germany's both third-largest, with an area of 35,751 km² and third-most populous state with more than 11 million inhabitants. Baden-Württemberg is a parliamentary republic and partly sovereign, federated state which was formed in 1952 by a merger of the states of Württemberg-Baden, South Baden and Württemberg-Hohenzollern. The largest city in Baden-Württemberg is the state capital of Stuttgart, followed by Karlsruhe and Mannheim. Other cities are Freiburg im Breisgau, Heidelberg, Heilbronn, Pforzheim, Reutlingen, Tübingen and Ulm.\\nThe sobriquet Ländle is sometimes used as a synonym for Baden-Württemberg."},{"page_url":"https://de.wikipedia.org/wiki/Kalkstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Kalkstein_mit_Crinoiden.jpg","page_title":"Kalkstein","context_page_description":"Als Kalkstein werden Sedimentgesteine bezeichnet, die überwiegend aus dem chemischen Stoff Calciumcarbonat in Form der Mineralien Calcit und Aragonit bestehen.\\nKalkstein ist ein äußerst variables Gestein; dies betrifft sowohl seine Entstehung als auch seine Eigenschaften, das Aussehen und die wirtschaftliche Verwendbarkeit. Es gibt daher innerhalb der Geologie eine eigene Fachrichtung, die Karbonatsedimentologie, die sich ausschließlich mit der Entstehung und den Eigenschaften der verschiedenen Kalksteintypen befasst. Die meisten Kalksteine sind biogener Herkunft, es gibt aber auch chemisch ausgefällte und klastische Kalksteine.\\nKalksteine besitzen eine enorme wirtschaftliche Bedeutung als Rohstoff für die Bauindustrie und als Naturwerkstein. Des Weiteren sind solche Lagerstätten Speichergestein für Erdöl und Erdgas.\\nNicht zu den Kalksteinen im engeren Sinn werden Umwandlungsgesteine wie Marmor und magmatisches Gestein wie etwa Calcitkarbonatit gezählt, obwohl diese ebenfalls zum überwiegenden Teil aus Calcit oder anderen Calciumcarbonaten bestehen."},{"page_url":"https://es.wikipedia.org/wiki/Francisco_Jos%C3%A9_P%C3%A9rez_y_Fern%C3%A1ndez-Golf%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Francisco_Jos%C3%A9_P%C3%A9rez_y_Fern%C3%A1ndez-Golf%C3%ADn_%28cropped%29.jpg","page_title":"Francisco José Pérez y Fernández-Golfín","context_page_description":"Francisco José Pérez y Fernández Golfín fue un eclesiástico español, obispo auxiliar de Madrid-Alcalá y primer obispo de Getafe.​"},{"page_url":"https://la.wikipedia.org/wiki/Flaugeac","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/Flaugeac_%C3%A9glise_%282%29.JPG","page_title":"Flaugeac","context_page_description":"Flaugeac est commune Francicum 328 incolarum praefecturae Duranii in regione Aquitania."},{"page_url":"https://oc.wikipedia.org/wiki/Giralda","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/La_Giralda_August_2012_Seville_Spain.jpg","page_title":"Giralda","context_page_description":"La Giralda es una torre que fa partida de la catedrala de Sevilha, una de las mai grandas del mond e una vertadièra jòia del gotica e barròca.\\nLos dos tèrces inferiors de la torre correspondon a l’alminar de l'anciana mosquèia de la vila, de la fin del sègle XII, a l'epòca almohada, alara que lo tèrç superior es un bastiment superpausat de l’epòca crestiana per albergar las campanas. En lo sieu cúspide se tròba una bòla cridada tinaja sobratz era quau s'auça lo Giraldillo.\\nLa Giralda mesura 97,5 mètres de nautor e 101 inclús lo Giraldillo, que mesura 3,5 mètres. Foguèt pendent de sègles la tor mai nauta d'Espanha, aital coma una dels bastiments mai anautits e famosas de tota Euròpa. Lo 29 de decembre de 1928 foguèt declarat Patrimòni Nacional e en 1987 integrèt la lista del Patrimòni de l'Umanitat. La siá arquitectura unica e originala de formas quadrangularas exactas, adornada de torrecillas e pináculos, a servit d'inspiracion a multitud de tors posterioras en Estats Units, Russia, Polonha e d'autres païses del mond."},{"page_url":"https://cs.wikipedia.org/wiki/Mod%C5%99ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Mod%C5%99ice_-_ul_Masarykova%2C_bytov%C3%A9_domy.jpg","page_title":"Modřice","context_page_description":"Modřice jsou město v okrese Brno-venkov v Jihomoravském kraji, bezprostředně sousedící se statutárním městem Brnem. Rozkládají se na okraji Dyjsko-svrateckého úvalu, jejich katastr má rozlohu 10,05 km². Žije zde přibližně 5 300 obyvatel.\\nJedná se o vinařskou obec ve Velkopavlovické vinařské podoblasti."},{"page_url":"https://fr.wikipedia.org/wiki/Palais_du_grand-duc_Nicolas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Palace_of_Grand_Prince_Nikolai_Konstantinovich_12-00.JPG","page_title":"Palais du grand-duc Nicolas","context_page_description":"Le palais du grand-duc Nicolas Constantinovitch est un palais construit en 1891 pour le grand-duc exilé à Tachkent, capitale du kraï du Turkestan, sous le nom de prince Romanovsky-Iskander. Les plans sont de Wilhelm Heinzelmann et d'Alexeï Benois."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%86%DA%91%DA%BE%D8%AF%D8%A7_%D8%B5%D9%86%D9%88%D8%A8%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/2013-08-20_11_52_49_Eastern_Red_Cedar_at_about_720_feet_on_the_Mount_Tammany_Trail.jpg","page_title":"چڑھدا صنوبر","context_page_description":"چڑھدا صنوبر سرو ٹبر دا اک صنوبر اے۔ ایہ میکسیکو وچ ہوندا اے۔"},{"page_url":"https://uz.wikipedia.org/wiki/Shueyville_(Iowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Shueyville_iowa.jpg","page_title":"Shueyville (Iowa)","context_page_description":"Shueyville AQShning Iowa shtatida joylashgan shahardir. Johnson okrugi tarkibiga kiradi."},{"page_url":"https://nl.wikipedia.org/wiki/Mijter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Bisch%C3%B6flicheG%C3%A4ste.jpg","page_title":"Mijter","context_page_description":"Een mijter of mitra is het traditionele, ceremoniële hoofddeksel van bisschoppen en abten in onder meer de Rooms-Katholieke Kerk, de Anglicaanse Kerk en de oosters-orthodoxe kerken.\\nDe mijter maakt deel uit van de pontificalia. De moderne vorm bestaat uit twee stijve, gelijke delen met een vijfhoekige vorm, uitlopend in een punt, samengenaaid aan de zijden en met twee flappen textiel aan weerszijden. Bij de Oostelijke mijter ontbreken deze flappen zodat de mijter de vorm van een kroon heeft. De oostelijke mijter vormt één geheel. De mijter of \\"infula\\" is vaak voorzien van een kruis of \\"omgekeerde T-vorm\\". Aan de achterzijde hangen twee witte of gouden, roodomrande linten die infulae heten.\\nOosters-orthodoxe priesters en priesters van andere christelijke kerken in Oost-Europa en Azië dragen vaak \\"kronen\\" die in werkelijkheid zwaargeborduurde en daardoor stijve stoffen mijters zijn."},{"page_url":"https://de.wikipedia.org/wiki/Saishin_Shina_y%C5%8Djin_den","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Xia_Qifeng.jpg","page_title":"Saishin Shina yōjin den","context_page_description":"Das Buch Saishin Shina yōjin den wurde in Japan vom Verlag Asahi Shimbun-sha am 2. Februar 1941 veröffentlicht und umfasst die Zeit in China einschließlich der chinesischen nationalistischen Partei, der Kommunistischen Partei Chinas, das Wang Jingwei-Regime, Mengjiang etc.; Bücher der Führer und Aktivisten der Demokratiebewegung und Prominente. Das Buch wurde mittels Ostasien-Fragebögen zusammengestellt. Das Buch enthielt 343 Fotos von Personen, die weiter unten aufgeführt sind.\\nDas Buch ist eines der am häufigsten verwendeten Werkzeuge zum Studium der modernen Geschichte Chinas.\\n„Die Schreibweise 支那 war dabei eine vom westlichen Begriff China abgeleitete, abwertende Bezeichnung für das Land.“"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%82%D0%BE-%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%BA%D0%B8%D0%B9_%D0%BC%D0%BE%D0%BD%D0%B0%D1%81%D1%82%D1%8B%D1%80%D1%8C_(%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B0%D0%BD%D0%B2%D0%B8%D0%BB%D0%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Holy_Trinity_Monastery%2C_Jordanville%2C_New_York_%285365711237%29.jpg","page_title":"Свято-Троицкий монастырь (Джорданвилл)","context_page_description":"Свя́то-Тро́ицкий монасты́рь — ставропигиальный мужской монастырь Русской православной церкви заграницей, расположенный в Джорданвилле, штат Нью-Йорк. Крупнейший и старейший монастырь РПЦЗ в США.\\nПри монастыре действует Свято-Троицкая духовная семинария, издательство, иконописная мастерская, библиотека и Музей русской истории."},{"page_url":"https://en.wikipedia.org/wiki/Lace_Market_tram_stop","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Lace_Market_tram_stop_by_chrisw_at_2015-08-01_16.40.33.jpg","page_title":"Lace Market tram stop","context_page_description":"Lace Market is a tram stop of the Nottingham Express Transit in the centre of the city of Nottingham. It is situated on Fletcher Gate in Nottingham's historic Lace Market quarter, from which it derives its name, and near to the Hockley quarter.\\nThe tram stop has twin side platforms flanking the twin tram tracks. The tramway shares road space with other traffic in both directions. To the north of the stop, the track executes a 90 degree curve descend Victoria Street towards the Old Market Square tram stop. To the south, the track passes Weekday Cross before switching onto the former viaduct of the Great Central Railway in order to reach the Nottingham Station tram stop.\\nThe tram stop opened on 9 March 2004, along with the rest of NET's initial system.\\nWith the opening of NET's phase two, Lace Market is now on the common section of the NET, where line 1, between Hucknall and Chilwell, and line 2, between Phoenix Park and Clifton, operate together. Trams on each line run at frequencies that vary between 4 and 8 trams per hour, depending on the day and time of day, combining to provide up to 16 trams per hour on the common section."},{"page_url":"https://it.wikipedia.org/wiki/Yusaku_Kamekura","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/1964-logo.jpg","page_title":"Yusaku Kamekura","context_page_description":"Yūsaku Kamekura è stato un designer e illustratore giapponese."},{"page_url":"https://hu.wikipedia.org/wiki/Olcs","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/RO_HD_Ociu_27.jpg","page_title":"Olcs","context_page_description":"Olcs románul: Ociu, falu Romániában, Erdélyben, Hunyad megyében."},{"page_url":"https://en.wikipedia.org/wiki/Jean-Jacques_Dessalines","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Jean_Jacques_Dessalines.jpg","page_title":"Jean-Jacques Dessalines","context_page_description":"Jean-Jacques Dessalines was a leader of the Haitian Revolution and the first ruler of an independent Haiti under the 1805 constitution. Under Dessalines, Haiti became the first country in the Americas to permanently abolish slavery. Initially regarded as governor-general, Dessalines was later named Emperor of Haiti as Jacques I by the generals of the Haitian Revolution Army. He is regarded as one of the founding fathers of Haiti.\\nDessalines served as an officer in the French army, when the colony was fending off Spanish and British incursions. Later he rose to become a commander in the revolt against France. As Toussaint Louverture's principal lieutenant, he led many successful engagements, including the Battle of Crête-à-Pierrot.\\nAfter the betrayal and capture of Toussaint Louverture in 1802, Dessalines became the leader of the revolution. He defeated a French army at the Battle of Vertières in 1803. Declaring Haiti an independent nation in 1804, Dessalines was chosen by a council of generals to assume the office of governor-general."},{"page_url":"https://es.wikipedia.org/wiki/Roy_Miller","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Roy_Miller_2016.jpg","page_title":"Roy Miller","context_page_description":"Roy Miller Hernández, es un futbolista costarricense que juega de defensa.\\nDebutó en la Primera División con el Cartaginés en 2002, cuando tenía diecisiete años. En 2005 fue fichado por el Bodø/Glimt de Noruega, donde en su primera temporada pierde la categoría. Luego de desarrollar dos torneos regulares, en 2008 firmó con el Rosenborg Ballklub del mismo país. Fue cedido a préstamo en el Örgryte IS de Suecia, con el cual descendió. Una vez finalizado el lapso, se incorporó al New York Red Bulls de la Major League Soccer, teniendo cinco años de carrera de manera ininterrumpida. Conquistó dos veces la MLS Supporters' Shield en 2013 y 2015. Regresó a Costa Rica después de diez años para jugar en el Deportivo Saprissa a partir de 2016. En diciembre de ese año se hizo con el título de Invierno y en marzo de 2017 volvió al balompié estadounidense, donde fichó por el Portland Timbers. En agosto de 2019 alcanzó su segunda etapa como jugador saprissista.\\nEs internacional con la selección costarricense desde 2005."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D9%84%D8%A7%D8%AF%DB%8C%D9%85%DB%8C%D8%B1_%D9%86%DB%8C%DA%A9%D9%88%D9%84%D9%88%D9%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Vladimir_Nikolov.JPG","page_title":"ولادیمیر نیکولوف","context_page_description":"ولادمیر نیکولوف والیبالیست؛ عضو و کاپیتان سابق تیم ملی والیبال بلغارستان است. نیکولوف با بلغارستان مدال برنز و سومی قهرمانی جهان را در سال ۲۰۰۶ به دست آورد."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E6%B5%B7%E5%B8%82%E7%AB%8B%E4%B8%AD%E5%A4%AE%E5%9B%B3%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Tokai_city_Central_library_01.jpg","page_title":"東海市立中央図書館","context_page_description":"東海市立中央図書館は、愛知県東海市中央町三丁目2番地にある公共図書館。分館として名鉄常滑線尾張横須賀駅前に東海市立横須賀図書館がある。\\n知多郡上野町と横須賀町が合併し、1969年4月1日に東海市が発足。東海市は1970年に建設された東海市立上野公民館や移動図書館車で図書館サービスを行っていた。1977年7月14日には大池公園北東角に独立館である東海市立中央図書館が開館。開館当時の延床面積は、名古屋市を除くと豊橋市図書館・岡崎市立図書館に次いで愛知県下3番目だった。2017年に開館40周年を迎えた。"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Saint-Trond","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Sint-Truiden_Begijnhof_Torenhuis_3.JPG","page_title":"Liste des monuments historiques de Saint-Trond","context_page_description":"Cette page regroupe l'ensemble des monuments classés de la ville belge de Saint-Trond."},{"page_url":"https://ru.wikipedia.org/wiki/Ferrari_F2003-GA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Ferrari_052_engine_front_Museo_Ferrari.jpg","page_title":"Ferrari F2003-GA","context_page_description":"Ferrari F2003-GA — автомобиль гоночной команды Scuderia Ferrari, построенный для участия в сезоне 2003 года и разработанный Рори Бирном и Россом Брауном. Болид дебютировал на пятом этапе сезона 2003 года, сменив предыдущую машину Ferrari F2002. Первоначально машина должна была получить название F2003, по аналогии с предыдущими шасси, но в январе 2003 года скончался глава FIAT Джанни Аньелли, чьи инициалы и были добавлены к названию болида. Используя этот автомобиль, Михаэль Шумахер в шестой раз стал чемпионом мира, а команда выиграла Кубок конструкторов."},{"page_url":"https://vi.wikipedia.org/wiki/Mitra_pica","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Mitra_pica_002.jpg","page_title":"Mitra pica","context_page_description":"Mitra pica là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Mitridae, họ ốc méo miệng."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%D8%B4%DA%AF%D8%A7%D9%87_%D8%A7%DB%8C%D8%A7%D9%84%D8%AA%DB%8C_%D8%B3%D9%88%D9%84%E2%80%8C%D8%B1%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Sul_Ross_wormark.png","page_title":"دانشگاه ایالتی سول‌راس","context_page_description":"دانشگاه ایالتی سول‌راس دانشگاهی عمومی است که در «آلپاین» تگزاس قرار دارد و نام آن از فرماندار پیشین تگزاس «لورنس سالیوان راس» گرفته شده‌است. دانشگاه در سال ۱۹۱۷ و با نام «سول‌راس نرمال کالج» تأسیس گردید و بعدها یعنی در سال ۱۹۶۹ تبدیل به دانشگاه شد.\\nارائه مدرک تحصیلی در این دانشگاه در مقاطع مختلف تحصیلی می‌باشد. محل اصلی دانشگاه در ناحیه «بیگ بند» قرار دارد که اولین مرکز آموزش عالی در منطقه محسوب می‌گردد، بیش از ۱۹ شهر غرب تگزاس را تحت پوشش خود دارد. شعبات دیگر دانشگاه در شهرهای «یووالد» «دل‌ریو» و «ایگل‌پس» دارا می‌باشد.\\nاداره کل دانشگاه توسط کمیته‌ای از سیستم آموزشی دولتی ایالت تگزاس می‌باشد که همچنین اداره هفت دانشگاه دیگر را در این ایالت تحت اختیار دارد."},{"page_url":"https://ro.wikipedia.org/wiki/28_octombrie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Statue-de-la-liberte-new-york.jpg","page_title":"28 octombrie","context_page_description":"28 octombrie este a 301-a zi a calendarului gregorian și a 302-a zi în anii bisecți. Mai sunt 64 de zile până la sfârșitul anului."},{"page_url":"https://de.wikipedia.org/wiki/Appenzeller_Bahnen_(Meterspurnetz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/CP_voitures.jpg","page_title":"Appenzeller Bahnen (Meterspurnetz)","context_page_description":"Dieser Artikel befasst sich mit dem Meterspurnetz der Appenzeller Bahnen, namentlich mit den technischen Aspekten und dem Meterspurrollmaterial."},{"page_url":"https://ca.wikipedia.org/wiki/Ricardo_Andrade_Quaresma_Bernardo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Ricardo_Quaresma_2017.jpg","page_title":"Ricardo Andrade Quaresma Bernardo","context_page_description":"Ricardo Andrade Quaresma Bernardo és un futbolista professional portuguès. Juga de migcampista.\\nHa estat internacional amb Portugal.\\nHa estat jugador a clubs com Sporting CP, FC Barcelona, FC Porto, Inter de Milà i Beşiktaş JK."},{"page_url":"https://en.wikipedia.org/wiki/Edmund_Ashfield_(Catholic_agent)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Beach_at_Seafield_-_geograph.org.uk_-_831297.jpg","page_title":"Edmund Ashfield (Catholic agent)","context_page_description":"Edmund Ashfield was an English Catholic from Tattenhoe in Buckinghamshire. He was educated at St Mary Hall, Oxford. In 1599 he travelled to Edinburgh to meet James VI of Scotland. The resident English diplomat organised his kidnap and rendition apparently in the belief that Ashfield was an agent of James VI and working to further his succession to the English throne. In 1606, Ashfield was involved in the rebuilding of Ashridge Priory for Sir Thomas Egerton. In 1612, the author Henry Peacham dedicated his Graphice, or the Auncient Arte of Drawing and Limning to Ashfield, by then Deputy-Lieutenant of Buckinghamshire. An aunt or cousin Cecily Ashfield was married to the Lord Chancellor Sir John Fortescue of Salden. Edmund's uncle Thomas Ashfield was a bailiff for the Earl of Oxford in 1571, and Edmund was Thomas's heir in 1609."},{"page_url":"https://de.wikipedia.org/wiki/Schnadegang","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Schnatgangstein%2C_Hotel_Walhalla_in_Osnabr%C3%BCck%2C_2007_-_cropped.jpg","page_title":"Schnadegang","context_page_description":"Der Schnadegang, mitunter auch Schnadezug, Schnatgang, Schnadgang oder Flurumgang, in Hessen auch Grenzgang oder Grenzegang und im Burgenland Hottergang genannt, ist in zahlreichen Gemeinden, vor allem in Westfalen, Hessen, im Burgenland sowie in der niedersächsischen Stadt Osnabrück ein wiederbelebter alter oder seit Jahrhunderten bestehender Brauch der Grenzbegehung. „Schnade“, niederdeutsch auch „Snat“ oder „Schnaot“, ist verwandt mit „Schneise“ und bedeutet Grenze. „Hotter“ leitet sich von ungarisch határ ab und bedeutet ebenfalls Grenze. Ein ähnlicher Brauch ist der in der Nordwestschweiz bekannte Banntag."},{"page_url":"https://ro.wikipedia.org/wiki/Chaudrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Chaudrey_monument_aux_morts_de_1870_03.jpg","page_title":"Chaudrey","context_page_description":"Chaudrey este o comună în departamentul Aube din nord-estul Franței. În 2009 avea o populație de 153 de locuitori."},{"page_url":"https://hr.wikipedia.org/wiki/Stefan-Boltzmannov_zakon","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Stefan_Boltzmann_001.png","page_title":"Stefan-Boltzmannov zakon","context_page_description":"Stefan-Boltzmannov zakon tvrdi da je ukupna količina energije j*, koju idealno crno tijelo zrači, po jedinici površine i u nekoj jedinici vremena, direktno proporcionalna sa četvtom potencijom termodinamičke temperature T:\\ngdje je σ - konstanta proporcionalnosti ili Stefan–Boltzmannova konstanta, koja se dobiva iz ostalih prirodnih konstanti, a vrijednost je:\\ngdje je k – Boltzmannova konstanta, h – Planckova konstanta i c – brzina svjetlosti u vakuumu. U stvarnosti ne postoji idealno crno tijelo, koje emitira 100 % svjetlosti, nego imamo sivo tijelo, kojeg dodatno karakteriziramo sa ε – stupanj emisije:\\nukupna količina zračenja j* ima dimenziju kao. Za temperature T jedinica je Kelvin. Stupanj emisije uglavnom ovisi o valnoj duljini svjetlosti ε = ε.\\nDa bismo dobili snagu zračenja nekog tijela, treba uzeti u obzir i njegovu površinu A:\\nOvaj zakon vrijedi za idealan toplinski stroj, kod kojeg je svjetlost radni medij, a ne plin. U stvarnosti, vrijednosti su uvijek nešto niže."},{"page_url":"https://de.wikipedia.org/wiki/Wappen_Schleswig-Holsteins","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Schleswig-Holstein-_und_Flensburgwappen_unter_Reichsadler_der_Sportschule_%28Jan_2015%29.JPG","page_title":"Wappen Schleswig-Holsteins","context_page_description":"Das Wappen Schleswig-Holsteins ist gespalten: Im heraldisch rechten Feld befinden sich auf goldenem Grund zwei blaue, nach innen gewandte, rot bewehrte, übereinander schreitende Löwen. Die sog. Schleswigschen Löwen sind dem dänischen Wappen entnommen; Herzog Abel erhielt als jüngerer Königssohn ein reduziertes Wappen, das heute das Wappen des ehemaligen Herzogtums Südjütland bzw. Schleswig ist. Im heraldisch linken Feld befindet sich ein silbernes bzw. weißes Schild mit roter Borte – das Wappen der Schauenburger Territorialherren, dieses wird seit den Oldenburgern als holsteinisches Nesselblatt bezeichnet. Es ist ein altes Symbol, das von den Schauenburger Landesherren übernommen wurde. Dieses sog. Nesselblatt ist silbern auf rotem Grund. Graf Adolf IV., der Mönch wurde und eine Pilgerfahrt nach Rom durchführte, führte die drei Nägel in den Ecken zur Erinnerung an die Kreuzigung des Heilands, also Jesus von Nazareth, ein."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8C%97%E7%BE%8E%E6%B4%B2%E5%9F%8E%E5%B8%82%E4%BA%BA%E5%8F%A3%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/CdrlSraGdpeMexicali.JPG","page_title":"北美洲城市人口列表","context_page_description":"此为根据官方最新人口普查资料而建立的北美洲城市人口列表。该列表仅列出人口数超过600,000人的城市。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8A%E6%B5%B7%E5%85%A8%E5%9B%BD%E9%87%8D%E7%82%B9%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/%E6%9D%BE%E6%B1%9F%E5%85%B4%E5%9C%A3%E6%95%99%E5%AF%BA%E5%A1%94.jpg","page_title":"上海全国重点文物保护单位列表","context_page_description":"本列表是全國重點文物保護單位列表的子列表，列舉在上海市境內的全國重點文物保護單位。"},{"page_url":"https://en.wikipedia.org/wiki/Northport_High_School","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Northport_High_School_Commons.jpg","page_title":"Northport High School","context_page_description":"Northport High School is a four-year secondary school in East Northport, New York, that serves as the high school for the Northport-East Northport Union Free School District which is composed of Northport, Eatons Neck, Asharoken and much of East Northport, all located in the Town of Huntington. Northport High School is home to over 2,000 students and 270 staff members and offers the International Baccalaureate program, two National Academy programs, Project Lead the Way, Project P.A.T.C.H. and more than 20 Advanced Placement courses. The school's athletic teams are known as the Tigers."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BB%D0%B8%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D0%B8%D1%86%D0%B0_%D0%B8%D0%BC._%D0%9D._%D0%90._%D0%A1%D0%B5%D0%BC%D0%B0%D1%88%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/%D0%9A%D0%BE%D0%BB%D0%B8%D1%88%D0%BD%D1%8F_%D1%85%D1%96%D1%80%D1%83%D1%80%D0%B3%D1%96%D1%87%D0%BD%D0%B0_%D0%BB%D1%96%D0%BA%D0%B0%D1%80%D0%BD%D1%8F_3.jpg","page_title":"Республиканская клиническая больница им. Н. А. Семашко","context_page_description":"ГБУЗ РК «Республиканская клиническая больница им. Н. А. Семашко» в Симферополе является многопро­фильным высококвалифицированным медицинским учреждением Республики Крым, выполняет лечебно-диагностическую, научную и учебно-методическую работу для жителей Крыма."},{"page_url":"https://en.wikipedia.org/wiki/Charleston_Renaissance","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Bayou_Scene_Alice_Ravenel_Huger_Smith_1920.jpeg","page_title":"Charleston Renaissance","context_page_description":"The Charleston Renaissance is a period between World Wars I and II in which the city of Charleston, South Carolina, experienced a boom in the arts as artists, writers, architects, and historical preservationists came together to improve and represent their city. The Charleston Renaissance was related to the larger interwar artistic movement known as the Southern Renaissance and is credited with helping to spur the city's tourist industry."},{"page_url":"https://es.wikipedia.org/wiki/Marina_de_Bitinia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Torrebaja-santaMarina_%282017%293773.jpg","page_title":"Marina de Bitinia","context_page_description":"Santa Marina Virgen es una santa del siglo IV-siglo V originaria de Bitinia-Bithynia, que vivió y murió en el Monasterio de Qannoubine, Líbano.\\nProcedente de la tradición maronita, santa Marina Virgen es venerada en la iglesia católica, cabe distinguirla -sin embargo- de otras santas de este nombre: Marina de Antioquía, Marina de España, Marina de Sicilia y Marina del Cister."},{"page_url":"https://ceb.wikipedia.org/wiki/Twice","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Twice_Members_in_2015_-_3x3.jpg","page_title":"Twice","context_page_description":"Ang Twice ay usa ka K-pop nga banda nga nagabase sa South Korea."},{"page_url":"https://pl.wikipedia.org/wiki/Pervench%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/FranceNormandiePervencheresEglise.jpg","page_title":"Pervenchères","context_page_description":"Pervenchères – miejscowość i gmina we Francji, w regionie Normandia, w departamencie Orne.\\nWedług danych na rok 1990 gminę zamieszkiwało 397 osób, a gęstość zaludnienia wynosiła 14 osób/km²."},{"page_url":"https://nl.wikipedia.org/wiki/Pieter_Nuyts_(senior)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Christmas_tree_02_gnangarra.jpg","page_title":"Pieter Nuyts (senior)","context_page_description":"Pieter Nuyts was een koopman en gouverneur in dienst van de Vereenigde Oostindische Compagnie. In Australië zijn een woekerplant, plantengeslacht, eilandengroep, drie natuurparken, rif, kaap, straat en een wetenschappelijk tijdschrift naar hem vernoemd."},{"page_url":"https://mg.wikipedia.org/wiki/Tsutomu_Hata","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Tsutomu_Hata_cropped_Tsutomu_Hata_199404.jpg","page_title":"Tsutomu Hata","context_page_description":"Tsutomu Hata dia mpanao politika mizaka ny zom-pirenen'i Japana teraka ny 24 Aogositra 1935 tao Tokyo - 25 august 2017."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%AA%D8%A7%D9%81%D9%83%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Russian_coa_1825.png","page_title":"ستافكا","context_page_description":"ستافكا مصطلح عسكري روسي أُطلق على عنصر القيادة بالقوات المسلحة منذ عهد كييف روس، وحقق رواجًا تاريخيًا في عهد الإمبراطورية الروسية كمصطلح يرمز للهيكل القيادي وأخيرا كمركز القيادة العامة للقوات المسلحة للإمبراطورية الروسية أواخر القرن التاسع عشر وهو ما استمر عليه الحال خلال العهد السوفيتي كذلك، وكلمة ستافكا في حد ذاتها تُستخدم للإشارة لأحد أفراد هيئة أركان القوات المسلحة وكذلك المقر الرسمي للقيادة العامة للقوات المسلحة، والكلمة مأخوذة من الروسية القديمة ставка والتي تقابلها كلمة خيمة في العربية."},{"page_url":"https://fr.wikipedia.org/wiki/1858","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/French_capture_of_Danang_1858.jpg","page_title":"1858","context_page_description":"13 février : les explorateurs britannique John Hanning Speke et Richard Francis Burton atteignent le Lac Tanganyika à Ujiji.\\n18 février : première constitution ségrégationniste du Transvaal.\\n19 mars : reprise de la guerre entre les Boers de l’État libre d'Orange et les Basotho.\\n14 mai : une expédition conduite par David Livingstone, partie de Liverpool le 10 mars pour explorer le Zambèze, atteint les bouches du fleuve.\\n20 mai : en Mauritanie, le général français Faidherbe, gouverneur du Sénégal impose la souveraineté française aux tribus Trarza qui contrôlaient les escales du bas Sénégal et rançonnaient les commerçants.\\n9 juin, Cameroun : Alfred Saker fonde de la ville de Victoria. Le 23 août, les Britanniques signent un traité avec roi William de Bimbia. Une cour d’équité est installée.\\n24 juin : Napoléon III supprime le Gouvernement général de l’Algérie et le remplace par un ministère de l’Algérie et des Colonies confié à son cousin, Jérôme Napoléon, qui tente quelques réformes dont certaines auraient dû aboutir à une politique d’assimilation, mais se heurte, sur de nombreux points, aux militaires et donne sa démission en 1859."},{"page_url":"https://en.wikipedia.org/wiki/Charlie_Furbush","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Charlie_Furbush.JPG","page_title":"Charlie Furbush","context_page_description":"Charles Roderick Furbush is an American former professional baseball pitcher. He played in Major League Baseball for the Detroit Tigers and Seattle Mariners."},{"page_url":"https://sv.wikipedia.org/wiki/F%C3%B6rsvarsfordonsmuseet_Arsenalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Pansarbandvagn_301_Str%C3%A4ngn%C3%A4s_12.08.11.JPG","page_title":"Försvarsfordonsmuseet Arsenalen","context_page_description":"Försvarsfordonsmuseet Arsenalen är ett militärhistoriskt museum beläget i Härad väster om Strängnäs."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%97%E6%8B%89%E5%9F%BA%E7%B1%B3%E5%B0%94%C2%B7%E6%99%AE%E4%BA%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Vladimir_Putin_and_Hassan_Rouhani_%282018-06-09%29_1.jpg","page_title":"弗拉基米尔·普京","context_page_description":"佛拉迪米爾·佛拉迪米羅維奇·普丁是俄羅斯的政治人物，出生於列寧格勒，現任俄羅斯總統、俄羅斯聯邦安全會議主席。曾任俄羅斯第5任、第9任俄羅斯總理、俄羅斯第2任總統、第3任統一俄羅斯黨主席，更換職位均沒有離開過權力核心以及其在政府中的聲望頗大，故被外界認為是俄羅斯自2000年以來的國家領導人。普丁最早任職於蘇聯國家安全委員會，蘇聯解體後進入俄羅斯聯邦政府工作，並在1999年中獲得時任俄羅斯總統葉爾欽任命為總理。在1999年12月31日即將踏入2000年的數小時前，葉爾欽突然宣布辭去總統職務，時任總理的普丁受命成為代理總統。之後，他陸續贏得2000年和2004年的總統選舉。由於憲法規定了連任的限制，普丁無法參與2008年俄羅斯總統選舉。隨後，普丁指定的候選人德米特里·梅德維傑夫當選了俄羅斯總統。2008年5月7日普丁卸任總統後，被總統梅德韋傑夫提名第二度出任總理，繼續掌握國家的實權。2012年普丁第三度參選總統選舉且勝出並辭去統一俄羅斯黨主席職務，第四度參選2018年大選再度連任，任期至2024年。2020年3月14日，普丁簽署由本人提出的俄聯邦憲法修正案，使其可再競選2任總統，突破目前遭到的憲法任期，其修正案原訂於2020年4月22日舉行全國投票，但因為嚴重特殊傳染性肺炎疫情而被延後。普丁擔任總統期間的主要改革如所得稅改成13％、降低利潤稅稅率，以及制定新的土地和法律條文，利用他善於擔任特務工作的施政手段，確保國家運作的平穩。特別是普丁在位期間遇上史上最高油價，俄羅斯受惠於油田出口賺進大量資金，使俄國的軍事與政治實力得以在蘇聯崩潰後恢復，政治以及法制上都獲得了穩定發展。但他在民主方面則遭到很多爭議，可說是一位名副其實的「鐵腕總統」。號稱在普丁的經濟管理下，在他任內吸引了許多外匯公司進駐俄羅斯，但國際原油價格反轉下跌後馬上又呈現經濟疲態。不過總體而言，他任內國內生產總值將近上升了72%，購買力平價也上升6倍左右；俄羅斯國內的貧窮人口則減少了一半，平均月薪從80美元增加至640美元。分析人士形容普丁的經濟改革，令人印象深刻。但同時他所帶領的政府也被反對派、西方政府和歐美人權組織質疑，特別是他所主導的第二次車臣戰爭、頓巴斯戰爭、克里米亞戰爭、南奧塞提亞戰爭及敘利亞內戰中展現出非常強硬的態度，以及國內經濟體制改革中出現的寡頭化等問題。普丁於2009年12月在俄羅斯國家電視台說前蘇共中央總書記史達林「很難被非黑即白地評價，很難說他的一生是功是過。」俄羅斯聯邦共產黨、比俄共更加親近史達林主義的蘇聯共產黨俄羅斯共產主義工人黨、全聯盟共產黨布爾什維克以及第三位置政黨俄羅斯民族布爾什維克黨基本上都反感與厭惡普丁。"},{"page_url":"https://hu.wikipedia.org/wiki/2009-es_Giro_d%E2%80%99Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Denis_Menchov_Giro_2009.JPG","page_title":"2009-es Giro d’Italia","context_page_description":"A 2009-es Giro d’Italia volt a 92. a verseny történetében. Velencében rajtolt a mezőny május 9-én a csapat időfutammal. A 21 versenynapot 2 pihenőnap szakította meg. A győztes az orosz Gyenyisz Menysov lett. Május 31-én, Rómában ő vehette át a győztesnek járó rózsaszín trikót. Éppen 100 éve, 1909-ben rendezték az első Giro-t. A centenáriumi eseményt doppingbotrányok árnyékolták be, melyek miatt később több versenyzőt – köztük a második helyezett Danilo di Luca-t is – megfosztották eredményétől. Jelen összeállításunkban az eredeti eredményeket közöljük."},{"page_url":"https://es.wikipedia.org/wiki/Aeropuerto_Internacional_Rafael_N%C3%BA%C3%B1ez","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/77_-_Carthag%C3%A8ne_-_D%C3%A9cembre_2008.JPG","page_title":"Aeropuerto Internacional Rafael Núñez","context_page_description":"El Aeropuerto Internacional Rafael Núñez se encuentra en Cartagena de Indias, Colombia, capital del departamento de Bolívar. Con un movimiento de 5.773.774 de pasajeros​ es el más importante de la costa Caribe colombiana y el tercero a nivel nacional en tráfico de pasajeros después del Aeropuerto El Dorado de la ciudad de Bogotá y el Aeropuerto Internacional José María Córdova de la ciudad de Medellín.\\nEl aeropuerto está localizado al norte de la ciudad, exactamente en el barrio de Crespo. Su nombre, Rafael Núñez, hace referencia al expresidente homónimo colombiano, quien escribió las estrofas del himno nacional de Colombia y quien nació en la ciudad.\\nDesde 1996 es administrado bajo la figura de concesión por la Sociedad Aeroportuaria de la Costa S.A., empresa colombiana que cuenta con la experiencia y tecnología de su socio operador de España AENA\\nAlgunas aerolíneas como: Avianca, Copa Airlines Colombia, Spirit Airlines, Delta Airlines y KLM tienen vuelos desde este terminal aéreo hacia ciudades de Norte, Centro, Sudamérica y Europa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%BA%D0%BE-%D0%A6%D0%B8%D0%BD%D0%BD%D0%B5%D0%B1%D0%B5%D1%80%D0%B3,_%D0%9C%D0%B0%D0%BA%D1%81%D0%B8%D0%BC%D0%B8%D0%BB%D0%B8%D0%B0%D0%BD_%D1%84%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Wittelsbacherplatz_1_Palais_Arco-Zinneberg_Muenchen-1.jpg","page_title":"Арко-Циннеберг, Максимилиан фон","context_page_description":"Граф Максимилиан Иосиф Бернхард фон Арко-Циннеберг — австрийский и баварский аристократ, коллекционер.\\nРодился в замке Степперг в Верхней Баварии.\\nСын графа Людвига Арко и австрийской эрцгерцогини Марии Леопольдины Австрийской-Эсте. Правнук императрицы Священной Римской империи Марии Терезии.\\nВместе с братом получил домашнее образование. Семья благодаря способностям и деловой хватке матери, была очень богатой, владела одним из крупнейших состояний в Баварии. В 1825 году семья купила замок Циннеберг в Глонне.\\nВ 1833 году Арко-Циннеберг женился на Леопольдине фон Вальдбург-Цейль, двоюродной сестре майнцского епископа Вильгельма Эммануила фон Кеттелера, в браке с которой имел 13 детей. Свадебным подарком от родителей ему стал дворец в Мюнхене.\\nВ 1848 году мать оставила своим сыновьям огромное состояние 15 миллионов флоринов.\\nАрко-Циннеберг был страстным охотником, особой его страстью была орлиная охота, за что получил прозвище «граф Орел». Кроме собственных охотничьих трофеев, он приобретал уникальные и ценные предметы со всего мира.\\nАрко-Циннеберга считают основателем Музея охоты и рыболовства, расположившегося в бывшей августинской церкви в Мюнхене."},{"page_url":"https://en.wikipedia.org/wiki/New_Buckenham","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Tudor_Rose_Cottage_-_geograph.org.uk_-_1403138.jpg","page_title":"New Buckenham","context_page_description":"New Buckenham is a village and civil parish in the English county of Norfolk.\\nThe parish covers an area of 1.73 km² and had a population of 468 in 197 households at the 2001 census, falling marginally to a population of 460 in 209 households at the 2011 census. The small parish includes only the village, New Buckenham Common and some outlying houses and farmland. It is in the local government district of Breckland.\\nA nucleated village, New Buckenham has a medieval grid plan encompassing a green that originally served as the market place. At the green there is a historic market house, a grade II-star listed building which features a whipping post, and commonly called the Market Cross. The village entirely comprises a conservation area together with the adjacent Buckenham Castle, which lies in the neighbouring parish of Old Buckenham."},{"page_url":"https://fr.wikipedia.org/wiki/P%C3%A9riode_des_Printemps_et_Automnes","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Zhou_capitales.svg","page_title":"Période des Printemps et Automnes","context_page_description":"La période des Printemps et Automnes ou période Chunqiu désigne, dans l'histoire de Chine, la première partie de la dynastie des Zhou orientaux, c'est-à-dire une période allant d'environ 771 à 481/453 av. J.-C. Elle tire son nom des Annales des Printemps et Automnes, une chronique des événements survenus entre 722 et 481 av. J.-C. issue des scribes de l'État de Lu mais concernant aussi les autres États.\\nDurant la période des Zhou de l'Ouest, les nombreux petits États qui s'étendent dans la vallée du fleuve Jaune et ses alentours jusqu'au cours du fleuve Bleu connaissent sous l'égide des rois Zhou un régime qui a pu être qualifié de « féodal », reposant sur les liens de parenté et d'allégeance entre lignages aristocratiques, dont les pratiques rituelles sont dominées par le culte des ancêtres. Mais après la prise de leur capitale en 771 av. J.-C. et son déplacement plus à l'est, les nouveaux rois Zhou « orientaux » n'exercent plus qu'une autorité symbolique, et s'affirment alors des princes puissants qui exercent temporairement la fonction d'« hégémon », leur assurant la direction de coalitions militaires regroupant plusieurs principautés."},{"page_url":"https://en.wikipedia.org/wiki/CEACAM3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/PBB_GE_CEACAM3_208052_x_at_fs.png","page_title":"CEACAM3","context_page_description":"Carcinoembryonic antigen-related cell adhesion molecule 3 also known as CD66d, is a member of the carcinoembryonic antigen gene family..\\nThis gene encodes a member of the family of carcinoembryonic antigen-related cell adhesion molecules, which are used by several bacterial pathogens to bind and invade host cells. The encoded transmembrane protein directs phagocytosis of several bacterial species that is dependent on the small GTPase Rac. It is thought to serve an important role in controlling human-specific pathogens by the innate immune system. Alternatively spliced transcript variants have been described, but their biological validity has not been determined."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Zellingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/D-6-77-203-15_Langgasse_4_Zellingen.jpg","page_title":"Liste der Baudenkmäler in Zellingen","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Zellingen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 15. April 2020 wieder und enthält 139 Baudenkmäler."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D8%AE%D9%84_%D8%A2%D8%B3%D8%A7%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/A%C3%A7aizeiro_no_pal%C3%A1cio.JPG","page_title":"نخل آسای","context_page_description":"نخل آسای یکی از گونه‌های تیره نخل است. میوه‌های آسای، در سال‌های اخیر یکی از میوه‌های محبوب فروشگاه‌های ایالات متحده و نیز اروپا بوده است. از این میوه‌ها برای تولید آب میوه و حتی تولید رنگ‌های طبیعی استفاده‌های فراوانی به عمل می‌آید.\\nبرای تولید آب میوه ابتدا سته‌ها را در آب خیسانده تا پوستهٔ خارجی آن نرم شود، سپس آنها را فشرده کرده و آبگیری می‌نمایند. آب میوه به رنگ ارغوانی تیره بوده که برای مصرف آن را با شکر و نشاسته کاساو مخلوط می‌کنند تا آب میوه‌ای غلیظ و مقوی ایجاد شود. همچنین برای تهیهٔ بستنی، مشروبات الکلی و انواع مختلفی از شیرینی‌ها از آب میوهٔ این گیاه استفاده می‌شود. از برگ‌های این گیاه نیز در تهیه کاهگل برای سقف خانه‌ها استفاده می‌کنند. از این درخت و فراورده‌های آن به‌طور سنتی در تهیه داروهای مختلف نیز بهره می‌گیرند. روغن میوهٔ آن برای درمان اسهال کاربرد دارد. بذرهای این گیاه را پس از برشته کردن و له کردن برای درمان «تب» به کار می‌برند. جوشانده و دم کرده ریشه‌های این گیاه برای درمان بیماری‌های کبد، دیابت، ریزش مو و درد ماهیچه‌ها مفید هستند. مطالعات اخیر نشان داده که میوه‌های این گیاه و روغن آن دارای خواص آنتی اکسیدانی قوی می‌باشند."},{"page_url":"https://ca.wikipedia.org/wiki/Les_Coves_de_Vinrom%C3%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Coves_de_Vinrom%C3%A0.jpg","page_title":"Les Coves de Vinromà","context_page_description":"Les Coves de Vinromà és un municipi valencià situat a la Plana Alta."},{"page_url":"https://fr.wikipedia.org/wiki/Cecily_Lefort","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Cecily_Lefort.jpg","page_title":"Cecily Lefort","context_page_description":"Cecily Lefort est un agent secret britannique du Special Operations Executive pendant la Seconde Guerre mondiale. Elle assure, au cours de l'été 1943, la fonction de courrier dans le réseau Jockey, dirigé par Francis Cammaerts dans le sud-est de la France. Arrêtée par la Gestapo, elle est déportée à Ravensbrück et exécutée."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%89%D5%AB%D5%B4%D5%A2%D5%B8%D6%80%D5%A1%D5%BD%D5%B8_(%D5%BA%D6%80%D5%B8%D5%BE%D5%AB%D5%B6%D6%81%D5%AB%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Luis-Alberto-Costales-Riobamba-Chimborazo.jpg","page_title":"Չիմբորասո (պրովինցիա)","context_page_description":"Չիմբորասո, պրովինցիա Էկվադորի Անդերի կենտրոնում։ Այստեղ է գտնվում Սանգայ ազգային պարկը։ Մայրաքաղաքը Ռիոբամբան է։ Պրովինցիայի կազմի մեջ է մտնում Չիմբորասոն, որն Էկվադորի ամենաբարձր լեռն է։"},{"page_url":"https://cy.wikipedia.org/wiki/Melksham","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Melksham_Market_Place.jpg","page_title":"Melksham","context_page_description":"Tref a phlwyf sifil yn Wiltshire, De-orllewin Lloegr, ydy Melksham.\\nYng Nghyfrifiad 2011 roedd gan y plwyf sifil boblogaeth o 15,229.\\nMae Caerdydd 72.9 km i ffwrdd o Melksham ac mae Llundain yn 142 km. Y ddinas agosaf ydy Caerfaddon sy'n 16 km i ffwrdd."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Sadurki","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/SadurkiStaraDworcowaToaleta.jpg","page_title":"Bahnhof Sadurki","context_page_description":"Der Bahnhof Sadurki befindet sich nordöstlich der gleichnamigen Ortschaft in der Woiwodschaft Lublin in Polen, 23 Kilometer von der Stadt Lublin und 49 Kilometer von Dęblin entfernt. Die 1875–1877 erbauten Gebäude waren der erste Bahnhof des bekannten Kurorts Nałęczów und sind in ihrer Gesamtheit denkmalgeschützt."},{"page_url":"https://vi.wikipedia.org/wiki/Panchrysia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Panchrysia_v-argenteum.jpg","page_title":"Panchrysia","context_page_description":"Panchrysia là một chi bướm đêm thuộc họ Noctuidae."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Bergshausen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Kasseler_Stra%C3%9Fe_17%2C_1%2C_Bergshausen%2C_Fuldabr%C3%BCck%2C_Landkreis_Kassel.jpg","page_title":"Liste der Kulturdenkmäler in Bergshausen","context_page_description":"Die Liste der Kulturdenkmäler in Bergshausen enthält alle Kulturdenkmäler im Ortsteil Bergshausen der nordhessischen Gemeinde Fuldabrück, die in der vom Landesamt für Denkmalpflege Hessen 2011 herausgegebenen Denkmaltopographie veröffentlicht wurden."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%B2%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Weser_Einzugsgebiet.png","page_title":"وزر","context_page_description":"وزر یک رود در آلمان است که در برمن واقع شده‌است."},{"page_url":"https://lmo.wikipedia.org/wiki/RegioJet","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/RegioJet%2C_souprava_04.jpg","page_title":"RegioJet","context_page_description":"RegioJet a l'è 'n azienda ceca de straport, filial de la Student Agency e de la Keolis. La opera in del straport a longa percorrenza in Cechia, de 'n quaj servizzi regional in Slovacchia e de 'n servizzi diurn in tra la Cechia e l'Austria. La se occupa anca, 'me marchio, di conligament bus de la Student Agency.\\nEl sò material rotabil a l'è faa de 9 Bombardier Talent diesel a 3 cass per el servizzi regional in Slovacchia, insemma a di Siemens Desiro. Per el straport in Cechia a hinn doperaa di treni ordinari, cont di carrozz faa in Austria e spint di locomotiv Vectron e di locomotiv FNM E.630, de produzion cecoslovacca, venduu ai Ferrovie Nord Milano e poeu recrompaa de la RegioJet."},{"page_url":"https://sk.wikipedia.org/wiki/Kask%C3%A1dov%C3%A9_vrchy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/ColumbiarivergorgeJRH.jpg","page_title":"Kaskádové vrchy","context_page_description":"Kaskádové vrchy, je horské pásmo, tiahnúce sa v smere juh-sever po západnom pobreží Severnej Ameriky, od severnej Kalifornie, cez Oregon a Washington až po rieku Fraser v Britskej Kolumbii v Kanade. Z Európanov preskúmal pohorie ako prvý kapitán George Vancouver, ktorý aj pomenoval viacero štítov. Neskôr prešla cez pohorie expedícia Lewisa a Clarka, využila pritom rieku Columbia.\\nKaskádové vrchy sú zaujímavé výskytom sopečnej činnosti. Nachádzajú sa tu vyhasnuté, ale aj aktívne sopky. Kaskádové vrchy sú súčasťou tichomorského prstenca sopiek, nazývaného Ohnivý kruh. Pre pôvodných obyvateľov Ameriky sú nevyčerpateľnou studnicou povier a mýtov, taktiež sú domovom jedného z mýtických zvierat - Bigfoota."},{"page_url":"https://da.wikipedia.org/wiki/Daniel_Evans","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Daniel_Evans_1%2C_2015_Wimbledon_Qualifying_-_Diliff.jpg","page_title":"Daniel Evans","context_page_description":"Daniel Evans er en professionel mandlig tennisspiller fra Storbritannien."},{"page_url":"https://eu.wikipedia.org/wiki/Procelsterna_cerulea","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Blue-grey_Noddy.jpg","page_title":"Procelsterna cerulea","context_page_description":"Procelsterna cerulea Procelsterna generoko animalia da. Hegaztien barruko Laridae familian sailkatua dago."},{"page_url":"https://sv.wikipedia.org/wiki/Kabelskalare","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Wire_stripper.jpg","page_title":"Kabelskalare","context_page_description":"Kabelskalare är ett specialiserat verktyg varmed det går att tar bort isoleringen från elkablar. Det finns flera olika typer av skaltänger, där en av de vanligaste är en kombinationstång som även fungerar som kabelskotång.\\nAndra verktyg för skalning av kablar omfattar bland annat Kabelknivar."},{"page_url":"https://it.wikipedia.org/wiki/Dmitrij_Konstantinovi%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/39_History_Of_Russia_by_William_Tooke.jpg","page_title":"Dmitrij Konstantinovič","context_page_description":"Dmitrij Konstantinovič in russo: Дми́трий Константи́нович Су́здальский fu Gran Principe di Vladimir-Suzdal' dal 1359 fino al 1362. Morì nei dintorni di Nižnij Novgorod, dove è ancora sepolto."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%95%E0%B8%B2%E0%B8%A3%E0%B9%8C%E0%B8%A7%E0%B8%B9%E0%B8%94%E0%B9%82%E0%B8%AE%E0%B9%80%E0%B8%97%E0%B8%A5%E0%B8%AA%E0%B9%8C%E0%B9%81%E0%B8%AD%E0%B8%99%E0%B8%94%E0%B9%8C%E0%B8%A3%E0%B8%B5%E0%B8%AA%E0%B8%AD%E0%B8%95%E0%B8%AA%E0%B9%8C%E0%B9%80%E0%B8%A7%E0%B8%B4%E0%B8%A5%E0%B8%94%E0%B9%8C%E0%B9%84%E0%B8%A7%E0%B8%94%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Starwood_headquarters.jpg","page_title":"สตาร์วูดโฮเทลส์แอนด์รีสอตส์เวิลด์ไวด์","context_page_description":"กลุ่มโรงแรมและรีสอร์ทสตาร์วูด เป็นกลุ่มโรงแรมสัญชาติอเมริกัน มีที่ตั้งบริษัทแม่อยู่ที่สแตมเฟิร์ด ซึ่งจัดเป็นหนึ่งในกลุ่มโรงแรมที่ใหญ่ที่สุดกลุ่มหนึ่งของโลก โดยเป็นทั้งผู้บริหาร ผู้ร่วมทุน เจ้าของ และเจ้าของเฟรนไชส์ของทั้งโรงแรม รีสอร์ท สปา เรสซิเดนซ์ ภายใต้แบรนด์ทั้งหมด 9 แบรนด์ ในปีค.ศ.2009 กลุ่มสตาร์วูด มีโรงแรมในเครือทั้งหมด 992 แห่ง และมีพนักงานทั้งหมดกว่า 145,000 คน โดย 26% อยู่ในสหรัฐอเมริกา\\nในวันที่ 16 พฤศจิกายน 2558 แมริออทอินเตอร์เนชันแนล ประกาศเข้าซื้อกิจการกลุ่มโรงแรมและรีสอร์ทสตาร์วูด ทำให้กลายเป็นกลุ่มโรงแรมขนาดใหญ่ที่สุดในโลก"},{"page_url":"https://ms.wikipedia.org/wiki/Mahkamah_United_Kingdom","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Middlesex.guildhall.london.arp.jpg","page_title":"Mahkamah United Kingdom","context_page_description":"United Kingdom tidak mempunyai suatu sistem bidang kuasa yang bersatu, tetapi sistem kehakiman berpisah mengkhidmati England dan Wales, Scotland dan Ireland Utara. Meskipun, dalam bidang undang-undang imigresen, bidang kuasa tertentu Tribunal Asylum dan Imigresen dan Suruhanjaya Rayuan Imigresen Istimewa meliputi keseluruhan United Kingdom; pada employment law, Employment tribunals dan Employment Appeal Tribunal mempunyai bidang kuasa dalam keseluruhan Great Britain.\\nConstitutional Reform Act 2005 mendirikan sebuah Mahkamah Persekutuan United Kingdom untuk mengambil alih fungsi-fungsi kehakiman Dewan Pertuanan dan kes penurunan kuasa dari Jawatankuasa Kehakiman Majlis Privi. Oleh kerana itu, apabila Mahkamah Persekutuan United Kingdom mula bertugas pada 2009, ia akan berkhidmat sebagai mahkamah tertinggi rayuan di England dan Wales dan di Ireland Utara, dan kes sivil di Scotland. Mahkamah Tinggi Keadilan akan kekal jadi mahkamah jalan terakhir di Scotland untuk kes-kes jenayah.\\nUntuk maklumat selanjutnya pada mahkamah dalam berlainan bidang kuasa United Kingdom sila lihat:\\nMahkamah England dan Wales\\nMahkamah Ireland Utara\\nMahkamah Scotland"},{"page_url":"https://de.wikipedia.org/wiki/Lake_Woronora","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Australia_New_South_Wales_relief_location_map.png","page_title":"Lake Woronora","context_page_description":"Der Lake Woronora ist ein Stausee im Osten des australischen Bundesstaates New South Wales. Er wurde am Oberlauf des Woronora River im Süden von Sydney gebaut und dient der Trinkwasserversorgung des Sutherland Shire und des nördlichen Illawara Shire mit den Vororten Helensborough, Otford, Stanwell Tops, Stanwell Park und Coalcliff."},{"page_url":"https://eu.wikipedia.org/wiki/Sepia_(generoa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Sepia1.jpg","page_title":"Sepia (generoa)","context_page_description":"Sepia Sepiidae familiako generorik ezagunena da. Generoaren izena txibiaren grezierazko σηπία, sepia, forma latinizatua da."},{"page_url":"https://eu.wikipedia.org/wiki/Joseba_Tapia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/JosebaTapia_Aiurri_Kitarra_2019.jpg","page_title":"Joseba Tapia","context_page_description":"Joseba Tapia soinu jotzailea eta trikitilaria da. Kepa Junkerarekin batera, trikitiaren arloa gehien aldatu duten gaur egungo trikitilarietako bat da, eta trikitilari onenetako bat ere bai."},{"page_url":"https://de.wikipedia.org/wiki/%C4%8Ceren%C4%8Dany","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/%C4%8Ceren%C4%8Dany_-_ulica_obce.jpg","page_title":"Čerenčany","context_page_description":"Čerenčany ist eine Gemeinde in der Mitte der Slowakei mit 560 Einwohnern, die im Okres Rimavská Sobota, einem Kreis des Banskobystrický kraj, liegt und zur Landschaft Gemer gezählt wird."},{"page_url":"https://fr.wikipedia.org/wiki/Nuku_Hiva","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Nuku_Hiva_02.jpg","page_title":"Nuku Hiva","context_page_description":"Nuku Hiva, également dénommée Nuka Hiva ou île Marchand, est une île située dans l’archipel des Marquises en Polynésie française. L'île est le chef-lieu des Marquises ainsi que celui de la commune de Nuku Hiva"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D8%B1%D9%88%D8%B4%D9%88%D9%88%D8%A7%D9%86%DB%8C_(%D8%AE%D9%88%D9%85%D9%88%D8%AA%D9%88%D9%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Hru%C5%A1ovany_CoA.jpg","page_title":"هروشووانی (خوموتوف)","context_page_description":"هروشووانی (خوموتوف) چک اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۳۰۰ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا ۴۱۲ نفر ایمیش و اوستی ناد لابم اوستانیندا یئرلشیب. بۆتون چک‌دا اوْلدوغو کیمی، بۇ شهرده آنا دیلی چک دیلی دیر."},{"page_url":"https://nl.wikipedia.org/wiki/Westerse_esoterie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Rose_Cross_Lamen.svg","page_title":"Westerse esoterie","context_page_description":"Westerse esoterie is een studiegebied binnen de geesteswetenschappen. Het gaat om een verzameling sterk uiteenlopende stromingen uit de westerse cultuurgeschiedenis die gemeen hebben dat ze door de heersende religieuze en academische instellingen werden verworpen als bronnen van legitieme kennis; door religie als ketters, door de wetenschap als irrationeel. De belangrijkste van deze stromingen zijn gnostiek, hermetica, alchemie, astrologie, magie, theosofie, mystiek en het moderne occultisme.\\nAan deze esoterische stromingen werd vroeger gerefereerd als occultisme, maar die benaming is in het wetenschappelijk discours niet langer gebruikelijk. De benaming 'westerse esoterie' mag dan wel suggereren dat er naast een westelijke esoterie ook een 'oostelijke esoterie' binnen dit onderzoeksveld zijn plaats zou moeten hebben, maar dat is niet zo. Dezelfde term wordt ook wel in engere zin gebruikt en slaat dan op een diffuse verzameling geschriften over het paranormale, occulte wetenschappen, exotische wijsheidstradities en dergelijke."},{"page_url":"https://sk.wikipedia.org/wiki/Taeke_Taekema","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Taeke-taekema-1359929503.jpg","page_title":"Taeke Taekema","context_page_description":"Taeke Taekema celým menom Taeke Wiebe Doekes Taekema je súčasný holandský pozemný hokejista hrajúci na pozícii obrancu. Momentálne je hráčom klubu Amsterdam HBC."},{"page_url":"https://ms.wikipedia.org/wiki/Giurtelecu_%C5%9Eimleului","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Simleu_Silvaniei%2C_Salaj_Location.png","page_title":"Giurtelecu Şimleului","context_page_description":"Giurtelecu Şimleului ialah sebuah penempatan di Kaunti Sălaj, Romania."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Brieuc-de-Mauron","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Map_commune_FR_insee_code_56208.png","page_title":"Saint-Brieuc-de-Mauron","context_page_description":"Saint-Brieuc-de-Mauron är en kommun i departementet Morbihan i regionen Bretagne i nordvästra Frankrike. Kommunen ligger i kantonen Mauron som tillhör arrondissementet Vannes. År 2009 hade Saint-Brieuc-de-Mauron 354 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Kloster_Heiligenthal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Schwanfeld_Heiligenthal_Klosterkirche-001.jpg","page_title":"Kloster Heiligenthal","context_page_description":"Das Kloster Heiligenthal ist ein ehemaliges Kloster der Zisterzienserinnen in Schwanfeld in Bayern in der Diözese Würzburg."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_de_Solms","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Eleonore_zu_Solms-Hohensolms-Lich_1871.jpg","page_title":"Maison de Solms","context_page_description":"La Maison de Solms est une ancienne famille de la haute noblesse allemande, qui prétendait remonter à Othon, frère du roi Conrad Iᵉʳ de Germanie, tandis que son premier membre connu est le seigneur Marquardus de Sulmese, mentionné comme témoin au monastère de Schiffenberg à Giessen en 1129.\\nLes territoires de la maison de Solms avec immédiateté impériale mesuraient environ 40 km sur 24, et étaient situées sur les deux rives de la Lahn, près des terres de Nassau, de la Hesse et de Wetzlar. Le chef de la lignée de Braunfels est devenu Prince du Saint-Empire en 1742, celui de Hohensolms-Lich en 1792. Les principautés et comtés de la famille ont été médiatisées en 1806."},{"page_url":"https://fr.wikipedia.org/wiki/Castelnuovo_di_Garfagnana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/CastelnuovoGarfagnanaPanorama4.jpg","page_title":"Castelnuovo di Garfagnana","context_page_description":"Castelnuovo di Garfagnana est une commune italienne de la province de Lucques dans la région Toscane en Italie."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_del_districte_de_Nimes","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Course_camarguaise_-_Capelado_Le_Cailar_2013.jpg","page_title":"Llista de monuments del districte de Nimes","context_page_description":"Llista de monuments del districte de Nimes registrats com a monuments històrics, bé catalogats d'interès nacional o bé inventariats d'interès regional.\\nEls municipis més destacats estan separats en llistes corresponents. Vegeu:\\nLlista de monuments de Bellcaire\\nLlista de monuments de Nimes\\nLlista de monuments d'Usès"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%88%D8%B3%DB%8C_%D8%B3%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Moussa_Sow.jpg","page_title":"موسی سو","context_page_description":"موسی سو بازیکن فوتبال اهل سنگال است."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A7%D9%88%D9%84%D8%B3%D8%A7%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Tavelsas_kyrka.jpg","page_title":"تاولساس","context_page_description":"تاولساس یک منطقهٔ مسکونی در سوئد است که در Växjö Municipality واقع شده‌است."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D9%88%D8%B2%D9%87_%D9%88%DB%8C%DA%A9%D8%AA%D9%88%D8%B1%DB%8C%D8%A7_%D9%88_%D8%A2%D9%84%D8%A8%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Caffagiolo_Dish_with_maiolica_painter_VA_1717-1855.jpg","page_title":"موزه ویکتوریا و آلبرت","context_page_description":"موزهٔ ویکتوریا و آلبرت در لندن، انگلستان از برترین موزه‌های جهان به جهت داشتن ذخائر غنی آثار هنری، و بزرگ‌ترین موزهٔ جهان از نظر هنرهای تزئینی است. این موزه که مسکن دائمی مجموعهٔ بیش از ۴٫۵ میلیون اشیاء گوناگون است در سال ۱۸۵۲ تأسیس گردید و به نام ملکه ویکتوریا و پرنس آلبرت که در جوانی درگذشت نام‌گذاری شد. این موزه در منطقهٔ برامپتون لندن از شهرک سلطنتی کنزینگتون و چلسی، واقع شده‌است. این موزه از نهادهای عمدهٔ فرهنگی است. خدمات این موزه عبارتند از: موزهٔ تاریخ طبیعی، موزهٔ علوم و رویال آلبرت هال. موزهٔ ویکتوریا و آلبرت یک نهاد دولتی غیر دپارتمان است که با حمایت «وزارت فرهنگ، رسانه و ورزش» گردانیده می‌شود. مانند سایر موزه‌های ملی بریتانیا، بازدید و ورود به این موزه از سال ۲۰۰۱ به صورت رایگان بوده‌است.\\nموزهٔ ویکتوریا و آلبرت مساحتی برابر ۵٫۱ هکتار را پوشش می‌دهد. و دارای ۱۴۵ گالری‌است. گسترهٔ مجموعه‌های آن از ۵۰۰۰ سال آثار هنری، از دوران باستان تا به امروز، از فرهنگ‌های اروپا، شمال آمریکا، آسیا و شمال آفریقا."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%A4%E3%83%AB%E3%83%88%E3%83%B3%E3%83%BB%E3%82%BB%E3%83%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Ayrton_Senna_8_%28cropped%29.jpg","page_title":"アイルトン・セナ","context_page_description":"アイルトン・セナ・ダ・シルバは、ブラジル人のレーシング・ドライバー。F1世界選手権において、1988年・1990年・1991年と、計3度ワールドチャンピオンを獲得した。"},{"page_url":"https://id.wikipedia.org/wiki/Kota_Tual","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Wali_Kota_Tual_MM_Tamher.jpg","page_title":"Kota Tual","context_page_description":"Kota Tual adalah sebuah kota di Provinsi Maluku, Indonesia. Kota Tual pernah menjadi bagian dari Kabupaten Maluku Tenggara sebelum Undang-Undang Republik Indonesia Nomor 31 Tahun 2007 disahkan. Pembentukan Kota Tual sebagai daerah otonom pernah dipertentangkan secara hukum oleh beberapa pihak yang merasa tidak puas namun putusan Mahkamah Konstitusi Republik Indonesia menyatakan bahwa kota Tual tetap sah dan memenuhi syarat sebagai kota otonom. Kini pemerintahan kota di sana telah berjalan efektif. Kota terbesar kedua di provinsi Maluku ini, memiliki jumlah penduduk 88.633 jiwa ditahun 2019."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%87%D8%B1%D9%85%D8%A7_%D8%A8%D8%A7%D9%88%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Wien02_Meiereistra%C3%9Fe007_Stadion_2018-11-20_GuentherZ_GD_Bauma_%2802%29.jpg","page_title":"هرما باوما","context_page_description":"هرما باوما پرتاب‌گر نیزه اهل اتریش بود.\\nاز افتخارات وی میتوان به کسب مدال طلا پرتاب نیزه در بازی‌های المپیک تابستانی ۱۹۴۸ اشاره کرد."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%83%D1%81%D0%B0%D1%80_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Kusarchai_River.JPG","page_title":"Гусар (город)","context_page_description":"Гусар — город на севере Азербайджана, административный центр одноимённого района. Гусар расположен в предгорьях Большого Кавказа, на реке Кусарчай в 35 км к юго-западу от железнодорожной станции Худат и в 180 км от столицы страны — города Баку."},{"page_url":"https://en.wikipedia.org/wiki/Greasy_spoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/NYC_diner_Brooklyn.jpg","page_title":"Greasy spoon","context_page_description":"A greasy spoon is a small, cheap eatery – either an American diner or coffee shop, or a British or Irish cafe – typically specializing in fried foods and/or home-cooked meals. The term \\"greasy spoon\\" has been used in the United States since at least the 1920s; and is sometimes used in the United Kingdom to refer to a cafe or caff, which is not to be confused with the European term café which may mean coffeehouse or bar. According to the Oxford English Dictionary, the term \\"greasy spoon\\" originated in the United States and is now used in various English-speaking countries. In Ireland, the term is almost exclusively used in Ulster, especially throughout Northern Ireland and parts of County Donegal.\\nThe earliest appearance of the term in print, refers to events of an earlier time: a restaurant in Paris was visited daily by Robert Louis Stevenson in 1874.\\n\\"...the Cremerie in the Rue Delambre, - an eating-house much frequented by artists, and familiarly known as The Greasy Spoon...\\""},{"page_url":"https://en.wikipedia.org/wiki/Wechselburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Wechselburg_in_FG.png","page_title":"Wechselburg","context_page_description":"Wechselburg is a municipality in the district of Mittelsachsen, in Saxony, Germany. It is well known for its twelfth century Benedictine monastery, the\\nWechselburg Priory.\\nThe lordship and the castle were owned by the House of Schönburg from 1546 until 1945."},{"page_url":"https://simple.wikipedia.org/wiki/Saint-Jean-de-la-Motte","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/St_Jean_Motte_-_Eglise_01.jpg","page_title":"Saint-Jean-de-la-Motte","context_page_description":"Saint-Jean-de-la-Motte is a commune. It is found in the region Pays de la Loire in the Sarthe department in the west of France."},{"page_url":"https://en.wikipedia.org/wiki/Sumiyoshi-taisha","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Sumiyoshi-taisha%2C_keidai-2.jpg","page_title":"Sumiyoshi-taisha","context_page_description":"Sumiyoshi-taisha, also known as Sumiyoshi Grand Shrine, is a Shinto shrine in Sumiyoshi-ku, Osaka, Osaka Prefecture, Japan. It is the main shrine of all the Sumiyoshi shrines in Japan. However, the oldest shrine that enshrines the Sumiyoshi sanjin, the three Sumiyoshi kami, is the Sumiyoshi Shrine in Hakata.\\nIt is called Sumiyoshi-san or Sumiyossan by the locals, and is famous for the large crowds that come to the shrine on New Year's Day for hatsumōde.\\nSumiyoshi taisha enshrines the Sumiyoshi sanjin and Okinagatarashi-hime no Mikoto.\\nIt gives its name to a style of shrine architecture known as Sumiyoshi-zukuri."},{"page_url":"https://lv.wikipedia.org/wiki/Ponci_sh%C4%93ma","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Charles_Ponzi.jpg","page_title":"Ponci shēma","context_page_description":"Ponci shēma ir krāpnieciska kapitālieguldījumu shēma, kur tās operators izmaksā peļņu vecākiem investoriem no jaunāku investoru iemaksātiem līdzekļiem, nevis peļņu nesošas uzņēmējdarbības vai darbībām finanšu tirgos. Ponci shēmu operatori var būt gan uzņēmumi, gan privātpersonas un jaunu investoru uzmanība parasti tiek piesaistīta, piesolot lielu peļņu īsā laika periodā. Ponci shēmas ir balstītas uz pastāvīgu jaunu investoru piesaisti. Tiklīdz jauni investori shēmā līdzekļus vairs neiegulda, tā drīz vien sabrūk.\\nTā nosaukta Čarlza Ponci vārdā, kurš ar šādu shēmu kļuva pazīstams ASV 1920. gados.\\nKaut kādā mērā Ponci shēmām līdzīgi ir spekulatīvie burbuļi, kur cilvēki pērk kādu aktīvu pārliecībā, ka vēlāk to noteikti varēs pārdot dārgāk kādam citam. Taču spekulatīvos burbuļos nav viena centralizēta operatora, kas apkrāpj investorus, tos drīzāk var pielīdzināt masu hipnozei. Izņēmums ir pump and dump prakse.\\nPonci shēmas piemērs ir MMM piramīda Krievijā 1990. gados."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B5%B7%E9%87%8D%E6%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Reconstruction_of_the_temple_of_Jerusalem.jpg","page_title":"起重机","context_page_description":"起重機，指用吊鉤或其他取物裝置吊掛重物，在空間進行升降與運移等循環性作業的機械。起重機有很多分類，「吊車」、「塔吊」、「天車」、「行車」等俗稱指的就是起重機中的一類或幾類。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D9%88%D9%85%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Naser_al-Din_Qajar_2_Tuman_gold_coin.jpg","page_title":"تومان","context_page_description":"تومان یکای شمارش و یکای پول نیمه رسمی ایران است. تومان به طور پیوسته از قرن هفتم هجری تاکنون به عنوان یکای پول در ایران کاربرد داشته است و با وجود تغییر واحد پول ایران در سال ۱۳۰۸ به ریال، مردم همچنان از واحد شمارش تومان استفاده می‌کنند.\\nدر تاریخ ۱۵ اردیبهشت ۱۳۹۹ لایحه تغییر پول ملی در مجلس شورای اسلامی ایران تصویب شد و به این گونه که هر یک تومان صد قران و معادل ده \\"دیمن\\" شد."},{"page_url":"https://cs.wikipedia.org/wiki/Axiomatick%C3%A1_teorie_mno%C5%BEin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Dedekind_cut-_square_root_of_two.png","page_title":"Axiomatická teorie množin","context_page_description":"Axiomatická teorie množin je označení pro teorii, která formalizuje vlastnosti množin takovým způsobem, aby bylo možné pomocí množin zkonstruovat všechny matematické objekty, takže dokazatelná tvrzení této teorie budu přesně odpovídat všem platným matematickým výsledkům ze všech oblastí matematiky.\\nHlavní význam takových teorií je v tom, že staví na velmi solidní základ pojem „dokazatelné matematické tvrzení“ a tedy poskytují užitečné vodítko při ověřování, zda nějaký matematický důkaz je korektní.\\nNejpoužívanější axiomatická teorie množin je jednak Zermelova-Fraenkelova teorie množin a dále ZF s přidaným axiomem výběru. ZFC je všeobecně uznávána jako teorie, která přesně popisuje platné matematické pravdy, tj. matematická věta je pokládána za pravdivou, právě když je dokazatelná v ZFC.\\nAplikace Gödelových vět o neúplnosti na axiomatickou teorii množin přináší vhledy na podstatu a filosofii matematiky, neboť z ní vyplývá, že sebelepší axiomatika teorie množin bude vždy obsahovat nerozhodnutelná tvrzení a že pokud teorie, kterou chceme používat k popisu všech matematických pravd, je bezesporná, nelze tuto bezespornost dokázat."},{"page_url":"https://en.wikipedia.org/wiki/Vasyl_Stankovych","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Vasyl_Stankovych_1972.jpg","page_title":"Vasyl Stankovych","context_page_description":"Vasyl Stankovych is a retired Ukrainian fencer. He competed at the 1968, 1972 and 1976 Olympics and won team silver medals in the foil in 1968 and 1972; in 1976 he placed fourth both individually and with the Soviet team. At the world championships Stankovych won five gold medals in the foil between 1969 and 1974."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%86%D1%8F%D0%B3_%D0%A1%D0%BB%D0%B0%D0%B2%D0%B0%D0%BA%D1%96%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Obal_Matica.jpg","page_title":"Сцяг Славакіі","context_page_description":"Дзяржа́ўны сцяг Слава́цкай Рэспу́блікі, сцяг Слава́кіі — сцяг-трыкалор, зацверджаны 1 верасня 1992 г. і ўпершыню ўзняты 3 верасня 1992 г., які складаецца з трох гарызантальных палос панславісцкіх колераў: верхняя паласа белая, сярэдняя — сіняя, ніжняя — чырвоная. З мэтай адрознення сцяга ад сцягоў іншых славянскіх краін на яго нанесены нацыянальны герб Славакіі: неагатычны шчыт знаходзіцца бліжэй да дрэўка ад цэнтра сцяга, цалкам перасякаючы сярэднюю паласу і крыху заходзячы на верхнюю і ніжнюю палосы. Бакі сцяга Славакіі суадносяцца між сабою як 2:3. Гэты жа сцяг памерамі 1,5 м на 1 м з'яўляецца суднаходным у дачыненні да славацкага воднага транспарту. Сцяг Славацкай Рэспублікі з'яўляецца адным з чатырох дзяржаўных сімвалаў Славацкай Рэспублікі.\\nЗ 1 мая 2004 г. разам са сцягам Славакіі вывешваецца сцяг Еўропы."},{"page_url":"https://it.wikipedia.org/wiki/Gorrevod","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/%C3%89glise_Sts_Pierre_Paul_Gorrevod_14.jpg","page_title":"Gorrevod","context_page_description":"Gorrevod è un comune francese di 796 abitanti situato nel dipartimento dell'Ain della regione dell'Alvernia-Rodano-Alpi."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AD%D9%85%D8%A7%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Noria_and_houses_in_Hama%2C_Syria.JPG","page_title":"حماه","context_page_description":"حماه هى مدينه فى تقع شمال غرب سوريا على نهر العاصى و هى مركز محافظة حماه."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%8A%D9%83%D9%8A_%D8%AF%D8%B1%D9%8A%D9%81%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Vicki_Draves_1948b.jpg","page_title":"فيكي دريفز","context_page_description":"فيكتوريا مانالو دريفز ‏ والشهيرة باسم فيكي دريفز ‏ غواصة أمريكية من أصول فلبينية. فازت بميداليات ذهبية في كل من منصة ومنط الغطس في دورة الألعاب الأولمبية الصيفية 1948 في لندن. وقد أصبحت بذلك أول امرأة تحصل على ميداليات ذهبية لكل من المنصة التي يبلغ ارتفاعها عشرة أمتار ولوحة الانطلاق التي يبلغ طولها ثلاثة أمتار. بالإضافة إلى ذلك، أصبحت دريفز أول امرأة أمريكية تفوز بميداليتين ذهبيتين في الغطس، وأول أمريكية آسيوية تفوز بميداليات ذهبية أولمبية."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9D%AD%E5%B7%9E%E5%B0%91%E5%B9%B4%E5%84%BF%E7%AB%A5%E5%9B%BE%E4%B9%A6%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/%E6%9D%AD%E5%B7%9E%E5%B0%91%E5%B9%B4%E5%84%BF%E7%AB%A5%E5%9B%BE%E4%B9%A6%E9%A6%86_%E4%BA%8C%E6%A5%BC_%283%29.jpg","page_title":"杭州少年儿童图书馆","context_page_description":"杭州少年儿童图书馆是一家位于中华人民共和国浙江省杭州市的一家公共图书馆，隶属于杭州市文化局，是文化和旅游部评定的国家一级图书馆。成立于1982年1月16日，前身为1928年成立的浙江图书馆新民分馆儿童阅览室。主馆舍新馆位于西湖区曙光路75号，于1997年12月31日奠基，自1999年6月1日起开馆。占地面积5482平方米。2019年7月16日，于上城区南宋御街成立“尚善之家”分馆。"},{"page_url":"https://en.wikipedia.org/wiki/Ar_Rahaliyah","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/RahaliyahIraq.JPG","page_title":"Ar Rahaliyah","context_page_description":"Ar Rahaliyah is an Iraqi town in Al-Anbar Governorate, near the western shore of Lake Milh.\\nIn 1921 Rahaliya, along with Shithathah, was noted for its \\"immense\\" groves for palm date production."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D1%80%D0%B1%D0%B0%D1%81_(%D1%80%D0%B8%D1%98%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Vrbbbas.jpg","page_title":"Врбас (ријека)","context_page_description":"Врбас је ријека која извире испод планине Зец и након 250 km дугог тока се улијева у ријеку Саву код Српца, на 96 m надморске висине. Површина слива ове ријеке износи око 5.900 km² и на њеним обалама живи око 500 хиљада становника. Прије Бање Луке, Врбас пролази кроз кањон и бројне клисуре, који су заштићени Законом о заштити природних вриједности из 1955. године. Тече кроз: Скопљанску котлину, Виначку клисуру, Јајачку котлину, кањонску долину Тијесно, Бањалучку котлину а доњим током преко своје макроплавине Лијевче поље. Слив је издуженог облика дужине 150 km и просјечне ширине 70 km. Просјечна надморска висина је 690 м.н.в., а највиша тачка у сливу је на око 2100 м.н.в. Просјечне годишње падавине крећу се одо око 800 l/m2 при ушћу Врбаса у Саву до око 1500 l/m2 на јужном дијелу слива. Просјечно вишегодишње отицање са слива ријеке Врбаса износи око 132 m³/s. Просјечно специфично отицање износи око 20,7 l/s/km².\\nИма 36 директних притока дужих од 10 km, а најзначајније су Плива, Угар, Црна ријека и Врбања."},{"page_url":"https://hu.wikipedia.org/wiki/Helmuth_Karl_Bernhard_von_Moltke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Die_Gartenlaube_%281873%29_b_394.jpg","page_title":"Helmuth Karl Bernhard von Moltke","context_page_description":"Helmuth Karl Bernhard von Moltke gróf, az „idősebb Moltke” porosz királyi tábornagy, 1858–1871 között a porosz királyi haderő vezérkari főnöke, majd 1888-ig a német császári nagyvezérkar főnöke. Kiváló katonai stratéga volt. A porosz haderő az ő hadvezéri irányításával vívta ki háborús győzelmeit az 1864-es porosz–osztrák–dán háborúban, az 1866-os porosz–osztrák háborúban és az 1870–71-es porosz–francia háborúban. Kiemelkedő szerepet játszott – Bismarck kancellár mellett – a Német Császárság 1871-es létrehozásában."},{"page_url":"https://es.wikipedia.org/wiki/70.%C2%AA_Asamblea_Mundial_de_la_Salud","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Flag_of_WHO.svg","page_title":"70.ª Asamblea Mundial de la Salud","context_page_description":"La 70.ª Asamblea Mundial de la Salud se reúne en Ginebra del 22 al 31 de mayo de 2017."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9F%B1%E5%8F%B2%E5%9D%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Zhushi_Fang_in_Taizhou_09_2012-10.JPG","page_title":"柱史坊","context_page_description":"柱史坊位於中國江蘇省泰州市海陵區泰山公園東南隅、泰山橋西側，原為明代隆慶進士、監察御史蔣科為其父蔣行請封而建，位於城中升仙橋南，1951年被移至現址並改作烈士塔前牌坊，中間石板上的「柱史」二字被改成「永垂不朽」，後為配合泰山嶽廟的建設，正反兩面又被重新改成「精忠報國」和「氣壯山河」。\\n該建築為三間四柱式石牌樓，以同粗的抹角方形柱承托廡殿頂樓屋面，中部寬脊上安寶瓶，總高約6米，寬7.8米，中門寬約3米，邊門寬約1.4米，因中門立柱兩側前後的須彌座上以回民騎獅子的形象作倚柱石支撐，又被俗稱為回子牌坊，倚柱石在移建時已被拆下，現散置在牌樓內側的道路兩旁。"},{"page_url":"https://en.wikipedia.org/wiki/1850","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Hans_von_Pechmann.jpg","page_title":"1850","context_page_description":"1850 was a common year starting on Tuesday of the Gregorian calendar and a common year starting on Sunday of the Julian calendar, the 1850th year of the Common Era and Anno Domini designations, the 850th year of the 2nd millennium, the 50th year of the 19th century, and the 1st year of the 1850s decade. As of the start of 1850, the Gregorian calendar was 12 days ahead of the Julian calendar, which remained in localized use until 1923."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B8%D0%B5%D0%B3%D0%BE_%D0%9C%D0%B0%D1%80%D0%B0%D0%B4%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Maradona-Mundial_86_con_la_copa.JPG","page_title":"Диего Марадона","context_page_description":"Диего Армандо Марадона е бивш аржентински футболист и настоящ треньор, една от най-големите и обичани, но и противоречиви звезди на футбола.\\nНай-добрият футболист на XX век по гласуване на официалния сайт на ФИФА, където той набира 53,6 % от гласовете.\\nНай-добрият футболист на световни първенства, според вестник Таймс.\\nВторият сред най-добрите играчи в историята на футбола по версия на списание „Плакар“ от 1999 г.\\nВторо място сред най-добрите футболисти на XX век според най-реномираните списания – „Франс футбол“\\n, Гуерин спортиво, версия на World Soccer.\\nПо версия на футболната Комисия на ФИФА, Марадона е третият сред най-добрите футболисти на XX век,\\n. Член на списъка ФИФА 100.\\nВключен е в идеалния тим от 11 живи легенди на футбола\\nПървият притежател на почетна „Златна топка“ на „Франс футбол“.\\nЧлен на Залата на славата на италианския футбол в номинацията „Най-добър чуждестранен играч“\\n.\\nПрез 21-годишната си кариера като футболист играе в шест отбора, сред които Бока Хуниорс, Барселона и Наполи. За клубовете участва в 491 мача и отбелязва 210 гола.\\nУчаства на четири световни първенства от 1982 до 1994, като през 1986 година става шампион, а през 1990 – вицешампион."},{"page_url":"https://ca.wikipedia.org/wiki/Apol%C2%B7linar_de_Ravenna","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Relics_of_St_Appollinarus_were_found_here.jpg","page_title":"Apol·linar de Ravenna","context_page_description":"Apol·linar de Ravenna fou el primer bisbe de Ravenna. És venerat com a sant per diverses confessions cristianes."},{"page_url":"https://en.wikipedia.org/wiki/Interior_architecture","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Battersea_Power_Station_-_geograph.org.uk_-_829933.jpg","page_title":"Interior architecture","context_page_description":"Interior architecture is the design of a building or shelter from inside out, or the design of a new interior for a type of home that can be fixed. It can refer to the initial design and plan used for a building's interior, to that interior's later redesign made to accommodate a changed purpose, or to the significant revision of an original design for the adaptive reuse of the shell of the building concerned. The latter is often part of sustainable architecture practices, whereby resources are conserved by \\"recycling\\" a structure through adaptive redesign.\\nGenerally referred to as the spatial art of environmental design, interior architecture also refers to the process by which the interiors of buildings are designed to address all aspects of the human use of their structural spaces. Put simply, interior architecture is the design of an interior in architectural terms.\\nInterior architecture may refer to:\\nthe art and science of designing and erecting buildings and their interiors, along with other related physical features, by a licensed architect."},{"page_url":"https://fr.wikipedia.org/wiki/L%27Isle-Arn%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Map_commune_FR_insee_code_32157.png","page_title":"L'Isle-Arné","context_page_description":"L'Isle-Arné est une commune française située dans le département du Gers, en région Occitanie."},{"page_url":"https://en.wikipedia.org/wiki/Dolmabah%C3%A7e_Palace","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Dolmabahce%2C_Istanbul%2C_Turchia.JPG","page_title":"Dolmabahçe Palace","context_page_description":"Dolmabahçe Palace located in the Beşiktaş district of Istanbul, Turkey, on the European coast of the Strait of Istanbul, served as the main administrative center of the Ottoman Empire from 1856 to 1887 and from 1909 to 1922."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_fortificat%C4%83_din_Reghin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Biserica_evanghelica_din_Reghin_%2827%29.jpg","page_title":"Biserica fortificată din Reghin","context_page_description":"Biserica evanghelică din Reghin este un ansamblu de monumente istorice aflat pe teritoriul municipiului Reghin.\\nAnsamblul este format din două monumente:\\nBiserica evanghelică\\nCasa parohială"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D5%AB%D5%A3%D5%B8%D5%A4%D5%A1_(%D5%A3%D5%A5%D5%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Tigoda.jpg","page_title":"Տիգոդա (գետ)","context_page_description":"Տիգոդա, գետ Ռուսաստանում ։"},{"page_url":"https://de.wikipedia.org/wiki/St._Leodegar_im_Hof","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Chorgest%C3%BChl_0604.jpg","page_title":"St. Leodegar im Hof","context_page_description":"Die Hofkirche St. Leodegar ist eines der Wahrzeichen der Stadt Luzern in der Schweiz. Die Hofkirche ist die Hauptkirche der römisch-katholischen Pfarrei St. Leodegar im Hof, einer der acht katholischen Stadtpfarreien Luzerns und sie ist zugleich die Stiftskirche des Kollegiat-Stifts St. Leodegar. Die Hofkirche wurde von 1633 bis 1639 teilweise auf den Fundamenten der 1633 abgebrannten romanischen Basilika gebaut und ist eine der wenigen Kirchen, die während des Dreissigjährigen Kriegs nördlich der Alpen gebaut wurden und eine der grössten und kunsthistorisch wertvollsten Kirchen der deutschen Spätrenaissance."},{"page_url":"https://pl.wikipedia.org/wiki/Senatorowie_VII_kadencji_Senatu_Rzeczypospolitej_Polskiej","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Maria_Pa%C5%84czyk-Pozdziej_2007.jpg","page_title":"Senatorowie VII kadencji Senatu Rzeczypospolitej Polskiej","context_page_description":"Senatorowie VII kadencji zostali wybrani 21 października 2007 oraz w wyniku wyborów uzupełniających 22 czerwca 2008, 20 czerwca 2010 i 6 lutego 2011. Senatorowie złożyli ślubowanie na pierwszym posiedzeniu Senatu VII kadencji wyznaczonym na 5 listopada 2007, a ich kadencja upłynęła w przeddzień pierwszego posiedzenia następnego Sejmu, tj. 7 listopada 2011.\\nW wyniku wyborów parlamentarnych w 2007 wybrano 100 senatorów. Zostali oni wyłonieni w głosowaniu większościowym w 40 okręgach wyborczych, w których wybierano od 2 do 4 senatorów na zasadzie większości względnej. 60 nowo wybranych senatorów reprezentowało Platformę Obywatelską, 39 kandydowało z ramienia Prawa i Sprawiedliwości, 1 mandat uzyskał kandydat niezależny. Wśród nich znalazło się 8 kobiet i 92 mężczyzn. 44 osoby po raz pierwszy uzyskały mandaty w polskim parlamencie, 56 osób posiadało doświadczenie parlamentarne wynikające z zasiadania w Sejmie lub Senacie.\\n1. posiedzenie Senatu VII kadencji rozpoczęło się w dniu 5 listopada 2007, funkcję marszałka seniora pełnił najstarszy wiekiem senator – Ryszard Bender.\\nW trakcie kadencji pięciokrotnie w trzech terminach przeprowadzono wybory uzupełniające."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AD%E0%B8%B8%E0%B8%97%E0%B8%A2%E0%B8%B2%E0%B8%99%E0%B9%81%E0%B8%AB%E0%B9%88%E0%B8%87%E0%B8%8A%E0%B8%B2%E0%B8%95%E0%B8%B4%E0%B8%A0%E0%B8%B9%E0%B9%80%E0%B8%81%E0%B9%89%E0%B8%B2-%E0%B8%A0%E0%B8%B9%E0%B8%9E%E0%B8%B2%E0%B8%99%E0%B8%84%E0%B8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%E0%B8%84%E0%B8%A7%E0%B8%B2%E0%B8%A1%E0%B9%80%E0%B8%8A%E0%B8%B7%E0%B9%88%E0%B8%AD%E0%B8%82%E0%B8%AD%E0%B8%87%E0%B8%AD%E0%B8%B8%E0%B8%97%E0%B8%A2%E0%B8%B2%E0%B8%99%E0%B9%81%E0%B8%AB%E0%B9%88%E0%B8%87%E0%B8%8A%E0%B8%B2%E0%B8%95%E0%B8%B4%E0%B8%A0%E0%B8%B9%E0%B9%80%E0%B8%81%E0%B9%89%E0%B8%B2-%E0%B8%A0%E0%B8%B9%E0%B8%9E%E0%B8%B2%E0%B8%99%E0%B8%84%E0%B8%B3.jpg","page_title":"อุทยานแห่งชาติภูเก้า-ภูพานคำ","context_page_description":"อุทยานแห่งชาติภูเก้า-ภูพานคำ ตั้งอยู่ในท้องที่ของจังหวัดหนองบัวลำภู พื้นที่ตอนล่างของจังหวัดอุดรธานี และตอนบนของจังหวัดขอนแก่น\\nอุทยานแห่งชาติภูเก้า-ภูพานคำ เป็นอุทยานแห่งชาติลำดับที่ 50 ของประเทศไทย"},{"page_url":"https://eo.wikipedia.org/wiki/Serpu%C4%A5ovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Flag_of_Serpukhov_%28Moscow_oblast%29.png","page_title":"Serpuĥovo","context_page_description":"Serpuĥovo estas urbo en Moskva provinco en Rusio.\\nKodo de OKATO de la urbo estas 46470.\\nLa urbo estis fondita en jaro 1328.\\nĜi havas statuson de urbo ekde jaro 1781.\\nLa loka tempo estas la sama kiel moskva tempo.\\nGeografiaj koordinatoj de la urbo estas 54° 55′ N 37° 24′ O.\\nLa urbo estas ĉe rivero Nara, apud ĝia enenfluo en riveron Oka.\\nEn la urbo estas fervoja stacio en linio Moskvo - Tula.\\nEn jaro 1959 la urbo havis 106 mil loĝantojn.\\nEn jaro 2002 la urbo havis 131,1 mil loĝantojn."},{"page_url":"https://eu.wikipedia.org/wiki/Orbaizetako_ola","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Orbaitzetako_ola_erreka.jpg","page_title":"Orbaizetako ola","context_page_description":"Orbaizetako Munizioen Errege Fabrika, eskuarki Orbaizetako ola deitua, Espainiako Koroaren arma fabrika izan zen, Orbaizetan kokatutakoa, Nafarroa Garaian. 1784an eraiki zen, Karlos III.a Espainiakoaren aginduz, eta 1884an gelditu zen behin betiko. Nafarroako Gobernuak Kultura Intereseko Ondasun izendatu zuen 2008an."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%8F%AF%E6%B0%91%E5%9C%8B%E5%9C%8B%E5%8B%99%E7%B8%BD%E7%90%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Cao_Kun.jpg","page_title":"中華民國國務總理","context_page_description":"中華民國國務總理是中華民國國務院的首長，也是北洋政府時期的政府首腦。有些國務總理名義上曾代行大總統職權，但實權卻握在軍閥手上。此外，袁世凱擔任大總統時，曾將國務總理改設為「國務卿」，此處亦一併收錄。"},{"page_url":"https://es.wikipedia.org/wiki/Almer%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Almeria_Plaza_de_la_Constitucion_fcm.jpg","page_title":"Almería","context_page_description":"Almería es una ciudad y municipio español, capital de la provincia homónima, en la comunidad autónoma de Andalucía. Es el centro neurálgico de la Comarca Metropolitana de Almería, en el extremo sureste de la península ibérica y de la comarca turística de Almería-Cabo de Gata-Níjar.​ La rodean por el oeste la sierra de Gádor, por el norte Sierra Alhamilla y por el este el valle y delta del río Andarax y, más allá, una llanura que culmina en la sierra de Cabo de Gata. Al sur, su puerto y litoral se abren a una amplia bahía sobre el mar Mediterráneo.​\\nEs la sede del partido judicial n.º 1 de la provincia y de la diócesis que lleva su nombre.​​ En 2005 fue asimismo sede de los XV Juegos Mediterráneos.​\\nFue fundada en 955 d. C. por Abderramán III en un emplazamiento dominado anteriormente por otras urbes como la ibera Urci o la romana Portus Magnus y desempeñó un papel fundamental durante el califato de Córdoba, llegando a ser el puerto más importante del al-Ándalus omeya. Alcanzó su máximo esplendor durante la taifa, en el siglo XI, convirtiéndose bajo el reinado de Almotacín en un emporio comercial y cultural."},{"page_url":"https://ca.wikipedia.org/wiki/Cyanolyca","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/XanthuraQuindiunaKeulemans.jpg","page_title":"Cyanolyca","context_page_description":"Cyanolyca és un gènere d'ocells de la família dels còrvids."},{"page_url":"https://fi.wikipedia.org/wiki/Wilier_Triestina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Wilier_triestina_logo.png","page_title":"Wilier Triestina","context_page_description":"Wilier Tristina on italialainen maantiepyörävalmistaja. Pietro Dal Molin perusti yrityksen vuonna 1906 Bassano del Grappassa. Nykyisin yritys toimii Rossano Venetossa.\\nYrityksen nimi on muodostettu lauseesta \\"W |l’Italia liberata e redenta\\", jossa W on lyhennys sanasta \\"Viva!\\". Suomeksi lause tarkoittaa \\"kauan eläköön Italia, vapaana ja vapautettuna\\".\\nWilier Triestina toimitti aiemmin UCI ProTouriin osallistuvan Lampre-ISD-tallin pyörät. Yrityksellä oli voimassa oleva sopimus kauden 2013 loppuun saakka, mutta Wilierin mukaan Lampre rikkoi sopimuksen ehtoja ja tämän johdosta Wilier irtisanoi sopimuksen.\\nVuoden 2008 maantieajon maailmanmestari Alessandro Ballan ja toiseksi sijoittunut Damiano Cunego käyttivät kyseisessä kilpailussa Wilierin pyöriä."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A8%D1%8D%D1%9E%D0%B4%D1%8D_(%D0%BA%D0%B0%D0%BC%D1%83%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Klagstorp.jpg","page_title":"Шэўдэ (камуна)","context_page_description":"Камуна Шэўдэ — адміністрацыйна-тэрытарыяльная адзінка мясцовага самакіравання, якая знаходзіцца ў лене Вестра-Гёталанд у паўднёва-заходняй Швецыі.\\nШэўдэ 152-ая па памеры тэрыторыі камуна Швецыі. Адміністрацыйны цэнтр камуны — горад Шэўдэ."},{"page_url":"https://de.wikipedia.org/wiki/Oneida_County_(Idaho)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Samaria_Idaho_Historic_District.jpeg","page_title":"Oneida County (Idaho)","context_page_description":"Oneida County ist ein County im Bundesstaat Idaho der Vereinigten Staaten. Der Verwaltungssitz ist Malad City."},{"page_url":"https://hu.wikipedia.org/wiki/Cs%C3%BClleng","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Isatis_tinctoria_MHNT.BOT.2011.3.12.jpg","page_title":"Csülleng","context_page_description":"A csülleng vagy festő csülleng egy növény, melyet kékfestésre használtak.\\nA csülleng az ókori idők óta fontos forrása volt a kék színnek. Termesztették Európa-szerte, kiváltképp Nyugat- és Dél-Európában. A középkori időkben jelentős csüllengtermesztő területek voltak Angliában, Németországban és Franciaországban. Települések gazdagodtak meg a csüllengkereskedelemben, mint például Toulouse. A csüllenget idővel felváltotta a jobb színtartó képességgel bíró indigó, majd a kora 20. században mindkettő helyett a szintetikus kék színek kezdtek teret hódítani."},{"page_url":"https://de.wikipedia.org/wiki/PAS_Stadium","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Pas_Stadium%2C_Tehran.PNG","page_title":"PAS Stadium","context_page_description":"Das PAS Stadium ist ein Fußballstadion mit Leichtathletikanlage im Stadtteil Ekbātān der iranischen Hauptstadt Teheran."},{"page_url":"https://uk.wikipedia.org/wiki/Oakland_(%D0%B0%D0%B2%D1%82%D0%BE%D0%B2%D0%B8%D1%80%D0%BE%D0%B1%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/OaklandMotorCar.jpg","page_title":"Oakland (автовиробник)","context_page_description":"Oakland — з 1907 року американський виробник автомобілів. Штаб-квартира розташована в місті Понтіак, штат Мічиган. У 1909 році компанію купує фірма General Motors. У 1931 році компанія припинила виробництво автомобілів."},{"page_url":"https://es.wikipedia.org/wiki/Gimnasia_r%C3%ADtmica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Punteras.jpg","page_title":"Gimnasia rítmica","context_page_description":"La gimnasia rítmica es una disciplina deportiva que combina elementos de ballet, gimnasia y danza, así como el uso de diversos aparatos como la cuerda, el aro, la pelota, las mazas y la cinta.​\\nEn este deporte se realizan tanto competiciones como exhibiciones en las que la gimnasta se acompaña de música para mantener un ritmo en sus movimientos, realizando un montaje con o sin aparato. La gimnasia rítmica desarrolla la armonía, la gracia y la belleza mediante movimientos creativos, traducidos en expresiones personales a través de la combinación musical, teatral y técnica, que transmite, principalmente, satisfacción estética a los espectadores. Practicada principalmente por mujeres, en los últimos años está aumentando el número de practicantes masculinos. Las pruebas se realizan sobre un tapiz y la duración de los ejercicios es de aproximadamente 90 segundos en la modalidad individual y de 150 en la de conjuntos."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B2%A0%EB%84%A4%EB%94%95%ED%8A%B8_%EB%B0%94%EA%B7%B8%EB%84%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Benedikt_Wagner_2014_European_Championships_SMS-EQ_t144031.jpg","page_title":"베네딕트 바그너","context_page_description":"베네딕트 바그너는 독일의 펜싱 선수로 주 종목은 사브르이다. 그는 2012년 하계 올림픽의 남자 사브르 개인전에 참가했는데, 16강전에서 팀동료 니콜라스 림바흐에 패하였다. 단체전에서 그는 팀 동료와 함께 출전하였는데, 이 토너먼트 금메달을 차지한 대한민국과의 첫판에서 패하며 탈락하였다."},{"page_url":"https://hu.wikipedia.org/wiki/Rom%C3%A1nia_mad%C3%A1rfajainak_k%C3%A9pt%C3%A1ra","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Tarabusino%2C_giovane_maschio_%28Casale%29.jpg","page_title":"Románia madárfajainak képtára","context_page_description":"A világon élő mintegy 10 000 madárfaj közül a Romániában jelenleg 384 fajt tartanak nyilván."},{"page_url":"https://en.wikipedia.org/wiki/Principality_of_Samos","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/2011_Dimos_Samou.png","page_title":"Principality of Samos","context_page_description":"The Principality of Samos was an autonomous tributary state of the Ottoman Empire from 1834 to 1912. The island of Samos participated in the Greek War of Independence and had successfully resisted several Turkish and Egyptian attempts to occupy it, but it was not included with the boundaries of the newly independent Kingdom of Greece after 1832. Instead, in 1834 the island was granted self-government as a semi-independent state.\\nTributary to the Ottoman Empire, paying the annual sum of £2700, it was governed by a Christian of Greek descent though nominated by the Porte, who bore the title of \\"Prince\\". The prince was assisted in his function as chief executive by a 4-member Senate. These were chosen by him out of eight candidates nominated by the four districts of the island: Vathy, Chora, Marathokampos, and Karlovasi. The actual legislative power belonged to a chamber of 36 deputies, presided over by the Greek Orthodox Metropolitan. The seat of the government was the port of Vathy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%80%D0%BA_%D0%93%D0%B5%D1%80%D0%BE%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/%D0%A1%D1%82%D0%B5%D0%BB%D0%B0_%D0%93%D0%B5%D1%80%D0%BE%D1%97%D0%B2_%28%D0%B2%D1%81%D0%B5%D1%80%D0%B5%D0%B4%D0%B8%D0%BD%D1%96%29.jpg","page_title":"Парк Героев","context_page_description":"Парк Героев — парк, Соцгород, Металлургический район, Кривой Рог, Днепропетровская область, Украина.\\nПарк Героев — излюбленное место жителей района и города. В праздничные дни здесь проходят концерты, выставки, ярмарки и спортивные соревнования. В парк выходят на пленэр ученики находящейся рядом художественной школы № 1.\\nПарк ограничен проспектом Металлургов, улицами Героев АТО, Владимира Бызова и Хабаровской. На парк выходит улица Виталия Матусевича. На территории парка по проспекту Металлургов находится остановка общественного транспорта, по улице Героев АТО есть разворотное кольцо трамвая.\\nНа территории парка располагаются:\\nСтела Героев;\\nПамятник воинам-интернационалистам;\\nКрупнейшие в мире цветочные часы.\\nАдрес парка: Кривой Рог, просп. Металлургов.\\nДополнительные услуги:\\nдетская площадка;\\nобщественная уборная."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%84%D8%AA%D9%86%D8%A8%D8%B1%D8%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/MOMap-doton-Altenburg.png","page_title":"ألتنبرغ","context_page_description":"التنبرغ ‏ هي مدينة أمريكية تقع في ولاية ميزوري. تبلغ مساحة هذه المدينة 2.5،ويبلغ عدد سكانها 309 نسمة حسب إحصاء سنة 2010 م 309.تشير إحصاءات سنة 2000م بأن الكثافة السكانية في هذه المدينة تقدر بـ نسمة/كم2"},{"page_url":"https://ro.wikipedia.org/wiki/Prim-ministrul_Fran%C8%9Bei","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Necker%2C_Jacques%2C_par_Boillet%2C_BNF_Gallica.jpg","page_title":"Prim-ministrul Franței","context_page_description":"În Franța, prim-ministrul este șeful guvernului din A V-a Republică și al Consiliului Miniștrilor. Este desemnat de președintele Franței. Această funcție era numită Președinte al Consiliului în perioada celor două Constituții franceze precedente, doar puterile diferând. Reședința prim-ministrului este Palatul Matignon, situat în arondismentul 7 din Paris. Din această cauză, serviciile prim-ministrului sunt deseori numite „Matignon” prin metonimie."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%BC%D1%8F%D0%BD%D0%B5_%D0%B2_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/StasNamin2009.jpg","page_title":"Армяне в России","context_page_description":"Армяне в России или российские армяне — жители Российской Федерации армянского происхождения. Согласно переписи 2010 года, в России проживало более 1,700,000 армян, из которых свыше 1,182,000 армян-граждан России и 515,000-граждан Армении:\\n, то есть 0,86 % от общего населения России, согласно данным официальной переписи населения. По оценке «Союза армян России», число армянской диаспоры в России превышает 2,5 млн человек. В ряде своих выступлений президент России В. В. Путин, говоря о численности армян в России, указывал на цифру «около 3 миллионов человек». Около половины российских армян компактно проживают в четырех южных субъектах РФ — Краснодарском, Ставропольском краях, Ростовской области."},{"page_url":"https://hu.wikipedia.org/wiki/Alpha_Blondy","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/AlphaBlondyAtSolidays2008.jpg","page_title":"Alpha Blondy","context_page_description":"Alpha Blondy, született: Seydou Koné nemzetközileg ismert elefántcsontparti reggae énekes.\\nAlpha Blondy dalaiban saját dioula nyelvén, franciául, angolul és néha arabul és héberül énekel. A dalszövegeinek gyakran politikai tartalmuk van, humorral fűszerezve.\\nGyakran használja az általa alkotott democrature szót egyes afrikai kormányok jellemzésére."},{"page_url":"https://es.wikipedia.org/wiki/Mota_del_Cuervo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Santa_Rita_en_Mota_de_Cuervo_%28DavidDaguerro%29.jpg","page_title":"Mota del Cuervo","context_page_description":"Mota del Cuervo es un municipio y localidad española de la provincia de Cuenca, en la comunidad autónoma de Castilla-La Mancha. Ubicado en la comarca de La Mancha, cuenta con una población de 5990 habitantes. Su rasgo más característico son sus siete molinos de viento que se sitúan en la loma a cuyos pies se asienta el pueblo. Entre sus costumbres destaca la celebración de la fiesta de Nuestra Señora de la Antigua de Manjavacas, declarada de interés turístico nacional. La localidad es conocida turísticamente como «El Balcón de la Mancha»."},{"page_url":"https://fi.wikipedia.org/wiki/Hyesan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/%E9%95%B7%E6%81%B5%E5%9B%BD%E9%9A%9B%E5%A4%A7%E6%A9%8B.jpg","page_title":"Hyesan","context_page_description":"Hyesan on Pohjois-Korean Ryanggangin maakunnan pääkaupunki. Se sijaitsee Jalujoen varrella Kiinan rajalla Baekduvuoren eteläpuolella. Vuoden 2008 väestönlaskennan mukaan kaupungissa oli 192 680 asukasta."},{"page_url":"https://de.wikipedia.org/wiki/Blitzb%C3%BCndel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/2012-10-12_16-46-36-musee-histoire-belfort-aigle.jpg","page_title":"Blitzbündel","context_page_description":"Als Blitzbündel wird in der bildenden Kunst ein Attribut antiker Himmels- und Wettergötter bezeichnet, das aus stilisierten Blitzstrahlen besteht. Blitzbündel waren ein Sinnbild für den Himmelsgott, der als Blitzeschleuderer und Donnerer über Götter und Menschen herrschte. In der Heraldik wird das Blitzbündel als Donnerkeil bezeichnet."},{"page_url":"https://en.wikipedia.org/wiki/List_of_University_of_Toronto_buildings","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/T.M._Harris_House.JPG","page_title":"List of University of Toronto buildings","context_page_description":"The University of Toronto is made up of several academic and administrative buildings at each of its three campuses."},{"page_url":"https://fr.wikipedia.org/wiki/Upton_Park_(Londres)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Green_Street%2C_Upton_Park%2C_London_E13_-_geograph.org.uk_-_1471336.jpg","page_title":"Upton Park (Londres)","context_page_description":"Upton Park est un district de l'arrondissement de Newham, dans l'Outer London."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AF%8C%E5%A3%AB%E3%83%95%E3%82%A4%E3%83%AB%E3%83%A0%E3%81%AE%E3%82%AB%E3%83%A1%E3%83%A9%E8%A3%BD%E5%93%81%E4%B8%80%E8%A6%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Fuji_Zoom_Cardia_Super_115.JPG","page_title":"富士フイルムのカメラ製品一覧","context_page_description":"富士フイルムのカメラ製品は富士フイルムの開発、発売したカメラ、レンズ製品の一覧。ただし大判用レンズは富士フイルム大判用レンズの一覧、引き伸ばし用レンズは富士フイルム引き伸ばし用レンズの一覧、デジタルカメラ製品は富士フイルムのデジタルカメラ製品一覧を参照のこと。"},{"page_url":"https://fr.wikipedia.org/wiki/Parc_national_d%27Arakwal","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Byron_Lighthouse_looking_south_2004-28-12.JPG","page_title":"Parc national d'Arakwal","context_page_description":"Le parc national d'Arakwal est un parc situé à environ 624 km au nord de Sydney en Nouvelle-Galles du Sud en Australie et 2 km au sud du cap Byron, le point le plus à l'est de l'Australie continentale. La ville la plus proche est Byron Bay. Le parc protège une zone de paysage wallum, de landes côtières argileuses situées derrière Tallow Beach, qui offrent un habitat à de nombreuses espèces d'oiseaux et à deux espèces indigènes de grenouilles: Crinia tinnula et Litoria olongburensis qui sont toutes deux considérées vulnérables.\\nPropriété traditionnelle du peuple Arakwal, le parc a été créé en 2001 après que la communauté Arakwal et le gouvernement de Nouvelle-Galles du Sud furent parvenus à un accord d'utilisation des terres. Le peuple Arakwal est cogestionnaire du parc."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%94%D0%B5%D1%80%D0%B6%D0%B0%D0%B2%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%B4%D0%BE%D0%BD_%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Ant%C3%A1rtida_Argentina.png","page_title":"Державний кордон Аргентини","context_page_description":"Державний кордон Аргентини — державний кордон, лінія на поверхні Землі та вертикальна поверхня, що проходить по цій лінії, що визначають межі державного суверенітету Аргентини над власними територією, водами, природними ресурсами в них і повітряним простором над ними."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8C%97%E4%BA%AC%E5%9C%B0%E9%93%81%E4%B8%80%E6%9C%9F%E5%B7%A5%E7%A8%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/20030510234628_-_%E5%8C%97%E4%BA%AC%E7%AB%99.jpg","page_title":"北京地铁一期工程","context_page_description":"北京地铁一期工程是北京地铁的第一条线路，也是中国大陆首条地铁线路。该工程是为了防范空袭和核弹的威胁，和平时期兼顾交通需要所建，故全线均为地下线，并且按照防空工事标准设计。线路全长29.007公里，其中包括古城路站至北京站的“401线”和进山延长线“402线”，连接北京市中心和西部山区军队驻地。401线全长22.879公里，设置16座车站及一座地面车辆段；402线全长6.128公里，设置3座车站和一条环形检修线。一期工程于1965年开工，1969年竣工，1971年起逐步投入运营，至1973年运营区段稳定为苹果园站至北京站，全长23.6公里。1987年，随着二期工程和复兴门折返线的竣工，一期工程线路分拆，分别归入今天的1号线和2号线。"},{"page_url":"https://pl.wikipedia.org/wiki/Droga_wojew%C3%B3dzka_nr_689","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Bia%C5%82owie%C5%BCa_-_Droga_wojew%C3%B3dzka_nr_689.JPG","page_title":"Droga wojewódzka nr 689","context_page_description":"Droga wojewódzka nr 689 – droga wojewódzka o długości ok. 49 km, biegnąca z Bielska Podlaskiego przez Hajnówkę i Białowieżę w kierunku pieszo-rowerowego przejścia granicznego Białowieża-Piererow."},{"page_url":"https://tr.wikipedia.org/wiki/Mutlak","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/FlammarionWoodcut.jpg","page_title":"Mutlak","context_page_description":"Mutlak, felsefî bir kavram olarak, şeylerin, keşfedilmiş olsun olmasın, bütününü, tamamını tanımlar. Felsefenin farklı konularında ve farklı felsefî metinlerde, Mutlak nihai varlığı tanımlamak için de kullanılabilir; bu kullanımda fâni ve varlığı zorunlu olmayanın tersi olan yani mutlak olan varlık anlamındadır.\\nHiçbir şeye bağlı olmaksızın varolan, bağımsız ve koşulsuz olan anlamında felsefi terim.Genel geçer anlamı bakımından hiçbir şey ile sınırlandırılamaksızın varolan şey anlamındadır.Felsefe tarihinde her zaman mevcut olmuş, üzerinde en çok tartışılmış kavramlardan birdir. Metafizikte, mantıkta, epistemolojide, estetikte, bilimde bu kavramın değerlendirilmesi ve üzerinden süregelen tartışmalar söz konusudur. Sınırsız, sonsuz, koşulsuz, değişmez, zorunlu olduğu varsayılanı anlatan felsefe terimidir mutlak.\\nFelsefi anlamda mutlak kavramı, bu bilinen genel anlamıyla eş fakat kısmen daha kompleks bir anlaman katmanına sahiptir. Buna göre, mutlak, her şeyi kuşatan, en temel gerçeklik anlamındaki felsefi ilkedir."},{"page_url":"https://es.wikipedia.org/wiki/Finley_Peter_Dunne","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Finley_Peter_Dunne_-_Project_Gutenberg_eText_19324.jpg","page_title":"Finley Peter Dunne","context_page_description":"Finley Peter Dunne, humorista, periodista y editor estadounidense.\\nFinley estaba casado con la golfista estadounidense Margaret Ives Abbott.\\nWikiquote alberga frases célebres de o sobre Finley Peter Dunne."},{"page_url":"https://et.wikipedia.org/wiki/Staicele","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Staiceles_dibin%C4%81%C5%A1anas_piemi%C5%86as_z%C4%ABme_2000-04-29_-_panoramio.jpg","page_title":"Staicele","context_page_description":"Staicele on linn Lätis Aloja piirkonnas, Salatsi jõe kaldal.\\nLinn asub piirkonnakeskusest Alojast 13 km, pealinnast Riiast 140 km ja lähimast Eesti-Läti piiripunktist Heinastes 29 km kaugusel."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BC%D0%BE%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Momotus_momota_-_Zoo_Frankfurt.jpg","page_title":"Момоты","context_page_description":"Момоты или обыкновенные момоты — род птиц семейства момотовых отряда ракшеобразных. Момоты — это тропические птицы с ярким оперением. В окраске преобладают зелёный, жёлтый и оранжевый цвета. Момотов легко узнать по характе́рной чёрной «маске» на голове и длинному хвосту с двумя рулевыми перьями, заканчивающими чем-то наподобие ракеток. Все виды — птицы среднего размера: с длиной туловища 30—48 см и массой — 100—150 г."},{"page_url":"https://oc.wikipedia.org/wiki/Neuvy_(Al%C3%A8ir)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Neuvy_Allier_01.jpg","page_title":"Neuvy (Alèir)","context_page_description":"Neuvy es una comuna francofòna de Borbonés, situada dins lo departament d'Alèir e la region d'Auvèrnhe."},{"page_url":"https://es.wikipedia.org/wiki/Bang_Bros","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Bang_Bros_logo.png","page_title":"Bang Bros","context_page_description":"BangBros es una red de sitios web para adultos. La red cuenta con un total de 38 sitios web, de los cuales 20 permanecen activos, mientras que 16 ya no son actualizados, siendo Assparade, el sitio más visitado.​ Los vídeos, de temática gonzo y diferente metraje, se filman generalmente en Miami, Florida. La primera web de la compañía fue Bang Bus."},{"page_url":"https://sv.wikipedia.org/wiki/Arthrodermataceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Epidermophyton_floccosum_01.jpg","page_title":"Arthrodermataceae","context_page_description":"Arthrodermataceae är en familj av svampar. Arthrodermataceae ingår i ordningen Onygenales, klassen Eurotiomycetes, divisionen sporsäcksvampar och riket svampar."},{"page_url":"https://en.wikipedia.org/wiki/Caleb_Ekwegwo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Caleb_Ekwegwo.JPG","page_title":"Caleb Ekwegwo","context_page_description":"Caleb Tochukwu Maranatha Ekwegwo is a Nigerian-born Hong Kong professional footballer who currently plays as a striker for Hong Kong Premier League club Yuen Long."},{"page_url":"https://gl.wikipedia.org/wiki/Eug%C3%A8ne_Delacroix","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Eug%C3%A8ne_Ferdinand_Victor_Delacroix_024.jpg","page_title":"Eugène Delacroix","context_page_description":"Ferdinand Victor Eugène Delacroix, nado o 26 de abril 1798 e morto o 13 de agosto de 1863, foi un pintor francés, o máis importante dos pintores románticos."},{"page_url":"https://en.wikipedia.org/wiki/Zouave_(Pont_de_l%27Alma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Diebolt_-_le_grenadier.jpg","page_title":"Zouave (Pont de l'Alma)","context_page_description":"The Zouave is an 1856 stone statue by French artist Georges Diebolt, which has been sited on the Pont de l'Alma in Paris since the 1850s. The statue is used as an informal flood marker for the level of the River Seine in Paris."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BC%D0%BF%D0%B5%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Roman_fresco_Villa_dei_Misteri_Pompeii_001.jpg","page_title":"Помпеи","context_page_description":"Помпе́и — древнеримский город недалеко от Неаполя, в регионе Кампания, погребённый под слоем вулканического пепла в результате извержения Везувия в 79 году н. э.\\nСейчас — музей под открытым небом. Внесён в Список Всемирного наследия ЮНЕСКО."},{"page_url":"https://no.wikipedia.org/wiki/Thomas_Bateman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Thomas_Bateman_%281821%E2%80%931861%29%2C_and_His_Son%2C_by_Thomas_Joseph_Banks%2C_sheffield_museums%2C_uk.jpg","page_title":"Thomas Bateman","context_page_description":"Thomas Bateman, var en britisk antikvar kjent for sine mange utgravninger av gravhauger."},{"page_url":"https://fr.wikipedia.org/wiki/Cadran_solaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Suncanik_Senj_45_paralela_07.jpg","page_title":"Cadran solaire","context_page_description":"Un cadran solaire est un instrument silencieux et immobile qui indique le temps solaire par le déplacement de l'ombre d'un objet de forme variable, le style, sur une surface, la table du cadran, associé à un ensemble de graduations tracées sur cette surface. La table est généralement plane mais peut aussi être concave, convexe, sphérique, cylindrique, etc.\\nLe style indique généralement l'heure par la longueur ou la direction de son ombre. Sur les cadrans courants, l'élément porte-ombre est généralement un axe incliné parallèlement à l'axe de rotation de la Terre ou axe du monde. Il prend alors le nom de « style polaire ». Cette inclinaison, dont l'angle dépend de la latitude du lieu, permet de lire l'heure pendant toute l'année directement sur un même ensemble de graduations : l'éventail des lignes horaires. Les cadrans solaires ont plusieurs formes : ronde, rectangle, carrée, etc."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A4%CE%BF%CF%85%CF%81%CE%BA%CE%B9%CE%BA%CF%8C_%CE%A0%CE%BF%CE%BB%CE%B5%CE%BC%CE%B9%CE%BA%CF%8C_%CE%9D%CE%B1%CF%85%CF%84%CE%B9%CE%BA%CF%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Flag_of_Turkish_Naval_Forces_Command.PNG","page_title":"Τουρκικό Πολεμικό Ναυτικό","context_page_description":"Το Τουρκικό Πολεμικό Ναυτικό, ή Τουρκικό Ναυτικό είναι ο ναυτικός πολεμικός κλάδος των υπηρεσιών των Τουρκικών Ενόπλων Δυνάμεων.\\nΤο ναυτικό ανάγει τις ρίζες του στους πρώτους τουρκικούς στόλους που έπλευσαν στο Αιγαίο στα τέλη του 11ου αιώνα, στους στόλους των μπεϊλικίων της Ανατολίας τον 14ο αιώνα, και, πιο άμεσα, στο Οθωμανικό Ναυτικό. Ωστόσο, οι σύγχρονες ναυτικές παραδόσεις και τα έθιμα του Τουρκικού Ναυτικού ξεκινούν από τις 10 Ιουλίου του 1920, οπότε και καθιερώθηκε ως Διεύθυνση Ναυτικών Υποθέσεων, κατά τη διάρκεια του Τουρκικού Πολέμου της Ανεξαρτησίας υπό την ηγεσία του Μουσταφά Κεμάλ. Από τον Ιούλιο του 1949, η υπηρεσία είναι επισήμως γνωστή ως Τουρκικό Πολεμικό Ναυτικό.\\nΤο 2008, το Τουρκικό Ναυτικό ανέφερε δύναμη ενεργού προσωπικού της τάξεως των 48.600. Στο ποσοστό αυτό περιλαμβάνεται μία Ταξιαρχία Αμφίβιων Πεζοναυτών καθώς και αρκετές μονάδες Ειδικών Δυνάμεων και Καταδρομών. Το ναυτικό έχει περίπου 112 πλοία εν υπηρεσία και περίπου 50 θαλάσσια αεροσκάφη."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_im_Landkreis_Waldeck-Frankenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Dorfansicht_Welleringhausen.jpg","page_title":"Liste der Naturschutzgebiete im Landkreis Waldeck-Frankenberg","context_page_description":"Im hessischen Landkreis Waldeck-Frankenberg gibt es die in der folgenden Tabelle aufgelisteten Naturschutzgebiete."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E7%A7%8B%E7%94%B0%E8%97%8D%E9%96%83%E9%9B%BB2012%E8%B3%BD%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Vending_machine_of_Blaublitz_Akita.jpg","page_title":"秋田藍閃電2012賽季","context_page_description":"秋田藍閃電2012賽季係秋田藍閃電足球隊喺日足聯嘅第六個賽季。球會年度口號係「～変革～」。"},{"page_url":"https://sq.wikipedia.org/wiki/Dhelpra_e_kuqe","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Lis_%28Vulpes_vulpes%29_WOB.JPG","page_title":"Dhelpra e kuqe","context_page_description":"Dhelpra e kuqe është specia më e madhe e dhelprave dhe një nga anëtarët me shpërndarje më të gjerë të rendit Karnivora, duke qenë i pranishëm në të gjithë hemisferën veriore nga Rrethi i Arktikut deri në Afrikën e Veriut, Amerikën e Veriut dhe Euroazi. Ёshtë renditur si shqetësimi më i vogël nga IUCN. Gama e tij është rritur krahas zgjerimit njerëzor, pasi është futur në Australi, ku konsiderohet e dëmshme për gjitarët vendës dhe popullsinë e shpendëve. Për shkak të pranisë së saj në Australi, ajo është përfshirë në listën e \\"100 specieve më të rrezikshme në botë\\".\\nDhelpra e kuqe lindi nga paraardhës me përmasa më të vegjël nga Eurazia gjatë periudhës së Villafranchian të Mesëm, dhe kolonizoi Amerikën e Veriut menjëherë pas glaciatonit Wisconsin. Midis dhelprave të vërteta, dhelpra e kuqe paraqet një formë më përparimtare në drejtim si mishngrënësit. Përveç madhësisë së saj të madhe, dhelpra e kuqe dallohet nga speciet e tjera të dhelprave nga aftësia e saj për t'u përshtatur shpejt në ambiente të reja. Pavarësisht nga emri i saj, specie shpesh prodhon individë me njyra të tjera, duke përfshirë individëve të bardhë dhe të zinj."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%82%D0%B5%D0%BB%D1%8C_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Hotelmoskva4.JPG","page_title":"Отель Москва","context_page_description":"Отель Москва — отель в Белграде на пересечении площади Теразие и улицы Балканской построено по проекту архитектора Йована Илкича и группы архитекторов из Санкт-Петербурга.\\nСтроительство здания началось весной 1905 года, а торжественное открытие состоялось 14 января 1908 года. Это был самый большой частный дом в Королевстве Сербии, находился всего в 100 метрах от королевского дворца. На стенах здания значилась надпись «Палата Россия»."},{"page_url":"https://de.wikipedia.org/wiki/Christoph_Cremer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/GFP_Superresolution_Christoph_Cremer.JPG","page_title":"Christoph Cremer","context_page_description":"Christoph Cremer ist ein deutscher Physiker und Professor an der Ruprecht-Karls-Universität Heidelberg, Honorarprofessor an der Johannes Gutenberg-Universität Mainz und Forschungsgruppenleiter am Institut für Molekulare Biologie in Mainz, der die konventionelle lichtoptische Auflösungsgrenze durch unterschiedliche Methoden überwunden hat. Im September 2014 gründete er die gemeinnützige Organisation LuciaOptics zum Einsatz der Super Resolution Mikroskopie in den Bereichen von Molekularbiologie, Biomedizin, Mikrobiologie, Virologie, Pharmazie and Diagnostik."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%BF%D0%B5_(%D0%BB%D0%B5%D0%B3%D0%BA%D0%BE%D0%B2%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D1%96%D0%BB%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Alfa_Romeo_SZ.JPG","page_title":"Купе (легковий автомобіль)","context_page_description":"Купе́ — тип кузова легкового автомобіля з двома дверима та двома чи чотирма сидіннями. Зазвичай, купе — спортивніший варіант седана. Вперше, даний термін з'явився в 19 ст., коли ним почали ідентифікувати транспортні засоби, в яких задні, обернені протилежно напрямку руху сидіння було виключено з конструкції, тобто вирізано."},{"page_url":"https://uz.wikipedia.org/wiki/Belarus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/BelAZ_haul_truck.jpg","page_title":"Belarus","context_page_description":"Belorussiya, Belorussiya Respublikasi — Yevropa markazidagi davlat. Sharqiy Yevropa tekisligining gʻarbida joylashgan. Maydoni 207,6 ming km². Aholisi 9 463 300 kishi. 6 viloyat, 118 tuman, 102 shahar, 109 shaharcha bor. Poytaxti — Minsk shahri."},{"page_url":"https://it.wikipedia.org/wiki/Sainte-Anne-sur-Vilaine","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Sainte-Anne-sur-Vilaine_ch%C3%A2teau_Port_de_Roche.jpg","page_title":"Sainte-Anne-sur-Vilaine","context_page_description":"Sainte-Anne-sur-Vilaine è un comune francese di 1.012 abitanti situato nel dipartimento dell'Ille-et-Vilaine nella regione della Bretagna."},{"page_url":"https://cs.wikipedia.org/wiki/Aglianico_del_Vulture","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Aglianico_del_Vulture.jpg","page_title":"Aglianico del Vulture","context_page_description":"Aglianico del Vulture DOC a Aglianico del Vulture Superiore DOCG je červené víno z odrůdy vinné révy Aglianico pěstované v zóně Vulture, nacházející se na severovýchodě provincie Potenza v italském regionu Basilicata.\\nVíno Aglianico del Vulture produkují vinařské podniky nacházející se v 15 obcích. Za rok vyrobí cca 2 500 000 lahví tohoto vína."},{"page_url":"https://ca.wikipedia.org/wiki/Mico_manicorensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Manicore_Marmoset_area.png","page_title":"Mico manicorensis","context_page_description":"Mico manicorensis és una espècie de primat de la família dels cal·litríquids que viu al Brasil. El seu nom prové del riu Manicoré, un afluent de l'Amazones, ja que l'espècie fou descoberta allà, a uns 300 km al sud de Manaus.\\nFa uns 50 cm de llargada, més de la meitat dels quals pertanyen a la cua, i pesa uns 340 grams. El pelatge és de color blanc amb tons platejats a l'esquena, de color gris al cap i al coll, la cua és de color negre i el ventre és grogós-ataronjat. La cara i les orelles no tenen pèl i són rosa."},{"page_url":"https://en.wikipedia.org/wiki/Medvednik","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Medvednik_-_Zapadna_Srbija_-_isto%C4%8Dni_obronci_Medvednika_-_mesto_Kozila_-_Medvedni%C4%8Dko_platno_1.jpg","page_title":"Medvednik","context_page_description":"Medvednik is a mountain in western Serbia, near the town of Valjevo. Its highest peak has an elevation of 1,247 meters above sea level."},{"page_url":"https://en.wikipedia.org/wiki/Greater_adjutant","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Science_is_measurement_Stacy_Marks.jpg","page_title":"Greater adjutant","context_page_description":"The greater adjutant is a member of the stork family, Ciconiidae. Its genus includes the lesser adjutant of Asia and the marabou stork of Africa. Once found widely across southern Asia, mainly in India but extending east to Borneo, the greater adjutant is now restricted to a much smaller range with only three breeding populations; two in India, with the largest colony in Assam, a smaller one around Bhagalpur; and another breeding population in Cambodia. They disperse widely after the breeding season. This large stork has a massive wedge-shaped bill, a bare head and a distinctive neck pouch. During the day, it soars in thermals along with vultures with whom it shares the habit of scavenging. They feed mainly on carrion and offal; however, they are opportunistic and will sometimes prey on vertebrates. The English name is derived from their stiff \\"military\\" gait when walking on the ground. Large numbers once lived in Asia, but they have declined to the point of endangerment. The total population in 2008 was estimated at around a thousand individuals."},{"page_url":"https://es.wikipedia.org/wiki/Slot_(modelismo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Chasisslot.jpg","page_title":"Slot (modelismo)","context_page_description":"El slot, autopistas en miniatura o fórmula de salón es un deporte competitivo consistente en hacer correr los automóviles a escala equipados con motores eléctricos lo más velozmente posible por unas pistas equipadas con ranuras especialmente diseñadas para ello, de donde se alimentan eléctricamente los coches y es de estas ranuras por las que viene el nombre del término inglés slot.\\nLos materiales mínimos para ello son una pista, un coche, un transformador o fuente de alimentación y un mando controlador. La diversión y dificultad del slot consiste en que el coche circule lo más rápido posible sin que se salga del carril, ya sea en velocidad, rally, raid, etc. Es posible facilitar la tarea incluyendo pequeños pero potentes imanes que atraen el chasis a la pista.\\nAunque para los entendidos en el tema se llama slot, para la mayoría de la gente dicho término resulta extraño, y se prefiere usar la marca registrada Scalextric como nombre genérico, aún a pesar de haber proliferado ampliamente otros fabricantes en las dos últimas décadas."},{"page_url":"https://pl.wikipedia.org/wiki/Dramatiska_institutet","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Dramatiska_institutet_budynek.jpg","page_title":"Dramatiska institutet","context_page_description":"Dramatiska institutet – Państwowa Wyższa Szkoła Filmowa w Sztokholmie, założona 1970 roku. Szkoła kształci na studiach I-go i II-go stopnia."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%89%E3%83%8E%E5%AE%AE%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Sannomiya_st01_2816.jpg","page_title":"三ノ宮駅","context_page_description":"三ノ宮駅は、兵庫県神戸市中央区布引町四丁目にある、西日本旅客鉄道東海道本線の駅である。駅番号はJR-A61。「JR神戸線」の愛称区間に含まれている。乗り換え駅である三宮駅とともに神戸市の中心駅であり、JR西日本の兵庫県内の駅の中では最大の利用者数を誇る。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%86%E3%83%8D%E3%82%B7%E3%83%BC%E5%B7%9E%E3%83%87%E3%82%A4%E3%83%B4%E3%82%A3%E3%83%83%E3%83%89%E3%82%BD%E3%83%B3%E9%83%A1%E3%81%AE%E5%9B%BD%E5%AE%B6%E6%AD%B4%E5%8F%B2%E7%99%BB%E9%8C%B2%E8%B2%A1%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Anna_Russell_Cole_Auditorium.JPG","page_title":"テネシー州デイヴィッドソン郡の国家歴史登録財一覧","context_page_description":"テネシー州デイヴィッドソン郡の国家歴史登録財一覧を以下に示す。\\nアメリカ合衆国テネシー州デイヴィッドソン郡の国家歴史登録財に指定された建造物および地域の一覧である。国家歴史登録財に指定された建造物および地域の多くは緯度および経度が明らかにされており、Google マップでも見つけることができる。\\nテネシー州デイヴィッドソン郡の6ヶ所の国定歴史建造物を含む建造物および地域187ヶ所の国家歴史登録財の一覧である。\\nテネシー州サムナー郡の国家歴史登録財一覧には郡境にあるグッドレッツヴィルの建造物も含まれている。\\nこのアメリカ合衆国国立公園局のリストは2015年8月14日に更新されたNPSの最新リストによって網羅されている。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9A%CF%85%CE%BD%CF%8C%CF%80%CE%BF%CE%BB%CE%B9%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Lower_Nile.jpg","page_title":"Κυνόπολις","context_page_description":"Κυνόπολις ήταν το ελληνιστικό τοπωνύμιο για δύο πόλεις στην Αρχαία Αίγυπτο. Τόσο η άνω Κυνοπόλις όσο και η κάτω Κυνόπολις ήταν επισκοπές στα χριστιανικά χρόνια."},{"page_url":"https://pl.wikipedia.org/wiki/Alejandro_Moreno","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Alejandro_Moreno_2011_Chivas_USA.jpg","page_title":"Alejandro Moreno","context_page_description":"Alejandro Enrique Moreno Riera – wenezuelski piłkarz występujący na pozycji napastnika. Zawodnik klubu CD Chivas USA."},{"page_url":"https://eu.wikipedia.org/wiki/Lonchophylla_thomasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Naturalis_Biodiversity_Center_-_RMNH.MAM.17347.b_dor_-_Lonchophylla_thomasi_-_skin.jpeg","page_title":"Lonchophylla thomasi","context_page_description":"Lonchophylla thomasi Lonchophylla generoko animalia da. Chiropteraren barruko Glossophaginae azpifamilia eta Phyllostomidae familian sailkatuta dago"},{"page_url":"https://sw.wikipedia.org/wiki/Paraguay_(mto)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/River_paraguay_map.PNG","page_title":"Paraguay (mto)","context_page_description":"Mto wa Paraguay ni tawimto mkubwa wa Rio Paraná. Jina laandikwa katika Brazil kwa Kireno \\"Rio Paraguai\\", baadaye nchini Paraguay kwa Kihispania \\"Río Paraguay\\".\\nMto unaanza Brazil katika nyanda za juu za Mato Grosso 1154 km kaskazini ya Cuiabá ukielekea kusini. Baada ya kutoka katika nyanda za juu mto unapita tambarare ya Pantanal hapi ni mpaka kati ya Brazil na Bolivia.\\nMto hukata Paraguay yote hadi Asuncion na kuingia Argentina. Unaishia kwenye Rio Parana karibu na Corrientes."},{"page_url":"https://en.wikipedia.org/wiki/Maryland_Route_67","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Maryland_Route_67_map.png","page_title":"Maryland Route 67","context_page_description":"Maryland Route 67 is a state highway in the U.S. state of Maryland. Known as Rohrersville Road, the state highway runs 12.20 miles from U.S. Route 340 in Weverton north to US 40 Alternate in Boonsboro. MD 67 parallels the western flank of South Mountain in southeastern Washington County, connecting Boonsboro with Weverton and Rohrersville. In conjunction with US 340 and US 40 Alternate, MD 67 connects Hagerstown and Harpers Ferry, West Virginia, a link that made the highway one of the original state roads marked for improvement in 1909. The first section of the state highway was constructed through Rohrersville around 1920. The remainder of the highway was built between Boonsboro and Weverton in the late 1920s and early 1930s. MD 67 was reconstructed with multiple relocations starting in the late 1950s, culminating in a relocation at the southern terminus to tie into the US 340 freeway in the late 1960s."},{"page_url":"https://cs.wikipedia.org/wiki/Mo%C5%99ic_%C4%8Cernil","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/K%C5%99e%C4%8Dho%C5%99_-_pam%C3%A1tn%C3%ADk_bitvy_u_Kol%C3%ADna1.jpg","page_title":"Mořic Černil","context_page_description":"Mořic Černil byl český sochař a výtvarný pedagog."},{"page_url":"https://ru.wikipedia.org/wiki/Audi_A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Audi_A6_allroad_quattro_3.0_TDI_%28C6%29_%E2%80%93_Frontansicht_%281%29%2C_13._Juni_2011%2C_Wuppertal.jpg","page_title":"Audi A6","context_page_description":"Audi 100, с 1994 года Audi A6, — семейство автомобилей бизнес-класса, выпускающихся под маркой Audi, внутреннее обозначение — «тип C». Премьера Audi 100 состоялась в 1968 году, с августа 1994 года этот модельный ряд носит название А6.\\nВ отличие от Audi 80/A4, где переименование совпало с выпуском новой модели, первый А6 представлял собой рестайлинговую версию последнего Audi 100.\\nСегодня Audi A6 предлагается в четырехдверной версии с кузовом седан и в пятидверной версии Avant, ранее выпускались также двухдверные модели, купе и хэтчбек. Спортивная модификация А6 производится под наименованием Audi S6, а наиболее мощная версия A6 производится под наименованием RS6, что расшифровывается как \\"RennSport\\"."},{"page_url":"https://nl.wikipedia.org/wiki/Arie_van_den_Berg_(beeldhouwer)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Hilversum_kunstwerk_vrouw_met_vogel_A.JPG","page_title":"Arie van den Berg (beeldhouwer)","context_page_description":"Arie van den Berg was een Nederlands schilder, beeldhouwer en keramist."},{"page_url":"https://de.wikipedia.org/wiki/Stuhlfelden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Stuhlfeldenchurch.jpg","page_title":"Stuhlfelden","context_page_description":"Stuhlfelden ist eine Gemeinde im Oberpinzgau des Bezirks Zell am See, Salzburger Land, Österreich, mit 1578 Einwohnern. Sie gehört zu den Nationalpark Hohe Tauern."},{"page_url":"https://az.wikipedia.org/wiki/Voreal","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Panorama_Belvedere%2C_Vaur%C3%A9al.png","page_title":"Voreal","context_page_description":"Voreal — Fransada bələdiyyə, region — İl-de-Frans, departament — Val-d’Uaz, rayon — Pontuaz, kanton — L'Otiy. Əhalisi — 15.602 nəfər.\\nBələdiyyə Paris şəhərinin təxminən 31 km şimal-qərbdə, Serji belediyyənin 3 km qərbdə yerləşir."},{"page_url":"https://de.wikipedia.org/wiki/Charles-%C3%89mile_Freppel","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Charles_%C3%89mile_Freppel_-_Statue.jpg","page_title":"Charles-Émile Freppel","context_page_description":"Charles-Émile Freppel war ein französischer römisch-katholischer Bischof und Kirchenhistoriker."},{"page_url":"https://sv.wikipedia.org/wiki/Vilhelm_Renhult","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Prinsgatan_7%2C_%C3%96rebro.jpg","page_title":"Vilhelm Renhult","context_page_description":"Vilhelm Renhult, född den 4 maj 1876 i Horndal, död 1948 i Hovsta, var en svensk arkitekt."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%8D%E0%A4%A8%E0%A4%9C%E0%A5%80%E0%A4%B8%E0%A5%80_%E0%A5%AC%E0%A5%AE%E0%A5%A8%E0%A5%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Barnard%27s_Galaxy.jpg","page_title":"ऍनजीसी ६८२२","context_page_description":"ऍनजीसी ६८२२, जिसे बरनार्ड की गैलेक्सी और आईसी ४८९५ भी कहा जाता है, एक डन्डीय सर्पिल गैलेक्सी है जिसका आकार थोड़ा बेढंगा है। यह गैलेक्सियों के स्थानीय समूह की सदस्य है और आकाशगंगा के पास स्थित है। अपने ढाँचे और तारों के हिसाब से यह छोटे मॅजलॅनिक बादल नामक गैलेक्सी से काफ़ी मिलती-जुलती है। आकाश में यह धनु तारामंडल के क्षेत्र में नज़र आती है और हमसे क़रीब १६ लाख प्रकाश वर्ष की दूरी पर स्थित है।"},{"page_url":"https://en.wikipedia.org/wiki/Mark_Six","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/HK_Mark_Six_-_Aug_2006.jpg","page_title":"Mark Six","context_page_description":"Mark Six is a lottery game organised by the Hong Kong Jockey Club."},{"page_url":"https://sk.wikipedia.org/wiki/STS-51-D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/STS-51-D_crew.jpg","page_title":"STS-51-D","context_page_description":"STS-51-D bola misia raketoplánu Discovery. Celkovo išlo o 16. misiu raketoplánu do vesmíru a 4. pre Discovery. Cieľom letu bolo vynesenie dvoch satelitov na obežnú dráhu."},{"page_url":"https://nl.wikipedia.org/wiki/Selje","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Stad_skipstunnel_profile.png","page_title":"Selje","context_page_description":"Selje was een gemeente in de Noorse provincie Sogn og Fjordane. Het grootste deel van de gemeente is gelegen op het schiereiland Stad en kenmerkt zich door een uitgesproken woest landschap. Plaatsen in de gemeente zijn onder meer Barmen, Ervik, Flatraket, Hoddevik en Leikanger. De gemeente telde 2781 inwoners in januari 2017.\\nOp het gemeentewapen is de plaatselijke heilige Sunniva afgebeeld, die als martelares in de 10e eeuw stierf.\\nOp 1 januari 2020 werd de gemeente samengevoegd met de gemeente Eid en de plaats Bryggja van de gemeente Vågsøy tot de gemeente Stad, genoemd naar het gelijknamige schiereiland."},{"page_url":"https://en.wikipedia.org/wiki/Adycha","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Kisilyakh_Mountains_-_ONC_C-6.jpg","page_title":"Adycha","context_page_description":"The Adycha is a river in the Republic of Sakha in Russia. It is a right hand tributary of the Yana, and is 715 kilometres long, with a drainage basin of 89,800 square kilometres.\\nAt the end of the Soviet period, a big dam with a hydroelectric station was planned to be built on the river, but following perestroika and economic difficulties in the country the project was given up."},{"page_url":"https://de.wikipedia.org/wiki/Belgische_Annexionspl%C3%A4ne_nach_dem_Zweiten_Weltkrieg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Belgrenz.jpg","page_title":"Belgische Annexionspläne nach dem Zweiten Weltkrieg","context_page_description":"Nachdem das Deutsche Reich den Zweiten Weltkrieg verloren hatte, plante Belgien ab 1945, Gebietsteile entlang der deutsch-belgischen Grenze zu annektieren. Dies wurde neben Geldzahlungen und dem Überlassen von Arbeitskräften als eine Möglichkeit der Kriegsreparation in Betracht gezogen. Mitte April 1949 gab Belgien überraschend einen Verzicht auf die meisten der beanspruchten Gebiete bekannt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%82%A7%E3%83%8E%E3%83%B4%E3%82%A1%E3%81%AE%E3%83%AC%E3%83%BB%E3%82%B9%E3%83%88%E3%83%A9%E3%83%BC%E3%83%87%E3%83%BB%E3%83%8C%E3%82%AA%E3%83%BC%E3%83%B4%E3%82%A7%E3%81%A8%E3%83%91%E3%83%A9%E3%83%83%E3%83%84%E3%82%A3%E3%83%BB%E3%83%87%E3%82%A4%E3%83%BB%E3%83%AD%E3%83%83%E3%83%AA%E5%88%B6%E5%BA%A6","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Genova-Genova-DSCF7392.JPG","page_title":"ジェノヴァのレ・ストラーデ・ヌオーヴェとパラッツィ・デイ・ロッリ制度","context_page_description":"「ジェノヴァのレ・ストラーデ・ヌオーヴェとパラッツィ・デイ・ロッリ制度」は、イタリアの世界遺産の一つ。ストラーデ・ヌオーヴェは、「新しい街路群」の意味で、ジェノヴァで16世紀に整備されたストラーダ・ヌオーヴァと、それ以降の時代に出来た二つの街路を指している。ガリバルディ通りには今もパラッツォ群が立ち並んでいるが、「パラッツィ・デイ・ロッリ」とは、それらの宮殿群がかつての「ロッリ」に掲載されていたことに由来する。"},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Lane_County,_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Our_Lady_of_Perpetual_Help_Catholic_Church_%28Cottage_Grove%2C_Oregon%29.jpg","page_title":"National Register of Historic Places listings in Lane County, Oregon","context_page_description":"This list presents the full set of buildings, structures, objects, sites, or districts designated on the National Register of Historic Places in Lane County, Oregon, and offers brief descriptive information about each of them. The National Register recognizes places of national, state, or local historic significance across the United States. Out of over 90,000 National Register sites nationwide, Oregon is home to over 2,000, and 137 of those are found partially or wholly in Lane County.\\nThis National Park Service list is complete through NPS recent listings posted April 17, 2020."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B2%D0%B5%D1%86%D1%8C_%D1%80%D0%BE%D0%BA%D1%83_%D0%A4%D0%86%D0%A4%D0%90_2001","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Luis_Figo.jpg","page_title":"Гравець року ФІФА 2001","context_page_description":"«Гравець року ФІФА» за підсумками 2001 року був оголошений 17 грудня 2001 року у Цюриху. Це було одинадцяте нагородження трофеєм «Гравець року ФІФА», започаткованого ФІФА у 1991 році. Лауреатом нагороди став португальський півзахисник іспанського клубу «Реал Мадрид» Луїш Фігу.\\nПереможець визначався за підсумками голосування серед 130 тренерів національних команд світу. Кожен із тренерів визначав трійку найкращих футболістів, окрім співвітчизників. Перше місце оцінювалось у п'ять балів, друге — три бали, третє місце — 1 бал.\\nТакож було проведено голосування щодо визначення кращої футболістки 2001 року. Першим лауреатом нагороди стала американка Міа Гемм."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_l%27Alt_Pened%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Esgl%C3%A9sia_de_Santa_Maria_Magdalena_%28el_Pla_del_Pened%C3%A8s%29_-_1.jpg","page_title":"Llista de monuments de l'Alt Penedès","context_page_description":"Llista de monuments de l'Alt Penedès inclosos en l'Inventari del Patrimoni Arquitectònic de Catalunya per la comarca de l'Alt Penedès. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb una classificació arquitectònica, els béns culturals d'interès local immobles i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://en.wikipedia.org/wiki/Raul_Boesel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Raul_Boesel_2007_Mil_Milhas_Brasil.jpg","page_title":"Raul Boesel","context_page_description":"Raul de Mesquita Boesel\\nis a Brazilian former racing driver who raced for the March and Ligier Formula One teams and later raced in Champ Car and the Indy Racing League.\\nHe won the 1987 World Sportscar Championship and the 1988 24 Hours of Daytona."},{"page_url":"https://es.wikipedia.org/wiki/Conferencia_Episcopal_de_Venezuela","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Escudo_monse%C3%B1or_Antonio_Jose_Lopez_Castillo.PNG","page_title":"Conferencia Episcopal de Venezuela","context_page_description":"La Conferencia Episcopal Venezolana es una Institución de carácter permanente que de acuerdo al Concilio Vaticano II, asocia a los Obispos de la República Bolivariana para ejercer su apostolado según la organización de la Iglesia Católica para Venezolana."},{"page_url":"https://pt.wikipedia.org/wiki/Sch%C3%B6nberg_(Mecklemburgo-Pomer%C3%A2nia_Ocidental)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/SchoolSch%C3%B6nberg.JPG","page_title":"Schönberg (Mecklemburgo-Pomerânia Ocidental)","context_page_description":"Schönberg é uma cidade da Alemanha localizada no distrito de Nordwestmecklenburg, estado de Mecklemburgo-Pomerânia Ocidental.\\nÉ membro e sede do Amt de Schönberger Land."},{"page_url":"https://en.wikipedia.org/wiki/Colora_Meetinghouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Colora_Meeting_House_CecilCo_MD_2.JPG","page_title":"Colora Meetinghouse","context_page_description":"The Colora Meetinghouse is a historic Friends meeting house located at Colora, Cecil County, Maryland, United States.\\nThe meeting house was built in 1841 as part of a larger dispute known as the \\"great separation.\\" The original members of the Colora Meeting, then called the Nottingham Preparative Meeting, sided with the orthodox Friends splitting off from the Hicksite West Nottingham Friends Meeting. The new meeting was first part of Baltimore Yearly Meeting. In 1854 it formed the Primitive Yearly Meeting with several nearby meetings and in 1890 became part of the Western Quarterly Meeting."},{"page_url":"https://ceb.wikipedia.org/wiki/Weddell_Sea","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/NASA%27s_DC-8_Flying_Over_the_Weddell_Sea.jpg","page_title":"Weddell Sea","context_page_description":"Dagat ang Weddell Sea sa Antartika. Siya nahimutang sa kasadpang bahin sa kontinente. Arhentina ug Hiniusang Gingharian nag-angkon sa maong dapit."},{"page_url":"https://ms.wikipedia.org/wiki/The_Bronx","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Bronx1867.jpg","page_title":"The Bronx","context_page_description":"The Bronx ialah bahagian paling utara dari lima daerah perbandaran di Bandar Raya New York di negeri A.S. di New York. Ia secara geografi selatan di Kaunti Westchester; utara dan timur pulau dan daerah Manhattan di selatan dan barat di seberang Sungai Harlem; dan utara wilayah Queens, di seberang Sungai Timur. Daripada lima daerah perbandaran, Bronx ialah satu-satunya yang mempunyai sebahagian besar wilayahnya di tanah besar A.S. dan, dengan tanah berkeluasan 42 batu persegi dan penduduk 1,455,720 pada 2016, mempunyai kawasan tanah keempat terbesar, penduduk keempat tertinggi, dan ketumpatan penduduk ketiga tertinggi. Sejak 1914, Bronx mempunyai sempadan yang sama seperti Kaunti Bronx, sebuah daerah New York dan daerah paling padat ketiga di Amerika Syarikat.\\nBronx dibahagikan dengan Sungai Bronx ke bahagian tengah di barat, dekat dengan Manhattan, dan bahagian timur yang rata, dekat dengan Long Island. Alamat jalan timur dan barat dibahagikan oleh penerusan Jerome Avenue, Manhattan Fifth Avenue. Bronx Barat telah dilampirkan ke Bandar Raya New York pada tahun 1874, dan kawasan timur Sungai Bronx pada tahun 1895. Bronx County dipisahkan dari New York County pada tahun 1914."},{"page_url":"https://it.wikipedia.org/wiki/Paularo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Sernio_da_Saletti.JPG","page_title":"Paularo","context_page_description":"Paularo è un comune italiano di 2 457 abitanti del Friuli-Venezia Giulia."},{"page_url":"https://it.wikipedia.org/wiki/Rolls-Royce_Cullinan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Rolls-Royce_Cullinan_Genf_2019_1Y7A5686.jpg","page_title":"Rolls-Royce Cullinan","context_page_description":"La Rolls-Royce Cullinan è un SUV full-size di lusso in produzione dal 2018 dalla casa automobilistica britannica Rolls-Royce Motor Cars. Il nome dell'auto, Cullinan, è lo stesso del più grande diamante grezzo mai trovato."},{"page_url":"https://uz.wikipedia.org/wiki/Boku_bulvari","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Night_bulvar%2C_Baku%2C_2010_%282%29.jpg","page_title":"Boku bulvari","context_page_description":"Dengiz boʻyi bulvari — Kaspiy dengizi qirgʻoqlarida joylashgan Bokuning tashrif belgisi va ramzidir. Boku bulvari Bokuning diqqatga sazovor joylaridan biri boʻlib, bokuliklar va shahar mehmonlarining eng sevimli dam olish joyidir. 2009 yilda oʻzining 100 yilligini nishonladi. Rekonstruksiyagacha bulvarning uzunligi 16 kilometrni tashkil qilgan, toʻliq rekonstruksiyadan soʻng esa 25 kilometrga yetdi. Funikulyor stansiyasi joylashgan Togʻli bogʻ etagidan boshlanadi. Soʻng Eski shahar Icheri Sheher boʻylab Dengiz portigacha choʻziladi. Uning uzunligi 5 kilometr atrofida, lekin uni yanada uzaytirish rejalari ham mavjud.\\nAmalda, Boku Dengiz boʻyi bulvari bu — Kaspiy dengizi koʻrfazi boʻylab choʻzilgan suv boʻyidagi koʻchadir, lekin uni Bokuning eng goʻzal joyidagi dam olish zonasi desak toʻgʻriroq boʻladi. Suv boʻyidagi koʻchaning oʻzini kengligi 30 metrni tashkil etadi, lekin yonida yana sayr qilish uchun xiyobon, kanal, kafe va boshqa turli xil muassasalar mavjud.\\nBoku bulvari juda goʻzal, keng, shinam, kattadir va unda barcha qulayliklar mavjud. Bu yerda barchasi kichik detallargacha oʻylab qurilganligi koʻrinib turibdi."},{"page_url":"https://pt.wikipedia.org/wiki/Prati_(rione_de_Roma)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Rome_rione_XXII_prati_logo.png","page_title":"Prati (rione de Roma)","context_page_description":"Prati é o nome de um dos vinte e dois riones de Roma, oficialmente numerado como Rione XXII, localizado no Municipio I, na margem ocidental do Tibre. Até 1913, Prati, juntamente com os quartieri Trionfale e Della Vittoria eram parte do Municipio XVII. É uma das vizinhanças mais ricas de Roma. A movimentada Via Cola di Rienzo, uma das mais famosas ruas de Roma, é frequentemente ranqueada entre as mais importantes ruas comerciais da cidade."},{"page_url":"https://tr.wikipedia.org/wiki/Pilos","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Pylos_Messenien.jpg","page_title":"Pilos","context_page_description":"Pilos, Mora Yarımadası'nın sahillerinin batısında, Yunanistan'ın güneyindeki Messinia ilinde bulunan bir kasaba ve körfezdir. Gialova, Elaiofyto, Schinolakka ve Palaionero köylerine komşudur. 2001 sayılarına göre nüfusu 2.561 olup belediye sınırları içinde 5.402 kişi yaşamaktadır. Navarin Deniz Muharebesi burada gerçekleşmiştir.\\nEski Pilos ve Yeni Pilos farklı yerleşim yerleridir ve aralarında birkaç kilometre vardır. Eski Pilos körfezin kuzeybatısında bulunurken, Yeni Pilos körfezin güneydoğusundadır."},{"page_url":"https://de.wikipedia.org/wiki/%C3%84tzende_Stoffe","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Danger-class-8.svg","page_title":"Ätzende Stoffe","context_page_description":"Ätzende Stoffe zerstören lebendes Gewebe oder greifen Oberflächen an, d. h., sie zeigen eine Ätzwirkung. Zu den ätzenden Stoffen zählen stärkere Säuren und Basen sowie Verbindungen, die mit Wasser stark alkalisch oder sauer reagieren. Auch oxidierend wirkende und Wasser entziehende Stoffe können ätzend sein. Ätzende Stoffe können organischer oder anorganischer Natur, fest, flüssig oder gasförmig sein.\\nBeispiele: Salzsäure, Schwefelsäure, Salpetersäure, Natronlauge, konzentrierte Seifenlauge, Abflussreiniger.\\nÄtzende Gase verursachen schon in kleinsten Mengen und geringer Konzentration Schädigungen der Atemwege und der Lunge.\\nFlüssigkeiten wirken auf der Haut wegen ihrer benetzenden Wirkung sofort und sind für sie deshalb am gefährlichsten. Feste und gasförmige ätzende Stoffe müssen eine Zeit auf dem Gewebe der Haut verweilen, um mit äußerlich anhaftender Feuchtigkeit oder der inneren Gewebeflüssigkeit reagieren zu können. Siehe hierzu Verätzung."},{"page_url":"https://it.wikipedia.org/wiki/Padriciano","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Padriciano.jpg","page_title":"Padriciano","context_page_description":"Padriciano è un quartiere del comune di Trieste, posto a 359 m s.l.m. nell'Altopiano Carsico.\\nFino al XVII secolo il territorio ove sorge il borgo era di proprietà delle monache benedettine di Trieste. Il nome deriva forse da Tomaso Padrichiar che acquistò la proprietà nel 1619; proprietà chiamata fino a quel momento Bovolenta. È tuttavia possibile anche un'altra etimologia: il nome Padriče deriverebbe dallo sloveno \\"podgrič\\", lett. \\"sottomonte\\"; Padričar sarebbe quindi da ritenersi un nome di persona derivante dal luogo di residenza, al pari di Furlan, Romano, Napolitano. È invece documentata la presenza di una famiglia Grgič sin dal 1584, anno che si ritiene fondativo per il paese.\\nIl quartiere di Padriciano, che fino al secondo dopoguerra era abitato esclusivamente da sloveni, ha conosciuto negli ultimi venti-trent'anni una cementificazione selvaggia, che ha portato allo snaturamento del borgo con pesanti conseguenze ambientali e culturali.\\nLa chiesa di Padriciano è stata costruita nel 1898 dagli stessi abitanti del luogo, riuniti in un consorzio. La chiesetta è consacrata ai SS. Cirillo e Metodio."},{"page_url":"https://cs.wikipedia.org/wiki/Hrad_na_Z%C3%A1meck%C3%A9m_vrchu_u_He%C5%99manic_v_Podje%C5%A1t%C4%9Bd%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Z%C3%A1meck%C3%BD_vrch_u_He%C5%99manic_-_poz%C5%AFstatky_hradu_%281%29.jpg","page_title":"Hrad na Zámeckém vrchu u Heřmanic v Podještědí","context_page_description":"Hrad na Zámeckém vrchu je zaniklý hrad v Lužických horách v okrese Liberec. Jeho zbytky se nachází na vrcholu Zámeckého vrchu asi dva kilometry severozápadně od Heřmanic v Podještědí. Dochovaly se z něj pouze drobné zbytky zdiva a záseky ve skále."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Gro%C3%9Fostheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Breite_Stra%C3%9Fe_4_Gro%C3%9Fostheim_%281%29.jpg","page_title":"Liste der Baudenkmäler in Großostheim","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Großostheim zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 15. April 2020 wieder und enthält 140 Baudenkmäler."},{"page_url":"https://no.wikipedia.org/wiki/%C3%85re_kommune","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/%C3%85resj%C3%B6n_Dcastor_2003.jpg","page_title":"Åre kommune","context_page_description":"Åre kommune er en kommune i Jämtlands län i landskapet Jämtland i Sverige. Kommunens administrasjonssenter ligger i Järpen. Tettstedet Storlien ligger like ved grensen til Norge og er kjent for omfattende grensehandel. VM i alpint er arrangert i Åre i 1954, 2007 og 2019."},{"page_url":"https://es.wikipedia.org/wiki/Euphagus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Brewer%27s_Blackbird_female_RWD.jpg","page_title":"Euphagus","context_page_description":"Euphagus es un género de aves paseriformes de la familia Icteridae.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%B3%E3%83%8F%E3%83%83%E3%82%BF%E3%83%B3%E3%81%AE%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E5%9B%BD%E5%AE%B6%E6%AD%B4%E5%8F%B2%E7%99%BB%E9%8C%B2%E8%B2%A1%E3%81%AE%E4%B8%80%E8%A6%A7_(14%E4%B8%81%E7%9B%AE%E4%BB%A5%E5%8C%9759%E4%B8%81%E7%9B%AE%E4%BB%A5%E5%8D%97)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Grand_Hotel_1232-38_Broadway.jpg","page_title":"マンハッタンのアメリカ合衆国国家歴史登録財の一覧 (14丁目以北59丁目以南)","context_page_description":"この記事はニューヨーク市マンハッタン区の14丁目から59丁目の間にあるアメリカ合衆国国家歴史登録財に登録された建造物・場所の一覧である。マンハッタン区内の他の地区に位置する国家歴史登録財についてはニューヨーク郡のアメリカ合衆国国家歴史登録財の一覧を参照すること。\\nこのアメリカ合衆国国立公園局のリストは2015年8月14日に更新されたNPSの最新リストによって網羅されている。"},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%AAtes_maritimes_en_baie_de_Morlaix","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/08_rade-17.jpg","page_title":"Fêtes maritimes en baie de Morlaix","context_page_description":"Entre Terre et Mer ou Fêtes maritimes en baie de Morlaix est une manifestation maritime et terrestre se déroulant en Baie de Morlaix, de Morlaix à Roscoff. C'est une grande fête gratuite, ouverte à tous, unissant les agriculteurs et les gens de mer du pays de Morlaix, Léon et Trégor.\\nDe nombreux bateaux des côtes françaises, répliques ou restaurations des principaux bateaux traditionnels français, de pêche ou de travail, des grands voiliers locaux et de nombreux bateaux de plaisance, et des bateaux étrangers invités paradent en baie.\\nSur terre, des villages permanents à Morlaix et Roscoff proposent des stands agricoles, des animations sportives, expositions, conférences, ateliers gastronomiques, espace enfants, ainsi que de nombreuses animations musicales pour des fins de journées animées et conviviales."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9E%D0%BF%D0%BE%D0%BB%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Oppeln_-_Altstadt1-description.jpg","page_title":"Ополе","context_page_description":"Ополе, 1945 йылға тиклем Оппельн — Польшала Одра йылғаһы буйындағы ҡала. Ополе воеводлығының баш ҡалаһы. Төбәктең мәҙәни һәм фәнни үҙәге."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%8A%D1%80_%D0%A0%D0%B0%D0%B7%D0%B2%D0%B8%D0%B3%D0%BE%D1%80%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Alexandar_Razvigorov_i_semeystvo.JPG","page_title":"Александър Развигоров","context_page_description":"Александър Спиров Развигоров с псевдоним Рувим е български революционер, учител, деец на Вътрешната македоно-одринска революционна организация."},{"page_url":"https://de.wikipedia.org/wiki/Betty_Rosenfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Stolperstein_Stuttgart_-_Breitscheidstra%C3%9Fe_35_-_Charlotte%2C_Theresia%2C_Betty_Rosenfeld%2C_Charlotte_Behr.jpg","page_title":"Betty Rosenfeld","context_page_description":"Betty Rosenfeld war eine jüdische Krankenschwester, die als Freiwillige der Internationalen Brigaden am Spanischen Bürgerkrieg teilnahm."},{"page_url":"https://en.wikipedia.org/wiki/Steel_trap_(carnivorous_plants)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Dionaea-muscipula-Ausloeseborste-Mikroskopaufnahme.jpg","page_title":"Steel trap (carnivorous plants)","context_page_description":"Steel trap is an informal term in the study of comparative plant physiology of the carnivorous plants. \\"Steel trap\\", more particularly \\"active steel trap\\", refers to prey capture devices such as occur in some members of the family Droseraceae, and in particular in the genera Dionaea and Aldrovanda. The term apparently originated with the author Francis Ernest Lloyd in 1942, in which he adopted the overly general term \\"steel trap\\" rather than say, \\"gin trap\\" or a more adjectival form, for devices such as the lobed trap leaves of Dionaea.\\nThe distinctive attributes of \\"steel trap\\" devices are that:\\nthey are active, capturing prey with positive movements, not relying on mere stickiness, hooks, pitfalls or the like;\\nprey capturing activity occurs only in response to specific tactile stimuli — prey making contact with sensory bristles;\\nthe action is a thigmonastic, stereotyped, rapid movement."},{"page_url":"https://es.wikipedia.org/wiki/Rafaela_Ybarra_de_Vilallonga","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Beata_rafaela_ybarra_01.jpg","page_title":"Rafaela Ybarra de Vilallonga","context_page_description":"Rafaela de Ybarra fue una mujer y madre de familia perteneciente a la alta sociedad de Bilbao que, con el consentimiento de su marido José Vilallonga, fundó la Congregación de los Santos Angeles Custodios. Fue beatificada por el Papa Juan Pablo II en 1984 y actualmente se encuentra en proceso de canonización."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Blount_County,_Tennessee","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Willard-clark-house-maryville-tn1.jpg","page_title":"National Register of Historic Places listings in Blount County, Tennessee","context_page_description":"This is a list of the National Register of Historic Places listings in Blount County, Tennessee.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Blount County, Tennessee, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 75 properties and districts listed on the National Register in the county. Another 3 properties were previously listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://en.wikipedia.org/wiki/Coburg%E2%80%93Sonneberg_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Bahnstrecken-Coburger-Land-2017.png","page_title":"Coburg–Sonneberg railway","context_page_description":"The Coburg–Sonneberg railway is a single-track, electrified, 20 kilometre-long main line railway from Coburg in the German state of Bavaria via Neustadt to Sonneberg in Thuringia. It was opened in 1858 and is one of the oldest railways in Germany."},{"page_url":"https://eu.wikipedia.org/wiki/Ultzama_ibaia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Atarrabia_Arreko_Andra_Mariren_zubia2.jpg","page_title":"Ultzama ibaia","context_page_description":"Ultzama ibaia Nafarroa Garaiko iparraldeko ibai bat da. Ultzama udalerriarekin batera Ultzamaldea eskualdeari izen ematen dio."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D0%B5%D0%BB%D1%82%D0%BE%D1%85%D0%B2%D0%BE%D1%81%D1%82%D1%8B%D0%B9_%D1%86%D0%B2%D0%B5%D1%82%D0%BD%D0%BE%D0%B9_%D1%82%D1%80%D1%83%D0%BF%D0%B8%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Icterus_mesomelas.jpg","page_title":"Желтохвостый цветной трупиал","context_page_description":"Желтохвостый цветной трупиал — вид воробьиных птиц из семейства трупиаловых. Выделяют четыре подвида."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B5%B7%E7%A5%9E%E5%96%B7%E6%B3%89_(%E7%89%B9%E4%BC%A6%E6%89%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Trento-statua_Nettuno_originale_1.jpg","page_title":"海神喷泉 (特伦托)","context_page_description":"海神噴泉是義大利特倫托的一個噴泉，位於主教座堂廣場，由雕塑家Francesco Antonio Giongo建於1767-1769年。\\n海神雕像原來是科莫的Stefano Salterio的作品，1939年移到附近的圖恩宮的院子裡。目前的噴泉是Davide Rigatti的1945年青銅副本"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BB%D1%81%D1%82%D0%BE%D0%B9,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/I.N.Tolstoy_by_M.Zichy_%28before_1854%2C_Tretyakov_gallery%29.jpg","page_title":"Толстой, Иван Николаевич","context_page_description":"Иван Никола́евич Толсто́й — сенатор и тайный советник из осташковской ветви рода Толстых, участник Отечественной войны. Младший брат Я. Н. Толстого."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%BC%91%E6%96%AF%E6%95%A6%E7%8B%AC%E7%AB%8B%E5%AD%A6%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/LeeHighSchoolHoustonTX.JPG","page_title":"休斯敦独立学区","context_page_description":"休士頓獨立學區是哈里斯縣的學區, 總部在休斯敦哈蒂·馬·懷教育支持中心。 HISD是最大德克薩斯州的學區。 HISD也是第7大美國的學區。 在2009年-2010年HISD有298個學校和202,773名學生。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%95%D7%A1_%D7%90%D7%A0%D7%92%27%D7%9C%D7%A1_%D7%93%D7%95%D7%93%D7%92%27%D7%A8%D7%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Dodger-Stadium-Panorama-052707.jpg","page_title":"לוס אנג'לס דודג'רס","context_page_description":"לוס אנג'לס דודג'רס היא קבוצת בייסבול אמריקאית מליגת ה-MLB, שבסיסה בעיר לוס אנג'לס, קליפורניה. הקבוצה משחקת בבית המערבי של הנשיונל ליג.\\nהקבוצה נוסדה בברוקלין, ניו יורק ב-1883 והצטרפה לליגה המקצוענית שנקראה ההתאחדות האמריקאית, ב-1890 הצטרפה לנשיונל ליג בה משחקת עד היום. השם דודג'רס, שהתקבע ככינוי הקבוצה, נובע מן המילה האנגלית Dodged-התחמקות ומתייחס להולכי הרגל המתחמקים מן קרוניות הנוסעים באזור ברוקלין, ב-1958 עברה הקבוצה ללוס אנג'לס, כשהיא שומרת על הכינוי דודג'רס."},{"page_url":"https://ca.wikipedia.org/wiki/President_del_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/FranciscodePaulaRodriguesAlves.jpg","page_title":"President del Brasil","context_page_description":"El President del Brasil és el cap d'estat i de govern. Junt amb el vicepresident i ajudat pels ministres d'estat integren el poder executiu.\\nLa presidència del Brasil es va crear després de la instauració de la república que substituí l'imperi. Entre setembre de 1961 i gener de 1963, va tenir un règim parlamentari, i el cap de govern fou el primer ministre i no el president.\\nEl president i el vicepresident són elegits simultàniament per sufragi popular directe. La duració del seu mandat és de 4 anys, amb possibilitat de reelecció. És escollida la candidatura conjunta de president-vicepresident que obtingui la majoria absoluta dels vots vàlidament emesos. En cas de no ser així les candidatures que tinguin la primera i segona majoria passen a una segona volta. Les dades de les eleccions són el primer diumenge d'octubre per a la primera volta i l'últim diumenge del mateix mes per a la segona volta. Totes es realitzen en l'any anterior a la vigència del mandat presidencial."},{"page_url":"https://es.wikipedia.org/wiki/Cerquides","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Cerquides%2C_Lousame.png","page_title":"Cerquides","context_page_description":"Cerquides es una localidad del municipio español de Lousame, en Galicia. Pertenece a la parroquia de Lousame.\\nEn 2012 tenía una población de 77 habitantes.\\nDatos: Q12386013"},{"page_url":"https://ceb.wikipedia.org/wiki/Birrwil_(lungsod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/Karte_Gemeinde_Birrwil_2010.png","page_title":"Birrwil (lungsod)","context_page_description":"Lungsod ang Birrwil sa Nasod nga Swiss. Nahimutang ni sa distrito sa Bezirk Kulm ug kanton sa Kanton Aargau, sa sentro nga bahin sa nasod, 70 km sa amihanan-sidlakan sa Bern ang ulohan sa nasod. 508 metros ibabaw sa dagat kahaboga ang nahimutangan sa Birrwil, ug adunay 953 ka molupyo. Birrwil nga nahimutang sa lanaw sa Hallwilersee.\\nAng yuta palibot sa Birrwil kay medyo bungtoron. Ang kinahabogang dapit sa palibot dunay gihabogon nga 722 ka metro ug 1.0 km sa kasadpan sa Birrwil. Dunay mga 172 ka tawo kada kilometro kwadrado sa palibot sa Birrwil medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Reinach, 3.4 km sa habagatan sa Birrwil. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Birrwil.\\nAng klima hemiboreal. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 1,854 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 202 milimetro nga ulan, ug ang kinaugahan Marso, sa 76 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/S%C3%BCdhimmel","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/South_Hemisphere.png","page_title":"Südhimmel","context_page_description":"Der Südhimmel, Südsternhimmel oder südliche Sternenhimmel ist jene Hälfte des Sternenhimmels, die südlich des Himmelsäquators liegt und somit alle Punkte mit negativer Deklination umfasst. Vom Südpol aus kann der Südhimmel ganz überblickt werden; je weiter nördlich der Beobachtungsort, desto weniger ist von ihm sichtbar.\\nBei guten Sichtbedingungen umfasst der Südhimmel über 2.000 freiäugig sichtbare Fixsterne, bei Verwendung eines Feldstechers etwa 20.000 bis 40.000. In Großstädten sieht man auch bei wolkenlosem Nachthimmel je nach Ausmaß der Luft- und Lichtverschmutzung nur etwa 100 bis 500 Sterne. Die hellsten Sterne sind alle größer als unsere Sonne. Der hellste mit einer scheinbaren Helligkeit von −1,5 mag ist Sirius im Sternbild Großer Hund; er hat doppelten Sonnenradius und ist 8 Lichtjahre entfernt. Auch Canopus und der mit 4 Lichtjahren nächste Stern Toliman stehen am Südhimmel, allerdings mit rund 60° südlicher Deklination so nahe am Pol, dass beide von Mitteleuropa aus nicht beobachtet werden können.\\nDer Südhimmel zeigt etwas mehr Sterne als der Nordhimmel, da das Zentrum der Milchstraße etwa 20° südlich des Äquators im Sternbild Schütze liegt."},{"page_url":"https://de.wikipedia.org/wiki/Portia_(Arkansas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Dr._F.W._Buercklin_House.jpg","page_title":"Portia (Arkansas)","context_page_description":"Portia ist eine Stadt im Lawrence County, Arkansas, USA. Im Jahr 2010 hatte sie 437 Einwohner."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%81%E3%82%A2%E3%83%9F%E3%83%B3%E3%82%AA%E3%82%AD%E3%82%B7%E3%83%80%E3%83%BC%E3%82%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Thiamine_oxidase_reaction.PNG","page_title":"チアミンオキシダーゼ","context_page_description":"チアミンオキシダーゼは、次の化学反応を触媒する酸化還元酵素である。\\n反応式の通り、この反応は二段階で起こる。まず、チアミンが酸化されてチアミンアルデヒドとなり、さらに酸化されてチアミン酢酸となる。この反応では補因子としてFADを用いる。\\n組織名はthiamine:oxygen 5-oxidoreductaseで、別名にthiamin dehydrogenase, thiamine dehydrogenase, thiamin:oxygen 5-oxidoreductaseがある。"},{"page_url":"https://es.wikipedia.org/wiki/El_Cabaco","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Bandera_de_El_Cabaco_%28Salamanca%29.svg","page_title":"El Cabaco","context_page_description":"El Cabaco es un municipio y localidad española de la provincia de Salamanca, en la comunidad autónoma de Castilla y León. Se integra dentro de la comarca de la Sierra de Francia. Pertenece al partido judicial de Ciudad Rodrigo y a la Mancomunidad Las Dehesas.​\\nSu término municipal está formado por las localidades de El Cabaco, Peña de Francia, Zarzosillo y Zarzoso, ocupa una superficie total de 47,35 km² y según los datos demográficos recogidos en el padrón municipal elaborado por el INE en el año 2017, cuenta con 245 habitantes."},{"page_url":"https://fr.wikipedia.org/wiki/Incendie_d%27une_discoth%C3%A8que_%C3%A0_G%C3%B6teborg_en_1998","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Backabranden_minnesstenen_2012.jpg","page_title":"Incendie d'une discothèque à Göteborg en 1998","context_page_description":"L'incendie survenu le 29 octobre 1998 dans un local associatif de Göteborg, transformé pour un soir en discothèque, est l'une des plus grandes catastrophes de l'histoire moderne de la Suède : il a causé la mort de 63 jeunes, âgés de douze à vingt ans. Les flammes s'étant déclarées dans l'unique escalier de secours, l'évacuation n'était possible que par l'entrée et par les fenêtres, et de nombreuses personnes furent prises au piège dans un local dont la capacité d'accueil était largement dépassée. La piste criminelle fut immédiatement évoquée, mais ce n'est qu'en 2000 que les coupables furent arrêtés et condamnés."},{"page_url":"https://lt.wikipedia.org/wiki/Mass_Effect_(serija)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/10.15.11MacWaltersByLuigiNovi1.jpg","page_title":"Mass Effect (serija)","context_page_description":"Mass Effect – mokslinės fantastikos tematikos veiksmo vaidmenų trečiojo asmens šaudyklių serija, sukurta kanadiečių įmonės „BioWare“ ir išleista Xbox 360, PlayStation 3, Microsoft Windows bei Wii U platformoms. Ketvirtoji serijos dalis išleista Windows, PlayStation 4 ir Xbox One platformoms.\\nPirmosios žaidimų trilogijos veiksmas sukasi aplink Paukščių Tako galaktikos rasių, tarp jų ir žmonijos, kovą su organinėmis mašinomis. Visi trys žaidimai susilaukė kritikų pripažinimo istorijos plėtojimo, veikėjų vystymo, romantikos, įgarsinimo, pasirinkimų, turinčių įtakos žaidimo eigai, ir nuodugnaus galaktikos perteikimo jausmo srityse. Be pagrindinės žaidimų trilogijos, buvo išleista žaidimų su šalutinėmis istorijomis, romanų, komiksų, filmų, stalo žaidimų, piešinių knygų, veikėjų figurėlių ir kitokios produkcijos."},{"page_url":"https://et.wikipedia.org/wiki/Jermaine_Pennant","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Jermaine_Pennant.jpg","page_title":"Jermaine Pennant","context_page_description":"Jermaine Lloyd Pennant on Inglismaa jalgpallur.\\nTa on karjääri jooksul mänginud sellistes klubides nagu Notts County, Arsenal, Watford, Leeds United, Birmingham City, Liverpool, Portsmouth ja Real Zaragoza."},{"page_url":"https://fr.wikipedia.org/wiki/Annexion_de_la_Savoie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Rattachement-chablais-faucigny-genevois-savoie-suisse.jpg","page_title":"Annexion de la Savoie","context_page_description":"L'annexion de la Savoie est le nom générique donné à la réunion, selon l’expression utilisée dans le traité de Turin dans sa version française, de l’ensemble de la Savoie, correspondant au duché homonyme, et du comté de Nice, alors partie intégrante du royaume de Sardaigne, à la France en 1860.\\nBien que le pays ait été occupé, voire annexé, à plusieurs reprises, l’expression renvoie à la clause de « réunion » prévue par l’article 1ᵉʳ du traité de Turin du 24 mars 1860."},{"page_url":"https://de.wikipedia.org/wiki/Neues_Greetsieler_Sieltief","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/KarteKrummhoern.png","page_title":"Neues Greetsieler Sieltief","context_page_description":"Das Neue Greetsieler Sieltief ist ein Wasserlauf in den Gemeinden Krummhörn und Hinte im Landkreis Aurich in Ostfriesland. Es handelt sich dabei, wie bei den meisten Tiefs in der Region, um ein künstlich angelegtes bzw. ausgebautes Gewässer. Wie der Name bereits andeutet, dient es der Entwässerung der nur wenig über bzw. teils auch unter Normalhöhennull liegenden Region durch ein Siel, in diesem Fall dasjenige in Greetsiel."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB%D0%B0%D1%82%D0%BE%D0%BD%D0%B1%D0%BE%D0%B3%D0%BB%D0%B0%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Ko%C5%9Bci%C3%B3%C5%82_parafialny_w_Balatonbogl%C3%A1r_2001.jpg","page_title":"Балатонбоглар","context_page_description":"Балатонбоглар — город в юго-западной Венгрии в медье Шомодь. Расположен на южном берегу озера Балатон. Население по данным на 2004 год — 6 044 человека. Известный курорт.\\nГород расположен примерно в 150 километрах к юго-западу от Будапешта. В 40 километрах к западу расположен город Кестхей, в 35 километрах к северо-востоку — Шиофок, а в 50 километрах к югу находится столица медье — Капошвар. Рядом с городом проходят автомобильное шоссе E71 Будапешт — Надьканижа — Загреб и железнодорожная магистраль Будапешт — Загреб. С 1979 года по 1991 год Балатонбоглар и прилегающий к нему посёлок Балатонлелле были объединены в один город Богларлелле.\\nВпервые населённый пункт с таким названием упомянут в 1211 году. Как туристическо-курортный центр начал развиваться на стыке XIX и XX веков. Балатонбоглар, как и большинство городов региона, обладает термальными источниками, на которых построены купальни. Кроме санаторно-курортного обслуживания в городе и окрестностях, развито виноградарство и виноделие.\\nСимволом города служит башня Ксантуша на вершине холма над Балатонбогларом, названная в честь биолога Яноша Ксантуша."},{"page_url":"https://hu.wikipedia.org/wiki/2013_%C3%BAj_vil%C3%A1g%C3%B6r%C3%B6ks%C3%A9gi_helysz%C3%ADnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Al_Zubara_%286966524441%29.jpg","page_title":"2013 új világörökségi helyszínei","context_page_description":"A világörökségi listára kiemelkedő jelentőségű és egyetemes értéket képviselő kulturális és természeti helyszínek kerülhetnek fel, amelyek nemcsak az adott ország, hanem az egész emberiség számára egyedi jelentőséggel bírnak. A világ kulturális és természeti örökségének védelméről szóló Világörökségi Egyezményt az UNESCO dolgozta ki és a szerződő államok 1972. november 16-án fogadták el. Az aláíró államok aktív részvételre kötelezik magukat legfontosabb természeti kincseik és műemlékeik megőrzésében. A helyszínek először a javaslati listára kerülnek fel, majd az UNESCO Világörökség Bizottsága évente egyszer dönt arról, hogy ezek közül melyik helyszín kerül fel a Világörökségi Listára.\\nAz UNESCO Világörökség Bizottsága 2013-ban a következő helyszíneket nyilvánította a világörökség részévé:"},{"page_url":"https://de.wikipedia.org/wiki/K%C3%BCstendienst_der_Deutschen_Ost-Afrika_Linie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Adjutant_%281%29_DOAL.jpg","page_title":"Küstendienst der Deutschen Ost-Afrika Linie","context_page_description":"Der Küstendienst der Deutschen Ost-Afrika Linie an der afrikanischen Küste bestand von 1890 bis 1914."},{"page_url":"https://en.wikipedia.org/wiki/List_of_lighthouses_in_Mexico","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/PAngelLthouse.JPG","page_title":"List of lighthouses in Mexico","context_page_description":"This is a list of lighthouses in Mexico. They are located along the Pacific, Gulf of Mexico, and Caribbean coastlines of the country. These are named landfall lights, or those with a range of over fifteen nautical miles."},{"page_url":"https://ca.wikipedia.org/wiki/Calendari_asteca","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/CalendariAsteca.jpg","page_title":"Calendari asteca","context_page_description":"El calendari asteca va ser usat per aquest poble i altres cultures americanes en dues versions, una religiosa i una civil, per mesurar el pas del temps per a l'agricultura i les festivitats. Sembla que el primer mes corresponia a una data entre febrer i març. Quan els dos calendaris acabaven el mateix dia, cada 52 anys, es canviava d'era i se celebrava amb una gran festa del foc. Aquest segle es combinava també amb un cicle de Venus, anomenat vellesa. El calendari asteca fou trobat el 1709 durant el nou empedrat de la plaça principal de Ciutat de Mèxic."},{"page_url":"https://fr.wikipedia.org/wiki/Ion_Beam_Applications","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Belgique_-_Louvain-la-Neuve_-_IBA_-_03.jpg","page_title":"Ion Beam Applications","context_page_description":"Ion Beam Applications est une entreprise basée à Louvain-la-Neuve, section de la ville belge d'Ottignies-Louvain-la-Neuve en Belgique.\\nÀ l'origine spin-off de l'Université catholique de Louvain, IBA est devenu en trente ans le leader mondial de la protonthérapie pour le traitement du cancer."},{"page_url":"https://pt.wikipedia.org/wiki/L%C3%ADder_em_assist%C3%AAncias_da_NBA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Oscar_Robertson_1960s.jpeg","page_title":"Líder em assistências da NBA","context_page_description":"No basquete, uma assistência é um passe para um companheiro de equipe que leva diretamente a uma pontuação. O título de líder de assistência da National Basketball Association é concedido ao jogador com a maior média de assistências por jogo em um cada temporada da liga.\\nO título de assistências foi reconhecido pela primeira vez na temporada 1946-1947, quando as estatísticas sobre assistências foram compiladas pela Associação de Basquete da América, antecessora da NBA. Para se qualificar para o título de assistência, o jogador deve jogar pelo menos 58 jogos.\\nJohn Stockton detém os recordes de todos os tempos, em assistências totais e assistências por jogo em uma temporada, alcançada nas temporadas 1990-91 e 1989-90, respectivamente. Mark Jackson detém os recordes de novato no total de assistências e assistências por jogo, quando deu 868 assitências na sua primeira temporada e teve média de 10.6 na temporada 1987-88. < Entre os jogadores ativos, Chris Paul tem o total de assistências em uma temporada, em 2007-08 e Rajon Rondo teve a média de assistências em uma temporada, em 2011-12.\\nStockton foi o jogador que mais ganhou o prêmio, em 9 temporadas."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Rehburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Rehburg_1586.jpg","page_title":"Burg Rehburg","context_page_description":"Die Burg Rehburg ist eine etwa im 13. Jahrhundert erbaute Burganlage in Rehburg, im heutigen Niedersachsen. Sie war eine Trutzburg der Welfen gegen die Grafen von Hoya, ebenso gegen die Grafen von Schaumburg und den Bischof von Minden. Auf den Grundmauern der Burg entstand im 18. Jahrhundert ein Fachwerkgebäude, in dem sich ein\\nAmtshof und später ein Forstamt befanden. Heute dienen die Baulichkeiten mit Erweiterungsbauten aus den 1980er Jahren der Stadt Rehburg-Loccum als Rathaus."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Kirrweiler_(Pfalz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Kirrweiler_2382.jpg","page_title":"Liste der Kulturdenkmäler in Kirrweiler (Pfalz)","context_page_description":"In der Liste der Kulturdenkmäler in Kirrweiler (Pfalz) sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Kirrweiler (Pfalz) aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://de.wikipedia.org/wiki/Teapot-Dome-Skandal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Denby-Washington.jpg","page_title":"Teapot-Dome-Skandal","context_page_description":"Der Teapot-Dome-Skandal war der größte politische Bestechungsskandal der USA der frühen 1920er Jahre und über diese Zeit hinaus noch lange ein Symbol für Korruption.\\nUm sich die lukrative private Erschließung von sich im Staatsbesitz befindenden Ölfeldern zu sichern, hatten zwei Ölkonzerne 1921/22 Innenminister Albert B. Fall bestochen. Fall war 1929 der erste amerikanische Minister, der für ein während seiner Amtszeit begangenes Verbrechen eine Haftstrafe antreten musste."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B9%D0%BE%D0%BD%D0%B8_%D0%A2%D1%83%D1%80%D0%BA%D1%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Turku%2C_Koroinen_%28ward%29.png","page_title":"Райони Турку","context_page_description":"Райони Турку — територіальні одиниці міста Турку, утворені з урахуванням історичних, географічних, містобудівних особливостей відповідних територій, чисельності населення, соціально-економічних характеристик, розташування транспортних комунікацій, наявності інженерної інфраструктури та інших особливостей території.\\nНа 2011 в Турку було 78 районів, розподілених між 9 адміністративними округами."},{"page_url":"https://tl.wikipedia.org/wiki/Gildone","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Campobasso_posizione.png","page_title":"Gildone","context_page_description":"Ang Gildone ay isang comune sa lalawigan ng Campobasso sa bansang Italya."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CE%B1%CE%90%CE%BC_%CE%A3%CE%BB%CE%B9%CF%84%CE%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Bel-Tun_%2823%29.jpg","page_title":"Ναΐμ Σλιτί","context_page_description":"Ο Ναΐμ Σλιτί είναι Τυνήσιος διεθνής ποδοσφαιριστής, γεννημένος στις 27 Ιουλίου 1992 στην Μασσαλία. Αγωνιζόμενος στην θέση του επιθετικού μέσου, αυτό τον καιρό αγωνίζεται για λογαριασμό της Ντιζόν, ενώ έχει κατά το παρελθόν αγωνιστεί για λογαριασμό των ΚΣ Σεντάν-Αρδέννες, Παρί ΦΚ, Ρεντ Σταρ και Λιλ."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Diocese_of_Djibouti","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Cath%C3%A9drale_de_Djibouti.jpg","page_title":"Roman Catholic Diocese of Djibouti","context_page_description":"The Roman Catholic Diocese of Djibouti is the Latin sole diocese in the country of Djibouti in the Horn of Africa.\\nIt is exempt, i.e. directly subject to the Holy See and its missionary Roman Congregation for the Evangelization of Peoples.\\nIt has its Cathedral episcopal see, the Our Lady of the Good Shepherd Cathedral, Djibouti, in the national capital Djibouti City."},{"page_url":"https://et.wikipedia.org/wiki/Joodis","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Solda_de_estanho.JPG","page_title":"Joodis","context_page_description":"Joodis on metallisulam, millega liidetakse metallist või metalliseeritud detaile temperatuuril. Joodise sulamistemperatuur peab alati olema madalam liidetavate osade sulamistemperatuurist. Metallitööde juures eristatakse pehme- ja kõvajoodiseid."},{"page_url":"https://es.wikipedia.org/wiki/Misiones_diplom%C3%A1ticas_de_Serbia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Serbian_Consulate_General_in_Sydney.jpg","page_title":"Misiones diplomáticas de Serbia","context_page_description":"Abajo se encuentra las embajadas y consulados de Serbia:"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D8%A7%D9%86%D8%AF%D9%89_%D8%AC%D9%88%D9%85%D9%BE%D9%8A%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Randy_Gumpert.jpg","page_title":"راندى جومپيرت","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nراندى جومپيرت كان لاعب بيسبول من امريكا."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D0%B8_%D0%99%D0%BE%D0%B0%D0%BD_%D0%9A%D1%80%D1%8A%D1%81%D1%82%D0%B8%D1%82%D0%B5%D0%BB_(%D0%92%D0%B0%D0%BB%D0%B5%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Stjohns-cathedral-209.jpg","page_title":"Свети Йоан Кръстител (Валета)","context_page_description":"„Свети Йоан Кръстител“ е римокатолически християнски храм, разположен в столицата на Малта – Валета. Има статут, равен с този на архиепископската катедрала „Свети Павел“ в старата столица Мдина, и затова се нарича конкатедрала. Построен е през XVI век като монашеска църква за нуждите на ордена на рицарите хоспиталиери, наричани още малтийски рицари. Храмът е посветен на Свети Йоан Кръстител, който е патрон на ордена. В сградата са погребани около 400 членове на ордена, чиито надгробни плочи, изпълнени като цветни каменни пана, са сред основните художествено-исторически богатства на Малта. Тук се намира и специално нарисуваната за пристроения параклис картина „Обезглавяването на Свети Йоан Кръстител“ от живелия в Малта италиански художник Караваджо. Катедралата е обявена за уникален паметник със световно културно и историческо значение, като част от груповия паметник Валета."},{"page_url":"https://en.wikipedia.org/wiki/AAI_RQ-7_Shadow","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/RQ-7_Launch.jpg","page_title":"AAI RQ-7 Shadow","context_page_description":"The AAI RQ-7 Shadow is an American unmanned aerial vehicle used by the United States Army, Australian Army, Swedish Army, and Italian Army for reconnaissance, surveillance, target acquisition and battle damage assessment. Launched from a trailer-mounted pneumatic catapult, it is recovered with the aid of arresting gear similar to jets on an aircraft carrier. Its gimbal-mounted, digitally stabilized, liquid nitrogen-cooled electro-optical/infrared camera relays video in real time via a C-band line-of-sight data link to the ground control station.\\nThe US Army's 2nd Battalion, 13th Aviation Regiment at Fort Huachuca, Arizona, trains soldiers, Marines, and civilians in the operation and maintenance of the Shadow UAS. The Shadow is operated in the U.S. Army at brigade-level."},{"page_url":"https://eu.wikipedia.org/wiki/Kie%C5%82czyg%C5%82%C3%B3w_udalerria","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Gmina_Kie%C5%82czyg%C5%82%C3%B3w.png","page_title":"Kiełczygłów udalerria","context_page_description":"Kiełczygłów Poloniako Lodzeko voivoderriko landa-udalerri bat da, Pajęczno barrutian kokatuta. 87,2 km²ko azalera du eta 2017ko datuen arabera 4096 biztanle zituen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Landschaftsschutzgebiete_im_Landkreis_Breisgau-Hochschwarzwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Krozinger_und_Schlatter_Berg_jm65533.jpg","page_title":"Liste der Landschaftsschutzgebiete im Landkreis Breisgau-Hochschwarzwald","context_page_description":"Im Landkreis Breisgau-Hochschwarzwald gibt es 33 Landschaftsschutzgebiete. Nach der Schutzgebietsstatistik der Landesanstalt für Umwelt, Messungen und Naturschutz Baden-Württemberg stehen 62.709,29 Hektar der Landkreisfläche unter Landschaftsschutz, das sind 45,50 Prozent."},{"page_url":"https://es.wikipedia.org/wiki/Abies_durangensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Abies_tamazula_dgo.jpg","page_title":"Abies durangensis","context_page_description":"Abies durangensis es una especie de conífera perteneciente a la familia Pinaceae. Son endémicas de México donde se encuentran en Durango, Chihuahua, Coahuila, Jalisco y Sinaloa. También es conocido como 'Árbol de Coahuila' y 'pino mexicano'.​"},{"page_url":"https://pl.wikipedia.org/wiki/Premierzy_W%C4%99gier","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/P%C3%A1l_Teleki_01.jpg","page_title":"Premierzy Węgier","context_page_description":null},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%A8%D7%A8%D7%AA_%D7%90%D7%A6%27%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Echo_parakeet_%28Psittacula_eques_echo%29_-at_Durrell_Trust.jpg","page_title":"דררת אצ'ו","context_page_description":"דררת אצ'ו הוא של תוכי ממשפחת הדרראים ומהסוג דררה. אנדמית לאי מאוריציוס שבאוקיינוס ההודי."},{"page_url":"https://id.wikipedia.org/wiki/Bayerisch_Gmain","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Grossgmain.jpg","page_title":"Bayerisch Gmain","context_page_description":"Bayerisch Gmain adalah kota yang terletak di distrik Berchtesgadener Land di Bavaria, Jerman. Kota Bayerisch Gmain memiliki luas sebesar 11.40 km². Bayerisch Gmain pada tahun 2006, memiliki penduduk sebanyak 2.990 jiwa."},{"page_url":"https://en.wikipedia.org/wiki/Saint-Nom-la-Bret%C3%A8che","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Saint-Nom-la-Bret%C3%A8che_Mare.JPG","page_title":"Saint-Nom-la-Bretèche","context_page_description":"Saint-Nom-la-Bretèche is a wealthy commune in the Yvelines department in the Île-de-France in north-central France."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%B4%84%E5%85%8B%E9%8E%AE%E8%99%9F%E8%88%AA%E7%A9%BA%E6%AF%8D%E8%89%A6_(CV-10)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/FG-1D_VBF-88_on_USS_Yorktown_%28CV-10%29_1945.jpg","page_title":"約克鎮號航空母艦 (CV-10)","context_page_description":"約克鎮號航空母艦是一艘隸屬於美國海軍的航空母艦，為艾塞克斯級航空母艦的二號艦。她是美軍第四艘以約克鎮為名的軍艦，紀念美國獨立戰爭中的約克鎮圍城戰役。\\n約克鎮號於1941年開始建造，艦名原為好人理查。建造僅開始數日，日本偷襲珍珠港，美國正式參與第二次世界大戰，並加快建造艾塞克斯號等航空母艦。1942年，日軍在中途島海戰擊沉了舷號CV-5的約克鎮號，美軍在稍後將建造中的CV-10更名為約克鎮號，以作紀念。\\n1943年約克鎮號下水服役，開始參與太平洋戰爭。戰後約克鎮號退役封存，並在稍後進行代號SCB-27A現代化改建。改建期間，約克鎮號被重編為攻擊航艦。1953年約克鎮號完成改建，但在前往西太平洋前夕，韓戰剛好結束，約克鎮號無緣參與。接著約克鎮號留在西太平洋執勤，並在大陳島撤退中援助民國政府，然後進行SCB-125改建，增設斜角飛行甲板。\\n1957年約克鎮號重編為反潛航艦，舷號改為CVS-10，繼續留在西太平洋。稍後約克鎮號在八二三炮戰期間再次到台灣海峽巡邏，並在越戰期間到南中國海執勤，但未有派飛機參與攻擊。除冷戰衝突外，約克鎮號亦有參與美國的太空計畫，擔任阿波羅8號指揮艙的救援船。服役晚年，約克鎮號調到大西洋艦隊。\\n約克鎮號在1970年退役，並在1973年除籍。稍後海軍將約克鎮號改建為博物館艦；博物館在1976年於查爾斯頓愛國者地開放，並在1986年獲評為美國國家歷史地標。"},{"page_url":"https://tr.wikipedia.org/wiki/Chester_Beatty_Papir%C3%BCsleri","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/P._Chester_Beatty_I%2C_folio_13-14%2C_recto.jpg","page_title":"Chester Beatty Papirüsleri","context_page_description":"Chester Beatty Papirüsleri, Kitab-ı Mukaddes'ten parçalar içeren Yunanca kaleme alınmış bir grup antik papirüstür. Toplamda 11 farklı elyazması içeren papirüslerin yedisi Eski Ahit'e ahit içeriğe sahipken, üç adeti Yeni Ahit'e ahit içeriğe sahiptir. Geriye kalan son elyazması Hanok kitabından parçalar ve kime ait olduğu belirlenemeyen bir Hristiyan vaazı içermektedir. Büyük çoğunluğu kabaca 3. yüzyıla tarihlenen papirüslerin günümüzde Dublin'de Chester Beatty Kütüphanesi'nde ve Michigan Üniversitesi'nde korunmaktadırlar.\\nİllegal yollar aracılığıyla ulaşılan papirüslerin nerede ve nasıl bulundukları bilinmemektedir. Bazı iddialara göre papirüslerden birinin kullandığı Kıptice nedeniyle Mısır'da Feyyum yakınlarında ya da Aphroditopolis'te bulunmuştur. Elyazmaları Alfred Chester Beatty tarafından 1930lu yıllarda satın alınmış ve bugün de hala onun adıyla anılmaktadır. Yazmaların bazı parçaları Michigan Üniversitesi ve diğer koleksiyoncular tarafından satın alınmıştır."},{"page_url":"https://pt.wikipedia.org/wiki/Ti%C5%A1ice","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Ti%C5%A1ice%2C_M%C4%9Blnick%C3%A1_str.jpg","page_title":"Tišice","context_page_description":"Tišice é uma comuna checa localizada na região da Boêmia Central, distrito de Mělník."},{"page_url":"https://de.wikipedia.org/wiki/Niederlindach_(He%C3%9Fdorf)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Niederlindach_-_Kreuzigungsgruppe_-_D-5-72-133-30_%283%29.jpg","page_title":"Niederlindach (Heßdorf)","context_page_description":"Niederlindach ist ein Ortsteil der Gemeinde Heßdorf im Landkreis Erlangen-Höchstadt in Mittelfranken."},{"page_url":"https://en.wikipedia.org/wiki/United_States_Secretary_of_Labor","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Williamebrock.jpg","page_title":"United States Secretary of Labor","context_page_description":"The United States Secretary of Labor is a member of the Cabinet of the United States, and as the head of the United States Department of Labor, controls the department, and enforces and suggests laws involving unions, the workplace, and all other issues involving any form of business-person controversies.\\nFormerly, there was a U.S. Secretary of Commerce and Labor, who led this department along with the U.S. Department of Commerce as one department. Since the two departments split in 1913, the Department of Commerce is now headed by a separate U.S. Secretary of Commerce.\\nEugene Scalia, a son of the late U.S. Supreme Court Justice Antonin Scalia, has served as Secretary of Labor since September 30, 2019."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%82%AB%E3%82%AA%E6%AD%B4%E5%8F%B2%E5%9C%B0%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Under_the_section_of_the_old_city_wall%2C_the_side_of_Na_Tcha_Temple_and_the_back_of_Ru%C3%ADnas_de_S.Paulo.JPG","page_title":"マカオ歴史地区","context_page_description":"マカオ歴史地区とは、中華人民共和国の特別行政区であるマカオにある、20以上の建築や広場などの古跡を含む地区である。かつてのポルトガルの植民地であったマカオにおける東西文化のユニークな同化と共存を窺い知ることができる。2005年、中国で31番目のユネスコ世界遺産に登録された。"},{"page_url":"https://fr.wikipedia.org/wiki/Carl_Grundstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Marlies-vs-stars---060318_42492589222_o_%2841215785670%29.jpg","page_title":"Carl Grundström","context_page_description":"Carl Grundström est un joueur professionnel suédois de hockey sur glace. Il évolue au poste d'ailier gauche."},{"page_url":"https://en.wikipedia.org/wiki/Pulford","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/St_Mary%27s_Church%2C_Pulford.jpg","page_title":"Pulford","context_page_description":"Pulford is a village and former civil parish, now in the parish of Poulton and Pulford, in the unitary authority of Cheshire West and Chester and the ceremonial county of Cheshire, England. It is on the B5445 road, to the south west of Chester and on the border with Wales. It is believed that the name of the village is derived from the Welsh words Pwll \\"marsh\\" and Ffordd \\"crossing\\". According to the 2001 Census, the population of the entire parish was 395, increasing to 580 at the 2011 Census. The civil parish was abolished in 2015 to form Poulton and Pulford.\\nPulford Castle, which no longer stands, was a small Norman motte-and-bailey defensive structure. Today, only the mound of the castle remains, just behind the church of S Mary, on the outskirts of the village. The castle was built at a strategic location, protecting a road at a river crossing. Although no firm date of construction is recorded, it is believed to have been built around 1100. The castle is mentioned as having a garrison stationed at it, during the revolt of Owain Glyndŵr in 1403.\\nPulford Parish Church is named after St. Mary."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A7%D0%B5%D1%81%D0%BA%D0%B5-%D0%91%D1%83%D0%B4%D0%B5%D1%91%D0%B2%D0%B8%D1%86%D0%B5_(%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/NH_kl%C3%A1%C5%A1ter.jpg","page_title":"Ческе-Будеёвице (район)","context_page_description":"Ческе-Будеевице районы — Чехияның Көньяҡ Чехия крайындағы 7 райондарының береһе. Административ үҙәге булған Ческе-Будеевице ҡалаһы тора. Райондың майҙаны 1638,30 майҙаны квадрат километр тәшкил итә, халыҡ һаны — 187 881 кеше. Ческе-Будеевице районы 109 тораҡ пункттарынан, шул иҫәптән 9 ҡаланан тора."},{"page_url":"https://pt.wikipedia.org/wiki/Caladeniinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Caladeniinae_distribution_map.png","page_title":"Caladeniinae","context_page_description":"Caladeniinae é uma subtribo de orquídeas classificada na tribo Diurideae, composta por espécies terrestres, presentes principalmente na Austrália e Nova Zelândia, além de algumas espécies em Java, Sulawesi e outras pequenas ilhas próximas, muitas vezes em áreas restritas, dispersas por ambientes diversos que variam em conformidade com os gêneros.\\nA caracterização de Caladeniinae entre as Diurideae, tribo à qual pertence, dá-se por serem as únicas plantas a apresentarem ao mesmo tempo todas as seguintes qualidades: serem plantas compostas por sistema subterrâneo quase sempre composto por raízes com tubérculos carnosos, e parte aérea anual formada por caules e ou folhas e inflorescências, recobertos por tricomas de células basais intumescidas.\\nCaladeniinae é composta por cerca de trezentas e quinze espécies divididas por onze gêneros os quais, além das características acima enumeradas, tem tubérculos formados por diversas camadas de fibras, folhas solitárias, inflorescências racemosas ou solitárias com flores ressupinadas de segmentos semelhantes, labelo móvel, trilobado com glândulas variadas, coluna apoda, geralmente sem polinário e com quatro ou oito polínias."},{"page_url":"https://cs.wikipedia.org/wiki/Hanazono","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Emperor_Hanazono_detail.jpg","page_title":"Hanazono","context_page_description":"Hanazono byl v pořadí 95. japonským císařem. Vládcem se stal v roce 1308, v roce 1318 abdikoval, tj. dobrovolně se vzdal trůnu. Jeho vlastní jméno bylo Tomihito.\\nHanazono byl čtvrtým synem císaře Fushimiho. Císařem se stal v roce 1308 poté, co na nemoc zemřel císař Go-Nijo. Během Hanazonovy vlády došlo k ujednání s šógunátem, že každých deset let se budou na trůnu střídat dvě linie vládnoucího rodu. Tato smlouva ale dlouho nevydržela, byla zrušena již následujícím císařem Go-Daigem.\\nPo své abdikaci v roce 1318 začal s výchovou svého synovce, který byl budoucím císařem Kogonem. V roce 1335 se Hanazono stává buddhistickým knězem větve Zen. V roce 1348 umírá.\\nAutoritní data: GND: 120776413 | ISNI: 0000 0001 2278 9215 | LCCN: n82146364 | VIAF: 42677800 | WorldcatID: lccn-n82146364\\nPortály: Japonsko | Lidé"},{"page_url":"https://sv.wikipedia.org/wiki/%C3%98rens_Mekaniske_V%C3%A6rksted","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/SS_Femund_II_Engineering_Drawing.jpg","page_title":"Ørens Mekaniske Værksted","context_page_description":"Ørens Mekaniske Værksted og Jernstøberi var en mekanisk verkstad i Trondheim.\\nØrens Mekaniske Værksted og Jernstøberi etablerades vid Nedre Elvehavn 1883 av ingenjören Edvard I. Olsen och började som reparationsvarv. Från 1890-talet hade verkstaden 70–80 anställda och byggde små ångfartyg. År 1896 utvidgades verksamheten med ett gjuteri, som bland annat göt kaminar, och 1900 med en slip för underhåll och reparation av fartyg. 1929 köptes Ilens Skipsverft i Ilsvika i Trondheim. Ørens Mekaniske Værksted gick i konkurs 1959 och såldes till Ila og Lilleby Smelteverker 1961. Gjuteriet lades ned på 1960-talet, medan fartygstillverkningen upphörde 1978. Verksamheten lades ned helt 1987.\\nSedan dess har Nedre Elvehavn byggts om till ett område med bostäder, köpcentrum och kontor."},{"page_url":"https://ja.wikipedia.org/wiki/2016%E5%B9%B4%E3%81%AE%E5%8F%B0%E9%A2%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/JMA_TD_14_2016-08-10_0210Z.jpg","page_title":"2016年の台風","context_page_description":"2016年の台風のデータ。データは基本的に気象庁の情報に基づくが、気象庁が熱帯低気圧としていないものについては、合同台風警報センターのみに因る。\\n2015年12月23日に熱帯低気圧が消滅して以来、2016年5月26日までおよそ5か月間に渡って熱帯低気圧が発生しなかった。2016年はエルニーニョ現象が終息に向かっていたため、北西太平洋では例年より非常に強い太平洋高気圧に覆われ、熱帯低気圧が発生しにくい状況が続いていた。\\nそのため、この年は台風1号の発生が7月3日と記録的に遅く、最初の台風発生が7月にまでずれ込んだのは1998年以来18年ぶりであり、1951年の統計開始以降では2番目に遅い台風1号の発生となった。しかしその後、それまでの状況に反して、7月下旬以降、台風や熱帯低気圧の発生ペースが上がり、7月24日から30日にかけての1週間で台風が3個発生するなどした。8月と9月には平年を上回る月間7個の台風が発生し、10月に4個、11月に3個、12月に1個の台風が発生したため、最終的に年間の発生数は26個と平年並みになった。すなわち、最初の台風発生が非常に遅かった割には、それ以降は台風が一貫してハイペースで発生したことにより、7月から12月までの半年に満たない期間に、1年あたりの平年並みの数の台風が発生したことになる。\\n日本への影響においては、接近数が平年並みの11個、上陸数は統計史上2位タイの多さとなる6個であった。\\n8月中旬には太平洋北西部に3個の台風が同時に存在していたことがあった。8月には太平洋高気圧が日本の東にあったため日本付近を北上する台風が相次ぎ、7号・11号・9号の順で北海道に上陸し、1年に3個の台風が北海道に上陸するのは初めてとなった。また台風10号は観測史上初めて東北地方の太平洋側に上陸し、北日本に大きな豪雨被害をもたらした。最終的に1年間の日本への上陸数は6個となり、観測史上2位となった。また、台風の最大風速に満たないの熱帯低気圧も多発した。台風2号や10号、11号など、日本近海や北緯30度前後で発生した台風や、台風3号や8号、15号のように、中国大陸のすぐそばで発生するなど、台風の発生位置は比較的高緯度である場合が多かった。\\n記録的な発生の遅さとなった台風1号は、台風1号にして史上初めて「猛烈な」勢力となり、台風1号としては過去最強となった。台風1号の最低気圧は900hPaであったが、このほかにも最低気圧が900hPa以下となった台風が2個発生しており、9月の台風14号は890hPa、10月の台風22号は900hPaにまでそれぞれ発達し、最低気圧が900hPa以下の台風が1年で複数個発生したのは1991年以来25年ぶりであり、さらに3個以上の発生は1983年以来33年ぶりであった。"},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_della_Santissima_Trinit%C3%A0_dei_Pellegrini_(Roma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/San_Filippo_Neri.jpg","page_title":"Chiesa della Santissima Trinità dei Pellegrini (Roma)","context_page_description":"La chiesa della Santissima Trinità dei Pellegrini è un luogo di culto cattolico che si trova nel centro storico di Roma in Piazza della Trinità dei Pellegrini nel Rione Regola, vicina ad importanti monumenti come Palazzo Farnese, Ponte Sisto e la celebre Via Giulia."},{"page_url":"https://sq.wikipedia.org/wiki/Maks_Frish","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Max_Frisch_mit_Oskar_W%C3%A4lterlin_-_Com_M07-0074-0001.jpg","page_title":"Maks Frish","context_page_description":"Max Rudolf Frisch ishte një Zviceran shkrimtar dhe arkitekt. Me teatrin copa, të tilla si Biedermann dhe arsonists, apo Andorra, si dhe me tij tre romanet e madhe Stiller, Homo faber dhe Mein Emrin sei Gantenbein arritur të Freskët të një audience të gjerë, dhe gjeti në hyrje të shkollës Canon. Përveç kësaj, ai botoi radio luan, tregime të shkurtra dhe më të vogla tekstet e prozës, si dhe dy revista letrare të periudhave kohore të 1946 në vitin 1949, dhe 1966 për 1971.\\nTë rinjtë Max Frisch ndjerë civile dhe artistike ekzistencën si të papajtueshëm dhe ishte për një kohë të gjatë të pasigurt për atë lloj jete ai duhet të zgjidhni dizajn. Si rezultat, u diplomua nga të Freskët pas një përzunë gjuhës dhe letërsisë gjermanetë studimeve, dhe e para letrare të Punës një studim i arkitekturës dhe ka punuar për disa vite si arkitekt. Pas suksesit të romanit të tij, Stiller vendosi që më në fund e vendosur për një jetë si një shkrimtar dhe e la familjen e tij, për të Shkruar, për të kushtojnë për të."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B8%D0%BD%D0%B0%D0%BC%D0%BE_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1,_%D0%91%D1%83%D1%85%D0%B0%D1%80%D0%B5%D1%81%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Coppacampionivecchia.png","page_title":"Динамо (футбольный клуб, Бухарест)","context_page_description":"«Дина́мо Бухаре́ст» — румынский футбольный клуб из города Бухарест. Основан 14 мая 1948 года. Является одним из самых титулованных клубов Румынии, уступая по количеству завоёванных трофеев только «Стяуа». За всю свою историю ни разу не покидал высший дивизион Румынии Лигу I. Домашние матчи проводит на стадионе «Динамо», вмещающем 15 032 зрителя."},{"page_url":"https://no.wikipedia.org/wiki/Monotrykk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/The_Tyger_BM_a_1794.jpg","page_title":"Monotrykk","context_page_description":"Monotrykk, monotypi, monoprint eller engangstrykk er en grafisk teknikk som gir ett enkelt trykk i motsetning til vanlige grafikk som gir flere trykk fra samme plate. Slike engangstrykk er plantrykk som er framstilt ved at en maler bildet med trykkfarge direkte på en plate av glass eller blankpolert metall eller ved at platene blir valset inn med en tjukk farge som kan tegnes i med pinner, pensler, hendene, filler eller annet. Platen blir så trykt av på et papir i en kobbertrykkspresse. Vanligvis kan det bare tas ett godt trykk, og teknikken passer derfor ikke til å lage opplag på flere eksemplarer.\\nMonotypi har sin opprinnelse fra 1600-tallet. På slutten av 1800-tallet ble teknikken dyrket av blant annet Edgar Degas. Også den britiske kunstpoeten William Blake eksperimenterte med engangstrykk."},{"page_url":"https://es.wikipedia.org/wiki/Locros","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Ionic_temple_locri.JPG","page_title":"Locros","context_page_description":"Locros o Locros Epicefirios fue una ciudad de la costa sureste de Brucio, no lejos del extremo sur, en la región italiana de Calabria, en la actual Locri."},{"page_url":"https://ca.wikipedia.org/wiki/Forn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Making_of_Chapati_in_chulha.jpg","page_title":"Forn","context_page_description":"Un forn és un compartiment tancat que s'utilitza per a escalfar, coure o assecar. S'utilitza habitualment a la cuina i la ceràmica."},{"page_url":"https://es.wikipedia.org/wiki/Jonathan_(manzana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Pomological_Watercolor_POM00000226.jpg","page_title":"Jonathan (manzana)","context_page_description":"Jonathan es el nombre de la variedad cultivar de manzano.​​​\\nEs originaria de la granja de Philip Rick, Woodstock, Condado de Ulster, Nueva York, Estados Unidos. Fue descrito por primera vez en 1826 por el juez Buel, que nombró a la manzana en honor a Jonathan Hasbrouck. Las frutas tienen una carne suave, de textura fina y bastante jugosa con un sabor dulce y bastante agradable.​"},{"page_url":"https://it.wikipedia.org/wiki/Congregazione_elveto-americana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Conception-abbey2.jpg","page_title":"Congregazione elveto-americana","context_page_description":"La Congregazione elveto-americana è una delle congregazioni monastiche di diritto pontificio che compongono la confederazione benedettina."},{"page_url":"https://fi.wikipedia.org/wiki/Korinttilainen_pylv%C3%A4sj%C3%A4rjestelm%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/GR-korinth-tempel-octavia.jpg","page_title":"Korinttilainen pylväsjärjestelmä","context_page_description":"Korinttilainen pylväsjärjestelmä tai korinttilainen tyyli on yksi kolmesta klassisesta pylväsjärjestelmästä, jotka ovat peräisin antiikin kreikkalaisesta arkkitehtuurista. Kaksi muuta ovat doorilainen ja joonialainen pylväsjärjestelmä. Pylväsjärjestelmiin kuuluu pylväiden lisäksi myös entablementti eli palkisto. Korinttilaista tyyliä käytettiin erityisesti roomalaisessa arkkitehtuurissa."},{"page_url":"https://en.wikipedia.org/wiki/List_of_children_of_the_presidents_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Esther_Cleveland_%28LOC%29.jpg","page_title":"List of children of the presidents of the United States","context_page_description":"This is a list of children of U.S. presidents, including stepchildren and alleged illegitimate children. All full names with married names are given. Currently there are 31 confirmed, known living presidential children, the oldest Lynda Bird Johnson Robb, the youngest confirmed Barron Trump. Two presidential children, John Quincy Adams and George W. Bush, have become president in their own right.\\nPresidential children have been studied individually and as a class. As individuals they are more often notable in their own right than most individuals: They disproportionately circulate among political and social leaders and the wealthier classes, and they are more likely to be scrutinized as part of celebrity culture. Additionally, as individuals they frequently have significant influence on other notable family members. So, for instance, a child who may appear otherwise non-notable as an individual may, in fact, have had a significant influence on the child's parent: acting as a sounding board, or having behavioral issues that affected the parent's beliefs or performance."},{"page_url":"https://it.wikipedia.org/wiki/Tullytown","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/TullytownPA_WaltDisneyElementarySchool.jpg","page_title":"Tullytown","context_page_description":"Tullytown è una borough degli Stati Uniti d'America, nella contea di Bucks nello Stato della Pennsylvania. Secondo il censimento del 2010 la popolazione è di 1.872 abitanti."},{"page_url":"https://en.wikipedia.org/wiki/Education_in_Gjilan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Thimi_mitko.JPG","page_title":"Education in Gjilan","context_page_description":"The education in Gjilan includes primary, secondary education, and a public university. Currently there are 23608 Albanian students and 881 minority students enrolled in educational institutions around Gjilan."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%B5%D0%BD_(%D0%92%D0%B5%D1%80%D1%85%D0%BD%D1%8F_%D0%A1%D0%B0%D0%B2%D0%BE%D0%B9%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Vignoble_de_Marin_01.JPG","page_title":"Марен (Верхня Савойя)","context_page_description":"Маре́н — муніципалітет у Франції, у регіоні Рона-Альпи, департамент Верхня Савойя. Населення — 1627 осіб.\\nМуніципалітет розташований на відстані близько 420 км на південний схід від Парижа, 150 км на північний схід від Ліона, 60 км на північний схід від Аннесі."},{"page_url":"https://de.wikipedia.org/wiki/Fleurey-l%C3%A8s-Saint-Loup","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Fleurey-l%C3%A8s-Saint-Loup%2C_Mairie.jpg","page_title":"Fleurey-lès-Saint-Loup","context_page_description":"Fleurey-lès-Saint-Loup ist eine Gemeinde im französischen Département Haute-Saône in der Region Bourgogne-Franche-Comté."},{"page_url":"https://en.wikipedia.org/wiki/List_of_castles_in_Greece","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%CE%9A%CE%AC%CF%83%CF%84%CF%81%CE%BF_%CE%9A%CE%B1%CF%81%CE%AC%CE%BC%CF%80%CE%B1%CE%BC%CF%80%CE%B1_0039.jpg","page_title":"List of castles in Greece","context_page_description":"This is a list of castles in Greece."},{"page_url":"https://es.wikipedia.org/wiki/Parque_natural_del_Cad%C3%AD-Moixer%C3%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Serra_Cabirolera_01.jpg","page_title":"Parque natural del Cadí-Moixeró","context_page_description":"El Parque Natural del Cadí-Moixeró es un espacio natural protegido español situado entre las provincias de Barcelona, Gerona y Lérida, en Cataluña, en el ámbito de las comarcas del Berguedá, el Alto Urgel y la Cerdaña.​\\nLa Sierra del Cadí es una alineación montañosa situada en los Prepirineos, sierra paralela a los Pirineos, formada por un tipo de roca, calcárea, que provoca el relieve abrupto. Su cara norte es particularmente impactante. Dentro del parque natural se encuentra el Pedraforca, montaña de forma característica situado en la zona sur, y constituye uno de los símbolos del excursionismo en Cataluña.\\nSus altitudes se sitúan entre los 900 metros en los valles y los 2648,6 metros​ del pico más alto, el Vulturó. Es por tanto un parque de alta montaña. Las sierras del Cadí y del Moixeró unidas en el puerto de Tancalaporta forman una barrera de impresionante altura que separa el valle del Segre de la cabecera del río Llobregat."},{"page_url":"https://it.wikipedia.org/wiki/Apollo_e_Marsia_(Ribera_Napoli)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Jusepe_de_ribera%2C_apollo_e_marsia%2C_1637%2C_Q511%2C_05.JPG","page_title":"Apollo e Marsia (Ribera Napoli)","context_page_description":"L'Apollo e Marsia è un dipinto olio su tela di Jusepe de Ribera del 1637 conservato nel museo nazionale di Capodimonte di Napoli.\\nIntriso degli insegnamenti appresi dai modi di Caravaggio, il dipinto rappresenta uno dei momenti più alti raggiunti dal pittore in questione e, più in generale, uno dei più felici esempi di pittura del Seicento napoletano.\\nSempre nel 1637 Ribera esegui un'altra versione del dipinto, oggi al museo di Belle Arti di Bruxelles."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Wilmersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Stolperstein_Bundesplatz_2_%28Wilmd%29_Frieda_Elisabeth_Pinthus.jpg","page_title":"Liste der Stolpersteine in Berlin-Wilmersdorf","context_page_description":"Die Liste der Stolpersteine in Berlin-Wilmersdorf enthält die Stolpersteine im Berliner Ortsteil Wilmersdorf im Bezirk Charlottenburg-Wilmersdorf, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 1335 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_K%C3%B6nigshain","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Koenigshain_Steinstock.jpg","page_title":"Liste der Kulturdenkmale in Königshain","context_page_description":"In der Liste der Kulturdenkmale in Königshain sind die Kulturdenkmale der sächsischen Gemeinde Königshain verzeichnet, die bis November 2018 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale im Landkreis Görlitz."},{"page_url":"https://fr.wikipedia.org/wiki/Mouvement_de_participation_populaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Lula_recibe_a_Jos%C3%A9_Mujica.jpg","page_title":"Mouvement de participation populaire","context_page_description":"Le Mouvement de participation populaire est un mouvement politique uruguayen appartenant au Frente Amplio, la coalition de gauche devenue la première force politique du pays en 1999, son candidat, Tabaré Vázquez, étant élu président en 2004. Le MPP, qui se présente aux élections sur la liste 609, est l'un des très rares groupes politiques d'Amérique latine issus d'un mouvement guérillero, les Tupamaros. En juin 2009, le candidat du MPP, l'ex-dirigeant tupamaro José Mujica, a été élu aux internes du Frente Amplio pour représenter le mouvement à la présidentielle de 2009, qu'il a remportée face au candidat blanco Luis Alberto Lacalle en novembre. Avec 6 sénateurs et 25 députés, la liste 609 du MPP est celle ayant remporté le plus de voix à ces élections."},{"page_url":"https://it.wikipedia.org/wiki/Tennis_ai_Giochi_della_IV_Olimpiade","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/London_1908_Lawn-Tennis_WomensSingle.jpg","page_title":"Tennis ai Giochi della IV Olimpiade","context_page_description":"Le partite di tennis dei Giochi della IV Olimpiade si sono svolte tra il 6 maggio e l'11 luglio 1908 all'All England Lawn Tennis and Croquet Club di Londra. Per la prima nella storia del tennis olimpico sono stati disputati tornei a livello sia indoor che outdoor. Sono stati disputati tornei nelle seguenti specialità:\\nsingolare maschile indoor\\nsingolare maschile outdoor\\nsingolare femminile indoor\\nsingolare femminile outdoor\\ndoppio maschile indoor\\ndoppio maschile outdoor"},{"page_url":"https://hu.wikipedia.org/wiki/P%C3%A4r_Hansson","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/P%C3%A4r_Hansson.jpg","page_title":"Pär Hansson","context_page_description":"Pär Hansson svéd labdarúgó, aki jelenleg a Feyenoordban játszik kapusként. A svéd válogatott tagjaként ott volt a 2012-es Európa-bajnokságon."},{"page_url":"https://it.wikipedia.org/wiki/Palau_Reial_de_Pedralbes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Escalera_interior_del_Palacio_de_Pedralbes%2C_Barcelona.JPG","page_title":"Palau Reial de Pedralbes","context_page_description":"Il Palau Reial de Pedralbes o Palazzo Reale di Pedralbes è un edificio sito in un ampio giardino a Les Corts a Barcellona.\\nDal 1919 al 1931 fu residenza della famiglia reale spagnola quando erano in visita alla città.\\nÈ sede del Museo della ceramica, del Museo tessile e degli indumenti e del Museo delle arti decorative, tutti facenti parte del Museo del design di Barcellona, ed è anche la sede del Segretariato generale dell'Unione per il Mediterraneo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%BF%D1%82%D0%B8%D1%87%D0%BD%D0%B5_%D0%B2%D0%B8%D0%BF%D1%80%D0%BE%D0%BC%D1%96%D0%BD%D1%8E%D0%B2%D0%B0%D0%BD%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/%D0%A1%D0%BE%D0%BD%D1%86%D0%B5.jpg","page_title":"Оптичне випромінювання","context_page_description":"Оптичне випромінювання — 1 випромінювання, електромагнітна хвиля оптичного\\nдіапазону; термін, що поєднує видиме світло, інфрачервоне випромінення і ультрафіолетове випромінювання.\\n2 Уражаючий фактор ядерного вибуху."},{"page_url":"https://en.wikipedia.org/wiki/Hip_hop","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ice_T2.jpg","page_title":"Hip hop","context_page_description":"Hip hop or hip-hop is a culture and art movement that was created by African Americans, Latino Americans and Caribbean Americans in the Bronx, New York City. The origin of the name is often disputed. It is also argued as to whether hip hop started in the South or West Bronx. While the term hip hop is often used to refer exclusively to hip hop music, hip hop is characterized by nine elements, of which only four are considered essential to understanding hip hop musically. Afrika Bambaataa of the hip hop collective Zulu Nation outlined these main pillars of hip hop culture, coining the terms: \\"rapping\\", a rhythmic vocal rhyming style; DJing, which is making music with record players and DJ mixers; b-boying/b-girling/breakdancing; and graffiti. Other elements of hip hop subculture and arts movements beyond the main four are: hip hop culture and historical knowledge of the movement; beatboxing, a percussive vocal style; street entrepreneurship; hip hop language; and hip hop fashion and style, among others. The fifth element, although debated, is commonly considered either street knowledge, hip hop fashion, or beatboxing."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B5%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D0%B8%D0%BC%D0%BD%D0%B0%D0%B7%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Nemiroff_gymnasium.jpg","page_title":"Немировская гимназия","context_page_description":"Немировская гимназия — казённая мужская гимназия, действовавшая в Немирове в 1838—1920 годах.\\nИстория учебного заведения восходит к 1785 году, когда великий подкоморий граф Викентий Потоцкий основал в местечке Немиров частное училище для детей бедных дворян. После второго раздела Польши, когда Подолия была присоединена к России, Немировское училище перешло в непосредственное заведование Подольского приказа общественного призрения, а в 1803 году было причислено к Виленскому учебному округу. В 1815 году Немировское училище было преобразовано в Брацлаво-Гайсинское поветовое училище, которое было закрыто в 1832 году после польского восстания. Два года спустя в Немирове было учреждено уездное училище, в 1836 году преобразованное в четырехклассное дворянское училище.\\nВ 1838 году камергер Высочайшего двора граф Болеслав Потоцкий предложил Министерству народного просвещения преобразовать дворянское училище в гимназию и обязался ежегодно выплачивать необходимые для её содержания средства, а также выстроить новое здание гимназии. Высочайшим повелением от 16 апреля 1838 года вместо уездного дворянского училища в Немирове была учреждена гимназия, торжественно открытая 7 августа того же года."},{"page_url":"https://en.wikipedia.org/wiki/Upper_Hessian_Ridge","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Gilserberger_H%C3%B6hen.jpg","page_title":"Upper Hessian Ridge","context_page_description":"The Upper Hessian Ridge or Upper Hesse Ridge is a hill chain in the West Hesse Highlands in North and Middle Hesse, which lies on the Rhine-Weser watershed and links the montane Central Upland ranges of the Kellerwald and the Vogelsberg in a north-south direction. The swell is divided into the Gilserberg Heights in the north, the central Neustadt Saddle and the Northern Vogelsberg Foreland in the south."},{"page_url":"https://fr.wikipedia.org/wiki/Rivi%C3%A8re-du-Loup_(municipalit%C3%A9_r%C3%A9gionale_de_comt%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Village-Saint-Arsene.jpg","page_title":"Rivière-du-Loup (municipalité régionale de comté)","context_page_description":"Rivière-du-Loup est une municipalité régionale de comté de la province de Québec, dans la région administrative du Bas-Saint-Laurent, créée le 1ᵉʳ janvier 1982. Son chef-lieu est la ville de Rivière-du-Loup. Elle est composée de 13 municipalités : une ville, six municipalités et cinq paroisses. Le mode de tenure des terres est majoritairement de propriété privée, alors que le territoire de propriété publique représente 15 % des terres louperiviennes.\\nSon préfet actuel est Michel Lagacé, aussi maire de Saint-Cyprien."},{"page_url":"https://es.wikipedia.org/wiki/Ermita_de_San_Pelayo_y_San_Isidoro","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Ermita_de_San_Isidro_Avila_lou.jpg","page_title":"Ermita de San Pelayo y San Isidoro","context_page_description":"La iglesia o ermita de San Pelayo y San Isidoro fue un templo católico de origen medieval, de estilo románico edificada en la ciudad española de Ávila. Fue construida extramuros, frente a la puerta de la Malaventura en el paño sur de la muralla, hacia el oeste. En su recuerdo queda un espacio conocido como Atrio de San Isidro. Tras la desamortización fue llevada a Madrid donde tuvo diferentes emplazamientos. Sus restos ruinosos encontraron finalmente acomodo en El Retiro."},{"page_url":"https://en.wikipedia.org/wiki/List_of_reptiles_of_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Mauremys_leprosa_01.JPG","page_title":"List of reptiles of Spain","context_page_description":"This is a list of all reptiles living in Spain, both in the Iberian Peninsula and other territories such as Ceuta, Melilla, the Balearic Islands and the Canary Islands. Both native and introduced species are included."},{"page_url":"https://en.wikipedia.org/wiki/Yiftach_Brigade","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Mula_Cohen.jpg","page_title":"Yiftach Brigade","context_page_description":"The Yiftach Brigade was an Israeli infantry brigade. It included two Palmach battalions, and later also the 2nd, which was transferred from the Negev Brigade.\\nThe Palmach memorial website records 274 of its members being killed whilst in the Yiftach Brigade."},{"page_url":"https://ca.wikipedia.org/wiki/Canig%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Canigou8.jpg","page_title":"Canigó","context_page_description":"El Canigó és una muntanya del Pirineu, situada entre les comarques nord-catalanes del Conflent i el Vallespir, tot i que el cim és íntegrament en el Conflent, entre les comunes de Taurinyà i Vernet.\\nHa esdevingut símbol de la personalitat catalana de les comarques pirinenques.\\nEl cim, la pica del Canigó o Pic de Balaig, fa 2.784 msnm. Malgrat la seva altitud moderada, fou considerada la muntanya més alta dels Pirineus a causa del gran i brusc desnivell que la separa de la plana del Rosselló, cosa que la fa més aparent que altres muntanyes més engorjades i situades entre valls ja més altes. La llegenda n'atribueix la primera ascensió al rei Pere el Gran, l'any 1285.\\nLa ministra d'Ecologia, Desenvolupament sostenible i Energia del govern francès, Delphine Batho, va declarar el 13 de juliol del 2012 el Canigó \\"Gran Paratge de França\\", amb la seva ortografia original catalana, després d'una campanya que van impulsar alhora el Consell General dels Pirineus Orientals i la Regió del Llenguadoc-Rosselló"},{"page_url":"https://fr.wikipedia.org/wiki/Malli%C3%A1_(Chypre)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/LimassolDistrictMalia%2C_Cyprus.png","page_title":"Malliá (Chypre)","context_page_description":"Malliá est un village de Chypre situé dans le district de Limassol."},{"page_url":"https://es.wikipedia.org/wiki/Oro_precolombino_de_Costa_Rica","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Pre-Columbian_gold_of_Costa_Rica_%2881%29.JPG","page_title":"Oro precolombino de Costa Rica","context_page_description":"El oro precolombino de Costa Rica es una de las manifestaciones artísticas más elaboradas y complejas de las sociedades indígenas que ocuparon el actual territorio costarricense antes de la llegada de los españoles. Las investigaciones y estudios arqueológicos y etnohistóricos han determinado que, entre los años 700 y 1550 d.C, en Costa Rica hubo una importante producción suntuaria de objetos de oro, con evidencia de la existencia de especialistas orfebres que habían alcanzado un importante manejo tecnológico, así como niveles de extraordinaria calidad y belleza en la elaboración de las piezas, mezcladas con un alto grado de simbolismo.\\nCosta Rica forma parte de la tradición metalúrgica del Área Intermedia, que incluye también a Panamá y el noroccidente de Colombia. Es precisamente desde Colombia de donde penetra el conocimiento en las técnicas metalúrgicas en Costa Rica, a través del establecimiento de rutas de intercambio terrestres, fluviales y marítimas."},{"page_url":"https://es.wikipedia.org/wiki/V%C3%ADa_crucis_(Rinc%C3%B3n_de_Ademuz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/1-Vallanca-viacrucisEstaci%C3%B3n_V_%282017%290641.jpg","page_title":"Vía crucis (Rincón de Ademuz)","context_page_description":"Los Vía Crucis o Viacrucis del Rincón de Ademuz son las «Estaciones de la Cruz» o «Vía Dolorosa» existentes en los distintos municipios de la comarca, en provincia de Valencia.\\nActualmente pueden verse en Ademuz, Casas Altas, Casas Bajas, Puebla de San Miguel, Vallanca y Val de la Sabina, pedanía de Ademuz. Existieron también en Castielfabib, donde pervive la calle Calvario, y en Torrebaja, cuyos ladrillos fueron destruidos durante la revolución y la Guerra Civil Española.​ Aunque humildes en su concepción, los Viacrucis locales forman parte del patrimonio histórico-artístico, cultural y religioso de la comarca."},{"page_url":"https://de.wikipedia.org/wiki/Joo_Hyong-jun","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Joo_Hyung-Joon_from_acrofan.jpg","page_title":"Joo Hyong-jun","context_page_description":"Joo Hyong-jun ist ein südkoreanischer Eisschnellläufer."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D9%88%D9%85%D8%A7%D8%B3_%D8%AC%D9%8A._%D9%84%D9%88%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Thomas_G._Lawson.jpeg","page_title":"توماس جي. لوسون","context_page_description":"توماس جي. لوسون ‏ هو قاضي ومحامي وسياسي أمريكي، ولد في 2 مايو 1835 في إتونتون في الولايات المتحدة، وتوفي بنفس المكان في 16 أبريل 1912. حزبياً، نشط في الحزب الديمقراطي. وقد انتخب عضو مجلس النواب الأمريكي."},{"page_url":"https://es.wikipedia.org/wiki/Richfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/NCMap-doton-Richfield.PNG","page_title":"Richfield","context_page_description":"Richfield es un pueblo ubicado en el condado de Stanly en el estado estadounidense de Carolina del Norte. La localidad en el año 2000, tenía una población de 515 habitantes en una superficie de 6.2 km², con una densidad poblacional de 95.4 personas por km².​"},{"page_url":"https://ro.wikipedia.org/wiki/Limnophora_obsignata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Mosca_en_Bastavales%2C_Bri%C3%B3n%2C_Galiza_090818_2.jpg","page_title":"Limnophora obsignata","context_page_description":"Limnophora obsignata este o specie de muște din genul Limnophora, familia Muscidae. A fost descrisă pentru prima dată de Camillo Rondani în anul 1866. Conform Catalogue of Life specia Limnophora obsignata nu are subspecii cunoscute."},{"page_url":"https://fi.wikipedia.org/wiki/Tapiolan_koulu_ja_lukio","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Tapiolan_koulu_ja_lukio.jpg","page_title":"Tapiolan koulu ja lukio","context_page_description":"Tapiolan koulu ja lukio on Espoon Tapiolassa Kulttuurikeskuksen ja Tapiolan uimahallin kupeessa sijaitseva lähes tuhannen oppilaan ja opiskelijan koulu. Samassa koulussa toimii peruskoulun yläkoulu eli kolme ylintä luokka-astetta, lukio ja Espoon aikuislukio.\\nPerustamislupa koululle saatiin 19. huhtikuuta 1958 ja toiminta käynnistettiin saman vuoden syksyllä. Koulukokonaisuus oli valmis vuonna 1961, kun toinen osa valmistui. Rakennuksen on suunnitellut arkkitehti Jorma Järvi ja se sijaitsee osoitteessa Opintie 1."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%80%D0%B8%D1%81%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Rhinopomastus_cyanomelas.jpg","page_title":"Ірисор","context_page_description":"Ірисор — рід птахів родини слотнякових. Складається з трьох видів, що поширені в Африці. Згідно з молекулярними дослідженнями рід відхилився від слотняка близько 10 млн. років тому. Ірисори мають чорний колір із кількома білими смужками на крилах. Ці птахи зазвичай мешкають парами та харчуються комахами та іншими безхребетними, яких вони легко достають з порожнин у деревах та землі завдяки своїм довгом дзьобам."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D0%B2%D1%80%D0%B8%D0%BA%D1%83%D1%80_(%D0%9C%D0%BE%D0%B7%D0%B5%D0%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Avricourt_57_Nouvel-Avricourt.JPG","page_title":"Аврикур (Мозел)","context_page_description":"Аврикур насеље је и општина у североисточној Француској у региону Лорена, у департману Мозел која припада префектури Сарбур.\\nПо подацима из 2011. године у општини је живело 708 становника, а густина насељености је износила 68,6 становника/km². Општина се простире на површини од 10,32 km². Налази се на средњој надморској висини од 142 метара."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A5%D0%B0%D0%BA%D0%BA%D1%8D%D0%BD%D0%B4%D1%8D%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Tei.png","page_title":"Хаккэндэн","context_page_description":"“Нансо Сатомі Хаккендэн” \\"Легенда пра восем псоў з сям'і Сатомі\\" – гэта 106-томны раман 19 стагоддзя японскага пісьменніка Кёкутэі Бакіна. Хаккендэн самы доўгі раман японскай класічнай літаратуры."},{"page_url":"https://pl.wikipedia.org/wiki/Dziesi%C4%99%C4%87_lat_%C5%BCycia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Quality_Street_lobby_card_2.jpg","page_title":"Dziesięć lat życia","context_page_description":"Dziesięć lat życia – amerykański film z 1937 roku w reżyserii George’a Stevensa."},{"page_url":"https://da.wikipedia.org/wiki/Finderup_Sogn_(Viborg_Kommune)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Finderup_korset.JPG","page_title":"Finderup Sogn (Viborg Kommune)","context_page_description":"Finderup Sogn er et sogn i Viborg Domprovsti. Sognet ligger i Viborg Kommune; indtil Kommunalreformen i 1970 lå det i Nørlyng Herred. I Finderup Sogn ligger Finderup Kirke.\\nDet store militære øvelsesområde Finderup Øvelsesterræn ligger for en del i sognet.\\nI Finderup Sogn findes flg. autoriserede stednavne:\\nAgerskov\\nFalle\\nFinderup\\nFinderup Hede\\nFinderup Nørremark\\nFindskov Plantage\\nFløjgårde\\nHellerup\\nMorville Plantage"},{"page_url":"https://pt.wikipedia.org/wiki/Zlon%C3%ADn","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Coats_of_arms_Zlon%C3%ADn.jpeg","page_title":"Zlonín","context_page_description":"Zlonín é uma comuna checa localizada na região da Boêmia Central, distrito de Praha-východ."},{"page_url":"https://de.wikipedia.org/wiki/Medien_in_Hamburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Spiegel_building_Hamburg%2C_Ericusspitze%2C_at_night.jpg","page_title":"Medien in Hamburg","context_page_description":"Hamburg ist ein führender Medienstandort in Deutschland. Auf dem Gebiet der Freien und Hansestadt ist eine vielfältige Medienlandschaft mit einem Gesamtumsatz von 25 Mrd. Euro angesiedelt, in der rund 70.000 Beschäftigte in 14.063 Unternehmen aus den Bereichen Werbung, Verlag, Musik, Filmwirtschaft, Druck, Rundfunk und in der Kulturwirtschaft tätig sind. Hinzu kommen rund 2000 Multimediaunternehmen. Hamburg ist zudem ein wichtiger Standort für die Medienausbildung mit diversen Journalistenschulen und Ausbildungsmöglichkeiten im Bereich Medien.\\nDie Medienmetropole Hamburg nimmt besonders bei den Printmedien in Deutschland eine führende Position ein. Fast 50 % der Marktanteile der deutschen Publikumspresse werden von Hamburger Großverlagen gehalten. Hamburg gilt als „Kreativ-Hauptstadt“ und belegt mit seinen Werbeagenturen in nationalen wie internationalen Wettbewerben stets Spitzenplätze. Auch in der Musikwirtschaft strebt Hamburg eine führende Rolle an."},{"page_url":"https://de.wikipedia.org/wiki/Dellplatz","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Katholische_Pfarrkirche_St._Joseph%2C_Duisburg.jpg","page_title":"Dellplatz","context_page_description":"Der Dellplatz ist ein Duisburger Platz im Zentrum des sogenannten Dellviertels südlich der Friedrich-Wilhelm-Straße und westlich der am Kantpark vorbeiführenden Düsseldorfer-Straße.\\nDer Platz hieß im 19. Jahrhundert Papendelle. In dem 1850 erstellten Bauplan der Stadt war der Name Neumarkt vorgesehen. Seit 1890 weisen die Adressbücher den Platz als Dellplatz aus.\\nVor dem Zweiten Weltkrieg hieß das Dellviertel Papendell. Der Name rührt von der niederdeutschen Bezeichnung für Tal her und bezieht sich auf das Tal des Dickelsbachs. Der Platz umfasst die Fläche der Kirche St. Joseph und den sechseckigen östlich anschließenden Platz.\\nDer Dellplatz ist ein kultureller Mittelpunkt in Duisburg. Neben dem Kleinkunsttheater „Die Säule“ und dem Kulturhaus Grammatikoff befindet sich dort das Filmforum und die Hausbrauerei Webster.\\nDas Dellviertel lag außerhalb der ehemaligen Stadtmauern. Auf dem Corputius-Plan, dem von Johannes Corputius verfertigten besonders detailgenauen Plan Duisburgs aus der Vogelschau, ist die Flusssenke des Dickelsbachs und der Ort des heutigen Dellplatzes im rechten oberen Teil gut zu erkennen.\\nBis zum Ende des 19."},{"page_url":"https://ht.wikipedia.org/wiki/Troutville,_Pennsilvani","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Troutville%2C_Pennsylvania.jpg","page_title":"Troutville, Pennsilvani","context_page_description":"Troutville se yon vil nan eta Pennsilvani, nan Etazini."},{"page_url":"https://pl.wikipedia.org/wiki/T%C3%BCnel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Istanbul_asv2020-02_img01_T%C3%BCnel_Karak%C3%B6y_station.jpg","page_title":"Tünel","context_page_description":"Tünel – podziemna kolej w europejskiej części Stambułu w Turcji. Otwarcie tej drugiej w kontynentalnej Europie linii podziemnej kolei miało miejsce 17 stycznia 1875. Linia o długości ok. 573 metrów składa się z dwóch stacji, dolnej Karaköy oraz górnej Tünel Meydani. Różnica wysokości między nimi wynosi w przybliżeniu 60 metrów."},{"page_url":"https://es.wikipedia.org/wiki/Cairn_de_Gavrinis","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Cairn_Gavrinis_exterieur.jpg","page_title":"Cairn de Gavrinis","context_page_description":"El cairn de Gavrinis es un importante cairn francés localizado en la pequeña isla de Gavrinis, perteneciente a la comuna de Larmor-Baden, en el departamento de Morbihan.\\nGavrinis es un ejemplo destacado del megalitismo tardío europeo y está catalogado desde el 19 de julio de 1901 como monumento histórico de Francia.​"},{"page_url":"https://pl.wikipedia.org/wiki/Andrea_Garghella","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Andrea_Garghella_%28Legavolley_2014%29.jpg","page_title":"Andrea Garghella","context_page_description":"Andrea Garghella włoski siatkarz występujący obecnie w Serie A, w drużynie Sempre Volley Padwa. Gra na pozycji libero. Mierzy 192 cm."},{"page_url":"https://no.wikipedia.org/wiki/Halfdan_Christensen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Halfdan_Christensen.jpg","page_title":"Halfdan Christensen","context_page_description":"Halfdan Christensen var en norsk skuespiller, sceneinstruktør, forfatter og teatersjef. Han hadde sitt hovedsakelige virke på Nationaltheatret."},{"page_url":"https://tr.wikipedia.org/wiki/Yuvac%C4%B1k,_Amasya","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Yuvac%C4%B1k_K%C3%B6y%C3%BC_Genel_G%C3%B6r%C3%BCn%C3%BCm.jpg","page_title":"Yuvacık, Amasya","context_page_description":"Yuvacık, Amasya ilinin Merkez ilçesinde bağlı bir köydür."},{"page_url":"https://it.wikipedia.org/wiki/Sulmona","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Sulmona_23.jpg","page_title":"Sulmona","context_page_description":"Sulmona è un comune italiano di 23 326 abitanti della provincia dell'Aquila in Abruzzo. È il terzo comune più popoloso della provincia e il dodicesimo della regione. Situata nel cuore dell'Abruzzo, a ridosso del Parco nazionale della Majella, Sulmona è nota nel mondo per la secolare tradizione nella produzione dei confetti. Inoltre è sede vescovile dell'omonima diocesi Sulmona-Valva.\\nGià oppidum dei Peligni, successivamente municipio romano, nel 43 a.C. Sulmo diede i natali al poeta latino Publio Ovidio Nasone. Nel Medioevo, per volontà di Federico II, fu dal 1233 al 1273 sede del giustizierato d'Abruzzo. È tra le città decorate al valor militare per la guerra di liberazione, insignita della medaglia d'Argento per i sacrifici delle sue popolazioni e per la sua attività nella lotta partigiana durante la Seconda guerra mondiale."},{"page_url":"https://ru.wikipedia.org/wiki/Dance_Dance_Revolution","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Dance_Dance_Revolution_Solo_2000_arcade_machine_stage.jpg","page_title":"Dance Dance Revolution","context_page_description":"Dance Dance Revolution — серия музыкальных видеоигр от Konami Digital Entertainment, Inc, также известная как Dancing Stage. Впервые была представлена в виде аркадного игрового автомата в Японии в 1998 году на игровой выставке Tokyo Game Show. С того момента серия получила большую популярность во всём мире. К настоящему моменту издано более 100 вариантов этой игры. Dance Dance Revolution является самой большой серией входящей в так называемое семейство Bemani-игр. К настоящему моменту во всех официальных версиях DDR представлено более 1000 различных песен.\\nИгра проходит на танцевальной платформе с четырьмя панелями: «вверх», «вниз», «влево» и «вправо». Во время игрового процесса по экрану перемещается последовательность стрелок, которая соответствует музыкальному ритму исполняемой песни. Игрок должен нажимать ногами в такт музыке соответствующие панели в тот момент, когда стрелки совпадают с полупрозрачным трафаретом, расположенным обычно в верхней части экрана. При каждом правильном нажатии у игрока постепенно пополняется уровень «шкалы жизни». За каждый промах от шкалы отнимается определённое количество энергии."},{"page_url":"https://es.wikipedia.org/wiki/Physalis_peruviana","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Peruvian-gooseberry-13581703809uy.jpg","page_title":"Physalis peruviana","context_page_description":"La planta conocida como uchuva, aguaymanto, uvilla o bien ushun​ es una planta herbácea perteneciente a la familia solanaceae, por lo tanto posee características similares a las plantas de papa, tomate y tabaco, a pesar de su crecimiento arbustivo."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%AD%8C%E8%88%9E%E4%BC%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Toshusai_Sharaku-_Otani_Oniji%2C_1794.jpg","page_title":"歌舞伎","context_page_description":"歌舞伎は、日本固有の演劇で、伝統芸能のひとつ。重要無形文化財。歌舞伎は2005年にユネスコにおいて傑作宣言され、2009年9月に無形文化遺産の代表一覧表に記載された。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Sainte-H%C3%A9l%C3%A8ne_(Sa%C3%B4ne-et-Loire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Map_commune_FR_insee_code_71426.png","page_title":"Sainte-Hélène (Saône-et-Loire)","context_page_description":"Sainte-Hélène sī ūi-tī Hoat-kok Bourgogne toā-khu Saône-et-Loire koān ê chi̍t ê commune."},{"page_url":"https://en.wikipedia.org/wiki/Boronia_splendida","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Boronia_splendida_DistMap113.png","page_title":"Boronia splendida","context_page_description":"Boronia splendida is a species of plant in the citrus family, Rutaceae, and is endemic to Queensland, Australia. It is an erect shrub with most parts covered with star-like hairs and has simple, linear to narrow elliptic leaves, and pink to white, four-petalled flowers."},{"page_url":"https://cs.wikipedia.org/wiki/Boninsk%C3%A9_ostrovy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Minamijima%2C_Ogasawara%2C_Tokyo.jpg","page_title":"Boninské ostrovy","context_page_description":"Boninské ostrovy popř. Ostrovy Ogasawara jsou souostrovím více než 30 subtropických ostrovů asi 1 000 km na jih od Tokia, Japonsko. Administrativně jsou součástí prefektury Tokio. Ostrovy jsou také známé pod názvem Boninské ostrovy a jejich nejjižnější, neobydlená část také jako Vulkánové ostrovy. O 700 km dále na jih leží ostrov Okino Torišima a 1 900 km na východ ostrov Minami Torišima. Tyto dva odlehlé ostrovy nejsou geograficky součástí souostroví Ogasawara, ale náleží k němu administrativně. Celková rozloha ostrovů je 84 km².\\nJedinými obydlenými ostrovy jsou Čičidžima a Hahadžima."},{"page_url":"https://es.wikipedia.org/wiki/Niels_Fredborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Niels_Fredborg_1967_%28cropped%29.jpg","page_title":"Niels Fredborg","context_page_description":"Niels Christian Fredborg es un deportista danés que compitió en ciclismo en la modalidad de pista, especialista en las pruebas de velocidad y contrarreloj.\\nParticipó en cuatro Juegos Olímpicos de Verano, engtre los años 1964 y 1976, obteniendo en total tres medallas, oro en Múnich 1972, plata en México 1968 y bronce en Montreal 1976, las tres en la prueba del kilómetro contrarreloj.​\\nGanó cinco medallas en el Campeonato Mundial de Ciclismo en Pista entre los años 1967 y 1980.​"},{"page_url":"https://en.wikipedia.org/wiki/Abedus_herberti","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Abedus_herberti.jpg","page_title":"Abedus herberti","context_page_description":"Abedus herberti, the toe biter, is a species of giant water bug in the family Belostomatidae. It is found in Central America and North America."},{"page_url":"https://vi.wikipedia.org/wiki/Plectranthus_rotundifolius","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Plectranthus_rotundifolius_DSCN0612.jpg","page_title":"Plectranthus rotundifolius","context_page_description":"Plectranthus rotundifolius là một loài thực vật có hoa trong họ Hoa môi. Loài này được Spreng. miêu tả khoa học đầu tiên năm 1825."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D1%88%D1%82%D0%B0%D0%B1_%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D1%82%D0%B0%D0%BB%D1%8C%D1%8F%D0%BD%D1%81%D0%BA%D0%BE%D0%B9_%D0%B0%D1%80%D0%BC%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Pietro_Badoglio_3.jpg","page_title":"Генеральный штаб Королевской итальянской армии","context_page_description":"Генеральный штаб Королевской итальянской армии — центральный инструмент управленческой структуры вооружённых сил Королевства Италии, в 1925—1945 годах."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Norges_st%C3%B8rste_tettsteder","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Hommers%C3%A5k.JPG","page_title":"Liste over Norges største tettsteder","context_page_description":"Dette er en liste over de største tettstedene i Norge, slik SSB definerer dem. Definisjonen ligger nær opp til det internasjonale urban area. Tettsted kan karakteriseres som et dynamisk statistisk bybegrep."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%A8%D7%A9%D7%AA_%D7%A9%D7%9E%D7%95%D7%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Holman_Moses_and_the_Burning_Bush.jpg","page_title":"פרשת שמות","context_page_description":"פָּרָשַׁת שְׁמוֹת היא פרשת השבוע הראשונה בספר שמות. היא מתחילה בתחילת הספר, פרק א', פסוק א', ומסתיימת בפרק ו', פסוק א'.\\nבפרשת שמות מסופר על תחילת שעבוד עם ישראל במצרים ועל שנות חייו הראשונות של משה ובחירתו להנהגה. בפרשה זו מוצגות כמה מן הדמויות שיופיעו במהלך הפרשות והספרים הבאים, ובהן מרים ואהרן אחי משה, וכן פרעה מלך מצרים שמשעבד את עם ישראל והופך אותם לעבדיו."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Geotope_im_Landkreis_W%C3%BCrzburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Geotope_im_Landkreis_W%C3%BCrzburg_Steinbruch_an_der_Stra%C3%9Fe_Th%C3%BCngersheim-G%C3%BCntersleben_Geotop-Nummer_679A010_Nordseite_9.jpg","page_title":"Liste der Geotope im Landkreis Würzburg","context_page_description":"Diese Liste enthält zwölf Geotope des unterfränkischen Landkreises Würzburg in Bayern.\\nDie Liste enthält die amtlichen Bezeichnungen für Namen und Nummern des Bayerischen Landesamt für Umwelt sowie deren geographische Lage. Diese Liste ist möglicherweise unvollständig. Im Geotopkataster Bayern sind etwa 3.400 Geotope erfasst. Das LfU sieht einige Geotope nicht für die Veröffentlichung im Internet geeignet. Einige Objekte sind zum Beispiel nicht gefahrlos zugänglich oder dürfen aus anderen Gründen nur eingeschränkt betreten werden."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8%D1%98%D0%B0%D0%BD_X_%D0%94%D0%B0%D0%BD%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/King_Christian_X_of_Denmark.jpg","page_title":"Кристијан X Дански","context_page_description":"Кристијан X 26. септембар 1870 — 20. април 1947, био је краљ Данске од 14. маја 1912. до своје смрти 20. априла 1947. године."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A6%E1%83%A0%E1%83%98%E1%83%90%E1%83%9C%E1%83%99%E1%83%90%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%97%E1%83%90%E1%83%9C%E1%83%90%E1%83%95%E1%83%90%E1%83%A0%E1%83%A1%E1%83%99%E1%83%95%E1%83%9A%E1%83%90%E1%83%95%E1%83%94%E1%83%93%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Scorpius_constellation_map.png","page_title":"ღრიანკალის თანავარსკვლავედი","context_page_description":"ღრიანკალი — ზოდიაქოს ერთ-ერთი თანავარსკვლავედი. მისი ყველაზე ბრწყინვალე ვარსკვლავების ვიზუალური ვარსკვლავიერი სიდიდეებია 0,8 - 1,2, 1,6 და 1,9. დაკვირვებისათვის ხელსაყრელი პირობებია მაის-ივნისში. მოჩანს საქართველოდანაც."},{"page_url":"https://en.wikipedia.org/wiki/Jason_Garrison","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Djurg%C3%A5rden-F%C3%A4rjestad_20190129_17.jpg","page_title":"Jason Garrison","context_page_description":"Jason John Maxwell Garrison is a Canadian professional ice hockey defenseman currently playing with Djurgårdens IF of the Swedish Hockey League.\\nGarrison played two years of Junior A with the Nanaimo Clippers of the British Columbia Hockey League, during which time he earned a scholarship to play college hockey with the University of Minnesota Duluth. Following his third NCAA year, he signed with the Florida Panthers of the National Hockey League as an undrafted free agent in 2008. Garrison spent four years with the Panthers organization, setting franchise records for single-season goals and power play goals by a defenceman in 2011–12."},{"page_url":"https://ceb.wikipedia.org/wiki/Aepypodius_bruijnii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Annales_des_sciences_naturelles_%281881%29_%2818204839675%29.jpg","page_title":"Aepypodius bruijnii","context_page_description":"Espesye sa langgam nga una nga gihulagway ni Oustalet ni adtong 1880 ang Aepypodius bruijnii. Ang Aepypodius bruijnii sakop sa kahenera nga Aepypodius sa kabanay nga Megapodiidae. Giklaseklase sa IUCN ang espesye sa nagtikapuo. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ca.wikipedia.org/wiki/Alderson_(Oklahoma)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/37/OKMap-doton-Alderson.PNG","page_title":"Alderson (Oklahoma)","context_page_description":"Alderson és un poble dels Estats Units a l'estat d'Oklahoma. Segons el cens del 2000 tenia una població de 261 habitants."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D8%A7%D9%83%D8%A7%D8%BA%D8%A7%D9%88%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Nakagawa_in_Fukuoka_Prefecture.png","page_title":"ناكاغاوا","context_page_description":"ناكاغاوا هي مدينة في اليابان، تقع في فوكوكا، بلغ عدد سكانها 50,186 نسمة وذلك حسب إحصائيات سنة 2017."},{"page_url":"https://en.wikipedia.org/wiki/Phimai_Historical_Park","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Entrance-phimai.jpg","page_title":"Phimai Historical Park","context_page_description":"The Phimai historical park is one of the largest Khmer temples of Thailand. It is located in the town of Phimai, Nakhon Ratchasima province.\\nThe temple marks one end of the Ancient Khmer Highway from Angkor. As the enclosed area of 1020x580m is comparable with that of Angkor Wat, Phimai must have been an important city in the Khmer Empire. Most buildings are from the late 11th to the late 12th century, built in the Baphuon, Bayon and Angkor Wat style. However, even though the Khmer at that time were Hindu, the temple was built as a Buddhist temple, since the inhabitants of the Khorat area had been Buddhists as far back as the 7th century. Inscriptions name the site Vimayapura, which developed into the Thai name Phimai.\\nThe first inventory of the ruins was done in 1901 by the French geographer Etienne Aymonier. The site was put under Thai governmental protection by announcement in the Government Gazette, Volume 53, section 34, on September 27, 1936. Most of the restorations were done from 1964 to 1969 as a joint Thai-French project. The historical park, now managed by the Fine Arts Department, was officially opened by Princess Maha Chakri Sirindhorn on April 12, 1989."},{"page_url":"https://it.wikipedia.org/wiki/Kelvin_Arase","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Austria_national_under-21_football_team_-_Teamcamp_October_2019_%2863%29.jpg","page_title":"Kelvin Arase","context_page_description":"Kelvin Arase è un calciatore austriaco, attaccante del Rapid Vienna."},{"page_url":"https://fr.wikipedia.org/wiki/Valent%C3%ADn_Castellanos","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Valentin_Castellanos.jpg","page_title":"Valentín Castellanos","context_page_description":"Valentín Mariano José Castellanos Giménez, né le 3 octobre 1998 à Mendoza en Argentine, est un footballeur argentin qui joue au poste de milieu de terrain au New York City FC en Major League Soccer."},{"page_url":"https://eu.wikipedia.org/wiki/Bingen_Zupiria","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Entrega_de_los_premios_Euskadi_de_Literatura_2017_21_%28cropped%29.jpg","page_title":"Bingen Zupiria","context_page_description":"Bingen Zupiria Gorostidi euskal herritar kazetari bat da. Filosofia eta Letretan lizentziatua da. 22 urterekin ETBn kazetari gisa lanean hasi zen, 1983-1989 bitartean eguneroko albistegietako editorea ere izan zela, ETB1eko Gaur Egun eta ETB2ko Teleberri albistegietarako. 1989 eta 1999 bitartean Eusko Jaurlaritzako Lehendakaritzako Prentsa eta Komunikazio zuzendaria edo arduraduna izan zen, handik Andoni Ortuzarren eskutik 2008an EITBko zuzendaria izatera iragan zen.\\n2012 urteaz geroztik Deia egunkariko zuzendaria izan zen, ordura arteko Iñigo Camino zuzendaria ordezkatuta.\\n2016an Eusko Jaurlaritzako Hizkuntza Politika eta Kultura Sailburu izendatu zuten."},{"page_url":"https://sv.wikipedia.org/wiki/Karl_XI","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Karl_XI_%281655-1697%29%2C_konung_av_Sverige.png","page_title":"Karl XI","context_page_description":"Karl XI, född 24 november 1655, död 5 april 1697, var kung av Sverige från 1660 till sin död. Han regerade även från 1681 som hertig Karl I över Pfalz-Zweibrücken. Han var son till Karl X Gustav och Hedvig Eleonora av Holstein-Gottorp samt gift med Ulrika Eleonora av Danmark. De fick bland andra barnen Hedvig Sofia, Karl XII och Ulrika Eleonora.\\nRegeringstiden för Karl XI inleddes med skånska kriget mot framför allt Danmark, som efter stora ansträngningar avslutades utan betydande landavträdelser. Han förde en försiktig politik där Sveriges finanser stabiliserades, försvaret reformerades och mycket begränsade landavträdelser gjordes. Han inrättade det karolinska enväldet och för att kunna finansiera en större armé genomfördes en omfattande reduktion, vilket kraftigt minskade adelns tillgångar. Därefter inriktades ansträngningar till stor del mot att förhindra ett nytt krig, vilket ledde till skapandet av det yngre indelningsverket och den karolinska armén. Karl XI efterträddes av sin ende son Karl XII, som använde sin fars armé i Stora nordiska kriget."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%95%98%E5%88%A9%E4%BA%9E%E9%98%BF%E6%8B%89%E4%BC%AF%E7%A9%BA%E8%BB%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Russian_Air_Force_Ilyushin_Il-76MD_Dvurekov-11.jpg","page_title":"敘利亞阿拉伯空軍","context_page_description":"敘利亞空軍\\n，是敘利亞政府的空軍軍種，以主要使用前蘇聯／俄羅斯製裝備，為俄羅斯在中東地區的盟友及重要武器銷售國。"},{"page_url":"https://fr.wikipedia.org/wiki/Transport_ferroviaire_en_Norv%C3%A8ge","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/00ostfoldost.png","page_title":"Transport ferroviaire en Norvège","context_page_description":"Le réseau ferroviaire de Norvège comprend 4 087 kilomètres de ligne de chemin de fer dont 2 622 km sont électrifiés et 242 sont en double voie. Il compte 696 tunnels et 2 790 ponts."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%8A%D9%85%D8%B3_%D8%B1._%D9%85%D9%88%D8%B1%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/James_R._Morris_002.png","page_title":"جيمس ر. موريس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجيمس ر. موريس كان سياسى من امريكا."},{"page_url":"https://nl.wikipedia.org/wiki/Robert_III_van_Schotland","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Robert_III%2C_King_of_Scotland.png","page_title":"Robert III van Schotland","context_page_description":"Robert III was koning van Schotland van 1390 tot 1406. Hij was de oudste zoon van Robert II en diens minnares en latere echtgenote Elizabeth Mure. Hij werd in 1390 tot koning gekroond te Scone. Uit afkeer voor de naam 'John' die herinnerde aan een van zijn voorgangers, John Balliol, veranderde hij zijn naam John in Robert. Roberts oudste zoon, David, stierf in mei 1402. Zijn enige nog levende zoon Jacobus I wilde hij in veiligheid naar Frankrijk sturen, maar deze werd gevangengenomen door de Engelsen. Toen Robert III stierf liet hij zijn regering over aan zijn broer Robert, hertog van Albany, die vanaf dan als regent regeerde."},{"page_url":"https://en.wikipedia.org/wiki/Packing_problems","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/5_cirkloj_en_60_60_60_triangulo_v1.png","page_title":"Packing problems","context_page_description":"Packing problems are a class of optimization problems in mathematics that involve attempting to pack objects together into containers. The goal is to either pack a single container as densely as possible or pack all objects using as few containers as possible. Many of these problems can be related to real life packaging, storage and transportation issues. Each packing problem has a dual covering problem, which asks how many of the same objects are required to completely cover every region of the container, where objects are allowed to overlap.\\nIn a bin packing problem, you are given:\\n'containers'\\nA set of 'objects' some or all of which must be packed into one or more containers. The set may contain different objects with their sizes specified, or a single object of a fixed dimension that can be used repeatedly.\\nUsually the packing must be without overlaps between goods and other goods or the container walls. In some variants, the aim is to find the configuration that packs a single container with the maximal density. More commonly, the aim is to pack all the objects into as few containers as possible. In some variants the overlapping is allowed but should be minimized."},{"page_url":"https://da.wikipedia.org/wiki/Els_von_Gemmingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Els_von_Gemmingen1.jpg","page_title":"Els von Gemmingen","context_page_description":"Els von Gemmingen var priorinde i Magdalenenklosteret i Speyer i 1504."},{"page_url":"https://de.wikipedia.org/wiki/Lancia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/L%27evolutione_dell%27automobile_Lancia.jpg","page_title":"Lancia","context_page_description":"Lancia ist ein italienischer Automobilhersteller mit Sitz in Turin. Das Unternehmen wurde 1906 in Turin gegründet und gehört seit 1969 zum Fiat-Konzern.\\nDer Traditionshersteller kann auf Pionierleistungen im Automobilbau zurückblicken und war lange Zeit auch mit Erfolg im Rallye-Sport präsent. Die Fahrzeuge der Marke stehen seit jeher für eine hohe Designaffinität, die sich früher durch zahlreiche sowie teils außergewöhnliche Karosserievarianten auszeichnete, später auch durch eine besondere Auswahl an Materialien und Designlösungen.\\nAb 2009 kooperierte Lancia mit Chrysler. Lancia wirkte am Design beider Marken mit, geringfügig modifizierte Chrysler-Fahrzeuge wurden als Lancia-Modelle in Europa angeboten. 2014 wurde bekanntgegeben, dass die Produktion von Fahrzeugen mit dem Markennamen Lancia schrittweise eingestellt werde. Seit Ende April 2017 wird das letzte noch gebaute Modell Ypsilon nur noch in Italien angeboten."},{"page_url":"https://bs.wikipedia.org/wiki/Okinavljanski_kobud%C5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/2_sai.JPG","page_title":"Okinavljanski kobudō","context_page_description":"Okinavljanski kobudō je japanski pojam koji se može prevesti kao \\"stari borilački način Okinave \\". To se općenito odnosi na klasičnu tradiciju oružja Okinavljanskih borilačkih vještina, od kojih su najpoznatiji rokushakubo, VRI, tonfa, Kama, i nunčaku, ali i tekko, tinbe-rochin, i surujin. Manje uobičajeno Okinavljansko oružje uključuje Tambo i eku."},{"page_url":"https://sv.wikipedia.org/wiki/STS-32","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/STS-32_patch.png","page_title":"STS-32","context_page_description":"STS-32 var den trettiotredje flygningen i det amerikanska rymdfärjeprogrammet och nionde i ordningen för rymdfärjan Columbia."},{"page_url":"https://ca.wikipedia.org/wiki/Car%C3%A0ngids","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Caranx_melampygus.jpg","page_title":"Caràngids","context_page_description":"La família dels caràngids està constituïda per peixos pelàgics, osteïctis i de l'ordre dels perciformes."},{"page_url":"https://hr.wikipedia.org/wiki/Arthur_Leonard_Schawlow","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Libs_Laser-induced_breakdown_spectroscopy.jpg","page_title":"Arthur Leonard Schawlow","context_page_description":"Arthur Leonard Schawlow, američki fizičar. Studirao fiziku i matematiku na Sveučilištu u Torontu, no s prekidima, zbog ekonomske krize, nedostatka novca i ratnih okolnosti, kada je radio na razvoju mikrovalnih antena za radarske uređaje, doktorirao. Radio je na Sveučilištu Columbia u New Yorku, s C. H. Townesom bavio se istraživanjima koja su dovela do izuma lasera, radio u Bellovim laboratorijima u Murray Hillu, bio profesor fizike na Sveučilištu Stanford. Bavio se optičkom i mikrovalnom spektroskopijom, kvantnom elektronikom, nuklearnom rezonancijom i supravodljivošću. Godine 1981. je, s N.\\nBloembergenom, dobio Nobelovu nagradu za fiziku za doprinos razvoju laserske spektroskopije na osnovi kvantne mehanike. Iste je godine nagrađen i K. M. B. Siegbahn. Po Schawlowu su nazvani američka nagrada za laserska istraživanja koja se dodjeljuje od 1991. i planetoid. Bio je član Američke akademije umjetnosti i znanosti."},{"page_url":"https://fr.wikipedia.org/wiki/Acide_malique","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Walden_inversion.png","page_title":"Acide malique","context_page_description":"L'acide malique est un acide alpha-hydroxylé de formule HOOC-CH₂-CHOH-COOH. Il s'agit d'un acide dicarboxylique très répandu dans le règne végétal et naturellement présent dans les pommes, les poires et le jus de raisin, dont il contribue à la saveur agréable. Il est de ce fait utilisé comme additif alimentaire, sous le numéro E296. Il existe sous la forme de deux diastéréoisomères, les énantiomères L et D ; seul l'acide L-malique est présent dans le milieu naturel. La base conjuguée de l'acide malique et ses sels sont appelés malates. L'anion L-malate est un intermédiaire du cycle de Krebs, l'une des voies métaboliques majeures de respiration cellulaire chez presque tous les êtres vivants, et intervient dans le cycle de Calvin, qui entre dans le cadre de la photosynthèse."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_campe%C3%A3s_femininas_da_WWE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Melina_Royal_Rumble_2009.jpg","page_title":"Lista de campeãs femininas da WWE","context_page_description":"O WWE Women's Championship foi um título feminino de wrestling profissional disputado na World Wrestling Entertainment. Criado em 1956, foi o mais velho título ativo na história da World Wrestling Entertainment, até sua aposentadoria em 2010, quando foi unificado ao WWE Divas Championship.\\nA campeã inaugural foi The Fabulous Moolah, que derrotou Judy Grable em setembro de 1956, tendo o maior reinado oficial, com 27 anos, 10 meses e cinco dias, um total de 10 dias. Trish Stratus possui o maior número de reinados, sete. Mickie James teve o reinado mais curto, com apenas alguns minutos.\\nLayla foi a última campeã, ao derrotar Beth Phoenix em uma luta 2-contra-1 no SmackDown de 1° de maio de 2010, exibido no dia 14. No total, existiram 29 campeãs e 59 reinados."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Bristol","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Neptune_-_geograph.org.uk_-_769847.jpg","page_title":"Grade II* listed buildings in Bristol","context_page_description":"There are 212 Grade II* listed buildings in Bristol, England.\\nIn England and Wales the authority for listing is granted by the Planning Act 1990 and is administered by English Heritage, an agency of the Department for Culture, Media & Sport\\nIn the United Kingdom the term listed building refers to a building or other structure officially designated as being of special architectural, historical or cultural significance."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AF%D9%88%D9%88%D8%A8%D8%B1%D8%A7%D9%88%DB%8C%D8%AA%D8%B3%D9%87_%D9%86%D8%A7%D8%AF_%D8%B3%D9%88%DB%8C%D8%AA%D8%A7%D9%88%D9%88%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Doubravice_nad_Svitavou_CoA.png","page_title":"دووبراویتسه ناد سویتاووو","context_page_description":"دووبراویتسه ناد سویتاووو چک اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۳۱۵ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا ۱۲۶۴ نفر ایمیش و گونئی موراویا اوستانیندا یئرلشیب. بۆتون چک‌دا اوْلدوغو کیمی، بۇ شهرده آنا دیلی چک دیلی دیر."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A8%81%E7%8C%9B%E8%A3%B8%E8%83%B8%E9%B1%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Gymnothorax_conspersus_-_pone.0010676.g006.png","page_title":"威猛裸胸鱔","context_page_description":"威猛裸胸鳝，又称威猛裸胸鯙，为辐鳍鱼纲鳗鲡目鯙亚目鯙科的其中一种，分布于西大西洋区，从墨西哥湾、加勒比海至巴西南部海域，栖息深度100-310米，本鱼体棕栗色，头部苍白，尾部近黑色，身体具有白色斑点，背鳍具有黑白乡间的斑纹，体长可达110公分，为底栖性鱼类，生活在大陆坡，属肉食性，生活习性不明。"},{"page_url":"https://es.wikipedia.org/wiki/Pig%C3%B3stilo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Squelette_oiseau.svg","page_title":"Pigóstilo","context_page_description":"El término pigóstilo se refiere a las vértebras caudales distales fusionadas en una sola osificación que sostiene las plumas y la musculatura de la cola de las aves y dinosaurios relacionados. En las aves modernas están unidas a éste las rectrices.\\nEl pigóstilo es la estructura ósea que sostiene la rabadilla, protuberancia carnosa visible en la parte posterior de un ave desplumada que puede comúnmente verse en un pollo, pavo u otra ave que se prepara para cocinar. La rabadilla incluye también la glándula uropígea que produce el aceite para el acicalamiento."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82%D0%BE_%D0%91%D1%83%D1%80%D0%BB_%D0%9C%D0%B0%D1%80%D0%BA%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/CopacabanaPavement.jpg","page_title":"Роберто Бурл Маркс","context_page_description":"Роберто Бурл Маркс је био бразилски пејзажни архитекта чији пројекти паркова и вртова су га учинили светски познатим. Он је увео модерну пејзажну архитектуру у Бразил. Био је познат као савремени уметник природе и дизајнер јавног градског простора."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_zum_UNESCO-Welterbe_z%C3%A4hlenden_Kirchengeb%C3%A4uden","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Urbino_z03.jpg","page_title":"Liste von zum UNESCO-Welterbe zählenden Kirchengebäuden","context_page_description":"Die Liste von zum UNESCO-Welterbe zählenden Kirchengebäuden enthält für sich allein zum UNESCO-Welterbe ernannte Kirchengebäude. Solche Kirchengebäude, die innerhalb eines Ensembles zum UNESCO-Welterbe mit ernannt wurden, werden insofern berücksichtigt, als nur auf exemplarische Einzelbeispiele und ggf. hierzu bereits extra angelegte Listen verwiesen wird.\\nDie Reihung der Einträge folgt zuerst nach dem Alphabet für die Spalte Ort, dann für die Spalte Name."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8F%B0%E5%9F%8E%E8%A1%97%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Taicheng_pedestrian_walk_in_Taishan%2C_Jiangmen%2C_Guangdong.jpg","page_title":"台城街道","context_page_description":"台城街道，是中华人民共和国广东省江门市台山市下辖的一个乡镇级行政单位。"},{"page_url":"https://en.wikipedia.org/wiki/Donau_City_Church","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Donau_City_Church_Vienna_from_SSW_on_2012-09-25.jpg","page_title":"Donau City Church","context_page_description":"The Donau City Church, known more formally by its dedication as Christus, Hoffnung der Welt is a Roman Catholic parish church in Vienna's 22nd district. The church is located next to the Vienna International Centre. Its architect is Heinz Tesar."},{"page_url":"https://fi.wikipedia.org/wiki/Tekij%C3%A4_XIII","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Factor_XIII_activation_via_thrombin.svg","page_title":"Tekijä XIII","context_page_description":"Hyytymistekijä XIII on ihmisten ja monien muiden eläinten veressä oleva inaktiivinen tsymogeeni. Se katkeaa aktiiviseksi tekijäksi XIIIa, joka on osa veren hyytymistä. Monista hyytymistekijöistä poiketen XIIIa on transglutaminaasi. Se tuottaa verkkosidoksia verihyytymän muodostavien fibriinien välille. Sidokset vahventavat hyytymää. XIII tunnetaan myös nimellä fibriiniä stabiloiva tekijä.\\nTarkemmin ottaen XIII:t koostuvat kahden XIIIA-entsyymin ja kahden ei-entsymaattisen XIIIB-proteiinin yhdistelmistä eli ne ovat heterotetrameerejä. Näiden XIIA:t aktivoituvat trombiinien avulla, jolloin XIIIB:t irtoavat. Jäljelle jääneet XIIIA₂-homodimeerit katalysoivat verkkosidosten muodostusta. Myös XIIIA₂- ja XIIIB₂-dimeereitä ilmenee kehossa eri kudoksissa, mutta nämä eivät tiettävästi osallistu hyytymiseen."},{"page_url":"https://fy.wikipedia.org/wiki/St._Lawrence_(eil%C3%A2n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Wfm_st_lawrence_island.jpg","page_title":"St. Lawrence (eilân)","context_page_description":"St. Lawrence is in fulkanysk eilân yn 'e Amerikaanske steat Alaska, dat westlik fan it fêstelân yn 'e Beringsee leit, in eintsje besuden de Beringstrjitte. It eilân leit tichter by Aazje as by Noard-Amearika: de noardein fan St. Lawrence leit op 58 km ôfstân fan it fêstelân fan it Tsjûkotka-skiereilân, dat ta de Russyske Federaasje heart. Geologen binne fan tinken dat St. Lawrence ien fan 'e lêste boppe see útstekkende dielen is fan 'e Beringlânbrêge, dy't yn it Pleistoseen Aazje en Noard-Amearika mei-inoar ferbûn. It is it op fiif nei grutste eilân fan 'e Feriene Steaten en it op 112 nei grutste eilân fan 'e wrâld. De oarspronklike bewenners fan St. Lawrence binne de Middensibearyske Jûpik, in Eskimofolk."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D0%BD%D0%B5%D1%88%D0%B5%D0%BC%D1%81%D0%BA%D0%B0%D1%8F_%D0%B5%D0%BF%D0%B0%D1%80%D1%85%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C%2C_%D1%81%D0%B5%D0%BB%D0%BE_%D0%9A%D0%BE%D1%89%D0%B5%D0%B5%D0%B2%D0%BE%2C_%D0%BF%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B5%D0%BD%D0%B0_%D0%B2_1811_%D0%B3.jpg","page_title":"Кинешемская епархия","context_page_description":"Кинеше́мская епа́рхия — епархия Русской православной церкви в административных границах Верхнеландеховского, Заволжского, Кинешемского, Лухского, Палехского, Пестяковского, Пучежского, Родниковского и Юрьевецкого районов Ивановской области. Входит в состав Ивановской митрополии. Правящий архиерей имеет титул епископ Кинешемский и Палехский. Кафедра епископа и епархиальное управление расположены в Троицко-Успенском кафедральном соборе города Кинешмы."},{"page_url":"https://fr.wikipedia.org/wiki/Aigrette_garzette","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Aigrette_garzette_lac_de_Tunis_%28site_Ramsar%29.jpg","page_title":"Aigrette garzette","context_page_description":"L'Aigrette garzette est une espèce d'oiseaux de la famille des Ardeidae."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wiener_Parks_und_Gartenanlagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Wien_09_Erwin-Ringel-Park_d.jpg","page_title":"Liste der Wiener Parks und Gartenanlagen","context_page_description":"Dies ist eine Liste von Parks und Gartenanlagen in Wien, sofern sie einen Namen tragen:"},{"page_url":"https://cs.wikipedia.org/wiki/Victor_Hayden","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/VH_02_copy.jpg","page_title":"Victor Hayden","context_page_description":"Victor Hayden, známý pod přezdívkou The Mascara Snake; byl americký klarinetista. Proslul svojí spoluprací s Captainem Beefheartem, se kterým nahrál album Trout Mask Replica z roku 1969. Zajímavostí je, že Victor Hayden byl bratrancem Captaina Beefhearta. Zemřel roku 2018 ve věku 70 let."},{"page_url":"https://da.wikipedia.org/wiki/Ille-sur-T%C3%AAt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Les_Orgues_Ille-sur-Tet1.jpeg","page_title":"Ille-sur-Têt","context_page_description":"Ille-sur-Têt er en by og kommune i departementet Pyrénées-Orientales i Sydfrankrig. Ille ligger i Roussillon, som er den franske del af Catalonien."},{"page_url":"https://fr.wikipedia.org/wiki/P%C3%A8res_fondateurs_des_%C3%89tats-Unis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/George_Clinton.jpg","page_title":"Pères fondateurs des États-Unis","context_page_description":"Les Pères fondateurs des États-Unis sont les signataires de la Déclaration d'indépendance ou la Constitution des États-Unis, ainsi que ceux participant à la révolution américaine comme Revolutionaries. Considérés comme des héros aux États-Unis, ces hommes sont principalement chrétiens, quelques-uns athées ou déistes. Par ailleurs, plusieurs pères sont membres de la franc-maçonnerie."},{"page_url":"https://id.wikipedia.org/wiki/Pioneer_10","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Pioneer_10-11_-_P56_-_fx.jpg","page_title":"Pioneer 10","context_page_description":"Pioneer 10 adalah sebuah pesawat luar angkasa pertama yang melampaui sabuk asteroid, dan juga yang pertama melakukan pengamatan langsung terhadap planet Jupiter. Pesawat ini diluncurkan pada tanggal 2 Maret 1972, dan berhasil mengirimkan foto jarak dekat Jupiter pertama pada 3 Desember 1973. Pada tanggal 13 Juni 1983 Pioneer 10 melintasi orbit Neptunus dan menjadi benda buatan manusia pertama yang meninggalkan tata surya, walaupun belum melewati heliopause atau awan Oort."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%81%932%E5%8F%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/%E5%85%B5%E5%BA%AB%E7%9C%8C%E6%98%8E%E7%9F%B3%E5%B8%82%E5%86%85.jpg","page_title":"国道2号","context_page_description":"国道2号は、大阪府大阪市北区から福岡県北九州市門司区に至る一般国道である。"},{"page_url":"https://en.wikipedia.org/wiki/Aureolysin","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/PDB_1bqb_EBI.jpg","page_title":"Aureolysin","context_page_description":"Aureolysin is an extracellular metalloprotease expressed by Staphylococcus aureus. This protease is a major contributor to the bacterium's virulence, or ability to cause disease, by cleaving host factors of the innate immune system as well as regulating S. aureus secreted toxins and cell wall proteins. To catalyze its enzymatic activities, aureolysin requires zinc and calcium which it obtains from the extracellular environment within the host."},{"page_url":"https://tr.wikipedia.org/wiki/Liverpool_%C3%9Cniversitesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/University_of_Liverpool_Building.jpg","page_title":"Liverpool Üniversitesi","context_page_description":"Liverpool Üniversitesi Birleşik Krallık'ın Liverpool şehrinde bulunan yükseköğretim kurumudur. Üniversite Russel Grubu üyesidir. Üniversite \\"redbrick denilen Kraliçe Viktorya döneminde İngiltere'nin 6 endüstrileşmiş şehrine kurulan ve II. Dünya Savaşı'nın öncesinde üniversite statüsünü kazanan üniversitelerden biridir. Üniversite 8 adet Nobel Ödülü kazanmış, günümüzde 103 değişik konuda 230 lisans diplomasi için eğitim verilmektedir. Üniversitenin özel yıllık geliri £219 milyon olup, bu gelirin £75 milyonu araştırma amaçlı kullanılmaktadır.\\nÜniversite bir kamu üniversitesi özelliği taşımaktadır. 16.805 lisans, 3.860 yüksek lisans öğrencisi üniversite bünyesinde eğitim görmektedir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%BE%D0%B1%D1%8C%D1%91%D0%B2%D1%8B_%D0%B3%D0%BE%D1%80%D1%8B_(%D0%BF%D1%80%D0%B8%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%BA%D0%B0%D0%B7%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%D0%A1%D0%BA%D0%BB%D0%BE%D0%BD%D1%8B_%D0%92%D0%BE%D1%80%D0%BE%D0%B1%D1%8C%D1%91%D0%B2%D1%8B%D1%85_%D0%B3%D0%BE%D1%80_%282%29.jpg","page_title":"Воробьёвы горы (природный заказник)","context_page_description":"Воробьёвы го́ры — природный заказник, покрывающий территорию исторической местности «Воробьёвы горы». Был основан 21 июля 1998 года."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9C%B0%E6%96%B9%E7%B7%8F%E7%9B%A3%E5%BA%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/HiroshimaL%26SUniv.jpg","page_title":"地方総監府","context_page_description":"地方総監府は、第二次世界大戦最末期の日本において、本土決戦のため全国8ヵ所に置かれた、都道府県の上位に位置する内務省管轄下の地方行政機関である。敗戦後の同年11月に廃止されたため極めて短命に終わった。"},{"page_url":"https://en.wikipedia.org/wiki/Propylamine","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/N-Propylamine_3D_ball.png","page_title":"Propylamine","context_page_description":"Propylamine, also known as n-propylamine, is an amine with the chemical formula CH₃(CH₂)₂NH₂. It is a colorless volatile liquid.\\nPropylamine is a weak base. Its Kb is 4.7 × 10⁻⁴."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Siegeberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bergsporn_der_ehemaligen_Burg_Siegeberg_Upflam%C3%B6r_-_Zwiefalten_Blick_von_S%C3%BCd-Westen.jpg","page_title":"Burg Siegeberg","context_page_description":"Die Burg Siegeberg ist eine abgegangene Spornburg auf 655 m ü. NN im Geisinger Tal nordöstlich von Upflamör, einem Ortsteil von Zwiefalten im Landkreis Reutlingen."},{"page_url":"https://en.wikipedia.org/wiki/Australian_non-residential_architectural_styles","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Young_Commercial_Bank_Building-1%2B_%282145438525%29.jpg","page_title":"Australian non-residential architectural styles","context_page_description":"Australian non-residential architectural styles are a set of Australian architectural styles that apply to buildings used for purposes other than residence and have been around only since the first colonial government buildings of early European settlement of Australia in 1788.\\nTheir distribution follows closely the establishment and growth of the different colonies of Australia, in that the earliest colonial buildings can be found in New South Wales and Tasmania.\\nThe classifications set out below are derived from a leading Australian text."},{"page_url":"https://es.wikipedia.org/wiki/Boussi%C3%A8res","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/Boussi%C3%A8res_papeterie_entr%C3%A9e.JPG","page_title":"Boussières","context_page_description":"Boussières es una población y comuna francesa, en la región de Franco Condado, departamento de Doubs, en el distrito de Besançon y cantón de Boussières."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CE%B1%CF%81%CE%AC%CE%B3%CE%B3%CE%B9_%CF%84%CE%BF%CF%85_%CE%9D%CF%84%CE%B1%CF%81%CE%B9%CE%AC%CE%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Darial-Gorge.JPG","page_title":"Φαράγγι του Νταριάλ","context_page_description":"Το φαράγγι Νταριάλ ή Νταριαλί, είναι φαράγγι, πέρασμα και σημείο ελέγχου, στα σύνορα μεταξύ της Ρωσίας και της Γεωργίας. Βρίσκεται ανατολικά, στο ύψος της βάσης, του βουνού Καζμπέκ και διασχίζεται από τον ποταμό Τάρεκ, σε μια απόσταση 15 περίπου χιλιομέτρων. Το φαράγγι βρίσκεται νότια της σημερινής πόλης Βλαντικαβκάζ, πρωτεύουσας της Δημοκρατίας της Βόρειας Οσετίας - Αλανίας."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Ranskan_diplomaattisista_edustustoista","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Diplomatic_missions_of_France.PNG","page_title":"Luettelo Ranskan diplomaattisista edustustoista","context_page_description":"Tämä on luettelo Ranskan diplomaattisista edustustoista. Luettelo kattaa kaikki Ranskan pysyvät diplomaattiset edustustot lukuun ottamatta kunniakonsuleita. Ranskan ensimmäinen diplomaattinen edustusto perustettiin vuonna 1522 Sveitsiin. Nykyään Ranskalla on eniten diplomaattisia edustustoja maailmassa Yhdysvaltojen jälkeen. Vaikka Ranska ei ole enää siirtomaamahti, se on kuitenkin edelleen merkittävä kansainvälinen toimija. Maa on esimerkiksi yksi viidestä Yhdistyneiden kansakuntien turvallisuusneuvoston pysyvästä jäsenestä, G8:n jäsen ja Naton, OECD:n ja EU:n perustajajäsen."},{"page_url":"https://es.wikipedia.org/wiki/Venansault","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Map_commune_FR_insee_code_85300.png","page_title":"Venansault","context_page_description":"Venansault es una población y comuna francesa, en la región de Países del Loira, departamento de Vendée, en el distrito de La Roche-sur-Yon y cantón de La Roche-sur-Yon-Nord."},{"page_url":"https://es.wikipedia.org/wiki/Bola%C3%B1os","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Bandera_de_Bola%C3%B1os%2C_Jalisco..png","page_title":"Bolaños","context_page_description":"Bolaños es un municipio y pueblo de la Región Norte del estado de Jalisco, México. Se encuentra aproximadamente a 300 km al norte de Guadalajara. Según el II Conteo de Población y Vivienda de 2005, el municipio tiene 5.019 habitantes.​ En sus orígenes llevó por nombre Villa del Real de Bolaños. Su extensión territorial es de 1.499,79 km² y la población se dedica principalmente al sector terciario.​ A mediados del siglo XVIII se convirtió en un centro minero muy importante, produciendo el 20% del total de la plata extraída en la Nueva España, en esa época llegó a tener 17.000 habitantes.​"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8D%97%E5%AE%AE%E5%A4%A7%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/ja/4/40/%E5%8D%97%E5%AE%AE%E5%A4%A7%E7%A4%BE_%E7%9F%B3%E9%80%A0%E9%B3%A5%E5%B1%85.JPG","page_title":"南宮大社","context_page_description":"南宮大社は、岐阜県不破郡垂井町にある神社。旧称は南宮神社。式内社、美濃国一宮。旧社格は国幣大社で、現在は神社本庁の別表神社。"},{"page_url":"https://nl.wikipedia.org/wiki/Green_Acres_(televisieserie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Eddie_Albert_Eva_Gabor_Green_Acres_1965.JPG","page_title":"Green Acres (televisieserie)","context_page_description":"Green Acres was een Amerikaanse sitcom met Eddie Albert en Eva Gabor. Hierin speelden zij een echtpaar dat verhuisde van New York naar een boerderijtje op het platteland. De serie werd uitgezonden in de Verenigde Staten door CBS tussen 15 september 1965 en 27 april 1971. De serie was een zogenaamde 'zuster show' van Petticoat Junction, een andere Amerikaanse serie die zich in hetzelfde fictieve universum afspeelde en veel cross-overs had met Green Acres. Vanaf 13 oktober 1966 werd de serie in Nederland uitgezonden onder de titel Geen beter leven dan het buitenleven.\\nTijdens de zes jaar dat de serie werd uitgezonden, had het zeer hoge kijkcijfers. Toch werd Green Acres in 1971 door een wijziging van het beleid bij CBS van de buis gehaald."},{"page_url":"https://jv.wikipedia.org/wiki/Gerakan_non-blok","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/NAM_Members.svg","page_title":"Gerakan non-blok","context_page_description":"Gerakan Non-Blok ya iku organisasi internasional kang kapérang punjul 100 nagara-nagara kang ora ngakoni beraliansi karo utawa marang blok kakuwatan gedhé apa waé. Tujuwan organisasi iki, kacathet ana ing Deklarasi Havana taun 1979, ya iku kanggo njamin \\"kamardhikan, kedhaulatan, integritas tèritorial, lan keamanan nagara-nagara nonblok\\" ing perjuangan nentang imperialisme, kolonialisme, neo-kolonialisme, apartheid, zionisme, rasisme lan sakabéhing wujud agrèsi militèr, pendhudhukan, dominasi, interferènsi, utawa hegemoni, lan nentang sakabéhing wujud blok pulitik. Dhèwèké merepresentasikan 55 persèn saka warga donya lan mèh 2/3 keangotaan PBB. Nagara-nagara kang wis nganakaké konferènsi tingkat tinggi Non-Blok kaya ta Yugoslavia, Mesir, Zambia, Aljazair, Sri Lanka, Kuba, India, Zimbabwe, Indonesia, Kolombia, Afrika Selatan lan Malaysia."},{"page_url":"https://ca.wikipedia.org/wiki/Silvestrins","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/San_silvestro_grottafucile.jpg","page_title":"Silvestrins","context_page_description":"L'Orde dels Silvestrins o Orde de Montefano és una congregació religiosa benedictina, nascuda com a orde monàstic que seguia la Regla de Sant Benet. Va ser fundada a Monte Fano, prop de Fabriano, per Sant Silvestre Guzzolini en 1231."},{"page_url":"https://pl.wikipedia.org/wiki/Jacek_Rybi%C5%84ski","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Gda%C5%84sk_Oliwa_%28katedra_-_p%C5%82yta_nagrobna_Jacka_Rybi%C5%84skiego%29.JPG","page_title":"Jacek Rybiński","context_page_description":"Józef Jacek Rybiński herbu Radwan – cysters, ostatni opat klasztoru w Oliwie."},{"page_url":"https://br.wikipedia.org/wiki/Inizi_Hermite","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Hermite.Islands.JPG","page_title":"Inizi Hermite","context_page_description":"An Inizi Hermite, pe L'Hermite zo inizi eus su Chile, er su d'an Inizi Wollaston. War an hini suañ anezho, Enez Hornos, emañ ar C'hab Horn.\\nDont a ra o anv eus anv ar moraer izelvroat Jacques L'Hermite."},{"page_url":"https://en.wikipedia.org/wiki/Telescopic_sight","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Sniperscope.jpg","page_title":"Telescopic sight","context_page_description":"A telescopic sight, commonly called a scope, is an optical sighting device that is based on a refracting telescope. It is equipped with some form of graphic image pattern mounted in an optically appropriate position in its optical system to give an accurate aiming point. Telescopic sights are used with all types of systems that require accurate aiming but are most commonly found on firearms, particularly rifles. Other types of sights are iron sights, reflector sights, and laser sights. The optical components may be combined with optoelectronics to form a night scope."},{"page_url":"https://eu.wikipedia.org/wiki/Nyctibatrachus_kempholeyensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Nyctibatrachus_kempholeyensis_frog.JPG","page_title":"Nyctibatrachus kempholeyensis","context_page_description":"Nyctibatrachus kempholeyensis Nyctibatrachus generoko animalia da. Anfibioen barruko Nyctibatrachidae familian sailkatuta dago, Anura ordenan."},{"page_url":"https://en.wikipedia.org/wiki/Scuba_skills","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/US_Navy_110727-N-KB666-379_Arnulfo_Lopez_conducts_a_front_step_entry_prior_to_search_operations_with_Mobile_Diving_and_Salvage_Unit_%28MDSU%29_2.jpg","page_title":"Scuba skills","context_page_description":"Scuba skills are the skills required to dive safely using self-contained underwater breathing apparatus. Most of these skills are relevant to both open circuit and rebreather scuba, and many are also relevant to surface-supplied diving. Those skills which are critical to the safety of the diver may require more practice than is usually provided during training to achieve reliable long-term proficiency\\nSome of the skills are generally accepted by recreational diver certification agencies as necessary for any scuba diver to be considered competent to dive without direct supervision, and others are more advanced, though some diver certification and accreditation organizations may consider some of these to also be essential for minimum acceptable entry level competence. Divers are instructed and assessed on these skills during basic and advanced training, and are expected to remain competent at their level of certification, either by practice or refresher courses."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3%D0%B1%D0%B8%D0%B2%D1%81%D1%82%D0%B2%D0%BE_%D1%85%D0%B0%D1%80%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%B3%D0%BE_%D1%81%D1%83%D0%B4%D0%B4%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/%D0%96%D0%B8%D1%82%D0%BB%D0%BE%D0%B2%D0%B8%D0%B9_%D0%B1%D1%83%D0%B4%D0%B8%D0%BD%D0%BE%D0%BA_%E2%84%9685_%D0%BF%D0%BE_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%BE%D0%BC%D1%83_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82%D1%83_%D0%BC%D1%96%D1%81%D1%82%D0%B0_%D0%A5%D0%B0%D1%80%D0%BA%D0%BE%D0%B2%D0%B0.jpg","page_title":"Убивство харківського судді","context_page_description":"Уби́вство ха́рківського судді́ — поширена у ЗМІ назва умисного вбивства судді Фрунзенського районного суду міста Харкова Володимира Трофімова та членів його родини, що сталося 15 грудня 2012 року в Харкові. Один з найбільш жорстоких і резонансних злочинів у новітній історії України."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%88%D9%84%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Scalinata_monumentale_-_Leuca.JPG","page_title":"بوليا","context_page_description":"بوليا هي منطقة في جنوب شرق إيطاليا مطلة على البحر الأدرياتيكي في الشرق و البحر الأيوني إلى الجنوب الشرقي و مضيق أوترانتو و خليج تارانتو في الجنوب. جزءها الجنوبي يعرف باسم سالنتو و هو شبه جزيرة تشكل كعب \\"الجزمة\\" الإيطالية. تبلغ مساحة الإقليم 19345 كيلومتر مربع و تعداد سكانه حوالي 4 ملايين. يحد بوليا أقاليم إيطالية أخرى مثل موليزي إلى الشمال و كامبانيا إلى الغرب و بازيليكاتا إلى الجنوب الغربي. جيرانها اليونان و ألبانيا عبر البحر الأيوني والبحر الأدرياتيكي على التوالي. تمتد المنطقة شمالاً حتى مونتي غارغانو، وشهدت آخر مراحل الحرب البونيقية الثانية."},{"page_url":"https://en.wikipedia.org/wiki/Baryshnikov_Arts_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Scene_from_ILLUSIONS_at_the_Baryshnikov_Arts_Center.jpg","page_title":"Baryshnikov Arts Center","context_page_description":"The Baryshnikov Arts Center is a foundation and arts complex opened by Mikhail Baryshnikov in 2005 at 450 West 37th Street between Ninth and Tenth Avenues in the Hell's Kitchen neighborhood of Manhattan, New York City. The top three floors of the complex are occupied by the Baryshnikov Arts Center, which provides space and production facilities for dance, music, theater, film, and visual arts. The building also houses the Orchestra of St. Luke's DiMenna Center for Classical Music."},{"page_url":"https://eo.wikipedia.org/wiki/Harold_Urey","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Urey.jpg","page_title":"Harold Urey","context_page_description":"Harold Clayton UREY estis usona kemiisto kaj instruisto.\\nUrey estis pioniro labori kun izotopoj. Li ankaŭ esploris pri geofiziko, pri la problemo de la origino de la Sunsistemo kaj pri paleontologio. Li estis unu el la co-aŭtoroj de la Eksperimento de Miller kaj Urey sur la kemia origino de la vivo.\\nEn 1934 li ricevis la Nobel-premion pri Kemio kaj en 1966 li ricevis la Medalon de Oro de la Reĝa Astronomia Socio."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%92%D0%B8%D1%82%D0%B5%D0%B1%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Vitebsk_gub_coa.png","page_title":"История Витебска","context_page_description":"История Витебска, центра Витебской области, охватывает более тысячелетия."},{"page_url":"https://en.wikipedia.org/wiki/Herman_Schmalenbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Schmalenbach_herman.png","page_title":"Herman Schmalenbach","context_page_description":"Herman Schmalenbach was a German philosopher who refined the concepts of Gemeinschaft and Bund."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%80%D1%83%D0%B3%D0%BB%D0%BE_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%84%D0%B2%D0%B3%D0%B5%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Oleh_pruhlo.jpg","page_title":"Пругло Олег Євгенович","context_page_description":"Олег Євгенович Пругло — український діяч, перший заступник, заступник голови Полтавської обласної державної адміністрації. Виконувач обов'язків голови Полтавської обласної державної адміністрації. Член ВО «Батьківщина»."},{"page_url":"https://pt.wikipedia.org/wiki/E%C3%A7a_de_Queiroz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Assinatura_E%C3%A7a_de_Queir%C3%B3s.png","page_title":"Eça de Queiroz","context_page_description":"José Maria de Eça de Queiroz, contemporaneamente escrito Eça de Queirós, foi um escritor e diplomata português. É considerado um dos mais importantes escritores portugueses da história. Foi autor de romances de reconhecida importância, de Os Maias e O Crime do Padre Amaro. Os Maias é considerado por muitos o melhor romance realista português do século XIX.\\nEça de Queiroz e Machado de Assis são considerados os dois maiores escritores em língua portuguesa do século XIX. Eça notabilizou-se pela originalidade e riqueza do seu estilo e linguagem, o realismo descritivo; e pela crítica social constantes nos seus romances. O termo \\"acaciano\\" para definir alguém com um discurso vazio, enfeitado, pomposo, mas sem conteúdo, presente na Língua portuguesa; é uma alusão ao personagem Conselheiro Acácio, do romance O Primo Basílio."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A4%D1%96%D0%B4%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Farnese_Diadumenos_BM_501.jpg","page_title":"Фідый","context_page_description":"Фідый — старажытнагрэчаскі скульптар і архітэктар, адзін з найвялікшых мастакоў перыяду высокай класікі. Асабісты сябар Перыкла."},{"page_url":"https://fr.wikipedia.org/wiki/El_Hormiguero","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Img_cfaneca_20180926-131218_imagenes_md_otras_fuentes_pablo_motos-kczB-U452042964185oCF-980x554%40MundoDeportivo-Web.jpg","page_title":"El Hormiguero","context_page_description":"El Hormiguero est une émission très populaire dans toute l’Espagne. Elle a été produite par “7 y accion”. On la retrouve sur “Antena 3” depuis 2011. Le programme est un mélange d’humour, de magie, d’expériences comme celles de Marron, des échanges avec des célébrités internationaux ou avec des actions, des jeux et défis. Elle traite aussi des sujets tels que la science ou la politique. La première émission a eu lieu le 24 septembre 2006.\\nEl Hormiguero compte plus de 1000 épisodes qui ont été diffusés dans toute l'Espagne en l’espace de 14 ans. Lauréat du National Television Award 2016, El Hormiguero a également reçu la Rose d'or et TP de Oro, 10 Iris Awards, en plus de deux nominations aux Emmy International. Elle est animée et produite par le scénariste Pablo Motos. Il est donc dirigé par Pablo Motos et est assisté par deux marionnettes, Trancas et Barrancas. Parmi les collaborateurs figurent Anna Simon, Pilar Rubio, El Monaguillo…\\nLa septième émission du programme a commencé le 3 septembre 2012. L'émission de la deuxième saison est passée d'une diffusion hebdomadaire de 120 minutes à une diffusion quotidienne de 50 minutes débutant le 17 septembre 2007."},{"page_url":"https://en.wikipedia.org/wiki/Junior_Stanislas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Junior_Stanislas.jpg","page_title":"Junior Stanislas","context_page_description":"Felix Junior Stanislas is an English professional footballer who plays as a winger for Championship club Bournemouth.\\nHe started his career in the youth team of West Ham United at the age of 10 in 2000. He signed a three-year academy contract in the summer of 2006, playing regularly for the under-18 side and reserves. In November 2008, he joined League One club Southend United on a six-week loan. He made his first-team debut for West Ham in March 2009, at the age of 19. He signed a three-and-a-half-year contract in April 2009.\\nIn August 2011, he joined Championship club Burnley on a three-year contract for an undisclosed fee. In June 2014 he signed for Bournemouth on a free transfer, helping them to the Championship title in his first season. In September 2018 he signed a contract extension with Bournemouth until 2021."},{"page_url":"https://pl.wikipedia.org/wiki/Osiedla_Mielca","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Administrative_division_of_Mielec.svg","page_title":"Osiedla Mielca","context_page_description":"Mielec jest podzielony na 18 osiedli, które są jednostkami pomocniczymi wspólnoty samorządowej. Zostały utworzone 14 czerwca 1978 przez Miejską Radę Narodową, a następnie wraz z przyłączeniem kolejnych terenów podział ten był korygowany. Podział na osiedla obejmuje cały obszar miasta, a przy ich wyznaczaniu pod uwagę wzięta została jednorodność układu osadniczego, układ przestrzenny oraz możliwości integracji w celu wykonywania zadań publicznych."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%BB%D0%B8%D0%B2%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Slivia1.jpg","page_title":"Зливија","context_page_description":"Зливија је насеље у Италији у округу Трст, региону Фурланија-Јулијска крајина.\\nПрема процени из 2011. у насељу је живело 146 становника. Насеље се налази на надморској висини од 154 м."},{"page_url":"https://de.wikipedia.org/wiki/Osttimor","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Silberschmied_in_Maubara2.jpg","page_title":"Osttimor","context_page_description":"Die Demokratische Republik Timor-Leste, im Deutschen auch als Osttimor bezeichnet, ist ein Inselstaat in Südostasien. Es war der erste Staat, der im 21. Jahrhundert unabhängig wurde. Die einzige Landgrenze trennt Osttimor vom indonesischen Westteil der Insel Timor, der zu der Provinz Ost-Nusa Tenggara gehört. Nördlich liegen die zu Indonesien gehörenden Inseln Alor, Wetar und Liran und nordöstlich weitere Inseln der indonesischen Provinz Maluku. Australien liegt südlich, jenseits der Timorsee. Neben dem Ostteil Timors gehören zum Staat Osttimor auch die Exklave Oe-Cusse Ambeno in Westtimor und die Inseln Atauro und Jaco."},{"page_url":"https://cs.wikipedia.org/wiki/Zlat%C3%A1_Kti%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Zlat%C3%A1_Kti%C5%A1%2C_plaven%C3%AD_n%C3%A1dr%C5%BE.jpg","page_title":"Zlatá Ktiš","context_page_description":"Zlatá Ktiš je splavovací nádrž v Novohradských horách. Nachází se na Černé, na jižním svahu Jeleního hřbetu v nadmořské výšce 766 m. Má rozlohu 5,24 ha a maximální hloubku 5 m."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B0%E0%AE%BE%E0%AE%9C%E0%AE%B8%E0%AF%8D%E0%AE%A4%E0%AE%BE%E0%AE%A9%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Le_temple_de_Karni_Mata_%28Deshnoke%29_%288423354647%29.jpg","page_title":"ராஜஸ்தான்","context_page_description":"இராஜஸ்தான் Rājasthān, தேவநாகரி: राजस्थान, என்பது இந்தியாவின் மாநிலங்களுள் ஒன்று. ஜெய்ப்பூர் இம்மாநிலத்தின் தலைநகராக உள்ளது. இதுதவிர உதயப்பூர் மற்றும் ஜோத்பூர் ஆகியன முக்கிய நகரங்கள் ஆகும். இராஜஸ்தானி, மார்வாரி, பஞ்சாபி, உருது மற்றும் இந்தி ஆகியன இங்கு பெரும்பான்மையான மக்களால் பேசப்படும் மொழிகள் ஆகும்.\\nஇம்மாநில தார் பாலைவனத்தில் உள்ள பொக்ரான் எனுமிடத்தில் முதன் முதலாக 1974 ஆம் ஆண்டு மே மாதம் 18-ஆம் நாளன்று சிரிக்கும் புத்தர் எனும் பெயரில் இந்தியா தன் முதல் அணுகுண்டு சோதனையை நிகழ்த்தியது. பின்னர் இரண்டாம் முறையாக அதே இடத்தில், 1998 ஆம் ஆண்டு மே மாதம் 11, 13 தேதிகளில் சக்தி நடவடிக்கை எனும் பெயரில் ஐந்து அணுகுண்டுகள் வெடித்து சோதனை செய்தது."},{"page_url":"https://sh.wikipedia.org/wiki/Zagreb","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/University_of_Zagreb.jpg","page_title":"Zagreb","context_page_description":"Zagreb je glavni grad Republike Hrvatske, i najveći grad u Hrvatskoj po broju stanovnika. Povijesno gledano, Zagreb je izrastao iz dva naselja na susjednim brdima, Gradeca i Kaptola, koji čine jezgru današnjeg Zagreba, njegovo povijesno središte.\\nZagreb danas predstavlja upravno, gospodarsko, kulturno, prometno i znanstveno središte Hrvatske. Položajem i kulturom spada u gradove srednje Europe.\\nGrad Zagreb je posebna jedinstvena, teritorijalna, upravna i samoupravna jedinica koja ima položaj županije."},{"page_url":"https://da.wikipedia.org/wiki/Will_Smith","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Will_Smith_-_Emmy_Awards_1993.jpg","page_title":"Will Smith","context_page_description":"Willard Carroll \\"Will\\" Smith, Jr. er en amerikansk skuespiller, producer og rapper. Han har haft succes i tv, film og musik. I april 2007 kaldte Newsweek ham den mest magtfulde skuespiller i Hollywood. Smith har været nomineret til fire Golden Globe Awards, to Academy Awards og har vundet fire Grammy Awards.\\nI slutningen af 1980'erne opnåede Smith beskeden berømmelse som en rapper under navnet The Fresh Prince. I 1990, steg hans popularitet dramatisk, da han spillede hovedrollen i den populære tv-serie The Fresh Prince of Bel-Air. TV-serien kørte i næsten seks år på NBC og er blevet syndikeret konsekvent på forskellige tv-stationer siden da. I midten af 1990'erne gik Smith fra tv til film og medvirkede i talrige succesfilm, såsom Bad Boys, Independence Day, Men in Black og Enemy of the State. Han er den eneste skuespiller der har otte sammenhængende film med brutto på 100 millioner $ på den indenlandske \\"box office\\".\\nFjorten af de nitten fiktionsfilm, han har spillet i har på verdensplan en samlet bruttoindtjening på over 100 millioner dollar, og fire indtjente over 500 millioner dollar i globale billetindtægter."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B0%D0%B1%D0%B0%D1%80,_%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Vend%C3%A9e_Globe_2012-2013_Fran%C3%A7ois_Gabart_Macif.jpg","page_title":"Габар, Франсуа","context_page_description":"Франсуа Габар — французский профессиональный яхтсмен, выигравший в 2013 году кругосветную регату Vendée Globe, преодолев дистанцию свыше 40 000 км за рекордное время — 78 дней 2 часа 16 минут 40 секунд. Также является владельцем рекорда одиночного cуточного перехода под парусом, составляющего 785 миль."},{"page_url":"https://ca.wikipedia.org/wiki/Lanfroicourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Eglise_Lanfroicourt.JPG","page_title":"Lanfroicourt","context_page_description":"Lanfroicourt és un municipi francès, situat al departament de Meurthe i Mosel·la i a la regió del Gran Est. L'any 2007 tenia 123 habitants."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Kartennetzentw%C3%BCrfen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Lambert_conformal_conic_projection_SW.jpg","page_title":"Liste von Kartennetzentwürfen","context_page_description":"Dies ist eine chronologisch sortierte Liste von Kartennetzentwürfen, die eigene Artikel auf Wikipedia haben oder anderweitig bemerkenswert sind. Da die Anzahl der möglichen Kartenprojektionen nicht begrenzt ist, kann es keine umfassende Liste geben."},{"page_url":"https://oc.wikipedia.org/wiki/Fusti%C3%A8r","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Cervo100.jpg","page_title":"Fustièr","context_page_description":"Un fustièr o carpentièr, èra un mestièr de companhonatge que trabalha la fusta. Avián fòrça importància dins los bastiments d'abitacions e tanben de naus que desvolopèron una profession especifica: aquela dels fustièrs de marina. Cal tanben far mencion dels fustièrs que dempuèi la fin de l'Edat mejana trabalhavan dins las rèssas. Se cal mencionar tanben los menuisièrs que son encargats de realizar los mòbles e coma artistas i a los escultors de fusta."},{"page_url":"https://ca.wikipedia.org/wiki/Arquebisbat_de_la_Mare_de_D%C3%A9u_a_Moscou","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Map_of_Roman_Catholic_Archdiocese_of_Moscow.PNG","page_title":"Arquebisbat de la Mare de Déu a Moscou","context_page_description":"L' Arquebisbat de la Mare de Déu de Moscou és una seu metropolitana de l'Església Catòlica a Rússia. Al 2016 tenia 70.000 batejats sobre una població de 58.800.000 habitants. Actualment està regida per l'arquebisbe Paolo Pezzi, F.S.C.B."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D0%BE%D0%B2%D0%B8%D1%89%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Map_of_Sidirokastro.png","page_title":"Валовища","context_page_description":"Вало̀вища или Вало̀вище, също Демир Хисар, или Демирхисар е град в Гърция, в област Централна Македония, център на дем Синтика, както и на Валовищката епархия. Градът има 5711 жители."},{"page_url":"https://en.wikipedia.org/wiki/Lanner_falcon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Falco_biarmicus_-near_Tugela_Ferry%2C_KwaZulu-Natal%2C_South_Africa_-flying-8a.jpg","page_title":"Lanner falcon","context_page_description":"The lanner falcon is a medium-sized bird of prey that breeds in Africa, southeast Europe and just into Asia. It prefers open habitat and is mainly resident, but some birds disperse more widely after the breeding season. A large falcon, it preys on birds and bats."},{"page_url":"https://it.wikipedia.org/wiki/Croce_del_Sud","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Southern_Cross_-New_Zealand-.jpg","page_title":"Croce del Sud","context_page_description":"La Croce del Sud, è la più piccola delle 88 costellazioni moderne, ma anche una delle più famose e appariscenti. È circondata da tre lati dal Centauro, mentre a sud si trova la piccola costellazione della Mosca.\\nA causa della sua luminosità e della sua forma inconfondibile, è spesso raffigurata nelle bandiere delle nazioni situate nell'emisfero australe, come l'Australia, Brasile e la Nuova Zelanda, le quali l'hanno assunta come simbolo della loro posizione geografica meridionale."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D9%88%D9%86%DB%8C_%D8%A2%D9%85%D9%86%D8%AF%D9%88%D9%84%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Tony_Amendola_Creation_Official_Stargate_Convention_2007.jpg","page_title":"تونی آمندولا","context_page_description":"تونی آمندولا هنرپیشه اهل ایالات متحده آمریکا است. از فیلم‌هایی که وی در آن نقش داشته است، می‌توان به دروازه ستارگان اس‌جی-۱، نقاب زورو و افسانه زورو اشاره کرد."},{"page_url":"https://ceb.wikipedia.org/wiki/Przelewice_(kapital_sa_munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Przelewice-Pa%C5%82ac.JPG","page_title":"Przelewice (kapital sa munisipyo)","context_page_description":"Kapital sa munisipyo ang Przelewice sa Polskowa. Nahimutang ni sa powiat sa Powiat pyrzycki ug gingsakopan sa Województwo Zachodniopomorskie, sa kasadpang bahin sa nasod, 400 km sa kasadpan sa Warsaw ang ulohan sa nasod. 65 metros ibabaw sa dagat kahaboga ang nahimutangan sa Przelewice, ug adunay 770 ka molupyo.\\nAng yuta palibot sa Przelewice kay patag, ug nga tinakpan sa ubos sa amihanan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 92 ka metro ug 1.9 km sa habagatan sa Przelewice. Dunay mga 42 ka tawo kada kilometro kwadrado sa palibot sa Przelewice medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Pyrzyce, 13.1 km sa kasadpan sa Przelewice. Hapit nalukop sa kaumahan ang palibot sa Przelewice. Sa rehiyon palibot sa Przelewice, mga lanaw talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Agosto, sa 20 °C, ug ang kinabugnawan Enero, sa -6 °C."},{"page_url":"https://it.wikipedia.org/wiki/Passo_della_Moistrocca","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Izlet_na_Vr%C5%A1i%C4%8D_%283625150613%29.jpg","page_title":"Passo della Moistrocca","context_page_description":"Il passo della Moistrocca è un valico alpino delle Alpi Giulie, in Slovenia, posto a 1.611 m s.l.m., che collega l'Alta Carniola a nord al Goriziano sloveno a sud, attraversato quindi dallo spartiacque tra i bacini del mar Nero e quello del mar Adriatico. Sul passo è presente un rifugio e partono diversi sentieri per le cime circostanti. Fino alla prima guerra mondiale apparteneva interamente al territorio dell'impero austro-ungarico: dal 1921 al 1947 vi passava il confine tra Italia e Iugoslavia; dal 1991 fa parte della Slovenia; nel 1935 sul versante meridionale fu costruita una teleferica dal governo italiano, che venne distrutta dalla guerra."},{"page_url":"https://en.wikipedia.org/wiki/Some_Day_Waiting_Will_End","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/SomeDayWaitingWillEnd.jpg","page_title":"Some Day Waiting Will End","context_page_description":"Some Day Waiting Will End is a song from The Girl Behind the Gun with music by Ivan Caryll and lyrics by Guy Bolton and P. G. Wodehouse. It was published in 1918 by Chappell & Co."},{"page_url":"https://pt.wikipedia.org/wiki/Gr%C3%A9cia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Classic_view_of_Acropolis.jpg","page_title":"Grécia","context_page_description":"Grécia, oficialmente República Helênica ou Helénica e historicamente conhecida como Hélade, é um país localizado no sul da Europa. De acordo com dados do censo de 2011, a população grega é de cerca de 11 milhões de pessoas. Atenas é a capital e a maior cidade do país.\\nO país está estrategicamente localizado no cruzamento entre a Europa, a Ásia, o Oriente Médio e a África. Tem fronteiras terrestres com a Albânia a noroeste, com a Macedônia do Norte e a Bulgária ao norte e com a Turquia no nordeste. O país é composto por nove regiões geográficas: Macedônia, Grécia Central, Peloponeso, Tessália, Epiro, Ilhas Egeias, Trácia, Creta e Ilhas Jônicas. O Mar Egeu fica a leste do continente, o Mar Jônico a oeste e o Mar Mediterrâneo ao sul. A Grécia tem a 11.ª maior costa do mundo, com 13 676 quilômetros de comprimento, com um grande número de ilhas. Oitenta por cento do país é composto por montanhas, das quais o Monte Olimpo é a mais elevada, a 2 917 metros de altitude.\\nA Grécia moderna tem suas raízes na civilização da Grécia Antiga, considerada o berço de toda a civilização ocidental."},{"page_url":"https://de.wikipedia.org/wiki/Jean-%C3%89tienne_Championnet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/G%C3%A9n%C3%A9ral_JEAN_ETIENNE_CHAMPIONNET.jpg","page_title":"Jean-Étienne Championnet","context_page_description":"Jean-Étienne Vachier, genannt Championnet war ein französischer Général de division."},{"page_url":"https://cs.wikipedia.org/wiki/1901","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Franti%C5%A1ek_Halas.jpg","page_title":"1901","context_page_description":"1901 byl rok, který dle gregoriánského kalendáře započal úterým."},{"page_url":"https://fr.wikipedia.org/wiki/Vuka%C5%A1in_Braji%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Vuka%C5%A1in_Braji%C4%87_%C3%A0_Operacija_Trijumf.jpg","page_title":"Vukašin Brajić","context_page_description":"Vukašin Brajić est un chanteur bosnien et serbe, né le 9 février 1984 à Sanski Most."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Mahlsdorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Durlacher_Platz_Berlin-Mahlsdorf_856-738-%28118%29.jpg","page_title":"Liste der Straßen und Plätze in Berlin-Mahlsdorf","context_page_description":"Die Liste der Straßen und Plätze in Mahlsdorf beschreibt das komplette Straßensystem im Berliner Ortsteil Mahlsdorf des Bezirks Marzahn-Hellersdorf mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://fr.wikipedia.org/wiki/Pr%C3%A9sident_de_la_Chambre_des_repr%C3%A9sentants_(Nouvelle-Z%C3%A9lande)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Opening_of_29th_NZ_Parliament.jpg","page_title":"Président de la Chambre des représentants (Nouvelle-Zélande)","context_page_description":"Le président de la Chambre des représentants préside les sessions de la Chambre des représentants de Nouvelle-Zélande. Ses fonctions s'inscrivent dans la continuité de celles du président de la Chambre des communes au Royaume-Uni. Dans l'ordre protocolaire, le Speaker est le troisième personnage de l'État, derrière le Gouverneur général et le Premier ministre.\\nLe président est élu par et parmi les membres de la Chambre. L'élection du président doit être le premier élément à l'ordre du jour après le renouvellement de la Chambre. Bien que généralement élu sous l'étiquette d'un parti politique, il préside les séances de manière impartiale. Il gère les débats à la Chambre, et veille au respect des procédures. Les députés ne peuvent prendre la parole qu'avec l'accord du président, qui veille à une répartition équitable du temps de parole entre la majorité et l'opposition, ainsi qu'entre les ministres ou ministres fantôme et les simples députés. Chargé de maintenir l'ordre dans l'assemblée, le président peut exclure provisoirement de la Chambre tout député perturbateur. Par ailleurs, le président incarne la 'voix' de la Chambre dans ses relations avec l'exécutif."},{"page_url":"https://eu.wikipedia.org/wiki/Sinonatrix_aequifasciata","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Diamond-back_Water_Snake_%28Sinonatrix_aequifasciata%29_%E7%92%B0%E7%B4%8B%E6%B8%B8%E8%9B%87.jpg","page_title":"Sinonatrix aequifasciata","context_page_description":"Sinonatrix aequifasciata Sinonatrix generoko animalia da. Narrastien barruko Natricidae familian sailkatuta dago."},{"page_url":"https://nl.wikipedia.org/wiki/WTA-toernooi_van_Shenzhen_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Halep_RG16_%2820%29_%2827127280230%29.jpg","page_title":"WTA-toernooi van Shenzhen 2018","context_page_description":"Het WTA-tennistoernooi van Shenzhen van 2018 vond plaats van zondag 31 december 2017 tot en met zaterdag 6 januari 2018 in de Chinese plaats Shenzhen. Het was de zesde editie van het toernooi. Er werd gespeeld op hardcourt-buitenbanen.\\nDe Roemeense Simona Halep won de titel in zowel het enkel- als het dubbelspel. Ook de Tsjechische Kateřina Siniaková speelde in beide finales, maar verloor."},{"page_url":"https://pt.wikipedia.org/wiki/S%C3%A9rie_1800_da_CP","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Flickr_-_nmorao_-_Locomotiva_1801%2C_Barreiro-A%2C_2008.12.13.jpg","page_title":"Série 1800 da CP","context_page_description":"A Série 1800 refere-se a um tipo de locomotiva a tracção diesel-eléctrica, que esteve ao serviço da antiga operadora Caminhos de Ferro Portugueses e da sua sucessora, a empresa Comboios de Portugal."},{"page_url":"https://nl.wikipedia.org/wiki/Geldermalsen_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Geldermalsen_station.jpg","page_title":"Geldermalsen (plaats)","context_page_description":"Geldermalsen is een dorp in de gemeente West Betuwe in de Nederlandse provincie Gelderland. Op 1 januari 2019 telde Geldermalsen 10.855 inwoners"},{"page_url":"https://es.wikipedia.org/wiki/Ola_de_proa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Bow_wave_1.jpg","page_title":"Ola de proa","context_page_description":"La ola de proa o también onda de proa, es una ola que se forma delante de un barco cuando la proa corta el agua avanzando.​​ Detrás, el barco va seguido por la ola de popa. A medida que la ola se extiende en forma de flecha, define los límites exteriores de la estela de un barco.\\nUna ola de proa demasiado grande frena el barco, fuera de que supone un riesgo para las embarcaciones más pequeñas. Dentro de un puerto, o en aguas confinadas, puede dañar tanto las instalaciones de amarre como los barcos amarrados.\\nUna ola de proa también se forma en la cabeza de un nadador cuando se mueve dentro del agua. El valle de esta ola se encuentra cerca de la boca del nadador y se sitúa más baja que el nivel del agua en reposo. Este hecho ayuda el nadador a inhalar el aire para respirar cuando gira la cabeza."},{"page_url":"https://it.wikipedia.org/wiki/Hamburger_Sport-Verein","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/BVB_vs_HSV.jpg","page_title":"Hamburger Sport-Verein","context_page_description":"L'Hamburger Sport-Verein, o HSV, noto in italiano più semplicemente come Amburgo, è una società polisportiva tedesca con sede ad Amburgo. Fondata nel 1887, è la più antica della nazione. Milita attualmente in Zweite Bundesliga, la seconda divisione del campionato tedesco di calcio.\\nLa sua sezione calcistica gioca le partite casalinghe al Volksparkstadion e nella stagione 2017-18 è retrocessa in Zweite Bundesliga dopo 54 anni e 261 giorni, cioè 55 campionati consecutivi di permanenza in massima divisione. Il famoso orologio che nello stadio contava i giorni di permanenza ininterrotta nel massimo campionato tedesco si è fermato così il 12 maggio 2018, segnando esattamente 54 anni, 164 giorni, 2 ore, 50 minuti e 43 secondi.\\nTra le squadre più prestigiose nel panorama calcistico tedesco, vanta sei titoli nazionali, tre Coppe nazionali e due Coppe di Lega. A livello internazionale si è aggiudicata una Coppa dei Campioni, una Coppa delle Coppe e due Coppe Intertoto e fa parte del gruppo di squadre che hanno disputato almeno una finale nelle tre principali coppe europee."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BB%D1%8C-%D0%9A%D0%B0%D1%82%D0%B0%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/22/El_Gtar.jpg","page_title":"Ель-Катар","context_page_description":"Ель-Катар — місто в Тунісі. Входить до складу вілаєту Гафса. Станом на 2004 рік тут проживало 13 554 особи.\\nМісто відоме тим, що тут вирощується велика кількість фісташок."},{"page_url":"https://pt.wikipedia.org/wiki/Campeonato_Portugu%C3%AAs_de_Futebol_2006/2007","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Equipamento_Pt_AAcademicaC_0708.PNG","page_title":"Campeonato Português de Futebol 2006/2007","context_page_description":"O Campeonato português de futebol foi a edição do Campeonato português de futebol que se realizou entre 2006 e 2007."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%DB%8C%E2%80%8C%D9%84%DB%8C_%D8%AF%D9%88%D9%86%D8%A7%D9%84%D8%AF%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Lily_Donaldson_Cannes_2012.jpg","page_title":"لی‌لی دونالدسون","context_page_description":"لی‌لی دونالدسون متولد ۲۷ ژانویه ۱۹۸۸ مدل بریتانیایی است.\\nلی‌لی متولد شهر لندن و تحصیل کردهٔ دبیرستان هنر و موسیقی Camden School for Girls است. او در هنگام خرید کشف شد و خیلی زود کار خود را با برندهای مشهور بسیاری آغاز کرد.\\nلی لی چهرهٔ مارک مشهور انگلیسی بوربری است.\\nاو همراه با دیگر سوپر مدل‌های هم دوره‌اش بر جلد نسخه امریکایی مجله ووگ تصویر شده‌است و همچنین در مد لقب دارد.\\nدونالدسون از مدل‌های معروف به فرشته‌است که برای لاین ویکتوریاز سیکرت نمایش می‌دهد. همچنین مانند هثر مارکس و جسیکا استم از صورت عروسکی‌های دوران خویش است. حتی مانکن عروسکی لی‌لی ساخته شده‌است و در ویترین‌ها با بینی مجسمه‌ایش چهره‌نمایی می‌کند."},{"page_url":"https://en.wikipedia.org/wiki/List_of_NASA_aircraft","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Learjet_28-29.jpg","page_title":"List of NASA aircraft","context_page_description":"This is a list of NASA aircraft. Throughout its history NASA has used several different types of aircraft on a permanent, semi-permanent, or short-term basis. These aircraft are usually surplus, but in a few cases are newly built, military aircraft."},{"page_url":"https://lv.wikipedia.org/wiki/Be%C4%BC%C4%A3ijas_premjerministru_uzskait%C4%ABjums","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Achiel_Van_Acker1.jpg","page_title":"Beļģijas premjerministru uzskaitījums","context_page_description":"Šajā uzskaitījumā apkopoti Beļģijas premjerministri, kas ir Beļģijas federālās valdības vadītāji. Šāds amats tika izveidots 1831. gadā."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%B2%8D%E9%87%8C%E6%96%AF%C2%B7%E6%B6%85%E5%A7%86%E4%BD%90%E5%A4%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/%D0%9C%D0%B0%D1%80%D1%88_%D0%B7%D0%B0_%D0%BC%D0%B8%D1%80_%D0%B8_%D1%81%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D1%83_%2811%29.jpg","page_title":"鲍里斯·涅姆佐夫","context_page_description":"鮑里斯·葉菲莫維奇·涅姆佐夫，俄羅斯政治家，右翼力量聯盟創始人之一，曾任俄羅斯聯邦政府第一副總理、國家杜馬副主席。2015年2月27日在莫斯科克林姆林宮附近遇刺身亡。2018年2月27日，美國首都華盛頓哥倫比亞特區正式將俄羅斯使館前廣場改名為「涅姆佐夫廣場」。"},{"page_url":"https://en.wikipedia.org/wiki/Cedar_Island_National_Wildlife_Refuge","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Cedar_island_nwr.jpg","page_title":"Cedar Island National Wildlife Refuge","context_page_description":"Cedar Island National Wildlife Refuge, located in Carteret County, North Carolina, is on the end of a peninsula marking the southern end of Pamlico Sound. The refuge lies five miles east of the Atlantic Ocean and about 40 miles northeast of Beaufort, North Carolina. Established in 1964, the refuge consists of approximately 11,000 acres of irregularly flooded, brackish marsh and 3,480 acres of pocosin and woodland habitat. The dominant marsh plants include black needlerush, saltmarsh cordgrass, saltmeadow hay, and saltgrass. The woodland areas are dominated by loblolly, longleaf and pond pine. Live oak is also abundant on some upland sites. The marsh and surrounding waters provide wintering habitat for thousands of ducks and nesting habitat for colonial waterbirds.\\nMammalian species that inhabit this refuge are gray squirrel, marsh rabbit, white-tailed deer, red fox, raccoon, bobcat, gray fox, nutria, beaver, muskrat, river otter, mink and opossum."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tributaries_of_Catawissa_Creek","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Trexler_Run_looking_upstream.JPG","page_title":"List of tributaries of Catawissa Creek","context_page_description":"Catawissa Creek is a 41.8-mile long creek flowing into the Susquehanna River with 26 named tributaries, of which 19 are direct tributaries. The creek flows through Luzerne, Schuylkill, and Columbia counties in Pennsylvania. The two shortest tributaries are approximately 1 mile long, while the longest is about 10.8 miles in length. The tributaries include seventeen runs, six creeks, and three hollows. By length, the five largest tributaries of Catawissa Creek are Little Catawissa Creek, Tomhicken Creek, Scotch Run, Beaver Run, and Messers Run. By watershed area, the five largest tributaries are Tomhicken Creek, Little Catawissa Creek, Beaver Run, Scotch Run, and Messers Run.\\nVarious species of fish inhabit most of the tributaries of Catawissa Creek. The Pennsylvania Department of Environmental Protection considers eleven tributaries of the creek to be Coldwater Fisheries. Another is a Coldwater Fishery for part of its length and a High-Quality Coldwater Fishery for the other part. An additional twelve tributaries are High-Quality Coldwater Fisheries for their entire lengths. The Pennsylvania Fish and Boat Commission considers eleven tributaries to be Class A Wild Trout Waters."},{"page_url":"https://ast.wikipedia.org/wiki/Armenios_nel_Imperiu_otomanu","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/HouseOfSanStefanoTreaty.jpg","page_title":"Armenios nel Imperiu otomanu","context_page_description":"Los armenios nel Imperiu otomanu moraben nel territoriu occidental y l'Armenia otomana o Armenia Occidental, que fai referencia al territoriu oriental de la península d'Anatolia, qu'históricamente tuvo habitáu polos armenios, y que pasó del Imperiu bizantín a los turcos otomanos en conquistando Constantinopla nel 1453. Les llendes d'esta conquista variaron col tiempu hasta quedar más o menos estables dende'l sieglu XVII hasta la partición del Imperiu otomanu en 1923. La zona onde se concentraba la mayor parte de la población armenia otomana entendía seis valiatos o provincies."},{"page_url":"https://en.wikipedia.org/wiki/Windsor,_Berkshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Windsor_Bridge_and_Town.jpg","page_title":"Windsor, Berkshire","context_page_description":"Windsor is a historic market town and unparished area in the Royal Borough of Windsor and Maidenhead in Berkshire, England, close to London. It is widely known as the site of Windsor Castle, one of the official residences of the British Royal Family.\\nThe town is situated 21.7 miles west of Charing Cross, central London, 5.8 miles southeast of Maidenhead, and 15.8 miles east of the county town of Reading. It is immediately south of the River Thames, which forms its boundary with its smaller, ancient twin town of Eton. The village of Old Windsor, just over 2 miles to the south, predates what is now called Windsor by around 300 years; in the past Windsor was formally referred to as New Windsor to distinguish the two."},{"page_url":"https://en.wikipedia.org/wiki/1940","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Pauline_Collins_in_November_2012.jpg","page_title":"1940","context_page_description":"1940 was a leap year starting on Monday of the Gregorian calendar, the 1940th year of the Common Era and Anno Domini designations, the 940th year of the 2nd millennium, the 40th year of the 20th century, and the 1st year of the 1940s decade.\\nA calendar from 1940 according to the Gregorian calendar, factoring in the dates of Easter and related holidays, cannot be used again until the year 5280."},{"page_url":"https://it.wikipedia.org/wiki/Teoria_del_flogisto","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Georg_Ernst_Stahl.png","page_title":"Teoria del flogisto","context_page_description":"La teoria del flogisto sulla combustione dei materiali è una teoria elaborata nel XVII secolo con l'intento di spiegare i processi di ossidazione e combustione, successivamente smentita e abbandonata dopo che fu resa pubblica la legge della conservazione della massa di Antoine Lavoisier.\\nLa teoria in sostanza sostiene che i materiali combustibili e metalli arroventati si trasformavano in \\"calci\\" producendo durante il processo di combustione o di calcinazione, il \\"flogisto\\", un misterioso principio di infiammabilità o principio solforoso.\\nTale teoria di un principio di infiammabilità fu elaborata inizialmente dal chimico tedesco Johann Joachim Becher e successivamente sviluppata e formulata dal connazionale Georg Ernst Stahl, grande medico appassionato di chimica, che nel 1697 la propose nel suo libro Zymotechnia fundamentalis sive fermentationis theoria generalis."},{"page_url":"https://sh.wikipedia.org/wiki/Lohfelden","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Lohfelden_in_KS_mit_Labels.svg","page_title":"Lohfelden","context_page_description":"Lofelden je opština u njemačkoj saveznoj državi Hesen. Jedno je od 29 opštinskih središta okruga Kasel. Prema procjeni iz 2010. u opštini je živjelo 13.763 stanovnika. Posjeduje regionalnu šifru 6633017."},{"page_url":"https://de.wikipedia.org/wiki/Peking","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Wan_song_monk_pagoda01.jpg","page_title":"Peking","context_page_description":"Peking bzw. nach Maßgabe der chinesischen Regierung amtlich Beijing ist die Hauptstadt der Volksrepublik China. Peking hat eine über dreitausendjährige Geschichte und ist heute eine regierungsunmittelbare Stadt, d. h. sie ist direkt der Zentralregierung unterstellt und damit Provinzen, autonomen Gebieten und Sonderverwaltungszonen gleichgestellt.\\nDas gesamte 16.807 Quadratkilometer große Verwaltungsgebiet Pekings hat 21,5 Millionen Einwohner. Es stellt kein zusammenhängendes Stadtgebiet dar, mit seiner dominierenden ländlichen Siedlungsstruktur ist es eher mit einer Provinz vergleichbar. Von der Gesamtbevölkerung sind 11,8 Millionen registrierte Bewohner mit ständigem Wohnsitz und 7,7 Millionen temporäre Einwohner mit befristeter Aufenthaltsgenehmigung. Wird die Kernstadt als Grundlage genommen, leben in Peking 7,7 Millionen Menschen mit Hauptwohnsitz. Der Ballungsraum hat 11,8 Millionen Einwohner. Ab 2018 soll die Metropole Kern einer Megalopolis von 130 Millionen Einwohnern namens Jing-Jin-Ji werden.\\nPeking ist als Hauptstadt das politische Zentrum Chinas. Aufgrund der langen Geschichte beherbergt Peking ein bedeutendes Kulturerbe."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Meerlo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Kerk_Meerlo.JPG","page_title":"Meerlo","context_page_description":"Meerlo sī Hô-lân Limburg séng Horst aan de Maas chū-tī-thé lāi-bīn ê chi̍t ê chng-thâu."},{"page_url":"https://eo.wikipedia.org/wiki/Gigantmontaro","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Sn%C4%9B%C5%BEka_a_Ob%C5%99%C3%AD_d%C5%AFl.jpg","page_title":"Gigantmontaro","context_page_description":"Gigantmontaro ankaŭ Karkonoŝo estas montaro, kiu troviĝas en limregiono de Ĉeĥio kaj Pollando. Oni ankaŭ parolas pri bohemia kaj silezia parto. Tiu ĉi montaro estas la plej alta en la ĉeno de la Sudetoj montaroj. Leviĝanta super ĉirkaŭaĵo, kiu estas 300 ĝis 400 metrojn super la marnivelo, ĝi atingas per Neĝulo altecon de 1.602 m. Ĝia ĉefa kresto atingas altecojn inter 1350 kaj 1450 m kaj etendiĝas laŭ longo de 36 km de okcidento al oriento. Gigantmontaro kovras areon de 454 km² sur ĉeĥa kaj 177 km² sur pola teritorio, do sume 661 km².\\nEn alteco de 1.386 m situas la fonto de la rivero Elbo.\\nLa montaro konsistas el granito kaj metamorfa ŝtonaĵo. Grandan parton de ĝi kovras piceaj arbaroj."},{"page_url":"https://pl.wikipedia.org/wiki/Tr21","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/POL_Karsznice_Tr21-53.jpg","page_title":"Tr21","context_page_description":"Tr21 to pierwszy produkowany w Polsce parowóz, opracowany przez zespół polskich inżynierów przy współpracy z Biurem Konstrukcyjnym Fabryki Lokomotyw StEG w Wiedniu w 1921 roku. Pierwszych 36 zbudowano w StEG. W latach 1922-1925 Fabryka Lokomotyw w Chrzanowie wyprodukowała 72 szt., a 40 szt. powstało w belgijskich zakładach Cockerill."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CE%AC%CE%BD%CF%84%CF%83%CE%BF_%CF%84%CE%B7%CF%82_%CE%A0%CF%81%CE%BF%CE%B2%CE%B7%CE%B3%CE%BA%CE%AF%CE%B1%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Sancho_Provence.jpg","page_title":"Σάντσο της Προβηγκίας","context_page_description":"Ο Σάντσο της Προβηγκίας, μέλος του Οίκου της Βαρκελώνης ήταν Κόμης της Προβηγκίας, Κόμης της Σερδάνια, κόμης τού Ρουσσιγιόν και κόμης των Ζεβωντάν, Ροντέζ και Καρλά. Διορίστηκε αντιβασιλιάς της Προβηγκίας την εποχή που ήταν ανήλικος ο μικρανεψιός του Ραϋμόνδος Βερεγγάριος Δ΄ της Προβηγκίας και αντιβασιλιάς της Αραγωνίας την εποχή που ήταν ανήλικος ο μικρανεψιός του Ιάκωβος Α΄ της Αραγωνίας. Ο Σάντσο ήταν τέταρτος γιος του Ραϋμόνδου Βερεγγάριου Δ΄ της Βαρκελώνης και της Πετρονίλας της Αραγωνίας μέλους του Οίκου των Χιμένεθ και κόρης του Ραμίρο Β΄ της Αραγωνίας."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D9%85%D8%A8%D8%B1%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Bamberg-Schlenkerla1-Asio.JPG","page_title":"بامبرغ","context_page_description":"بامبرغ هي مدينة في ولاية بافاريا في ألمانيا، تقع في إقليم فرانكونيا العليا على نهر ريغنتز قرب التقائه بنهر ماين. بامبرغ واحدة من المدن القليلة في ألمانيا التي لم تدمها الحرب العالمية الثانية لوجود مصنع للمدفعية قريب منها حماها من قصف الطائرات. المدينة على قائمة مواقع التراث العالمي لليونسكو."},{"page_url":"https://lb.wikipedia.org/wiki/Villers-l%C3%A8s-Guise","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Villers-l%C3%A8s-Guise_%28Aisne%29_mairie.JPG","page_title":"Villers-lès-Guise","context_page_description":"Villers-lès-Guise ass eng Gemeng am franséischen Departement Aisne an der Regioun Hauts-de-France."},{"page_url":"https://nn.wikipedia.org/wiki/Roald_Amundsens_heim_Uranienborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/9982._Roald_Amundsen_-_Villa_fra_sj%C3%B8en_-_no-nb_digifoto_20150220_00132_bldsa_RA_alb001_002.jpg","page_title":"Roald Amundsens heim Uranienborg","context_page_description":"Roald Amundsens heim Uranienborg attmed Bunnefjorden på Svartskog i Oppegård kommune er ein villa i sveitserstil som var polarfarar og oppdagar Roald Amundsens heim frå 1908 til han døydde i 1928. Huset er ein villa i sveitserstil frå 1898, og står framleis slik det var då Amundsen drog av garde med flyet Latham for å freiste kome general Nobile og ekspedisjonen hans til hjelp. Frå 1935 har Uranienborg vore museum, og i 2003 tok Follo Museum i Drøbak over forvaltingsansvaret.\\nRoald Amundsen fekk skøyte på eigedomen av Nils Julius Ytterborg i 1908, og gav eigedomen namnet Uranienborg etter barndomsheimen i Lille Uranienborg, Uranienborgveien 9 i Oslo. Men etter at Amundsen fekk økonomiske problem på midten av 1920-talet, kjøpte hans nære ven, konsul Gade, eigedomen i 1926, og gav Amundsen høve til å verte buande. Fem år etter at Amundsen døydde i 1928, overdrog Gade eigedomen som gåve til staten.\\nI tillegg til villaen i sveitserstil med rikt profilert og utskorne listverk, er det uthus, ishus, badehus, lysthus, bod, vaktmeistarbustad og hundehus på eigedomen."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Minister_of_Foreign_Affairs_(Denmark)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/William_Ahlefeldt-Laurvig_by_Carl_Pietzner.jpg","page_title":"List of Minister of Foreign Affairs (Denmark)","context_page_description":"This is a list of Foreign Ministers of Denmark since the establishment of the Ministry of Foreign Affairs in 1848."},{"page_url":"https://pl.wikipedia.org/wiki/Finau_Maka","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Finau_Maka_2011.jpg","page_title":"Finau Maka","context_page_description":"Finau Maka – tongański rugbysta występujący na pozycji wiązacza młyna. Obecnie występuje w drugoligowym francuskim Sporting club appaméen."},{"page_url":"https://en.wikipedia.org/wiki/McCullough_Park_(Houston)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/McCullough_Park_-_04_-_Grill_and_Sign.jpg","page_title":"McCullough Park (Houston)","context_page_description":"McCullough Park is a park located in the Independence Heights neighborhood of Houston, Texas, which is listed on the National Register of Historic Places. It was originally called Independence Park but was renamed by the city of Houston after its acquisition of Houston Heights in 1929.\\nIts NRHP nomination states: \\"Independence Park is the only public space remaining from the early years of Independence Heights. In 1910, the Wright Land Company set aside some eight lots in the northeast portion of the subdivision for a community park and named it Independence Park. The park provided important community space for church gatherings, school activities, and annual Juneteenth celebrations. Although parks were often part of white neighborhoods during this period, few African American communities had such dedicated space and few larger community parks were open to blacks.\\"\\nElsewhere segregation in parks \\"was enforced by custom first and then by local ordinance in 1922\\".\\nIt was listed on the National Register in 1997 as \\"Independence Park\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%81%90%E9%BE%99%E8%91%9B%E8%92%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Winsor_McCay_%281914%29_Gertie_the_Dinosaur_-_Gerite_carries_MccCay_in_her_mouth.jpg","page_title":"恐龙葛蒂","context_page_description":"《恐龙葛蒂》是一部于1914年上映的动画短片，为最早关于恐龙的动画片段，由美国漫画家与动画师温瑟·麦凯制作。麦凯最初在他的歌舞杂耍表演现场用这部电影与观众互动；片中像孩子般的、活泼的葛蒂在主人的指挥下表演动作。后来，麦凯的雇主威廉·赫斯特减少了麦凯的杂耍表演，因此麦凯在原片基础上增加了真人表演部分作为院线上映版。1921年，麦凯想制作续集《巡演的葛蒂》，但在做了约一分钟长的片段后放弃。\\n尽管本片经常被大众认为是史上最早的动画电影，但麦凯在之前已经制作过《小尼莫》和《蚊子是怎么生活的》。美国的J·斯图尔特·布莱克顿和法国的埃米里·科尔甚至在更早的时候已经试验了动画制作，但片中塑造的葛蒂这一有魅力的角色使本片在之前的“把戏电影”中脱颖而出。《恐龙葛蒂》是第一部运用关键格、上色参照标志、描图纸、妙透镜、动画循环等动画技术的电影。它影响了许多下一代的动画师，如弗莱舍兄弟、奥图·梅思默、保罗·特里和华特·迪士尼。该片上映后一两年出现了盗版，约翰·布雷试图为麦凯的很多动画技术申请专利，但失败了。麦凯的一些影片已经遗失或仅存片段，《恐龙葛蒂》是他的电影中保存得最完好的，已被保存在美国国家影片登记部。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%B7%D0%BE%D0%BF%D0%B0%D1%81%D0%BD%D0%B0%D1%8F_%D1%88%D0%B8%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Sicherheitsreifen_BMK.jpg","page_title":"Безопасная шина","context_page_description":"Безопасная шина — технология, применяемая при производстве автомобильных шин, которая позволяет продолжать движение после прокола шины.\\nТакие шины обладают усиленными боковинами или дополнительным внутренним опорным кольцом. Наличие специального поддерживающего компонента позволяет им выдерживать вес автомобиля, не оседая, даже будучи спущенными.\\nНа спущенной безопасной шине можно проехать порядка 50 км, если машина полностью загружена. Если в машине находится только водитель, то движение на спущенной шине может продолжаться до 150 км. Способность «продлённого пробега» на спущенных шинах позволяет водителям избежать сложной и небезопасной смены колес среди потока машин. По утверждениям производителей, покрышка остаётся пригодной для дальнейшего использования после вулканизации и накачивания до необходимого давления.\\nВ российских условиях описанные 150 км проехать не удается поскольку даже небольшой ямы с острым краем достаточно что бы прорубить резину и она больше не пригодна для ремонта. С учетом того, что производители рекомендуют ездить на шинах с одинаковым износом, надо где-то находить замену с таким же уровнем износа или менять все четыре колеса."},{"page_url":"https://en.wikipedia.org/wiki/Juguang,_Lienchiang","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Dongju%2C_seen_from_the_hillside%2C_Dongju%2C_Matsu%2C_Taiwan.JPG","page_title":"Juguang, Lienchiang","context_page_description":"Juguang Township, also spelled Chukuang, is a rural township of Lienchiang County, Republic of China. Juguang Township includes two major islands, Dongju Island and Xiju Island, as well as some islets."},{"page_url":"https://pl.wikipedia.org/wiki/Andrea_Sansovino","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/100_le_vite%2C_andrea_contucci_detto_il_sansovino.jpg","page_title":"Andrea Sansovino","context_page_description":"Andrea Sansovino, właśc. Andrea Contucci – włoski rzeźbiarz i architekt.\\nDziałał głównie we Florencji i w Rzymie. Przebywał także w Loreto, gdzie był naczelnym budowniczym bazyliki. Podróżował do Portugalii. W Rzymie słynny jest jego nagrobek przyścienny kardynała Ascania Sforzy, który silnie oddziaływał na rzeźbę w Polsce. Andrea Sansovino był mistrzem dla Jakuba Sansovino, na którego rozwój artystyczny wywarł ogromny wpływ. Kunsztowność artystyczną Andrei Sansovino docenił Giorgio Vasari, który nie opisał artysty w swoim dziele pt. Żywoty najsławniejszych malarzy, rzeźbiarzy i architektów, tylko poświęcił mu osobny żywot.\\nOd jego nazwiska pochodzi określenie poza sansovinowska, które odnosi się do przedstawienia na nagrobku postaci zmarłego z podniesionym lekko korpusem i zgiętymi kończynami, zwykle skrzyżowanymi nogami, czasem też głową podpartą ręką. Poza ta, wykorzystana w jego nagrobkach kardynalskich w rzymskiej bazylice Santa Maria del Popolo, stała się bardzo popularna. Sansovino zaczerpnął ją ze starożytnych sarkofagów etruskich i rzymskich."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BA%D0%BE%D0%BD%D0%BE%D0%BC%D1%96%D0%BA%D0%B0_%D0%9F%D1%96%D0%B2%D0%B4%D0%B5%D0%BD%D0%BD%D0%BE%D1%97_%D0%9A%D0%BE%D1%80%D0%B5%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Samsung_Electronics_stand_at_GSMA_Barcelona_20080211.jpg","page_title":"Економіка Південної Кореї","context_page_description":"Економіка Південної Кореї"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BC%D0%BB%D0%B5%D0%BA%D0%BE%D0%BF%D0%B8%D1%82%D0%B0%D1%8E%D1%89%D0%B8%D1%85_%D0%AD%D0%BA%D0%B2%D0%B0%D0%B4%D0%BE%D1%80%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a4/Myoprocta_pratti.jpg","page_title":"Список млекопитающих Эквадора","context_page_description":"Этот список является списком видов млекопитающих, записанных в Эквадоре, в том числе, Галапагосских островах. Из 401 указанного в таблице вида, 3 вида считается вымершими, 3 находятся в критическом положении, 13 находятся под угрозой исчезновения, 32 являются уязвимыми, и 17 под угрозой.\\nСледующие теги используются для выделения охранного статуса каждого вида по оценкам МСОП:"},{"page_url":"https://pl.wikipedia.org/wiki/Kamienne","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Kamienne_village1.jpg","page_title":"Kamienne","context_page_description":"Kamienne – nieistniejąca wieś na terenie gminy Bukowsko, w powiecie sanockim, województwie podkarpackim na Pogórzu Bukowskim. Mimo to miejscowość jest odnotowana przez GUS w rejestrze TERYT jako miejscowość podstawowa. W obecnym obrębie geodezyjnym Kamienne znajdują się pola oraz las będący własnością osób prywatnych."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D8%AC%D9%84_%D8%B9%D8%B1%D8%A8%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Alectoris_melanocephala_2.jpg","page_title":"حجل عربي","context_page_description":"الحجل العربي ‏ هو طائر من فصيلة السمانية. تتواجد في كل من المملكة العربية السعودية، سلطنة عمان، واليمن. ودخلت مؤخرا إلى باكستان عبر عمان."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_City_of_Canterbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Bridge_church.jpg","page_title":"Grade II* listed buildings in City of Canterbury","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of City of Canterbury in Kent."},{"page_url":"https://en.wikipedia.org/wiki/Hurricane_Ioke","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Ioke_2006-08-28_0130Z.jpg","page_title":"Hurricane Ioke","context_page_description":"Hurricane Ioke, also referred to as Typhoon Ioke, had the highest Accumulated cyclone energy of any tropical cyclone on record. The first storm to form in the Central Pacific in the 2006 Pacific hurricane season, Ioke was a record breaking, long-lived and extremely powerful storm that traversed the Pacific for 17 days, reaching the equivalent of Category 5 status on the Saffir–Simpson hurricane scale on three different occasions. It was the most intense hurricane ever recorded in the Central Pacific, as well as the fifth-most intense Pacific hurricane on record, tied with 1973's Hurricane Ava.\\nThe cyclone developed in the Intertropical Convergence Zone on August 20 far to the south of Hawaii. Encountering warm waters, little wind shear, and well-defined outflow, Ioke intensified from a tropical depression to Category 4 status within 48 hours. Late on August 22 it rapidly weakened to Category 2 status before crossing over Johnston Atoll. Two days later favorable conditions again allowed for rapid strengthening, and Ioke attained Category 5 status on August 25 before crossing the International Date Line."},{"page_url":"https://ro.wikipedia.org/wiki/Echis_carinatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Echis_carinatus_sal.jpg","page_title":"Echis carinatus","context_page_description":"Echis carinatus este o specie de șerpi din genul Echis, familia Viperidae, descrisă de Schneider 1801."},{"page_url":"https://fr.wikipedia.org/wiki/Jamie_Arnold","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Arnold101.JPG","page_title":"Jamie Arnold","context_page_description":"Jamie Arnold, né le 10 mars 1975 à Détroit, aux États-Unis, est un joueur américain naturalisé israélien de basket-ball. Il évolue au poste d'ailier fort."},{"page_url":"https://de.wikipedia.org/wiki/Liste_festverdrahteter_Heimvideospielkonsolen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Audiosonic_Home%27s_TV_set_PP-600.jpg","page_title":"Liste festverdrahteter Heimvideospielkonsolen","context_page_description":"Diese Liste festverdrahteter Heimvideospielkonsolen enthält stationäre Spielkonsolen der ersten Konsolengeneration. Sie erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://no.wikipedia.org/wiki/NM_i_friidrett_1933","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Ketil_Askildt_Bislett_OB.FS0898.jpg","page_title":"NM i friidrett 1933","context_page_description":"Norgesmesterskapet i friidrett 1933 bestod av flere arrangementer som i 1933 kåret norgesmestere i friidrettsøvelsene.\\nHovedmesterskapet ble arrangert på Bislett stadion i Oslo 26.–27. august.\\nArrangør var Norges Friidrettsforbund. Kun menn deltok.\\nKongepokalvinner ble Einar Tommelstad.\\nFølgende øvelser ble arrangert utenfor hovedmesterskapet:\\nNM i hopp uten tilløp 1933 – Dale i Vaksdal 16. mars\\nNM i mangekamp 1933 – Notodden 25. juni og Bergen 29.–30. juli\\nTerrengløp – Kongsvinger 28. mai"},{"page_url":"https://ms.wikipedia.org/wiki/Yusuf_al-Qaradawi","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Qardawi.JPG","page_title":"Yusuf al-Qaradawi","context_page_description":"Prof. Dr. Syeikh Yusuf Abdullah al-Qaradawi adalah seorang cendekiawan Islam dari Mesir yang terkenal. Beliau merupakan ketua Majlis Fatwa dan Penyelidikan Eropah dan presiden Persatuan Ilmuwan Islam Antarabangsa.\\nBeliau adalah Pengerusi Kesatuan Ulama Sedunia dan dipilih sebagai Tokoh Maal Hijrah Peringkat Antarabangsa sempena sambutan Maal Hijrah 1431/2009 Malaysia."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Ascea","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Velia2-enhanced.jpg","page_title":"Ascea","context_page_description":"Ascea sī Italia Campania toā-khu Salerno Séng ê chi̍t ê comune."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%A8%E0%A4%BF%E0%A4%B0%E0%A5%8D%E0%A4%AE%E0%A4%B2%E0%A4%95%E0%A5%81%E0%A4%AE%E0%A4%BE%E0%A4%B0_%E0%A4%AD%E0%A4%A3%E0%A5%8D%E0%A4%A1%E0%A4%BE%E0%A4%B0%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%E0%A4%A8%E0%A4%BF%E0%A4%B0%E0%A5%8D%E0%A4%AE%E0%A4%B2%E0%A4%95%E0%A5%81%E0%A4%AE%E0%A4%BE%E0%A4%B0_%E0%A4%AD%E0%A4%A3%E0%A5%8D%E0%A4%A1%E0%A4%BE%E0%A4%B0%E0%A5%80.jpg","page_title":"निर्मलकुमार भण्डारी","context_page_description":" कर्तव्य बोध संदश\\n चेलीबेटीको बह व्यथा र विलौना\\n सावधान! नयाँ युग आउँदैछ\\n अश्रु ओलक\\n सम्झनामा स्व. प्रेमराज\\n आमा\\n निर्मलमणि\\nअन्य साहित्यिक पत्र–पत्रिका, श्रव्य संचार मिडिया तथा सामाजिक संजाल बाट थुपै्र रचनाहरु फुटकररूपमा प्रकाशित एवं प्रसारित ।"},{"page_url":"https://nl.wikipedia.org/wiki/Stenotomus_caprinus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Fish4482_-_Flickr_-_NOAA_Photo_Library.jpg","page_title":"Stenotomus caprinus","context_page_description":"Stenotomus caprinus is een straalvinnige vissensoort uit de familie van zeebrasems. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1882 door Jordan & Gilbert."},{"page_url":"https://it.wikipedia.org/wiki/%C4%8Cavusy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Flag_of_Chausy.jpg","page_title":"Čavusy","context_page_description":"Čavusy è un comune della Bielorussia, situato nella regione di Mahilëŭ."},{"page_url":"https://ms.wikipedia.org/wiki/Geesthacht","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Geesthacht-Wappen.png","page_title":"Geesthacht","context_page_description":"Geesthacht merupakan sebuah bandar terletak di daerah Herzogtum Lauenburg, Schleswig-Holstein, Jerman."},{"page_url":"https://nl.wikipedia.org/wiki/Saint-Joseph-de-Rivi%C3%A8re","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Saint-Joseph-de-Rivi%C3%A8re%2C_chemin_de_la_grotte%2C_1908%2C_p208_de_L%27Is%C3%A8re_les_533_communes_-_G_et_D_Voiron.jpg","page_title":"Saint-Joseph-de-Rivière","context_page_description":"Saint-Joseph-de-Rivière is een gemeente in het Franse departement Isère en telt 1082 inwoners. De plaats maakt deel uit van het arrondissement Grenoble."},{"page_url":"https://pt.wikipedia.org/wiki/Ataque_de_p%C3%A2nico","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Panic_attack.jpg","page_title":"Ataque de pânico","context_page_description":"Ataques de pânico são períodos súbitos de medo intenso associados a sintomas como palpitações, suores, tremores, falta de ar, dormência ou sensação de que está prestes a acontecer qualquer coisa má. O pico de sintomas ocorre em poucos minutos. A maioria dos ataques de pânico dura cerca de 30 minutos, embora possa durar de alguns segundos a algumas horas. Em alguns casos a pessoa pode sentir medo de perder o controlo sobre si ou sentir dor no peito. No entanto, os ataques de pânico não são perigosos em termos físicos.\\nOs ataques de pânico podem ter origem numa série de perturbações, entre as quais perturbação de pânico, perturbação de ansiedade social, perturbação de stresse pós-traumático, consumo de drogas, depressão ou outros problemas de saúde. Os ataques podem ser desencadeados por um acontecimento ou ocorrer de forma espontânea. Entre os fatores de risco estão fumar e stresse psicológico. O diagnóstico deve descartar outras condições que produzem sintomas semelhantes, como hipertiroidismo, hiperparatiroidismo, doenças cardiovasculares, doenças pulmonares e consumo de drogas.\\nO tratamento consiste em tratar a causa subjacente."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Baden-W%C3%BCrttemberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/41_Waldstein_Castle.JPG","page_title":"Liste von Burgen und Schlössern in Baden-Württemberg","context_page_description":"Auf dem Gebiet des deutschen Landes Baden-Württemberg befindet sich eine Vielzahl von Burgen und Schlössern. Diese zum Teil auf eine 1000-jährige Geschichte zurückblickenden Bauten waren Schauplatz historischer Ereignisse, Wirkungsstätte bekannter Persönlichkeiten und sind häufig noch heute imposante Gebäude. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://pl.wikipedia.org/wiki/Szczyrzyc","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Chapel_in_Szczyrzyc.JPG","page_title":"Szczyrzyc","context_page_description":"Szczyrzyc – wieś w Polsce położona w województwie małopolskim, w powiecie limanowskim, w gminie Jodłownik.\\nSzczyrzyc uzyskał lokację miejską w 1416 roku, zdegradowany przed 1499 rokiem. W latach 1975–1998 miejscowość położona była w województwie nowosądeckim."},{"page_url":"https://sk.wikipedia.org/wiki/Fresnes_(Yonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Map_commune_FR_insee_code_89183.png","page_title":"Fresnes (Yonne)","context_page_description":"Fresnes je francúzska obec, ktorá sa nachádza v departemente Yonne, v regióne Burgundsko."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D1%84%D0%B8%D0%BD%D0%B3%D0%B5%D1%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/FaltbareKleiderbuegel_res.jpg","page_title":"Офингер","context_page_description":"Офингер, вешалица или штеклица је је предмет у облику:\\nљудских рамена, дизајниран је ради вешања капута, јакни, џемпера, мајица, сукања, блуза или хаљина без њиховог гужвања, са нижом шипком за вешање панталона или сукања.\\nстега за вешање панталона и сукања. Обе врсте се могу наћи заједно на једном офингеру.\\nПостоје три основне врсте офингера. Прва је жичани офингер који има једноставну омчу направљену од жице, у облику спљоштеног троугла који се наставља нагоре правећи куку. Друга је дрвени офингер, који се састоји из равног парчета дрвета исеченог у облику бумеранга са ошмиргланим ивицама, што спречава оштећење одеће, и куке, најчешће металне, која се налази на врху. Неки дрвени офингери имају заобљену полугу од врха до врха, правећи тако раван троугао. Ова полуга се користи да би се окачиле панталоне које припадају истом комплету као и окачен сако. Трећа врста, а уједно и она која се највише користи у данашњем свету, јесте пластични офингер, који је обично истог облика као и дрвени или жичани офингер. Пластични офингери се такође производе и у мањим величинама за вешање дечије гардеробе.\\nНеки офингери имају штипаљке на доњем делу које се користе за качење сукања."},{"page_url":"https://sh.wikipedia.org/wiki/Laktukopikrin","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Lactucopicrin.png","page_title":"Laktukopikrin","context_page_description":"Laktukopikrin je organsko jedinjenje, koje sadrži 23 atoma ugljenika i ima molekulsku masu od 410,417 Da."},{"page_url":"https://vi.wikipedia.org/wiki/Thuy%E1%BA%BFt_h%C3%B2a_b%C3%ACnh_d%C3%A2n_ch%E1%BB%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Bundesarchiv_B_145_Bild-F015892-0010%2C_Bonn%2C_Konrad_Adenauer_und_Charles_de_Gaulle.jpg","page_title":"Thuyết hòa bình dân chủ","context_page_description":"Thuyết hòa bình dân chủ là một lý thuyết dựa trên cơ sở là các nước dân chủ rất lưỡng lự khi quyết định tham dự vào một cuộc xung đột vũ trang với một nước dân chủ khác. Khác hẳn với các lý thuyết giải thích tại sao đưa đến chiến tranh, đây là một lý thuyết hòa bình, phác họa ra những nét chính của những động cơ mà cản ngăn bạo lực được hỗ trợ bởi nhà nước.\\nTrong số những đề xướng của Thuyết hòa bình dân chủ, nhiều yếu tố được xem như là khích lệ hòa bình giữa các nước dân chủ:\\nCác nhà lãnh đạo dân chủ bị bắt buộc phải chịu tội vì những mất mát do chiến tranh gây ra trước các cử tri;\\nCác chính khách chịu trách nhiệm trước quần chúng thường có khuynh hướng xây dựng các thiết chế dân chủ để giải quyết các căng thẳng quốc tế;\\nCác nước dân chủ ít có khuynh hướng xem các quốc gia với chính sách và các học thuyết cầm quyền tương tự là thù nghịch;\\nCác nước dân chủ thường thịnh vượng hơn các nước khác, và vì vậy thường né tránh chiến tranh để gìn giữ cơ sở hậu cần và tài nguyên.\\nCác nghiên cứu gần đây đã mở rộng thuyết này và nhận thấy rằng các nền dân chủ có ít xung đột quốc tế được quân sự hóa gây ra ít hơn 1000 lính chiến trường tử vong với nước khác."},{"page_url":"https://es.wikipedia.org/wiki/Daytona_Prototype","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/DP01_Scott_Pruett_Memo_Rojas_2011_Road_America.jpg","page_title":"Daytona Prototype","context_page_description":"Un Daytona Prototype, por sus siglas en inglés DP o en español, Prototipos Daytona, es un tipo coche designado para una categoría de coche carreras del tipo sport prototipo desarrollado específicamente para la serie Grand-Am Series siendo considerado como coche de primera clase, que surgió en sustitución de los coches deportivos contemporáneos de los coches de cabina descubierta, específicamente los antiguos coches Sport Prototypes. Estos llevan el nombre de \\"Daytona\\" como referencia a los principales eventos de la Grand-Am Series, debido a la principal competencia que abre la temporada, las 24 Horas de Daytona, y como su equivalente en lo referente a los LMP."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Pecce","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Valy_%28489_m%29_s_hradi%C5%A1t%C4%9Bm_pobl%C3%AD%C5%BE_Kalu_u_Pecky_-_pohled_od_JZ%2C_od_silnice_u_tvrzi%C5%A1t%C4%9B_B%C4%9Blu%C5%A1ice.jpg","page_title":"Seznam kulturních památek v Pecce","context_page_description":"Tento seznam nemovitých kulturních památek v městysi Pecka v okrese Jičín vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://en.wikipedia.org/wiki/Botany_Bay_Plantation_Wildlife_Management_Area","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/BotanyBayHP.jpg","page_title":"Botany Bay Plantation Wildlife Management Area","context_page_description":"Botany Bay Plantation Wildlife Management Area is a state preserve on Edisto Island, South Carolina. Botany Bay Plantation was formed in the 1930s from the merger of the Colonial-era Sea Cloud Plantation and Bleak Hall Plantation. In 1977, it was bequeathed to the state as a wildlife preserve; it was opened to the public in 2008. The preserve includes a number of registered historic sites, including two listed in the National Register of Historic Places: a set of three surviving 1840s outbuildings from Bleak Hall Plantation, and the prehistoric Fig Island shell rings."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%9E%D7%9C%D7%91%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/%D7%94%D7%9B%D7%A4%D7%A8_%D7%9E%D7%9C%D7%90%D7%91%D7%A1_%D7%95%D7%A1%D7%91%D7%99%D7%91%D7%AA%D7%95_%D7%91%D7%A9%D7%A0%D7%AA_1799.jpg","page_title":"אומלבס","context_page_description":"אוּמְלָבָּס היה כפר ערבי אשר אדמתו נרכשה על ידי יהודים, ובשטחו נבנתה בשנת 1878 המושבה פתח תקווה, היום העיר פתח תקווה.\\nהכפר שכן בצפונה של פתח תקווה של היום בגבעה שעליה נמצא היום פארק לב סביונים ממזרח לדרך משה סנה וממערב בית הקברות סגולה של היום.\\nהגבעה הנה תל ובו שרידי ישוב מהתקופה הביזנטית ועד התקופה העות'מאנית.\\nמשה סמילנסקי כותב כי לפי התעודה הרשמית של ספר האחוזה הטורקי \\"החיג'ה\\" הגיע שטחו עד כדי מאה אלף דונם וגבולות שטחי אדמותיו היו:\\nמדרום - דרך המלך מיפו.\\nממערב - הגבעות שלפני מוסררה. ואדי מוסררה - היום נחל איילון\\nממזרח - מוצאו של נחל הירקון - היום ראש העין.\\nמצפון - נחל הירקון"},{"page_url":"https://en.wikipedia.org/wiki/Serbian_traditional_clothing","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Etnografski_muzej_Beograd_Dungodung_17.jpg","page_title":"Serbian traditional clothing","context_page_description":"Serbian traditional clothing, also called as Serbian national costume or Serbian dress, refers to the traditional clothing worn by Serbs living in Serbia, Croatia, Bosnia and Herzegovina, Montenegro, and the extended Serbian diaspora communities in Austra, Australia, Bulgaria, Canada, France, Germany, Greece, Hungary, North Macedonia, Romania, Russia, Slovenia, United States, etc. Like any traditional dress of a nation or culture, it has been lost to the advent of urbanization, industrialization, and the growing market of international clothing trends. The wide range of regional folk costumes show influence from historical Austrian, Hungarian, German, Italian, and Ottoman Turkish presence. Nonetheless, the costumes are still a pinnacle part of Serbian folk culture. From the 19th century and onwards, Serbs have adopted western-styled clothing. This change has started in larger settlements such as cities and towns, although it was not uncommon to see rural women in traditional working costumes all the way until the end of President Josip Broz Tito's term."},{"page_url":"https://el.wikipedia.org/wiki/Open_House_Thessaloniki","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Logo-OHT.jpg","page_title":"Open House Thessaloniki","context_page_description":"Το Open House Thessaloniki είναι μια πολιτιστική εκδήλωση που προωθεί την αρχιτεκτονική στο ευρύ κοινό. Η εκδήλωση είναι μη κερδοσκοπικού χαρακτήρα και βασίζεται στους θεσμούς του εθελοντισμού και των χορηγιών.\\nΔιοργανώνεται από την Αστική Μη Κερδοσκοπική Εταιρεία “Open House Greece”. Η εταιρεία ιδρύθηκε το 2012 για αυτόν τον σκοπό κι αποτελεί μέλος του παγκόσμιου δικτύου Open House Worldwide, στο οποίο ανήκουν όλοι οι φορείς που διοργανώνουν επίσημα Open House εκδηλώσεις ανά τον κόσμο.\\nΗ εκδήλωση περιλαμβάνει δωρεάν αρχιτεκτονικές ξεναγήσεις σε κτίρια της πόλης με αρχιτεκτονικό ενδιαφέρον –ιδιωτικά και δημόσια– πραγματοποιείται μια φορά το χρόνο και διαρκεί ένα σαββατοκύριακο.\\nΤο πρώτο Open House Thessaloniki διοργανώθηκε το 2012. Η εκδήλωση έχει επικρατήσει να πραγματοποιείται το τέταρτο σαββατοκύριακο του Νοεμβρίου. Με την πάροδο των χρόνων, το πρόγραμμα εμπλουτίστηκε με πλήθος παράλληλων δράσεων, που ξεκινούν μια εβδομάδα νωρίτερα.\\nΤο Open House Thessaloniki είναι μία από τις πιο πετυχημένες πολιτιστικές δράσεις της Θεσσαλονίκης, που χαίρουν ευρείας απήχησης από το κοινό. Κάθε χρόνο το OHT ανοίγει περίπου 100 κτίρια και προσελκύει πάνω από 12.000 επισκέπτες."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_Tr%C3%B3jcy_Przenaj%C5%9Bwi%C4%99tszej_w_Babicach","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Babice_woj._podkarpackie.jpg","page_title":"Parafia Trójcy Przenajświętszej w Babicach","context_page_description":"Parafia pw. Trójcy Przenajświętszej w Babicach - parafia rzymskokatolicka znajdująca się w archidiecezji przemyskiej w dekanacie Dubiecko.\\nErygowana w 1508. Jest prowadzona przez księży archidiecezjalnych. Parafia ma kościoły filialne w Bachowie i w Skopowie."},{"page_url":"https://eo.wikipedia.org/wiki/Valadolido","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/224734097_695290e713.jpg","page_title":"Valadolido","context_page_description":"Valladolid [Baljadolid] estas municipo kaj urbo, situanta en la nordokcidenta parto de la ibera duoninsulo, ĉefurbo de la provinco Valadolido kaj sidejo de la Parlamento kaj Registaro de la aŭtonoma komunumo Kastilio kaj Leono.\\nĜi havas, laŭ datumoj de INE de 2014, 306.830 enloĝantojn, kaj situas en la 13a municipo pli enloĝata de Hispanio, kaj la unua en la tuta hispana nordokcidento. La tuta metropolita areo kun 23 municipoj situas la 23a en Hispanio kun 414.281 enloĝantoj. Ĝi havas areon de rekta soci-ekonomia influo de pli ol 700.000 personoj.\\nSpite ke ekzistis praloĝantoj dum la Paleolitika periodo, kaj restaĵoj de vakceoj, kaj romiaj, Valadolido ne havis stabilajn loĝantojn ĝis la resetliĝo de la valo Doŭro, kiam la reĝo Alfonso la 6-a donacis siajn posedaĵojn al sia kunlaboranto Pedro Ansurez, en 1072.\\nDum la mezepoko estis sidejo de la parlamento de Kastilio kun foruoj kaj reĝa Ĉarto kaj aliaj instancoj kiel Iglesia Colegial, konvertita en Katedralo de Valadolido en 1595, Universitato, Reĝa Tribunalo kaj Kancelierejo.\\nKarlo la 5-a uzis ĝin kiel politikan ĉefurbon kaj pli poste, de 1601 ĝis 1606 ĝi estis la ĉefurbo de la Hispana Imperio."},{"page_url":"https://it.wikipedia.org/wiki/Scozia_nell%27Alto_Medioevo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Saint_Margaret_of_Scotland.jpg","page_title":"Scozia nell'Alto Medioevo","context_page_description":"L'Alto Medioevo scozzese è il periodo storico della Scozia compreso tra la morte di Domnal II nel 900 d.C. e quella del re Alessandro III nel 1286, che fu tra le cause delle Guerre di indipendenza scozzesi.\\nAlla fine del nono secolo, l'odierno territorio della Scozia era diviso tra diversi regni in competizione tra loro. L'influenza scandinava era dominante nelle isole settentrionali e occidentali, quella britanna nel sudovest, quella anglosassone del regno di Northumbria a sudest e il regno pittico e gaelico di Alba ad oriente, a nord del fiume Forth. Durante il decimo e undicesimo secolo, la parte nord della Gran Bretagna era sempre più dominata dalla cultura gaelica e dalla signoria regale di Alba, detta in latino Albania o Scotia, ed in inglese Scotland. Dalla sua base nell'est, questo regno assunse il controllo delle terre a sud e successivamente si impose sull'ovest e su gran parte del nord. La sua cultura fiorente comprendeva parte del mondo di lingua gaelica, e l'economia era basata su agricoltura e commercio."},{"page_url":"https://de.wikipedia.org/wiki/Flurdenkmal","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Haghenheim-Feldkreuz-Blick-auf-Hofstetten.jpg","page_title":"Flurdenkmal","context_page_description":"Ein Flurdenkmal ist ein Denkmal an Wegen, im Wald und in der Flur. Von weltlichen Flurdenkmälern wie Grenzsteinen, Kilometersteinen und Sühnekreuzen sind religiöse Flurdenkmäler in Form von Wegkreuzen, Bildstöcken und kleinen Feldkapellen zu unterscheiden. Als historische Kulturlandschaftselemente geben Flurdenkmale Zeugnisse menschlichen Handelns ideeller, geistiger und materieller Art, die als solche für die Geschichte des Menschen an einem bestimmten Ort bedeutsam sind. Sie prägen die altbäuerlichen Kulturlandschaften und erinnern an die Frömmigkeit und Gesinnung der Bevölkerung. Die Kleindenkmale spiegeln neben persönlichen Schicksalen und Tragödien auch tiefgreifende Ereignisse wie Kriege, Hungersnöte, Krankheiten und Elementarkatastrophen wider."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%81%D0%BA%D0%B8_%D0%BF%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B8%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/NP-5.jpg","page_title":"Нидерландски пословици","context_page_description":"„Нидерландски пословици“ е картина на Питер Брьогел Стария от 1559 г., изпълнена с маслени бои върху дърво и представяща земя, населена с образи на съвременници на художника в сцени, възпроизвеждащи буквално множество фламандски пословици и притчи. Картината днес е притежание на Държавния музей в Берлин.\\nВъв времето на Брьогел пословиците са популярен жанр: публикувани са много сборници с пословици, включително и един сборник на антверпенски книжар, публикуван прибилизително по същото време. Около 1558 година фламандският гравьор Франц Хогенберг завършва своя гравюра, изобразяваща около 40 пословици. Самият Брьогел също използва тази стилистика в по-ранни свои творби като „Големите риби изяждат по-малките“ от 1556 година, ала с размерите си от 117×163 cm, „Нидерландски пословици“ се смята за първата голямоформатна картина на тази тема.\\nКартината, която в каталога на антверпенския колекционер Питър Стивънс е влязла под името „Опак свят“, прелива от символика и отпратки към живота и бита във Фландрия през 16 век."},{"page_url":"https://fr.wikipedia.org/wiki/Lili_Berky","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Berky_Lili_s%C3%ADrja.jpg","page_title":"Lili Berky","context_page_description":"Lili Berky est une actrice hongroise et l'épouse de Gózon Gyula."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%83%D8%B3%D8%A7%D9%86%D8%AF%D8%B1%D9%8A%D9%87_%D8%AA%D8%B4%D9%8A%D9%81%D8%A7%D8%AF%D8%B2%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Aleksandr_Chivadze%2C_Vladimir_Gutsaev%2C_David_Kipiani.jpg","page_title":"الكساندريه تشيفادزه","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nالكساندريه تشيفادزه لاعب كورة قدم من جيورجيا."},{"page_url":"https://hu.wikipedia.org/wiki/Gare_d%E2%80%99Oissel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Gare_d%27Oissel.JPG","page_title":"Gare d’Oissel","context_page_description":"Gare d’Oissel vasútállomás Franciaországban, Oissel településen."},{"page_url":"https://en.wikipedia.org/wiki/Priroda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Mir_insignia.svg","page_title":"Priroda","context_page_description":"The Priroda module was the seventh and final module of the Mir Space Station. Its primary purpose was to conduct Earth resource experiments through remote sensing and to develop and verify remote sensing methods. The control system of Priroda was developed by the Khartron."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%A1%E9%9B%AF%C2%B7%E4%BD%A9%E7%89%B9%E9%AD%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Diane_von_F%C3%BCrstenberg_Spring-Summer_2014_03.jpg","page_title":"卡雯·佩特魯","context_page_description":"卡雯·佩特魯出生於愛沙尼亞，是一位愛沙尼亞超模。圈內好友：Abbey Lee、Aline Weber、Jill Bauwens、Julie Mordovets、Kori Richardson、Magdalena Frackowiak、Malin Ones、Sarah Stephens、Freja Beha Erichsen。"},{"page_url":"https://nl.wikipedia.org/wiki/Chvat%C4%9Bruby","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Chvat%C4%9Bruby_znak.jpg","page_title":"Chvatěruby","context_page_description":"Chvatěruby is een Tsjechische gemeente in de regio Midden-Bohemen, en maakt deel uit van het district Mělník. Chvatěruby telt 465 inwoners."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%81%D1%82%D1%80%D0%BE%D0%B2%D0%B8_%D0%9F%D0%B0%D0%BA%D1%80%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Abandoned_church_on_Suur-Pakri.jpg","page_title":"Острови Пакрі","context_page_description":"Пакрі — два острови в Балтійському морі, Фінської затоки: Вяйке-Пакрі та Суур-Пакрі. Острови Пакрі входять до складу міста Палдіскі, повіт Гар'юмаа в Естонії."},{"page_url":"https://de.wikipedia.org/wiki/Stangeria_eriopus","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Stangeria_seed_005.jpg","page_title":"Stangeria eriopus","context_page_description":"Stangeria eriopus ist eine Pflanzenart der Palmfarne; sie ist die einzige Art der monotypischen Gattung Stangeria. Die Art ist endemisch in einem schmalen Streifen an der Ostküste Südafrikas und dem südlichen Mosambik."},{"page_url":"https://es.wikipedia.org/wiki/%C3%89mile_Reynaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Praxinoscopio_de_Reynayd.jpg","page_title":"Émile Reynaud","context_page_description":"Charles-Émile Reynaud fue un inventor y pionero del cine de animación francés que perfeccionó el zoótropo al inventar el praxinoscopio en 1877. Patentó una mejora considerable de su invento en 1888 al que bautizó con el nombre de Théâtre Optique. Fue el primero, además, en perforar la película, como medio de arrastre mecánico. Sus proyecciones estaban sincronizadas con música compuesta por él mismo y efectos sonoros. Sus películas presentan breves escenas humorísticas con un tono naif y poético. Reynaud, en resumen, fue el primero en conseguir pasar del movimiento cíclico de figuras dibujadas a un discurso visual dotado de argumento."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9B%D0%B5%D0%BC%D0%BA%D0%B0%D1%9E%D1%88%D1%87%D1%8B%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Zagroda_z_Posady_Olchowskiej_%281880%29.JPG","page_title":"Лемкаўшчына","context_page_description":"Ле́мкаўшчына — украінскі этнакультурны рэгіён лемкаў, размешчаны ва ўкраінскiх, польскiх i славацкiх Карпатах."},{"page_url":"https://lv.wikipedia.org/wiki/Karls_Persimegi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Parsimagi_In_the_park.jpg","page_title":"Karls Persimegi","context_page_description":"Karls Persimegi bija igauņu fovisma gleznotājs."},{"page_url":"https://nl.wikipedia.org/wiki/Proef_van_Las%C3%A8gue","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Straight-leg-test.gif","page_title":"Proef van Lasègue","context_page_description":"De proef van Lasègue is in de geneeskunde een test om te evalueren of er sprake is van prikkeling van een zenuwwortel op het punt waar deze uit de wervelkolom tevoorschijn komt. Hiertoe wordt er licht aan de zenuw getrokken. Als dit aanleiding geeft tot ergere pijn zit de zenuwwortel waarschijnlijk in meerdere of mindere mate knel. Vaak is de oorzaak hiervan een rughernia."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%95%E0%A8%BF%E0%A8%B0%E0%A8%AA%E0%A8%BE%E0%A8%B2_%E0%A8%95%E0%A8%9C%E0%A8%BC%E0%A8%BE%E0%A8%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Kirpal_Kazak_03.jpg","page_title":"ਕਿਰਪਾਲ ਕਜ਼ਾਕ","context_page_description":"ਕਿਰਪਾਲ ਕਜ਼ਾਕ ਕਹਾਣੀਕਾਰ ਤੇ ਪਟਕਥਾ ਲੇਖਕ ਅਤੇ ਵਾਰਤਕ ਲੇਖਕ ਹੈ। ਦਸਵੀਂ ਪਾਸ ਨਾ ਹੋਣ ਦੇ ਬਾਵਜੂਦ ਵੀ ਉਹ ਪੰਜਾਬੀ ਯੂਨੀਵਰਸਿਟੀ, ਪਟਿਆਲਾ ਦੇ ਸਾਹਿਤਕ ਅਧਿਐਨ ਵਿਭਾਗ ਵਿੱਚ ਪ੍ਰੋਫ਼ੈਸਰ ਰਿਹਾ ਹੈ, ਜਿਥੇ ਉਸ ਨੇ ਲੋਕਧਾਰਾ ਸਹਾਇਕ ਦੇ ਤੌਰ 'ਤੇ ਕੰਮ ਕੀਤਾ।"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%B0%B7%E9%97%9C%E6%B0%B4%E5%BA%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Kukuan_Dam01.jpg","page_title":"谷關水庫","context_page_description":"谷关水库，位于台湾台中市和平区，即大甲溪中游、离天轮坝上游约6.7公里的峡谷。为供应大甲溪下游谷关发电厂发电及灌溉使用的小型水坝。"},{"page_url":"https://ms.wikipedia.org/wiki/C%C3%A9sar_Pelli","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/BOK_Center_faccade.JPG","page_title":"César Pelli","context_page_description":"César Pelli ialah seorang jurubina kelahiran Argentina, yang terkenal kerana mereka bentuk beberapa buah bangunan tertinggi di dunia dan bermacam-macam lagi mercu tanda bandaraya utama. Kebanyakan dari hasil seni rekaan bangunan yang beliau lakarkan, beliau lebih dikenali atas perekaan binaan yang cenderung berunsur litupan logam serta bercorak likur.\\nPada tahun 1991, Institut Jurubina Amerika menyenaraikan Pelli di kalangan sepuluh jurubina Amerika terhandal yang hidup di dunia. Antara berpuluh-puluh anugerah yang diraihnya termasuk AIA Gold Medal 1995 yang mengiktiraf hasil pembinaan yang memberikan pengaruh berpanjangan dalam teori dan amalan seni bina.\\nHasil seni bina Pelli yang paling terkemuka di dunia ialah Menara Berkembar Petronas yang pernah membawa gelaran bangunan tertinggi di dunia. Beliau juga mereka bina kompleks World Financial Center di Manhattan, yang mengelilingi tapak World Trade Center."},{"page_url":"https://en.wikipedia.org/wiki/List_of_towns_and_cities_with_100,000_or_more_inhabitants/cityname:_C","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Panoramic_view_of_Cluj-Napoca.jpg","page_title":"List of towns and cities with 100,000 or more inhabitants/cityname: C","context_page_description":"This is a list of towns and cities in the world believed to have 100,000 or more inhabitants, sorted alphabetically by the letter C. Unless otherwise noted, populations are based on United Nations estimates from 2016.\\nIndex\\nBy country name:\\nBy city name:\\nBack to main page"},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_the_United_States_for_1950","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/1950_Ohio_passenger_license_plate.jpg","page_title":"Vehicle registration plates of the United States for 1950","context_page_description":"Each of the 48 states of the United States of America plus several of its territories and the District of Columbia issued individual passenger license plates for 1950."},{"page_url":"https://ca.wikipedia.org/wiki/Ander_Capa_Rodr%C3%ADguez","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/CSC_0233_%2835991275625%29_%28cropped%29.jpg","page_title":"Ander Capa Rodríguez","context_page_description":"Ander Capa Rodríguez és un futbolista basc que juga com a lateral o extrem a l'Athletic Club de LaLiga Santander."},{"page_url":"https://en.wikipedia.org/wiki/Jovan_%C4%86irkovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Jovan_%C4%86irkovi%C4%87_and_Vojislav_Tankosi%C4%87%2C_mission_to_Kosovo%2C_1903.jpg","page_title":"Jovan Ćirković","context_page_description":"Jovan Ćirković, known as Čifa or Ćirko-paša, was a Serbian teacher, revolutionary during the Macedonian Struggle, and politician."},{"page_url":"https://en.wikipedia.org/wiki/Visa_policy_of_Senegal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Visa_policy_of_Senegal.png","page_title":"Visa policy of Senegal","context_page_description":"Visitors to Senegal require a visa unless they come from one of the visa exempt countries. Visitors must hold passports that are valid for at least 3 months from the date of arrival."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D0%BC%D0%B5%D0%BD%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87_%D0%9A.%D0%90..jpg","page_title":"Ремень","context_page_description":"Ремень — элемент одежды, представляющий собой длинную кожаную, тканую, или составную металлическую ленту, снабженную металлической или пластиковой застежкой с передней стороны.\\nВ наши дни служит для поддержания брюк, джинсов и других элементов одежды, практически потеряв своё изначальное предназначение — надеваться поверх кафтана или другой верхней одежды. Традиционное использование ремня сохранили Вооруженные силы Российской Федерации: как часть обмундирования имеются парадный пояс, поясной ремень, брючной ремень. Ремень со временем вытеснил традиционный пояс, который охватывал талию не менее 3 раз и не имел пряжки."},{"page_url":"https://it.wikipedia.org/wiki/Paphiopedilum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Paphiopedilum_helenae_Orchi_2012-09-07_276.jpg","page_title":"Paphiopedilum","context_page_description":"Paphiopedilum Pfitzer, 1886 è un genere di piante della famiglia delle Orchidaceae che comprende circa 77 specie di piante perlopiù terrestri, sprovviste di pseudobulbi e dalle foglie coriacee e persistenti.\\nSono piante provenienti nella maggior parte dei casi dall'Asia tropicale, in particolare dalla Cina meridionale, dall'India e dal resto del sud-est asiatico ma anche dalle isole nell'Oceano Pacifico.\\nIl nome deriva da Paphos, una città cipriota secondo la leggenda città natale della dea Afrodite, e Pedilon che significa ciabatta, pantofola, la traduzione sarebbe Pantofola di Venere e si riferisce alla particolarissima forma del labello dei fiori di Paphiopedilum, forma condivisa con tutti i generi della sottofamiglia delle Cypripedioideae.\\nQueste piante vengono coltivate per la straordinaria bellezza dei fiori e per la relativa facilità di coltivazione anche in ambito domestico."},{"page_url":"https://en.wikipedia.org/wiki/Quebec_Autoroute_30","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Quebec_Autoroute_30_-_WB_%2803%29.jpg","page_title":"Quebec Autoroute 30","context_page_description":"Autoroute 30, or the Autoroute de l'Acier is an Autoroute in Quebec, Canada. Construction of the A-30 dates back to the early days of autoroute construction in the 1960s. Originally called Highway 3, the A-30 was designed to replace Route 132 as the main artery linking the communities along the South Shore of the St. Lawrence River. The A-30 was originally intended to begin at the U.S. border at Dundee and end at Saint-Pierre-les-Becquets. In the late 1970s an eight-year moratorium on new autoroute construction in favour of public transport by the Parti Québécois prevented implementation of that plan.\\nThe original section of Autoroute 30 in 1968 linked Sorel-Tracy to Route 116, which was then called Highway 9. The A-30 was extended to an interchange with Autoroute 10 in Brossard by 1985 and to Autoroute 15 in Candiac by 1996.\\nGrowing road congestion in and around Montreal led to the announcement in 2006 of a federal-provincial partnership to complete A-30 as southwestern bypass ring road. At that time, the section from Châteauguay to Vaudreuil-Dorion was to be tolled, however by 2009 it was decided to collect tolls only on the St. Lawrence bridge."},{"page_url":"https://en.wikipedia.org/wiki/Cycnoches_egertonianum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Cycnoches_egertonianum_-_Bateman_Orch._Mex._Guat._pl._40_%281842%29.jpg","page_title":"Cycnoches egertonianum","context_page_description":"Cycnoches egertonianum is a species of orchid native to Mexico and Central America."},{"page_url":"https://bs.wikipedia.org/wiki/Cvjetnice_Bosne_i_Hercegovine","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Erysimum_cheiri_%28L.%29_Crantz%2C_biennial_plant.jpg","page_title":"Cvjetnice Bosne i Hercegovine","context_page_description":"Ovaj spisak cvjetnica Bosne i Hercegovine, skupa sa unesenim vrstama i bosanskohercegovačkim endemima, nepotpuni je pregled angiospermnih biljnih vrsta koje se navode u raspoloživoj literaturi na bosanskom hrvatskom, srpskom i srpskohrvatskom jeziku. Nisu uključene kulturne i povremeno unošene.\\nNapomena\\nZbog višekratnih promjena u biološkoj klasifikaciji i/ili taksonomskih rangova i naziva obuhvaćenih taksona, neki od njih se u priloženom spisku pojavljuju i po dva puta. To se posebno odnosi na one nazive binomne nomenklature koji su i danas u širokoj upotrebi.\\nNajčešće je promijenjeno ime roda i porodice, a ponekad i pripadajućih vrsta."},{"page_url":"https://pt.wikipedia.org/wiki/Gobioides_sagitta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Gobioides_sagitta.jpg","page_title":"Gobioides sagitta","context_page_description":"Gobioides sagitta é uma espécie de peixe da família Gobiidae e da ordem Perciformes."},{"page_url":"https://de.wikipedia.org/wiki/Firbeix","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/AugengneisMialet.jpg","page_title":"Firbeix","context_page_description":"Firbeix, okzitanisch Firbes, ist eine französische Gemeinde mit 306 Einwohnern im Norden des Départements Dordogne in der Region Nouvelle-Aquitaine. Sie gehört zum Arrondissement Nontron und zum Kanton Thiviers. Außerdem bildet sie einen Teil des Regionalen Naturparks Périgord-Limousin."},{"page_url":"https://ro.wikipedia.org/wiki/Dulap","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/HeritagehallsdormBYU.JPG","page_title":"Dulap","context_page_description":"Dulapul este o piesă de mobilier confecționată cel mai des din lemn constând într-un spațiu închis prevăzut cu rafturi folosit în general pentru depozitarea hainelor.\\nLa origine, dulapul însemna o roată pentru depănarea firului de borangic."},{"page_url":"https://sv.wikipedia.org/wiki/Sedum_candollei","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Sedum_candollei3.jpg","page_title":"Sedum candollei","context_page_description":"Sedum candollei är en fetbladsväxtart som beskrevs av R.-hamet. Sedum candollei ingår i Fetknoppssläktet som ingår i familjen fetbladsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Baty%C5%BCowieckie_Oka","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Batyzowieckie_Oka.jpg","page_title":"Batyżowieckie Oka","context_page_description":"Batyżowieckie Oka – grupa małych okresowych stawków położonych na wysokości ok. 2200 m n.p.m. w górnych, północno-wschodnich partiach Doliny Batyżowieckiej w słowackiej części Tatr Wysokich. Batyżowieckie Oka leżą na Wyżniej Batyżowieckiej Równi u podnóża grani głównej Tatr. Do stawków tych nie prowadzą żadne znakowane szlaki turystyczne.\\nBatyżowieckie Oka są jednymi z najwyżej położonych zbiorników wodnych w Tatrach. W górnych partiach Doliny Pięciu Stawów Spiskich leży okresowy Barani Stawek dorównujący im wysokością położenia. Najwyżej położonym stałym zbiornikiem wodnym w Tatrach jest Lodowy Stawek znajdujący się w Dolince Lodowej, która stanowi odgałęzienie Doliny Pięciu Stawów Spiskich."},{"page_url":"https://fi.wikipedia.org/wiki/Paratiisinm%C3%A4ki","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Salviatie_Paratiisinm%C3%A4ki.jpg","page_title":"Paratiisinmäki","context_page_description":"Paratiisinmäki on Porin 48. kaupunginosa ja se sijaitsee kaupungin keskustaajaman lounaisosassa, Länsi-Porin alueella. Viereiset kaupunginosat ovat Liinaharja koillisessa ja Tuorsniemi ja Klasipruuki lännessä, pohjoisessa alue rajoittuu Vähäraumaan. Kaakossa peltoaukean takana on Liikastenmäki.\\nParatiisinmäen nimi periytyy samannimisestä mäestä, jonka ympäristöön nykyinen kaupunginosa on rakennettu. Nimen sanotaan alun perin viittaavan peltoaukeiden keskellä sijaitsevan mäen erityisen kauniiseen mäntymetsikköön.\\nParatiisinmäen ensimmäiset rakennukset ovat peräisin toisen maailmansodan jälkeiseltä ajalta, ja alueen perinteisesti tunnettu paikka on mäen eteläpuolella toimiva Paratiisin taimitarha. Varsinainen asuinalue Paratiisinmäkeen on rakennettu 1990-luvulla, jolloin alueelle kaavoitettiin omakotitalovaltainen pientaloalue. Tämä pääosin metsäiselle mäelle rakennettu alue on tunnettu erityisesti varakkaiden asuinalueena. Myöhemmin asuinalue on kasvanut pohjoiseen 2000-luvun alkuvuosina."},{"page_url":"https://sv.wikipedia.org/wiki/Najasar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Najas_guadalupensis_NRCS-1.jpg","page_title":"Najasar","context_page_description":"Najasar är ett släkte av dybladsväxter. Enligt Catalogue of Life ingår Najasar i familjen dybladsväxter, men enligt Dyntaxa är tillhörigheten istället familjen dybladsväxter."},{"page_url":"https://fr.wikipedia.org/wiki/Guo_Si","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Li_Jue_and_Guo_Si_sack_the_capital_at_Chang%27an.jpg","page_title":"Guo Si","context_page_description":"Guo Si sert le général Dong Zhuo depuis ses débuts lors de la repression de la rébellion de la Province de Liang. Il accompagna Dong Zhuo et sa grande armée lorsque celui-ci fut appelé à la capitale. En l’an 190, sous les ordres de Dong Zhuo et avec Li Jue, il assassina le Grand Tuteur Yuan Wei, puis à la tête d’une force de 50 000 hommes, allèrent ensemble défendre la Passe de la Rivière Si. Lors des troubles de la campagne contre Dong Zhuo, les deux généraux ont été assignés à l’évacuation chaotique des nombreux habitants de Luoyang vers Chang'an et dans leur fuite, Guo Si affronta les armées de Cao Cao dirigées par Cao Ren. Par après, en tant que commandant sous la direction de Niu Fu, il attaqua Zhu Jun à Zhongmou. Avec Li Jue et Zhang Ji, ils battirent ce dernier et ravagèrent également les comtés de Chenliu et Yongchuan.\\nÀ la suite de la mort de Dong Zhuo, lui et Li Jue sous prétexte de se faire les vengeurs du défunt et sur les conseils de Jia Xu, lancèrent une attaque sur Chang'an dans laquelle ils vainquirent le puissant Lu Bu et prirent conjointement le contrôle de la Cour impériale des Han."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D8%B3%D9%8A%D9%84_%D8%AF%D9%8A%D9%83%D9%86%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Basil_Dickinson.jpg","page_title":"باسيل ديكنسون","context_page_description":"باسيل ديكنسون ‏ هو لاعب القفز الثلاثي أسترالي، ولد في 25 أبريل 1915 في كوينبيان في أستراليا، وتوفي في 7 أكتوبر 2013 في الجبال الزرقاء في أستراليا."},{"page_url":"https://de.wikipedia.org/wiki/Maria_Pia_De_Vito","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Maria_Pia_De_Vito.jpg","page_title":"Maria Pia De Vito","context_page_description":"Maria Pia De Vito ist eine italienische Jazzmusikerin."},{"page_url":"https://sv.wikipedia.org/wiki/Bad_Schwartau","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Bad_Schwartau_in_OH.png","page_title":"Bad Schwartau","context_page_description":"Bad Schwartau är en stad i distriktet Ostholstein vid floden Schwartau i delstaten Schleswig-Holstein i norra Tyskland. Den är en förort till Lübeck och har cirka 20 000 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Mru_people","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/PICT0360_Burma_Chin_State_Traditional_Village_%287864250886%29.jpg","page_title":"Mru people","context_page_description":"The Mru, also known as the Mro, Murong, Taung Mro, Mrung, and Mrucha, refer to the tribes who live in the border regions between Myanmar, Bangladesh, and India. The Mru are a sub-group of the Chin people, a few of whom live in western Myanmar. They are also found in the northern Rakhine State. In Bangladesh, they reside in the Chittagong Hills in southeast Bangladesh, primarily in Bandarban District and Rangamati Hill District. In India, they reside in West Bengal.\\nThe Mru people are divided into five distinct linguistic and cultural sub-groups: the Anok, Tshüngma, Dömrong, Dopteng, and Rümma."},{"page_url":"https://en.wikipedia.org/wiki/Regiment_Oos_Rand","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/SADF_era_Regiment_Oos_Rand_insignia.jpg","page_title":"Regiment Oos Rand","context_page_description":"Regiment East Rand is a reserve infantry battalion of the South African Army. The unit was intended initially to be predominantly an Afrikaans speaking citizen force. As a reserve force unit, it has a status roughly equivalent to that of a British Army Reserve or United States Army National Guard unit."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%AC%D5%B8%D5%BE%D5%A1%D5%AF%D5%AB%D5%A1%D5%B5%D5%AB_%D6%84%D5%A1%D5%B2%D5%A1%D6%84%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/View_by_airplane_above_skalica.JPG","page_title":"Սլովակիայի քաղաքների ցանկ","context_page_description":"Սլովակիայի քաղաքներ, բնակավայրեր Սլովակիայում, որ պաշտոնապես ունեն քաղաքի կարգավիճակ։ Սլովակիայի Հանրապետության Սահմանադրության 70-րդ հոդվածը թույլ է տալիս բնակավայրին քաղաքի կարգավիճակ շնորհել օրենքով սամանված կարգով։ Տվյալ կարգը սահմանված է 369/1990 Zb օրենքով։ § 22 բաժնում նշվում է, որ քաղաքներն այն բնակավայրերն են, որոնք տնտեսական, վարչական, մշակութային կամ առողջարանային կենտրոններ են ու սպասարկում են նաև հարևան բնակավայրերին, ունեն 5 000-ից ոչ պակաս բնակչություն և այլն։ Բնակավայրը քաղաքի կարգավիճակ կարող է ստանալ բնակիչների հանրաքվեով, Սլովակիայի Հանրապետության Ազգային խորհրդի որոշմամբ, մունիցիպալետի ներկայացմամբ։\\nՍլովակիայում կան 138 քաղաքներ, որտեղ բնակվում է 2 939 180 մարդ, ինչը կազմում է երկրի բնակչության 54,38%-ը։ Քաղաքներից 66-ն ունեն 10 հազարից ավելի բնակիչ, 51-ը՝ 10-30 հազար, 11-ը՝ 30-50 հազար, 8-ը՝ 50-100 հազար, և 2 քաղաք ունի 100 հազարից ավելի բնակիչ։ Սլովակիայի ամենամեծ քաղաքը երկրի մայրաքաղաք Բրատիսլավան է, որն ունի 413 192 բնակիչ։"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BA%D0%B0%D0%BB%D0%BD%D0%B8_%D1%80%D0%B8%D1%81%D1%83%D0%BD%D0%BA%D0%B8_%D0%B2_%D0%A2%D0%B0%D0%BD%D1%83%D0%BC%D1%88%D0%B5%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Tanum_255_fossum_ID_10160602550001_IMG_8648.JPG","page_title":"Скални рисунки в Танумшеде","context_page_description":"Скални рисунки в Танумшеде представлява колекция от скалните рисунки в близост до Танумшеде, Бохуслен, Швеция, които са обявени за обект на Световното културно наследство на ЮНЕСКО през 1994 г., поради големият им брой."},{"page_url":"https://nl.wikipedia.org/wiki/Nancy_Kress","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Delia_Sherman-Nancy_Kress-Ellen-Datlow.jpg","page_title":"Nancy Kress","context_page_description":"Nancy Kress is een sciencefictionschrijfster.\\nZe werd geboren als Nancy Anne Koningisor en trouwde in 1973 met Michael Joseph Kress. Ze hadden twee zonen en scheidden in 1984. Kress werkte een tijd voor een advertentiebureau. Na de dood van haar tweede man, Charles Sheffield, in 2002 verhuisde Kress terug naar de staat New York.\\nKress begon met schrijven in 1976, maar werd pas echt bekend na de publicatie van de novelle Beggars in Spain waarmee ze in 1990 de Hugo en Nebula Awards won. Kress schrijft meestal verhalen in de nabije toekomst, waarin de techniek realistisch is en plausibel aansluit op het heden. Genetische manipulatie is een terugkerend thema, evenals in mindere mate kunstmatige intelligentie. Ze neemt een middenpositie in tussen harde sciencefiction en de zachtere variant. Ze toont een grotere interesse in het innerlijk leven van haar hoofdpersonen dan 'harde' schrijvers als Larry Niven en Greg Egan. De wetenschapsgebieden waarop Kress zich richt zijn ook minder hard dan SF favorieten natuurkunde en ruimtevaart. Aan de andere kant werkt ze de technische details van haar verzonnen wetenschap veel verder uit dan bijvoorbeeld Ursula LeGuin."},{"page_url":"https://sv.wikipedia.org/wiki/Fattighus%C3%A5n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Vy_%C3%B6ver_Fattighus%C3%A5n_i_G%C3%B6teborg-_2014-03-14_22-33.jpg","page_title":"Fattighusån","context_page_description":"Fattighusån eller Fattighuskanalen är en cirka 900 meter lång, grävd kanal i Göteborg som förbinder Mölndalsån med Stora Hamnkanalen och Vallgraven vid Drottningtorget. Den rinner utmed Stampgatan och förbi Mariakyrkan och Trädgårdsföreningen. Den invigdes 1641 av greve Per Brahe.\\nNamnet var ursprungligen Gullbergs kanal senare Then gräffde canalen samt Möndahls Canal, Gullbergs Gräfde Canal, och i folkmun endast \\"kanalen\\". Namnet Fattighusån fick den i folkmun eftersom en fastighet utefter ån nyttjades som fattighus från 1726, och 1767 öppnade Willinska fattigfriskolan på Stampgatan. Kanalen uppmättes år 1900 till en längd av 640 meter."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B7%B4%E9%AD%AF%E5%A1%94%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Las_Mercedes_-_Caracas.jpg","page_title":"巴魯塔市","context_page_description":"巴鲁塔市，是委内瑞拉的一个市，位于该国北部米兰达州，首府设于努斯特拉塞尼奥拉，始建于1987年9月22日，面积86平方公里，2010年人口424,983，人口密度每平方公里4,941.66人。"},{"page_url":"https://en.wikipedia.org/wiki/Paracompact_uniform_honeycombs","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Cantitruncated_order-6_tetrahedral_honeycomb_verf.png","page_title":"Paracompact uniform honeycombs","context_page_description":"In geometry, uniform honeycombs in hyperbolic space are tessellations of convex uniform polyhedron cells. In 3-dimensional hyperbolic space there are 23 Coxeter group families of paracompact uniform honeycombs, generated as Wythoff constructions, and represented by ring permutations of the Coxeter diagrams for each family. These families can produce uniform honeycombs with infinite or unbounded facets or vertex figure, including ideal vertices at infinity, similar to the hyperbolic uniform tilings in 2-dimensions."},{"page_url":"https://fi.wikipedia.org/wiki/Bell_206","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/N90301_lifting_off_%2816367970971%29.jpg","page_title":"Bell 206","context_page_description":"Bell 206 on yhdysvaltalaisen Bell-yhtiön valmistama yksimoottorinen kevyt helikopteri.\\nKopteria valmistaa lisenssillä myös italialainen Agusta, jolloin kopterista käytetään nimeä Agusta AB 206. Kopterin ohjausjärjestelmä on hydraulinen."},{"page_url":"https://pl.wikipedia.org/wiki/I_Liceum_Og%C3%B3lnokszta%C5%82c%C4%85ce_im._Adama_Mickiewicza_w_Stargardzie","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/ILO_building2.JPG","page_title":"I Liceum Ogólnokształcące im. Adama Mickiewicza w Stargardzie","context_page_description":"I Liceum Ogólnokształcące im. Adama Mickiewicza w Stargardzie to najstarsze liceum w Stargardzie. Mieści się w budynku dawnego Königliches und Gröningsche Gymnasium, budowanego specjalnie dla gimnazjum klasycznego. Architektura całego kompleksu szkoły ma wyraźnie klasyczny charakter. Kompleks jest wpisany między ulicami: Popiela, Stanisława Staszica i Śląską.\\nW I LO im. Adama Mickiewicza prowadzone są klasy z rozszerzonym programem nauczania:\\nmatematyczno-fizyczna\\nmatematyczno-geograficzna\\nmedyczna z rozszerzonym językiem angielskim\\nmedyczna z rozszerzoną matematyką\\nspołeczno-prawny\\npsychologiczno-pedagogiczny"},{"page_url":"https://zh.wikipedia.org/wiki/CZ_100%E5%8D%8A%E8%87%AA%E5%8B%95%E6%89%8B%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/CZ-100.png","page_title":"CZ 100半自動手槍","context_page_description":"CZ 100是一款由捷克槍械製造商烏爾斯基·布羅德兵工廠所設計和在1995年生產的輕量級半自動手槍，是ČZ走進聚合物底把市場的手槍之一。主要發射9×19公釐和.40 S&W這二種口徑的手槍子彈。它具有一款姐妹型號為CZ 110，為其雙／單動操作扳機。\\n隨後CZ 100於2000年重新推出，稱為CZ 100B。除了新增可調節式瞄準具、扳機和擊發機構的操作，以及滑套和外部鋼製部件的清潔加工以外，它在其餘的多數方面都相同。"},{"page_url":"https://es.wikipedia.org/wiki/Miss_Guatemala_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Bandera_Municipalidad_de_Guatemala.jpg","page_title":"Miss Guatemala 2014","context_page_description":"La 60ª edición del certamen Miss Guatemala, correspondiente al año 2014, se realizó el 17 de mayo de 2014 en el Teatro Fantasía, IRTRA Petapa, en Ciudad de Guatemala, Guatemala. Candidatas de 6 Departamentos compitieron por el título. Al final del evento Paulette Samayoa, Miss Guatemala 2013, coronó a Ana Luisa Montufar de Guatemala como su sucesora.\\nLa noche final fue emitida en vivo y en directo por los canales Nacionales de Guatemala. La gala final estuvo conducida por Jackellinne Piccinini y Cristian Zamora. Los artistas que amenizaron la velada fueron los cantantes guatemaltecos Kim Lou y Andrés Mendoza."},{"page_url":"https://vi.wikipedia.org/wiki/USS_Philippine_Sea_(CV-47)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/USS_Philippine_Sea_%28CVA-47%29_underway_at_sea_on_9_July_1955_%2880-G-K-18429%29.jpg","page_title":"USS Philippine Sea (CV-47)","context_page_description":"USS Philippine Sea là một trong số 24 tàu sân bay thuộc lớp Essex được chế tạo cho Hải quân Hoa Kỳ trong Chiến tranh Thế giới thứ hai, và là chiếc tàu chiến đầu tiên của Hải quân Mỹ được đặt cái tên này để kỷ niệm Trận chiến biển Philippine vào năm 1944. Philippine Sea được đưa ra hoạt động vào tháng 5 năm 1946, quá trễ để có thể phục vụ cho Thế Chiến II. Nó trải qua những năm đầu tiên phục vụ chủ yếu tại Đại Tây Dương, vùng biển Caribbe và Địa Trung Hải, nhưng cũng từng được bố trí những nhiệm vụ đặc biệt tại biển Bắc Cực và Nam Cực. Nó gia nhập Hạm đội Thái Bình Dương vào năm 1950, và đã phục vụ tích cực trong cuộc Chiến tranh Triều Tiên, được tặng thưởng chín Ngôi sao Chiến đấu. Vào đầu những năm 1950 nó được xếp lại lớp như một tàu sân bay tấn công, rồi thành một tàu sân bay chống tàu ngầm. Nó phục vụ cho đến cuối cuộc đời hoạt động tại khu vực Thái Bình Dương.\\nKhông giống như những con tàu chị em khác cùng lớp, Philippine Sea không nhận được sự nâng cấp lớn đáng kể nào, nên trong suốt quãng đời hoạt động của mình vẫn giữ lại dáng dấp cổ điển của một tàu sân bay lớp Essex thời Thế Chiến II."},{"page_url":"https://pt.wikipedia.org/wiki/Henry_Petroski","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Henry_Petroski_Photo.jpg","page_title":"Henry Petroski","context_page_description":"Henry Petroski é um engenheiro estadunidense especializado em análise de falha. É professor de engenharia civil e história na Universidade Duke."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%B4%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%BA%D0%BE%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/%D0%91%D0%B5%D1%80%D0%B4%D1%8F%D0%BD%D1%81%D1%8C%D0%BA%D0%B0_%D0%BA%D0%BE%D1%81%D0%B011.JPG","page_title":"Бердянська коса","context_page_description":"Бердя́нська коса́ — коса на півночі Азовського моря, що відокремлює Бердянську затоку від моря."},{"page_url":"https://en.wikipedia.org/wiki/Baronet","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Arms_of_Baronet_Agnew_of_Lochnaw.jpg","page_title":"Baronet","context_page_description":"A baronet or the rare female equivalent, a baronetess, is the holder of a baronetcy, a hereditary title awarded by the British Crown. The practice of awarding baronetcies was originally introduced in England in the 14th century and was used by James I of England in 1611 as a means of raising funds.\\nA baronetcy is the only British hereditary honour that is not a peerage, with the exception of the Anglo-Irish Black Knights, White Knights and Green Knights. A baronet is addressed as \\"Sir\\" or \\"Dame\\" in the case of a baronetess, but ranks above all knighthoods and damehoods in the order of precedence, except for the Order of the Garter, the Order of the Thistle, and the dormant Order of St Patrick. Baronets are conventionally seen to belong to the lesser nobility, even though William Thoms claims that \\"The precise quality of this dignity is not yet fully determined, some holding it to be the head of the nobiles minores, while others, again, rank Baronets as the lowest of the nobiles majores, because their honour, like that of the higher nobility, is both hereditary and created by patent.\\""},{"page_url":"https://de.wikipedia.org/wiki/Abtei_Pomposa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Pomposa_Rundfenster.jpg","page_title":"Abtei Pomposa","context_page_description":"Pomposa ist eine ehemalige Abtei des Benediktiner-Ordens an der Mündung des Po in Norditalien. Sie liegt auf dem Gebiet der Gemeinde Codigoro in der Provinz Ferrara."},{"page_url":"https://de.wikipedia.org/wiki/Beck_Isle_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/BecksIsleMuseumPressH1c.jpg","page_title":"Beck Isle Museum","context_page_description":"Das Beck Isle Museum ist das Heimatmuseum der Stadt Pickering im Vereinigten Königreich in der englischen Grafschaft North Yorkshire ist ein im Vereinigten Königreich akkreditiertes Museum. Das Museum wurde 1967 gegründet stellt die Geschichte des der Stadt Pickering im 19. und 20. Jahrhundert dar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%BE%D0%B2%D0%B8%D1%85_%D0%BB%D1%96%D1%82%D0%B0%D0%BA%D1%96%D0%B2_%D0%A1%D0%A8%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/F-20_flying.jpg","page_title":"Список військових літаків США","context_page_description":"Список військових літаків США — перелік військових літальних апаратів, у тому числі прототипів, передсерійних екземплярів та таких, що перебували на озброєнні у Повітряних силах Сполучених Штатів Америки."},{"page_url":"https://de.wikipedia.org/wiki/Micral","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Micral_MGR_Lyon-IMG_9895.JPG","page_title":"Micral","context_page_description":"Micral ist eine Serie von Minicomputern, die vom französischen Hersteller Réalisation d'Études Electroniques hergestellt wurden. Die Produktion begann mit dem Micral N im Frühjahr 1973.\\nDer Micral N war ein Vorläufer des Personal Computers; der erste seiner Art mit einem Mikroprozessor, in diesem Fall ein Intel 8008."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A8%E3%83%90%E3%83%B3%E3%83%BB%E3%82%A8%E3%83%9E%E3%83%BC%E3%83%AB%E8%A6%81%E5%A1%9E%E3%81%AE%E6%88%A6%E3%81%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Eben-Emael.jpg","page_title":"エバン・エマール要塞の戦い","context_page_description":"エバン・エマール要塞の戦いは、第二次世界大戦中の1940年5月10日、11日両日に行われたベルギー軍とドイツ国防軍間の戦いであり、ドイツ軍のフランス、低地諸国侵攻作戦である黄作戦におけるオランダの戦い、ベルギーの戦いの一部。ドイツ軍の降下猟兵による攻撃はドイツ軍の砲兵部隊が進攻に使用する予定であったアルベール運河上の重要な橋を支配しているエバン・エマール要塞を襲撃、占領する任務を課されていた。ドイツ軍の降下猟兵部隊のいくつかが要塞を襲撃、要塞内のベルギー軍駐屯部隊の動きを封じ、要塞内の火砲を使用不可能にしたため、ドイツ軍は運河上の3つの橋を同時に占領した。要塞を封じたドイツ降下猟兵部隊はドイツ第18軍と合流するまで橋をベルギー軍の反撃から防衛するよう命令された。\\n軍用グライダーを使用して要塞上に着陸、爆薬を使用、さらに要塞外部の防衛を火炎放射器で制圧した降下猟兵の活躍により、戦いはドイツ軍の決定的勝利に終わった。その後、降下猟兵部隊は要塞へ入り、防衛を行っていたベルギー軍を殲滅、要塞の下部区域の残り部分を占領した。同時に、残りのドイツ攻撃部隊は運河上の3つの橋近辺に着陸、いくつかのトーチカ、防衛陣地を破壊、橋を守るベルギー軍を捕虜とし、ドイツ軍支配下に置いた。降下猟兵部隊は作戦行動中、多大な犠牲者で苦しんだが、ドイツ地上軍の到着まで橋の占拠に成功、その後、降下猟兵部隊は2回目の要塞襲撃を行い、要塞に駐屯するベルギー軍の降伏を強いるのを支援した。ドイツ軍はその後、ベルギー軍の防衛地点をいくつか迂回してベルギー侵入を効果的に行うために運河上の3つの橋を利用することができるようになった。"},{"page_url":"https://pl.wikipedia.org/wiki/Columbia_(komputer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Columbia_Supercomputer_-_NASA_Advanced_Supercomputing_Facility.jpg","page_title":"Columbia (komputer)","context_page_description":"Columbia - superkomputer wybudowany w 2004 roku przez Silicon Graphics dla NASA, nazwany dla uhonorowania ofiar katastrofy promu Columbia. Działał przez prawie 9 lat i umożliwił przeprowadzenie ponad 3 miliardów godzin obliczeń przez CPU. Został zdemontowany 15 marca 2013 roku.\\nJego głównym zadaniem były symulacje zderzeń galaktyk i powstawania galaktyk spiralnych. Zawierał 10240 procesorów Itanium 2, 20 terabajtów pamięci operacyjnej i 440 terabajty dysku twardego. W momencie uruchomienia miał moc obliczeniową 51,87 TFLOPS i według listy TOP500 był na drugim miejscu w rankingu najszybszych komputerów świata. W 2008 roku został rozbudowany i jego moc obliczeniowa wzrosła do 66 TFLOPS."},{"page_url":"https://hu.wikipedia.org/wiki/Iszl%C3%A1m_kert","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Generalife.JPG","page_title":"Iszlám kert","context_page_description":"Az iszlám kert vallási elveken alapuló ismérvek alapján létesült. Az elzártság, a védettség, a víz és az árnyék a fő jellemzői. A kert a nomád sivatagi élet gondjaitól tudatosan elválasztva önmagában zárt világot alkotott, ahol a fák látványa és a víz csobogása különleges értéket képviselt.\\nTekintettel a barátságtalan élettérre ezért nem meglepő, hogy az ideális elképzelés – a Korán paradicsomkertje – ritkán valósulhatott meg. Alaprajzilag a kertet egy kereszt alakú csatornával négy részre tagolták, ami viszonylag könnyen kivitelezhető volt ott, ahol volt víz. Nagyobb gondot okozott a dús növénykiültetés, gyümölcstermő és árnyékot adó fákkal, melyek – legalábbis az egykorú ábrázolások szerint – pavilonokkal együtt virágszőnyegek között álltak. A kertet árkádok szegélyezték, amelyek hozzájárultak az épület belsejének hűvösen tartásához.\\nA belső és a külső tér az iszlám felfogásnak megfelelő módon kapcsolódott egymáshoz és az állandóan változó térélményt a fény és az árnyék összjátéka is pompásan hangsúlyozta.\\nAz iszlám kert tipikus képviselője a granadai Alhambrától északkeletre fekvő Generalife nyári palota belső udvara."},{"page_url":"https://nl.wikipedia.org/wiki/Andreas_Giglmayr","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Austrian_Olympic_Team_2012_a_Andreas_Giglmayr_01a.jpg","page_title":"Andreas Giglmayr","context_page_description":"Andreas Giglmayr is een triatleet uit Oostenrijk. Hij nam namens zijn vaderland deel aan de Olympische Spelen in Londen, waar hij eindigde op de 40ste plaats in de eindrangschikking met een tijd van 1:51.14."},{"page_url":"https://pl.wikipedia.org/wiki/Ludno%C5%9B%C4%87_%C5%81odzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Polska_II_RP_gestosc_zaludnienia.jpg","page_title":"Ludność Łodzi","context_page_description":"Liczba mieszkańców Łodzi\\nWraz z rozwojem przemysłu w mieście, rozwijała się także liczba mieszkańców Łodzi. Z małej osady jeszcze na początku XIX wieku, Łódź stała się w 1850 roku, drugim po Warszawie miastem, pod względem liczby mieszkańców w Królestwie Polskim. W przeciągu stulecia liczba ludności zwiększyła się w Łodzi 600-krotnie, z niecałego tysiąca w 1815 do 600 tys. w 1915 roku. Tak szybki wzrost demograficzny w XIX wieku, jest nieporównywalny w skali całej Europy. Inne miasta w tym czasie powiększały się dziesięciokrotnie, najwyżej szesnastokrotnie.\\nWedług corocznego zestawienia GUS-u m.in. wszystkich miast Polski, Łódź jest trzecim miastem w kraju pod względem liczby ludności i czwartym pod względem powierzchni."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%96%B0%E5%8C%97%E5%B8%82%E7%83%8F%E4%BE%86%E5%8D%80%E4%BF%A1%E8%B3%A2%E7%A8%AE%E7%B1%BD%E8%A6%AA%E5%AD%90%E5%AF%A6%E9%A9%97%E5%9C%8B%E6%B0%91%E5%B0%8F%E5%AD%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/%E7%A8%AE%E7%B1%BD%E5%AF%A6%E5%B0%8F.jpg","page_title":"新北市烏來區信賢種籽親子實驗國民小學","context_page_description":"新北市乌来区信贤种籽亲子实验国民小学，简称种籽实小，位于台湾新北市乌来区信贤里泰雅族部落区，是一所由一群家长创办的民主学校，以自主学习为立校精神。创校人李雅卿同时也是台北市自主学习实验计划主持人和自主学习促进会第二任理事长。"},{"page_url":"https://de.wikipedia.org/wiki/Theropoda","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Allosaurus_skull_SDNHM.jpg","page_title":"Theropoda","context_page_description":"Die Theropoda sind eine systematische Gruppe, die traditionell den Echsenbeckendinosauriern zugeordnet wird. Sie bewegten sich zweibeinig fort und waren zum größten Teil Fleischfresser. Umgekehrt gehörten nahezu alle fleischfressenden Dinosaurier dieser Gruppe an, darunter die nach heutiger Kenntnis größten landbewohnenden Fleischfresser aller Zeiten mit Längen von rund 15 Metern. Viele Theropoda waren jedoch verglichen mit anderen Dinosauriern klein und maßen oft nur 2 bis 6 Meter.\\nKladistisch gesehen umfassen die Theropoda auch die Vögel, die im Jura nachweislich aus nicht-flugfähigen Theropoden hervorgegangen sind. Demnach überlebten die Theropoda nicht nur das Massenaussterben am Ende der Kreidezeit, sondern stellen auch, vertreten durch über 10.000 lebende Spezies moderner Vögel, gegenwärtig über ein Drittel aller rezenten Landwirbeltierarten. Der nachfolgende Artikel beschränkt sich jedoch weitgehend auf fossile Vertreter des Mesozoikums, die nicht den Vögeln angehörten.\\nIm Zuge der Popularisierung der Dinosaurier seit Mitte des 19."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%BE%D9%86%D8%A8%D8%B1%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Wappen_Eppenbrunn.png","page_title":"اپنبرون","context_page_description":"اپنبرون یک شهر در آلمان است که در زودوستپفالتس واقع شده‌است. اپنبرون ۱٬۴۸۸ نفر جمعیت دارد."},{"page_url":"https://sv.wikipedia.org/wiki/Prunus_nipponica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Prunus_nipponica_Blossom_crop.jpg","page_title":"Prunus nipponica","context_page_description":"Prunus nipponica är en rosväxtart som beskrevs av Jinzô Matsumura. Prunus nipponica ingår i släktet prunusar, och familjen rosväxter."},{"page_url":"https://ca.wikipedia.org/wiki/Poppenb%C3%BCttel","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Emekesweg_12_%28Hamburg-Poppenb%C3%BCttel%29.Stolpersteine.ajb.jpg","page_title":"Poppenbüttel","context_page_description":"Poppenbüttel és un barri del districte de Wandsbek a la ciutat estat d'Hamburg a Alemanya. El 2015 tenia 26.675 habitants sobre una superfície de 8,1 km². El Poppenbütteler Graben forma la frontera amb Lemsahl-Mellingstedt i el Mellingbek al nord, l'Alster a l'est amb Sasel i després de traversar el poble, al sud amb Wellingsbüttel, i Hummelsbüttel a l'oest. Les comunicacions molts bons i es troba a l'estació terminal de la línia del metro d'Hamburg S1.\\nEl nom prové del baix alemany Poppenbüddel el que significa masia d'en Poppilo, un nom freqüent a l'edat mitjana. El primer esment escrit data del 1336. Fins al segle XIX era un petit assentament rodó"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BB%D0%B8_%D0%9B%D0%B0%D0%BF%D0%B0%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Kislap%C3%A1s_szakr_kiseml%C3%A9k_1.JPG","page_title":"Мали Лапаш","context_page_description":"Мали Лапаш насељено је мјесто са административним статусом сеоске општине у округу Њитра, у Њитранском крају, Словачка Република."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%89%84C59%E5%BD%A2%E8%92%B8%E6%B0%97%E6%A9%9F%E9%96%A2%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Umekoji_Steam_Locomotive_Museum_%E6%A2%85%E5%B0%8F%E8%B7%AF%E8%92%B8%E6%B0%97%E6%A9%9F%E9%96%A2%E8%BB%8A%E9%A4%A8_%288178321301%29.jpg","page_title":"国鉄C59形蒸気機関車","context_page_description":"国鉄C59形蒸気機関車は、日本国有鉄道の前身である鉄道省が設計した、幹線旅客列車用テンダー式蒸気機関車である。愛称はシゴクまたはシゴキュウ。"},{"page_url":"https://ms.wikipedia.org/wiki/19_Mei","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Thai_soldiers_and_Type_85_APCs_during_2010_Thai_political_protests.jpg","page_title":"19 Mei","context_page_description":"19 Mei merupakan hari ke-139 dalam takwim Gregorius. Tinggal 226 hari sebelum memasuki tahun selepasnya.\\nHari ini juga merupakan Hari Belia dan Sukan di Turki."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%94%D7%A0%D7%A1_%D7%A9%D7%98%D7%A4%D7%9C%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Johannes_St%C3%B6ffler%2C_Elucidatio_fabricae_ususque_astrolabii.jpg","page_title":"יוהנס שטפלר","context_page_description":"יוהנס שטפלר, היה אסטרונום גרמני, מתמטיקאי, אסטרולוג וכומר ששלט בשפות לטינית, יוונית, עברית וערבית. הוא היה פרופסור למתמטיקה ויושב ראש הקתדרה ללימודי מתמטיקה ואסטרונומיה באוניברסיטת טיבינגן.\\nהוא התפרסם בזכות הספרים שכתב בתחומי האסטרולוגיה והאסטרונומיה וכיצרן של מכשירים אסטרונומיים. הוא יצר שניים משלושת השעונים האסטרונומיים המעטרים עד היום את בניין העירייה בכיכר השוק בטיבינגן, המספקים נתונים מדויקים על ליקויי החמה והירח, על מיקום השמש בגלגל המזלות ועוד.\\nבשנת 1935 נקרא המכתש הממוקם בחזית הדרומית של הירח, על שמו של שטפלר, כהוקרה על עבודתו בתחום האסטרונומיה."},{"page_url":"https://sk.wikipedia.org/wiki/Svat%C3%BD_Jan_pod_Skalou","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/Svaty_Jan_pod_Skalou_CZ_CoA.jpg","page_title":"Svatý Jan pod Skalou","context_page_description":"Svatý Jan pod Skalou je obec v Stredočeskom kraji, okres Beroun, ktorá spoločne s Karlštejnom a starodávnym Tetínom patria medzi najzaujímavejšie turistické lokality okresu. Obec, ležiaca v nadmorskej výške 233 metrov nad morom má asi 132 obyvateľov a rozlohu 4,09 ha."},{"page_url":"https://en.wikipedia.org/wiki/Olmsted_Township,_Cuyahoga_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/John_and_Maria_Adams_House.jpg","page_title":"Olmsted Township, Cuyahoga County, Ohio","context_page_description":"Olmsted Township is a township located in Cuyahoga County, Ohio, United States. Situated in the southwest end of the county, Olmsted Township is a west side suburb of Cleveland, and a part of the even larger Greater Cleveland area. As of the 2010 Census, Olmsted had a population of 13,513. It is one of only two civil townships remaining in Cuyahoga County, and the only Olmsted Township statewide."},{"page_url":"https://ca.wikipedia.org/wiki/Renkum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Grunsfoort.jpg","page_title":"Renkum","context_page_description":"Renkum és un municipi de la província de Gelderland, al centre-est dels Països Baixos. L'1 de gener del 2009 tenia 31.801 habitants repartits sobre una superfície de 47,12 km². Limita al nord amb Ede, a l'oest amb Wageningen, a l'est amb Arnhem i al sud amb Overbetuwe."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_72_Namen_auf_dem_Eiffelturm","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Portrait_Lazare_Carnot.jpg","page_title":"Liste der 72 Namen auf dem Eiffelturm","context_page_description":"Gustave Eiffel hat in Anerkennung ihrer wissenschaftlichen und technischen Leistungen die Nachnamen von 72 männlichen Personen – bis auf die Schweizer Breguet und Sturm und den gebürtigen Italiener Lagrange alles Franzosen – in goldenen Lettern auf den Friesen der ersten Etage des Eiffelturms anbringen lassen. Zu Beginn des 20. Jahrhunderts wurden sie übermalt und erst bei der Restaurierung des Eiffelturms zwischen 1986 und 1987 durch die Société nouvelle d’exploitation de la tour Eiffel wieder zum Vorschein gebracht.\\nBis auf Fizeau und Chevreul waren alle Wissenschaftler zum Zeitpunkt der Einweihung des Turms bereits verstorben."},{"page_url":"https://nl.wikipedia.org/wiki/Rolstoelcurling","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Paralympic_Curling.jpg","page_title":"Rolstoelcurling","context_page_description":"Rolstoelcurling een variant op het gewone curling, maar dan voor mensen met een lichamelijke handicap die gebruikmaken van een rolstoel."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%88%D8%AA%D9%88%DA%AF%D8%B1%D8%A7%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/BUL_%D0%91%D0%BE%D1%82%D0%B5%D0%B2%D0%B3%D1%80%D0%B0%D0%B4_COA.png","page_title":"بوتوگراد","context_page_description":"بۇتوگراد - بولغاریستانین صوفیه اوستانیندا یئرلشیب ۲۰۰۱ جی ایلینین نۆفوس ساییمی اساسیندا بۇ شهرین ۲۱۵۴۵ نفر و ۲۰۱۱-جی ایلین نۆفوس ساییمی اساسیندا ۲۰۴۴۴ نفر جمیعتی واریمیش. بۇ باخیم‌دان اۆلکه‌نین ۴۴- اینجی شهری سایاگلیر."},{"page_url":"https://it.wikipedia.org/wiki/Bandiera_di_Ejin_Horo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/GhinggisKhanMausoleum.jpg","page_title":"Bandiera di Ejin Horo","context_page_description":"La bandiera di Ejin Horo è una bandiera della Mongolia Interna, regione autonoma della Cina. Essa è amministrata dalla prefettura di Ordos."},{"page_url":"https://fr.wikipedia.org/wiki/Deutsches_Technikmuseum_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/0106-01b_DTMB.jpg","page_title":"Deutsches Technikmuseum Berlin","context_page_description":"Le Deutsches Technikmuseum Berlin a été ouvert en 1982 à Berlin : il portait alors le nom de Museum für Verkehr und Technik. Le musée se trouve dans le centre de Berlin à l'adresse suivante : Trebbinerstraße 9, 10963 Berlin. Zum 1. En septembre 1996, il est renommé en Deutsches Technikmuseum Berlin. Le musée utilisait au début des halles encore existantes de l'ancienne et célèbre gare d'Anhalt bombardée durant la Seconde Guerre mondiale, située non loin."},{"page_url":"https://pl.wikipedia.org/wiki/Anton%C3%ADn_Kasper_(1962%E2%80%932006)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Antonin_Kasper.jpg","page_title":"Antonín Kasper (1962–2006)","context_page_description":"Antonín Kasper junior – czechosłowacki i czeski żużlowiec, mistrz świata juniorów, jedyny uczestnik Grand Prix, który z dziką kartą wystąpił we wszystkich turniejach w danym sezonie. Jego ojciec, Antonín, również był żużlowcem."},{"page_url":"https://de.wikipedia.org/wiki/Kettenschifffahrt_auf_dem_Neckar","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Kettenschifffahrt_Neckar.svg","page_title":"Kettenschifffahrt auf dem Neckar","context_page_description":"Die Kettenschifffahrt auf dem Neckar war eine spezielle Art der Schleppschiffahrt, bei der sich Kettendampfer mit mehreren angehängten Schleppkähnen entlang einer im Fluss verlegten Kette zogen. Sie wurde ab 1878 zwischen Mannheim und Heilbronn, ab 1884 bis Lauffen eingesetzt. Die Kettenschifffahrt reduzierte die Transportkosten der Schiffer gegenüber dem bis dahin üblichen Treideln mit Pferden erheblich und machte den Schiffstransport gegenüber der Eisenbahn wieder konkurrenzfähig. Durch fortschreitende Kanalisierung des Neckars und die dafür erforderlichen Staustufen wurde der Kettenschleppbetrieb erschwert und unwirtschaftlich. Er wurde zunehmend durch Schlepper mit Schiffsschraube ersetzt und mit dem vollständigen Ausbau des Neckars 1935 eingestellt."},{"page_url":"https://pt.wikipedia.org/wiki/Wilshire_Grand_Center","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Wilshire_Grand_demolition.jpg","page_title":"Wilshire Grand Center","context_page_description":"Wilshire Grand Central é um arranha-céu de 73 andares de 335 metros de altura localizado no centro de Los Angeles, Califórnia. É o edifício mais alto de Los Angeles e da Califórnia, e o edifício mais alto à oeste do Rio Mississippi e fora da cidade de Nova York, Chicago e Filadélfia, e o 10º edifício mais alto dos Estados Unidos. Sua altura ultrapassa a altura do U.S. Bank Tower 25 metros. O edifício faz parte de um complexo de hotéis, varejos, plataformas de observação, shopping centers e escritórios, construído para revitalizar o centro de Los Angeles e a área ao redor do edifício. O desenvolvimento do complexo teve custo estimado de US$ 1,2 bilhão. O edifício possui uma área de 6 225 metros quadrados de varejo, 62 895 metros quadrados de escritórios Classe A e de 900 quartos de hotel. O InterContinental é a rede hoteleira que atua no edifício, composto de 900 quartos e suites."},{"page_url":"https://ca.wikipedia.org/wiki/Lantuelh","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Lanteuil.JPG","page_title":"Lantuelh","context_page_description":"Lantòl és un municipi francès, situat al departament de la Corresa i a la regió de la Nova Aquitània."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%81%86%E6%B2%B3%E9%81%8B%E6%B2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ganga_canal.jpg","page_title":"恆河運河","context_page_description":"恆河運河，是恆河流域的一套運河系流，用來灌溉恆河及其最大支流亞穆納河之間的狹長平原。\\n運河主要用途為灌溉，但有些河段也用於航行，以運送本身所需的建築材料。不同河段之間築有水閘，以利船隻得以通過落差。最早興建於1842年至1852年，當時的源頭流量為6,000 ft³/s。其後「上恆河運河」逐漸擴展規模，如今源頭流量已達10,500 ft³/s 。整套系統由272英里長的主線及大約4,000英里長的支線所組成，灌溉大約9,000平方公里的肥沃農地，跨及北阿坎德邦及北方邦的十個縣。如今這套運河系統仍然是這兩邦繁榮的重要原因，而邦的灌溉管理單位透過向使用者收費的方式來維護運河。\\n運河沿岸建有一些小型的水力發電廠，最大負載達33MW，分別位於尼爾加吉尼、奇陶拉、沙拉瓦、波拉、賈尼、Jauli及達斯納等地。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%82%D9%88%D8%A7%D9%85_%D8%A2%D9%86%D8%AA%D9%88%D9%86%DB%8C_%D8%A2%D9%BE%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Kwame_Anthony_Appiah_by_David_Shankbone.jpg","page_title":"قوام آنتونی آپیا","context_page_description":"قوام آنتونی آپیا فیلسوف و نظریه‌پرداز فرهنگ معاصر و استاد فلسفه دانشگاه پرینستون. دیدگاه‌های او در حوزه‌های متنوع علوم انسانی از جمله اخلاق، فلسفه سیاسی و فلسفه اجتماعی، مطالعات آمریکا و آفریقا و مطالعات چندفرهنگ‌گرایی حائز اهمیت است."},{"page_url":"https://en.wikipedia.org/wiki/Indian_Mexicans","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Dr._Sanjaya_Rajaram_WFP.jpg","page_title":"Indian Mexicans","context_page_description":"Indian Mexicans are Mexican citizens who are descendants of migrants from India."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_de_P%C3%B6yty%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/P%C3%B6yty%C3%A4_church_interior_2.JPG","page_title":"Église de Pöytyä","context_page_description":"L'église de Pöytyä est une église située à Pöytyä en Finlande."},{"page_url":"https://pl.wikipedia.org/wiki/Focke-Wulf_Fw_190","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/FW190_A8_3Seiten.JPG","page_title":"Focke-Wulf Fw 190","context_page_description":"Focke-Wulf Fw 190 Würger – jednomiejscowy, jednosilnikowy niemiecki myśliwiec z czasów drugiej wojny światowej. Wyprodukowany w ponad 20 tysiącach egzemplarzy, w tym około 6 tysięcy w wersji myśliwsko-bombowej."},{"page_url":"https://cs.wikipedia.org/wiki/El_Greco","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/El_Greco_-_Cristo_en_la_cruz_adorado_por_dos_donantes_%28Mus%C3%A9e_du_Louvre%29.jpg","page_title":"El Greco","context_page_description":"Doménikos Theotokópoulos známý jako El Greco byl malíř řeckého původu, známý jako hlavní představitel španělského pozdního manýrismu a počínajícího baroka. Jako významný inovátor byl objeven uměleckou veřejností až koncem 19. století. Jeho dílo bylo jednou z inspirací pro malíře 20. století, zejména Pabla Picassa."},{"page_url":"https://fr.wikipedia.org/wiki/Lotte_Stein","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Lotte_Stein_3.jpg","page_title":"Lotte Stein","context_page_description":"Lotte Stein était une actrice allemande."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D1%8B%D1%85_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_2012_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/RR5216-0082R.jpg","page_title":"Список памятных монет России 2012 года","context_page_description":"арбитражных судов"},{"page_url":"https://en.wikipedia.org/wiki/Mechelen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Mechelen%2C_de_Brusselpoort_RM3411_foto8_2011-09-23_12.52.jpg","page_title":"Mechelen","context_page_description":"Mechelen is a city and municipality in the province of Antwerp in the Flemish Region of Belgium. The municipality comprises the city of Mechelen proper, some quarters at its outskirts, the hamlets of Nekkerspoel and Battel, as well as the villages of Walem, Heffen, Leest, Hombeek, and Muizen. The Dyle flows through the city, hence it is often referred to as the Dijlestad.\\nMechelen lies on the major urban and industrial axis Brussels–Antwerp, about 25 km from each city. Inhabitants find employment at Mechelen's southern industrial and northern office estates, as well as at offices or industry near the capital and Zaventem Airport, or at industrial plants near Antwerp's seaport.\\nMechelen is one of Flanders' prominent cities of historical art, with Antwerp, Bruges, Brussels, Ghent, and Leuven. It was notably a centre for artistic production during the Northern Renaissance, when painters, printmakers, illuminators and composers of polyphony were attracted by patrons such as Margaret of York, Margaret of Austria and Hieronymus van Busleyden."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Windm%C3%BChlen_in_Nordrhein-Westfalen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Osterrather_Windm%C3%BChle_Ost.JPG","page_title":"Liste der Windmühlen in Nordrhein-Westfalen","context_page_description":"Die Liste der Windmühlen in Nordrhein-Westfalen gibt einen umfassenden Überblick über die Windmühlen unterschiedlichen Erhaltungszustandes im Land Nordrhein-Westfalen. Am Niederrhein finden sich vorwiegend runde, konische Steinwindmühlen als Erdholländermühlen oder Wallholländermühlen."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%91%D0%B0%D1%82%D0%B0%D0%BB%D1%8C%D1%91%D0%BD_%D0%9A%D0%90%D0%9F_%C2%AB%D0%A1%D1%82%D0%BE%D1%9E%D0%BF%D1%86%D1%8B%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Sto%C5%ADbcy%2C_kazarmy_pamie%C5%BEnaha_bataljona._Sto%C5%82pce%2C_koszary.jpg","page_title":"Батальён КАП «Стоўпцы»","context_page_description":"Батальё́н Ко́рпусу ахо́вы паме́жжа «Сто́ўпцы» — восьмы батальён Корпусу аховы памежжа часоў міжваеннай Польскай Рэспублікі, які разьмяшчаўся ў Стоўпцах у 1924—1939 гадах.\\nБатальён уваходзіў у склад другой брыгады КАП «Наваградак» і ўключаў 3 памежныя роты КАП: «Мікалаеўшчына», «Сейлавічы» і «Коласава»."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B1%D1%8B_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%BE%D0%B2_%D0%9A%D0%B0%D0%BC%D1%87%D0%B0%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%BA%D1%80%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Coat_of_Arms_of_Milkovo_%28Kamchatka_krai%29.png","page_title":"Гербы районов Камчатского края","context_page_description":"Герб Камчатского края\\nГербы населённых пунктов Камчатского края\\nФлаги Камчатского края"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%83%A9%E3%83%A0%E3%82%BD%E3%83%BC%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Plumsauce.jpg","page_title":"プラムソース","context_page_description":"プラムソースは、粘度が高く、明るい茶色で、甘酸っぱい調味料である。春巻き、エッグロール、揚げ麺、揚げチキンボール等の揚げ物やローストダックのディップとして中国料理で用いられる。甘いスモモか、モモ、パイナップル、アンズ等の果物と、砂糖、酢、食塩、ショウガ、トウガラシ等から作る。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Erding","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Landshuter_Str._4_Erding-1.jpg","page_title":"Liste der Baudenkmäler in Erding","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Stadt Erding zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://it.wikipedia.org/wiki/Maurice_Athanase_Le_Luc","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Bundesarchiv_Bild_146-1982-089-18%2C_Waffenstillstand_von_Compi%C3%A8gne%2C_Unterh%C3%A4ndler.jpg","page_title":"Maurice Athanase Le Luc","context_page_description":"Maurice Athanase Le Luc è stato un ammiraglio francese, firmatario dell'armistizio di Compiègne entrò poi a fra parte del Governo di Vichy come Capo di gabinetto del Ministro della Marina e delle Colonie ammiraglio François Darlan. Nel novembre 1942, dopo l'invasione tedesca del territorio della Francia di Vichy e l'Autoaffondamento della flotta francese a Tolone, assunse per un breve periodo la funzioni di Capo di stato maggiore della Marine nationale."},{"page_url":"https://fr.wikipedia.org/wiki/Perfect_Strangers_(album)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mag._art._Matthias_Laurenz_Gr%C3%A4ff._%22Deep_Purple%2C_Perfect_Strangers_Reunion_27._11._1984%2C_Perth%22.JPG","page_title":"Perfect Strangers (album)","context_page_description":"Perfect Strangers est le onzième album studio du groupe britannique Deep Purple sorti en 1984 chez Polydor au Royaume-Uni et chez Mercury aux États-Unis. Il marque le retour du groupe, de sa formation la plus célèbre, la Mark II, avec Ritchie Blackmore, Ian Gillan et Roger Glover."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%AD%E8%88%88%E6%A9%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/%E4%B8%AD%E8%88%88%E6%A9%8B%E4%B8%89%E9%87%8D%E7%AB%AFFUJI3485.JPG","page_title":"中興橋","context_page_description":"中興橋位於台灣台北盆地中央，跨越淡水河連接起台北市萬華區成都路及新北市三重區成功路，通往經過三重的台1甲線，目前為市道104號的一部份。\\n此橋全長1055公尺、寬14.5公尺、高7.5公尺。為當時遠東及台灣第一座預力混凝土大橋，亦為戰後時期完成的第二座大橋。"},{"page_url":"https://oc.wikipedia.org/wiki/Capcin%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Capcin%C3%A8s.svg","page_title":"Capcinés","context_page_description":"Lo capcinés es una varietat particulara del catalan septentrional parlada dins la val de Capcir en Catalonha del Nòrd. Es actualament un ensems de parlars de transicion cap a l'occitan qu'a conegut una pression constanta dels sosdialèctes catalans vesins dempuèi almens la fin del sègle XIX en se desoccitanizar long del temps. Aqueste caractèr ibrid faguèt que Juli Ronjat l'integrèsse dins l'occitan, çò qu'indignèt lo lingüista rosselhonés Enric Guiter qualques decadas mai tard.\\nLo capcinés, que compren totes los vilatges de Capcir manca Matamala, presenta una omogeneïtat pro limitada; globalament se pòt dire que los traches \\"occitans\\" son mai importants al nòrd qu'al sud encara que lo parlar dels Angles pòsca servar qualques traches \\"septentrionals\\" que los autres parlars possedisson pas. Lo parlar de Matamala es exterior al capcinés encara que presente qualques afinitats dins las enquèstas de Sacasa o de Guiter."},{"page_url":"https://en.wikipedia.org/wiki/Picardy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Picardie_in_France_%281789%29.svg","page_title":"Picardy","context_page_description":"Picardy is a historical territory and a former administrative region of France. Since 1 January 2016, it has been part of the new region of Hauts-de-France. It is located in the northern part of France."},{"page_url":"https://sv.wikipedia.org/wiki/Tj%C3%A4nstegrader_i_NKVD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/%D0%9D%D0%BA%D0%B2%D0%B4%D0%BF%D0%B21937%D0%BA%D0%B0%D0%BF%D0%B8%D1%82%D0%B0%D1%88.png","page_title":"Tjänstegrader i NKVD","context_page_description":"Tjänstegrader i NKVD visar den hierarkiska ordningen i NKVD, Narodnyj komissariat vnutrennich del."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Cyr_(Alto_Vienne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Blason_ville_fr_Saint-Cyr_%28Haute-Vienne%29.svg","page_title":"Saint-Cyr (Alto Vienne)","context_page_description":"Saint-Cyr es una población y comuna francesa, situada en la región de Lemosín, departamento de Alto Vienne, en el distrito de Rochechouart y cantón de Saint-Laurent-sur-Gorre."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B0%80%EB%82%98%EC%9E%90%EC%99%80_%EB%AC%B8%EA%B3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Seal_of_Kanezawa_bunko.jpg","page_title":"가나자와 문고","context_page_description":"가나자와 문고는 일본 가마쿠라 시대 중기 일본에서 가나자와류 호조 씨 호조 사다토키가 세운 일본 최고의 무가문고이다. 소재지는 일본 가나가와현 요코하마시 가나자와구 가나자와 정142이다.\\n가나자와 류 호조 씨가 영지로써 다스렸던, 훗날 그들의 저택 및 보리사가 되는 쇼묘지를 건립하여 본거지로써 개발하고, 집안의 이름의 유래가 된 땅인 무사시 국 구로사키 군 로쿠라 장 가나가와 향에 소재하였던 것이 명칭의 유래가 되었다. 오늘날에는 「가나가와 현립 가나가와 문고」라는 이름으로 가나가와 현립 역사박물관으로 개장되어 다양한 소장품을 보관 ・ 전시하고 있다."},{"page_url":"https://de.wikipedia.org/wiki/Brunnen_in_Wien","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Brunnenmitwasserspiel.JPG","page_title":"Brunnen in Wien","context_page_description":"Die öffentlichen Brunnen in Wien dienten schon seit der Römerzeit der Wasserversorgung des Gemeinwesens und der Brandbekämpfung in der heutigen österreichischen Bundeshauptstadt Wien. Im Lauf der Zeit erhielten die Brunnen zunehmend eine repräsentative Funktion und wurden entsprechend aufwändig gestaltet."},{"page_url":"https://sk.wikipedia.org/wiki/Vajansk%C3%A9ho_vodop%C3%A1d","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Ciemnosmreczynska_Siklawa.jpg","page_title":"Vajanského vodopád","context_page_description":"Vajanského vodopád je ľadovcový vodopád selektívneho typu vo Vysokých Tatrách, ktorý sa nachádza na dolnej terase skalného prahu medzi Kôprovou a Temnosmrečinskou dolinou."},{"page_url":"https://de.wikipedia.org/wiki/Echte_Betonie","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Herbarius_Betonica_Bethonien.jpg","page_title":"Echte Betonie","context_page_description":"Die Echte Betonie, auch Heil-Ziest, Heilbatunge, Flohblume, Pfaffenblume, Zahnkraut oder Zehrkraut genannt, ist eine Pflanzenart aus der Gattung der Betonien innerhalb der Familie der Lippenblütler."},{"page_url":"https://en.wikipedia.org/wiki/Polish%E2%80%93Lithuanian_Commonwealth","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Milicje_krakowskie_Rolka_sztokholmska.jpg","page_title":"Polish–Lithuanian Commonwealth","context_page_description":"The Polish–Lithuanian Commonwealth – formally, the Crown of the Kingdom of Poland and the Grand Duchy of Lithuania and, after 1791, the Commonwealth of Poland – was a country and bi-federation of Poland and Lithuania ruled by a common monarch in real union, who was both King of Poland and Grand Duke of Lithuania. It was one of the largest and most populous countries of 16th- to 17th-century Europe. At its largest territorial extent, in the early 17th century, the Commonwealth covered almost 1,000,000 square kilometres and as of 1618 sustained a multi-ethnic population of almost 12 million. Polish and Latin were the two co-official languages.\\nThe Commonwealth was established by the Union of Lublin in July 1569, but the Crown of the Kingdom of Poland and the Grand Duchy of Lithuania had been in a de facto personal union since 1386 with the marriage of the Polish queen Hedwig and Lithuania's Grand Duke Jogaila, who was crowned King jure uxoris Władysław II Jagiełło of Poland."},{"page_url":"https://vi.wikipedia.org/wiki/B%E1%BA%AFc_Trung_B%E1%BB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Den-tho-ba-trieu.jpg","page_title":"Bắc Trung Bộ","context_page_description":"Bắc Trung Bộ là phần phía bắc của Trung Bộ Việt Nam có địa bàn từ phía nam Ninh Bình tới phía bắc Đèo Hải Vân. Vùng Bắc Trung Bộ là một trong 7 vùng kinh tế được Chính phủ giao lập quy hoạch tổng thể kinh tế xã hội.\\nVề mặt quốc phòng thì các tỉnh này do Bộ Tư lệnh, Quân khu 4 trách nhiệm và quản lý."},{"page_url":"https://ro.wikipedia.org/wiki/R%C3%A2ul_Valea_S%C4%83rat%C4%83,_Arie%C8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Turda-ValeaS%C4%83rat%C4%83-%2803%29.JPG","page_title":"Râul Valea Sărată, Arieș","context_page_description":"Valea Sărată, sau Pârâul Sărat Mare este un afluent de stânga al râului Arieș. Cursul său mijlociu și inferior este numit Pârâul Sfântu Ion."},{"page_url":"https://ro.wikipedia.org/wiki/Baekje","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/History_of_Korea-375.png","page_title":"Baekje","context_page_description":"Baekje a fost un stat antic coreean, fondat în anul 18 î.Hr. de catre Onjo, fiul cel mic al lui Jumong, fondatorul statului Goguryeo. O altă legendă spune că fondatorul regatului este, de fapt, Biryu, fratele mai mare al lui Onjo.\\nAlături de Goguryeo și Silla, Baekje face parte din cele trei regate ale Coreei din antichitate.\\nBaekje, la fel ca și Goguryeo se considera națiune succesoare a regatului Buyeo, un stat din Manciuria, format în timpul căderii Vechiului Joseon.\\nRegii regatului Baekje sunt:\\nOnjo 18 BCE–29 CE\\nDaru 29–77\\nGiru 77–128\\nGaeru 128–166\\nChogo 166–214\\nGusu din Baekje 214–234\\nSaban 234\\nGoi din Baekje 234–286\\nChaekgye 286–298\\nBunseo 298–304\\nBiryu 304–344\\nGye 344–346\\nGeunchogo 346–375\\nGeungusu 375–384\\nChimnyu 384–385\\nJinsa 385–392\\nAsin 392–405\\nJeonji 405–420\\nGuisin 420–427\\nBiyu 427–455\\nGaero 455–475\\nMunju 475–477\\nSamgeun 477–479\\nDongseong 479–501\\nMuryeong 501–523\\nSeong 523–554\\nWideok 554–598\\nHye 598–599\\nBeop 599–600\\nMu 600–641\\nUija 641–660"},{"page_url":"https://gl.wikipedia.org/wiki/Chelbacheb","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Palau-CIA_WFB_Map.png","page_title":"Chelbacheb","context_page_description":"As Illas Chelbacheb son un pequeno arquipélago de 200 a 300 illas de pedra calcaria en Palau, entre as illas de Koror e Peleliu. As illas están formadas dun arrecife de coral parcialmente emerxido e están deshabitadas, pero son famosas polas súas praias e bosques tropicais e pola peculiar forma na maioría das illas.\\nO arquipélago divídese en sete grupos distribuídos de norte a sur.\\nIllas Ulubsechel: situado ao noroeste e xusto ao sur da illa de Koror. Está conformado por 20 illas;\\nIllas Urukthapel ou Ngeruktabel: ao suroeste de Ulubsechel e conformado por 80 illas, do cal sobresae a illa de Ngerukthable;\\nIllas Ulong: quince illas situadas ao oeste de Urukthapel;\\nIllas Mecherchar: 70 illas situadas ao sur de Ngeruktabel, do cal sobresae a illa de Eil Malk. Nesta illa está situado o chamado Lago das Medusas.\\nIllas Ngerukeuid ou Seventy Islands: 40 illas situadas ao oeste de Mecherchar;\\nIllas Ngemelis: 20 illas situadas ao sur de Ngerkeuid, sobresae a illa de Dmasech;\\nIllas Ngeroi: no extremo meridional do arquipélago, a só 5 km ao norte do estado de Peleliu. Consiste en cinco illas."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AC%E0%A6%B2%E0%A6%BF%E0%A6%B9%E0%A6%BE%E0%A6%B0_%E0%A6%B0%E0%A6%BE%E0%A6%9C%E0%A6%AC%E0%A6%BE%E0%A6%A1%E0%A6%BC%E0%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/%E0%A6%AE%E0%A7%82%E0%A6%B2_%E0%A6%AA%E0%A7%8D%E0%A6%B0%E0%A6%BE%E0%A6%B8%E0%A6%BE%E0%A6%A6%E0%A7%87_%E0%A6%A2%E0%A7%8B%E0%A6%95%E0%A6%BE%E0%A6%B0_%E0%A6%AA%E0%A6%A5_%E0%A6%AF%E0%A6%BE_%E0%A6%8F%E0%A6%96%E0%A6%A8_%E0%A6%AE%E0%A7%82%E0%A6%B2%E0%A6%A4_%E0%A6%A4%E0%A6%BE%E0%A6%B2%E0%A6%BE%E0%A6%AC%E0%A6%A6%E0%A7%8D%E0%A6%A7_%E0%A6%A5%E0%A6%BE%E0%A6%95%E0%A7%87.jpg","page_title":"বলিহার রাজবাড়ী","context_page_description":"বলিহার রাজবাড়ী নওগাঁ সদর উপজেলায় অবস্থিত প্রাচীনতম রাজবাড়ী এবং বাংলাদেশের অন্যতম প্রত্নতাত্ত্বিক স্থাপনা।"},{"page_url":"https://mk.wikipedia.org/wiki/Macedonian_Bike_Riders","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Ramno07.JPG","page_title":"Macedonian Bike Riders","context_page_description":"Macedonian Bike Riders — аматерска велосипедска група од Скопје, Македонија, основана во 2014 година. Групата вози во околината на Скопје, како и целодневни тури и до подалечните краеви во Македонија. Воедно, групата на своите возења собира средства кои ги донира во хуманитарни цели, а исто така и некои од турите биле целосно хуманитарни. Неформално е предводена од Горан Богоевски.\\nДосега, групата има извозени 65 подолги тури, кои најчесто биле возени во недела низ различни места во Македонија, главно почнувајќи ги од Скопје. Претставува една од неколкуте групи и поединци во Македонија кои се дел од велосипедскиот туринг.\\nВо текот на 2015 година, групата започнала да вози и ноќни тури до поблиските места во Скопје, најчесто одржувани во денот среда."},{"page_url":"https://en.wikipedia.org/wiki/Battle_of_Chocont%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Ch%C3%ADa_Bogot%C3%A1_May_2016.jpg","page_title":"Battle of Chocontá","context_page_description":"The Battle of Chocontá was one of a series of battles in the ongoing conflict between the northern and southern Muisca of pre-Columbian central Colombia. The battle was fought c. 1490 in the vicinity of Chocontá. An army of 50,000 southern Muisca guecha warriors, led by their ruler, or zipa, Saguamanchica, attacked 60,000 northern Muisca troops commanded by Zaque Michuá, who was supported by the Cacique of Guatavita."},{"page_url":"https://af.wikipedia.org/wiki/Karnmelkspruit","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/HGG-8thReverseStation.jpg","page_title":"Karnmelkspruit","context_page_description":"Die Karnmelkspruit is 'n sytak van die Kraairivier in die Senqugebied in die noordoostelike deel van die Oos-Kaap. Dit ontspring in die Witteberg suid van Lesotho, en vloei as 'n stroompie suidweswaarts deur valleie en klowe oos van die dorp Lady Grey tot waar dit verder suid aansluit by die Kraairivier.\\nDie spruit word deur 'n historiese treinspoorlyn gekruis, en die Jan Kemp Vorsterbrug dra die motorverkeer oor die spruit in die rigting van Barkly-Oos, sowat 50 km verder weg."},{"page_url":"https://pt.wikipedia.org/wiki/Homare_Sawa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Homare_Sawa_in_2011.JPG","page_title":"Homare Sawa","context_page_description":"Homare Sawa é uma futebolista do Japão que atua como meia.Defende atualmente o INAC Kobe Leonessa."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D0%B8%D0%B4%D0%B8%D0%BD_%D0%93%D1%80%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/The_base_of_one_of_the_towers_at_Vidin_Grad.JPG","page_title":"Видин Град","context_page_description":"Видин Град је тврђава у Србији која се налази на врху Видојевице, брда изнад села Лешнице, у граду Лозници. Данас је остало врло мало надземних остатака утврђења, који се простиру на платоу, грубих димензија 50 метара у пречнику, смештених на самом врху брда. Од њега, терен се стрмо спушта на све стране, до сувог шанца, који се прстенасто ширио око целе утврде и штитио прилаз ка њој.\\nОстаци бедема, прављеног од притесаног камена, су већим делом покривени растињем, а њихова првобитна дебљина се процењује на око 100 cm. Били су ојачани са барем две куле, чији се остаци могу уочити на терену."},{"page_url":"https://nl.wikipedia.org/wiki/Reuil-sur-Br%C3%AAche","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/71/Map_commune_FR_insee_code_60535.png","page_title":"Reuil-sur-Brêche","context_page_description":"Reuil-sur-Brêche is een gemeente in het Franse departement Oise en telt 206 inwoners. De plaats maakt deel uit van het arrondissement Clermont."},{"page_url":"https://en.wikipedia.org/wiki/Souk_El_Berka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Soukelb.JPG","page_title":"Souk El Berka","context_page_description":"Souk El Berka is one of the souks of the medina of Tunis. The market traders specialize in the jewellery trade."},{"page_url":"https://es.wikipedia.org/wiki/Neder-Betuwe","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Station_Hemmen-Dodewaard1.jpg","page_title":"Neder-Betuwe","context_page_description":"Neder-Betuwe es un municipio de la provincia de Güeldres al este de los Países Bajos. Cuenta con una superficie de 68,16 km² de los que 7,52 km² están ocupados por el agua, y una población de 22.555 habitantes el 1 de enero de 2014, lo que supone una densidad de 373 h/km². Se localiza en la región de la Baja Betuwe, de donde toma el nombre, entre los ríos Rin al norte, Waal al sur y el canal Ámsterdam-Rin al oeste.\\nEl municipio se creó el 1 de enero de 2002 por la fusión de tres antiguos municipios: Dodewaard, Echteld y Kesteren. Inicialmente see denominó Kesteren, pero en abril de 2003 adoptó su actual nombre. Lo forman seis aldeas: Dodewaard, Echteld, Ijzendoorn, Kesteren, Ochten y Opheusden, donde se encuentra el ayuntamiento."},{"page_url":"https://de.wikipedia.org/wiki/Magnis_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/P%C5%99estavlky_%28PR%29%2C_z%C3%A1mek.jpg","page_title":"Magnis (Adelsgeschlecht)","context_page_description":"Die Magnis sind ein ursprünglich aus der Lombardei stammendes, österreichisch-böhmisch-mährisches und schlesisches Adelsgeschlecht. 1622 erreichten sie den Freiherrenstand, am 2. Juni 1637 wurden sie in den Reichsgrafenstand erhoben. Durch ihre Besitzungen in der Grafschaft Glatz gehörten sie ab 1780 auch zum preußischen Adel."},{"page_url":"https://en.wikipedia.org/wiki/2012_German_Masters","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/German_Masters_2012_-_Mike_Ganley.jpg","page_title":"2012 German Masters","context_page_description":"The 2012 PartyPoker.net German Masters was a professional ranking snooker tournament that took place between 1–5 February 2012 at the Tempodrom in Berlin, Germany. This was the first time that PartyPoker.net sponsored the event.\\nMike Dunn made the 79th official maximum break during his round 1 qualifying match against Kurt Maflin. This was Dunn's first 147 break. Stephen Hendry missed the final stage of a ranking event for the first time in 15 years after losing 1–5 to James Wattana in the final qualifying round.\\nMark Williams was the defending champion, but he lost in the quarter-finals 3–5 against Stephen Lee.\\nRonnie O'Sullivan won his 23rd ranking title by defeating Stephen Maguire 9–7 in the final."},{"page_url":"https://en.wikipedia.org/wiki/Landsborough,_Queensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Landsborough_Pub.JPG","page_title":"Landsborough, Queensland","context_page_description":"Landsborough is a town and a locality in the Sunshine Coast Region, Queensland, Australia. In the 2016 census, Landsborough had a population of 3,812 people. The Landsborough railway station provides access to Brisbane, Nambour and Gympie via train and is the major bus transport hub for the coastal regions of the Sunshine Coast."},{"page_url":"https://ro.wikipedia.org/wiki/Cremenciug,_Soroca","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Movila_Casca_Cremenciug_Soroca_%285%29.jpg","page_title":"Cremenciug, Soroca","context_page_description":"Cremenciug este satul de reședință al comunei cu același nume din raionul Soroca, Republica Moldova."},{"page_url":"https://tr.wikipedia.org/wiki/RAD51","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/PDB_1pzn_EBI.jpg","page_title":"RAD51","context_page_description":"RAD51, bir insan genidir, bu genin ürünü olan ve aynı isme sahip olan protein DNA çift iplikçikli kesiklerini tamir eder. Bu protein RAD51 protein ailesinin üyelerinden biridir. RAD51 protein ailesi üyeleri bakteriyel RecA ve maya Rad51 ile homologdur. Protein, mayadan insana kadar çoğu ökaryotta korunmuştur."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1893","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Gyula_Breyer.jpg","page_title":"Lijst van personen geboren in 1893","context_page_description":"Dit is een lijst van personen die geboren zijn in 1893.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/Payyannur_Pavithra_ring","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Payyannur_Sree_Subrahmanya_swamy_Temple_Pond.jpg","page_title":"Payyannur Pavithra ring","context_page_description":"Payyannur Pavithra Mothiram is a kind of gold ring worn by Indians for its ritualistic value. This holy ring is worn during the rituals of pithru bali, or the prayer for the dead ancestors of the person. This ring was traditionally made of Dharba grass. However, the modern Pavithra Mothiram is made of gold. The shape of the ring is unique and it looks like a knot.\\nSilver is also used for making the ring. It is worn on the right ring finger while performing poojas for the dead ancestors."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D0%BD%D1%83%D1%88%D0%B5%D0%B2,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B4%D1%83%D1%85%D0%BE%D0%B2%D0%BD%D0%B0%D1%8F_%D1%81%D0%B5%D0%BC%D0%B8%D0%BD%D0%B0%D1%80%D0%B8%D1%8F.jpg","page_title":"Янушев, Василий Александрович","context_page_description":"Василий Александрович Янушев — православный диакон и педагог, член Общества любителей духовного просвещения, сотрудник «Московских епархиальных ведомостей», которые издавались этим обществом под редакцией священника В. Рождественского."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BF%D0%BE%D1%97%D0%B7%D0%B4_B-Zug","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Austro-DaimlerB-Zug.jpg","page_title":"Автопоїзд B-Zug","context_page_description":"Автопоїзд B-Zug виготовлявся у ході Першої світової війни для Збройних сил Австро-Угорщини компанією Austro-Daimler на базі автопоїздів А-Zug.\\nУ Збройних силах Австро-Угорщини першими у світі 1905 почали розробляти артилерійські тягачі на моторній тязі. На основі досліджень Фердинанд Порше розробив оригінальну конструкцію автопоїзда -- тягач не тягнув за собою навантажені причепи, а кожен з причепів пересувався самостійно за допомогою своїх привідних мотор-коліс.\\nДля транспортування 30,5-см облогових мортир М11 масою 24 т розробили повнопривідний тягач М12 Elektro-Train Daimler-Landwer з електричними фарами і двигуном потужністю 100 к.с. Після початку розробки нових важких облогових артилерійських систем 24-см М16, 38-см М.16, 42-см М14 виникла потреба у розробці автопоїзда для їхнього перевезення. Фердинанд Порше встановив на тягач гібридну силову установку з 6-циліндрового карбюраторного мотору потужністю 150 к.с., робочим об'ємом 20,32 см³ від якого працював генератор постійного струму потужністю 93 кВт. Від генератора приводились два електромотори задніх коліс тягача та задні мотор-колеса чотирьох двовісних причепів, на яких перевозили розібрану на 4 частини гармату."},{"page_url":"https://fi.wikipedia.org/wiki/Nuolukivi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Mineral_stone_for_moose.JPG","page_title":"Nuolukivi","context_page_description":"Nuolukivi on riistalle tai kotieläimille tarkoitettu mineraaleja, suoloja, hivenaineita ja vitamiineja sisältävä \\"kivi\\" eli tavallisesti kuutionmuotinen suolakappale. Eläin saa kiven sisältämiä aineita nuolemalla. Nuolukiviä varustetaan useimmiten Riistaeläimistä hirville, mutta myös kotieläimille ja poroille. Riistaeläimille nuolukivi asetetaan sopivalle korkeudelle, tavallisesti pari metriä korkean tolpan päässä olevaan piikkiin. Nuolukivien ohella suolaa voidaan antaa riistaeläimillekin rakeina eli irtotavarana.\\nEläimet tarvitsevat suolaa hivenainetarpeensa tyydyttämiseen. Nuolukivet ovat mahdollinen keino vähentää eläinten hakeutumista tienvarsille nuolemaan tiesuolaa, samoin voidaan pyrkiä ohjaamaan niitä pois pelloilta ja taimikoilta."},{"page_url":"https://es.wikipedia.org/wiki/Harmotoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Harmotome-266937.jpg","page_title":"Harmotoma","context_page_description":"La harmotoma, también llamada andreolita o ercinita es un mineral de la clase de los tectosilicatos, y dentro de esta pertenece al llamado grupo de la zeolitas. Fue descubierta en 1801 en St. Andreasberg, en Baja Sajonia, proviniendo su nombre del griego, de las palabras \\"harmos\\", que significa \\"conjunta\\", y \\"tomo\\", que significa \\"cortar\\", en alusión a la forma de sus maclas."},{"page_url":"https://pl.wikipedia.org/wiki/Katedra_w_Kolonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Koelner_Dom_Innenraum.jpg","page_title":"Katedra w Kolonii","context_page_description":"Katedra w Kolonii – archikatedra, największy i najważniejszy kościół w niemieckiej Kolonii. W latach 1313 do 1782 świątynia była siedzibą biskupstwa, od 1795 do dziś arcybiskupstwa kolońskiego.\\nBudowa obecnej gotyckiej świątyni rozpoczęła się w 1248 i trwała z przerwami ponad 600 lat do 1880. Usytuowana na miejscu rzymskiej świątyni z IV wieku i późniejszego kościoła z czasów karolińskich nieopodal rzeki Ren katedra kolońska ma 144 m długości i 86 m szerokości oraz wieże o wysokości 157,38 m\\nPo ukończeniu wież katedra była najwyższą budowlą świata do 1884. Jest drugą co do wysokości gotycką budowlą sakralną na świecie i trzecią co do wielkości katedrą świata pod względem powierzchni. Powierzchnia kościoła wraz z wieżami to 7000 m². W 1996 r. katedra została wpisana na listę światowego dziedzictwa UNESCO. Budowla jest wizytówką zarówno Kolonii, jak i całych Niemiec, masowo odwiedzaną przez pielgrzymów i turystów; w 2001 było to blisko 6 mln osób. W 2005 roku katedra była jednym z głównych punktów programu Światowych Dni Młodzieży pod przewodnictwem papieża Benedykta XVI."},{"page_url":"https://hu.wikipedia.org/wiki/Louisiana_korm%C3%A1nyz%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/HueyPLong.jpg","page_title":"Louisiana kormányzóinak listája","context_page_description":"Ez a lista az Amerikai Egyesült Államok Louisiana államának kormányzóit sorolja föl.A spanyol hódítók már a 16. században jártak Louisiana öbleinél, de a buja növényzet miatt nem találták meg a nagy folyó öblét.Hernando de Soto is járt az állam északi részén. Hosszú idő telt el, míg újabb expedíciók megjelentek itt. Először 1682-ben a franciaRené-Robert Cavelier de La Salle hajózott le északról. La Salle engedélyt kapott a francia királytól egy francia település létrehozására, amelyet a „Napkirály” tiszteletére Louisianának nevezett el, de az öböl felől próbálta megközelíteni a szárazföldet. Elvétette a kikötőt, és Texas területén kötött ki. Itt fellázadt legénysége 1687-ben meggyilkolta.\\n1718-ban Jean-Baptiste Le Moyne de Bienville a Mississippi deltájában megalapította Nouvelle-Orléans-t, amely gyors fejlődésnek indult és a francia gyarmat fővárosa lett. A megérkezett francia katonák után hajóval fiatal lányokat küldtek, hogy családot alapítsanak, s növeljék a gyarmati város nagyságát.\\nA vidék sajátos körülmények között fejlődött. A kreolok a francia gyarmatosítók, a karib-tengeri szigetlakók és a spanyolok keverékéből alakult ki. Később a francia gyarmatosítók feketéket hoztak."},{"page_url":"https://en.wikipedia.org/wiki/William_Adams_(pilot)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Blue_Skies_in_Chiloe.jpg","page_title":"William Adams (pilot)","context_page_description":"William Adams, known in Japanese as Miura Anjin, was an English navigator who, in 1600, was the first Englishman to reach Japan during a five-ship expedition for a private Dutch fleet. Of the few survivors of the only ship that reached Japan, Adams and his second mate Jan Joosten were not allowed to leave the country while Jacob Quaeckernaeck and Melchior van Santvoort were to go back to the Dutch Republic to invite them to trade. Adams and Joosten settled in Japan and became two of the first ever Western samurai.\\nSoon after Adams's arrival in Japan, he became a key advisor to the shōgun Tokugawa Ieyasu. Adams directed construction for the shōgun of the first Western-style ships in the country. He was later key to Japan's approving the establishment of trading factories by the Netherlands and England. He was also highly involved in Japan's Red Seal Asian trade, chartering and serving as captain of four expeditions to Southeast Asia. He died in Japan at age 55. He has been recognised as one of the most influential foreigners in Japan during this period."},{"page_url":"https://en.wikipedia.org/wiki/Gaston_Rebry","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Tour_de_France_-_Rebry.JPG","page_title":"Gaston Rebry","context_page_description":"Gaston Rebry was a Belgian former champion road racing cyclist between 1928 and 1935.\\nIn 1934, Rebry became the third of nine riders to win the Tour of Flanders and Paris–Roubaix in the same year; he also won Paris–Nice that year. Rebry won Paris–Roubaix three times. He also won four stages of the Tour de France.\\nHis son, Gaston Rebry, was also a road-racing cyclist in the 1950s but moved to Canada in 1954 to become a landscape painter. He died on January 5, 2007"},{"page_url":"https://de.wikipedia.org/wiki/Willgottheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Woellenheim_StAndr%C3%A9_03.JPG","page_title":"Willgottheim","context_page_description":"Willgottheim ist eine französische Gemeinde mit 1085 Einwohnern im Département Bas-Rhin in der Region Grand Est. Willgottheim liegt im Kochersberg zwischen Landersheim und Neugartheim-Ittlenheim. Am 1. Mai 1972 fusionierte Willgottheim mit der Gemeinde Wœllenheim."},{"page_url":"https://it.wikipedia.org/wiki/Principe_del_sangue","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/CharlesdeBourbonComtedeSoissonCustos.jpg","page_title":"Principe del sangue","context_page_description":"Con il termine principe del sangue si indica qualsiasi discendente legittimo nella linea agnatizia di un monarca, con ciò includendo anche i rami collaterali. Nel contesto storico della monarchia francese, in particolare a partire dal XVI secolo, il titolo di prince du sang acquisì notevole importanza nel processo di accentramento assolutistico. Ai principi del sangue infatti vennero riconosciuti diversi privilegi che crearono un corpo aristocratico strettamente legato alla monarchia e preminente anche rispetto ai pari di Francia."},{"page_url":"https://az.wikipedia.org/wiki/Duqlas_Krokford","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Douglas_Crockford%2C_February_2013.jpg","page_title":"Duqlas Krokford","context_page_description":"Duqlas Krokford — JavaScriptin inkişafı ilə məşğul olan Amerika kompüter proqramçısı və təşəbbüskarıdır. O, məlumat formatını JSON populyarlaşdırdı və JSLint və JSMin kimi müxtəlif JavaScript ilə əlaqəli alətlər hazırladı.Hazırda PayPalda baş JavaScript memarıdır, eyni zamanda JavaScript, JSON və əlaqəli veb texnologiyalar üzrə yazıçı və natiqdir."},{"page_url":"https://de.wikipedia.org/wiki/Krausen_(Solingen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Krausen_Solingen_1.jpg","page_title":"Krausen (Solingen)","context_page_description":"Krausen ist eine Hofschaft im Stadtteil Wald der bergischen Großstadt Solingen."},{"page_url":"https://de.wikipedia.org/wiki/Schwimm-_und_Sprunghalle_Freiberger_Platz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Baustelle_Schwimmhalle_Freiberger_Stra%C3%9Fe_%28November_2015%29.jpg","page_title":"Schwimm- und Sprunghalle Freiberger Platz","context_page_description":"Der Gebäudekomplex Schwimm- und Sprunghalle Freiberger Platz ist die größte Sportanlage in Dresden für Schwimmsport und Wasserspringen. Der Gebäudekomplex am Freiberger Platz Ecke Freiberger Straße besteht aus zwei Schwimmhallen, einer 1964 fertiggestellten Sprunghalle sowie einer 2019 errichteten Sauna. Im Jahr 2008 wurden die Altbauten aus den 1960er Jahren vom Landesamt für Denkmalpflege Sachsen als ein Beispiel für die Nachkriegsmoderne unter Denkmalschutz gestellt. Nach der Berliner Schwimm- und Sprunghalle im Europasportpark ist er der zweitgrößte Schwimmsportkomplex in Deutschland."},{"page_url":"https://ceb.wikipedia.org/wiki/Prairie_Creek_Redwoods_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Prairie_Creek_Redwoods_State_Park.jpg","page_title":"Prairie Creek Redwoods State Park","context_page_description":"Parke ang Prairie Creek Redwoods State Park sa Tinipong Bansa. Ang Prairie Creek Redwoods State Park nahimutang sa kondado sa Humboldt County ug estado sa California, sa kasadpang bahin sa nasod, 4,000 km sa kasadpan sa ulohang dakbayan Washington, D.C. 220 metros ibabaw sa dagat kahaboga ang nahimutangan sa Prairie Creek Redwoods State Park.\\nAng yuta palibot sa Prairie Creek Redwoods State Park kay kabungtoran sa amihang-sidlakan, apan sa habagatang-kasadpan nga kini mao ang patag. Sa kasadpan, dagat ang pinakaduol sa Prairie Creek Redwoods State Park. Dunay mga 2 ka tawo kada kilometro kwadrado sa palibot sa Prairie Creek Redwoods State Park may kaayo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Klamath, 13.3 km sa amihanan sa Prairie Creek Redwoods State Park. Hapit nalukop sa lasang nga dagomkahoy ang palibot sa Prairie Creek Redwoods State Park. Sa rehiyon palibot sa Prairie Creek Redwoods State Park, mga patag talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 10 °C. Ang kinainitan nga bulan Hulyo, sa 17 °C, ug ang kinabugnawan Disyembre, sa 2 °C. Ang kasarangang pag-ulan 1,588 milimetro matag tuig."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB%D0%B5%D1%80%D0%B0%D0%BD%D0%BE_%D1%81%D1%83%D0%BB_%D0%9B%D0%B0%D0%BC%D0%B1%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Salerano_sul_Lambro_piazza_Maggiore.JPG","page_title":"Салерано сул Ламбро","context_page_description":"Салера̀но сул Ла̀мбро е малко градче и община в Северна Италия, провинция Лоди, регион Ломбардия. Разположено е на 77 m надморска височина. Населението на общината е 2695 души."},{"page_url":"https://es.wikipedia.org/wiki/Torneo_de_Ecuador_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/FINAL_ATP_250_%2816292879677%29.jpg","page_title":"Torneo de Ecuador 2015","context_page_description":"El Ecuador Open Quito 2015 es un torneo de tenis que pertenece a la ATP en la categoría de ATP World Tour 250. Será la novena edición del torneo y se disputará del 2 al 8 de febrero de 2015 sobre Tierra Batida en Quito, Ecuador."},{"page_url":"https://es.wikipedia.org/wiki/Juan_Jos%C3%A9_de_la_Cruz","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/JohnJosephoftheCross.jpg","page_title":"Juan José de la Cruz","context_page_description":"San Juan José de la Cruz fue un santo italiano. Es el patrono de la isla de Ischia, el lugar donde nació.\\nNacido como Carlo Gaetano Calosirto, entró a la Orden Franciscana en Nápoles a la edad de 16 años. Tuvo una reputación de austeridad y del don de milagros.\\nEn 1674 fue enviado a fundar un monasterio en Afila, Piamonte, donde asistió en la construcción del mismo. Fue ordenado sacerdote, y como superior, realizó las tareas más modestas en la comunidad monástica. En 1702 fue designado Vicario Provincial de la Reforma Alcantarina en Italia."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BB%D1%83%D0%BD%D1%81%D0%BA%D0%B8_%D0%B7%D0%B0%D0%BB%D0%B8%D0%B2","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Golfo_de_Tesalonica_1.jpg","page_title":"Солунски залив","context_page_description":"Солунският залив е най-големият залив на Егейско море, разположен южно от ном Солун, източно от ном Пиерия и ном Иматия, западно от ном Халкидики. Гръцкото наименование произхожда от името на древния град Терма, който се е намирал по крайбрежието на залива. Град Терма по-късно е преименуван на Тесалоники. Дължината на залива е 100 км, а широчината му е 5 км близо до Солун, около 15 км на север и около 50 км на юг.\\nПо време на Римската империя заливът е известен като Thermaicus или Thermaeus sinus, Залив Терма, Macedonicus sinus, Македонски залив.\\nГрадове, разположени около залива са Касандрия, древният Потидея, Неа Мудания, Агия Триада, Неи Епиватес, Переа, Солун, Гъскарка, Метони, Пидна, Паралия, Олимпиаки Акти. По-големите реки, които вливат водите си в залива са Пеней, Бистрица, Караазмак, Вардар и Галик. По крайбрежието са разположени множество плажове, като в северната част има доста мочурливи места.\\nПиерийската равнина обгражда залива на север, а на изток и югоизток преобладават планини и възвишения. Множество пристанища са разположени по протежението на залива, като най-голямото е това на Солун."},{"page_url":"https://de.wikipedia.org/wiki/Neuwiedermu%C3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Neuwiedermuss_Bild_1.jpg","page_title":"Neuwiedermuß","context_page_description":"Neuwiedermuß ist ein Ortsteil der Gemeinde Ronneburg im Main-Kinzig-Kreis in Hessen.\\nNeuwiedermuß liegt im Ronneburger Hügelland am Fallbach. Die Gemarkung umfasste vor der Gebietsreform 185 ha Fläche, davon waren 23 ha Wald."},{"page_url":"https://id.wikipedia.org/wiki/Juan_de_Borb%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/J._de_Borb%C3%B3n.jpg","page_title":"Juan de Borbón","context_page_description":"Infante Juan dari Spanyol, Count Barcelona, adalah anak ketiga dan pewaris takhta dari Raja Alfonso XIII dari Spanyol dan Victoria Eugenie dari Battenberg. Ayahnya dikudeta melalui Republik Spanyol Kedua, dan berkat anaknya, Juan Carlos I, monarki berhasil dikembalikan. Sebagai Raja Spanyol ia bergelar Juan III."},{"page_url":"https://nl.wikipedia.org/wiki/Charles_Howard_Hodges","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Charles_Howard_Hodges_selfportrait_1835_RIJK_SK-A-1047.jpg","page_title":"Charles Howard Hodges","context_page_description":"Charles Howard Hodges was een in Engeland geboren kunstenaar die in Nederland carrière maakte nadat hij in zijn geboorteland een 'wonderkind' was geweest. In 1788 reisde hij naar Amsterdam en woonde bij Johann Friedrich August Tischbein op de Keizersgracht.\\nNa een tweejarig verblijf in Dublin vestigde hij zich in 1792 in 's-Gravenhage. In deze stad en in Amsterdam, waar hij veel werkte, maakte hij \\"zwartekunstprenten\\" of mezzotinten van Engelse schilderstukken. In 1797 verhuisde hij met zijn gezin naar Amsterdam, waar hij zich ontwikkelde tot een veelgevraagd portretschilder in de stijl van Tischbein. Hij was ook graveur, tekenaar, uitgever, kunsthandelaar en lid van het gezelschap Felix Meritis.\\nHodges schilderde de vijf leiders van de achtereenvolgende Nederlandse politieke systemen: stadhouder Willem V van de Republiek der Verenigde Nederlanden, Raadpensionaris Rutger Jan Schimmelpenninck van de Bataafsche Republiek, Koning Lodewijk Napoleon, keizer Napoleon Bonaparte en koning Willem I der Nederlanden. Hij schilderde ook talloze portretten van Nederlandse edellieden en patriciërs. Het enige bekende portret van Sebald Justinus Brugmans is ook van zijn hand."},{"page_url":"https://en.wikipedia.org/wiki/HM_Prison_Pentonville","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Pentonville_Prison-10644057415.jpg","page_title":"HM Prison Pentonville","context_page_description":"HM Prison Pentonville is an English Category B men's prison, operated by Her Majesty's Prison Service. Pentonville Prison is not in Pentonville, but is located further north, on the Caledonian Road in the Barnsbury area of the London Borough of Islington, north London. In 2015 the justice secretary, Michael Gove, described Pentonville as “the most dramatic example of failure” within the prisons estate."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Stewart_(bishop)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Charles_James_Stewart.jpg","page_title":"Charles Stewart (bishop)","context_page_description":"Charles James Stewart was an English Church of England, clergyman, bishop, and politician. He was the second Bishop of Quebec from 1826 to 1837, and in connection with this was appointed to the Legislative Council of Lower Canada.\\nBorn in London, England, the third surviving son of John Stewart, 7th Earl of Galloway, and his second wife, Anne Dashwood, Stewart was a member of Corpus Christi College, Oxford when he graduated Bachelor of Arts in 1795 and a fellow of All Souls College, Oxford when this matured to an M.A. in 1799. He was ordained to the Anglican ministry in the diaconate in December 1798 and to the priesthood in May 1799. From 1799 to 1826, he was Rector of Orton Longueville in Cambridgeshire. In 1807, he arrived in Lower Canada as a missionary, settling in Montreal. He soon moved to Saint-Armand and helped to build Trinity Church, Frelighsburg, the first regular place of Anglican worship in the Eastern Townships. In 1826, he was appointed Bishop of Quebec. He died in London in 1837, and is buried there in Kensal Green Cemetery."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%8A%E5%8C%97%E6%BE%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Kamikitazawa.jpg","page_title":"上北澤","context_page_description":"上北泽是东京都世田谷区的町名。已实施住居表示。现行行政地名为上北泽一丁目至五丁目。2013年9月1日为止的人口有15,151人。邮递区号156-0057。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wiener_Parks_und_Gartenanlagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Wien_14_Ludwig-Zatzka-Park_c.jpg","page_title":"Liste der Wiener Parks und Gartenanlagen","context_page_description":"Dies ist eine Liste von Parks und Gartenanlagen in Wien, sofern sie einen Namen tragen:"},{"page_url":"https://ko.wikipedia.org/wiki/%ED%85%8C%EC%9D%B4%ED%94%84_%EB%A0%88%EC%BD%94%EB%8D%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/RadioShack-ctr-119.jpg","page_title":"테이프 레코더","context_page_description":"테이프 레코더 또는 테이프 녹음기는 자기테이프에 소리를 저장하고 재생하는 시스템을 말한다. 스테레오 테이프는 두 개의 녹음 트랙을 사용하는 등 기구적으로 레코드보다 단순하다."},{"page_url":"https://fr.wikipedia.org/wiki/Racing_Club_de_Lens","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Supportering_%28mus%C3%A9e_national_du_sport%29.jpg","page_title":"Racing Club de Lens","context_page_description":"Le Racing Club de Lens, couramment abrégé en RCL ou RC Lens, est un club de football français basé à Lens, dans le Pas-de-Calais, en France.\\nLe club est fondé en 1906, sous le nom de Racing Club Lensois. Aujourd’hui, le club compte deux titres nationaux majeures à son palmarès, un championnat de France en 1998 et une Coupe de la Ligue en 1999. Au niveau européen, le club se hisse à deux reprises en Ligue des Champions lors des saisons 1998-1999 et 2002-2003, et atteint les demi-finales de la Coupe de l'UEFA en 2000 avant de remporter une Coupe Intertoto en 2005.\\nLe club artésien se distingue en étant un club fortement présent en première division française puisqu’il compte 58 saisons au sein de l’élite."},{"page_url":"https://fr.wikipedia.org/wiki/Alstonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Alstonia_scholaris_Blanco1.113-cropped.jpg","page_title":"Alstonia","context_page_description":"Alstonia est un genre de plantes eudicotylédones de la famille des Apocynacées."},{"page_url":"https://ast.wikipedia.org/wiki/Mar%C3%ADa_N%C3%BA%C3%B1ez","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Mar%C3%ADa_N%C3%BA%C3%B1ez%2C_2018.jpg","page_title":"María Núñez","context_page_description":"María Núñez Nistal ye una xugadora profesional de balonmano española. Actúa como pivós y anguaño xuega nel YE Besançon de la Lliga francesa de balonmano.\\nYe internacional cola selección española, cola que llogró la medaya de plata nel Européu d'Hungría y Croacia 2014."},{"page_url":"https://it.wikipedia.org/wiki/Simone_Catalano","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Relitto_del_BR20%2C_da_sopra.jpg","page_title":"Simone Catalano","context_page_description":"Simone Catalano è stato un ufficiale e aviatore italiano, decorato di Medaglia d'oro al valor militare alla memoria nel corso della seconda guerra mondiale. Decorato anche di una Medaglia d'argento e una di bronzo al valor militare."},{"page_url":"https://es.wikipedia.org/wiki/Palouse_(Washington)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Palouse_City_Flag.jpg","page_title":"Palouse (Washington)","context_page_description":"Palouse es una ciudad ubicada en el condado de Whitman en el estado estadounidense de Washington. En el año 2000 tenía una población de 1.011 habitantes y una densidad poblacional de 364,8 personas por km².​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B6%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Hotel_Rzhev.jpg","page_title":"Ржев","context_page_description":"Ржев — город в России, административный центр Ржевского района Тверской области. Образует городской округ город Ржев. Город воинской славы России. Население — 59 422 чел., площадь города — 56,17 км²."},{"page_url":"https://en.wikipedia.org/wiki/J30_Protests","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/The_march.jpg","page_title":"J30 Protests","context_page_description":"The J30 Protests were a one-day strike held in the United Kingdom on 30 June 2011. The strike was held by public sector workers in an effort to protest the government's planned uncoventional changes to pension plans and retirement policies, including raising the retirement age from 60 to 66 and the replacing of final salary pension schemes with a career-average system. The Driving Standards Agency had recently announced that it was to launch a localised trial to determine whether delivering examiners from non-established test centres could help with growing pupil demand, starting in Warrington, Wiltshire, Ayrshire, Wales and Dumbarton.\\nIn the one-day strike, pickets and a series of anti-cuts rallies by the National Union of Teachers, Association of Teachers and Lecturers, University and College Union and the Public and Commercial Services Union went ahead largely as planned. Over 11,000 schools in England were affected by the strike, according to the data released by the Department for Education. Nearly 400 schools were closed in greater Birmingham and the Black Country, with another 70 partially shut."},{"page_url":"https://en.wikipedia.org/wiki/Neil_Oram","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Spring-Again_%282006%29-_Neil_Oram.jpg","page_title":"Neil Oram","context_page_description":"Neil Oram is a British musician, poet, artist and playwright, best known as the author of The Warp, a 10 play cycle, directed by Ken Campbell."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9E%D0%B3%D1%8E%D1%81%D1%82_%D0%9A%D1%83%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/La_mort_du_g%C3%A9n%C3%A9ral_Moreau-Auguste_Couder_mg_8219.jpg","page_title":"Огюст Куде","context_page_description":"Луи-Шарл-Огюст Куде или Огюст Куде е френски живописец, роден в Париж на 1 април 1790, починал на 21 юли 1873, погребан в гробището Пер Лашез. Той е ученик на Жан-Батист Рено и Жак-Луи Давид."},{"page_url":"https://pt.wikipedia.org/wiki/Carrinho_de_beb%C3%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Bundesarchiv_Bild_183-D0904-0008-005%2C_Schwedt%2C_Blick_vor_die_Kaufhalle.jpg","page_title":"Carrinho de bebê","context_page_description":"Carrinho de bebê ou carrinho de bebé é um veículo sobre rodas, utilizado para transportar crianças. A criança geralmente fica sentada com o rosto voltado para a frente, porém existem carrinhos para recém-nascidos, nos quais o bebê permanece deitado, ou sentado com apoio, virado para a pessoa que empurra. Algumas versões mais modernas podem ser configuradas para carregar tanto um bebê deitado como a criança sentada. Há também uma variedade de carrinhos duplos, que permitem carregar duas crianças ao mesmo tempo, podendo ser para gêmeos ou para crianças de idades diferentes."},{"page_url":"https://en.wikipedia.org/wiki/Adelaide_I,_Abbess_of_Quedlinburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Hase_Quast_1877_S_10_Nr_1_Adelheid_I.jpg","page_title":"Adelaide I, Abbess of Quedlinburg","context_page_description":"Adelaide I, a member of the royal Ottonian dynasty was the second Princess-abbess of Quedlinburg from 999, and Abbess of Gernrode from 1014, and Abbess of Gandersheim from 1039 until her death, as well as a highly influential kingmaker of medieval Germany."},{"page_url":"https://de.wikipedia.org/wiki/Steinkohlenwerk_Karl_Marx","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Bundesarchiv_Bild_183-71107-0002%2C_Zwickau%2C_Rettung_von_Bergleuten.jpg","page_title":"Steinkohlenwerk Karl Marx","context_page_description":"Der VEB Steinkohlenwerk Karl Marx war ein Bergbauunternehmen auf Steinkohle in Zwickau, Sachsen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BB%D0%BB%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Sarawak_24.jpg","page_title":"Доллар","context_page_description":"До́ллар — название валют множества стран мира, включающих Австралию, Белиз, Канаду, Новую Зеландию, Намибию, Сингапур, Синт-Эстатиус, Сабу, Восточный Тимор, Пуэрто-Рико, Панаму, Палау, Бруней, Бонэйр, Британские Виргинские острова, Багамские Острова, Бермудские Острова, Маршалловы Острова, Соломоновы Острова, Соединённые Штаты Америки, Сальвадор, Эквадор, Тайвань, Гонконг, Зимбабве, Фиджи, Федеративные Штаты Микронезии, Теркс и Кайкос, Ямайку и ряд других стран. Один доллар, как правило, равен 100 центам."},{"page_url":"https://it.wikipedia.org/wiki/Boyfriend_(Ariana_Grande_e_Social_House)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/BoyfriendArianaGrandeLogo.jpg","page_title":"Boyfriend (Ariana Grande e Social House)","context_page_description":"Boyfriend è un singolo della cantante statunitense Ariana Grande e del gruppo musicale statunitense Social House, pubblicato il 2 agosto 2019 come secondo estratto dal primo EP dei Social House Everything Changed...."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D9%88%D8%B1%D8%A7%D8%B3_%D9%85%D8%A7%D9%8A%D9%86%D8%A7%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Horace_Maynard_-_Brady-Handy.jpg","page_title":"هوراس ماينارد","context_page_description":"هوراس ماينارد ‏ هو معلم ومحامي وسياسي ودبلوماسي أمريكيًا كان نشطًا في في النصف الثاني من القرن التاسع عشر. تم انتخاب ماينارد في البداية في مجلس النواب الأمريكي عن مقاطعة الكونغرس الثانية في تينيسي في عام 1857، وكان أحد قلائل النواب الجنوبيين الذين حافظوا على مقعدهم في مجلس النواب خلال الحرب الأهلية. عمل ماينارد بعد نهاية الحرب في منصب النائب العام لولاية تينيسي في عهد الحاكم أندرو جونسون، وعمل فيما بعد سفيراً للبلاد في تركيا في عهد الرئيس يوليسيس غرانت ومدير عام خدمة البريد في عهد الرئيس رذرفورد هايز.\\nترك ماينارد منصبه التدريسي في كلية إيست تينيسي في أوائل الأربعينيات من القرن التاسع عشر لبدأ عمله في القانون، وسرعان ما كوّن سمعة بين أقرانه بتحليله المنطقي وأسلوبه الساخر. قضى معظم فترة ولايته الأولى في الكونغرس وهو يطالب بالمحافظة على الاتحاد، وظل يحث الرئيس أبراهام لينكون خلال الحرب على إرسال قوات الاتحاد لتحرير شرق تينيسي من محتليها الكونفدراليين. عاد ماينارد إلى الكونغرس بعد الحرب، لكنه عانى لينتصر في انتخابات الولاية بما أنه كان جمهوريًا في ولاية يسيطر عليها الديمقراطيون."},{"page_url":"https://da.wikipedia.org/wiki/Elektronik_eksperimentalplade","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Insidebreadboard_%283%29.jpg","page_title":"Elektronik eksperimentalplade","context_page_description":"Et elektronik eksperimentalplade eller bedre kendt under øgenavnet fumlebræt er en konstruktionsbase til at lave prototyper af elektroniske kredsløb. Termen anvendes mest til at referere til lodningsløse eksperimentalplader.\\nFordi den lodningsløse eksperimental-plade ikke behøver lodning, kan pladen og komponenter genanvendes. Dette gør det let at konstruere midlertidige prototyper og eksperimentere med kredsløbsdesign. Ældre fumlebrædder havde ikke denne egenskab. Et modulprint eller hulprint og lignende prototype printplader, anvendes til at konstruere permanente loddede prototyper, som er svære at genanvende. En mangfoldighed af elektroniksystemer kan konstrueres som prototyper ved at anvende fumlebrædder, fra små analoge og digitale kredsløb til komplette diskret opbyggede CPUer."},{"page_url":"https://da.wikipedia.org/wiki/%C3%86rteblomst-familien","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Albizia_julibrissin_Ab-02.jpg","page_title":"Ærteblomst-familien","context_page_description":"Ærteblomstfamilien er urter, buske eller træer. Bladene er spredte, ofte med fodflige og sammensatte. Blomsterne er uregelmæssige. De er samlet i aks, klaser eller hoveder. Frugterne er bælge med få til mange frø. Planterne har symbiose med knoldbakterier.\\nCaesalpinioideae\\nBrasiltræslægten\\nJohannesbrødslægten\\nJudastræ\\nTretorn\\nMimosoideae\\nAkacie\\nAlbizia\\nMimose\\nFaboideae\\nAdamguldregn\\nAspalathus\\nAstragel\\nBlærebælg\\nBlåregn\\nBukkehorn\\nBønne – bønnearter fra Nord- og Sydamerika\\nBønne – bønnearter fra Europa, Asien og Afrika\\nDerris\\nDværggyvel\\nEsparsette\\nFladbælg\\nFugleklo\\nGuldregn\\nGyvel\\nGyvel\\nHanekløver\\nHestesko\\nIndigoslægten\\nKantbælg – gammelt navn, se under Kællingetand\\nKikært-slægten\\nKladrastis\\nKløver\\nKløverbusk\\nKrageklo\\nKronvikke\\nKronvikke\\nKællingetand\\nLakrids-slægten\\nLinse-slægten\\nLupin\\nMaackia\\nMaramabønne-slægten\\nPagodetræslægten\\nPerlebælg\\nPetteria\\nRobinie\\nRundbælg\\nSneglebælg\\nSophora\\nSpartium\\nSpidsbælg\\nStenkløver\\nStregbælg\\nSærkrone\\nTornblad\\nTorngyvel\\nVikke\\nVisse\\nÆrt\\nÆrtetræ"},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D9%85%D8%A8%D8%B1%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Parish_Church_of_St_Peter_and_St_Paul%2C_Syston%2C_Leicestershire_-_geograph.org.uk_-_1341932.jpg","page_title":"کمبرلی","context_page_description":"کمبرلی بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 37916 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://ga.wikipedia.org/wiki/Tarbh-bhrocaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bull_terrier_2.jpg","page_title":"Tarbh-bhrocaire","context_page_description":"Is pór madra é an tarbh-bhrocaire a saothraíodh sa Bhreatain le haghaidh gríosú tarbh, trí chros-síolrú tarbhghadhar le brocairí. An cholainn cumasach, an t-eireaball fada, na cluasa biorach díreach in airde, an ceann leathan le súile beaga, an fionnadh gearr. An tarbh-bhrocaire Sasanach bán de ghnáth, tarbh-bhrocaire Staffordshire scothdhearg/buídhonn de ghnáth. Ó timpealll 1980 tá an tarbh-bhrocaire Meiriceánach ag tarraingt aire an phobail as ionsaithe ar pháistí is daoine fásta, ionsaithe marfacha uaireanta. I gcuid mhaith tíortha tá rialacháin is srianta orthu.\\nIs síol ainmhí é an t-alt seo. Cuir leis, chun cuidiú leis an Vicipéid.\\nMá tá alt níos forbartha le fáil i dteanga eile, is féidir leat aistriúchán Gaeilge a dhéanamh."},{"page_url":"https://es.wikipedia.org/wiki/Miami","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Miami_skyline_20080328.jpg","page_title":"Miami","context_page_description":"Miami​ ​ es una ciudad-puerto ubicada en el sureste de Florida, Estados Unidos, alrededor del río Miami, entre los Everglades y el océano Atlántico. Es la sede del condado de Miami-Dade, y por tanto, la principal, más céntrica y más poblada ciudad del Área Metropolitana de Miami. Fue fundada el 28 de julio de 1896 y según el censo de 2014 cuenta con una población de 417.650; su área metropolitana engloba a más de 5,4 millones de habitantes, lo que la convierte en la séptima más grande de los Estados Unidos.​ Las Naciones Unidas han calculado que Miami se convirtió en la novena área metropolitana más grande del país, detrás de Nueva York, Los Ángeles, Chicago, Dallas, Houston, Washington D. C., Filadelfia, Boston y San Francisco.​\\nEs considerada una ciudad global de importancia en las finanzas, el comercio, los medios de comunicación, entretenimiento, artes y comercio internacional.​ Es sede de numerosas oficinas centrales de compañías, bancos y estudios de televisión. Es, también, centro internacional del entretenimiento popular en televisión, música, moda, cine y artes escénicas."},{"page_url":"https://es.wikipedia.org/wiki/Claude_Esteban","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Claude_Esteban_en_2003.jpg","page_title":"Claude Esteban","context_page_description":"Claude Esteban fue un poeta y ensayista francés.\\nNacido en París de padre español y de madre francesa, dividido entre dos idiomas, Claude Esteban fue el autor de una obra poética destacada en los últimos decenios del siglo XX y a principios de este siglo. Escribió también numerosos ensayos sobre poesía y lenguaje y fue el traductor al francés de algunos grandes poetas de lengua española, como Jorge Guillén, Octavio Paz, Borges, García Lorca, César Vallejo, Quevedo y Góngora. Publicó muchos ensayos sobre arte, artistas modernos, pero también sobre pintores antiguos. En 1973, fue el fundador de la revista de poesía y arte Argile, publicada por Maeght."},{"page_url":"https://pl.wikipedia.org/wiki/Peleas_i_Melisanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Edmund_Blair_Leighton_-_Pelleas_and_Melisande.jpg","page_title":"Peleas i Melisanda","context_page_description":"Peleas i Melisanda – dramat Maurice'a Maeterlincka powstały w 1892. Był inspiracją dla różnych utworów muzycznych pod tym samym tytułem, m.in. opery Peleas i Melisanda Claude’a Debussy'ego, poematu symfonicznego A. Schoenberga i suity C. Faurégo."},{"page_url":"https://pl.wikipedia.org/wiki/Miss_Universe_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Demi_Leigh-Nel_Peters_in_2018.jpg","page_title":"Miss Universe 2017","context_page_description":"Miss Universe 2017 – 66. wybory Miss Universe. Gala finałowa odbyła się 26 listopada 2017 w The AXIS w Las Vegas, Stany Zjednoczone. Miss Universe została reprezentantka Południowej Afryki Demi-Leigh Nel-Peters."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%D1%8A%D0%B5%D0%BA%D1%82%D0%BE%D0%B2_%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D1%8F_%D0%A1%D0%B0%D1%80%D0%B0%D1%82%D0%BE%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%D0%94%D0%BE%D0%BC_%D0%9F%D0%BE%D0%B4%D0%BA%D0%BB%D0%B5%D1%82%D0%BD%D0%BE%D0%B2%D0%BE%D0%B9_%D1%82%D0%B0%D0%B1%D0%BB%D0%B8%D1%87%D0%BA%D0%B0.jpg","page_title":"Список объектов культурного наследия Саратова","context_page_description":"В Саратове имеются Объекты культурного наследия всех уровней: федерального, регионального и местного значения. Каждый список проиллюстрирован фотографиями и открывается отдельно.\\nВ связи с тем, что с 2016 года ведётся активная работа по включению в эти списки выявленных объектов культурного наследия, а также уточнение границ, охранных зон и предмета охраны существующих ОКН, список может не отражать новейших изменений."},{"page_url":"https://lb.wikipedia.org/wiki/Bamkabes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Caldo_verde_-_Jul_2008.jpg","page_title":"Bamkabes","context_page_description":"De Bamkabes, Brassica oleracea var. viridis L, ass eng Zuuchtvarietéit vum Geméiskabes, déi als Geméis an als Fudderplanz virun Allem op der atlantescher Westküst vun Europa ugebaut gëtt.\\nMat de Blieder vum Bamkabes a mat Grompere gëtt dat portugisescht Nationalrezept Caldo verde gekacht, eng einfach Zopp, déi e bësse batter schmaacht. Dat erkläert, firwat een de Bamkabes a ville Geméisgäert uechter Lëtzebuerg erbléckst.\\nDe Bamkabes ass méijäreg, all Joer wuessen nei Blieder am ieweschte Beräich vum Stronk, dee mat de Joren ëmmer méi haart gëtt. Déi ënnescht Blieder ginn no an no als Geméis benotzt, sou datt d'Planz mat de Joren aus engem plakege Stronk mat engem \\"Kabesbliederpinsel\\" um Enn besteet.\\nEng nach méi grouss Variant vum Bamkabes gëtt als Jersey-Kabes op de Kanalinsele gezillt. Aus den 1,8 bis 3m héije Kabesstämm goufen uganks des 20. Joerhonnert am grousse Stil Wanderbengele produzéiert, bis zu 30.000 Stéck am Joer. D'Strénk sinn och nach als Gespär oder als Zonkmaterial benotzt ginn."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B9%D0%BB%D0%B5%D0%BD%D0%B4-%D1%80%D0%B8%D0%B7%D0%BE%D1%80%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Island_Resort_0503.jpg","page_title":"Айленд-ризорт","context_page_description":"Айленд-ризорт — высотный жилой комплекс, расположенный в Гонконге, в округе Истерн, в районе Сиусайвань. Состоит из четырёх 60-этажных башен, двух подземных этажей, автобусной станции, паркинга, торговых помещений, ресторанов и бассейнов. Построен в 2001 году в стиле постмодернизма. Земля под комплекс была продана властями в 1997 году на пике рынка недвижимости за более чем 1,5 млрд долларов США. Всего компания Sino Group инвестировала в этот проект почти 2,6 млрд долларов США."},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%82ac_na_Szlaku_w_Krakowie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Na_Szlaku_Manor%2C_Krakow%2C_71_Szlak_street%2C_Krakow%2C_Poland.jpg","page_title":"Pałac na Szlaku w Krakowie","context_page_description":"Pałac na Szlaku – pałac mieszczący się przy ulicy Szlak w Krakowie. Dawna siedziba Radia Kraków. Zabytkowy, jednopiętrowy, eklektyczny budynek z portykiem balkonowym zbudowany w 1878 według projektu Antoniego Łuszczkiewicza. Kolejnymi właścicielami pałacu byli m.in. jezuici, rodzina Badenich, rodzina Tarnowskich, księża salwatorianie i Wyższa Szkoła Europejska im. ks. Józefa Tischnera w Krakowie."},{"page_url":"https://en.wikipedia.org/wiki/Sintra","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Sintra_-_Palacio_da_Pena_%2820332995770%29_%28cropped2%29.jpg","page_title":"Sintra","context_page_description":"Sintra is a town and municipality in the Greater Lisbon region of Portugal, located on the Portuguese Riviera. The population of the municipality in 2011 was 377,835, in an area of 319.23 square kilometres. Sintra is a major tourist destination in Portugal, famed for its picturesqueness and for its numerous historic palaces and castles. Sintra is also a major luxury dining and tourism destination within the Portuguese Riviera, as well as one of the wealthiest municipalities in the country, and is known for the numerous notable events hosted in Sintra, such as Bilderberg Meetings and the Open de Portugal.\\nThe historic center of the Vila de Sintra is famous for its 19th-century Romanticist architecture, historic estates & villas, gardens, and numerous royal palaces & castles, which resulted in the classification of the town and its historic passage as a UNESCO World Heritage Site. Sintra is similarly known for its numerous gardens and nature parks, including the Sintra-Cascais Nature Park and the Sintra Mountains. Sintra's landmarks include the mediaeval Castle of the Moors, the romanticist Pena National Palace and the Portuguese Renaissance Sintra National Palace."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%B9%E0%B0%BF%E0%B0%AE_%E0%B0%B8%E0%B0%82%E0%B0%AA%E0%B0%BE%E0%B0%A4%E0%B0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Mount_Windsor_Cornice2.jpg","page_title":"హిమ సంపాతం","context_page_description":"హిమ సంపాతం అనగా అకస్మాత్తుగా మంచు పెళ్ళలు వేగంగా కొండల మీద నుండి జారిపడడం. మంచుతో సహా గాలి, నీరు కూడా కలిసుంటాయి.\\nశక్తివంతమైన హిమ సంపాతాలు వాటి మార్గంలోని వృక్షాలు, గ్రామాలు మొదలైన వాటిని నాశనం చేస్తాయి. ఇవి ఎల్లప్పుడు మంచుతో కప్పబడిన పర్వత ప్రాంతాలలోనే సంభవిస్తాయి. అంటే హిమాలయాలు, ఏండిస్ మొదలైన ప్రదేశాలు. ఇలాంటి ప్రాంతాలలో అపారమైన ఆస్తి, జీవరాశుల నష్టం కలిగించే భయంకరమైన ప్రకృతి వైపరీత్యాలలో ఇది ప్రధానమైనది."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%86%DB%8C%D9%86%DA%AF%DA%A9%D8%A4_%DA%A9%D8%A7%D8%A4%D9%86%D9%B9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/%E5%9F%8E%E5%8F%A3%E5%8E%BF4ChengKouXian2012_-_panoramio.jpg","page_title":"چینگکؤ کاؤنٹی","context_page_description":"چینگکؤ کاؤنٹی چین کا ایک عوامی جمہوریہ چین کی کاؤنٹیاں جو چونگ چنگ میں واقع ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/HMS_Iris","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Hermione-Iris-EZ53lq6XkAA4s-b.jpeg","page_title":"HMS Iris","context_page_description":"Eight ships of the Royal Navy have been named HMS Iris after the Greek mythological figure Iris or after the flower by that name. A ninth was planned but renamed before entering service:\\nHMS Iris was a 28-gun sixth rate, formerly the American USS Hancock. The British captured Hancock in 1777 and renamed her Iris, but lost her to the French in 1781, who sold her in 1784.\\nHMS Iris was a 32-gun fifth rate launched in 1783. The Navy lent her to Trinity House in 1803, but reclaimed and refitted her in 1805. She was renamed HMS Solebay in 1809 and was broken up in 1833.\\nHMS Iris was a 44-gun fifth rate, formerly the Danish Marie. She was captured in 1807 and sold in 1816.\\nHMS Iris was a 26-gun sixth rate launched in 1840 and sold in 1869.\\nHMS Iris was an Iris-class second class cruiser launched in 1877 and sold in 1905.\\nHMS Iris was an Acacia-class sloop launched in 1915 and sold in 1920.\\nHMS Iris II was a river ferry acquired by the Royal Navy for use in the Zeebrugge Raid.\\nHMS Iris was a railway ferry converted to a \\"Landing Ship Sternchute\\"\\nHMS Iris was to have been a Flower-class corvette."},{"page_url":"https://de.wikipedia.org/wiki/Tasch_Hauli","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Harem_Tasch_Hauli.jpg","page_title":"Tasch Hauli","context_page_description":"Tasch Hauli ist ein Palast im Osten Ichan Qalʼаs, der zum UNESCO-Welterbe zählenden historischen Altstadt Chiwas. Er wurde in der ersten Hälfte des 19. Jahrhunderts gebaut."},{"page_url":"https://es.wikipedia.org/wiki/Gymnop%C3%A9dies","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Sati_e.gymnop%C3%A9die.01.0003-0010.svg","page_title":"Gymnopédies","context_page_description":"Las Gymnopédies son tres obras para piano compuestas por Erik Satie y publicadas en París en 1888. Estas piezas junto a Trois sarabandes y las Gnossiennes suelen clasificarse como danzas.\\nUn gran número de producciones cinematográficas, televisivas e incluso videojuegos han incluido alguna o varias gymnopédies dentro de su banda sonora. Asimismo diversos artistas musicales han hecho sus propias versiones y adaptaciones de estas obras."},{"page_url":"https://en.wikipedia.org/wiki/Pacific_Northwest","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Cannon_Beach_%284947305591%29.jpg","page_title":"Pacific Northwest","context_page_description":"The Pacific Northwest, sometimes referred to as Cascadia, is a geographic region in western North America bounded by the Pacific Ocean to the west and by the Rocky Mountains on the east. Though no official boundary exists, the most common conception includes the Canadian province of British Columbia and the U.S. states of Idaho, Oregon, and Washington. Broader conceptions reach north into Southeast Alaska and Yukon, south into northern California, and east to the Continental Divide to include Western Montana and parts of Wyoming. Narrower conceptions may be limited to the coastal areas west of the Cascade and Coast mountains. The variety of definitions can be attributed to partially overlapping commonalities of the region's history, culture, geography, society, and other factors.\\nThe Northwest Coast is the coastal region of the Pacific Northwest, and the Northwest Plateau is the inland region. The term \\"Pacific Northwest\\" should not be confused with the Northwest Territory or the Northwest Territories of Canada."},{"page_url":"https://vi.wikipedia.org/wiki/Mary_c%E1%BB%A7a_Burgundy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Isabella_of_Spain_Denmark.jpg","page_title":"Mary của Burgundy","context_page_description":"Mary của Burgundy, là một nữ quân chủ của tập đoàn lãnh địa thuộc Burgundy. Sau cái chết của cha mình là Charles el Temerario, bà cai trị một lãnh thổ rộng lớn dưới triều đại Burgundy, hiện nay là phần lớn nước Pháp."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B5%D0%B3%D0%B1%D0%B5%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Wegberg%2C_Ensemble.JPG","page_title":"Вегберг","context_page_description":"Вегберг — місто в Німеччині, знаходиться в землі Північний Рейн-Вестфалія. Підпорядковується адміністративному округу Кельн. Входить до складу району Гайнсберг.\\nПлоща — 84 км². Населення становить 27 921 ос."},{"page_url":"https://sw.wikipedia.org/wiki/Mkoa_wa_H%C3%A0_Nam","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Ha_Nam_in_Vietnam.svg","page_title":"Mkoa wa Hà Nam","context_page_description":"Hà Nam ni mkoa wa Vietnam. Mji mkuu ni Phủ Lý. Eneo lake ni 823.1 km². Mwaka 2009 wakazi 784,045 walihesabiwa."},{"page_url":"https://ca.wikipedia.org/wiki/Pagoda_Liuhe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Liuhe_Pagoda_in_Hangzhou%2C_2015-03-01_37.jpg","page_title":"Pagoda Liuhe","context_page_description":"La Pagoda Liuhe, literalment Pagoda de les Sis Harmonies o Torre de les Sis Harmonies, és una pagoda xinesa de diversos pisos d'altura, situada al sud de la ciutat de Hangzhou, província de Zhejiang, a la Xina. Es troba als peus del Pujol Yuelun i enfront del riu Qiantang. Va ser construïda originalment l'any 970 dC durant la Dinastia Song del Nord, destruïda el 1121 i reconstruïda sencera cap el 1165, durant la Dinastia Song del Sud.\\nÉs patrimoni de la República Popular Xinesa i, el 24 de juny de 2011, aquest i d'altres elements que conformen l'anomenat «paisatge cultural del Llac de l'Oest a Hangzhou» varen ser declarats Patrimoni de la Humanitat per la UNESCO."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Dendermonde","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Dendermonde_Sint-Gillislaan_84_-_126519_-_onroerenderfgoed.jpg","page_title":"Lijst van onroerend erfgoed in Dendermonde","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Dendermonde. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_Intrarea_%C3%AEn_Biseric%C4%83_din_Dobricul_L%C4%83pu%C8%99ului","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Dobricu_L%C4%83pusului_I_interior_%2826%29.JPG","page_title":"Biserica de lemn Intrarea în Biserică din Dobricul Lăpușului","context_page_description":"Biserica de lemn „Intrarea în Biserică”, sat Dobricu Lăpușului, județul Maramureș datează din anul 1701. Biserica se află pe noua listă a monumentelor istorice sub codul: MM-II-m-B-04567"},{"page_url":"https://la.wikipedia.org/wiki/Vieux-Ch%C3%A2teau","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Map_commune_FR_insee_code_21681.png","page_title":"Vieux-Château","context_page_description":"Vieux-Château est commune Francicum 100 incolarum praefecturae Clivi Aurei in regione occidentali Burgundia."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%A0%AD%E5%B1%B1%E6%BB%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Mitsuru_Toyama_at_25.jpg","page_title":"頭山滿","context_page_description":"头山满是日本在20世纪初右翼政治领袖、军商，极端国家主义秘密团体黑龙会创办人；日本人认为他是慈善家，被日本侵略国则或有多种看法。头山与孙中山、金玉均等东亚的有志改革者颇为友好，支持革命党建立中华民国。"},{"page_url":"https://fr.wikipedia.org/wiki/Indigofera_bracteolata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Indigofera_bracteolata_MS_4168.JPG","page_title":"Indigofera bracteolata","context_page_description":"Indigofera bracteolata est une espèce de plantes de la famille des Fabaceae et du genre Indigofera, présente en Afrique tropicale."},{"page_url":"https://ca.wikipedia.org/wiki/Donatello","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Donatello_e_nanni_di_banco%2C_profetini_dalla_porta_della_mandorla_new.jpg","page_title":"Donatello","context_page_description":"Donato di Niccolò di Betto Bardi o Donatello, i també Donatel·lo en català va ser un famós artista i escultor italià de principis del Renaixement. Ensems amb Leon Battista Alberti, Filippo Brunelleschi i Masaccio, són considerats els principals creadors de l'estil renaixentista. Donatello va destacar per la seva força innovadora en el camp de l'escultura monumental i en el tractament dels relleus, camp en el qual va aconseguir representar l'obra amb una gran profunditat dintre d'un pla molt simple, tècnica que s'anomenà stiacciato, és a dir, relleu pla o aplatat.\\nEl David de marbre realitzat el 1408 per a la catedral de Santa Maria del Fiore a Florència, va ser la primera obra documentada de l'artista. Durant els anys posteriors va realitzar nombroses obres en marbre, terracota, bronze i fusta per encàrrecs de diversos mecenes i governs de viles i ciutats. El 1459, retornà a Florència per realitzar unes plaques de bronze per a la Basílica de San Lorenzo, però va morir durant la seva elaboració, el dia 13 de desembre de 1466."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%A4%A9%E4%B8%BB%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Marco_palmezzano%2C_crocifissione_degli_Uffizi.jpg","page_title":"天主教","context_page_description":"天主教是基督教整体以下的宗派之一，是对罗马公教会发展而来的一系列基督教之神学、哲学理论、礼仪传统、伦理纲常等信仰体系之总括，为基督教最大宗派。其拉丁文本意为“普世的”，因此又译为公教会。另一个经常并用的名称是“大公教会”，通常用来概括基督教会的普遍特征，以用来区别狭义的、与圣座共融的公教会，即天主教会。\\n天主教的中文名称源自明朝万历年间耶稣会将基督信仰传入中国，经当朝礼部尚书之徐光启与利玛窦等耶稣会士讨论，取儒家古话“至高莫若天，至尊莫若主”，称其信仰之独一神灵为“天主”，故称之。天主教在与新教并提时亦被称为“旧教”，两者分别代表着第一个千禧年开始的“传承式信仰”、以及16世纪宗教改革开始的“书面式信仰”。这一概念曾在恢复公教传统的牛津运动提出。"},{"page_url":"https://de.wikipedia.org/wiki/Friedrich-Wilhelm-Kanal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Kaisermuehl_Friedrich_Wilhelm_Kanal.JPG","page_title":"Friedrich-Wilhelm-Kanal","context_page_description":"Der Friedrich-Wilhelm-Kanal, vorher Müllroser Kanal, war der erste Kanal, der die Oder mit der Spree verband. Von Brieskow an der Oder führte der 1668 fertiggestellte Kanal mit einer Länge von ca. 27 km bis Neuhaus an der Spree."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Tonbridge_and_Malling","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/IghthamMote-SouthSide-01.JPG","page_title":"Grade I listed buildings in Tonbridge and Malling","context_page_description":"There are over 9,000 Grade I listed buildings in England. This page is a list of these buildings in the district of Ashford in Kent."},{"page_url":"https://sv.wikipedia.org/wiki/Jytte_Hilden","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Jytte-hilden-2005.jpg","page_title":"Jytte Hilden","context_page_description":"Jytte Hilden, född Jensen 12 september 1942 i Lyngby, är en dansk socialdemokratisk politiker och före detta kulturminister och forskningsminister.\\nHilden har varit en framträdande gestalt inom dansk politik. Hon har många gånger genom sin politik och sin person blivit mycket omdebatterad och många gånger hårt kritiserad. Hon har utmärkt sig som en färgstark politiker, särskilt som kulturminister i Poul Nyrup Rasmussens regeringar, där hennes avvikande uppfattningar om vad som är kultur gick stick i stäv mot många etablerade politikers, kommentatorers och kulturpersonligheters definitioner av kulturbegreppet. Hon har även blivit kritiserad inom den danska socialdemokratin och den danska arbetarrörelsen, inte minst av Poul Nyrup Rasmussen, för sin syn på välfärdssamhället och förhållandet mellan offentliga och privata tjänster.\\nHilden är fortfarande synlig i den politiska debatten i Danmark, både som föreläsare och debattör, och även som ordförande för den centrum-vänsterinriktade tankesmedjan CEVEA."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%BB%D0%B5%D1%89%D1%83%D0%BA_%D0%86%D0%B3%D0%BE%D1%80_%D0%90%D0%BD%D0%B4%D1%80%D1%96%D0%B9%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/uk/8/8e/Avtograph2.jpg","page_title":"Олещук Ігор Андрійович","context_page_description":"Ігор Андрійович Олещук — український інженер, громадсько-політичний діяч."},{"page_url":"https://vi.wikipedia.org/wiki/Subotica","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Flag_of_Subotica%2C_Serbia.png","page_title":"Subotica","context_page_description":"Subotica là một thành phố và khu tự quản ở phía bắc Serbia, trong tỉnh tự trị Vojvodina, cách biên giới Hungary 10 km. Từng là thành phố lớn nhất tỉnh tự trị Vojvodina, hiện nay thành phố này lớn thứ nhì tỉnh, sau Novi Sad. Thành phố Subotica có diện tích km², dân số là 99.981 người. Đây là thành phố lớn thứ 5 Serbia về dân số, sau thủ đô Beograd, Novi Sad, Niš, Kragujevac. Thành phố có dân cư đa sắc tộc với người Hungary chiếm 34,99%, người Serb chiếm 27,85%, người Bunjevci chiếm 10,87%, người Croatia chiếm 10,43%. Dân số [[khu tự quản là 148.401 người. Đây là thủ phủ hành chính của quận Bắc Bačka."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%93%A5%E6%96%AF%E5%A4%A7%E9%BB%8E%E5%8A%A0%E9%83%A1%E7%B4%9A%E8%A1%8C%E6%94%BF%E5%8D%80%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Bandera_Canton_Perez_Zeledon.png","page_title":"哥斯大黎加郡級行政區列表","context_page_description":"哥斯大黎加郡級行政區列表列出哥斯大黎加共和國下轄的郡級行政區。哥斯大黎加全國共有7個省，下轄共82個郡，再下面則是區。郡級行政區是哥斯大黎加唯一以基層政權形式存在的地方政府，擁有民選的行政首長及民意代表，每四年選舉一次。\\n哥斯大黎加於1848年建立郡級行政區建制的時候共有14個郡，之後數量隨著最初的14個郡多次拆分而增加；自《4366號法令》於1969年8月頒布後，只有人口佔哥斯大黎加全國人口超過1%的地區才能建立新的郡級行政區，而最近成立的郡級行政區是里奧夸爾托德格雷西亞區，於2017年3月成立。\\n目前哥斯大黎加最大和最小的郡級行政區分別為阿拉胡埃拉省的聖卡洛斯郡和埃雷迪亞省的弗洛雷斯郡，面積分別為3,348.98平方公里和6.96平方公里；人口數最多和最少的郡級行政區則分別為聖荷西省的聖荷西郡和圖魯巴雷斯郡，人口數分別為288,054人和5,512人。"},{"page_url":"https://pl.wikipedia.org/wiki/Audrey_Hepburn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Audrey_Hepburn_and_Mel_Ferrer_1955.jpg","page_title":"Audrey Hepburn","context_page_description":"Audrey Hepburn – brytyjska aktorka filmowa, teatralna, działaczka humanitarna i filantropka. Ikona kultury popularnej, symbol seksu lat 60. XX wieku. Należała do grona najbardziej cenionych aktorek późniejszego okresu „Złotej Ery Hollywood”. W 1999 American Film Institute umieścił jej nazwisko na 3. miejscu w rankingu „największych aktorek wszech czasów”.\\nHepburn dzieciństwo i lata młodości spędziła w Belgii, Anglii i Holandii. W Amsterdamie uczyła się baletu pod kierownictwem Soni Gaskell. W 1948 przeprowadziła się do Londynu, gdzie kontynuowała naukę u Marie Rambert i występowała w chórkach w teatrach muzycznych na West Endzie. W 1951, po zagraniu mniejszych ról w kilku filmach, została dostrzeżona przez francuską pisarkę Sidonie-Gabrielle Colette. Dzięki niej zadebiutowała w opartej na motywach powieści Colette z 1944 sztuce Gigi, wystawianej na Broadwayu. Dwa lata później Hepburn zagrała główną rolę w komedii romantycznej Rzymskie wakacje, stając się pierwszą aktorką w historii uhonorowaną za swoją kreację nagrodą Akademii Filmowej, BAFTĄ oraz Złotym Globem."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%88%D8%AE%D9%88%D9%8A_%D8%B3%D9%88-15","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Su-15_Flagon.jpg","page_title":"سوخوي سو-15","context_page_description":"سوخوي سو-15 هي طائرة اعتراضية أُنتجت ابتداءً من 1965. من صناعة سوخوي. كان أول طيران لها في 30 مايو 1962. انتهت خدمتها في 1996. صنع منها 1,290 طائرة."},{"page_url":"https://nl.wikipedia.org/wiki/Reuzenklimtrompet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/CupOfGold2.JPG","page_title":"Reuzenklimtrompet","context_page_description":"De reuzenklimtrompet is een plant uit de nachtschadefamilie. Het is een snelgroeiende, tot 12 m lange klimplant, die in cultuur vaak wordt teruggesnoeid tot een struik met overhangende twijgen. Alle delen van de plant zijn giftig. De bladeren zijn afwisselend geplaatst, breed-elliptisch tot langwerpig, 5-18 x 2-9 cm groot, leerachtig, aan de bovenkant glanzend en meestal kort toegespitst.\\nDe trechtervormige bloemen zijn meestal alleenstaand. De kelk is 5-8 cm lang, vijfkantig en bestaat uit drie tot vijf slippen. De bloemkroon is 15-24 cm lang en bestaat uit grote, afgeronde, 8-15 cm brede lobben. De bloem is bij aanvang van de bloei roomwit tot lichtgeel en verkleurt tijdens de bloei naar oker tot oranje. Over het midden van de kroonslippen lopen violette of bruine banden tot diep in de bloembuis. Uit de bloembuis steken vijf meeldraden. De bloemen gaan 's avonds open waarbij ze een penetrante geur afscheiden. Dit trekt vleermuizen aan als bestuiver. De vruchten zijn ronde, tot 7 cm grote bessen waaraan de kelkbladen behouden blijven.\\nDe reuzenklimtrompet komt van nature voor in Mexico en wordt veel als sierplant aangeplant."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%91%B8%EB%91%A5_%EA%B5%AD%EC%A0%9C%EA%B3%B5%ED%95%AD_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/20180630%E6%97%A0%E5%AE%89%E5%85%A8%E9%97%A8%E7%9A%842%E5%8F%B7%E7%BA%BF%E6%B5%A6%E4%B8%9C%E5%9B%BD%E9%99%85%E6%9C%BA%E5%9C%BA%E7%AB%99.jpg","page_title":"푸둥 국제공항 역","context_page_description":"푸둥 국제공항 역은 상하이 자기부상 시범운행선과 상하이 지하철 2호선의 시종착 역으로, 2002년 12월 31일부터 영업을 시작하였다. 상하이 푸둥 국제공항 1터미널과 2터미널 사이에 위치하고 있다."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D9%88%D9%BE%D9%88%D9%84%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Roppolo_Panorama_dal_Castello.JPG","page_title":"روپولو","context_page_description":"روپولو یک کومونه در ایتالیا است که در استان بیه‌لا واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Beachbody","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/P90xgym.jpg","page_title":"Beachbody","context_page_description":"Beachbody LLC is a privately-held American multi-level marketing company that uses direct response infomercials, e-commerce, and individual sales consultants to sell home-exercise videos and dietary supplements. The company was founded in 1998 in Santa Monica, California. Their products include P90X."},{"page_url":"https://pl.wikipedia.org/wiki/Nowe_Miasto_(Toru%C5%84)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Torun_Rynek_Nowomiejski_pierzeja_pn-zach.jpg","page_title":"Nowe Miasto (Toruń)","context_page_description":"Nowe Miasto w Toruniu – najmłodsza część Zespołu Staromiejskiego w Toruniu.\\nToruń Nowe Miasto uzyskał lokację miejską w 1264 roku, zdegradowany około 1454 roku."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D1%80%D0%B0%D1%81%D0%B5%D0%B2%D0%B8%D1%87_%D0%9E%D0%BB%D1%8C%D0%B3%D0%B0_%D0%86%D0%B2%D0%B0%D0%BD%D1%96%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/OlgaTarasevich.jpg","page_title":"Тарасевич Ольга Іванівна","context_page_description":"Ольга Іванівна Тарасевич — російськомовна письменниця з Білорусі. Одна з найуспішніших письменниць Білорусі."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%81%D9%8A%D9%86%D8%A9_%D9%87%D9%88%D8%A7%D8%A6%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/USS_Shenandoah_Bau.jpg","page_title":"سفينة هوائية","context_page_description":"السفينة الهوائية مركبة هوائية أخف من الهواء. وجسم السفينة الهوائية كبير الحجم ويحتوي على غاز أخف من الهواء، وهذا الغاز هو المسؤول عن رفع السفينة الهوائية وبقائها محلقة في الهواء بنفس الطريقة التي يرتفع بها بالون الغاز. ولكن السفينة الهوائية تختلف عن المنطاد، حيث أنَّ لها محركًا يدفعها في الجو. وفي معظم السفن الهوائية معدات لتوجيه حركتها، بينما تعتمد حركة المناطيد على الرياح ولا يمكن توجيهها، ولكنها تتحرك في الاتجاه الذي تهب فيه الريح. وتختلف السفن الهوائية عن كل من الطائرة العادية والطائرة المروحية من حيث أن كلتيهما أثقل وزنا من الهواء. كما أنها تستعمل محركات ومراوح أو أجنحة لتحفظها مرفوعة.\\nظهرت السفن الهوائية في القرن التاسع عشر كأول آلات قادرة على الطيران لمسافات طويلة يقودها إنسان، وكذلك يمكن توجيهها، ولعل هذه الصفة كانت سببا في تسميتها في بعض الأحيان المناطيد الموجهة."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%BB%89%E6%94%BF%E5%85%AC%E7%BD%B2%E7%B8%BD%E9%83%A8%E5%A4%A7%E6%A8%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/ICAC_Building_Lobby_Reception.jpg","page_title":"廉政公署總部大樓","context_page_description":"廉政公署总部大楼位于香港岛北角七姊妹渣华道303号，由香港政府建筑署外判给予关善明建筑师设计，前身为民康街游乐场，东临一个加油站及渣华道321号，北望东区走廊、维多利亚港及九龙东沿海。廉政公署总部大楼为廉政公署的总部，耗资逾13亿港元兴建，于2007年12月8日启用，而本大楼曾暂借予香港海关使用至总部迁至北角为止。"},{"page_url":"https://de.wikipedia.org/wiki/Besteigung_aller_Achttausender","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Elizabeth_Hawley.jpg","page_title":"Besteigung aller Achttausender","context_page_description":"Die Besteigung aller Achttausender, also der weltweit vierzehn Berge mit einer Höhe von über 8000 Metern, gilt als besondere Herausforderung im Höhenbergsteigen. Erst 39 Menschen ist dies gelungen. Siebzehn davon schafften es ohne die Zuhilfenahme von Flaschensauerstoff, was als noch außergewöhnlichere Leistung gilt.\\nDer Erste, der alle Achttausender bestiegen hat, ist Reinhold Messner aus Südtirol. Er begann 1970 und schloss die Serie am 16. Oktober 1986 ab. Im Frühjahr 2010 reihten sich mit Oh Eun-sun aus Südkorea und Edurne Pasaban erstmals zwei Frauen in die Liste ein, gefolgt von Gerlinde Kaltenbrunner im August 2011. Die Leistung der Südkoreanerin ist allerdings umstritten; u. a. einer ihrer Gipfelerfolge wird in der Fachwelt in Frage gestellt.\\nMehrere weitere Bergsteiger haben behauptet, alle Achttausender bestiegen zu haben, jedoch werden nicht alle ihrer Besteigungen anerkannt. Wegen des teilweise massiven Einsatzes von Helfern und Hilfsmitteln wird eine Debatte über die Vergleichbarkeit bergsteigerischer Leistungen geführt."},{"page_url":"https://en.wikipedia.org/wiki/Solar_eclipse_of_February_4,_1981","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/SE1981Feb04A.png","page_title":"Solar eclipse of February 4, 1981","context_page_description":"An annular solar eclipse occurred at the Moon's descending node of the orbit on February 4–5, 1981. A solar eclipse occurs when the Moon passes between Earth and the Sun, thereby totally or partly obscuring the image of the Sun for a viewer on Earth. An annular solar eclipse occurs when the Moon's apparent diameter is smaller than the Sun's, blocking most of the Sun's light and causing the Sun to look like an annulus. An annular eclipse appears as a partial eclipse over a region of the Earth thousands of kilometres wide. This annular solar eclipse was large because the Moon covered 99.4% of the Sun, with a path width of only 25 km.\\nIt was visible in Australia, crossing over Tasmania and southern Stewart Island of New Zealand near sunrise on February 5th, and ended at sunset over western South America on February 4th. Occurring only 4 days before perigee, the moon's apparent diameter was larger.\\nThe moon's apparent diameter was 7 arcseconds smaller than the July 31, 1981 total solar eclipse."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%87%E0%AE%B0%E0%AE%BE%E0%AE%AE%E0%AE%95%E0%AE%BF%E0%AE%B0%E0%AF%81%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%BF%E0%AE%A3_%E0%AE%AE%E0%AE%9F%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Ramakrishna_Belur_Math%2C_Howrah.jpg","page_title":"இராமகிருட்டிண மடம்","context_page_description":"இராமகிருட்டிண மடம் என்பது இந்து சீர்திருத்த இயக்கங்களின் ஒரு பகுதியாகக் கருதப்படும் இராமகிருட்டிணரின் நிர்வாக சட்ட அமைப்பாகும். இது சுவாமி விவேகானந்தர் தலைமையிலான இராமகிருட்டிண பிரம்மகம்ச சன்யாசியின் சீடர்களால் 1886 ஆம் ஆண்டில் இந்தியாவில் கொல்கத்தாவுக்கு அருகிலுள்ள பராநகரில் அமைக்கப்பட்டது. இராமகிருட்டிண மடத்தின் தலைமையகம் மற்றும் அதன் இரட்டை அமைப்பான இராமகிருட்டிண இயக்கம் பேலூர் என்ற இடத்தில் உள்ளது.\\nஇராமகிருட்டிண மடம் மற்றும் இராமகிருட்டிண இயக்கம் ஆகியவை சட்டரீதியாகவும் நிதி ரீதியாகவும் தனித்தனியாக இருந்தாலும், அவை வேறு பல வழிகளில் ஒன்றோடொன்று தொடர்புடையவை. அவை இரட்டை அமைப்புகளாக கருதப்படுகிறது. இராமகிருட்டிண மடத்தின் அனைத்து கிளை மையங்களும் அறங்காவலர் குழுவின் நிர்வாக கட்டுப்பாட்டின் கீழ் வருகின்றன. அதேசமயம் இராமகிருட்டிண இயக்கத்தின் அனைத்து கிளை மையங்களும் இராமகிருட்டிண இயக்க ஆளும் குழுவின் நிர்வாக கட்டுப்பாட்டின் கீழ் வருகின்றன..\\nஇராமகிருடிண மடம் மற்றும் இராமகிருட்டிண இயக்கம் உலகம் முழுவதும் 214 மையங்களைக் கொண்டுள்ளன:\\nஇந்தியாவில் 163,\\n15 வங்காளதேசத்தில் 15,\\nஅமெரிக்காவில் 14,\\nஉருசியா மற்றும் தென்னாப்பிரிக்காவில் 2,"},{"page_url":"https://de.wikipedia.org/wiki/Ramecourt_(Vosges)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Ramecourt_bourg_2003.jpg","page_title":"Ramecourt (Vosges)","context_page_description":"Ramecourt ist eine französische Gemeinde mit 189 Einwohnern im Département Vosges in Grand Est. Sie gehört zum Arrondissement Épinal und zum Kanton Mirecourt. Die Bewohner nennen sich Ramecurtiens."},{"page_url":"https://lv.wikipedia.org/wiki/1._tramvaju_mar%C5%A1ruts_(R%C4%ABga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Tramvajs_Juglas_galapunkt%C4%81.jpg","page_title":"1. tramvaju maršruts (Rīga)","context_page_description":"1. tramvaju maršruts ir Rīgas sabiedriskā transporta tramvaju maršruts, kas kursē no Imantas apkaimes Pārdaugavā līdz Juglai.\\n1. tramvaju maršruta kopējais garums ir 36,587 km. Maršruta Imanta—Jugla kopējais garums ir 18,286 km, bet maršruta Jugla—Imanta kopējais garums ir 18,291 km.\\nDarbdienās pa maršrutu kursē 29 tramvaji, bet brīvdienās - 16 tramvaji. Šobrīd 1. tramvajs ir visgarākais un visbiežāk kursējošais tramvaja maršruts Rīgā. 1. tramvajs ir arī Rīgā visvairāk izmantotais ne tikai tramvaja, bet arī visa sabiedriskā transporta maršruts.\\n1. tramvaju maršrutu apkalpo RP SIA \\"Rīgas satiksme\\" 5. tramvaju depo.\\nMaršruts atklāts 2005. gada 1. septembrī, slēgts 2009. gada 1. septembrī, atjaunots 2017. gada 5. jūnijā. Sākumā atjaunotais maršruts pa Radio ielu kursēja tikai virzienā uz Imantu un no 2017. gada 5. jūnija līdz 2018. gada 2. martam kursēja arī pa 13. janvāra ielu, taču tagad kursē pa vēsturisko maršrutu — pa Prāgas, Centrāltirgus un Maskavas ielām, abos virzienos. Atsevišķām pieturvietām mainīti arī to nosaukumi.\\nKopš 2018. gada 3. marta virzienā uz Juglu bija ieviesta papildpietura „Aspazijas bulvāris” K. Barona ielā."},{"page_url":"https://tt.wikipedia.org/wiki/%D3%A8%D1%87_%D1%8F%D0%BF%D1%8C%D0%BB%D0%B5_%D1%81%D3%A9%D2%A3%D0%B3%D0%B5_(%D0%BA%D1%8B%D0%B5%D0%BA_%D1%81%D1%8B%D0%B7%D1%8B%D0%B3%D1%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Newton_trident.svg","page_title":"Өч япьле сөңге (кыек сызыгы)","context_page_description":"Математикада өч япьле сөңге дип ул кыек сызыклар гаиләсенең формуласы түбәндәгечә булган әгъзасы:\\nӨч япьле кыек сызыклар - x = 0, y = 1, z = 0; булганда гади икеләтә ноктасы матди проектив яссылыгында булган кубик яссы кыек сызыклар, әгәр дә без x = x\\n/\\nz итеп һәм y = 1/z итеп өч япьле сызыкның тигезләмәсенә алмаштырсак, без шундый нәтиҗәгә киләбез:\\nаның чыганагында икеләтә гади нокта бар. Өч япьле кыек сызыклар, шулай итеп, нуль төренең рациональ алгебраик кәкре сызыклары булып тора."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8C%97%E6%B8%AF%E6%9C%9D%E5%A4%A9%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/%E5%8C%97%E6%B8%AF%E6%9C%9D%E5%A4%A9%E5%AE%AE%E6%8B%9C%E6%AE%BF.jpg","page_title":"北港朝天宮","context_page_description":"北港朝天宮，俗稱北港媽祖廟，是一座位在臺灣雲林縣北港鎮的媽祖廟。\\n據信眾相傳，該廟由樹璧和尚創立於康熙三十三年。自樹壁和尚傳下17代禪宗法脈結束後，以管理委員制取代原本僧侶管理系統，但至今仍聘請佛教臨濟正宗僧侶擔任住持及駐廟法師，其管理組織財團法人北港朝天宮董監事會現任董事長為蔡詠鍀。\\n該廟在1985年被列為中華民國國定古蹟。"},{"page_url":"https://en.wikipedia.org/wiki/K%C5%A1y%C5%A1tof_Lavrinovi%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Krzysztof_Lawrynowicz_by_Augustas_Didzgalvis.jpg","page_title":"Kšyštof Lavrinovič","context_page_description":"Kšyštof Lavrinovič is a Lithuanian professional basketball player for the BC Vytis of the National Basketball League. He plays at the power forward and center positions."},{"page_url":"https://ca.wikipedia.org/wiki/Gharb-Chrarda-B%C3%A9ni_Hssen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Arbaoua.JPG","page_title":"Gharb-Chrarda-Béni Hssen","context_page_description":"Garb-Chrarda-Béni Hssen era una de les setze regions en què era organitzat el Marroc abans de la reforma administrativa de 2015. La seva capital era Kenitra. La regió està situada al nord del país, a la costa de l'oceà Atlàntic. Al nord limita amb Tànger-Tetuan, a l'est amb Taza-Al Hoceima-Taounate i al sud amb Meknès-Tafilalet i Rabat-Salé-Zemmour-Zaer. La regió té un total d'1.859.540 habitants repartits en 8.805 km².\\nEn 2015 es va fusionar amb l'antiga regió de Rabat-Salé-Zemmour-Zaer per formar la nova regió de Rabat-Salé-Kenitra."},{"page_url":"https://hu.wikipedia.org/wiki/1988","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Agnes_Szavay_Roland_Garros_2007.jpg","page_title":"1988","context_page_description":"Évszázadok: 19. század – 20. század – 21. század\\nÉvtizedek: 1930-as évek – 1940-es évek – 1950-es évek – 1960-as évek – 1970-es évek – 1980-as évek – 1990-es évek – 2000-es évek – 2010-es évek – 2020-as évek – 2030-as évek\\nÉvek: 1983 – 1984 – 1985 – 1986 – 1987 – 1988 – 1989 – 1990 – 1991 – 1992 – 1993"},{"page_url":"https://no.wikipedia.org/wiki/Werenskiold","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Sarpsborg_Skjeberg_kirke_rk_85456_IMG_7983.JPG","page_title":"Werenskiold","context_page_description":"Werenskiold er en norsk slekt som stammer fra en lagmann Werner Nielssen fra Danmark som kom til Norge. Hans tre sønner ble adlet Wærnschiold. En av de mer kjente er maleren Erik Werenskiold. En slektsbok ved Rolf Werenskjold ble utgitt i 1999.\\nTreliste\\nWerner Nielssen fra Ribe i Jylland, kom til Farsund. Gift 1662 m. rådmannsenke Ingeborg Sønnichsen. Ble 1664 rådmann i Christiania, 1667 gift med Hedvig datter av lagmann i Fredrikstad, Christen Jensen og derigjennom eier av Borregaard Hovedgård. Kjøpte i 1674 Hafslund hovedgård i Sarpsborg.\\nNiels Werenskiold til Hafslund, adlet 1697, amtmann i Smålenene 1703, g. Margrete Lobeck og Elisabeth de Tønsberg, datter av Matthias de Tønsberg, amtmann over Buskerudene\\nKaren Werenskiold g. Hartvig Huitfeldt som overtok Hafslund c. 1741. Karen solgte Hafslund i 1754 og kjøpte den danske herregård Næstved Sortebrødrekloster og ble hoffmesterinne hos Juliane Marie av Danmark og Norge.\\nSophie Huitfeldt g. general og kammerherre Fredrik Chr. Otto Wedel\\nSe Wedel-Jarlsberg for mange kjente efterkommere"},{"page_url":"https://de.wikipedia.org/wiki/Chinesische_Kunst","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/DaiJin-DenseGreenOnSpringMountains-ShanghaiMuseum-May27-08.jpg","page_title":"Chinesische Kunst","context_page_description":"Chinesische Kunst ist die Kunst, die ihren Ursprung im alten oder modernen China hat oder von chinesischen Künstlern ausgeübt wird, und damit ein Ausdruck der chinesischen Kultur ist."},{"page_url":"https://fr.wikipedia.org/wiki/Colonne_(architecture)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/5_pillars_from_the_inner_court_of_the_Bel_Temple_Palmyra_Syria.JPG","page_title":"Colonne (architecture)","context_page_description":"En architecture, ameublement, sculpture et ingénierie des structures, une colonne est un support vertical dont le plan est un cercle ou un polygone régulier à plus de quatre côtés. Elle se distingue du pilier et du pilastre.\\nElle est composée d'une base, d'un fût et d'un chapiteau. Dans l'architecture classique, les proportions et les ornements de ces éléments sont régis par les ordres architecturaux. Dans l'architecture antique et classique, les colonnes soutiennent souvent un portique en façade.\\nLa colonnade, quant à elle, est constituée d'une succession de colonnes."},{"page_url":"https://sv.wikipedia.org/wiki/Mattias_Beck","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/2012-12-29_Mattias_Beck_02.jpg","page_title":"Mattias Beck","context_page_description":"Mattias Beck, född 21 januari 1983 i Täby, Stockholms län, är en svensk ishockeyspelare som spelar för SC Riessersee i DEL2. Han har också spelat för AIK Ishockey i Elitserien, samt IK Oskarshamn och HV71. Han har representerat Sverige i J-VM och kommer från AIK:s årskull 1983 där bland annat elitseriespelarna Andreas Jämtin, Fredrik Hynning, Yared Hagos kommer från. Mattias Beck blev den 21 oktober 2010 utlånad till Mora IK i Hockeyallsvenskan. Den 19 juni 2014 skrev han på ett tvåårskontrakt med Södertälje SK."},{"page_url":"https://pl.wikipedia.org/wiki/Osiedle_Nowe_Winogrady_P%C3%B3%C5%82noc","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/88/Osiedle_Nowe_Winogrady_P%C3%B3%C5%82noc.png","page_title":"Osiedle Nowe Winogrady Północ","context_page_description":"Osiedle Nowe Winogrady Północ – osiedle administracyjne Poznania, obejmujące część Winograd."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B9%80%EB%B3%91%EC%98%A5_(%EB%B0%B0%EC%9A%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/%EA%B9%80%EB%B3%91%EC%98%A5_Kim_Byeong-ok_20161208.png","page_title":"김병옥 (배우)","context_page_description":"김병옥은 대한민국의 배우이다. 1983년 연극배우로 첫 데뷔를 하였고, 43세 때인 2003년 영화 《클래식》으로 영화배우로 데뷔하여 2004년 영화 《올드보이》에서 대중에 눈도장을 찍었다. 주로 청소년 관람불가 영화에서 잔혹한 악역으로 강렬한 인상을 남겼다."},{"page_url":"https://nn.wikipedia.org/wiki/Tromstun_skole","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Tromstun_Ungdomsskole_-_G1.jpg","page_title":"Tromstun skole","context_page_description":"Tromstun skole er ein ungdomsskole i Tromsdalen i Tromsø.\\nHan har rundt 420 elevar frå 8. til 10. trinn.\\nDen noverande skolebygningen stod ferdig i 2011. Den tidlegare skolebygningen var frå 1964, og blei riven då den nye skolen skulle byggjast.\\nTromstun skole held skolerevyen Tromteatret kvart år i november/desember."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BE%D0%B1%27%D1%94%D0%BA%D1%82%D1%96%D0%B2_%D0%A1%D0%B2%D1%96%D1%82%D0%BE%D0%B2%D0%BE%D1%97_%D1%81%D0%BF%D0%B0%D0%B4%D1%89%D0%B8%D0%BD%D0%B8_%D0%AE%D0%9D%D0%95%D0%A1%D0%9A%D0%9E_%D0%B2_%D0%90%D1%84%D1%80%D0%B8%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Bet_Giyorgis_church_Lalibela_01.jpg","page_title":"Список об'єктів Світової спадщини ЮНЕСКО в Африці","context_page_description":"Цей список містить об'єкти Світової спадщини ЮНЕСКО в Африці за винятком «Арабських країн».\\nУ списку станом на 2015 рік налічується 89 об'єктів. Разом це становить 8,63% від загальної кількості об'єктів Світової спадщини ЮНЕСКО.\\n48 об'єктів внесені до списку за культурними критеріями, причому 8 з них визнані шедеврами людського генія, 37 об'єктів включені за природними критеріями, 26 з них визнані природним феноменом виняткової краси і естетичної важливості і ще 4 об'єктів включені за змішаними критеріями. 17 об'єктів зі списку знаходяться під загрозою.\\nУ наведеній таблиці об'єкти розташовані за країною, а далі у хронологічному порядку їх внесення до списку Світової спадщини."},{"page_url":"https://es.wikipedia.org/wiki/Carro_de_combate","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/AH-64_Apache_060224.jpg","page_title":"Carro de combate","context_page_description":"Un carro de combate, o tanque de guerra, es un vehículo blindado de combate con tracción de orugas o ruedas, diseñado principalmente para enfrentarse a fuerzas enemigas utilizando fuego directo. Un carro de combate se caracteriza por tener armas de alto poder de fuego, un blindaje pesado, así como por un alto grado de movilidad que le permite cruzar terrenos difíciles a velocidades relativamente altas.\\nAunque los carros de combate son caros y requieren de logística, son una de las armas más temibles y versátiles del campo de batalla moderno, tanto por su capacidad de atacar a objetivos terrestres como por su valor al causar pánico en la infantería enemiga.\\nLos carros de combate son máquinas de ataque con gran potencia, raramente operan en solitario, están organizados en unidades blindadas en fuerzas combinadas. Sin tal apoyo, los carros de combate, a pesar de su blindaje y movilidad, serían vulnerables a la infantería, las minas terrestres y la artillería."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%80%D0%B0%D0%B9%D1%81%D1%8C%D0%BA%D1%96_%D0%BC%D0%BE%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Papua_new_guinea_east_sepik_province.png","page_title":"Арайські мови","context_page_description":"Арайські мови — сім'я папуаських мов, що поширена в Папуа Новій Гвінеї.\\nПоширені в північній частині центру острову Нова Гвінея на крайньому заході провінції Східний Сепік, в окрузі Амбунті і в прикордонних районах провінції Західний Сепік, між верхньою течією річки Сепік і її правою притокою Лефт-Мей. Назва «Arai family» вперше була використано у 1975 році, вона утворена на основі назви одного з населених пунктів — села Арай. Назва «Left May family» вперше була використана іншим дослідником у 1964.\\nНайближчими сусідами арайських мов є: амто-мусанські мови, мови суганга та міан, мова івам, мови абау та намія. На півночі також знаходиться річка Сепік."},{"page_url":"https://en.wikipedia.org/wiki/Culture_of_Israel","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Israeli_Wine_Bottles_007.jpg","page_title":"Culture of Israel","context_page_description":"The roots of the culture of Israel developed long before modern Israel's independence in 1948 and traces back to ancient Israel. It reflects Jewish culture, Jewish history in the diaspora, the ideology of the Zionist movement that developed in the late 19th century, as well as the history and traditions of the Arab Israeli population and ethnic minorities that live in Israel, among them Druze, Circassians, Armenians and others.\\nIsrael is the birthplace of the Jewish culture and its culture encompasses the foundations of many Jewish cultural characteristics, including philosophy, literature, poetry, art, mythology, folklore, mysticism and festivals; as well as Judaism, which was also fundamental to the creation of Christianity and Islam.\\nTel Aviv and Jerusalem are considered the main cultural hubs of Israel. The New York Times has described Tel Aviv as the \\"capital of Mediterranean cool,\\" Lonely Planet ranked it as a top ten city for nightlife, and National Geographic named it one of the top ten beach cities.\\nWith over 200 museums, Israel has the highest number of museums per capita in the world, with millions of visitors annually."},{"page_url":"https://nl.wikipedia.org/wiki/Proosdij_(Deventer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Zijkant_Deventer_Proosdij.jpg","page_title":"Proosdij (Deventer)","context_page_description":"De Proosdij in Deventer is het oudste nog bestaande stenen woonhuis in Nederland. Uit bouwhistorisch onderzoek is gebleken dat de oudste kern van het gebouw dateert van rond het jaar 1130 en is opgetrokken uit trachiet en tufsteen, steensoorten die aangevoerd werden vanuit de Eifel. Op de tweede verdieping zijn aan de kopgevel de restanten aanwezig van drie Romaanse vensters. Het huis is gelegen aan de Sandrasteeg en de Stromarkt, in de kern van de oude stad Deventer."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%85%D8%B3%D8%A7%D8%AC%D8%AF_%D8%A5%D9%8A%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/The_dome_of_zirdeh_masq.jpg","page_title":"قائمة مساجد إيران","context_page_description":"في عام 2015، تشير التقديرات الرسمية إلى وجود 47291 مسجد شيعي و10344 مسجد سني في إيران."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D8%A7%D8%AF_%D8%A5%D9%86%D8%B4%D8%A7%D8%A6%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Stress_v_strain_Aluminum_2.png","page_title":"مواد إنشائية","context_page_description":"تعتمد الهندسة الإنشائية على معرفة المواد وخصائصها، من أجل فهم كيف تُقاوم المواد المختلفة الأحمال وتدعمها.\\nالمواد الإنشائية الشائعة هي:"},{"page_url":"https://pt.wikipedia.org/wiki/Pepe_Jeans","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Pepejeans.jpg","page_title":"Pepe Jeans","context_page_description":"Pepe jeans é uma marca de vestuário de origem britânica mas atualmente com sede em Espanha."},{"page_url":"https://vec.wikipedia.org/wiki/Sancoins","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Donjon_Jouy_Cher_mar09.JPG","page_title":"Sancoins","context_page_description":"Sancoins el xé on comun de 3 080 abitanti del departemento de Cher che el fa parte del rejon Sentro-Vałe de ła Loira in Fransa."},{"page_url":"https://sr.wikipedia.org/wiki/Oxyaeninae","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sarkastodon-bpk.jpg","page_title":"Oxyaeninae","context_page_description":"Oxyaeninae је изумрла потпородица плацентални сисара из изумрле породице Oxyaenidae, која је у периоду од касног Палеоцена до касног Еоцена настањивала подручје Европе, Азије и Сјеверне Америке. Ову породицу сисара су чинили родови Argillotherium, Dipsalidictides, Malfelis, Oxyaena, Patriofelis, Protopsalis и Sarkastodon, и парафилетски род Dipsalidictis. Стручни назив за чланове ове потпородице сисара је оксијаенини."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%85%D9%88%D8%AB_%D8%A7%D9%84%D9%82%D8%B2%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Mammuthus_Size_comparison-ar.png","page_title":"ماموث القزم","context_page_description":"ماموث القزم أو ماموث جزر القنال هو نوع منقرض من الفيل القزم ينحدر من الماموث الكولومبي من البر الرئيسي لأمريكا الشمالية. انقرض هذا النوع خلال حدث الانقراض الرباعي الذي انقرض فيه العديد من أنواع الحيوانات الضخمة بسبب الظروف المتغيرة التي لم يستطع النوع التكيف معها .حالة التقزم الجزري أو الجزري، من تحليل حديث في عام 2010، تقرر أن ماموث القزم كان في المتوسط، يبلغ طوله 1.72 م عند الكتفين و 760 كجم في الوزن، يعتبر صغير جدا من سلفه الماموث الكولومبي البالغ طوله 4.3 متر، و 9,070 كجم. تقدير آخر يعطي ارتفاع الكتف من 2.02 م ووزن 1350 كجم."},{"page_url":"https://ru.wikipedia.org/wiki/Cerbalus_aravaensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Cerbalus_aravaensis.JPG","page_title":"Cerbalus aravaensis","context_page_description":"Cerbalus aravaensis — вид аранеоморфных пауков из семейства Sparassidae, найденный в 2003 году в пустынных дюнах Аравы на юге Израиля и Иордании. Размах ног может достигать 14 сантиметров. Длина тела самок около 3 см, самцы немного меньше. Карапакс песочного, светло-серого или желтоватого цвета густо покрыт волосками. Брюшко кремового цвета без рисунка.\\nПауки активны в основном летом и только ночью, скрываясь днём в различных укрытиях."},{"page_url":"https://de.wikipedia.org/wiki/Swiss_und_die_Andern","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Swiss_%28Rapper%29.jpg","page_title":"Swiss und die Andern","context_page_description":"Swiss und die Andern ist eine deutsche Punkrock-Band mit Crossover-Einflüssen aus Hamburg. Die Formation besteht aus dem Frontmann Swiss, sowie dem Bassisten Matze Grimm, dem Gitarristen Jakob Schulze, dem Schlagzeuger Tobias Gerth und dem DJ Da Wizard. Der Stil der Gruppe ist dabei stark von politischen Themen beeinflusst."},{"page_url":"https://et.wikipedia.org/wiki/P%C3%B5hjala_tehas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/P%C3%B5hjala_tehas.jpg","page_title":"Põhjala tehas","context_page_description":"Eesti Kummitööstus O/Ü Põhjala oli aastatel 1924–1998 Kopli poolsaarel tegutsenud tööstusettevõte. Alates 2018. aastast on Põhjala tehas eravalduses ning sellest on kujunemas kultuuri- ja kogukonnakeskus."},{"page_url":"https://en.wikipedia.org/wiki/Castleton_(village),_Vermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Castleton%2C_Vermont_%288431787881%29.jpg","page_title":"Castleton (village), Vermont","context_page_description":"Castleton is a hamlet in the town of Castleton, Rutland County, Vermont. Its population is approximately 4,000. A large portion of the village is part of the Castleton Village Historic District, listed on the National Register of Historic Places in 1979. It is also home to Castleton University, founded in 1787, and now part of the Vermont State Colleges system."},{"page_url":"https://de.wikipedia.org/wiki/Lisa_Rado","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Jf-rat-beil-lisa-rado-ffm-121.jpg","page_title":"Lisa Rado","context_page_description":"Lisa Rado war eine ungarische Theaterschauspielerin und Sängerin."},{"page_url":"https://cs.wikipedia.org/wiki/Auguste_a_Louis_Lumi%C3%A8rov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Fratelli_Lumiere.jpg","page_title":"Auguste a Louis Lumièrové","context_page_description":"Bratři Lumièrové, Auguste Marie Louis Nicholas a Louis Jean, patřili mezi první filmové tvůrce."},{"page_url":"https://hr.wikipedia.org/wiki/The_Upsetters","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Lee_Perry.jpg","page_title":"The Upsetters","context_page_description":"The Upsetters je ime house sastava jamajkanskog reggae glazbenika Leeja \\"Scratch\\" Perryja. Sastav se zove po Perrjevu nadimku Upsetter, prema njegovoj pjesmi I Am The Upsetter, glazbeni dissmissal njegovog bivšeg šefa Coxsonea Dodda.\\nSastav je postojao od 1969. do 1979. godine.\\nSastav se u početku zvao Gladdy's All-Stars, a vodio ih je pijanist Gladstone Anderson. Oni su izvorno snimili međunarodni hit \\"Live Injection\\" i \\"Return Of Django\\". Kad su ostale obveze spriječile All Starse, jedan drugi sastav, The Hippy Boys, se unovačilo za turneju po Uj. Kraljevstvu. Ova postava je ostala kao studijski sastav kojeg se najviše povezuje s imenom, koji će kasnije tvoriti jezgru pratećeg sastava Boba Marleya, The Wailers\\nU sastavu su bili gitarist Alva Lewis, orguljaš Glen Adams i braća Aston \\"Family Man\\" Barrett na bas-gitari i Carlton Barrett na bubnjevima.\\nKad su braća Barretti postali članovima Wailersa sa Bobom Marleyem 1972., Lee Perry je doveo druge vrhunske glazbenike da bi ispunili prazninu koja je nastala njihovim odlaskom. Novi Black Ark Upsetters su postali basist Boris Gardiner, Mikey Richards, Sly Dunbar, Benbow Creary, Earl \\"Chinna\\" Smith, Winston Wright i Keith Stirling."},{"page_url":"https://en.wikipedia.org/wiki/List_of_New_Hampshire_state_symbols","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/State_Tartan_of_New_Hampshire.png","page_title":"List of New Hampshire state symbols","context_page_description":"The U.S. state of New Hampshire has several official symbols."},{"page_url":"https://de.wikipedia.org/wiki/Rathaus_D%C3%BCsseldorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Old_townhall_Duesseldorf_Marktplatz_Altstadt_Duesseldorf_Germany.jpg","page_title":"Rathaus Düsseldorf","context_page_description":"Die Bau- und Nutzungsgeschichte des Rathauses der Landeshauptstadt Düsseldorf geht in den ältesten Gebäudeteilen bis auf die Jahre 1570/73 zurück. Seit dieser Zeit ist das inmitten der Altstadt und in unmittelbarer Nähe zum Rhein gelegene Rathaus durchgehend der Sitz des Stadtrates und der kommunalen Verwaltung. Bis 1806 dienten die ältesten Gebäudeteile, das alte Rathaus, auch als Versammlungsstätte der Landstände der Herzogtümer Jülich-Berg. Die Hauptzugang und die repräsentative Ansicht befinden sich auf dem vom Rathaus umschlossenen Marktplatz."},{"page_url":"https://fr.wikipedia.org/wiki/Occident_au_VIIIe_si%C3%A8cle","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Karolingische-reiterei-st-gallen-stiftsbibliothek_1-330x400.jpg","page_title":"Occident au VIIIe siècle","context_page_description":"Le VIIIᵉ siècle en Occident fait suite au VIIᵉ siècle, qui avait vu la mise en place de l'évangélisation massive des populations européennes.\\nDans l'empire Franc, le VIIIᵉ siècle est marqué par l’avènement de la dynastie Carolingienne et son expansion territoriale fulgurante, entre l'accession au pouvoir de Charles Martel jusqu'à la mort de Charlemagne.\\nC'est par cette dynastie que l'onction a été systématiquement introduite dans le sacre royal, manifestant un basculement dans la légitimité du pouvoir : de ce fait, le Roi tient son ministère de Dieu. Il a pour vocation à ce titre d'être le bras armé de l’Église dans le monde, consacrant la « conception ministérielle de la royauté ».\\nSur le plan territorial, l'empire de Charlemagne permet d'intégrer définitivement dans l'espace européen l'espace germanique et son expansion missionnaire vers l'Est.\\nAu sud, ce siècle est marqué par l'expansion de l'islam, et le début de l'occupation musulmane dans Al-Andalus, qui fait sortir la péninsule ibérique de l'occident chrétien.\\nLe mot Europe apparaît en 732, pour désigner l'espace chrétien non méditerranéen, lorsque Charles Martel le défend à la bataille de Poitiers."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BB%A5%E8%89%B2%E5%88%97","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/A_Seder_table_setting.jpg","page_title":"以色列","context_page_description":"以色列國，通稱以色列，是位於中東地區的一個主權國家，1948年5月14日獨立建國，人口900餘萬，主要人口為猶太人，以希伯來語為官方語言，通用英語。\\n以色列位於亞歐大陸交界處，自古為各民族交匯之處。其國家位處阿拉伯半島西北角、地中海東岸和紅海亞喀巴灣北岸，與巴勒斯坦領土交錯相鄰，北接黎巴嫩，東北鄰敘利亞，東與約旦接壤，西南則為埃及西奈半島。\\n以色列領土範圍不大，根據聯合國1947年巴勒斯坦分治決議，以色列面積1.52萬平方公里。經過四次中東戰爭後，以色列目前實際控制面積約2.5萬平方公里。地形和氣候相當多樣。以色列的金融及科技創新中心為特拉維夫，而耶路撒冷則為其法定首都、各政府機構所在地及其轄下的第一大城市，外國使領館駐特拉維夫。以色列對耶路撒冷的主權在國際上有爭議。\\n以色列所居領土歷史上曾為多個國家統治。包括古埃及、新亞述帝國、新巴比倫帝國、波斯帝國、希臘馬其頓帝國、哈斯蒙尼王朝、羅馬帝國、拜占庭帝國、阿拉伯帝國、十字軍、埃及馬穆魯克王朝、鄂圖曼土耳其帝國以及大英帝國。1918年，鄂圖曼帝國一戰戰敗，退出該地區，隨即阿拉伯部落紛爭。1922年，國際聯盟委託英國託管。受猶太復國主義興起和反猶主義影響，二戰後，大批猶太移民遷入。\\n1947年11月29日，聯合國大會181號決議確定支持在巴勒斯坦託管地推行分治方案，支持以巴分別成立獨立國家，耶路撒冷及其周邊地區則由國際管理。聯大決議使當時實際只控制了巴勒斯坦6%的土地和只占巴勒斯坦人口1/3的猶太人得到了巴勒斯坦地區56%的土地，而已經控制了巴勒斯坦94%的土地和占巴勒斯坦人口2/3的阿拉伯人僅得到43%的土地。\\n1948年5月14日，世界猶太復國主義組織及猶太援以協會主席戴維·本-古里安宣告「猶太國家在以色列家園建立，稱為以色列國」，將於託管期結束之時起開始運作。5月15日零時，英國對巴勒斯坦的託管終止。以色列建國次日，鄰近的阿拉伯國家便集結了軍隊發動第一次中東戰爭爭奪前巴勒斯坦託管地，與以色列軍隊交戰，後雙方戰線沿當今被稱做「綠線」處停戰。約旦占領了綠線至約旦河的地區，並於1950年宣布將其併入約旦王國，約旦認為此地所有的阿拉伯人為約旦國民。\\n此後，以色列與阿拉伯鄰國多次發生阿以衝突，以色列逐漸控制了約旦河西岸地區、西奈半島、南黎巴嫩局部地區、加薩走廊以及戈蘭高地。\\n以色列將其法律管轄範圍拓展至戈蘭高地和東耶路撒冷。根據1993年以巴簽訂的奧斯陸協議， 以色列對約旦河西岸的「B」和「C」區行使部分或完全的管轄權，「A」區則由阿拉伯人完全自治 。由於以阿雙方多年以來都未遵循或承認1947年聯大181決議劃定的以色列和巴勒斯坦國國界，衝突不斷，國際社會只能有限調解以巴衝突，至今仍未達成和平。以色列至今不承認巴勒斯坦為獨立國家，但以色列和埃及及約旦已經分別簽署和平條約。"},{"page_url":"https://lb.wikipedia.org/wiki/L%C3%ABscht_vun_de_Laureate_vum_Nobelpr%C3%A4is_fir_Chimie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Henri_Moissan.jpg","page_title":"Lëscht vun de Laureate vum Nobelpräis fir Chimie","context_page_description":"Dës Lëscht vun den Dréier vum Nobelpräis fir Chimie ass en Deel vun de Referenztabellen."},{"page_url":"https://en.wikipedia.org/wiki/Uniforms_of_the_British_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/UDR_Soldiers_-_South_Armagh.jpg","page_title":"Uniforms of the British Army","context_page_description":"The uniforms of the British Army currently exist in twelve categories ranging from ceremonial uniforms to combat dress. Uniforms in the British Army are specific to the regiment to which a soldier belongs. Full dress presents the most differentiation between units, and there are fewer regimental distinctions between ceremonial dress, service dress, barrack dress and combat dress, though a level of regimental distinction runs throughout.\\nSenior officers, of full colonel rank and above, do not wear a regimental uniform; rather, they wear their own 'staff uniform'.\\nAs a rule, the same basic design and colour of uniform is worn by all ranks of the same regiment. There are several significant uniform differences between infantry and cavalry regiments; furthermore, several features of cavalry uniform were extended to those corps and regiments deemed for historical reasons to have 'mounted status'."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Curry_County,_New_Mexico","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/First_Methodist_Church_of_Clovis%2C_NM.JPG","page_title":"National Register of Historic Places listings in Curry County, New Mexico","context_page_description":"This is a list of the National Register of Historic Places listings in Curry County, New Mexico.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Curry County, New Mexico, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 12 properties listed on the National Register in the county. All of the places within the county on the National Register are also listed on the State Register of Cultural Properties.\\nThis National Park Service list is complete through NPS recent listings posted July 24, 2020."},{"page_url":"https://pl.wikipedia.org/wiki/Ogr%C3%B3d_Zoologiczny_w_Bydgoszczy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Bdg_zoo_23_12-2014.jpg","page_title":"Ogród Zoologiczny w Bydgoszczy","context_page_description":"Ogród Zoologiczny w Bydgoszczy dawniej Ogród Fauny Polskiej – ogród zoologiczny wyspecjalizowany zwłaszcza w hodowli zwierząt krajowych. Godłem Zoo jest bocian biały na zielonym tle."},{"page_url":"https://vi.wikipedia.org/wiki/Buccinulum_vittatum_vittatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Buccinulum_vittatum_vittatum_01.JPG","page_title":"Buccinulum vittatum vittatum","context_page_description":"Buccinulum vittatum vittatum là một loài ốc biển, là động vật thân mềm chân bụng sống ở biển trong họ Buccinidae.\\nThis ốc biển is limited in distribution to New Zealand. The shell is about 25mm."},{"page_url":"https://ceb.wikipedia.org/wiki/Tracheophyta_sa_Bosniya_ug_Ersogobina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Erythronium_dens-canis_AT2.JPG","page_title":"Tracheophyta sa Bosniya ug Ersogobina","context_page_description":"Ang lista sa mga tanum nga sa Tracheophyta sa Bosniya ug Ersogobina, kauban ang gipaila nga mga species ug endemic species sa Bosnia ug Herzegovina, usa ka dili kompleto nga pagtan-aw sa mga vascular mosses, ferns ug angiospermous species species nga gikutlo sa magamit nga literatura sa Bosnian Croatian, Serbian ug Serbo-Croatian. Wala giapil sa kultura ug usahay gipaila.\\nMubo nga sulat\\nTungod sa sublisubli nga mga pagbag-o sa rolohikal nga pag-uuri ug /o ranggo sa taxonomic ug mga ngalan sa taxa nga gilakip, ang pipila niini nagpakita sa kaduha sa gilakip nga lista. Tinuod kini labi sa mga ngalan nga binomial nga ngalan nga gigamit gihapon karon."},{"page_url":"https://fr.wikipedia.org/wiki/United_States_Marine_Corps_Amphibious_Reconnaissance_Battalion","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/FMFPAC_HQ.png","page_title":"United States Marine Corps Amphibious Reconnaissance Battalion","context_page_description":"Le United States Marine Corps Amphibious Reconnaissance Battalion est une unité spécialisée du corps des Marines des États-Unis chargée d’effectuer de manière clandestine les opérations de reconnaissances dans les zones littorales et à l'intérieur du territoire ennemi nécessaire aux opérations amphibies tel le Jour J."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%87%BA%E7%81%A3%E7%B8%BD%E7%9D%A3%E5%BA%9C%E8%A9%95%E8%AD%B0%E6%9C%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Taiwan_Sotofuku_Hyogikai.jpg","page_title":"臺灣總督府評議會","context_page_description":"臺灣總督府評議會，簡稱府評，為台灣日治時期由臺灣總督府設立的法律諮詢機構，成立時間為1896年－1945年。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%92%B2%E5%AE%B6%E5%A3%AA%E7%84%A1%E9%8A%98%E9%97%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/%E6%B8%A0%E7%B8%A3%E6%BC%A2%E9%97%95%E5%8F%8A%E7%9F%B3%E7%8D%B8_46.jpg","page_title":"蒲家壪無銘闕","context_page_description":"蒲家壪無銘闕位於四川省達縣專區渠縣，文物遺址年代判定為漢代。1956年8月16日公布為四川省第一批歷史及革命文物保護單位。1980年7月7日重新公布為四川省第一批文物保護單位。2001年6月25日列為第五批全國重點文物保護單位，與馮煥闕、沈府君闕合併名稱：渠縣漢闕。\\n在渠縣月光鄉蒲家灣，距攔水橋約半里。現僅存東闕。子闕和西闕均不存在。該闕由五層石料砌成，高3.92米。第一、第二層為闕身，高2.35、寬1.08、厚0.70米。闕身正面上端浮雕展翅朱雀，西側刻含系璧之帶的龍。第三層四周皆刻頭拱，四角各刻一角神，正面中間刻獸頭。第四層後面左側刻一枝六葉，右側刻兩枝三蕊花卉。第五層是闕頂。其餘還刻人物，獸鳥圖案，表現手法和內容與沈府君闕相似。按其風格晚於沈闕，為東漢晚期建築。"},{"page_url":"https://fr.wikipedia.org/wiki/The_Woman%27s_World","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Woman%27s_World_1888_vol.jpg","page_title":"The Woman's World","context_page_description":"The Woman's World est un magazine féminin victorien publié par Cassell and Company entre 1886 et 1890, édité par Oscar Wilde entre 1887 et 1889, puis par Ella Hepworth Dixon."},{"page_url":"https://nl.wikipedia.org/wiki/Gal_(plantkunde)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Neuroterus_quercus-baccarum_2_beentree.jpg","page_title":"Gal (plantkunde)","context_page_description":"Een gal is een woekering van een plant, ontstaan door een parasiet of symbiont, meestal een insect die haar eieren in de plant legt. De gal, waarvan de vorm specifiek is voor een bepaalde parasiet, dient als behuizing en voedsel voor de larve. Er bestaan ook gallen die door schimmels worden veroorzaakt. De tak van wetenschap die zich met gallen bezighoudt wordt cecidologie genoemd. De algemeenste en best onderzochte galwesp is de Cynips quercusfolii die de bekende galappels veroorzaken.\\nNaargelang de vorm van de gal spreekt men over een beursgal, blaasgal, buidelgal, hoorngal, knobbelgal, spiraalgal.\\nTalloze soorten insecten zijn in staat om het ontstaan van een gal op een plant te induceren; daarnaast zijn er ook veel insecten die specifiek op de in de gal groeiende larven parasiteren door hun ei in de larve binnen in de gal te leggen. Het insect dat uit het gal komt, is dus niet per se de veroorzaker van dat gal.\\nEr zijn gallen van stengels, bladeren, en bloemen bekend. Men spreekt dan van bladgal, bloemgal, knopgal, meeldraadgal, schorsgal, stengelgal of wortelgal. Ze hebben lang niet allemaal de karakteristieke bolvorm van de bekende inktgallen op eikenbladeren."},{"page_url":"https://nl.wikipedia.org/wiki/Bisdom_Drohiczyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Katedra_w_Drohiczynie_1.jpg","page_title":"Bisdom Drohiczyn","context_page_description":"Het bisdom Drohiczyn is een in Polen gelegen rooms-katholiek bisdom met zetel in de stad Drohiczyn. Het bisdom behoort tot de kerkprovincie Białystok, en is samen met het bisdom Łomża suffragaan aan het aartsbisdom Białystok."},{"page_url":"https://en.wikipedia.org/wiki/River_Roach","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Roach_tq885903_stambridge.jpg","page_title":"River Roach","context_page_description":"The River Roach is a river that flows entirely through the English county of Essex. It is one of four main streams that originate in the Rayleigh Hills to the west, and flow east. They then flow towards the centre of the Rochford Basin, a circular feature which may have been caused by an asteroid impact in the Late Oligocene or Early Miocene periods. To the east of Rochford, the river becomes tidal, and is governed by the Crouch Harbour Authority. It joins the River Crouch between Wallasea Island and Foulness Island. To the west of Rochford, there is some doubt as to which of the four streams is officially the Roach.\\nAt Stambridge, there was a tidal mill from at least the 1500s, although few details are known until it was rebuilt in 1809. A pound was filled by the incoming tide, and was released to drive a water wheel as the tide fell. On spring tides, this gave around 7 hours of operation, which gradually decreased as the tides reduced, and at neap tides, the operation of the mill was entirely dependent on the flow from the upper river."},{"page_url":"https://en.wikipedia.org/wiki/Rodborough_Common,_Gloucestershire","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Orchid%2C_Rodborough_Common_-_geograph.org.uk_-_801623.jpg","page_title":"Rodborough Common, Gloucestershire","context_page_description":"Rodborough Common is a 116.0-hectare biological and geological Site of Special Scientific Interest in Gloucestershire, notified in 1954. The site is listed in the ‘Stroud District’ Local Plan, adopted November 2005, Appendix 6 as an SSSI and a Regionally Important Geological Site. The Common is also a Special Area of Conservation under the EU Habitats Directive\\nRodborough Common is sited south of Stroud and is owned and managed by the National Trust. It is north of Minchinhampton Common. It lies on Jurassic limestone and is on top of the Cotswold scarp. It is bounded on either side by the Nailsworth valley and the Frome valley. It is on a hill, and its margins are dissected by dry valleys. The sides of this plateau are steep.\\nRodborough Common, like Minchinhampton Common, is notified for its biological and geological importance. The grassland is unimproved, herb-rich and calcareous. There is an important geological area for fossils for research purposes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%B0%D1%8F_%D0%9A%D0%B0%D1%81%D0%B1%D0%B0_%D0%B2_%D0%90%D0%BB%D0%B6%D0%B8%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Algiers_fishing_port.jpg","page_title":"Старая Касба в Алжире","context_page_description":"Касба́ — крепость в старой части города Алжир. Словом касба называют крепости во многих населённых пунктах Северной Африки."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Nathaniel_Hitch","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/Peters%27_tablet.jpg","page_title":"List of works by Nathaniel Hitch","context_page_description":"The Works of Nathaniel Hitch enumerates the types of projects that Nathaniel Hitch was involved in over the course of his career, roughly from 1871 to 1935.\\nHitch ran his own business, first as a sole worker and later with hired employees to assist in the execution of work. Most of his work came through business relationships that he had with architects. John Loughborough Pearson provided commissions for Hitch over the course of his career, providing more than 75% of his work."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%A4%BE%E9%A0%AD%E9%83%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/%E7%A4%BE%E9%A0%AD%E6%B8%85%E6%B0%B4%E5%B2%A9.JPG","page_title":"社頭郷","context_page_description":"社頭郷は台湾彰化県の郷。グアバ・靴下の生産が盛んである。"},{"page_url":"https://no.wikipedia.org/wiki/Steen_Andersen_Bille_(1751%E2%80%931833)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/PocockBattleOfCopenhagen.jpg","page_title":"Steen Andersen Bille (1751–1833)","context_page_description":"Steen Andersen Bille var en dansk admiral, Gehejmestatsminister og innehaver av storkors av Dannebrogordenen."},{"page_url":"https://en.wikipedia.org/wiki/721st_Tactical_Fighter_Squadron","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/450bg-2.jpg","page_title":"721st Tactical Fighter Squadron","context_page_description":"The 721st Tactical Fighter Squadron is an inactive United States Air Force unit. It was last assigned to the 450th Tactical Fighter Wing at Foster Air Force Base, Texas, where it was inactivated on 18 December 1958.\\nThe squadron was first activated as the 721st Bombardment Squadron in 1943. After training with Consolidated B-24 Liberators in the United States, it deployed to the Mediterranean Theater of Operations, where it participated in the strategic bombing campaign against Germany, earning two Distinguished Unit Citations. After V-E Day, the squadron returned to the United States and briefly trained with Boeing B-29 Superfortresses but it was inactivated following Japan's surrender.\\nThe squadron was reactivated in 1954 as the 721st Fighter-Bomber Squadron at Foster, where it was initially equipped with North American F-86 Sabres. The following year, it became one of the first units to equip with the North American F-100 Super Sabre. It continued to fly the \\"Hun\\" until it was inactivated when Foster closed."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D8%A7%D8%B1%D9%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Sharp_Head_Office.jpg","page_title":"شارپ","context_page_description":"شارپ، شرکت صنایع الکترونیکی ژاپنی مستقر در اوساکا است، که طراح و تولیدکننده طیف وسیعی از محصولات و کالاهای الکترونیکی می‌باشد.\\nاین شرکت در سال ۱۹۱۲ توسط تاکوجی هایاکاوا تأسیس شده‌است. مؤسس این شرکت، نام شارپ که تیز معنا می‌دهد را برای اشاره به اولین کالای تولیدی خود؛ مداد نوکی انتخاب نمود!\\nامروزه شرکت شارپ پس از سامسونگ، ال‌جی، سونی و پاناسونیک، به‌عنوان پنجمین تولیدکننده تلویزیون در جهان، شناخته می‌شود. این شرکت بزرگترین تولیدکننده تجهیزات اداری در جهان به‌شمار می‌آید، سهام شرکت شارپ در بازارهای بورس توکیو و بورس اوساکا معامله می‌شود."},{"page_url":"https://en.wikipedia.org/wiki/St._Matthew%27s_Church_(Seat_Pleasant,_Maryland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/St_Matthews_Church_Sept_09.JPG","page_title":"St. Matthew's Church (Seat Pleasant, Maryland)","context_page_description":"St. Matthew's Church, also known as Addison Chapel, is a historic Episcopal church located at Seat Pleasant, Prince George's County, Maryland.\\nAddison Chapel was first established in 1696 as a chapel of ease for St. John's at Broad Creek. The parish it served was one of the thirty original Maryland parishes and was named for Colonel John Addison, of Oxon Hill plantation, a leading proponent of the Anglican Church. His descendant Walter Dulaney Addison, who was for a term Chaplain of the Senate also served as rector here. It is also associated with the Pinkney, Dulany, Lowndes, and Calvert families.\\nIn 1983, the vestry voted to vacate the structure and form Holy Redeemer Episcopal Church in Landover. The chapel was not convenient to where the parishioners lived, and a covenant placed by the Maryland Historical Trust barred the installation of indoor plumbing. The Episcopal Diocese of Washington agreed to continue weekly services for another five years, which ended in 1988."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Spiro_Agnew","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Spiro_Agnew.jpg","page_title":"Spiro Agnew","context_page_description":"Spiro Agnew sī Bí-kok ê chi̍t ê chèng-tī jîn-bu̍t. I tī 1969 nî kàu 1973 nî sī Bí-kok hù-chóng-thóng."},{"page_url":"https://ca.wikipedia.org/wiki/Jorge_Garcia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Jorge_Garcia_LF.jpg","page_title":"Jorge Garcia","context_page_description":"Jorge Fernando García Meza, conegut com a Jorge Garcia és un actor estatunidenc.\\nÉs fill del metge xilè Humberto García, qui a mitjans de la dècada de 1960 va decidir partir a perfeccionar-se als Estats Units, però es va quedar allí després de formar una família.\\nJorge García va cridar l'atenció amb la seva actuació com a Hector López a la sèrie de televisió Becker, així com a la sèrie Lost amb el personatge de Hugo \\"Hurley\\" Reyes. També actua com a humorista de monòlegs. La banda musical Weezer li va dedicar l'àlbum Hurley en honor a aquest personatge i una imatge de la seva cara era la portada del disc. En alguns concerts de la gira que van realitzar per promocionar el disc, Garcia hi va participar com a cantant convidat."},{"page_url":"https://it.wikipedia.org/wiki/Taras_Petrivs%27kyj","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Verde_e_Bianco_%28Strisce%29.png","page_title":"Taras Petrivs'kyj","context_page_description":"Taras Stevanovyč Petrivs'kyj è un calciatore ucraino, difensore del Karpaty Lviv."},{"page_url":"https://es.wikipedia.org/wiki/Sabbat","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Juda_13.jpg","page_title":"Sabbat","context_page_description":"El sabbat — también escrito shabat​ o su variante en yidis, shabbos — es el séptimo día de la semana, siendo a su vez el día sagrado de la semana en el judaísmo rabínico y en el judaísmo mesiánico.​ El sabbat se observa desde el atardecer del viernes hasta la aparición de tres estrellas la noche del sábado. Según las prescripciones de la Torá, debe ser celebrado en primer lugar mediante la abstención de cualquier clase de trabajo. En el ethos judío el sabbat es una señal de la relación entre Yahveh y el pueblo judío. La celebración del sabbat está prescrita entre los Diez Mandamientos recibidos por Moisés, así como una fiesta semanal.​ Según Génesis 2:2: «vaYshbot baYom haShevi'i».​\\nEnseñaron nuestros Sabios: \\"Todo aquel que ora en la víspera del Shabat y recita el pasaje de las Escrituras, 'Y fueron acabados los cielos e la tierra' es considerado como si fuese socio del Santo, bendito sea, en la obra de la Creación...\\"\\nTalmud, Shabat 119b"},{"page_url":"https://cs.wikipedia.org/wiki/Igor_Bare%C5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Igor_Bares_01.jpg","page_title":"Igor Bareš","context_page_description":"Igor Bareš je český herec."},{"page_url":"https://ca.wikipedia.org/wiki/Diagrama_de_Venn","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Venn_diagram_cmyk.png","page_title":"Diagrama de Venn","context_page_description":"Els diagrames de Venn són il·lustracions usades en la branca de les matemàtiques i lògica de classes anomenada teoria de conjunts. Aquests diagrames es fan servir per mostrar gràficament l'agrupació de coses elements a conjunts, representant cada conjunt mitjançant un cercle o un oval. La posició relativa en el pla d'aquests cercles mostra la relació entre els conjunts. Per exemple, si els cercles dels conjunts A i B se superposen, es mostra una àrea comuna a tots dos conjunts que conté tots els elements continguts a la vegada en A i en B. Si el cercle del conjunt A apareix dins del cercle d'un altre B, és que tots els elements de A també estan continguts en B."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%88%D8%AA%D9%8A%D9%8A%D9%87_%D9%86%D9%88%D8%B1_(%D9%83%D9%8A%D8%A8%D9%83)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Authier-Nord_Quebec_location_diagram.png","page_title":"أوتييه نور (كيبك)","context_page_description":"أوتييه نور هي بلدية محلية في كيبيك تقع في كندا في Abitibi-Ouest Regional County Municipality. يقدر عدد سكانها بـ 273 نسمة ومساحتها 294.40 كم²."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%B3%D9%83%D8%B1%D8%A7%D8%AC%D9%86%D9%88%D9%84%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Vue_sur_l%27%C3%A9glise_d%27Escragnolles_depuis_la_route_Napol%C3%A9on.JPG","page_title":"إسكراجنوليس","context_page_description":"إسكراجنوليس ‏ هي بلدية تقع في إقليم الألب البحرية من منطقة بروفنس ألب كوت دازور في جنوب شرق فرنسا. تبلغ مساحة هذه المدينة 25.48، وترتفع عن سطح البحر م، يبلغ عدد سكانها 545 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Jacques Ballestra البلدية خلال فترة."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%8E%D1%85%D0%B0%D0%BB%D0%B5%D0%BF%D0%B0_(%D0%B2%D0%BE%D0%BB%D0%BE%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Puhalepa_vald_location.png","page_title":"Пюхалепа (волость)","context_page_description":"Пюхалепа — волость в Естонії, у складі повіту Гіюмаа."},{"page_url":"https://en.wikipedia.org/wiki/2015%E2%80%9316_South_Carolina_Gamecocks_men%27s_basketball_team","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/20150401_MCDAAG_P._J._Dozier_dunk_%283%29.JPG","page_title":"2015–16 South Carolina Gamecocks men's basketball team","context_page_description":"The 2015–16 South Carolina Gamecocks men's basketball team represented the University of South Carolina during the 2015–16 NCAA Division I men's basketball season. The team's head coach was Frank Martin who was in his fourth season at South Carolina. The team played their home games at Colonial Life Arena in Columbia, South Carolina as a member of the Southeastern Conference. They finished the season 25–9, 11–7 in SEC play to finish in a three-way tie for third place. They lost in the quarterfinals of the SEC Tournament to Georgia. They were invited to the National Invitation Tournament where they defeated High Point in the first round to advance to the second round where they lost to Georgia Tech."},{"page_url":"https://en.wikipedia.org/wiki/Loyola_Greyhounds_men%27s_soccer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Loyola_MD_2008_1.JPG","page_title":"Loyola Greyhounds men's soccer","context_page_description":"The Loyola Greyhounds men's soccer team represents Loyola University Maryland in NCAA Division I soccer. It became a member of the Patriot League on July 1, 2013. Previously it competed in the Metro Atlantic Athletic Conference from 1989 to 2013. To avoid ambiguity, the team is often referenced as Loyola Maryland or Loyola, as there are two other institutions named Loyola that compete at the Division I level.\\nThe team is one of the most successful athletic programs at Loyola, winning numerous MAAC Championships, consistently making NCAA Tournament appearances, and often holding national rankings in both the NSCAA/Adidas Poll as well as that of CollegeSoccerNews. In 1987 the Loyola Men's soccer team was ranked #1 in the nation going into the season. The team is currently coached by Steve Nichols, a former Greyhound standout. Prior to Nichols, the coach was Mark Mettrick, a former youth and reserve player for Manchester United, who had been at the helm since 2000 and had led the Greyhounds to four NCAA Tournament appearances, reaching the Sweet 16 in 2001."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B4%D0%B8%D0%B1%D0%B0_%D0%A2%D0%BE%D0%B2%D0%B0%D1%80%D0%B8%D1%81%D1%82%D0%B2%D0%B0_%D1%88%D0%B2%D0%B8%D0%B4%D0%BA%D0%BE%D1%97_%D0%BC%D0%B5%D0%B4%D0%B8%D1%87%D0%BD%D0%BE%D1%97_%D0%B4%D0%BE%D0%BF%D0%BE%D0%BC%D0%BE%D0%B3%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/%D0%92%D0%B5%D0%B6%D0%B0_%D0%A2%D0%A8%D0%94_%2815-01-2020%29.jpg","page_title":"Садиба Товариства швидкої медичної допомоги","context_page_description":"Садиба Товариства швидкої медичної допомоги — комплекс будівель, розташованих на Рейтарській вулиці, 22. У 1918—1919 роках тут містилися Міністерство народного здоров'я Української Держави й Міністерство народного здоров'я й опікування УНР.\\nСадиба — зразок вдалого планування медичного закладу початку ХХ сторіччя в умовах щільної забудови центральної частини Києва."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AE%AE%E5%B4%8E%E7%9C%8C%E9%81%93232%E5%8F%B7%E9%96%80%E5%B7%9D%E6%B8%AF%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Japanese_National_Route_Sign_0010.svg","page_title":"宮崎県道232号門川港線","context_page_description":"宮崎県道232号門川港線は、宮崎県東臼杵郡門川町を通る一般県道である。"},{"page_url":"https://pt.wikipedia.org/wiki/Jogos_da_Lusofonia_de_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Pavilhao_Atlantico_Lisboa.JPG","page_title":"Jogos da Lusofonia de 2009","context_page_description":"Os Jogos da Lusofonia de 2009 foram a segunda edição dos Jogos da Lusofonia, evento multiesportivo disputado pela comunidade de países de língua portuguesa representados por seus respectivos Comitês Olímpicos Nacionais. Foi realizado em Lisboa, Portugal, entre 11 e 19 de julho de 2009. O Pavilhão Atlântico foi o principal palco de competições, sendo nele realizadas a cerimônia de abertura e encerramento."},{"page_url":"https://et.wikipedia.org/wiki/Paganamaa_k%C3%BCla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/WMEE-exp2019-%28083%29_Krabi_veskivaremed.jpg","page_title":"Paganamaa küla","context_page_description":"Paganamaa on küla Võru maakonnas Rõuge vallas Eesti-Läti piiri ääres.\\nEnne Eesti omavalitsuste haldusreformi 2017. aastal kuulus küla Varstu valda.\\n2011. aasta rahvaloenduse andmetel elas külas 43 inimest. Kõik olid eestlased.\\nKüla põhjapiir kulgeb Kolga jõe ääres. Jõel asub ka Krabi Veskijärv. Järve ääres on endise Krabi veski varemed."},{"page_url":"https://ceb.wikipedia.org/wiki/Tibouchina_longifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Starr_031118-0087_Tibouchina_longifolia.jpg","page_title":"Tibouchina longifolia","context_page_description":"Espesye sa tanom nga bulak nga una nga gihulagway ni Vahl, ug nga gihatagan sa eksakto nga ngalan ni Henri Ernest Baillon ang Tibouchina longifolia. Ang Tibouchina longifolia sakop sa kahenera nga Tibouchina sa kabanay nga Melastomataceae. Usa ka matang nga nahiubos niini atong makita T. l. simulans."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D1%8B_%D0%A1%D0%A1%D0%A1%D0%A0_(1937)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/The_Soviet_Union_1937_CPA_562_stamp_%28Tupolev_ANT-6%29.jpg","page_title":"Знаки почтовой оплаты СССР (1937)","context_page_description":"Зна́ки почто́вой опла́ты СССР (1937) — перечень знаков почтовой оплаты, введённых в обращение дирекцией по изданию и экспедированию знаков почтовой оплаты Народного комиссариата связи СССР в 1937 году.\\nС февраля по декабрь 1937 года было выпущено 37 почтовых марок, в том числе 29 памятных и 8 стандартных: 6 — третьего и 2 — четвёртого стандартного выпуска СССР, для которых использовались рисунки марок предыдущего выпуска. В почтовое обращение официально поступали разновидности марок как в беззубцовом, так и в перфорированном виде. Тематика коммеморативных марок охватывала знаменательные даты, была посвящена памяти выдающихся партийных деятелей, а также архитектуре Москвы и авиации СССР."},{"page_url":"https://pl.wikipedia.org/wiki/Acharacle","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Acharacle_Free_Church_-_geograph.org.uk_-_38904.jpg","page_title":"Acharacle","context_page_description":"Acharacle – wieś na półwyspie Ardnamurchan, w Szkocji, w jednostce administracyjnej Highland."},{"page_url":"https://ms.wikipedia.org/wiki/Sekolah_Menengah_Kebangsaan_Ayer_Keroh","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Keris_Melayu.jpg","page_title":"Sekolah Menengah Kebangsaan Ayer Keroh","context_page_description":"Sekolah Menengah Kebangsaan Ayer Keroh ialah sebuah sekolah menengah harian yang dibina di Taman Tasik Utama, Ayer Keroh, Melaka. Kedudukan sekolah yang strategik memudahkan para pelajarnya kerana berdekatan dengan kemudahan-kemudahan asas."},{"page_url":"https://en.wikipedia.org/wiki/Freddy_Eastwood","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Freddy_Eastwood_-_Pre_Season_2013-14.jpg","page_title":"Freddy Eastwood","context_page_description":"Freddy Eastwood is a former professional footballer who was released by Southend United on 23 May 2014. He started his career with West Ham United and has also played for Grays Athletic, Wolverhampton Wanderers and Coventry City. He has played eleven times in his international career for Wales."},{"page_url":"https://it.wikipedia.org/wiki/Kunoy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Bus_routes_on_the_northern_islands_%28map%2C_Faroe%29.jpg","page_title":"Kunoy","context_page_description":"Kunoy è un comune delle Isole Fær Øer situato sull'omonima isola, dalla superficie poco superiore ai 35 km². Al censimento del 2016 ha una popolazione di 138 abitanti, fa parte della regione di Norðoyar e si trova tra le due isole Kalsoy e Borðoy."},{"page_url":"https://de.wikipedia.org/wiki/Benediktinerabtei_St._Mauritius_(Tholey)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Benediktinerabtei_Tholey%2C_Treppenaufgang_im_Barockgarten.JPG","page_title":"Benediktinerabtei St. Mauritius (Tholey)","context_page_description":"Die Abtei Tholey in Tholey im Saarland ist ein Benediktinerkloster im Bistum Trier und gehört der Beuroner Kongregation an. Die Abtei gilt als ältestes Kloster auf deutschem Boden und wurde 634 n. Chr. erstmals urkundlich erwähnt. Die bedeutendsten unmittelbaren Nachbarabteien waren Busendorf, Weiler-Bettnach, St. Avold, Glandern, Fraulautern, Mettlach, St. Arnual sowie Hornbach. Die benachbarten geistigen Zentren des Mittelalters waren Trier und Metz. Die heutige frühgotische Abteikirche aus dem 13. Jahrhundert zählt zu den ältesten gotischen Kirchen Deutschlands. Die Abteikirche steht unter dem Patrozinium des heiligen Mauritius. Patroziniumstag der Abteikirche ist der 22. September. Der aktuelle lateinische Wahlspruch der Abtei lautet „fides cum benignitate“."},{"page_url":"https://ca.wikipedia.org/wiki/Port_de_matr%C3%ADcula","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Ship_transom.JPG","page_title":"Port de matrícula","context_page_description":"Un port de matrícula és el port on s'ha inscrit o registrat un vaixell.\\nTots els estats que tenen un registre de vaixells poden tenir un o més ports per a les seves embarcacions, i cada embarcació només pot tenir un port de matrícula.\\nEl port de matrícula s'ha d'exhibir pintat a popa sota del nom de la nau, i també a totes les seves embarcacions salvavides, a les dues amures.\\nEl port de matrícula és un concepte jurídic. Per tant, un vaixell pot estar registrat en un port on mai no hagi recalat. És més, un port de matrícula no necessàriament és un port físic, com és el cas de ciutat de La Paz, port de matrícula de les embarcacions que enarboren pavelló bolivià en tota la hidrovia Paranà–Paraguai.\\nAlguns dels ports de matrícula dels registres més importants són: Monròvia, Panamà, Limassol."},{"page_url":"https://en.wikipedia.org/wiki/1592","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Umbrella-china2-lg.jpg","page_title":"1592","context_page_description":"1592 was a leap year starting on Wednesday of the Gregorian calendar and a leap year starting on Saturday of the Julian calendar. As of the start of 1592, the Gregorian calendar was 10 days ahead of the Julian calendar."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%A5%D5%B6%D5%A4%D5%A1%D5%B6%D5%AB_%D5%B6%D5%B5%D5%B8%D6%82%D5%A9%D5%AB_%D5%B0%D5%A1%D5%BF%D5%AF%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Baer_embryos.png","page_title":"Կենդանի նյութի հատկություններ","context_page_description":"Կենդանի նյութի հատկությունները, կենդանի էակաները խիստ բազմազան են, սակայն նրանք ունեն ընդհանուր հատկություններ, որոնք բնորոշ են տեսակի օրգանիզմներին։"},{"page_url":"https://de.wikipedia.org/wiki/Antennensplitter","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Antennensplitter2.jpg","page_title":"Antennensplitter","context_page_description":"Antennensplitter haben die Aufgabe, mehrere Hochfrequenzquellen oder -senken impedanz- und ggf. phasenrichtig mit einem Anschluss zu verbinden. Anders als bei Spannungsanpassung können bei Impedanzanpassung nicht einfach mehrere Quellen oder Senken parallel angeschlossen werden."},{"page_url":"https://it.wikipedia.org/wiki/B%C3%A1r_(Ungheria)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/HUN_B%C3%A1r_COA.jpg","page_title":"Bár (Ungheria)","context_page_description":"Bár è un comune dell'Ungheria di 557 abitanti situato nella provincia di Baranya, nella regione Transdanubio Meridionale."},{"page_url":"https://es.wikipedia.org/wiki/Grupo_electr%C3%B3geno","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/ElectricalGeneratorGasoline.JPG","page_title":"Grupo electrógeno","context_page_description":"Un grupo electrógeno es una máquina que mueve un generador eléctrico a través de un motor de combustión interna.\\nSon comúnmente utilizados cuando hay déficit en la generación de energía eléctrica de algún lugar, o cuando son frecuentes los cortes en el suministro eléctrico. Así mismo, la legislación de los diferentes países puede obligar a instalar un grupo electrógeno en lugares en los que haya grandes densidades de personas, como hospitales, centro de datos, centros comerciales, restaurantes, cárceles, edificios administrativos, etc.\\nUna de las utilidades más comunes es la de generar electricidad en aquellos lugares donde no hay suministro eléctrico. Generalmente son zonas apartadas con pocas infraestructuras y muy poco habitadas. Otro caso sería en locales de pública concurrencia: hospitales, fábricas, etc., lugares en los que la energía eléctrica de red es insuficiente y es necesaria otra fuente de energía alterna para abastecerse."},{"page_url":"https://ms.wikipedia.org/wiki/Tokokan_(astrofizik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Comets_Kick_up_Dust_in_Helix_Nebula_%28PIA09178%29.jpg","page_title":"Tokokan (astrofizik)","context_page_description":"Dalam astrofizik, tokokan adalah pengumpulan zarah menjadi objek besar oleh graviti yang menarik lebih banyak jirim, biasanya jirim bergas, kepada cakera tokokan. Kebanyakan objek astronomi, seperti galaksi, bintang dan planet, terbentuk oleh proses tokokan."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%88%D1%8B%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Stashino_01.jpg","page_title":"Сташына","context_page_description":"Ста́шына — вёска ў Беларусі, у Магілёўскім раёне Магілёўскай вобласці. Уваходзіць у склад Буйніцкага сельсавета."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Levallois-Perret","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Institut_hospitalier_franco-britannique.jpg","page_title":"Liste der Monuments historiques in Levallois-Perret","context_page_description":"Die Liste der Monuments historiques in Levallois-Perret führt die Monuments historiques in der französischen Gemeinde Levallois-Perret auf."},{"page_url":"https://id.wikipedia.org/wiki/Louis_Braille","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Braille.jpg","page_title":"Louis Braille","context_page_description":"Louis Braille adalah pencipta sistem tulisan Braille yang digunakan oleh orang-orang buta.\\nPada umur 3 tahun, Braille mengalami kecelakaan yang membuat matanya tertusuk jarum, menyebabkan kebutaan padanya. Pada tahun 1821, saat bersekolah khusus untuk penderita tuna netra, seorang prajurit bernama Charles Barbier mengunjungi sekolah tersebut dan menunjukkan suatu kode yang telah ditemukannya. Sistem tersebut dikatakan sebagai \\"tulisan malam\\". Ini dirancang khusus untuk tentara perang yang menggunakan kombinasi duabelas titik. Braille muda menyadari manfaat sistem ini. Ia pun mengembangkan sistem yang lebih sederhana dengan menggunakan enam titik. Dan tahun 1827, buku yang menggunakan enam titik tersebut, yang kemudian disebut Braille, telah diterbitkan. Sekarang, para penderita buta menggunakan metode tersebut.\\nPada 6 Januari tahun 1852, Braille meninggal dunia. Sebuah monumen besar dibangun untuknya pada tahun 1867 untuk menghormati dia."},{"page_url":"https://et.wikipedia.org/wiki/De%C5%BEnjovi_neem","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Cape_Dezhnev_USCGS_1937.PNG","page_title":"Dežnjovi neem","context_page_description":"Dežnjovi neem on neem Tšuktši poolsaare idaotsas. See on samaaegselt Venemaa, Aasia ja Euraasia kõige idapoolsem punkt. Neem asub Beringi väina rannikul. Selle vastas Sewardi poolsaare läänetipus 86 km kaugusel asub Walesi Printsi neem.\\nDežnjovi neeme geograafilised koordinaadid on 66° 05′ N, 169° 40′ W. See on isoleeritud lameda laega mäemassiiv kõrgusega kuni 741 m järskude pankadega merepoolses küljes.\\nAastani 1898 nimetati Dežnjovi neeme Vostotšnõi neemeks. Aastal 1879 nimetas Adolf Erik Nordenskiöld selle ümber vene meresõitja ning Põhja- ja Ida-Siberi uurija Semjon Dežnjovi auks, kes 1648. aastal koos Fedot Popoviga esimesena ümber neeme ringi sõitis."},{"page_url":"https://en.wikipedia.org/wiki/Osman_Niyazi_Burcu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Osman_n.jpg","page_title":"Osman Niyazi Burcu","context_page_description":"Osman Niyazi Burcu was a Turkish Kemalist politician, and a prominent member of the CHP."},{"page_url":"https://nl.wikipedia.org/wiki/Orde_van_het_Bad","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Order_of_the_Bath.jpg","page_title":"Orde van het Bad","context_page_description":"De Orde van het Bad is een Britse ridderorde."},{"page_url":"https://en.wikipedia.org/wiki/Dingle_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Liverpool_Overhead_Railway_Southern_Extension_Tunnel_%28geograph_3147375%29.jpg","page_title":"Dingle railway station","context_page_description":"Dingle railway station is a disused underground railway station located on the Liverpool Overhead Railway, at the south end of Park Road, Dingle, Liverpool. It was the only below ground station on the line. Trains accessed the station via a half-mile tunnel, bored from the cliff face at Herculaneum Dock to Park Road. It is the last remaining part of the Overhead railway, with the surface entrance still standing. The former platform and track area were in use as a garage called Roscoe Engineering until 2015."},{"page_url":"https://de.wikipedia.org/wiki/Carl_Buz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Koenig_und_Bauer_-_Firmengeschichte_und_beteiligte_Personen.jpg","page_title":"Carl Buz","context_page_description":"Carl Buz war ein deutscher Maschinenbauingenieur, Industrieller und Mitbegründer der späteren Firma „manroland“."},{"page_url":"https://sv.wikipedia.org/wiki/Mauro_Maur","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Mauro_Maur.jpg","page_title":"Mauro Maur","context_page_description":"Mauro Maur, född 8 augusti, 1958 i Trieste, Italien, är en italiensk kompositör, trumpetare, och orkesterledare."},{"page_url":"https://nn.wikipedia.org/wiki/Alle_elsker_Raymond","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Everybody_Loves_Raymond_logo.png","page_title":"Alle elsker Raymond","context_page_description":"Alle elsker Raymond er ein amerikansk fjernsynsserie i sjangeren sitcom. Ray Romano og Patricia Heaton speler hovudrollene, Ray og Debra Barone. Serien gjekk opphavleg på CBS frå 13. september 1996 til 16. mai 2005. Mange av situasjonane i serien er basert på verkelege opplevingar av Romano. Skapar og produsent Phil Rosenthal tek òg del i dette, i tillegg til dei tilsette. Hovudpersonane i serien er laust basert på Romano og Rosenthals verkelege familiemedlemmar. Serien består av ni sesongar og til saman 210 episodar."},{"page_url":"https://ca.wikipedia.org/wiki/Lahidjan","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Achasheikhzahed.jpg","page_title":"Lahidjan","context_page_description":"Lahidjan o Lahijan és una ciutat de l'Iran a la província de Gilan, capital de comtat de Lahidjan. Està construïda seguint l'arquitectura iranoeuropea i ajunta tradició i modernitat. Està situada al nord de la muntanya Dulfek, als vessants de les muntanyes Elburz meridionals, sobre terres sedimentàries dels principals rius del Gilan, incloent-hi el Sefid Rud, i a la vora del petit riu Čom-kala. És el major centre turístic del nord de l'estat i tradicional capital del Gilan oriental en les èpoques en què va tenir dinasties locals. El seu nom està format per dues paraules: lah, que vol dir 'seda' i jan o gan, que vol dir 'lloc on es troba la seda'. La llengua més corrent a la ciutat és el gilaki, però fortament influenciat pel farsi. La població el 2005 era de 61.953 habitants i el 2010 és de 162.800 habitants. Com a antiguitats de la ciutat, cal esmentar diverses tombes dels sayyids kar-kiyais."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%8B%D0%BB%D1%8C%D0%BD%D0%B8%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/RIAN_archive_590241_YCL_17th_Congress.jpg","page_title":"Мыльников, Андрей Андреевич","context_page_description":"Андре́й Андре́евич Мы́льников — советский и российский живописец, художник-монументалист, педагог, профессор. Вице-президент Российской академии художеств. Руководитель мастерской монументальной живописи и заведующий кафедрой живописи и композиции в Санкт-Петербургском институте живописи, скульптуры и архитектуры имени И. Е. Репина. Руководитель творческой мастерской монументальной живописи АХ СССР/РАХ.\\nАкадемик АХ СССР. Герой Социалистического Труда. Народный художник СССР. Лауреат Ленинской премии, Сталинской премии третьей степени, Государственной премии СССР и Государственной премии РСФСР.\\nОдин из ключевых представителей русской реалистической школы второй половины XX века. Его художественное наследие составляют монументальные росписи, панно, мозаики, эпические картины, портреты, натюрморты, пейзажи, скульптуры и графические произведения. Как педагог Мыльников внес огромный вклад в развитие и совершенствование художественного образования и подготовил более 500 учеников."},{"page_url":"https://ast.wikipedia.org/wiki/Gran_Buenos_Aires","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Calle_Italia_-_Lomas_de_Zamora.jpg","page_title":"Gran Buenos Aires","context_page_description":"El Gran Buenos Aires ye la denominación xenérica que refier a la megaciudá arxentina qu'entiende la Ciudá Autónoma de Buenos Aires y el so conurbación sobre la provincia de Buenos Aires, ensin constituyir nel so conxuntu una unidá alministrativa. Esta dase en toles direiciones posibles.\\nPer otru llau, el Gran Buenos Aires, convertir n'unu de los polos industrial y económicu más dinámicos y competitivos que tien Arxentina y Suramérica. El PIB PPA de la urbe ye de 362.000 millones de dólares, oldeándose a les economíes nacionales de Venezuela o Suecia y allugaríase nel puestu 31 d'esi añu nel ranking mundial.\\nAl pie de la ciudá de Buenos Aires, capital arxentina, forma una megalópolis, que ye la segunda aglomeración más poblada de Suramérica y del hemisferiu sur, la tercera d'América Llatina, y la quinta d'América, convirtiéndose asina nuna de les 22 mayores de too el mundu.\\nEl Gran Buenos Aires ta integráu por dos grandes zones: la ciudá de Buenos Aires puramente felicidá y el conurbano bonaerense, integráu ésti de la mesma por dellos partíos de la provincia de Buenos Aires."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%A6%D5%A1%D5%BF%D5%B8%D6%82%D5%A9%D5%B5%D5%A1%D5%B6_%D5%B0%D5%B8%D6%82%D5%B7%D5%A1%D6%80%D5%B1%D5%A1%D5%B6_(%D5%8C%D5%B8%D6%82%D5%BD%D5%A5)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Ruse_TodorBozhinov_09.08.09_%2822%29.JPG","page_title":"Ազատության հուշարձան (Ռուսե)","context_page_description":"Ազատության արձան, հուշարձան Բուլղարիայի Ռուսե քաղաքում: Նախագծվել է 20-րդ դարում իտալացի Առնոլդո Ձոկիի ու բուլղարացի Գեորգի Կիսելինչևի կողմից: Արձանը Ռուսե քաղաքի խորհրդանիշն է և պատկերված է քաղաքի գերբի վրա:"},{"page_url":"https://en.wikipedia.org/wiki/Puntigrus_partipentazona","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Puntius_partipentazona_FOWLER.jpg","page_title":"Puntigrus partipentazona","context_page_description":"Puntigrus partipentazona, the partipentazona barb, is a species of cyprinid fish native to Southeast Asia where it is found in the Mekong, Mae Klong, and Chao Phraya basins of Thailand, the Malay Peninsula, and coastal streams of southeast Thailand and Cambodia where it occurs in streams and impoundments with dense weed growth. It can also be found in the aquarium trade. It is frequently misidentified as the similar Puntigrus tetrazona.\\nThis species can reach a length of 4 centimetres SL. The fish is silver to brownish yellow with three broad black vertical stripes on the body, a fourth across the eye, and a black blotch at the base of the dorsal fin, which also has a streak of red. This streak of red is slightly brighter in males than females, which, except for the shape, is the only outward indication of sex. At first glance, the fish appears to be identical to the tiger barb. However, when compared side-to-side, it can be seen that on P. tetrazona, the middle body stripe extends completely through the dorsal fin. On P. partipentazona, the blotch on the dorsal fin is not part of any of the body stripes, the colors are brighter, and the anal fin shows red."},{"page_url":"https://lt.wikipedia.org/wiki/Alioni%C5%B3_telmologinis_draustinis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Pulimo_e%C5%BEeras_8.jpg","page_title":"Alionių telmologinis draustinis","context_page_description":"Alionių telmologinis draustinis – sau­go­ma teritorija Širvintų ir Vilniaus rajonuose, draustinis. Plotas 2096 ha. Saugomas didelis pelkėtas masyvas, turintis Aukštaičių-Sėlių moreninėms prieškalvėms būdingų bruožų. Draustinyje yra Alionių pelkės aukštapelkė, daugiau kaip 100 ha Alio ežeras. Palei Pulimo ežerą yra maža klampi žemapelkė.\\nAlionių miške peri juodasis gandras. Uolės upelio slėnyje rasta didelė paprastojo kardelio augavietė. Draustinis įsteigtas 1974 m."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A0%E1%83%A3%E1%83%A1%E1%83%94%E1%83%97%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%9D%E1%83%9C%E1%83%90%E1%83%A0%E1%83%A5%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%94%E1%83%A3%E1%83%A6%E1%83%9A%E1%83%94%E1%83%94%E1%83%91%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Eudoxia_Lopukhina_as_a_nun.jpeg","page_title":"რუსეთის მონარქების მეუღლეები","context_page_description":"აქ წარმოდგენილია რუსეთის მეფეების და იმპერატორების მეუღლეების სია."},{"page_url":"https://cs.wikipedia.org/wiki/Pardubice","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Zamek_pce_2.jpg","page_title":"Pardubice","context_page_description":"Pardubice jsou univerzitní a statutární město na východě Čech, metropole Pardubického kraje s výraznou správní, obytnou, obslužnou a výrobní funkcí pardubicko-hradecké aglomerace. Leží ve východní části Polabí na soutoku řek Labe a Chrudimky, přibližně 100 kilometrů východně od Prahy a 20 km jižně od Hradce Králové v nadmořské výšce přibližně 220 metrů.\\nPardubice mají přibližně 92 tisíc obyvatel a jsou tak desátým největším městem Česka, jsou také největším městem Pardubického kraje i okresu Pardubice. Výměra území města je 82,7 km². Pardubice se dělí na 8 samosprávných městských obvodů a 20 katastrálních území. První dochovaná zmínka o existenci Pardubic pochází z roku 1295, k roku 1340 jsou už připomínány jako město. Největší rozkvět prodělaly za pánů z Pernštejna. Na konci 16. století a v 17. století nastal úpadek. Nový rozvoj města přišel od poloviny 19. století s připojením města na železnici. Vznikla zde řada průmyslových podniků jako lihovar, cukrovar, továrna na mlýnské stroje, Fantova rafinérie minerálních olejů a další. Po druhé světové válce došlo k masivní výstavbě nových čtvrtí především na okraji města a počet obyvatel se rychle zdvojnásobil."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mayors_of_Grosseto","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Loriano_Valentini_2000.jpg","page_title":"List of mayors of Grosseto","context_page_description":"The Mayor of Grosseto is an elected politician who, along with the Grosseto's City Council, is accountable for the strategic government of Grosseto in Tuscany, Italy. The current Mayor is Antonfrancesco Vivarelli Colonna, a centre-right independent, who took office on 23 June 2016."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%A2%E0%B8%81%E0%B8%B2%E0%B9%80%E0%B8%88%E0%B8%A3%E0%B8%B5%E0%B8%99%E0%B8%B2%E0%B8%A1%E0%B8%AB%E0%B8%B2%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%B4%E0%B8%99%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Catherine03.jpg","page_title":"เยกาเจรีนามหาราชินี","context_page_description":"จักรพรรดินีเยกาเจรีนาที่ 2 แห่งรัสเซีย ซึ่งทรงได้รับการถวายพระราชสมัญญาว่า \\"แคทเธอรีนมหาราชินี\\" หรือพระนามเดิมคือ โซฟี เอากุสเทอ ฟรีเดอรีเคอ แห่งอัลฮัลท์-แซบสท์ พระองค์ทรงเป็นจักรพรรดินีนาถที่เป็นที่รู้จักมากที่สุดและครองราชย์ยาวนานที่สุดของรัสเซีย ทรงขึ้นครองราชย์ตั้งแต่วันที่ 9 กรกฎาคม [แบบเก่า: 28 มิถุนายน] ค.ศ. 1762 หลังจากการรัฐประหารและการปลงพระชนม์จักรพรรดิปีเตอร์ที่ 3 พระราชสวามีของพระองค์เอง จนกระทั่งเสด็จสวรรคต การปกครองของพระองค์เป็นการอธิบายถึงการเป็น ผู้ใช้อำนาจเด็ดขาดที่ทรงเรืองปัญญา ทั้งยังทรงฟื้นฟูจักรวรรดิรัสเซียให้แข็งแกร่งและมีอาณาเขตกว้างกว่าเดิมอย่างที่ไม่เคยเป็นมาก่อน จนรัสเซียกลายมาเป็นชาติมหาอำนาจที่สำคัญมากที่สุดชาติหนึ่งในยุโรป"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%B3%E3%83%8D_(%E4%BC%81%E6%A5%AD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Advertisement_of_a_sanitary_item_by_Seiroku_Otsuka%27s_illustration_in_1963.jpg","page_title":"アンネ (企業)","context_page_description":"アンネ株式会社は、かつて存在していた、ナプキンやタンポンなどの生理用品を製造・販売する会社。1993年に東証1部上場のライオンと合併した。"}]`),L={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T